    _data = {
        [1] = {90001,"","Lu Bu","Serahkan Token Hero dan akan kubiarkan kamu hidup! ","Serahkan Token Hero dan akan kubiarkan kamu hidup! ",},
        [2] = {90001,"Lu Bu","Zhao Yun","Lu Bu, jangan sombong!","Lu Bu, jangan sombong!",},
        [3] = {90002,"","Lu Bu","Hmm! Kamu terlalu congkak, terima serangan Halberd Surga-ku!","Hmm! Kamu terlalu congkak, terima serangan Halberd Surga-ku!",},
        [4] = {90002,"","Diao Chan","Biar aku bantu, suamiku!","Biar aku bantu, suamiku!",},
        [5] = {90003,"","Sun Ce","Lu Bu, berani bertarung denganku? Aku adalah Maharaja Jiangdong, Sun Bofu! ","Lu Bu, berani bertarung denganku? Aku adalah Maharaja Jiangdong, Sun Bofu! ",},
        [6] = {90003,"","Da Qiao","Mati di Tongkat Ganda Bofu, merupakan penghormatan untuk kalian.","Mati di Tongkat Ganda Bofu, merupakan penghormatan untuk kalian.",},
        [7] = {90004,"","Zuo Ci","Hmm! Orang biasa juga ingin merebut Token Hero. Lihat jurus langitku!","Hmm! Orang biasa juga ingin merebut Token Hero. Lihat jurus langitku!",},
        [8] = {90006,"","Zhang Jiao","Hanya tentara Turban Kuning-Ku yang pantas mendapatkan Token Hero.","Hanya tentara Turban Kuning-Ku yang pantas mendapatkan Token Hero.",},
        [9] = {90006,"Zhang Jiao","Protagonis","Hmm, segerombolan orang lemah, beraninya mengaku sebagai pasukan langit!","Hmm, segerombolan orang lemah, beraninya mengaku sebagai pasukan langit!",},
        [10] = {91101,"","Guan Yu","Guan Yunchang disini! Zhang Jiao, Yu Ji, bertarunglah melawanku!","Guan Yunchang disini! Zhang Jiao, Yu Ji, bertarunglah melawanku!",},
        [11] = {91101,"Guan Yu","Zhang Jiao","Segala hal di atas bumi, semuanya di bawah kendaliku, kalian masih tidak segera menyerah?","Segala hal di atas bumi, semuanya di bawah kendaliku, kalian masih tidak segera menyerah?",},
