        [13] = {91103,"","Guan Yu","Taoist jahat, temui ajalmu!","Taoist jahat, temui ajalmu!",},
        [14] = {91104,"","Zhang Jiao","Turban Kuning… telah tiada!","Turban Kuning… telah tiada!",},
        [15] = {91104,"","Protagonis","Terima kasih atas bantuan kalian berdua!","Terima kasih atas bantuan kalian berdua!",},
        [16] = {91104,"Protagonis","Zhang Fei","Hero muda ini memiliki bakat, dia pasti berhasil! Biarkan putri tercintaku Zhang Xingcai menemani Hero berpetualang, bagaimana?","Hero muda ini memiliki bakat, dia pasti berhasil! Biarkan putri tercintaku Zhang Xingcai menemani Hero berpetualang, bagaimana?",},
        [17] = {91104,"Protagonis","Guan Yu","Pedang tidak memandang orang. Zhang Xingcai pernah berguru pada Hua Tuo, ahli dalam ilmu medis, akan sangat baik jika dia ikut bersama Hero.","Pedang tidak memandang orang. Zhang Xingcai pernah berguru pada Hua Tuo, ahli dalam ilmu medis, akan sangat baik jika dia ikut bersama Hero.",},
        [18] = {91104,"Guan Yu","Protagonis","Bagus, terima kasih untuk kalian! Aku juga sedang mencari orang baru!","Bagus, terima kasih untuk kalian! Aku juga sedang mencari orang baru!",},
        [19] = {91105,"Protagonis","Zhang Xingcai","Hormat, Tuan! #Zhang Xingcai# akan mengikuti Tuan pergi berperang dan tidak akan menyerah!","Hormat, Tuan! #Zhang Xingcai# akan mengikuti Tuan pergi berperang dan tidak akan menyerah!",},
        [20] = {2,"Protagonis","Zhang Xingcai","Tuan, kekuatan kami masih kurang, perlu #Rekrut# orang baru.","Tuan, kekuatan kami masih kurang, perlu #Rekrut# orang baru.",},
        [21] = {2,"","Protagonis","Dimana #Rekrut# orang baru?","Dimana #Rekrut# orang baru?",},
        [22] = {2,"","Zhang Xingcai","Tuan, sini ikut aku~","Tuan, sini ikut aku~",},
        [23] = {3,"Guan Yinping","Zhang Xingcai","Menyenangkan! Ternyata kakak #Guan Yinping#! Kita bisa bertarung bersama-sama!","Menyenangkan! Ternyata kakak #Guan Yinping#! Kita bisa bertarung bersama-sama!",},
        [24] = {3,"","Guan Yinping","Salam, Tuan! Guan Yinping memiliki pedang panjang, bersedia untuk membasmi segala kekacauan dunia untuk Tuan!","Salam, Tuan! Guan Yinping memiliki pedang panjang, bersedia untuk membasmi segala kekacauan dunia untuk Tuan!",},
        [25] = {3,"","Protagonis","Dia adalah putri Guan Yu! Seperti ayah, seperti anak perempuan. Tim kita menjadi lebih kuat!","Dia adalah putri Guan Yu! Seperti ayah, seperti anak perempuan. Tim kita menjadi lebih kuat!",},
        [26] = {3,"","Guan Yinping","Pedang panjangku sudah tidak sabar lagi! Tuan, mohon kirimkan aku untuk bertarung!","Pedang panjangku sudah tidak sabar lagi! Tuan, mohon kirimkan aku untuk bertarung!",},
        [27] = {4,"Guan Yinping","Zhang Xingcai","Tuan, Hero dengan gulungan #Kombol# saat bertarung bersama, dapat mengeluarkan Skill Kombo, kekuatannya tanpa batas!","Tuan, Hero dengan gulungan #Kombol# saat bertarung bersama, dapat mengeluarkan Skill Kombo, kekuatannya tanpa batas!",},
        [28] = {4,"","Guan Yinping","Tuan, saya dan kakak Xingcai memiliki #Kombo#: Bintang Bulan Perak.","Tuan, saya dan kakak Xingcai memiliki #Kombo#: Bintang Bulan Perak.",},
        [29] = {4,"","Guan Yinping","Mari kita pergi berperang, akan kugunakan #Kombo# untuk mengalahkan lawan!","Mari kita pergi berperang, akan kugunakan #Kombo# untuk mengalahkan lawan!",},
        [30] = {5,"Zhang Xingcai","Guan Yinping","Kombo yang dikeluarkan tadi sangat luar biasa, dapat menghancurkan mereka dengan seketika!","Kombo yang dikeluarkan tadi sangat luar biasa, dapat menghancurkan mereka dengan seketika!",},
        [31] = {5,"","Zhang Xingcai","Setelah Kakak Yinping #Level-up#, dia akan menjadi lebih kuat!","Setelah Kakak Yinping #Level-up#, dia akan menjadi lebih kuat!",},
        [32] = {5,"","Zhang Xingcai","Tuan, silahkan buka #Peti Peta#, ada banyak barang di dalam Harta.","Tuan, silahkan buka #Peti Peta#, ada banyak barang di dalam Harta.",},
        [33] = {6,"Guan Yinping","Zhang Xingcai","Selamat, Tuan mendapatkan #Arak# dan Perak! Anggur digunakan untuk Level-up Hero, barang bagus untuk meningkatkan CP.","Selamat, Tuan mendapatkan #Arak# dan Perak! Anggur digunakan untuk Level-up Hero, barang bagus untuk meningkatkan CP.",},
        [34] = {6,"","Guan Yinping","Tuan, #Level-up# aku untuk meningkatkan CP! Suatu hari, aku akan melampaui ayahku!","Tuan, #Level-up# aku untuk meningkatkan CP! Suatu hari, aku akan melampaui ayahku!",},
        [35] = {7,"Guan Yinping","Zhang Xingcai","Wah, kakak Guan Yinping naik ke Lv.3 dalam seketika, luar biasa!","Wah, kakak Guan Yinping naik ke Lv.3 dalam seketika, luar biasa!",},
        [36] = {7,"","Guan Yinping","Tuan, mari kita lanjutkan menyerang lawan!","Tuan, mari kita lanjutkan menyerang lawan!",},
        [37] = {91301,"","Yuan Shao","Aku adalah Nyonya Yuan dari Runan, siapa kalian?","Aku adalah Nyonya Yuan dari Runan, siapa kalian?",},
        [38] = {91301,"Yuan Shao","Protagonis","Memangnya siapa Nyonya Yuan dari Runan? Satu datang, satu mati. Dua datang, dua yang mati!","Memangnya siapa Nyonya Yuan dari Runan? Satu datang, satu mati. Dua datang, dua yang mati!",},
        [39] = {91303,"","Zhuge Liang","Menyusun strategi, menang dari ribuan mil.","Menyusun strategi, menang dari ribuan mil.",},
        [40] = {8,"Guan Yinping","Zhang Xingcai","Tuan, jika mencapai jumlah bintang tertentu pada instance utama, akan mendapat #Peti Bintang#.","Tuan, jika mencapai jumlah bintang tertentu pada instance utama, akan mendapat #Peti Bintang#.",},
        [41] = {9,"Guan Yinping","Zhang Xingcai","Selamat, Tuan mendapatkan #Pil Terobosan#! Pil Terobosan adalah barang utama untuk meningkatkan CP Hero!","Selamat, Tuan mendapatkan #Pil Terobosan#! Pil Terobosan adalah barang utama untuk meningkatkan CP Hero!",},
        [42] = {9,"","Guan Yinping","Setelah #Terobosan#, Hero akan mendapatkan talenta perang baru, kekuatan dapat meningkat dengan pesat!","Setelah #Terobosan#, Hero akan mendapatkan talenta perang baru, kekuatan dapat meningkat dengan pesat!",},
        [43] = {9,"","Zhang Xingcai","Tuan, mari coba #Terobosan#!","Tuan, mari coba #Terobosan#!",},
        [44] = {10,"Guan Yinping","Zhang Xingcai","Wow, menyenangkan! Tuan telah mencapai #Terobosan +1#, status meningkat pesat!","Wow, menyenangkan! Tuan telah mencapai #Terobosan +1#, status meningkat pesat!",},
        [45] = {10,"","Guan Yinping","Tuan, setelah #Terobosan#, skill yang awalnya menyerang 1 target akan menyerang 3 target!","Tuan, setelah #Terobosan#, skill yang awalnya menyerang 1 target akan menyerang 3 target!",},
        [46] = {10,"","Zhang Xingcai","Hebat, Tuan! Mari kita lanjutkan pencarian Token Hero!","Hebat, Tuan! Mari kita lanjutkan pencarian Token Hero!",},
        [47] = {106,"","Zhang Xingcai","Hua Xiong sangat lemah, Tuan sangat hebat! Tuanku terlihat sangat kuat setelah #Terobosan#!","Hua Xiong sangat lemah, Tuan sangat hebat! Tuanku terlihat sangat kuat setelah #Terobosan#!",},
        [48] = {106,"","Guan Yinping","Tuan, mari kita pergi menyerang Dong Zhuo!","Tuan, mari kita pergi menyerang Dong Zhuo!",},
        [49] = {91501,"Diao Chan","Dong Zhuo","Hehehe, si cantik, sini, cium aku~","Hehehe, si cantik, sini, cium aku~",},
        [50] = {91501,"Dong Zhuo","Diao Chan","Suamiku, cepat bantu aku!","Suamiku, cepat bantu aku!",},
        [51] = {91501,"Dong Zhuo","Lu Bu","Dong Zhuo penjahat tua! Serahkan nyawamu!","Dong Zhuo penjahat tua! Serahkan nyawamu!",},
        [52] = {91502,"","Dong Zhuo","Semua yang mengikutku akan sejahtera dan yang melawanku akan musnah!","Semua yang mengikutku akan sejahtera dan yang melawanku akan musnah!",},
        [53] = {13,"Protagonis","Zhang Jiao","Aku mendapat Seni Kedamaian dari Imortal Tua Nan Hua, sejak dibentuknya Jalan Kedamaian, sudah ada 360 ribu murid!","Aku mendapat Seni Kedamaian dari Imortal Tua Nan Hua, sejak dibentuknya Jalan Kedamaian, sudah ada 360 ribu murid!",},
        [54] = {13,"","Zhang Jiao","Ikuti jalan kedamaianku, untuk menyingkirkan malapetaka dan menjaga kedamaian keluarga!","Ikuti jalan kedamaianku, untuk menyingkirkan malapetaka dan menjaga kedamaian keluarga!",},
        [55] = {13,"","Protagonis","Zhang Jiao, kamu telah menipu rakyat dan menyesatkan rakyat! Jika bukan karena kekuatan #Token Hero#, kamu tidak ada apa-apanya!","Zhang Jiao, kamu telah menipu rakyat dan menyesatkan rakyat! Jika bukan karena kekuatan #Token Hero#, kamu tidak ada apa-apanya!",},
        [56] = {13,"","Zhang Jiao","Humph! Kamu tahu terlalu banyak! Rasakan kehebatan Turban Kuning!","Humph! Kamu tahu terlalu banyak! Rasakan kehebatan Turban Kuning!",},
        [57] = {202,"Zhang Xingcai","Zhang Liang","Siapa kamu, beraninya menghina pasukan langit Turban Kuning!","Siapa kamu, beraninya menghina pasukan langit Turban Kuning!",},
        [58] = {202,"","Guan Yinping","Turban Kuning menipu rakyat dan melakukan banyak kejahatan, beraninya mengaku sebagai pasukan langit! Rasakan pedang panjangku!","Turban Kuning menipu rakyat dan melakukan banyak kejahatan, beraninya mengaku sebagai pasukan langit! Rasakan pedang panjangku!",},
        [59] = {14,"Guan Yinping","Zhang Xingcai","Selamat, Tuan, setelah mengaktifkan #Gulungan Hero#, atribut dan CP meningkat!","Selamat, Tuan, setelah mengaktifkan #Gulungan Hero#, atribut dan CP meningkat!",},
        [60] = {14,"","Guan Yinping","Tuan, setiap Hero memiliki #Gulungan Hero# khusus!","Tuan, setiap Hero memiliki #Gulungan Hero# khusus!",},
        [61] = {14,"","Zhang Xingcai","Tuan, selanjutnya jangan lupa untuk mengaktifkan #Gulungan Hero#!","Tuan, selanjutnya jangan lupa untuk mengaktifkan #Gulungan Hero#!",},
        [62] = {203,"Guan Yinping","Zhang Jiao","Dinasti Han telah tiada, Turban Kuning akan bangkit. Saat tahun Jiazi, akan ada kemakmuran di dunia! Urusan dunia, aku yang mengatur!","Dinasti Han telah tiada, Turban Kuning akan bangkit. Saat tahun Jiazi, akan ada kemakmuran di dunia! Urusan dunia, aku yang mengatur!",},
        [63] = {203,"","Guan Yinping","Humph, sekelompok penjahat!","Humph, sekelompok penjahat!",},
        [64] = {203,"","Zhang Jiao","Petir dan kilat, dengarkan perintahku, berikan aku kekuatan, kumpulkan energi dunia dan sambut hukum alam yang baru!","Petir dan kilat, dengarkan perintahku, berikan aku kekuatan, kumpulkan energi dunia dan sambut hukum alam yang baru!",},
        [65] = {203,"","Guan Yinping","Banyak bicara saja, lihat ini!","Banyak bicara saja, lihat ini!",},
        [66] = {204,"Zhang Xingcai","Yu Ji","Zhang Jiao temanku, biarkan aku membantumu!","Zhang Jiao temanku, biarkan aku membantumu!",},
        [67] = {204,"","Zhang Xingcai","Darimana datangnya Taoist sebanyak ini! Seorang Zhang Jiao telah kalah, datang lagi seorang Yu Ji!","Darimana datangnya Taoist sebanyak ini! Seorang Zhang Jiao telah kalah, datang lagi seorang Yu Ji!",},
        [68] = {204,"","Cao Cao","Turban Kuning adalah musuh semua orang, Hero, aku akan membantumu!","Turban Kuning adalah musuh semua orang, Hero, aku akan membantumu!",},
        [69] = {204,"","Yu Ji","Cao Cao, Turban Kuning hanyalah rakyat miskin yang kelaparan, mengapa harus membunuh mereka?","Cao Cao, Turban Kuning hanyalah rakyat miskin yang kelaparan, mengapa harus membunuh mereka?",},
        [70] = {204,"","Yu Ji","Cao Cao, dengarkan nasihatku…","Cao Cao, dengarkan nasihatku…",},
        [71] = {204,"","Yu Ji","Kalau kamu menjadi Perdana Menteri, ingatlah ini: Jangan menindas janda atau yatim, setelah 40 tahun kamu akan mendapat hasil yang baik! Ingatlah akan hal ini!","Kalau kamu menjadi Perdana Menteri, ingatlah ini: Jangan menindas janda atau yatim, setelah 40 tahun kamu akan mendapat hasil yang baik! Ingatlah akan hal ini!",},
        [72] = {204,"","Cao Cao","Aku bisa menjadi Perdana Menteri? Kalau memang begini, Yu Ji, mengapa kamu mau membantu Turban Kuning, lebih baik ikutlah denganku!","Aku bisa menjadi Perdana Menteri? Kalau memang begini, Yu Ji, mengapa kamu mau membantu Turban Kuning, lebih baik ikutlah denganku!",},
        [73] = {204,"","Yu Ji","Kamu memang tidak pernah belajar, biarkan aku memberimu pelajaran hukum alam!","Kamu memang tidak pernah belajar, biarkan aku memberimu pelajaran hukum alam!",},
        [74] = {15,"Guan Yinping","Zhang Xingcai","Selamat, Tuan mendapatkan #Gear#!","Selamat, Tuan mendapatkan #Gear#!",},
        [75] = {15,"","Guan Yinping","Ini adalah Pedang Kuno! Pedang ini memiliki sejarah, masih digunakan banyak Hero!","Ini adalah Pedang Kuno! Pedang ini memiliki sejarah, masih digunakan banyak Hero!",},
        [76] = {15,"","Zhang Xingcai","Tuan, silahkan pakai #Senjata#!","Tuan, silahkan pakai #Senjata#!",},
        [77] = {16,"Guan Yinping","Zhang Xingcai","Tuan, di depan ada musuh yang lebih kuat, kita harus meningkatkan CP dengan #Penguatan# senjata!","Tuan, di depan ada musuh yang lebih kuat, kita harus meningkatkan CP dengan #Penguatan# senjata!",},
        [78] = {17,"Guan Yinping","Zhang Xingcai","Senjata menjadi lebih hebat setelah #Penguatan#! ATK menjadi dua kali lipat!","Senjata menjadi lebih hebat setelah #Penguatan#! ATK menjadi dua kali lipat!",},
        [79] = {17,"","Zhang Xingcai","Jadi, Tuan ingatlah untuk selalu melakukan #Penguatan# pada Senjata!","Jadi, Tuan ingatlah untuk selalu melakukan #Penguatan# pada Senjata!",},
        [80] = {17,"","Guan Yinping","Di depan ada musuh lagi, Tuan cobalah kekuatan Senjata yang sudah diberi Penguatan!","Di depan ada musuh lagi, Tuan cobalah kekuatan Senjata yang sudah diberi Penguatan!",},
        [81] = {18,"Guan Yinping","Zhang Xingcai","Kekuatan Tuan meningkat pesat, saatnya untuk memperluas tim!","Kekuatan Tuan meningkat pesat, saatnya untuk memperluas tim!",},
        [82] = {18,"","Guan Yinping","Tuan, #Paket Kombo Hero# memberikan Hero Ungu Skill Kombo, dengan bergabungnya mereka dalam tim, Tuan menjadi lebih kuat!","Tuan, #Paket Kombo Hero# memberikan Hero Ungu Skill Kombo, dengan bergabungnya mereka dalam tim, Tuan menjadi lebih kuat!",},
        [83] = {19,"Guan Yinping","Zhang Xingcai","Wow, menakjubkan, kita mendapatkan Hero Kombo baru! Mereka terlihat kuat!","Wow, menakjubkan, kita mendapatkan Hero Kombo baru! Mereka terlihat kuat!",},
        [84] = {19,"","Zhang Xingcai","Saat #Lv.9# dan #Lv.17#, posisi baru terbuka, mereka bisa dikirimkan untuk bertarung bersama Tuan!","Saat #Lv.9# dan #Lv.17#, posisi baru terbuka, mereka bisa dikirimkan untuk bertarung bersama Tuan!",},
        [85] = {19,"","Guan Yinping","Tuan, naikkan level Yinping dengan bertarung!","Tuan, naikkan level Yinping dengan bertarung!",},
        [86] = {20,"","Zhang Xingcai","Tuan, CP telah meningkat pesat, tantang Hero seluruh dunia pada #Arena#!","Tuan, CP telah meningkat pesat, tantang Hero seluruh dunia pada #Arena#!",},
        [87] = {20,"","Zhang Xingcai","Biarkan Xing Cai membawa Tuan mengunjungi #Arena#.","Biarkan Xing Cai membawa Tuan mengunjungi #Arena#.",},
        [88] = {21,"Guan Yinping","Zhang Xingcai","Tuan, dalam #Arena# ada banyak Hero, kalahkan pemain lain dan tingkatkan peringkat.","Tuan, dalam #Arena# ada banyak Hero, kalahkan pemain lain dan tingkatkan peringkat.",},
        [89] = {21,"","Guan Yinping","Tuan, setiap kali #Peringkat# naik, maka akan mendapatkan hadiah berlimpah! Semakin tinggi peringkat, hadiah juga semakin banyak.","Tuan, setiap kali #Peringkat# naik, maka akan mendapatkan hadiah berlimpah! Semakin tinggi peringkat, hadiah juga semakin banyak.",},
        [90] = {21,"","Zhang Xingcai","Tuan, mari menuju Toko Arena!","Tuan, mari menuju Toko Arena!",},
        [91] = {22,"Guan Yinping","Zhang Xingcai","Tuan, setiap kali menang di Arena, akan mendapatkan Martabat dan peringkat. Mencapai peringkat tertentu, masih akan mendapat hadiah bonus!","Tuan, setiap kali menang di Arena, akan mendapatkan Martabat dan peringkat. Mencapai peringkat tertentu, masih akan mendapat hadiah bonus!",},
        [92] = {22,"","Zhang Xingcai","Setiap kali peringkat naik akan mendapatkan hadiah Ingot banyak! Saat peringkat semakin tinggi, Martabat yang didapat setiap harinya juga bertambah.","Setiap kali peringkat naik akan mendapatkan hadiah Ingot banyak! Saat peringkat semakin tinggi, Martabat yang didapat setiap harinya juga bertambah.",},
        [93] = {22,"","Guan Yinping","Ayo! Tingkatkan terus peringkat di Arena! Aku akan membantu Tuan menjadi No. 1!","Ayo! Tingkatkan terus peringkat di Arena! Aku akan membantu Tuan menjadi No. 1!",},
        [94] = {23,"Guan Yinping","Zhang Xingcai","Tuan, kekuatan telah meningkat pesat, #Travel# telah aktif!","Tuan, kekuatan telah meningkat pesat, #Travel# telah aktif!",},
        [95] = {23,"","Guan Yinping","Sejak dahulu kala, tersebar Buku dan Simbol Militer di Daratan Tiongkok. Dengan Travel maka bisa mendapat #Harta# tersebut!","Sejak dahulu kala, tersebar Buku dan Simbol Militer di Daratan Tiongkok. Dengan Travel maka bisa mendapat #Harta# tersebut!",},
        [96] = {23,"","Zhang Xingcai","Selain Harta, Travel juga dapat mengaktifkan #Peristiwa#, dan bisa mendapat EXP besar untuk naik Level.","Selain Harta, Travel juga dapat mengaktifkan #Peristiwa#, dan bisa mendapat EXP besar untuk naik Level.",},
        [97] = {23,"","Zhang Xingcai","Tuan, ikuti Xing Cai pergi ke #Taman Persik#!","Tuan, ikuti Xing Cai pergi ke #Taman Persik#!",},
        [98] = {24,"","Guan Yinping","Tuan Shui Jing berpengetahuan dan dermawan, selama bisa menjawab pertanyaannya, kamu akan mendapat banyak Ingot!","Tuan Shui Jing berpengetahuan dan dermawan, selama bisa menjawab pertanyaannya, kamu akan mendapat banyak Ingot!",},
        [99] = {24,"","Guan Yinping","Tuan, pertanyaan ini aku bisa!","Tuan, pertanyaan ini aku bisa!",},
        [100] = {25,"Guan Yinping","Zhang Xingcai","Selamat, Tuan mendapatkan #Harta#! Ada dua macam Harta, Buku dan Simbol, Buku untuk meingkatkan Serangan, Simbol untuk meningkatkan HP.","Selamat, Tuan mendapatkan #Harta#! Ada dua macam Harta, Buku dan Simbol, Buku untuk meingkatkan Serangan, Simbol untuk meningkatkan HP.",},
        [101] = {25,"","Guan Yinping","Buku Wuzi ini adalah Buku Perang karya Wu Qi, jenderal terkenal pada masa peperangan, dapat meningkatkan CP dengan besar!","Buku Wuzi ini adalah Buku Perang karya Wu Qi, jenderal terkenal pada masa peperangan, dapat meningkatkan CP dengan besar!",},
        [102] = {25,"","Zhang Xingcai","Tuan, ikut denganku! Mari lihat Formasi dan pasang Hartanya.","Tuan, ikut denganku! Mari lihat Formasi dan pasang Hartanya.",},
        [103] = {26,"","Zhang Xingcai","Tuan, mari lakukan Penguatan Harta!","Tuan, mari lakukan Penguatan Harta!",},
        [104] = {26,"","Zhang Xingcai","Simbol dan Buku Militer dapat ditingkatkan dengan Penguatan. Setelah Penguatan, Harta akan menjadi lebih kuat.","Simbol dan Buku Militer dapat ditingkatkan dengan Penguatan. Setelah Penguatan, Harta akan menjadi lebih kuat.",},
        [105] = {27,"","Guan Yinping","Tuan, lihatlah! Setelah Penguatan Harta, CP meningkat banyak.","Tuan, lihatlah! Setelah Penguatan Harta, CP meningkat banyak.",},
        [106] = {27,"","Guan Yinping","Tuan, mari kita lanjutkan Travel dan dapatkan lebih banyak Harta!","Tuan, mari kita lanjutkan Travel dan dapatkan lebih banyak Harta!",},
        [107] = {28,"","Zhang Xingcai","Selamat, Tuan, sistem #Pangkat# telah dibuka!","Selamat, Tuan, sistem #Pangkat# telah dibuka!",},
        [108] = {28,"","Zhang Xingcai","Tuan, kekuatan Tuan sudah dikenal banyak orang, biarkan aku menunjukkan cara meningkatkan pangkat!","Tuan, kekuatan Tuan sudah dikenal banyak orang, biarkan aku menunjukkan cara meningkatkan pangkat!",},
        [109] = {29,"Guan Yinping","Zhang Xingcai","Selamat, Tuan telah naik pangkat! Pangkat dapat meningkatkan CP Hero keseluruhan, membuat Tuan menjadi lebih kuat dan menjadi juara sejati!","Selamat, Tuan telah naik pangkat! Pangkat dapat meningkatkan CP Hero keseluruhan, membuat Tuan menjadi lebih kuat dan menjadi juara sejati!",},
        [110] = {29,"","Guan Yinping","Wah, CP meningkat pesat! Yang kuat akan menjadi semakin kuat!","Wah, CP meningkat pesat! Yang kuat akan menjadi semakin kuat!",},
        [111] = {29,"","Guan Yinping","Tuan, mari kita selesaikan Stage Skenario dan melanjutkan petualangan!","Tuan, mari kita selesaikan Stage Skenario dan melanjutkan petualangan!",},
        [112] = {30,"","Zhang Xingcai","Tuan, telah dikenal seluruh dunia, bisa pergi menantang #Jalan Kejayaan# dan mendapat Gear tingkat tinggi!","Tuan, telah dikenal seluruh dunia, bisa pergi menantang #Jalan Kejayaan# dan mendapat Gear tingkat tinggi!",},
        [113] = {31,"Guan Yinping","Zhang Xingcai","Tuan, setiap level Jalan Kejayaan ada 3 tingkat, kesulitan semakin tinggi, bintang dan Besi Halus yang didapat semakin banyak!","Tuan, setiap level Jalan Kejayaan ada 3 tingkat, kesulitan semakin tinggi, bintang dan Besi Halus yang didapat semakin banyak!",},
        [114] = {31,"","Guan Yinping","Besi Halus dapat ditukar dengan Gear tingkat tinggi di Toko Gear, dengan jumlah bintang tertentu akan mendapat hadiah bonus.","Besi Halus dapat ditukar dengan Gear tingkat tinggi di Toko Gear, dengan jumlah bintang tertentu akan mendapat hadiah bonus.",},
        [115] = {31,"","Zhang Xingcai","Tuan baru saja mendapatkan Besi Halus, silahkan lihat pada Toko Gear.","Tuan baru saja mendapatkan Besi Halus, silahkan lihat pada Toko Gear.",},
        [116] = {32,"Guan Yinping","Zhang Xingcai","Selamat, Tuan mendapatkan Pedang Es! Hebat!","Selamat, Tuan mendapatkan Pedang Es! Hebat!",},
        [117] = {32,"","Zhang Xingcai","Tuan, jika ingin mendapatkan Gear hebat, ingatlah untuk menantang Jalan Kejayaan setiap hari!","Tuan, jika ingin mendapatkan Gear hebat, ingatlah untuk menantang Jalan Kejayaan setiap hari!",},
        [118] = {32,"","Guan Yinping","Tuan, Yinping ingin lebih banyak Gear tingkat tinggi! Ayo, lanjutkan Jalan Kejayaan!","Tuan, Yinping ingin lebih banyak Gear tingkat tinggi! Ayo, lanjutkan Jalan Kejayaan!",},
        [119] = {33,"Guan Yinping","Zhang Xingcai","Tuan, #Instance Harian# dibuka! Instance Harian adalah tempat yang bagus!","Tuan, #Instance Harian# dibuka! Instance Harian adalah tempat yang bagus!",},
        [120] = {33,"","Guan Yinping","Tuan, tantang Instance Harian dan dapatkan hadiah berlimpah! Perak, Pil Terobosan dan Batu Pemurnian, semua bisa meningkatkan CP!","Tuan, tantang Instance Harian dan dapatkan hadiah berlimpah! Perak, Pil Terobosan dan Batu Pemurnian, semua bisa meningkatkan CP!",},
        [121] = {33,"","Zhang Xingcai","Wow, Instance Harian sangat keren, ayo kita lihat!","Wow, Instance Harian sangat keren, ayo kita lihat!",},
        [122] = {34,"Guan Yinping","Zhang Xingcai","Tuan, tidak disarankan untuk bertarung sendiri! Sistem #Legiun# telah dibuka, ayo kita lihat!","Tuan, tidak disarankan untuk bertarung sendiri! Sistem #Legiun# telah dibuka, ayo kita lihat!",},
        [123] = {34,"","Guan Yinping","Tuan, gabung dalam Legiun, masih banyak permainan yang bisa dibuka! Cepat daftar masuk Legiun!","Tuan, gabung dalam Legiun, masih banyak permainan yang bisa dibuka! Cepat daftar masuk Legiun!",},
        [124] = {205,"Cao Cao","Protagonis","Sial! Zhang Jiao telah mati, tapi Yu Ji kabur!","Sial! Zhang Jiao telah mati, tapi Yu Ji kabur!",},
        [125] = {205,"","Cao Cao","Hero muda terlihat baik, pasti memiliki masa depan cerah! Jika pada suatu hari datang ke Luoyang, harus pergi mengunjungiku! Saat ini ada urusan, aku pergi dulu.","Hero muda terlihat baik, pasti memiliki masa depan cerah! Jika pada suatu hari datang ke Luoyang, harus pergi mengunjungiku! Saat ini ada urusan, aku pergi dulu.",},
        [126] = {205,"Protagonis","Zhang Xingcai","Tuan, ada hal tersembunyi dalam perkataan Yu Ji, tapi Cao Cao tidak menghiraukannya…","Tuan, ada hal tersembunyi dalam perkataan Yu Ji, tapi Cao Cao tidak menghiraukannya…",},
        [127] = {205,"","Zhang Xingcai","Tuan, menurutmu apakah Cao Cao adalah seorang pahlawan atau penjahat?","Tuan, menurutmu apakah Cao Cao adalah seorang pahlawan atau penjahat?",},
        [128] = {205,"","Protagonis","Ada masalah apa? Cao Cao hari ini membantuku, jika dia membutuhkanku, aku akan membantunya sepenuh tenaga.","Ada masalah apa? Cao Cao hari ini membantuku, jika dia membutuhkanku, aku akan membantunya sepenuh tenaga.",},
        [129] = {205,"","Zhang Xingcai","Tuan, ini adalah #Token Hero# yang dijatuhkan Yu Ji saat kabur!","Tuan, ini adalah #Token Hero# yang dijatuhkan Yu Ji saat kabur!",},
        [130] = {205,"","Protagonis","#Token Hero# lagi! Asyik!","#Token Hero# lagi! Asyik!",},
        [131] = {205,"","Zhang Xingcai","Tuan, kabarnya Jenderal Besar He Jin juga memiliki #Token Hero#, mari kita pergi ke Luoyang untuk mencarinya.","Tuan, kabarnya Jenderal Besar He Jin juga memiliki #Token Hero#, mari kita pergi ke Luoyang untuk mencarinya.",},
        [132] = {205,"","Protagonis","Baik, aku sedang berpikir untuk pergi ke Luoyang!","Baik, aku sedang berpikir untuk pergi ke Luoyang!",},
        [133] = {301,"Protagonis","Zhang Xingcai","Shh! Sepertinya ada rahasia.","Shh! Sepertinya ada rahasia.",},
        [134] = {301,"Protagonis","Zhang Rang","Beraninya He Jin menjebakku, lebih baik aku membunuhnya dulu!","Beraninya He Jin menjebakku, lebih baik aku membunuhnya dulu!",},
        [135] = {301,"Protagonis","Zhang Rang","Seseorang! Tipu He Jin untuk masuk ke istana dengan nama Ibu Suri dan bunuh dia!","Seseorang! Tipu He Jin untuk masuk ke istana dengan nama Ibu Suri dan bunuh dia!",},
        [136] = {301,"Zhang Xingcai","Protagonis","Lihat sosok orang itu, apakah dia seorang kasim?","Lihat sosok orang itu, apakah dia seorang kasim?",},
        [137] = {301,"Protagonis","Zhang Xingcai","Tebakan Tuan benar! Dia adalah Kasim Besar Zhang Rang, ketua Sepuluh Kasim.","Tebakan Tuan benar! Dia adalah Kasim Besar Zhang Rang, ketua Sepuluh Kasim.",},
        [138] = {301,"Protagonis","Zhang Xingcai","He Jin adalah Jenderal Besar kekaisaran dan kakak Ibu Suri He, Cao Cao dan Yuan Shao membujuk He Jin untuk membasmi kasim untuk mendapatkan kepercayaan rakyat.","He Jin adalah Jenderal Besar kekaisaran dan kakak Ibu Suri He, Cao Cao dan Yuan Shao membujuk He Jin untuk membasmi kasim untuk mendapatkan kepercayaan rakyat.",},
        [139] = {301,"Protagonis","Zhang Xingcai","Namun tidak tahu bagaimana berita ini bisa tersebar dan diketahui Zhang Rang. Jadi dia dapat merencanakan penyerangan mendadak.","Namun tidak tahu bagaimana berita ini bisa tersebar dan diketahui Zhang Rang. Jadi dia dapat merencanakan penyerangan mendadak.",},
        [140] = {301,"Zhang Xingcai","Protagonis","Ternyata adalah perselisihan antara kasim dan paman pertama!","Ternyata adalah perselisihan antara kasim dan paman pertama!",},
        [141] = {301,"Protagonis","Zhang Xingcai","Tuan, kita pergi cari He Jin, tidak bisa membiarkan Zhang Rang lebih dulu mendapatkan Token Hero.","Tuan, kita pergi cari He Jin, tidak bisa membiarkan Zhang Rang lebih dulu mendapatkan Token Hero.",},
        [142] = {302,"Zhang Xingcai","Ibu Suri He","Kalian warga sipil tidak bermoral, beraninya masuk ke dalam Aula Harumku? Penjaga, tangkap mereka!","Kalian warga sipil tidak bermoral, beraninya masuk ke dalam Aula Harumku? Penjaga, tangkap mereka!",},
        [143] = {302,"","Zhang Xingcai","Inikah Ibu Suri Han, benar-benar muda! Tapi tidak cantik-cantik juga.","Inikah Ibu Suri Han, benar-benar muda! Tapi tidak cantik-cantik juga.",},
        [144] = {302,"","Ibu Suri He","Dua pelayan sial, beraninya menghina kecantikanku, bawa mereka kemari!","Dua pelayan sial, beraninya menghina kecantikanku, bawa mereka kemari!",},
        [145] = {303,"He Jin","Zhang Xingcai","He Jin, akhirnya aku menemukanmu. Dengar-dengar kamu mendapatkan #Token Hero#?","He Jin, akhirnya aku menemukanmu. Dengar-dengar kamu mendapatkan #Token Hero#?",},
        [146] = {303,"","He Jin","Siapa kalian, beraninya masuk ke Istana Kaisar! Tangkap mereka!","Siapa kalian, beraninya masuk ke Istana Kaisar! Tangkap mereka!",},
        [147] = {303,"","Guan Yinping","Wah, akan ada pertengkaran lagi!","Wah, akan ada pertengkaran lagi!",},
        [148] = {304,"He Jin","Zhang Xingcai","He Jin, Zhang Rang sedang merencanakan pembantaian di Istana Kaisar, jangan masuk ke istana!","He Jin, Zhang Rang sedang merencanakan pembantaian di Istana Kaisar, jangan masuk ke istana!",},
        [149] = {304,"","He Jin","Kasim memegang semua kuasa, aku harus membunuh mereka, selain itu adik perempuanku masuk ke istana. Bagaimana mungkin aku meninggalkannya?","Kasim memegang semua kuasa, aku harus membunuh mereka, selain itu adik perempuanku masuk ke istana. Bagaimana mungkin aku meninggalkannya?",},
        [150] = {304,"Guan Yinping","Zhang Xingcai","He Jin meskipun keras kepala, tetapi sangat peduli dengan adik perempuannya. Sudah tahu berbahaya tapi masih memaksa masuk istana!","He Jin meskipun keras kepala, tetapi sangat peduli dengan adik perempuannya. Sudah tahu berbahaya tapi masih memaksa masuk istana!",},
        [151] = {304,"","Guan Yinping","Ayo cepat cari Zhang Rang dan membereskan para pemberontak!","Ayo cepat cari Zhang Rang dan membereskan para pemberontak!",},
        [152] = {305,"","Zhang Rang","Hahaha, He Jin, bukalah matamu dan lihatlah, sekarang siapa yang berwenang? Bukan kamu maupun aku!","Hahaha, He Jin, bukalah matamu dan lihatlah, sekarang siapa yang berwenang? Bukan kamu maupun aku!",},
        [153] = {305,"","Zhang Rang","Serigala memiliki kemenangan ketika para gembala bertengkar. Kamu memanggil Dong Zhuo ke ibukota untuk menyerangku. Tapi apakah kamu tahu siapakah Dong Zhuo sebenarnya?","Serigala memiliki kemenangan ketika para gembala bertengkar. Kamu memanggil Dong Zhuo ke ibukota untuk menyerangku. Tapi apakah kamu tahu siapakah Dong Zhuo sebenarnya?",},
        [154] = {305,"","Zhang Rang","Ha, Dong Zhuo masuk ibu kota, kekacuan dunia baru dimulai!","Ha, Dong Zhuo masuk ibu kota, kekacuan dunia baru dimulai!",},
        [155] = {305,"Zhang Rang","Zhang Xingcai","Kita terlambat satu langkah! Zhang Rang telah membunuh He Jin! Kaisar Muda disandera oleh Zhang Rang!","Kita terlambat satu langkah! Zhang Rang telah membunuh He Jin! Kaisar Muda disandera oleh Zhang Rang!",},
        [156] = {305,"","Guan Yinping","Zhang Rang, apa yang kamu inginkan dengan menyandera Kaisar Shao? Serahkan Kaisar Shao dan Token Hero, dan akan kubiarkan kamu hidup!","Zhang Rang, apa yang kamu inginkan dengan menyandera Kaisar Shao? Serahkan Kaisar Shao dan Token Hero, dan akan kubiarkan kamu hidup!",},
        [157] = {305,"","Zhang Rang","Bergantung padamu? Tanya dulu pada gunting di tanganku! Akan kubuat kalian tahu bagaimana rasanya tanpa keturunan!","Bergantung padamu? Tanya dulu pada gunting di tanganku! Akan kubuat kalian tahu bagaimana rasanya tanpa keturunan!",},
        [158] = {306,"Kaisar Shao","Zhang Rang","Sepuluh Kasim hanyalah sekelompok orang yang menyedihkan, mereka tidak memiliki apa-apa sekarang! Karena kalian sangat hebat, kalau begitu tolong lindung dengan baik Kaisar Muda!","Sepuluh Kasim hanyalah sekelompok orang yang menyedihkan, mereka tidak memiliki apa-apa sekarang! Karena kalian sangat hebat, kalau begitu tolong lindung dengan baik Kaisar Muda!",},
        [159] = {306,"Zhang Rang","Kaisar Shao","Kasim Zhang! Jangan!","Kasim Zhang! Jangan!",},
        [160] = {306,"Kaisar Shao","Zhang Rang","Mati adalah takdir, semoga Kaisar bisa menjaga diri (Zhang Rang lompat kedalam air).","Mati adalah takdir, semoga Kaisar bisa menjaga diri (Zhang Rang lompat kedalam air).",},
        [161] = {306,"Zhang Xingcai","Kaisar Shao","Bagaimanapun, terima kasih kalian telah membasmi pemberontak. #Token Hero# ini adalah tanda terima kasih, silahkan ambil.","Bagaimanapun, terima kasih kalian telah membasmi pemberontak. #Token Hero# ini adalah tanda terima kasih, silahkan ambil.",},
        [162] = {306,"Guan Yinping","Zhang Xingcai","Tuan, kekacauan Sepuluh Kasim telah reda, tapi Dong Zhuo telah masuk ibu kota! Ini adalah masalah besar!","Tuan, kekacauan Sepuluh Kasim telah reda, tapi Dong Zhuo telah masuk ibu kota! Ini adalah masalah besar!",},
        [163] = {306,"Zhang Xingcai","Guan Yinping","Terakhir kali saat Dong Zhuo dipanggil ke istana untuk membasmi Turban Kuning, dia membawa tentara Xiliang untuk merebut Token Hero dari kami. Benar-benar jahat!","Terakhir kali saat Dong Zhuo dipanggil ke istana untuk membasmi Turban Kuning, dia membawa tentara Xiliang untuk merebut Token Hero dari kami. Benar-benar jahat!",},
        [164] = {306,"Protagonis","Zhang Xingcai","Tuan, kita cari Cao Cao. Cao Cao lahir dari keluarga pejabat, memliki koneksi di Luoyang, kita lihat apakah dia memiliki cara untuk melawan Dong Zhuo.","Tuan, kita cari Cao Cao. Cao Cao lahir dari keluarga pejabat, memliki koneksi di Luoyang, kita lihat apakah dia memiliki cara untuk melawan Dong Zhuo.",},
        [165] = {306,"Protagonis","Guan Yinping","Siapa tahu masih Cao Cao memiliki petunjuk untuk #Token Hero# lainnya.","Siapa tahu masih Cao Cao memiliki petunjuk untuk #Token Hero# lainnya.",},
        [166] = {306,"Guan Yinping","Protagonis","Begini juga baik! Ayo, kita cari Cao Cao di Luoyang!","Begini juga baik! Ayo, kita cari Cao Cao di Luoyang!",},
        [167] = {401,"Protagonis","Cao Cao","Hero muda, waktu yang tepat! Setelah Dong Zhuo masuk ke ibu kota, membanggakan dirinya akan kekuatannya, mengacaukan hukum istana dan mengganggu rakyat.","Hero muda, waktu yang tepat! Setelah Dong Zhuo masuk ke ibu kota, membanggakan dirinya akan kekuatannya, mengacaukan hukum istana dan mengganggu rakyat.",},
        [168] = {401,"Protagonis","Cao Cao","Dong Zhuo ingin membunuh Yuan Shao, Yuan Shao telah kabur ke Jizhou. Sebelum dia pergi, Yuan Shao memintaku untuk mengirimkan surat pada Menteri Wang untuk berdiskusi bagaimana membasmi Dong Zhuo.","Dong Zhuo ingin membunuh Yuan Shao, Yuan Shao telah kabur ke Jizhou. Sebelum dia pergi, Yuan Shao memintaku untuk mengirimkan surat pada Menteri Wang untuk berdiskusi bagaimana membasmi Dong Zhuo.",},
        [169] = {401,"Cao Cao","Protagonis","Ayo, kita pergi! Aku juga datang untuk Dong Zhuo.","Ayo, kita pergi! Aku juga datang untuk Dong Zhuo.",},
        [170] = {401,"Cao Cao","Wang Yun","(Wang Yun menyembunyikan wajah dan menangis setelah membaca surat) Dong Zhuo melangkahi otoritas kaisar dan membuat rakyat dalam bahaya. Untuk itu aku sangat malu.","(Wang Yun menyembunyikan wajah dan menangis setelah membaca surat) Dong Zhuo melangkahi otoritas kaisar dan membuat rakyat dalam bahaya. Untuk itu aku sangat malu.",},
        [171] = {401,"Wang Yun","Cao Cao","Jangan khawatir, Tuan. Meskipun aku tidak hebat, tapi aku bersedia untuk membunuh Dong Zhuo.","Jangan khawatir, Tuan. Meskipun aku tidak hebat, tapi aku bersedia untuk membunuh Dong Zhuo.",},
        [172] = {401,"Wang Yun","Protagonis","Dong Zhuo membunuh orang tidak bersalah, jika membunuh Dong Zhuo, ajak aku juga!","Dong Zhuo membunuh orang tidak bersalah, jika membunuh Dong Zhuo, ajak aku juga!",},
        [173] = {401,"Cao Cao","Wang Yun","Dengan semangat membara kalian, aku melihat harapan untuk Dinasti Han! Tetapi Dong Zhuo berasal dari Xiliang, seperti serigala, jika kemampuan kalian tidak cukup, sama saja dengan menyerahkan nyawa.","Dengan semangat membara kalian, aku melihat harapan untuk Dinasti Han! Tetapi Dong Zhuo berasal dari Xiliang, seperti serigala, jika kemampuan kalian tidak cukup, sama saja dengan menyerahkan nyawa.",},
        [174] = {401,"Cao Cao","Wang Yun","Jika kamu bisa mengalahkanku seorang ahli di rumah besar, membuktikan kemampuanmu, aku akan memberikan Pedang Tujuh Bintang untuk membantu kalian berdua membunuh Dong Zhuo!","Jika kamu bisa mengalahkanku seorang ahli di rumah besar, membuktikan kemampuanmu, aku akan memberikan Pedang Tujuh Bintang untuk membantu kalian berdua membunuh Dong Zhuo!",},
        [175] = {401,"Cao Cao","Protagonis","Bukan masalah, seorang penjaga biasa, tidak ada apa-apanya bagiku! Tenang kakak Cao, biarkan aku melawannya!","Bukan masalah, seorang penjaga biasa, tidak ada apa-apanya bagiku! Tenang kakak Cao, biarkan aku melawannya!",},
        [176] = {402,"Cao Cao","Wang Yun","Kalian berdua memang hebat! Ini adalah Pedang Tujuh Bintang, jika berhasil, dunia pasti akan senang! ","Kalian berdua memang hebat! Ini adalah Pedang Tujuh Bintang, jika berhasil, dunia pasti akan senang! ",},
        [177] = {402,"Wang Yun","Cao Cao","Menteri Wang, tunggulah kabar baik dariku!","Menteri Wang, tunggulah kabar baik dariku!",},
        [178] = {402,"Protagonis","Cao Cao","Hero muda, saat masuk ke rumah Dong Zhuo, berpura-puralah menjadi pelayanku dan bergerak sesuai koordinasi. Jika batuk dua kali, itu tanda untuk bergerak!","Hero muda, saat masuk ke rumah Dong Zhuo, berpura-puralah menjadi pelayanku dan bergerak sesuai koordinasi. Jika batuk dua kali, itu tanda untuk bergerak!",},
        [179] = {402,"Cao Cao","Protagonis","Baik, harap tenang, Kakak Cao!","Baik, harap tenang, Kakak Cao!",},
        [180] = {403,"Cao Cao","Dong Zhuo","Mengde, hari ini ada urusan apa kemari?","Mengde, hari ini ada urusan apa kemari?",},
        [181] = {403,"Dong Zhuo","Cao Cao","Aku memiliki pedang berharga, akan kuberikan padamu. Uhuk-uhuk!","Aku memiliki pedang berharga, akan kuberikan padamu. Uhuk-uhuk!",},
        [182] = {403,"Cao Cao","Dong Zhuo","Biar kulihat! Sangat tajam, memang pedang bagus!","Biar kulihat! Sangat tajam, memang pedang bagus!",},
        [183] = {403,"Dong Zhuo","Protagonis","Kapan lagi kalau bukan sekarang! Dong Zhuo penjahat tua, matilah!","Kapan lagi kalau bukan sekarang! Dong Zhuo penjahat tua, matilah!",},
        [184] = {404,"Lu Bu","Dong Zhuo","Seseorang, ada pembunuh! Mana Fengxian anakku? Bantu aku!","Seseorang, ada pembunuh! Mana Fengxian anakku? Bantu aku!",},
        [185] = {404,"Protagonis","Lu Bu","Siapa yang berani menyakiti ayah angkatku!","Siapa yang berani menyakiti ayah angkatku!",},
        [186] = {404,"Dong Zhuo","Protagonis","Sial, jika bukan karena Lu Bu, Dong Zhuo sudah pasti mati hari ini!","Sial, jika bukan karena Lu Bu, Dong Zhuo sudah pasti mati hari ini!",},
        [187] = {404,"Protagonis","Dong Zhuo","Kamu lagi! Sebelumnya kamu yang merebut #Token Hero#! Waktu yang tepat! Fengxian anakku, bunuh mereka semua!","Kamu lagi! Sebelumnya kamu yang merebut #Token Hero#! Waktu yang tepat! Fengxian anakku, bunuh mereka semua!",},
        [188] = {404,"Protagonis","Cao Cao","Pergilah, Hero muda. Jangan melawannya!! Lu Bu sangat kuat, dan jumlah orang di rumah Dong Zhuo sangat banyak, pergilah! (Hero muda dan Cao Cao menunggang kuda dan menuju arah tenggara)","Pergilah, Hero muda. Jangan melawannya!! Lu Bu sangat kuat, dan jumlah orang di rumah Dong Zhuo sangat banyak, pergilah! (Hero muda dan Cao Cao menunggang kuda dan menuju arah tenggara)",},
        [189] = {405,"Cao Cao","Chen Gong","Aku adalah Chen Gong, Pemimpin Prefektur Zhongmou, siapa kalian?","Aku adalah Chen Gong, Pemimpin Prefektur Zhongmou, siapa kalian?",},
        [190] = {405,"Chen Gong","Cao Cao","Aku adalah pedagang yang lewat, bermarga Huangfu.","Aku adalah pedagang yang lewat, bermarga Huangfu.",},
        [191] = {405,"Cao Cao","Chen Gong","Saat aku mencari pejabat di Luoyang, aku mengenalmu sebagai Cao Cao! Perdana Menteri Dong memperlakukanmu dengan baik, mengapa ingin membunuhnya?","Saat aku mencari pejabat di Luoyang, aku mengenalmu sebagai Cao Cao! Perdana Menteri Dong memperlakukanmu dengan baik, mengapa ingin membunuhnya?",},
        [192] = {405,"Cao Cao","Chen Gong","Seseorang, masukkan kedua orang ini ke penjara, besok bawa mereka ke ibu kota untuk ditukarkan dengan hadiah.","Seseorang, masukkan kedua orang ini ke penjara, besok bawa mereka ke ibu kota untuk ditukarkan dengan hadiah.",},
        [193] = {405,"Chen Gong","Cao Cao","Bagaimana seekor burung pipit paham aspirasi angsa? Karena kamu telah mengenaliku, mari kita bertarung!","Bagaimana seekor burung pipit paham aspirasi angsa? Karena kamu telah mengenaliku, mari kita bertarung!",},
        [194] = {406,"Cao Cao","Chen Gong","Dong Zhuo telah menempatkan diri di atas Kaisar. Kita didukung oleh Dinasti Han. Tidak ada bedanya dengan binatang jika kita tidak membalaskannya! Ini hanya ujian kecil.","Dong Zhuo telah menempatkan diri di atas Kaisar. Kita didukung oleh Dinasti Han. Tidak ada bedanya dengan binatang jika kita tidak membalaskannya! Ini hanya ujian kecil.",},
        [195] = {406,"Cao Cao","Chen Gong","Kalian berdua adalah pahlawan dunia! Chen Gong bersedia meninggalkan jabatan dan mengikut kalian berdua.","Kalian berdua adalah pahlawan dunia! Chen Gong bersedia meninggalkan jabatan dan mengikut kalian berdua.",},
        [196] = {406,"Chen Gong","Cao Cao","Sangat senang bertemu dengan Hero muda sehebat ini dan juga telah membantu! Mari, hari ini kita minum-minum, hingga 300 gelas!","Sangat senang bertemu dengan Hero muda sehebat ini dan juga telah membantu! Mari, hari ini kita minum-minum, hingga 300 gelas!",},
        [197] = {406,"Chen Gong","Cao Cao","Arak tidak cukup saat teman baik bersama, mari kita bersenang-senang, bernyanyi sambil minum, oh betapa singkat hidup ini!","Arak tidak cukup saat teman baik bersama, mari kita bersenang-senang, bernyanyi sambil minum, oh betapa singkat hidup ini!",},
        [198] = {406,"Cao Cao","Protagonis","Begitu bersemangatnya, Kakak Cao, lebih baik kita beradu dan menikmati waktu yang baik ini!","Begitu bersemangatnya, Kakak Cao, lebih baik kita beradu dan menikmati waktu yang baik ini!",},
        [199] = {406,"Protagonis","Cao Cao","Baiklah, Hero muda sangat bersemangat, alu bersedia untuk bertarung!","Baiklah, Hero muda sangat bersemangat, alu bersedia untuk bertarung!",},
        [200] = {407,"Protagonis","Cao Cao","Hahaha, Hero muda memang hebat, aku mengaku kalah!","Hahaha, Hero muda memang hebat, aku mengaku kalah!",},
        [201] = {407,"","Protagonis","Sangat tersanjung. Ini adalah mimpiku untuk menjadi Hero terkuat!","Sangat tersanjung. Ini adalah mimpiku untuk menjadi Hero terkuat!",},
        [202] = {407,"","Cao Cao","Hero muda memiliki impian yang besar! #Token Hero# ini adalah hadiah untukmu, semoga impianmu segera tercapai!","Hero muda memiliki impian yang besar! #Token Hero# ini adalah hadiah untukmu, semoga impianmu segera tercapai!",},
        [203] = {407,"","Protagonis","Terima kasih! Kakak Cao, apa rencana selanjutnya?","Terima kasih! Kakak Cao, apa rencana selanjutnya?",},
        [204] = {407,"","Cao Cao","Aku akan kembali ke Chenliu dan merekrut pasukan lagi, lalu meminta bantuan para pangeran untuk menyerang Dong Zhuo!","Aku akan kembali ke Chenliu dan merekrut pasukan lagi, lalu meminta bantuan para pangeran untuk menyerang Dong Zhuo!",},
        [205] = {407,"","Protagonis","Ajak aku pergi jika menyerang Dong Zhuo, kepala Dong Zhuo akan jadi milikku!","Ajak aku pergi jika menyerang Dong Zhuo, kepala Dong Zhuo akan jadi milikku!",},
        [206] = {407,"","Cao Cao","Hahaha, ada Hero muda, pasti akan berhasil!","Hahaha, ada Hero muda, pasti akan berhasil!",},
        [207] = {501,"Protagonis","Zhang Xingcai","Tuan, sejak mengumumkan determinasi untuk menyerang Dong Zhuo dengan Cao Cao, para pangeran telah mengambil langkah sebagai respon, Tuan sangat hebat!","Tuan, sejak mengumumkan determinasi untuk menyerang Dong Zhuo dengan Cao Cao, para pangeran telah mengambil langkah sebagai respon, Tuan sangat hebat!",},
        [208] = {501,"","Protagonis","Gongsun Zan dari Youzhou telah datang, kakak-kakakku pernah mencari perlindungan dari Gongsun Zan, tidak tahu kali ini apakah mereka akan ikut bersama…","Gongsun Zan dari Youzhou telah datang, kakak-kakakku pernah mencari perlindungan dari Gongsun Zan, tidak tahu kali ini apakah mereka akan ikut bersama…",},
        [209] = {501,"","Liu Bei","Adik keempat, kami mendengar bahwa kamu dan Cao Cao mendeklarasikan untuk menyerang Dong Zhuo, ","Adik keempat, kami mendengar bahwa kamu dan Cao Cao mendeklarasikan untuk menyerang Dong Zhuo, ",},
        [210] = {501,"","Protagonis","Kakak-kakakku! Kalian benar-benar datang!","Kakak-kakakku! Kalian benar-benar datang!",},
        [211] = {501,"","Yuan Shu","Humph, hanya orang biasa yang tak dikenal, beraninya menunjukkan diri disini!","Humph, hanya orang biasa yang tak dikenal, beraninya menunjukkan diri disini!",},
        [212] = {501,"","Cao Cao","Yuan Gonglu, jangan! Hero muda ini adalah orang hebat! Para pangeran datang untuk menyerang Dong Zhuo, bagaimana bisa saling menyerang, pasti ada kesalahpahaman!","Yuan Gonglu, jangan! Hero muda ini adalah orang hebat! Para pangeran datang untuk menyerang Dong Zhuo, bagaimana bisa saling menyerang, pasti ada kesalahpahaman!",},
        [213] = {501,"","Protagonis","Karena kalian tidak percaya, lebih baik diselesaikan dalam pertarungan!","Karena kalian tidak percaya, lebih baik diselesaikan dalam pertarungan!",},
        [214] = {501,"","Yuan Shao","Baiklah! Pemenangnya akan menjadi Pemimpin Pangeran! Aku Yuan Shao sangat bersedia untuk memberikan #Token Hero#ku!","Baiklah! Pemenangnya akan menjadi Pemimpin Pangeran! Aku Yuan Shao sangat bersedia untuk memberikan #Token Hero#ku!",},
        [215] = {501,"","Protagonis","Hehe, mari kita mulai, #Token Hero# pasti jadi milikku!","Hehe, mari kita mulai, #Token Hero# pasti jadi milikku!",},
        [216] = {502,"Protagonis","Liu Bei","Adik keempat, ini Gongsun Zan, Pemimpin Prefektur Beiping, dulu adalah teman sekolahku.","Adik keempat, ini Gongsun Zan, Pemimpin Prefektur Beiping, dulu adalah teman sekolahku.",},
        [217] = {502,"","Protagonis","Ternyata si Jenderal Kuda Putih Gongsun Zan.","Ternyata si Jenderal Kuda Putih Gongsun Zan.",},
        [218] = {502,"","Gongsun Zan","Baiklah, karena kamu adalah saudara Xuande, kita beradu sampai disini saja.","Baiklah, karena kamu adalah saudara Xuande, kita beradu sampai disini saja.",},
        [219] = {503,"Liu Bei","Yuan Shu","Siapa kamu? Aku adalah Yuan Shu, anak pertama dari keluarga Yuan!","Siapa kamu? Aku adalah Yuan Shu, anak pertama dari keluarga Yuan!",},
        [220] = {503,"","Liu Bei","Aku lahir dari keluarga Kaisar Han, keturunan Pangeran Jing dari Zhongshan. Marga Liu, nama Bei, nama kehormatan Xuande.","Aku lahir dari keluarga Kaisar Han, keturunan Pangeran Jing dari Zhongshan. Marga Liu, nama Bei, nama kehormatan Xuande.",},
        [221] = {503,"","Yuan Shu","Sangat konyol, seorang penjual sandal, beraninya mengaku sebagai keluarga Kaisar Han!","Sangat konyol, seorang penjual sandal, beraninya mengaku sebagai keluarga Kaisar Han!",},
        [222] = {503,"","Protagonis","Yuan Shu, jangan membuat ribut dengan kakakku!","Yuan Shu, jangan membuat ribut dengan kakakku!",},
        [223] = {503,"","Guan Yinping","Cih! Yuan Shu, kamu bahkan tidak pantas untuk menjilat sepatu Tuanku!","Cih! Yuan Shu, kamu bahkan tidak pantas untuk menjilat sepatu Tuanku!",},
        [224] = {503,"","Zhang Xingcai","Tuan, kita maju, kalahkan Yuan Shu hingga percaya dulu!","Tuan, kita maju, kalahkan Yuan Shu hingga percaya dulu!",},
        [225] = {504,"Protagonis","Yuan Shao","Yuan Shao mengaku kalah! Aku ingin memilih hero muda ini menjadi ketua kami! Silahkan ambil #Token Hero# ini.","Yuan Shao mengaku kalah! Aku ingin memilih hero muda ini menjadi ketua kami! Silahkan ambil #Token Hero# ini.",},
        [226] = {504,"","Protagonis","#Token Hero# ini akan kuambil! Tetapi posisi ketua pangeran ini, aku tidak tertarik, akan kuberikan padamu!","#Token Hero# ini akan kuambil! Tetapi posisi ketua pangeran ini, aku tidak tertarik, akan kuberikan padamu!",},
        [227] = {504,"","Liu Bei","Adik keempat, jangan buat ribut!","Adik keempat, jangan buat ribut!",},
        [228] = {504,"","Yuan Shu","Haha, posisi ketua ini akhirnya adalah milik kami keluarga Yuan!","Haha, posisi ketua ini akhirnya adalah milik kami keluarga Yuan!",},
        [229] = {504,"","Guan Yinping","Pastinya buka kamu Yuan Shu yang menduduki, apa yang kamu banggakan!","Pastinya buka kamu Yuan Shu yang menduduki, apa yang kamu banggakan!",},
        [230] = {504,"","Yuan Shu","Kamu… (Yuan Shu tidak bisa berkata-kata karena marah)","Kamu… (Yuan Shu tidak bisa berkata-kata karena marah)",},
        [231] = {504,"Protagonis","Zhang Xingcai","Tuan, Hua Xiong yang telah kalah kembali menantang! Tuan, dengar-dengar Lu Bu melindungi gerbang!","Tuan, Hua Xiong yang telah kalah kembali menantang! Tuan, dengar-dengar Lu Bu melindungi gerbang!",},
        [232] = {504,"","Protagonis","Mengapa takut dengannya! Ayo, kita pergi ke Gerbang Hulao untuk bertemu Dewa Perang Lu Bu!","Mengapa takut dengannya! Ayo, kita pergi ke Gerbang Hulao untuk bertemu Dewa Perang Lu Bu!",},
        [233] = {601,"Protagonis","Lu Bu","Aku memiliki Kelinci Merah dan Halberd Surga, juga memiliki #Token Hero# di tangan, di dunia ini, tidak ada seorangpun yang bisa melawanku!","Aku memiliki Kelinci Merah dan Halberd Surga, juga memiliki #Token Hero# di tangan, di dunia ini, tidak ada seorangpun yang bisa melawanku!",},
        [234] = {601,"","Protagonis","Belum tentu, akulah yang akan mengalahkanmu!","Belum tentu, akulah yang akan mengalahkanmu!",},
        [235] = {601,"","Lu Bu","Kamu! Sebelumnya kamu membantu si Telinga Besar mencuri #Token Hero#ku!","Kamu! Sebelumnya kamu membantu si Telinga Besar mencuri #Token Hero#ku!",},
        [236] = {601,"","Protagonis","Betul, itu aku! Takut kan! Cepat serahkan #Token Hero#!","Betul, itu aku! Takut kan! Cepat serahkan #Token Hero#!",},
        [237] = {601,"","Lu Bu","Menurutmu? Kalahkan dulu pasukanku!","Menurutmu? Kalahkan dulu pasukanku!",},
        [238] = {602,"Guan Yinping","Li Jue","Jenderal muda ini kelihatannya berperilaku baik dan ahli dalam bela diri. Perdana Menteri Dong memiliki seorang putri dan ingin menikahkannya dengan jenderal, bagaimana?","Jenderal muda ini kelihatannya berperilaku baik dan ahli dalam bela diri. Perdana Menteri Dong memiliki seorang putri dan ingin menikahkannya dengan jenderal, bagaimana?",},
        [239] = {602,"","Guan Yinping","Jangan bermimpi! Dong Zhuo telah melawan kemanusiaan, Tuanku mana mungkin mau berkeluarga dengannya! ","Jangan bermimpi! Dong Zhuo telah melawan kemanusiaan, Tuanku mana mungkin mau berkeluarga dengannya! ",},
        [240] = {602,"","Zhang Xingcai","Putri Dong Zhuo sangat jelek. Dia tidak pantas bersama dengan Tuanku!","Putri Dong Zhuo sangat jelek. Dia tidak pantas bersama dengan Tuanku!",},
        [241] = {603,"Guan Yu","Hua Xiong","Aku telah membunuh Pan Feng. Siapa yang berani menantangku?","Aku telah membunuh Pan Feng. Siapa yang berani menantangku?",},
        [242] = {603,"","Guan Yu","Hua Xiong, jangan berlagak!","Hua Xiong, jangan berlagak!",},
        [243] = {603,"","Protagonis","Kakak kedua, Hua Xiong telah dikalahkan olehku, mana perlu turun tangan! Siapkan arak untukku, aku akan segera kembali.","Kakak kedua, Hua Xiong telah dikalahkan olehku, mana perlu turun tangan! Siapkan arak untukku, aku akan segera kembali.",},
        [244] = {604,"Liu Bei","Guan Yu","Adik keempat memang hebat!","Adik keempat memang hebat!",},
        [245] = {604,"","Guan Yu","Adik keempat telah membunuh Hua Xiong. Mengapa menunggu sekarang kalau kita bisa menembus gerbang dan menangkap Dong Zhuo hidup-hidup!","Adik keempat telah membunuh Hua Xiong. Mengapa menunggu sekarang kalau kita bisa menembus gerbang dan menangkap Dong Zhuo hidup-hidup!",},
        [246] = {604,"","Liu Bei","Jangan gelisah, kakak. Lu Bu gagah dan tak terkalahkan, sebaiknya kalahkan dulu Lu Bu, lalu bunuh Dong Zhuo.","Jangan gelisah, kakak. Lu Bu gagah dan tak terkalahkan, sebaiknya kalahkan dulu Lu Bu, lalu bunuh Dong Zhuo.",},
        [247] = {604,"","Liu Bei","Adik keempat, kami akan membantumu melawan Lu Bu!","Adik keempat, kami akan membantumu melawan Lu Bu!",},
        [248] = {604,"","Lu Bu","Lu Bu disini! Siapa yang berani menyakiti ayah angkatku?","Lu Bu disini! Siapa yang berani menyakiti ayah angkatku?",},
        [249] = {604,"","Zhang Fei","Zhang Fei dari Yan disini! Lu Bu, temui ajalmu!","Zhang Fei dari Yan disini! Lu Bu, temui ajalmu!",},
        [250] = {604,"","Lu Bu","Aku adalah Dewa Perang Lu Bu, meskipun kalian menyerangku bersamaan, jangan berharap untuk menang! Jika aku kalah hari ini, #Token Hero# akan jadi milikmu!","Aku adalah Dewa Perang Lu Bu, meskipun kalian menyerangku bersamaan, jangan berharap untuk menang! Jika aku kalah hari ini, #Token Hero# akan jadi milikmu!",},
        [251] = {604,"","Protagonis","#Token Hero# itu adalah milikku! Ayo bertarung!","#Token Hero# itu adalah milikku! Ayo bertarung!",},
        [252] = {605,"Zhang Fei","Lu Bu","Aku merindukan Diao Chan, tidak ingin bertarung lagi dengan kalian! #Token Hero# ini kuberikan untuk kalian juga tidak ada salahnya! (Lu Bu menunggang kuda dan berlari dengan cepat.)","Aku merindukan Diao Chan, tidak ingin bertarung lagi dengan kalian! #Token Hero# ini kuberikan untuk kalian juga tidak ada salahnya! (Lu Bu menunggang kuda dan berlari dengan cepat.)",},
        [253] = {605,"","Zhang Fei","Lu Bu jangan kabur!","Lu Bu jangan kabur!",},
        [254] = {605,"","Liu Bei","Adik ketiga, jangan kejar!","Adik ketiga, jangan kejar!",},
        [255] = {605,"Protagonis","Liu Bei","Adik keempat, Gerbang Hulao telah ditembus, kami akan pergi ke Youzhou dengan Gongsun Zan. Sampai jumpa!","Adik keempat, Gerbang Hulao telah ditembus, kami akan pergi ke Youzhou dengan Gongsun Zan. Sampai jumpa!",},
        [256] = {605,"","Protagonis","Sampai jumpa!","Sampai jumpa!",},
        [257] = {605,"","Zhang Xingcai","Selamat Tuan, mendapat #Hero Token# lagi! Tuan, sekarang kemanakah kita?","Selamat Tuan, mendapat #Hero Token# lagi! Tuan, sekarang kemanakah kita?",},
        [258] = {605,"","Protagonis","Menangkap penjahat mulai dari kepalanya, lebih baik pergi menyerang Luoyang dan menangkap Dong Zhuo, lalu dapat menjatuhkan pemberontak!","Menangkap penjahat mulai dari kepalanya, lebih baik pergi menyerang Luoyang dan menangkap Dong Zhuo, lalu dapat menjatuhkan pemberontak!",},
        [259] = {701,"Protagonis","Cao Cao","Laporan pengintai, Dong Zhuo takut akan kekuatan Para Pangeran dan saat ini membakar Luoyang, menyandera Kaisar menuju Chang'an, bagaimana menurut kalian?","Laporan pengintai, Dong Zhuo takut akan kekuatan Para Pangeran dan saat ini membakar Luoyang, menyandera Kaisar menuju Chang'an, bagaimana menurut kalian?",},
        [260] = {701,"","Protagonis","Kejahatan Dong Zhuo tidak bisa dimaafkan, kita harus mengejarnya dan menyelesaikan semuanya! Kapan lagi menyerang Luoyang dan menangkap Dong Zhuo kalau bukan sekarang!","Kejahatan Dong Zhuo tidak bisa dimaafkan, kita harus mengejarnya dan menyelesaikan semuanya! Kapan lagi menyerang Luoyang dan menangkap Dong Zhuo kalau bukan sekarang!",},
        [261] = {701,"","Yuan Shao","Prajurit telah kelelahan, orang Dong Zhuo sangat banyak, sebaiknya kita mundur dulu. Jika kita memaksa untuk mengejar, kita pasti akan gagal.","Prajurit telah kelelahan, orang Dong Zhuo sangat banyak, sebaiknya kita mundur dulu. Jika kita memaksa untuk mengejar, kita pasti akan gagal.",},
        [262] = {701,"","Cao Cao","Aku sangat benci bekerja dengan orang bodoh!","Aku sangat benci bekerja dengan orang bodoh!",},
        [263] = {701,"","Protagonis","Yuan Shao memang tidak bisa mencapai tujuan besar!","Yuan Shao memang tidak bisa mencapai tujuan besar!",},
        [264] = {701,"","Cao Cao","Para pangeran tidak ada bedanya dengan Yuan Shao, hanya Hero muda yang tetap heroik, merupakan kehormatan bagiku dapat berkenalan dengan Hero.","Para pangeran tidak ada bedanya dengan Yuan Shao, hanya Hero muda yang tetap heroik, merupakan kehormatan bagiku dapat berkenalan dengan Hero.",},
        [265] = {701,"","Cao Cao","Sun Jian dari Jiangdong telah membawa tentara menuju Luoyang, Hero muda, kita berpencar, aku mengejar Dong Zhuo, kamu pergi membantu Sun Jian, bagaimana?","Sun Jian dari Jiangdong telah membawa tentara menuju Luoyang, Hero muda, kita berpencar, aku mengejar Dong Zhuo, kamu pergi membantu Sun Jian, bagaimana?",},
        [266] = {701,"","Protagonis","Baik, kalau begitu, aku akan membantu Sun Jian di Luoyang!","Baik, kalau begitu, aku akan membantu Sun Jian di Luoyang!",},
        [267] = {702,"Zhang Xingcai","Huang Gai","Siapa kalian, mengapa menyelinap di dalam kota Luoyang?","Siapa kalian, mengapa menyelinap di dalam kota Luoyang?",},
        [268] = {702,"","Zhang Xingcai","Kami disini untuk membantu Sun Jian membersihkan sisa pasukan Dong Zhuo!","Kami disini untuk membantu Sun Jian membersihkan sisa pasukan Dong Zhuo!",},
        [269] = {702,"","Huang Gai","Menurutku kalian masih muda dan arogan, sudah pasti mata-mata yang dikirim Dong Zhuo!","Menurutku kalian masih muda dan arogan, sudah pasti mata-mata yang dikirim Dong Zhuo!",},
        [270] = {702,"","Zhang Xingcai","Kamu, mengapa tidak bisa membedakan yang baik dengan buruk? Cepat atau lambat kamu akan menyesal!","Kamu, mengapa tidak bisa membedakan yang baik dengan buruk? Cepat atau lambat kamu akan menyesal!",},
        [271] = {702,"","Guan Yinping","Humph, tidak bisa membedakan baik dan buruk, kalau begitu beri dia pelajaran. ","Humph, tidak bisa membedakan baik dan buruk, kalau begitu beri dia pelajaran. ",},
        [272] = {703,"Guan Yinping","Zhang Xingcai","Tuan, Sun Jian awalnya adalah bawahan Yuan Shu, Yuan Shu dan Yuan Shao tidak berbeda, ayo kita mencobanya!","Tuan, Sun Jian awalnya adalah bawahan Yuan Shu, Yuan Shu dan Yuan Shao tidak berbeda, ayo kita mencobanya!",},
        [273] = {703,"","Guan Yinping","Adik Xingcai nakal lagi!","Adik Xingcai nakal lagi!",},
        [274] = {703,"","Zhang Xingcai","Hehe!","Hehe!",},
        [275] = {703,"Sun Jian","Zhang Xingcai","Sun Jian, Perdana Menteri memiliki seorang putri, berparas cantik, ingin menikah dengan anak jenderal, bagaimana?","Sun Jian, Perdana Menteri memiliki seorang putri, berparas cantik, ingin menikah dengan anak jenderal, bagaimana?",},
        [276] = {703,"","Sun Jian","Dong Zhuo melawan hukum alam, merampas kuasa keluarga kerajaan. Aku sangat benci hingga ingin membunuhnya dan bawahannya, sebagai maaf kepada dunia. Bagaimana mungkin aku berkeluarga dengannya!","Dong Zhuo melawan hukum alam, merampas kuasa keluarga kerajaan. Aku sangat benci hingga ingin membunuhnya dan bawahannya, sebagai maaf kepada dunia. Bagaimana mungkin aku berkeluarga dengannya!",},
        [277] = {704,"Sun Jian","Protagonis","Xing Cai, jangan ribut! Jenderal Sun adalah pahlawan yang sebenarnya, berada di baris depan saat menyerang Turban Kuning dan Dong Zhuo, membuktikan kesetiaannya pada Dinasti Han.","Xing Cai, jangan ribut! Jenderal Sun adalah pahlawan yang sebenarnya, berada di baris depan saat menyerang Turban Kuning dan Dong Zhuo, membuktikan kesetiaannya pada Dinasti Han.",},
        [278] = {704,"","Sun Jian","Hero muda, aku tersanjung! Keberhasilanmu telah terkenal mendunia, Sun Jian tidak sebanding denganmu, #Token Hero# ini, kudapatkan di Luoyang, silahkan ambil.","Hero muda, aku tersanjung! Keberhasilanmu telah terkenal mendunia, Sun Jian tidak sebanding denganmu, #Token Hero# ini, kudapatkan di Luoyang, silahkan ambil.",},
        [279] = {704,"","Protagonis","Terima kasih, Jenderal Sun! Kalau begitu akan kuambil!","Terima kasih, Jenderal Sun! Kalau begitu akan kuambil!",},
        [280] = {704,"","Protagonis","Jenderal Sun memiliki rencana apa selanjutnya?","Jenderal Sun memiliki rencana apa selanjutnya?",},
        [281] = {704,"","Sun Jian","Aih, Para Pangeran menggunakan cara licik dan menipusatu sama lain. Aku memutuskan untuk kembali ke Jiangdong.","Aih, Para Pangeran menggunakan cara licik dan menipusatu sama lain. Aku memutuskan untuk kembali ke Jiangdong.",},
        [282] = {704,"","Protagonis","Sangat bagus, pikiran kita sama, aku ingin mengikut jenderal berkeliling ke Jiangdong bersama.","Sangat bagus, pikiran kita sama, aku ingin mengikut jenderal berkeliling ke Jiangdong bersama.",},
        [283] = {704,"","Sun Jian","Sekarang Yuan Shao adalah ketua pangeran, aku akan melaporkan kepergianku padanya.","Sekarang Yuan Shao adalah ketua pangeran, aku akan melaporkan kepergianku padanya.",},
        [284] = {801,"Yuan Shao","Sun Jian","Kondisi Sun Jian tidak baik dan ingin kembali ke Changsha. Aku datang untuk mengucapkan selamat tinggal. ","Kondisi Sun Jian tidak baik dan ingin kembali ke Changsha. Aku datang untuk mengucapkan selamat tinggal. ",},
        [285] = {801,"","Yuan Shao","Stempel Kerajaan adalah barang berharga istana, tapi kamu menyembunyikannya dan ingin kabur, apa yang kamu inginkan?","Stempel Kerajaan adalah barang berharga istana, tapi kamu menyembunyikannya dan ingin kabur, apa yang kamu inginkan?",},
        [286] = {801,"","Sun Jian","Stempel Kerajaan tidak ada padaku! Aku Sun Jian bersumpah pada langit, jika aku menyembunyikan Stempel Kerajaan, aku akan terkutuk dan mati dengan tragis!","Stempel Kerajaan tidak ada padaku! Aku Sun Jian bersumpah pada langit, jika aku menyembunyikan Stempel Kerajaan, aku akan terkutuk dan mati dengan tragis!",},
        [287] = {801,"Sun Jian","Yuan Shao","Kamu telah berjanji, jika tidak melepaskan, aku akan terlihat kikir! (Yuan Shao melepaskan dan Sun Jian pamit.)","Kamu telah berjanji, jika tidak melepaskan, aku akan terlihat kikir! (Yuan Shao melepaskan dan Sun Jian pamit.)",},
        [288] = {801,"Protagonis","Yuan Shao","Seseorang! Tuliskan surat untuk Liu Biao, Hakim Jingzhou, memberitahukan untuk menghadang Sun Jian dan merebut kembali Stempel Kerajaan.","Seseorang! Tuliskan surat untuk Liu Biao, Hakim Jingzhou, memberitahukan untuk menghadang Sun Jian dan merebut kembali Stempel Kerajaan.",},
        [289] = {801,"Protagonis","Zhang Xingcai","Tuan, Yuan Shao bermuka dua, benar-benar rendah. Tuan, apakah Sun Jian benar-benar menyembunyikan Stempel Kerajaan?","Tuan, Yuan Shao bermuka dua, benar-benar rendah. Tuan, apakah Sun Jian benar-benar menyembunyikan Stempel Kerajaan?",},
        [290] = {801,"","Protagonis","Meskipun Stempel Kerajaan ada pada Sun Jian, itu juga karena kemampuannya! Selain itu, kita hanya berjalan-jalan di Jingzhou, Stempel Kerajaan di tangan siapa bukanlah urusanku!","Meskipun Stempel Kerajaan ada pada Sun Jian, itu juga karena kemampuannya! Selain itu, kita hanya berjalan-jalan di Jingzhou, Stempel Kerajaan di tangan siapa bukanlah urusanku!",},
        [291] = {801,"","Zhang Xingcai","Tuan, dengar-dengar di tangan Liu Biao juga ada #Token Hero#, lebih baik kita coba kesempatan ini.","Tuan, dengar-dengar di tangan Liu Biao juga ada #Token Hero#, lebih baik kita coba kesempatan ini.",},
        [292] = {801,"","Protagonis","Liu Biao memiliki #Token Hero#! Kita tunggu apa lagi! Ayo, pergi ke Jingzhou!","Liu Biao memiliki #Token Hero#! Kita tunggu apa lagi! Ayo, pergi ke Jingzhou!",},
        [293] = {802,"Zhang Xingcai","Cai Mao","Dua perempuan cantik yang datang darimana, lebih baik ikut dengan Cai Mao!","Dua perempuan cantik yang datang darimana, lebih baik ikut dengan Cai Mao!",},
        [294] = {802,"","Zhang Xingcai","Siapa kamu? Apa yang kamu miliki?","Siapa kamu? Apa yang kamu miliki?",},
        [295] = {802,"","Cai Mao","Aku berasal dari keluarga kaya di Jingzhou, adik perempuanku menikah dengan Liu Biao. Dia memiliki relasi dengan keluarga Kaisar Dinasti Han, keluarga Cai akan menjadi berjaya!","Aku berasal dari keluarga kaya di Jingzhou, adik perempuanku menikah dengan Liu Biao. Dia memiliki relasi dengan keluarga Kaisar Dinasti Han, keluarga Cai akan menjadi berjaya!",},
        [296] = {802,"","Zhang Xingcai","Humph, adik perempuanmu hanyalah permaisuri Liu Biao, kamu terlalu sombong!","Humph, adik perempuanmu hanyalah permaisuri Liu Biao, kamu terlalu sombong!",},
        [297] = {802,"","Guan Yinping","Keluarga Cai yang lemah juga berani congkak, bunuh!","Keluarga Cai yang lemah juga berani congkak, bunuh!",},
        [298] = {803,"Zhang Xingcai","Liu Biao","Bocah darimana. Tidak disangka kamu dapat mengalahkan Cai Mao dan Huang Zu, kekuatanmu tidak dapat diremehkan.","Bocah darimana. Tidak disangka kamu dapat mengalahkan Cai Mao dan Huang Zu, kekuatanmu tidak dapat diremehkan.",},
        [299] = {803,"","Zhang Xingcai","Tuan, Liu Biao saat masih muda telah masuk ke Jingzhou dan menguasai sembilan prefektur Jingzhou, sangat hebat.","Tuan, Liu Biao saat masih muda telah masuk ke Jingzhou dan menguasai sembilan prefektur Jingzhou, sangat hebat.",},
        [300] = {803,"","Guan Yinping","Memangnya kenapa? Tuanku masuk Xiangyang tanpa banyak usaha. Bersiaplah untuk menerima pelajaran dari Tuanku.","Memangnya kenapa? Tuanku masuk Xiangyang tanpa banyak usaha. Bersiaplah untuk menerima pelajaran dari Tuanku.",},
        [301] = {803,"","Liu Biao","Lihat siapa yang bicara. Kamu akan tahu kehebatan Liu Jingsheng!","Lihat siapa yang bicara. Kamu akan tahu kehebatan Liu Jingsheng!",},
        [302] = {804,"Protagonis","Liu Biao","Hero mulai saat masih muda. Kamu benar-benar hebat, aku mengaku kalah!","Hero mulai saat masih muda. Kamu benar-benar hebat, aku mengaku kalah!",},
        [303] = {804,"","Protagonis","Setelah dihajar, nada bicaranya berubah! Karena mengaku kalah, serahkan #Token Hero#nya!","Setelah dihajar, nada bicaranya berubah! Karena mengaku kalah, serahkan #Token Hero#nya!",},
        [304] = {804,"","Liu Biao","Dengan hormat, aku tidak memiliki #Token Hero#!","Dengan hormat, aku tidak memiliki #Token Hero#!",},
        [305] = {804,"","Protagonis","Apa? Tanpa #Token Hero# artinya aku datang sia-sia, benar-benar rugi…","Apa? Tanpa #Token Hero# artinya aku datang sia-sia, benar-benar rugi…",},
        [306] = {804,"","Huang Gai","Jenderal, gawat! Tuanku jatuh dalam perangkap Kuai Liang, Huang Zu menipunya untuk meninggalkan kota dan pergi sendirian, sangat berbahaya!","Jenderal, gawat! Tuanku jatuh dalam perangkap Kuai Liang, Huang Zu menipunya untuk meninggalkan kota dan pergi sendirian, sangat berbahaya!",},
        [307] = {804,"","Protagonis","Jangan khawatir, Jenderal Tua Huang Gai, kami datang untuk membantu Sun Jian!","Jangan khawatir, Jenderal Tua Huang Gai, kami datang untuk membantu Sun Jian!",},
        [308] = {805,"Zhang Xingcai","Protagonis","Kita datang terlambat! Meskipun Huang Zu telah ditangkap, namun Jenderal Sun Jian telah mati oleh hujan panah.","Kita datang terlambat! Meskipun Huang Zu telah ditangkap, namun Jenderal Sun Jian telah mati oleh hujan panah.",},
        [309] = {805,"","Zhang Xingcai","Sumpah Sun Jian pada hari itu, tidak diduga datang secepat ini, sepertinya Stempel Kerajaan ada padanya… (Saat berbicara, Sun Ce datang dengan kudanya.)","Sumpah Sun Jian pada hari itu, tidak diduga datang secepat ini, sepertinya Stempel Kerajaan ada padanya… (Saat berbicara, Sun Ce datang dengan kudanya.)",},
        [310] = {805,"","Sun Ce","Siapa yang membunuh ayahku? Apakah itu kamu?","Siapa yang membunuh ayahku? Apakah itu kamu?",},
        [311] = {805,"","Protagonis","Kamu adalah?","Kamu adalah?",},
        [312] = {805,"","Sun Ce","Aku adalah Sun Ce, anak pertama Sun Jian dan penguasa Jiangdong! Kalian membunuh ayahku, serahkan nyawamu!","Aku adalah Sun Ce, anak pertama Sun Jian dan penguasa Jiangdong! Kalian membunuh ayahku, serahkan nyawamu!",},
        [313] = {806,"Sun Ce","Huang Gai","Tuan muda salah sangka! Jenderal muda ini datang untuk menyelamatkan Tuan, Huang Zu yang menembak mati Tuanku.","Tuan muda salah sangka! Jenderal muda ini datang untuk menyelamatkan Tuan, Huang Zu yang menembak mati Tuanku.",},
        [314] = {806,"","Sun Ce","Aku baru saja kehilangan ayah, sangat terpukul. Telah menyinggung dan salah paham dengan Jenderal, mohon maafkan aku.","Aku baru saja kehilangan ayah, sangat terpukul. Telah menyinggung dan salah paham dengan Jenderal, mohon maafkan aku.",},
        [315] = {806,"","Protagonis","Aku mengerti. Aku telah menangkap Huang Zu hidup-hidup, mengapa tidak menukarkan jasad Jenderal Sun Jian dengan Huang Zu?","Aku mengerti. Aku telah menangkap Huang Zu hidup-hidup, mengapa tidak menukarkan jasad Jenderal Sun Jian dengan Huang Zu?",},
        [316] = {806,"","Sun Ce","Terima kasih! Aku tidak bisa membalas kebaikan jenderal, anggap #Token Hero# sebagai tanda terima kasih!","Terima kasih! Aku tidak bisa membalas kebaikan jenderal, anggap #Token Hero# sebagai tanda terima kasih!",},
        [317] = {806,"","Protagonis","Baik. Jenderal Sun Ce memang keren, tidak tahu apa rencananya di masa depan?","Baik. Jenderal Sun Ce memang keren, tidak tahu apa rencananya di masa depan?",},
        [318] = {806,"","Sun Ce","Bawahan almarhum ayahku dulu, sekarang melayani Yuan Shu. Aku akan mendekati Yuan Shu, setelah aku cukup kuat akan kubalaskan dendam ayahku.","Bawahan almarhum ayahku dulu, sekarang melayani Yuan Shu. Aku akan mendekati Yuan Shu, setelah aku cukup kuat akan kubalaskan dendam ayahku.",},
        [319] = {806,"","Sun Ce","Pada saatnya, jenderal datanglah lagi ke Jiangdong, akan kuberikan bantuanku! (Sun Ce bersedih, membawa jasad Sun Jian dan pergi)","Pada saatnya, jenderal datanglah lagi ke Jiangdong, akan kuberikan bantuanku! (Sun Ce bersedih, membawa jasad Sun Jian dan pergi)",},
        [320] = {806,"","Zhang Xingcai","Tuan, kita sekarang akan pergi kemana?","Tuan, kita sekarang akan pergi kemana?",},
        [321] = {806,"","Protagonis","Cao Cao pergi menghadang Dong Zhuo, kabarnya telah tiba di Xingyang, mari kita pergi dan lihat!","Cao Cao pergi menghadang Dong Zhuo, kabarnya telah tiba di Xingyang, mari kita pergi dan lihat!",},
        [322] = {901,"Xiahou Dun","Protagonis","Jenderal Xiahou, dimanakah Cao Cao?","Jenderal Xiahou, dimanakah Cao Cao?",},
        [323] = {901,"Protagonis","Xiahou Dun","Dong Zhuo penjahat itu membakar Luoyang dan kabur ke Chang'an, Tuan menghadangnya di Xingyang!","Dong Zhuo penjahat itu membakar Luoyang dan kabur ke Chang'an, Tuan menghadangnya di Xingyang!",},
        [324] = {901,"Xiahou Dun","Protagonis","Bagaimana situasi perang saat ini?","Bagaimana situasi perang saat ini?",},
        [325] = {901,"Protagonis","Xiahou Dun","Xu Rong, Pemimpin Prefektur Xingyang membantu bandit itu, Lu Bu menghalangi jalan kami dengan prajurit elit. Li Ru juga telah merencanakan penyergapan, semuanya membuat Tuan susah untuk menyerang!","Xu Rong, Pemimpin Prefektur Xingyang membantu bandit itu, Lu Bu menghalangi jalan kami dengan prajurit elit. Li Ru juga telah merencanakan penyergapan, semuanya membuat Tuan susah untuk menyerang!",},
        [326] = {901,"Xiahou Dun","Protagonis","Cao Cao pasti dalam bahaya! Kita cepat pergi bantu dia!","Cao Cao pasti dalam bahaya! Kita cepat pergi bantu dia!",},
        [327] = {902,"Protagonis","Zhang Xingcai","Tuan, gawat! Cao Cao disergap di luar kota Xingyang dan dikepung oleh tentara Dong Zhuo, situasi sangat kritis!","Tuan, gawat! Cao Cao disergap di luar kota Xingyang dan dikepung oleh tentara Dong Zhuo, situasi sangat kritis!",},
        [328] = {902,"Zhang Xingcai","Protagonis","Tenang, Xingcai! Ada aku disini!","Tenang, Xingcai! Ada aku disini!",},
        [329] = {902,"Protagonis","Zhang Xingcai","Tuan, orang di depan itu sepertinya adalah Xiahou Yuan, saudara ipar Cao Cao, mari kita tanya dia keadaannya.","Tuan, orang di depan itu sepertinya adalah Xiahou Yuan, saudara ipar Cao Cao, mari kita tanya dia keadaannya.",},
        [330] = {902,"Protagonis","Xiahou Yuan","Pengejar lagi! Tuan pergilah, Xiahou Yuan akan menahannya!","Pengejar lagi! Tuan pergilah, Xiahou Yuan akan menahannya!",},
        [331] = {902,"Protagonis","Xiahou Yuan","Siapa kalian?","Siapa kalian?",},
        [332] = {902,"Xiahou Yuan","Guan Yinping","Xiahou Yuan yang bebal! Bahkan tidak mengenali Tuanku!","Xiahou Yuan yang bebal! Bahkan tidak mengenali Tuanku!",},
        [333] = {903,"Cao Cao","Zhang Xingcai","Cao Cao, ada panah di pundakmu, biarkan aku menyembuhkanmu.","Cao Cao, ada panah di pundakmu, biarkan aku menyembuhkanmu.",},
        [334] = {903,"Zhang Xingcai","Cao Cao","Siapa yang ingin membunuhku?","Siapa yang ingin membunuhku?",},
        [335] = {903,"Cao Cao","Zhang Xingcai","Tuan, itu pasti demam infeksi yang diakibatkan oleh luka, menyebabkan Cao Cao tidak sadar diri.","Tuan, itu pasti demam infeksi yang diakibatkan oleh luka, menyebabkan Cao Cao tidak sadar diri.",},
        [336] = {903,"Cao Cao","Guan Yinping","Penyakit kecurigaan Cao Cao sangat akut, hingga tidak mengenali Tuan kami.","Penyakit kecurigaan Cao Cao sangat akut, hingga tidak mengenali Tuan kami.",},
        [337] = {903,"Cao Cao","Protagonis","Rupanya Cao Cao telah bertarung dalam banyak peperangan dan terluka, hingga tidak bisa membedakan musuh dengan teman. Kita cepat jatuhkan dia untuk menyembuhkannya.","Rupanya Cao Cao telah bertarung dalam banyak peperangan dan terluka, hingga tidak bisa membedakan musuh dengan teman. Kita cepat jatuhkan dia untuk menyembuhkannya.",},
        [338] = {904,"Cao Cao","Zhang Xingcai","Cao Cao, apa sudah baikkan?","Cao Cao, apa sudah baikkan?",},
        [339] = {904,"Zhang Xingcai","Cao Cao","Terima kasih atas bantuan Hero muda! Terima kasih Xingcai tabib baik hati. Kemampuan penyembuhanmu sangat hebat, belajar dari siapa?","Terima kasih atas bantuan Hero muda! Terima kasih Xingcai tabib baik hati. Kemampuan penyembuhanmu sangat hebat, belajar dari siapa?",},
        [340] = {904,"Cao Cao","Zhang Xingcai","Guruku adalah Tabib Sakti Hua Tuo, ada lagi seorang Taoist bernama Zuo Ci pernah memberikanku obat, memintaku untuk membantu orang yang terpilih dan menjaganya!","Guruku adalah Tabib Sakti Hua Tuo, ada lagi seorang Taoist bernama Zuo Ci pernah memberikanku obat, memintaku untuk membantu orang yang terpilih dan menjaganya!",},
        [341] = {904,"Zhang Xingcai","Cao Cao","Kemampuan medis Xingcai memiliki sejarah seperti ini. Siapakah orang yang terpilih itu?","Kemampuan medis Xingcai memiliki sejarah seperti ini. Siapakah orang yang terpilih itu?",},
        [342] = {904,"Cao Cao","Zhang Xingcai","Tuanku adalah orang yang terpilih! Dia ditakdirkan untuk menghentikan kekacauan dunia!","Tuanku adalah orang yang terpilih! Dia ditakdirkan untuk menghentikan kekacauan dunia!",},
        [343] = {904,"Cao Cao","Zhang Xingcai","Tuan, Xing Cai akan berada di sisi Tuan seumur hidup, selamanya melindungi dan menjaga Tuan!","Tuan, Xing Cai akan berada di sisi Tuan seumur hidup, selamanya melindungi dan menjaga Tuan!",},
        [344] = {904,"Zhang Xingcai","Guan Yinping","Tuan, masih ada aku! Aku akan membantumu bertarung!","Tuan, masih ada aku! Aku akan membantumu bertarung!",},
        [345] = {904,"Guan Yinping","Protagonis","Bagusss! Hahaha!","Bagusss! Hahaha!",},
        [346] = {904,"Protagonis","Cao Cao","Hebat! Hero muda, yang kamu miliki merupakan talenta melimpah.","Hebat! Hero muda, yang kamu miliki merupakan talenta melimpah.",},
        [347] = {905,"Cao Cao","Xiahou Dun","Tuan, Xiahou Dun telah datang dengan beberapa prajurit kavaleri, di belakangnya ada Cao Ren, Li Dian dan Yue Jin juga telah tiba.","Tuan, Xiahou Dun telah datang dengan beberapa prajurit kavaleri, di belakangnya ada Cao Ren, Li Dian dan Yue Jin juga telah tiba.",},
        [348] = {905,"Xiahou Dun","Cao Cao","Pemimpin Prefektur Xingyang menyergapku, hari ini aku selamat karena Hero muda, kalau tidak hidupku akan dalam bahaya.","Pemimpin Prefektur Xingyang menyergapku, hari ini aku selamat karena Hero muda, kalau tidak hidupku akan dalam bahaya.",},
        [349] = {905,"Protagonis","Xiahou Dun","Jenderal muda, ada satu hal yang Xiahou Dun minta!","Jenderal muda, ada satu hal yang Xiahou Dun minta!",},
        [350] = {905,"Xiahou Dun","Protagonis","Katakan.","Katakan.",},
        [351] = {905,"Protagonis","Xiahou Dun","Dengar-dengar Jenderal melawan Lu Bu di Gerbang Hulao, membuat takut para pangeran, memiliki kekuatan yang hebat, terkenal di dunia, tidak tahu apakah aku bisa beradu dengan jenderal?","Dengar-dengar Jenderal melawan Lu Bu di Gerbang Hulao, membuat takut para pangeran, memiliki kekuatan yang hebat, terkenal di dunia, tidak tahu apakah aku bisa beradu dengan jenderal?",},
        [352] = {905,"Xiahou Dun","Protagonis","Hanya dengan bertarung tanpa henti aku dapat meningkatkan kemampuanku. Jenderal Xiahou, ayo beradu denganku!","Hanya dengan bertarung tanpa henti aku dapat meningkatkan kemampuanku. Jenderal Xiahou, ayo beradu denganku!",},
        [353] = {906,"Protagonis","Xiahou Dun","Jenderal memang hebat, aku mengaku kalah. Kamu pantas untuk mendapatkan Token Hero ini!","Jenderal memang hebat, aku mengaku kalah. Kamu pantas untuk mendapatkan Token Hero ini!",},
        [354] = {906,"Cao Cao","Protagonis","Terima kasih!","Terima kasih!",},
        [355] = {906,"Protagonis","Cao Cao","Dong Zhuo melangkahi kaisar, menindas rakyat. Dia telah membuat bangunan mahal, membunuh yang tidak bersalah, kejahatannya tidak bisa disebutkan lagi, harus dikutuk!","Dong Zhuo melangkahi kaisar, menindas rakyat. Dia telah membuat bangunan mahal, membunuh yang tidak bersalah, kejahatannya tidak bisa disebutkan lagi, harus dikutuk!",},
        [356] = {906,"Protagonis","Cao Cao","Sayang sekali, pada pertempuran Xingyang aku kalah total, kalau tidak aku pasti sudah akan memenggal kepala Dong Zhuo!","Sayang sekali, pada pertempuran Xingyang aku kalah total, kalau tidak aku pasti sudah akan memenggal kepala Dong Zhuo!",},
        [357] = {906,"Cao Cao","Protagonis","Tenang kakak Cao, aku akan pergi ke Chang'an dan membunuh Dong Zhuo!","Tenang kakak Cao, aku akan pergi ke Chang'an dan membunuh Dong Zhuo!",},
        [358] = {906,"Protagonis","Cao Cao","Hero muda sungguh gagah! Eksekusi Dong Zhuo akan kuserahkan padamu! Aku akan kembali ke Henei untuk penyembuhan, sampai jumpa.","Hero muda sungguh gagah! Eksekusi Dong Zhuo akan kuserahkan padamu! Aku akan kembali ke Henei untuk penyembuhan, sampai jumpa.",},
        [359] = {906,"Zhang Xingcai","Guan Yinping","Dong Zhuo tidak akan hidup lebih lama lagi! Ayo, kita pergi ke Chang'an dan membunuh Dong Zhuo!","Dong Zhuo tidak akan hidup lebih lama lagi! Ayo, kita pergi ke Chang'an dan membunuh Dong Zhuo!",},
        [360] = {906,"Protagonis","Zhang Xingcai","Jangan tergesa-gesa! Pembunuhan Dong Zhuo sebelumnya mengapa gagal, itu karena orang Dong Zhuo sangat banyak. Tuan mengapa tidak menyelinap ke Chang'an dulu, mencari informasi dari Wang Yun?","Jangan tergesa-gesa! Pembunuhan Dong Zhuo sebelumnya mengapa gagal, itu karena orang Dong Zhuo sangat banyak. Tuan mengapa tidak menyelinap ke Chang'an dulu, mencari informasi dari Wang Yun?",},
        [361] = {906,"Zhang Xingcai","Protagonis","Baik, sesuai perkataan Xingcai! Kita pergi ke Chang'an untuk menemui Wang Yun!","Baik, sesuai perkataan Xingcai! Kita pergi ke Chang'an untuk menemui Wang Yun!",},
        [362] = {1001,"Guan Yinping","Zhang Xingcai","Dong Zhuo penjahat tua itu membakar Luoyang, memaksa ratusan menteri dan pejabat pindah ke Chang'an. Tuan, di depan adalah kediaman Wang Yun di Chang'an.","Dong Zhuo penjahat tua itu membakar Luoyang, memaksa ratusan menteri dan pejabat pindah ke Chang'an. Tuan, di depan adalah kediaman Wang Yun di Chang'an.",},
        [363] = {1001,"Zhang Xingcai","Guan Yinping","Shh, bukankah itu Lu Bu? Dia datang mencari Wang Yun untuk apa?","Shh, bukankah itu Lu Bu? Dia datang mencari Wang Yun untuk apa?",},
        [364] = {1001,"Wang Yun","Lu Bu","Aku dan Diao Chan saling mencintai. Tuan telah merestui aku dan Diao Chan, mengapa sekarang memberikannya ke Perdana Menteri, ada maksud apa?","Aku dan Diao Chan saling mencintai. Tuan telah merestui aku dan Diao Chan, mengapa sekarang memberikannya ke Perdana Menteri, ada maksud apa?",},
        [365] = {1001,"Lu Bu","Wang Yun","Jenderal salah menuduhku! Kemarin Perdana Menteri datang ke kediamanku, mengatakan bahwa dia akan menikahkan Diao Chan dengan jenderal, karena itu aku membiarkan Diao Chan pergi.","Jenderal salah menuduhku! Kemarin Perdana Menteri datang ke kediamanku, mengatakan bahwa dia akan menikahkan Diao Chan dengan jenderal, karena itu aku membiarkan Diao Chan pergi.",},
        [366] = {1001,"Lu Bu","Wang Yun","Jenderal pikirkan baik-baik, Perdana Menteri datang sendiri, mana aku berani menolaknya?","Jenderal pikirkan baik-baik, Perdana Menteri datang sendiri, mana aku berani menolaknya?",},
        [367] = {1001,"Wang Yun","Lu Bu","Jangan salahkan aku, aku telah salah sangka, akan kuberikan permintaan maafku suatu hari. (Lu Bu kembali ke rumah Dong dengan terburu-buru)","Jangan salahkan aku, aku telah salah sangka, akan kuberikan permintaan maafku suatu hari. (Lu Bu kembali ke rumah Dong dengan terburu-buru)",},
        [368] = {1001,"Zhang Xingcai","Guan Yinping","Baru tiba di kediaman Wang Yun, langsung melihat pertunjukan bagus.","Baru tiba di kediaman Wang Yun, langsung melihat pertunjukan bagus.",},
        [369] = {1001,"Guan Yinping","Zhang Xingcai","Sungguh kasihan Kakak Diao Chan, Dong Zhuo orang mesum, pasti…","Sungguh kasihan Kakak Diao Chan, Dong Zhuo orang mesum, pasti…",},
        [370] = {1001,"Guan Yinping","Protagonis","Ayo, kita bertanya pada Wang Yun tentang hal ini, tidak bisa membuat Diao Chan menderita!","Ayo, kita bertanya pada Wang Yun tentang hal ini, tidak bisa membuat Diao Chan menderita!",},
        [371] = {1002,"Wang Yun","Protagonis","Wang Yun, mengapa kamu memberikan Diao Chan pada Dong Zhuo?","Wang Yun, mengapa kamu memberikan Diao Chan pada Dong Zhuo?",},
        [372] = {1002,"Protagonis","Wang Yun","Situasi saat ini membahayakan rakyat dan menekan para pejabat. Dong Zhuo menteri jahat itu, ingin merebut tahta kerajaan. ","Situasi saat ini membahayakan rakyat dan menekan para pejabat. Dong Zhuo menteri jahat itu, ingin merebut tahta kerajaan. ",},
        [373] = {1002,"Protagonis","Wang Yun","Aku menggunakan siasat orang cantik ini, agar Diao Chan dapat memisahkan Lu Bu dan Dong Zhuo berdua, Lu Bu sangat gagah, pasti dapat menyingkirkan Dong Zhuo.","Aku menggunakan siasat orang cantik ini, agar Diao Chan dapat memisahkan Lu Bu dan Dong Zhuo berdua, Lu Bu sangat gagah, pasti dapat menyingkirkan Dong Zhuo.",},
        [374] = {1002,"Wang Yun","Protagonis","Omong kosong! Membunuh Dong Zhuo, hanya aku yang bisa! Mengapa mengorbankan seorang wanita lemah untuk menyelamatkan negara!","Omong kosong! Membunuh Dong Zhuo, hanya aku yang bisa! Mengapa mengorbankan seorang wanita lemah untuk menyelamatkan negara!",},
        [375] = {1002,"","Protagonis","Ayo, kita pergi selamatkan Diao Chan!","Ayo, kita pergi selamatkan Diao Chan!",},
        [376] = {1003,"Diao Chan","Zhang Xingcai","Kakak Diao Chan, kami datang menyelamatkanmu. Ikutlah dengan kami.","Kakak Diao Chan, kami datang menyelamatkanmu. Ikutlah dengan kami.",},
        [377] = {1003,"Zhang Xingcai","Diao Chan","Ayah tidak memaksaku, aku sendiri yang mau. Aku hanya berharap untuk membunuh Dong Zhuo dan memberikan kedamaian di dunia!","Ayah tidak memaksaku, aku sendiri yang mau. Aku hanya berharap untuk membunuh Dong Zhuo dan memberikan kedamaian di dunia!",},
        [378] = {1003,"Diao Chan","Zhang Xingcai","Kakak Diao Chan memang perempuan yang hebat.","Kakak Diao Chan memang perempuan yang hebat.",},
        [379] = {1003,"Diao Chan","Zhang Xingcai","Kakak Diao Chan, tenanglah. Tuanku akan membunuh Dong Zhuo, menjagamu dan membuatmu bahagia.","Kakak Diao Chan, tenanglah. Tuanku akan membunuh Dong Zhuo, menjagamu dan membuatmu bahagia.",},
        [380] = {1004,"Lu Bu","Protagonis","Lu Bu, ayo, kita bunuh Dong Zhuo, jika Diao Chan bersedia denganmu, aku tidak akan melarang!","Lu Bu, ayo, kita bunuh Dong Zhuo, jika Diao Chan bersedia denganmu, aku tidak akan melarang!",},
        [381] = {1004,"Protagonis","Lu Bu","Sejak awal aku tidak puas dengan Dong Zhuo, tetapi hubungannya denganku seperti ayah dan anak, membunuhnya akan membuat percekcokan!","Sejak awal aku tidak puas dengan Dong Zhuo, tetapi hubungannya denganku seperti ayah dan anak, membunuhnya akan membuat percekcokan!",},
        [382] = {1004,"Lu Bu","Protagonis","Ayah apaan! Margamu Lu, dia Dong!","Ayah apaan! Margamu Lu, dia Dong!",},
        [383] = {1004,"Lu Bu","Protagonis","Dia merebut Diao Chan darimu, meniduri Diao Chanmu, hubungan ayah dan anak bagaimana?!","Dia merebut Diao Chan darimu, meniduri Diao Chanmu, hubungan ayah dan anak bagaimana?!",},
        [384] = {1004,"Protagonis","Lu Bu","Benar! Dong Zhuo sial, aku bertarung untuk dia dengan sepenuh hidupku, dan dia merebut Diao Chan dariku!!","Benar! Dong Zhuo sial, aku bertarung untuk dia dengan sepenuh hidupku, dan dia merebut Diao Chan dariku!!",},
        [385] = {1004,"Protagonis","Lu Bu","Seorang lelaki harus melakukan perkara besar, tidak dapat selalu bersembunyi! Ayo, kita bunuh Dong Zhuo!","Seorang lelaki harus melakukan perkara besar, tidak dapat selalu bersembunyi! Ayo, kita bunuh Dong Zhuo!",},
        [386] = {1004,"Lu Bu","Protagonis","Baiklah, Lu Bu memang mengagumkan! Inilah wujud pahlawan yang sejati! Aku menyukainya!","Baiklah, Lu Bu memang mengagumkan! Inilah wujud pahlawan yang sejati! Aku menyukainya!",},
        [387] = {1005,"Protagonis","Dong Zhuo","Haha, aku harus berbegas menuju Istana! Dekrit Kaisar mengatakan bahwa akan memahkotahkanku. Aku Dong Zhuo memang ditakdirkan untuk menjadi kaisar!","Haha, aku harus berbegas menuju Istana! Dekrit Kaisar mengatakan bahwa akan memahkotahkanku. Aku Dong Zhuo memang ditakdirkan untuk menjadi kaisar!",},
        [388] = {1005,"Dong Zhuo","Protagonis","Dong Zhuo, kamu telah melakukan kejahatan yang tidak dapat diampuni dan mengganggu Diao Chan, mati kau!","Dong Zhuo, kamu telah melakukan kejahatan yang tidak dapat diampuni dan mengganggu Diao Chan, mati kau!",},
        [389] = {1005,"Protagonis","Dong Zhuo","Kamu lagi? Beraninya menyergapku dengan memalsukan dekrit Kaisar! Mana Fengxian anakku?","Kamu lagi? Beraninya menyergapku dengan memalsukan dekrit Kaisar! Mana Fengxian anakku?",},
        [390] = {1005,"Dong Zhuo","Lu Bu","Kaisar telah memerintah kami menyerang pemberontak! Membunuh pengkhianat Dong Zhuo dan menyelamatkan dunia!","Kaisar telah memerintah kami menyerang pemberontak! Membunuh pengkhianat Dong Zhuo dan menyelamatkan dunia!",},
        [391] = {1006,"Lu Bu","Dong Zhuo","Kurang ajar, beraninya mengkhianatiku~","Kurang ajar, beraninya mengkhianatiku~",},
        [392] = {1006,"Lu Bu","Dong Zhuo","Aku tidak terima, aku adalah Perdana Menteri Dinasti Han… Lelaki Diao Chan… Aku akan jadi kaisar… (Dong Zhuo tewas)","Aku tidak terima, aku adalah Perdana Menteri Dinasti Han… Lelaki Diao Chan… Aku akan jadi kaisar… (Dong Zhuo tewas)",},
        [393] = {1006,"Diao Chan","Lu Bu","Chan, setelah kepergian di Paviliun Fengyi, Fengxian terus merindukanmu siang dan malam!","Chan, setelah kepergian di Paviliun Fengyi, Fengxian terus merindukanmu siang dan malam!",},
        [394] = {1006,"Lu Bu","Diao Chan","Fengxian! Aku bukan wanita yang suci lagi, tidak pantas untukmu, huhuhu…","Fengxian! Aku bukan wanita yang suci lagi, tidak pantas untukmu, huhuhu…",},
        [395] = {1006,"Diao Chan","Lu Bu","Chan, kamu telah menderita! Aku tidak sempat menyayangimu, mana bisa meninggalkanmu?","Chan, kamu telah menderita! Aku tidak sempat menyayangimu, mana bisa meninggalkanmu?",},
        [396] = {1006,"Diao Chan","Lu Bu","Mulai sekarang, aku akan menjagamu, menyerahkan jiwanya untukmu, dan menjauhkan kamu dari segala bahaya sekecil apapun!","Mulai sekarang, aku akan menjagamu, menyerahkan jiwanya untukmu, dan menjauhkan kamu dari segala bahaya sekecil apapun!",},
        [397] = {1006,"Diao Chan","Protagonis","Uhuk! (Bisakah kalian berhenti? Aku tak sanggup melihatnya)","Uhuk! (Bisakah kalian berhenti? Aku tak sanggup melihatnya)",},
        [398] = {1006,"Protagonis","Diao Chan","Ya… maafkan telah membuat jenderal canggung! Terima kasih telah menyelamatkanku dari masalah! Dong Zhuo pernah memberikanku Token Hero saat di Meiwu, silahkan ambil!","Ya… maafkan telah membuat jenderal canggung! Terima kasih telah menyelamatkanku dari masalah! Dong Zhuo pernah memberikanku Token Hero saat di Meiwu, silahkan ambil!",},
        [399] = {1006,"Lu Bu","Protagonis","Terima kasih atas kebaikan Nona Diao Chan! Kalau begitu aku tidak akan sungkan-sungkan!","Terima kasih atas kebaikan Nona Diao Chan! Kalau begitu aku tidak akan sungkan-sungkan!",},
        [400] = {1006,"Protagonis","Lu Bu","Hero muda, perselisihan di antara kita telah berlalu, aku menganggapmu sebagai teman!","Hero muda, perselisihan di antara kita telah berlalu, aku menganggapmu sebagai teman!",},
        [401] = {1006,"Protagonis","Lu Bu","Mulai sekarang, selama membutuhkan pertolongan Lu Fengxian, kamu cukup buka mulut, aku pasti akan datang.","Mulai sekarang, selama membutuhkan pertolongan Lu Fengxian, kamu cukup buka mulut, aku pasti akan datang.",},
        [402] = {1006,"Lu Bu","Protagonis","Baiklah, aku hanya memiliki sebuah permintaan, selanjutnya kamu harus memperlakukan Diao Chan dengan baik! Sampai jumpa!","Baiklah, aku hanya memiliki sebuah permintaan, selanjutnya kamu harus memperlakukan Diao Chan dengan baik! Sampai jumpa!",},
        [403] = {1006,"Protagonis","Zhang Xingcai","Tuan, kita sekarang akan pergi kemana?","Tuan, kita sekarang akan pergi kemana?",},
        [404] = {1006,"Protagonis","Guan Yinping","Setelah Dong Zhuo tewas, bawahannya seperti Li Jue dan Guo Si telah mengendalikan Beruang Terbang dan kabur ke Liangzhou.","Setelah Dong Zhuo tewas, bawahannya seperti Li Jue dan Guo Si telah mengendalikan Beruang Terbang dan kabur ke Liangzhou.",},
        [405] = {1006,"Guan Yinping","Protagonis","Kalau bukan karena bantuan mereka, Dong Zhuo tidak akan berjaya! Ayo, kita kejar!","Kalau bukan karena bantuan mereka, Dong Zhuo tidak akan berjaya! Ayo, kita kejar!",},
        [406] = {1101,"Guan Yinping","Li Jue","Kamu lagi! Jalan surga terbuka, malah memilih pintu neraka!","Kamu lagi! Jalan surga terbuka, malah memilih pintu neraka!",},
        [407] = {1101,"Li Jue","Guan Yinping","Cih! Jangan banyak bicara! Kamu, bahkan menjilat sepatu Tuanku pun tidak pantas!","Cih! Jangan banyak bicara! Kamu, bahkan menjilat sepatu Tuanku pun tidak pantas!",},
        [408] = {1101,"Li Jue","Zhang Xingcai","Tuan, kita musnahkan dia!","Tuan, kita musnahkan dia!",},
        [409] = {1102,"Zhang Xingcai","Li Jue","Sial aku gagal lagi! Anak muda, aku akan membunuhmu saat bertemu lagi. (Li Jue kabur dengan marah)","Sial aku gagal lagi! Anak muda, aku akan membunuhmu saat bertemu lagi. (Li Jue kabur dengan marah)",},
        [410] = {1102,"Li Jue","Zhang Xingcai","Humph, kalau jago jangan kabur!","Humph, kalau jago jangan kabur!",},
        [411] = {1102,"Li Jue","Guan Yinping","Di depan masih ada Guo Si, mari kalahkan dia!","Di depan masih ada Guo Si, mari kalahkan dia!",},
        [412] = {1103,"Li Jue","Jia Xu","Jangan tergesa-gesa, aku memiliki rencana!","Jangan tergesa-gesa, aku memiliki rencana!",},
        [413] = {1103,"Li Jue","Jia Xu","Jika berhasil, kita akan menyelamatkan dunia dan berjasa pada istana, jika gagal, kabur juga belum terlambat.","Jika berhasil, kita akan menyelamatkan dunia dan berjasa pada istana, jika gagal, kabur juga belum terlambat.",},
        [414] = {1103,"Jia Xu","Li Jue","Wenhe, kamu selalu penuh akal, cepat katakan, rencana apa yang kamu miliki?","Wenhe, kamu selalu penuh akal, cepat katakan, rencana apa yang kamu miliki?",},
        [415] = {1103,"Li Jue","Jia Xu","Jika meninggalkan prajuritmu dan berlari sendiri, bahkan seorang kapten dapat menangkap kalian. Sebaiknya panggil pasukan dari kamp, menuju Chang'an dan membalaskan dendam untuk Dong Zhuo.","Jika meninggalkan prajuritmu dan berlari sendiri, bahkan seorang kapten dapat menangkap kalian. Sebaiknya panggil pasukan dari kamp, menuju Chang'an dan membalaskan dendam untuk Dong Zhuo.",},
        [416] = {1103,"Jia Xu","Li Jue","Rencana bagus, Wang Yun sedang membasmi sisa prajurit Dong Zhuo di Chang'an. Kita sebarkan rumor ke segala penjuru, bahwa Wang Yun akan membasmi orang Xiliang, lalu kita bisa memanggil pasukan dengan cepat dan kembali ke Chang'an.","Rencana bagus, Wang Yun sedang membasmi sisa prajurit Dong Zhuo di Chang'an. Kita sebarkan rumor ke segala penjuru, bahwa Wang Yun akan membasmi orang Xiliang, lalu kita bisa memanggil pasukan dengan cepat dan kembali ke Chang'an.",},
        [417] = {1104,"Protagonis","Zhang Xingcai","Tuan, ada masalah! Setelah Li Jue dan Guo Si kabur, mereka mendengar rencana Jia Xu dan menyebarkan rumor yang mengatakan, Kaisar akan membasmi orang Xiliang. Mereka mengumpulkan ratusan ribu orang dan menuju ke Chang'an.","Tuan, ada masalah! Setelah Li Jue dan Guo Si kabur, mereka mendengar rencana Jia Xu dan menyebarkan rumor yang mengatakan, Kaisar akan membasmi orang Xiliang. Mereka mengumpulkan ratusan ribu orang dan menuju ke Chang'an.",},
        [418] = {1104,"Protagonis","Zhang Xingcai","Kabarnya Wang Yun telah dibunuh, Li Jue dan Guo Si memaksa Kaisar Xian untuk mengangkat mereka menjadi Jenderal Besar!","Kabarnya Wang Yun telah dibunuh, Li Jue dan Guo Si memaksa Kaisar Xian untuk mengangkat mereka menjadi Jenderal Besar!",},
        [419] = {1104,"Zhang Xingcai","Protagonis","Bagaimana bisa! Ini sama saja membenarkan yang salah! Dimana Lu Bu, bukankah dia sedang melindungi kota Chang'an?","Bagaimana bisa! Ini sama saja membenarkan yang salah! Dimana Lu Bu, bukankah dia sedang melindungi kota Chang'an?",},
        [420] = {1104,"Protagonis","Guan Yinping","Lu Bu meskipun hebat, tetapi berpasukan sedikit, sedangkan Pasukan Xiliang ada ratusan ribu! Dengar-dengar dia telah memimpin beberapa bawahan untuk mencari perlindungan dari Yuan Shu di Huainan!","Lu Bu meskipun hebat, tetapi berpasukan sedikit, sedangkan Pasukan Xiliang ada ratusan ribu! Dengar-dengar dia telah memimpin beberapa bawahan untuk mencari perlindungan dari Yuan Shu di Huainan!",},
        [421] = {1104,"Guan Yinping","Protagonis","Karena begini, sebaiknya kita segera kembali ke Chang'an!","Karena begini, sebaiknya kita segera kembali ke Chang'an!",},
        [422] = {1105,"Jia Xu","Zhang Xingcai","Jia Xu, kalau buka karena rencana jahatmu, bagimana bisa Chang'an menderita seperti ini!","Jia Xu, kalau buka karena rencana jahatmu, bagimana bisa Chang'an menderita seperti ini!",},
        [423] = {1105,"Zhang Xingcai","Jia Xu","Aku adalah orang Liangzhou, ini hanyalah strategi untuk bertahan hidup! Jika bukan karena aku, pejabat yang mati di Chang'an kota ini akan lebih banyak!","Aku adalah orang Liangzhou, ini hanyalah strategi untuk bertahan hidup! Jika bukan karena aku, pejabat yang mati di Chang'an kota ini akan lebih banyak!",},
        [424] = {1105,"Zhang Xingcai","Jia Xu","Namun tenanglah, ada aku, pasti dapat menjaga Kaisar dan menteri-menteri. (Jia Xu pergi)","Namun tenanglah, ada aku, pasti dapat menjaga Kaisar dan menteri-menteri. (Jia Xu pergi)",},
        [425] = {1105,"Jia Xu","Zhang Xingcai","Sial! Jia Xu orang ini sangat licik, kabur tanpa diketahui siapapun!","Sial! Jia Xu orang ini sangat licik, kabur tanpa diketahui siapapun!",},
        [426] = {1106,"Protagonis","Zhang Xingcai","Tuan, Ma Teng Pemimpin Prefektur Xiliang dan Han Sui Pemerintah Prefektur Bingzhou telah memimpin pasukan untuk menyerang Li Jue dan Guo Si!","Tuan, Ma Teng Pemimpin Prefektur Xiliang dan Han Sui Pemerintah Prefektur Bingzhou telah memimpin pasukan untuk menyerang Li Jue dan Guo Si!",},
        [427] = {1106,"Protagonis","Zhang Xingcai","Ma Chao, putra Ma Teng, saat ini menantang untuk bertarung di luar sana. Menurutku pasti ada kesalahpahaman!","Ma Chao, putra Ma Teng, saat ini menantang untuk bertarung di luar sana. Menurutku pasti ada kesalahpahaman!",},
        [428] = {1106,"Zhang Xingcai","Guan Yinping","Wow, Ma Chao memiliki penampilan baik, wajahnya seperti giok, matanya seperti menembakkan bintang, tubuhnya seperti macan, lengan seperti kera. Masih berumur 17 tahun, tetapi sangat gagah!","Wow, Ma Chao memiliki penampilan baik, wajahnya seperti giok, matanya seperti menembakkan bintang, tubuhnya seperti macan, lengan seperti kera. Masih berumur 17 tahun, tetapi sangat gagah!",},
        [429] = {1106,"Guan Yinping","Zhang Xingcai","Kakak Yinping, apakah kamu berpindah hati?","Kakak Yinping, apakah kamu berpindah hati?",},
        [430] = {1106,"Zhang Xingcai","Guan Yinping","Cerewet! Aku hanya mengagumi kekuatan lawan!","Cerewet! Aku hanya mengagumi kekuatan lawan!",},
        [431] = {1106,"Protagonis","Ma Chao","Ma Mengqi disini! Para pemberontak, cepatlah keluar dan terima ajalmu!","Ma Mengqi disini! Para pemberontak, cepatlah keluar dan terima ajalmu!",},
        [432] = {1106,"Ma Chao","Protagonis","Ha, seorang Hero lagi. Ayo, kita temui dia!","Ha, seorang Hero lagi. Ayo, kita temui dia!",},
        [433] = {1106,"Ma Chao","Zhang Xingcai","Ma Chao kamu kesini untuk menyerang Li Jue dan Guo Si kan! Sudah jelas kita adalah teman, jangan-jangan kamu tidak mengenali Tuanku?","Ma Chao kamu kesini untuk menyerang Li Jue dan Guo Si kan! Sudah jelas kita adalah teman, jangan-jangan kamu tidak mengenali Tuanku?",},
        [434] = {1106,"Ma Chao","Guan Yinping","Kalahkan dia dulu!","Kalahkan dia dulu!",},
        [435] = {1107,"Ma Chao","Protagonis","Haha, pertarungan ini sangatlah menyenangkan!","Haha, pertarungan ini sangatlah menyenangkan!",},
        [436] = {1107,"Protagonis","Ma Chao","Ternyata kamu adalah Hero muda yang terkenal di antara para pangeran dan telah membunuh Dong Zhuo! Merupakan kehormatan bagi Ma Chao dapat berkenalan dengan jenderal!","Ternyata kamu adalah Hero muda yang terkenal di antara para pangeran dan telah membunuh Dong Zhuo! Merupakan kehormatan bagi Ma Chao dapat berkenalan dengan jenderal!",},
        [437] = {1107,"Ma Chao","Protagonis","Sayang sekali, telah membuatmu sia-sia datang kemari! Li Jue, Guo Si dan Jia Xu telah dikalahkan olehku!","Sayang sekali, telah membuatmu sia-sia datang kemari! Li Jue, Guo Si dan Jia Xu telah dikalahkan olehku!",},
        [438] = {1107,"Protagonis","Ma Chao","Haha, kok bisa sia-sia? Aku dapat berteman denganmu!","Haha, kok bisa sia-sia? Aku dapat berteman denganmu!",},
        [439] = {1107,"Protagonis","Ma Chao","Kakak, tentara kami akan kembali ke Liangzhou! Token Hero ini untukmu. Selanjutnya jika kamu datang ke Liang Zhou, aku akan menjamu dengan baik! (Ma Chao pamit)","Kakak, tentara kami akan kembali ke Liangzhou! Token Hero ini untukmu. Selanjutnya jika kamu datang ke Liang Zhou, aku akan menjamu dengan baik! (Ma Chao pamit)",},
        [440] = {1107,"Protagonis","Zhang Xingcai","Tuan, sementara tidak ada perang di Zhongyuan, selanjutnya kita akan kemana?","Tuan, sementara tidak ada perang di Zhongyuan, selanjutnya kita akan kemana?",},
        [441] = {1107,"Zhang Xingcai","Protagonis","Ada perang intens di arah timur laut Youzhou, Qingzhou dan Jizhou! Kakak-kakakku mengikut Gongsun Zan di Youzhou, tidak tahu bagaimana?","Ada perang intens di arah timur laut Youzhou, Qingzhou dan Jizhou! Kakak-kakakku mengikut Gongsun Zan di Youzhou, tidak tahu bagaimana?",},
        [442] = {1107,"Zhang Xingcai","Protagonis","Ayo, kita pergi ke Youzhou untuk kakak Liubei dan ayahmu!","Ayo, kita pergi ke Youzhou untuk kakak Liubei dan ayahmu!",},
        [443] = {1107,"Protagonis","Zhang Xingcai","Bagus! Dulu saat Ayah berada di sisi, aku selalu mengeluh dan mengomel sepanjang hari. Setelah pergi sangat lama, sekarang aku merindukannya!","Bagus! Dulu saat Ayah berada di sisi, aku selalu mengeluh dan mengomel sepanjang hari. Setelah pergi sangat lama, sekarang aku merindukannya!",},
        [444] = {1201,"Protagonis","Zhang Xingcai","Tuan, perjalanan ke Youzhou sangat jauh, kita berhenti sejenak di Jizhou, lalu melanjutkan ke Youzhou, bagaimana?","Tuan, perjalanan ke Youzhou sangat jauh, kita berhenti sejenak di Jizhou, lalu melanjutkan ke Youzhou, bagaimana?",},
        [445] = {1201,"Protagonis","Guan Yinping","Tuan, Gongsun Zan mengirimkan pesan! Coba lihat.","Tuan, Gongsun Zan mengirimkan pesan! Coba lihat.",},
        [446] = {1201,"Guan Yinping","Protagonis","Menurut pesan, Yuan Shao menyuruh Gongsun Zan menyerang Jizhou, lalu membagi menjadi dua.","Menurut pesan, Yuan Shao menyuruh Gongsun Zan menyerang Jizhou, lalu membagi menjadi dua.",},
        [447] = {1201,"Protagonis","Guan Yinping","Yuan Shao memang licik! Sudah jelas dia yang ingin merebut Jizhou, tetapi menyuruh Gongsun Zan untuk menyerang Jizhou.","Yuan Shao memang licik! Sudah jelas dia yang ingin merebut Jizhou, tetapi menyuruh Gongsun Zan untuk menyerang Jizhou.",},
        [448] = {1201,"Guan Yinping","Protagonis","Analisa Yinping sangat bagus. Siapa Pemerintah Jizhou sekarang?","Analisa Yinping sangat bagus. Siapa Pemerintah Jizhou sekarang?",},
        [449] = {1201,"Protagonis","Zhang Xingcai","Han Fu, Tuan! Tuan, Gongsun Zan menyerang Jizhou, ayah pasti juga disana, kita pergi bantu mereka!","Han Fu, Tuan! Tuan, Gongsun Zan menyerang Jizhou, ayah pasti juga disana, kita pergi bantu mereka!",},
        [450] = {1202,"Han Fu","Zhang Xingcai","Aiya, datang terlambat! Tentara Gongsun Zan masih belum tiba, tetapi Han Fu telah memberikan Jizhou pada Yuan Shao karena ketakutan!","Aiya, datang terlambat! Tentara Gongsun Zan masih belum tiba, tetapi Han Fu telah memberikan Jizhou pada Yuan Shao karena ketakutan!",},
        [451] = {1202,"Han Fu","Protagonis","Han Fu, kamu memang bodoh! Kenapa kamu bisa memberikan Jizhou pada Yuan Shao dengan mudah?","Han Fu, kamu memang bodoh! Kenapa kamu bisa memberikan Jizhou pada Yuan Shao dengan mudah?",},
        [452] = {1202,"Han Fu","Guan Yinping","Yuan Shao hanyalah seorang Pemimpin Prefektur Bohai yang tidak ada apa-apanya, tetapi Jizhou memiliki banyak uang, gandum dan populasi, tempat yang luas, mengapa takut padanya?","Yuan Shao hanyalah seorang Pemimpin Prefektur Bohai yang tidak ada apa-apanya, tetapi Jizhou memiliki banyak uang, gandum dan populasi, tempat yang luas, mengapa takut padanya?",},
        [453] = {1202,"Han Fu","Guan Yinping","Han Fu, jangan-jangan kamu tidak tahu bahwa Gongsun Zan menyerang Jizhou juga merupakan rencana licik Yuan Shao?","Han Fu, jangan-jangan kamu tidak tahu bahwa Gongsun Zan menyerang Jizhou juga merupakan rencana licik Yuan Shao?",},
        [454] = {1202,"Guan Yinping","Han Fu","Apa? Ini adalah siasat Yuan Shao? Aku telah tertipu!","Apa? Ini adalah siasat Yuan Shao? Aku telah tertipu!",},
        [455] = {1202,"Han Fu","Guan Yinping","Istana memang buta! Kamu memang lemah, bagaimana bisa menjadi Pemerintah Jizhou","Istana memang buta! Kamu memang lemah, bagaimana bisa menjadi Pemerintah Jizhou",},
        [456] = {1202,"Han Fu","Guan Yinping","Benar-benar pecundang, enyahlah!","Benar-benar pecundang, enyahlah!",},
        [457] = {1202,"Han Fu","Zhang Xingcai","Kakak Yinping hanya di mulut saja yang kejam, sebenarnya dia berhati lembut dan tidak bermaksud untuk mengatakan itu. Dia hanya mengingatkanmu, cepatlah lari dan selamatkan dirimu. Yuan Shao tidak akan membiarkanmu hidup!","Kakak Yinping hanya di mulut saja yang kejam, sebenarnya dia berhati lembut dan tidak bermaksud untuk mengatakan itu. Dia hanya mengingatkanmu, cepatlah lari dan selamatkan dirimu. Yuan Shao tidak akan membiarkanmu hidup!",},
        [458] = {1202,"Han Fu","Guan Yinping","Kamu cerewet!","Kamu cerewet!",},
        [459] = {1202,"Guan Yinping","Han Fu","Terima kasih, kalian berdua. (Han Fu kabur dengan memyesal)","Terima kasih, kalian berdua. (Han Fu kabur dengan memyesal)",},
        [460] = {1203,"Protagonis","Gongsun Yue","Jenderal bertarung dengan gagah, Gongsun Yue mengaku kalah!","Jenderal bertarung dengan gagah, Gongsun Yue mengaku kalah!",},
        [461] = {1203,"Gongsun Yue","Protagonis","Kamu adalah Gongsun Yue, lalu apa hubunganmu dengan Gongsun Zan?","Kamu adalah Gongsun Yue, lalu apa hubunganmu dengan Gongsun Zan?",},
        [462] = {1203,"Protagonis","Gongsun Yue","Gongsun Zan adalah kakakku! Kakakku mengirimku ke Jizhou, mencari Yuan Shao dan merebut tanah Jizhou.","Gongsun Zan adalah kakakku! Kakakku mengirimku ke Jizhou, mencari Yuan Shao dan merebut tanah Jizhou.",},
        [463] = {1203,"Protagonis","Gongsun Yue","Kakakku sangat berbakat sejak kecil, hebat dalam bertarung, pemimpin Wuheng di Liaoxi dikalahkan olehnya! Kakakku memang hebat!","Kakakku sangat berbakat sejak kecil, hebat dalam bertarung, pemimpin Wuheng di Liaoxi dikalahkan olehnya! Kakakku memang hebat!",},
        [464] = {1203,"Gongsun Yue","Protagonis","Hehe. (Lelaki kasar ini adalah fanboi Gongsun Zan)","Hehe. (Lelaki kasar ini adalah fanboi Gongsun Zan)",},
        [465] = {1203,"Gongsun Yue","Zhang Xingcai","Gongsun Yue, apakah kamu tahu Ayahku Zhang Fei berada dimana?","Gongsun Yue, apakah kamu tahu Ayahku Zhang Fei berada dimana?",},
        [466] = {1203,"Zhang Xingcai","Gongsun Yue","Oh, ayahmu sekarang berada di Prefektur Pingyuan.","Oh, ayahmu sekarang berada di Prefektur Pingyuan.",},
        [467] = {1203,"Gongsun Yue","Zhang Xingcai","Tuan, kita pergi ke Prefektur Pingyuan untuk mencari Ayahku!","Tuan, kita pergi ke Prefektur Pingyuan untuk mencari Ayahku!",},
        [468] = {1204,"Protagonis","Liu Bei","Adik keempat, lama tidak bertemu, kemampuanmu telah meningkat banyak!","Adik keempat, lama tidak bertemu, kemampuanmu telah meningkat banyak!",},
        [469] = {1204,"Liu Bei","Protagonis","Kakak, ternyata kamu adalah Menteri Pingyuan sekarang! Selamat, kakak-kakakku, kalian telah dipromosikan.","Kakak, ternyata kamu adalah Menteri Pingyuan sekarang! Selamat, kakak-kakakku, kalian telah dipromosikan.",},
        [470] = {1204,"Protagonis","Liu Bei","Dibandingkan dengan adik keempat, kami semua tidak ada apa-apanya! Jasa heroikmu di Luoyang dan Chang'an telah diketahui semua orang.","Dibandingkan dengan adik keempat, kami semua tidak ada apa-apanya! Jasa heroikmu di Luoyang dan Chang'an telah diketahui semua orang.",},
        [471] = {1204,"Liu Bei","Protagonis","Terima kasih kakak! Aku mendengar kabar bahwa ada pembunuh yang ingin membunuh kakak, tapi kakak memperlakukannya dengan baik, hingga orang itu sungkan dan kabur. Moral kakak sudah dikenal oleh semua orang!","Terima kasih kakak! Aku mendengar kabar bahwa ada pembunuh yang ingin membunuh kakak, tapi kakak memperlakukannya dengan baik, hingga orang itu sungkan dan kabur. Moral kakak sudah dikenal oleh semua orang!",},
        [472] = {1204,"Protagonis","Zhang Fei","Baik, kakak pertama dan adik keempat jangan membual lagi! Lihat kakak kedua, mukanya menjadi merah karena kalian!","Baik, kakak pertama dan adik keempat jangan membual lagi! Lihat kakak kedua, mukanya menjadi merah karena kalian!",},
        [473] = {1204,"Protagonis","Guan Yu","Enyah! Mukaku sudah merah dari dulu!","Enyah! Mukaku sudah merah dari dulu!",},
        [474] = {1204,"Protagonis","Zhang Fei","Hehe! Adik keempat, kekuatanmu bertambah lagi! Sini, beradu denganku dulu!","Hehe! Adik keempat, kekuatanmu bertambah lagi! Sini, beradu denganku dulu!",},
        [475] = {1205,"Gongsun Zan","Liu Bei","Kakak Gongsun, ada urusan apa datang ke Prefektur Pingyuan?","Kakak Gongsun, ada urusan apa datang ke Prefektur Pingyuan?",},
        [476] = {1205,"Liu Bei","Gongsun Zan","Xuande, cepat serahlan adik keempat! Dia telah membunuh adikku Gongsun Yue di Jizhou!","Xuande, cepat serahlan adik keempat! Dia telah membunuh adikku Gongsun Yue di Jizhou!",},
        [477] = {1205,"Gongsun Zan","Protagonis","Gongsun Zan, jangan memfitnahku! Aku pernah bertarung dengan Gongsun Yue, tapi aku tidak membunuhnya!","Gongsun Zan, jangan memfitnahku! Aku pernah bertarung dengan Gongsun Yue, tapi aku tidak membunuhnya!",},
        [478] = {1205,"Protagonis","Gongsun Zan","Bayar hidup adikku! Nyawa ditukar dengan nyawa!","Bayar hidup adikku! Nyawa ditukar dengan nyawa!",},
        [479] = {1206,"Gongsun Zan","Protagonis","Gongsun Zan, meskipun kamu memfitnahku, aku tidak akan membunuhmu Kuberitahu sekali lagi, aku tidak membunuh Gongsun Yue!","Gongsun Zan, meskipun kamu memfitnahku, aku tidak akan membunuhmu Kuberitahu sekali lagi, aku tidak membunuh Gongsun Yue!",},
        [480] = {1206,"Gongsun Zan","Liu Bei","Kakak Gongsun, sepertinya ada kesalahpahaman.","Kakak Gongsun, sepertinya ada kesalahpahaman.",},
        [481] = {1206,"Gongsun Zan","Zhang Fei","Benar! Adik keempat adalah orang yang adil dan jujur, dia bersungguh-sungguh! Aku bisa menjaminnya dengan nyawaku, pasti bukan adik keempat yang membunuh!","Benar! Adik keempat adalah orang yang adil dan jujur, dia bersungguh-sungguh! Aku bisa menjaminnya dengan nyawaku, pasti bukan adik keempat yang membunuh!",},
        [482] = {1206,"Gongsun Zan","Liu Bei","Kakak Gongsun, darimana kamu tahu kalau adik keempatku yang membunuh Gongsun Yue?","Kakak Gongsun, darimana kamu tahu kalau adik keempatku yang membunuh Gongsun Yue?",},
        [483] = {1206,"Liu Bei","Gongsun Zan","Yuan Shao mengirimkan surat padaku!","Yuan Shao mengirimkan surat padaku!",},
        [484] = {1206,"Gongsun Zan","Liu Bei","Kamu tertipu! Pasti Yuan Shao yang menduduki Jizhou tapi tidak ini berbagi denganmu. Jadi dia membunuh adikmu dan memfitnah adik keempatku! Ini yang kulihat, dia ingin menggunakan adik keempat untuk membunuhmu!","Kamu tertipu! Pasti Yuan Shao yang menduduki Jizhou tapi tidak ini berbagi denganmu. Jadi dia membunuh adikmu dan memfitnah adik keempatku! Ini yang kulihat, dia ingin menggunakan adik keempat untuk membunuhmu!",},
        [485] = {1206,"Gongsun Zan","Zhang Fei","Kakak, laporan pengintai! Yuan Shao mengirimkan seseorang berpura-pura jadi adik keempat dan membuat Gongsun Yue terbunuh karena hujan panah!","Kakak, laporan pengintai! Yuan Shao mengirimkan seseorang berpura-pura jadi adik keempat dan membuat Gongsun Yue terbunuh karena hujan panah!",},
        [486] = {1206,"Zhang Fei","Gongsun Zan","Rencana busuk Yuan Shao! Tidak bisa dipercaya dan rendahan! Aku akan mengumpulkan pasukan untuk menyerang Yuan Shao, jika tidak membunuh Yuan Shao maka aku bukanlah manusia!","Rencana busuk Yuan Shao! Tidak bisa dipercaya dan rendahan! Aku akan mengumpulkan pasukan untuk menyerang Yuan Shao, jika tidak membunuh Yuan Shao maka aku bukanlah manusia!",},
        [487] = {1206,"Zhang Fei","Gongsun Zan","Maafkan aku jenderal muda, akulah yang telah tertipu! Anggap Token Hero ini sebagai permintaan maaf, silahkan ambil!","Maafkan aku jenderal muda, akulah yang telah tertipu! Anggap Token Hero ini sebagai permintaan maaf, silahkan ambil!",},
        [488] = {1206,"Gongsun Zan","Protagonis","Pada saat itu aku memberikan posisi Pemimpin Pangeran kepada Yuan Shao. Tidak hanya tidak berterimakasih, masih berani memfitnahku! Ayo, aku akan membantumu melawan Yuan Shao!","Pada saat itu aku memberikan posisi Pemimpin Pangeran kepada Yuan Shao. Tidak hanya tidak berterimakasih, masih berani memfitnahku! Ayo, aku akan membantumu melawan Yuan Shao!",},
        [489] = {1301,"Yuan Shao","Gongsun Zan","Yuan Shao, pengkhianat ini, beraninya menjualku?","Yuan Shao, pengkhianat ini, beraninya menjualku?",},
        [490] = {1301,"Gongsun Zan","Yuan Shao","Han Fu tidak memiliki kemampuan apapun, dia memberikan Jizhou padaku secara sukarela. Apa hubungannya denganmu, Gongsun Zan?","Han Fu tidak memiliki kemampuan apapun, dia memberikan Jizhou padaku secara sukarela. Apa hubungannya denganmu, Gongsun Zan?",},
        [491] = {1301,"Yuan Shao","Protagonis","Yuan Shao, menurutku dulu kamu sangat tulus dan murah hati, karena itu aku merekomendasikanmu menjadi pemimpin. Perbuatanmu hari ini, kejam dan tidak bermoral, apakah kamu masih memiliki muka untuk hidup?","Yuan Shao, menurutku dulu kamu sangat tulus dan murah hati, karena itu aku merekomendasikanmu menjadi pemimpin. Perbuatanmu hari ini, kejam dan tidak bermoral, apakah kamu masih memiliki muka untuk hidup?",},
        [492] = {1301,"Yuan Shao","Protagonis","Cepat turun dari kuda dan menyerah, akan kulepaskan kamu atas nama keluarga Yuan!","Cepat turun dari kuda dan menyerah, akan kulepaskan kamu atas nama keluarga Yuan!",},
        [493] = {1301,"Protagonis","Yuan Shao","Sekarang aku memiliki tanah Jizhou, ada menteri yang memberi nasihat, jenderal yang bertarung untukku, prajurit yang banyak, dan gandum berlimpah. Mengapa aku takut padamu?","Sekarang aku memiliki tanah Jizhou, ada menteri yang memberi nasihat, jenderal yang bertarung untukku, prajurit yang banyak, dan gandum berlimpah. Mengapa aku takut padamu?",},
        [494] = {1301,"Protagonis","Yuan Shao","Dimana jenderalku Yan Liang dan Wen Chou? Bunuh mereka!","Dimana jenderalku Yan Liang dan Wen Chou? Bunuh mereka!",},
        [495] = {1301,"Yuan Shao","Protagonis","Han Fu orang bodoh ini, memang tidak tahu terima kasih!","Han Fu orang bodoh ini, memang tidak tahu terima kasih!",},
        [496] = {1301,"Yuan Shao","Protagonis","Yan Liang dan Wen Chou memangnya siapa, satu datang bunuh satu, dua datang bunuh dua-duanya!","Yan Liang dan Wen Chou memangnya siapa, satu datang bunuh satu, dua datang bunuh dua-duanya!",},
        [497] = {1302,"Zhang Xingcai","Wen Chou","Kemarin aku kalah bermain saat minum-minum dengan Yan Liang. Hari ini suasana ku tidak baik, kalian masih berani menantangku!","Kemarin aku kalah bermain saat minum-minum dengan Yan Liang. Hari ini suasana ku tidak baik, kalian masih berani menantangku!",},
        [498] = {1302,"Wen Chou","Zhang Xingcai","Wen Chou, aku tebak kamu lahir saat tengah malam kan?","Wen Chou, aku tebak kamu lahir saat tengah malam kan?",},
        [499] = {1302,"Zhang Xingcai","Wen Chou","Koq kamu bisa tahu?","Koq kamu bisa tahu?",},
        [500] = {1302,"Wen Chou","Zhang Xingcai","Karena jam 1 hingga jam 3 tengah malam adalah Waktu Chou! Hehe!","Karena jam 1 hingga jam 3 tengah malam adalah Waktu Chou! Hehe!",},
        [501] = {1302,"Zhang Xingcai","Wen Chou","Benar, aku lahir saat Waktu Chou!","Benar, aku lahir saat Waktu Chou!",},
        [502] = {1302,"Wen Chou","Guan Yinping","Bodoh dan jelek, tidak terselamatkan! Kakak Xingcai sedang menertawaimu, lihat ini!","Bodoh dan jelek, tidak terselamatkan! Kakak Xingcai sedang menertawaimu, lihat ini!",},
        [503] = {1303,"Zhang He","Zhang Xingcai","Sis, kamu sangat cantik!","Sis, kamu sangat cantik!",},
        [504] = {1303,"Zhang Xingcai","Zhang He","Kakak perempuan siapa? Aku Zhang He adalah lelaki murni! Tulen!","Kakak perempuan siapa? Aku Zhang He adalah lelaki murni! Tulen!",},
        [505] = {1303,"Zhang He","Zhang Xingcai","Ah, aku tidak percaya kalau kamu pria! Pasti membohongiku!","Ah, aku tidak percaya kalau kamu pria! Pasti membohongiku!",},
        [506] = {1303,"Zhang He","Zhang Xingcai","Sis, apa rahasia kecantikannya? Jual padaku, akan kubuat obatnya dan mendapat banyak keuntungan!","Sis, apa rahasia kecantikannya? Jual padaku, akan kubuat obatnya dan mendapat banyak keuntungan!",},
        [507] = {1303,"Zhang Xingcai","Zhang He","Gadis kecil, benar-benar nakal! Biarkan aku menggantikan orangtuamu memberikan pelajaran.","Gadis kecil, benar-benar nakal! Biarkan aku menggantikan orangtuamu memberikan pelajaran.",},
        [508] = {1304,"Gongsun Zan","Yuan Shao","Tidak disangka aku Yuan Shao bisa kalah pada suatu hari! Gongsun Zan, perintah dari Kaisar.","Tidak disangka aku Yuan Shao bisa kalah pada suatu hari! Gongsun Zan, perintah dari Kaisar.",},
        [509] = {1304,"Yuan Shao","Gongsun Zan","Baik, baik. Karena Kaisar telah mengirimkan seseorang untuk berdamai, maka berhenti peranglah!","Baik, baik. Karena Kaisar telah mengirimkan seseorang untuk berdamai, maka berhenti peranglah!",},
        [510] = {1304,"Protagonis","Yuan Shao","Token Hero ini adalah tanda permintaan maaf untuk Jenderal, silahkan ambil!","Token Hero ini adalah tanda permintaan maaf untuk Jenderal, silahkan ambil!",},
        [511] = {1304,"Yuan Shao","Protagonis","Baik! Akan kubiarkan kamu hidup karena Token Hero. (Gongsun Zan dan Yuan Shao pergi)","Baik! Akan kubiarkan kamu hidup karena Token Hero. (Gongsun Zan dan Yuan Shao pergi)",},
        [512] = {1304,"Protagonis","Zhang Xingcai","Aku mengira Gongsun Zan adalah seorang pahlawan, sekarang dia dan Yuan Shao tidak ada bedanya.","Aku mengira Gongsun Zan adalah seorang pahlawan, sekarang dia dan Yuan Shao tidak ada bedanya.",},
        [513] = {1304,"Protagonis","Guan Yinping","Benar begini, dulu dia bersumpah, kalau tidak membunuh Yuan Shao maka bukanlah manusia! Hasilnya, istana memberikan dia manfaat yang bagus, dan menarik pasukannya. Benar-benar tidak berguna!","Benar begini, dulu dia bersumpah, kalau tidak membunuh Yuan Shao maka bukanlah manusia! Hasilnya, istana memberikan dia manfaat yang bagus, dan menarik pasukannya. Benar-benar tidak berguna!",},
        [514] = {1304,"Protagonis","Zhang Xingcai","Masih beruntung kita tidak datang sia-sia, kita dapat Token Hero lagi! Tuan, selanjutnya kemana kita?","Masih beruntung kita tidak datang sia-sia, kita dapat Token Hero lagi! Tuan, selanjutnya kemana kita?",},
        [515] = {1304,"Zhang Xingcai","Protagonis","Residu Turban Kuning membuat kekacauan di Qingzhou, Cao Cao sedang membereskan mereka, mari bantu dia!","Residu Turban Kuning membuat kekacauan di Qingzhou, Cao Cao sedang membereskan mereka, mari bantu dia!",},
        [516] = {1401,"Protagonis","Cao Cao","Terima kasih Hero muda, jika bukan karena bantuanmu, aku tidak mungkin mengalahkan Turban Kuning semudah ini di Qingzhou!","Terima kasih Hero muda, jika bukan karena bantuanmu, aku tidak mungkin mengalahkan Turban Kuning semudah ini di Qingzhou!",},
        [517] = {1401,"Cao Cao","Protagonis","Kakak Mengde, aku mempunyai usulan. Turban Kuning di Qingzhou ini adalah orang miskin yang tidak bisa memberi makan mereka sendiri. Tidak perlu membunuh mereka, tapi jika mereka kabur dalam jumlah kecil, takutnya mereka akan membuat kacau lagi.","Kakak Mengde, aku mempunyai usulan. Turban Kuning di Qingzhou ini adalah orang miskin yang tidak bisa memberi makan mereka sendiri. Tidak perlu membunuh mereka, tapi jika mereka kabur dalam jumlah kecil, takutnya mereka akan membuat kacau lagi.",},
        [518] = {1401,"Cao Cao","Protagonis","Kakak Mengde mengapa tidak membawa mereka masuk ke dalam tentara sendiri? Pertama, dapat memperluas pengaruh. Kedua, mereka mendapatkan makanan. Ketiga, merubah bandit ini menjadi prajurit. Istana juga tenang, mungkin kamu juga akan mendapatkan pahala!","Kakak Mengde mengapa tidak membawa mereka masuk ke dalam tentara sendiri? Pertama, dapat memperluas pengaruh. Kedua, mereka mendapatkan makanan. Ketiga, merubah bandit ini menjadi prajurit. Istana juga tenang, mungkin kamu juga akan mendapatkan pahala!",},
        [519] = {1401,"Protagonis","Cao Cao","Baik! Hero muda sangat membangun dan meyakinkan, benar-benar membuatku terkagum!","Baik! Hero muda sangat membangun dan meyakinkan, benar-benar membuatku terkagum!",},
        [520] = {1401,"Cao Cao","Protagonis","Tidak masalah, meskipun aku tidak tertarik dengan ketenaran dan harta, tetapi bukan berarti aku tidak tahu!","Tidak masalah, meskipun aku tidak tertarik dengan ketenaran dan harta, tetapi bukan berarti aku tidak tahu!",},
        [521] = {1401,"Protagonis","Zhang Xingcai","Tuan sangat hebat, Xingcai sangat mengagumi Tuan!","Tuan sangat hebat, Xingcai sangat mengagumi Tuan!",},
        [522] = {1401,"Protagonis","Cao Cao","Hahaha, baik! Sesuai perkataan Hero muda, untuk memanggil Turban Kuning di Qingzhou dan menamai tentara ini sebagai Tentara Qingzhou!","Hahaha, baik! Sesuai perkataan Hero muda, untuk memanggil Turban Kuning di Qingzhou dan menamai tentara ini sebagai Tentara Qingzhou!",},
        [523] = {1401,"Protagonis","Zhang Xingcai","Tuan, kabarmu berada di Yanzhou tidak sengaja tersebar, banyak figur yang datang untuk bertemu, jenderal dan menteri semuanya ada.","Tuan, kabarmu berada di Yanzhou tidak sengaja tersebar, banyak figur yang datang untuk bertemu, jenderal dan menteri semuanya ada.",},
        [524] = {1401,"Zhang Xingcai","Protagonis","Oh, siapakah kalian? Kakak Mengde, mari kita beradu dengan mereka!","Oh, siapakah kalian? Kakak Mengde, mari kita beradu dengan mereka!",},
        [525] = {1402,"Guan Yinping","Dian Wei","Dengar-dengar nama kalian sangat terkenal, berkekuatan hebat, Dian Wei ingin melihat kekuatan kalian, ayo beradu! Heh!","Dengar-dengar nama kalian sangat terkenal, berkekuatan hebat, Dian Wei ingin melihat kekuatan kalian, ayo beradu! Heh!",},
        [526] = {1402,"Dian Wei","Guan Yinping","Kamu terlalu memandang tinggi kemampuanmu, benar-benar berani!","Kamu terlalu memandang tinggi kemampuanmu, benar-benar berani!",},
        [527] = {1402,"Guan Yinping","Dian Wei","Nona, kamu terlalu kurus, senjataku terlalu berat untukmu! Pergilah, panggil Tuanmu kemari!","Nona, kamu terlalu kurus, senjataku terlalu berat untukmu! Pergilah, panggil Tuanmu kemari!",},
        [528] = {1402,"Dian Wei","Protagonis","Tuan, jangan mengganggu orangku! Aku bertanya, apakah berani bertaruh denganku?","Tuan, jangan mengganggu orangku! Aku bertanya, apakah berani bertaruh denganku?",},
        [529] = {1402,"Dian Wei","Protagonis","Jika kamu menang, mau dibunuh atau dipotong juga terserah! Jika aku menang, kamu harus berjanji satu hal padaku!","Jika kamu menang, mau dibunuh atau dipotong juga terserah! Jika aku menang, kamu harus berjanji satu hal padaku!",},
        [530] = {1402,"Protagonis","Dian Wei","Memang aku takut?","Memang aku takut?",},
        [531] = {1402,"Dian Wei","Protagonis","Bagus! Mari, kita bertarung!","Bagus! Mari, kita bertarung!",},
        [532] = {1403,"Protagonis","Dian Wei","Hero memang hebat! Dian Wei mengaku kalah!","Hero memang hebat! Dian Wei mengaku kalah!",},
        [533] = {1403,"Protagonis","Dian Wei","Katakan, apa yang kamu ingin untuk kulakukan? Aku Dian Wei meskipun gegabah, tetapi akan menepati janji, tidak pernah melanggarnya.","Katakan, apa yang kamu ingin untuk kulakukan? Aku Dian Wei meskipun gegabah, tetapi akan menepati janji, tidak pernah melanggarnya.",},
        [534] = {1403,"Dian Wei","Protagonis","Tidak separah itu! Cao Cao adalah orang berprospek, aku ingin kamu mengikuti dia dan menjaganya, bisakah kamu melakukannya?","Tidak separah itu! Cao Cao adalah orang berprospek, aku ingin kamu mengikuti dia dan menjaganya, bisakah kamu melakukannya?",},
        [535] = {1403,"Protagonis","Dian Wei","Baik! Cao Cao, selanjutnya aku akan menjadi pelindungmu, menjaga keamananmu dengan hidupku, apakah kamu setuju?","Baik! Cao Cao, selanjutnya aku akan menjadi pelindungmu, menjaga keamananmu dengan hidupku, apakah kamu setuju?",},
        [536] = {1403,"Dian Wei","Cao Cao","Setuju!","Setuju!",},
        [537] = {1404,"Protagonis","Xun Yu","Jenderal memang ahil strategi dan militer, membuatku terkagum, Xun Yu bersedia untuk mengikut jenderal. Ini adalah Token Hero keluarga Xun dan akan kuberikan padamu.","Jenderal memang ahil strategi dan militer, membuatku terkagum, Xun Yu bersedia untuk mengikut jenderal. Ini adalah Token Hero keluarga Xun dan akan kuberikan padamu.",},
        [538] = {1404,"Xun Yu","Protagonis","Token Hero ini akan kuambil! Tetapi aku sangat menyukai kebebasan, tujuanku adalah menjadi Hero terkuat di Tiga Negara!","Token Hero ini akan kuambil! Tetapi aku sangat menyukai kebebasan, tujuanku adalah menjadi Hero terkuat di Tiga Negara!",},
        [539] = {1404,"Xun Yu","Protagonis","Aku akan merekomendasikan seseorang untukmu, kamu ikuti dia, dia lebih bisa membantu untuk mewujudkan ambisimu.","Aku akan merekomendasikan seseorang untukmu, kamu ikuti dia, dia lebih bisa membantu untuk mewujudkan ambisimu.",},
        [540] = {1404,"Protagonis","Xun Yu","Siapa yang kamu maksudkan?","Siapa yang kamu maksudkan?",},
        [541] = {1404,"Xun Yu","Protagonis","Kuperkenalkan seseorang padamu, dia bernama Cao Cao, nama kehormatan Mengde, dia adalah teman baikku.","Kuperkenalkan seseorang padamu, dia bernama Cao Cao, nama kehormatan Mengde, dia adalah teman baikku.",},
        [542] = {1404,"Xun Yu","Cao Cao","Ternyata Xun Yu, sosok terkenal di Yingchuan! Hebat! Dapat datang kesisiku, seperti Zhang Liang kepada Liu Bang Kaisar Gaozu Dinasti Han.","Ternyata Xun Yu, sosok terkenal di Yingchuan! Hebat! Dapat datang kesisiku, seperti Zhang Liang kepada Liu Bang Kaisar Gaozu Dinasti Han.",},
        [543] = {1404,"Xun Yu","Cao Cao","Terima kasih Hero muda, telah merekomendasikan banyak talenta kepadaku, aku sangat berterima kasih, tidak tahu bagaimana cara membalasmu?","Terima kasih Hero muda, telah merekomendasikan banyak talenta kepadaku, aku sangat berterima kasih, tidak tahu bagaimana cara membalasmu?",},
        [544] = {1404,"Cao Cao","Protagonis","Baiklah, kita adalah saudara, tidak perlu sungkan! Kalian bicara dengan santai, aku bersiap untuk meninggalkan Yanzhou dan berkeliling, sampai jumpa!","Baiklah, kita adalah saudara, tidak perlu sungkan! Kalian bicara dengan santai, aku bersiap untuk meninggalkan Yanzhou dan berkeliling, sampai jumpa!",},
        [545] = {1404,"Protagonis","Zhang Xingcai","Sejak itu, Cao Cao sangat didukung oleh menteri bijaksana dan jenderal hebat di Yanzhou. Dia menjadi orang yang berkuasa. Di dunia ini, hanya ada Yuan Shao dan Yuan Shu yang dapat mengimbanginya!","Sejak itu, Cao Cao sangat didukung oleh menteri bijaksana dan jenderal hebat di Yanzhou. Dia menjadi orang yang berkuasa. Di dunia ini, hanya ada Yuan Shao dan Yuan Shu yang dapat mengimbanginya!",},
        [546] = {1404,"Protagonis","Guan Yinping","Tuan, kekuatan Cao Cao sangat besar, jika dia membalikkan badan pada kami bagaimana?","Tuan, kekuatan Cao Cao sangat besar, jika dia membalikkan badan pada kami bagaimana?",},
        [547] = {1404,"Guan Yinping","Protagonis","Zhuang Zi mengatakan, hubungan alami lebih baik daripada hubungan terkendali. Artinya, berteman tanpa membawa tujuan lain, jika terlalu banyak pertimbangan, maka ini tidak ada artinya.","Zhuang Zi mengatakan, hubungan alami lebih baik daripada hubungan terkendali. Artinya, berteman tanpa membawa tujuan lain, jika terlalu banyak pertimbangan, maka ini tidak ada artinya.",},
        [548] = {1404,"Protagonis","Guan Yinping","Perkataan Tuan sangat masuk akal, aku telah belajar sesuatu!","Perkataan Tuan sangat masuk akal, aku telah belajar sesuatu!",},
        [549] = {1404,"Protagonis","Zhang Xingcai","Tuan, dengar-dengar di Xuzhou ada petunjuk Token Hero, kita pergi ke Xuzhou untuk melihatnya!","Tuan, dengar-dengar di Xuzhou ada petunjuk Token Hero, kita pergi ke Xuzhou untuk melihatnya!",},
        [550] = {1501,"Cao Song","Guan Yinping","Tiba di Xuzhou! Eh, siapa orang yang di depan itu? Membawa banyak emas dan ingot.","Tiba di Xuzhou! Eh, siapa orang yang di depan itu? Membawa banyak emas dan ingot.",},
        [551] = {1501,"Cao Song","Zhang Xingcai","Dari kecil Ayah mengajariku, jangan menunjukkan kekayaan sendiri kepada orang lain, dengan begini dia akan mencari masalah cepat atau lambat.","Dari kecil Ayah mengajariku, jangan menunjukkan kekayaan sendiri kepada orang lain, dengan begini dia akan mencari masalah cepat atau lambat.",},
        [552] = {1501,"Guan Yinping","Cao Song","Dua nona kecil, apa yang kalian katakan? Siapa yang berani merampok harta Cao Song! Aku memperingatkan kalian, anakku adalah Cao Cao! Membuat kesalahan padaku dan aku akan memberikan masalah besar!","Dua nona kecil, apa yang kalian katakan? Siapa yang berani merampok harta Cao Song! Aku memperingatkan kalian, anakku adalah Cao Cao! Membuat kesalahan padaku dan aku akan memberikan masalah besar!",},
        [553] = {1501,"Cao Song","Guan Yinping","Lihat dirimu, penjahat berlagak tinggi! Jika bukan karena Tuanku, Cao Cao pasti sudah mati di Yingyang!","Lihat dirimu, penjahat berlagak tinggi! Jika bukan karena Tuanku, Cao Cao pasti sudah mati di Yingyang!",},
        [554] = {1501,"Guan Yinping","Cao Song","Omong kosong! Orang kampung mana, beraninya membual disini!","Omong kosong! Orang kampung mana, beraninya membual disini!",},
        [555] = {1501,"Cao Song","Guan Yinping","Beraninya memanggil Tuanku orang desa, lihat ini!","Beraninya memanggil Tuanku orang desa, lihat ini!",},
        [556] = {1502,"Tao Qian","Guan Yinping","Tao Qian, kamu adalah pemimpin Xuzhou. Apakah kamu memiliki Token Hero?","Tao Qian, kamu adalah pemimpin Xuzhou. Apakah kamu memiliki Token Hero?",},
        [557] = {1502,"Guan Yinping","Tao Qian","Sejujurnya, aku benar-benar tidak tahu dimana adanya Token Hero di Xuzhou?","Sejujurnya, aku benar-benar tidak tahu dimana adanya Token Hero di Xuzhou?",},
        [558] = {1502,"Tao Qian","Guan Yinping","Tidak ada?","Tidak ada?",},
        [559] = {1502,"Guan Yinping","Tao Qian","Aku telah diajar dengan cara Kong Hu Cu dan Mensius. Aku tidak akan berbohong sedikitpun.","Aku telah diajar dengan cara Kong Hu Cu dan Mensius. Aku tidak akan berbohong sedikitpun.",},
        [560] = {1502,"Tao Qian","Protagonis","Lupakan, Tao Qian terlihat seperti orang baik, karena tidak ada, kita mencari di tempat lain.","Lupakan, Tao Qian terlihat seperti orang baik, karena tidak ada, kita mencari di tempat lain.",},
        [561] = {1503,"Protagonis","Zhang Xingcai","Tuan, ada masalah besar!","Tuan, ada masalah besar!",},
        [562] = {1503,"Zhang Xingcai","Protagonis","Xingcai, tenang. Jangan tergesa-gesa, ada apa?","Xingcai, tenang. Jangan tergesa-gesa, ada apa?",},
        [563] = {1503,"Protagonis","Zhang Xingcai","Cao Cao mengirim seseorang ke Chenliu untuk menjemput ayahnya Cao Song, saat melewati Xuzhou, Tao Qian menjamu mereka dengan baik, juga mengirimkan orang untuk mengantar mereka…","Cao Cao mengirim seseorang ke Chenliu untuk menjemput ayahnya Cao Song, saat melewati Xuzhou, Tao Qian menjamu mereka dengan baik, juga mengirimkan orang untuk mengantar mereka…",},
        [564] = {1503,"Zhang Xingcai","Guan Yinping","Cih, Tao Qian sepertinya ingin menjilat Cao Cao, dengan melayani Cao Song. Ini juga bukan masalah besar.","Cih, Tao Qian sepertinya ingin menjilat Cao Cao, dengan melayani Cao Song. Ini juga bukan masalah besar.",},
        [565] = {1503,"Guan Yinping","Zhang Xingcai","Dengarkan aku dulu! Orang yang dikirim oleh Tao Qian adalah Zhang Kai, salah satu dari Turban Kuning. Dia telah membunuh Cao Song dan keluarganya, mengambil semua emas dan menjadi bandit di gunung yang dalam.","Dengarkan aku dulu! Orang yang dikirim oleh Tao Qian adalah Zhang Kai, salah satu dari Turban Kuning. Dia telah membunuh Cao Song dan keluarganya, mengambil semua emas dan menjadi bandit di gunung yang dalam.",},
        [566] = {1503,"Zhang Xingcai","Protagonis","Niat baik Tao Qian menjadi bumerang, dia membuat kesalahan besar terhadap Cao Cao! Cao Cao adalah pendendam, ini…","Niat baik Tao Qian menjadi bumerang, dia membuat kesalahan besar terhadap Cao Cao! Cao Cao adalah pendendam, ini…",},
        [567] = {1503,"Zhang Xingcai","Guan Yinping","Cao Song dibunuh karena kekayaannya. Xingcai, setiap kali bernubuat selalu tepat, cepat beritahu aku, apa rahasiamu?","Cao Song dibunuh karena kekayaannya. Xingcai, setiap kali bernubuat selalu tepat, cepat beritahu aku, apa rahasiamu?",},
        [568] = {1503,"Guan Yinping","Zhang Xingcai","Guan Yinping, jangan menyela!","Guan Yinping, jangan menyela!",},
        [569] = {1503,"Protagonis","Zhang Xingcai","Tuan, kabar telah sampai ke Yanzhou, Cao Cao mengirimkan ratusan ribu pasukan untuk menyerang Xuzhou. Cao Cao juga menambahkan, akan membunuh semua orang di Xuzhou untuk balas dendam!","Tuan, kabar telah sampai ke Yanzhou, Cao Cao mengirimkan ratusan ribu pasukan untuk menyerang Xuzhou. Cao Cao juga menambahkan, akan membunuh semua orang di Xuzhou untuk balas dendam!",},
        [570] = {1503,"Zhang Xingcai","Protagonis","Rakyat Xuzhou tidak bersalah, kita segera kembali ke Yanzhou untuk menghentikan Cao Cao!","Rakyat Xuzhou tidak bersalah, kita segera kembali ke Yanzhou untuk menghentikan Cao Cao!",},
        [571] = {1504,"Protagonis","Chen Gong","Jenderal, sudah lama tidak bertemu sejak kita berpisah di Chenliu!","Jenderal, sudah lama tidak bertemu sejak kita berpisah di Chenliu!",},
        [572] = {1504,"Chen Gong","Protagonis","Chen Gong, aku ingin bertanya padamu, saat berada di Prefektur Zhongmou, menurutku kamu sangat mengagumi Cao Cao, lalu mengapa berpisah dengannya?","Chen Gong, aku ingin bertanya padamu, saat berada di Prefektur Zhongmou, menurutku kamu sangat mengagumi Cao Cao, lalu mengapa berpisah dengannya?",},
        [573] = {1504,"Protagonis","Chen Gong","Itu karena keluarga Lu Bushe… aku juga tidak ingin membahas ini lagi.","Itu karena keluarga Lu Bushe… aku juga tidak ingin membahas ini lagi.",},
        [574] = {1504,"Protagonis","Chen Gong","Saat itu aku melihat Cao Cao memiliki ambisi besar, dan aku meninggalkan posisiku untuk mengikuti dia, tidak disangka dia penuh curiga, kejam, tanpa belas kasihan, membuatku meninggalkan dia.","Saat itu aku melihat Cao Cao memiliki ambisi besar, dan aku meninggalkan posisiku untuk mengikuti dia, tidak disangka dia penuh curiga, kejam, tanpa belas kasihan, membuatku meninggalkan dia.",},
        [575] = {1504,"Protagonis","Chen Gong","Saat ini Xuzhou berada dalam bahaya, aku dan Tao Qian memiliki hubungan baik, jadi aku bergegas menuju Yanzhou untuk menghentikan Cao Cao.","Saat ini Xuzhou berada dalam bahaya, aku dan Tao Qian memiliki hubungan baik, jadi aku bergegas menuju Yanzhou untuk menghentikan Cao Cao.",},
        [576] = {1504,"Protagonis","Chen Gong","Urusan ini darurat, aku pergi dulu, sampai jumpa!","Urusan ini darurat, aku pergi dulu, sampai jumpa!",},
        [577] = {1504,"Protagonis","Zhang Xingcai","Chen Gong berlari dengan cepat, Tuan, menurutmu apakah dia bisa membujuk Cao Cao?","Chen Gong berlari dengan cepat, Tuan, menurutmu apakah dia bisa membujuk Cao Cao?",},
        [578] = {1504,"Zhang Xingcai","Protagonis","Belum tentu! Mungkin hanya akulah yang dapat menangani.","Belum tentu! Mungkin hanya akulah yang dapat menangani.",},
        [579] = {1505,"Chen Gong","Cao Cao","Chen Gong, kamu telah meninggalkanku, dan sekarang masih berani untuk bertemu denganku?!","Chen Gong, kamu telah meninggalkanku, dan sekarang masih berani untuk bertemu denganku?!",},
        [580] = {1505,"Chen Gong","Cao Cao","Tao Qian membunuh keluargaku, aku pasti akan membalas dendam! Apapun yang kamu katakan, semuanya tidak berguna!","Tao Qian membunuh keluargaku, aku pasti akan membalas dendam! Apapun yang kamu katakan, semuanya tidak berguna!",},
        [581] = {1505,"Cao Cao","Chen Gong","Aku tidak bisa menemui Tao Qian seperti ini! (Chen Gong pergi dengan putus asa)","Aku tidak bisa menemui Tao Qian seperti ini! (Chen Gong pergi dengan putus asa)",},
        [582] = {1505,"Chen Gong","Cao Cao","Dendam pembunuhan ayah adalah dendam yang sangat mendalam, jika aku tidak menyelesaikan ini, apakah aku masih memiliki muka untuk hidup di dunia ini?","Dendam pembunuhan ayah adalah dendam yang sangat mendalam, jika aku tidak menyelesaikan ini, apakah aku masih memiliki muka untuk hidup di dunia ini?",},
        [583] = {1505,"Chen Gong","Cao Cao","Cao Ren, aku akan mengirimmu sebagai komandan, untuk menyerabn Xuzhou! Aku akan membunuh semua orang di Xuzhou, sebagai pemakaman ayahku!","Cao Ren, aku akan mengirimmu sebagai komandan, untuk menyerabn Xuzhou! Aku akan membunuh semua orang di Xuzhou, sebagai pemakaman ayahku!",},
        [584] = {1505,"Cao Cao","Cao Ren","Cao Ren menjalankan perintah!","Cao Ren menjalankan perintah!",},
        [585] = {1506,"Protagonis","Cao Ren","Hero muda, ilmu sangat hebat, Cao Ren mengaku kalah! Silahkan ambil Token Hero ini!","Hero muda, ilmu sangat hebat, Cao Ren mengaku kalah! Silahkan ambil Token Hero ini!",},
        [586] = {1506,"Cao Ren","Protagonis","Cao Cao mana? Mengapa dia menghindariku?","Cao Cao mana? Mengapa dia menghindariku?",},
        [587] = {1506,"Protagonis","Cao Ren","Jenderal, seharusnya tahu dengan jelas. Tuan tahu kamu datang untuk negosiasi, dan tidak ingiin bermusuhan denganmu, jadi dia memilih untuk menghindariku dan mengirimkanku untuk membawa prajurit! (Cao Ren mundur)","Jenderal, seharusnya tahu dengan jelas. Tuan tahu kamu datang untuk negosiasi, dan tidak ingiin bermusuhan denganmu, jadi dia memilih untuk menghindariku dan mengirimkanku untuk membawa prajurit! (Cao Ren mundur)",},
        [588] = {1506,"Protagonis","Guan Yinping","Humph, Cao Cao memang licik, dia menghindariku!","Humph, Cao Cao memang licik, dia menghindariku!",},
        [589] = {1506,"Guan Yinping","Zhang Xingcai","Tuan, menurut perkataan Chen Gong, Cao Cao ini apakah sungguh-sungguh mudah curiga dan sadis?","Tuan, menurut perkataan Chen Gong, Cao Cao ini apakah sungguh-sungguh mudah curiga dan sadis?",},
        [590] = {1506,"Zhang Xingcai","Guan Yinping","Membalaskan dendam ayahnya, itu hanyalah alasan! Yang kulihat adalah Cao Cao ingin merebut wilayah Tao Qian dan ingin mengambil Token Hero di Xuzhou!","Membalaskan dendam ayahnya, itu hanyalah alasan! Yang kulihat adalah Cao Cao ingin merebut wilayah Tao Qian dan ingin mengambil Token Hero di Xuzhou!",},
        [591] = {1506,"Guan Yinping","Protagonis","Karena Cao Cao tidak ingin menemui saya, mari kita pergi membantu Xuzhou. Bagaimanapun, rakyat tidak bersalah!","Karena Cao Cao tidak ingin menemui saya, mari kita pergi membantu Xuzhou. Bagaimanapun, rakyat tidak bersalah!",},
        [592] = {1601,"Protagonis","Tao Qian","(Menatap langit dengan menangis) Awalnya aku berpikir untuk berteman dengan Cao Cao, tidak disangka membuat Xuzhou jatuh dalam masalah! Aku sangat bersalah terhadap Xuzhou!","(Menatap langit dengan menangis) Awalnya aku berpikir untuk berteman dengan Cao Cao, tidak disangka membuat Xuzhou jatuh dalam masalah! Aku sangat bersalah terhadap Xuzhou!",},
        [593] = {1601,"Tao Qian","Protagonis","Tuan Tao, jangan takut! Aku akan membantu mengusir Cao Cao!","Tuan Tao, jangan takut! Aku akan membantu mengusir Cao Cao!",},
        [594] = {1601,"Protagonis","Tao Qian","(Melihat dengan air mata lagi) Hero memang murah hati! Tidak disangka pada saat kritis seperti ini, masih ada orang yang mau membantu Xuzhou!","(Melihat dengan air mata lagi) Hero memang murah hati! Tidak disangka pada saat kritis seperti ini, masih ada orang yang mau membantu Xuzhou!",},
        [595] = {1601,"Protagonis","Zhang Xingcai","Tuanku tidak terkalahkan, tampan dan hebat, pahlawan no.1 di dunia!","Tuanku tidak terkalahkan, tampan dan hebat, pahlawan no.1 di dunia!",},
        [596] = {1601,"Zhang Xingcai","Protagonis","Hehe, mulut Xingcai sangat manis, aku sungguh menyukainya!","Hehe, mulut Xingcai sangat manis, aku sungguh menyukainya!",},
        [597] = {1602,"Tao Qian","Mi Zhu","Tuan Tao, saya memiliki rencana!","Tuan Tao, saya memiliki rencana!",},
        [598] = {1602,"Mi Zhu","Tao Qian","Katakan!","Katakan!",},
        [599] = {1602,"Tao Qian","Mi Zhu","Sebaiknya mengirimkan orang untuk mencari bantuan dari Beihai! Beihai bersebelahan dengan Xuzhou dan Kong Rong Pemerintah Beihai adalah keturunan ke-20 dari Kong Hu Cu. Dia pasti bermurah hati dan bersedia untuk membantu.","Sebaiknya mengirimkan orang untuk mencari bantuan dari Beihai! Beihai bersebelahan dengan Xuzhou dan Kong Rong Pemerintah Beihai adalah keturunan ke-20 dari Kong Hu Cu. Dia pasti bermurah hati dan bersedia untuk membantu.",},
        [600] = {1602,"Mi Zhu","Protagonis","Pemimpin Prefektur Beihai adalah Kong Rong! Tidak perlu mengirim orang, saya yang pergi!","Pemimpin Prefektur Beihai adalah Kong Rong! Tidak perlu mengirim orang, saya yang pergi!",},
        [601] = {1602,"Mi Zhu","Protagonis","Hehe, kebetulan ingin pergi untuk melihat Kong Rong yang dikenal dengan kasih persaudaraan. Seperti apakah keturunan ke-20 dari Kong Hu Cu?","Hehe, kebetulan ingin pergi untuk melihat Kong Rong yang dikenal dengan kasih persaudaraan. Seperti apakah keturunan ke-20 dari Kong Hu Cu?",},
        [602] = {1603,"Zhang Xingcai","Kong Rong","Siapa kamu? Mengapa kamu datang ke Beihai?","Siapa kamu? Mengapa kamu datang ke Beihai?",},
        [603] = {1603,"Kong Rong","Zhang Xingcai","Hei, Kong Rong! Sopanlah saat bertemu dengan Tuanku! Tuanku adalah Hero gagah yang sangat terkenal, merupakan Hero terkuat di Tiga Negara di masa depan!","Hei, Kong Rong! Sopanlah saat bertemu dengan Tuanku! Tuanku adalah Hero gagah yang sangat terkenal, merupakan Hero terkuat di Tiga Negara di masa depan!",},
        [604] = {1603,"Zhang Xingcai","Kong Rong","Aku tidak percaya! Hero mulai sejak muda! Jangan remehkan umurku yang muda, aku ini sangat hebat!","Aku tidak percaya! Hero mulai sejak muda! Jangan remehkan umurku yang muda, aku ini sangat hebat!",},
        [605] = {1603,"Kong Rong","Guan Yinping","Adik, seberapa besar kemampuanmu? Beradu denganku dulu!","Adik, seberapa besar kemampuanmu? Beradu denganku dulu!",},
        [606] = {1604,"Protagonis","Kong Rong","Ah, kamu! Ternyata kamu adalah Hero hebat yang membasmi Turban Kuning, terkenal di Gerbang Hulao, membunuh Dong Zhuo! Bagus, aku mengagumimu sejak lama!","Ah, kamu! Ternyata kamu adalah Hero hebat yang membasmi Turban Kuning, terkenal di Gerbang Hulao, membunuh Dong Zhuo! Bagus, aku mengagumimu sejak lama!",},
        [607] = {1604,"Kong Rong","Protagonis","Terima kasih! Jika Cao Cao ingin menyerang Xuzhou, Beihai, berdasarkan lokasinya yang dekat, kamu harus membantu Xuzhou!","Terima kasih! Jika Cao Cao ingin menyerang Xuzhou, Beihai, berdasarkan lokasinya yang dekat, kamu harus membantu Xuzhou!",},
        [608] = {1604,"Protagonis","Kong Rong","Hero, aku memiliki niat tapi tidak berkekuatan! Beihai sendiri dalam bahaya, Residu Turban Kuning menyerang kota! Kebetulan ada seorang pejuang yang datang membantu, dia sangat kuat dan mengusir Turban Kuning saat ini!","Hero, aku memiliki niat tapi tidak berkekuatan! Beihai sendiri dalam bahaya, Residu Turban Kuning menyerang kota! Kebetulan ada seorang pejuang yang datang membantu, dia sangat kuat dan mengusir Turban Kuning saat ini!",},
        [609] = {1604,"Kong Rong","Protagonis","Petarung kuat? Siapa? Ayo, tanganku sudah gatal. Aku ingin bertarung dengan orang kuat!","Petarung kuat? Siapa? Ayo, tanganku sudah gatal. Aku ingin bertarung dengan orang kuat!",},
        [610] = {1605,"Protagonis","Taishi Ci","Hebat. Taishi Ci mengaku kalah! Aku mendapat Token Hero ini dari almarhum ayahku. Akan kuberikan ini untukmu!","Hebat. Taishi Ci mengaku kalah! Aku mendapat Token Hero ini dari almarhum ayahku. Akan kuberikan ini untukmu!",},
        [611] = {1605,"Taishi Ci","Protagonis","Terima kasih banyak! Hehe, kondisi tiba-tiba berubah menjadi baik, aku kira ini akan menjadi perjalanan yang sia-sia.","Terima kasih banyak! Hehe, kondisi tiba-tiba berubah menjadi baik, aku kira ini akan menjadi perjalanan yang sia-sia.",},
        [612] = {1605,"Protagonis","Kong Rong","Kalian berdua memang berani, tetapi dua tangan tidak bisa melawan empat tangan! Dengar-dengar Liu Xuande dari Pingyuan adalah Hero besar, sebaiknya meminta Liu Xuande untuk menolong Xuzhou! Tetapi tidak tahu apakah dia bersedia untuk datang.","Kalian berdua memang berani, tetapi dua tangan tidak bisa melawan empat tangan! Dengar-dengar Liu Xuande dari Pingyuan adalah Hero besar, sebaiknya meminta Liu Xuande untuk menolong Xuzhou! Tetapi tidak tahu apakah dia bersedia untuk datang.",},
        [613] = {1605,"Kong Rong","Protagonis","Liu Xuande adalah saudaraku paling besar! Dia penuh kebaikan, pasti mau! Biarkan aku pergi, biarkan aku pergi!","Liu Xuande adalah saudaraku paling besar! Dia penuh kebaikan, pasti mau! Biarkan aku pergi, biarkan aku pergi!",},
        [614] = {1605,"Kong Rong","Protagonis","Taishi Ci, bersediakah untuk ikut denganku?","Taishi Ci, bersediakah untuk ikut denganku?",},
        [615] = {1605,"Protagonis","Taishi Ci","Maafkan aku, aku tidak bisa pergi denganmu, dan harus menjaga ibuku yang sudah tua, maka dari itu tidak bisa pergi jauh. (Taishi Ci pergi)","Maafkan aku, aku tidak bisa pergi denganmu, dan harus menjaga ibuku yang sudah tua, maka dari itu tidak bisa pergi jauh. (Taishi Ci pergi)",},
        [616] = {1605,"Taishi Ci","Protagonis","Kalau begitu aku pergi sendiri meminta kakak, hal ini sangat darurat, tidak bisa ditunda! Kita segera pergi!","Kalau begitu aku pergi sendiri meminta kakak, hal ini sangat darurat, tidak bisa ditunda! Kita segera pergi!",},
        [617] = {2018101,"","Diao Chan","Ada orang cantik, sangat menawan dan elegan. Saat pertama kali bertemu, aku tahu dialah orangnya… Ini adalah syair dari Kitab Lagu, sangat malu, siapa yang memberikan, mengapa tidak meninggalkan nama?","Ada orang cantik, sangat menawan dan elegan. Saat pertama kali bertemu, aku tahu dialah orangnya… Ini adalah syair dari Kitab Lagu, sangat malu, siapa yang memberikan, mengapa tidak meninggalkan nama?",},
        [618] = {2018101,"","Diao Chan","Penari Wanita selalu menertawakanku, mengatakan penampilanku lebih menakjubkan dari bulan purnama dan tarianku lebih indah daripada peri. Dia ingin tahu siapa yang akan menikah denganku suatu hari…","Penari Wanita selalu menertawakanku, mengatakan penampilanku lebih menakjubkan dari bulan purnama dan tarianku lebih indah daripada peri. Dia ingin tahu siapa yang akan menikah denganku suatu hari…",},
        [619] = {2018101,"","Diao Chan","(Penuh harapan) Tentunya aku mau menikah dengan Hero terkuat di dunia…","(Penuh harapan) Tentunya aku mau menikah dengan Hero terkuat di dunia…",},
        [620] = {2018101,"Diao Chan","Zhang Liang","Hahaha, si cantik, aku mengikutimu sepanjang jalan!","Hahaha, si cantik, aku mengikutimu sepanjang jalan!",},
        [621] = {2018101,"","Diao Chan","Ha? Siapa kamu, mengapa mengikutiku?","Ha? Siapa kamu, mengapa mengikutiku?",},
        [622] = {2018101,"","Zhang Liang","Menurutmu mengapa aku mengikutimu? Cuaca sangat dingin, pakaianmu tipis, pasti kedinginan, lebih baik pelukan denganku untuk menghangatkan badan!","Menurutmu mengapa aku mengikutimu? Cuaca sangat dingin, pakaianmu tipis, pasti kedinginan, lebih baik pelukan denganku untuk menghangatkan badan!",},
        [623] = {2018101,"","Diao Chan","Eh, kamu bukan orang baik! Jangan kemari, kalau tidak aku akan berteriak!","Eh, kamu bukan orang baik! Jangan kemari, kalau tidak aku akan berteriak!",},
        [624] = {2018101,"","Zhang Liang","Tidak ada siapapun di sekitar sini, teriak hingga habis suaramu pun tidak berguna, hahaha. (Zhang Liang lompat ke Diao Chan, membuat Diao Chan ketakutan)","Tidak ada siapapun di sekitar sini, teriak hingga habis suaramu pun tidak berguna, hahaha. (Zhang Liang lompat ke Diao Chan, membuat Diao Chan ketakutan)",},
        [625] = {2018101,"","Lu Bu","Berhenti!","Berhenti!",},
        [626] = {2018102,"Lu Bu","Diao Chan","Terima kasih atas bantuan Hero. Namaku adalah Diao Chan, bolehkah aku bertanya namamu? (Diao Chan memberikan salam pada Lu Bu, saat dia menundukkan kepala, Lu Bu terdiam seketika)","Terima kasih atas bantuan Hero. Namaku adalah Diao Chan, bolehkah aku bertanya namamu? (Diao Chan memberikan salam pada Lu Bu, saat dia menundukkan kepala, Lu Bu terdiam seketika)",},
        [627] = {2018102,"","Lu Bu","… Margaku Lu, nama Bu, nama kehormatan Fengxian. Turban Kuning membuat kekacuan dimana-mana, mengapa kamu pergi sendirian?","… Margaku Lu, nama Bu, nama kehormatan Fengxian. Turban Kuning membuat kekacuan dimana-mana, mengapa kamu pergi sendirian?",},
        [628] = {2018102,"","Diao Chan","Ayah angkatku sedang sakit, dengar-dengar ada tabib terkenal yang menyembunyikan diri bernama Hua Tuo, aku ingin memintanya untuk menyembuhkan ayah angkatku.","Ayah angkatku sedang sakit, dengar-dengar ada tabib terkenal yang menyembunyikan diri bernama Hua Tuo, aku ingin memintanya untuk menyembuhkan ayah angkatku.",},
        [629] = {2018102,"","Lu Bu","(Terkejut) Ternyata kamu sangat perhatian dengan keluarga. Mengapa ayah angkat, bagaimana dengan ayah dan ibumu?","(Terkejut) Ternyata kamu sangat perhatian dengan keluarga. Mengapa ayah angkat, bagaimana dengan ayah dan ibumu?",},
        [630] = {2018102,"","Diao Chan","Orang tuaku telah meninggal sejak aku masih kecil, ayah angkatlah yang telah membesarkanku.","Orang tuaku telah meninggal sejak aku masih kecil, ayah angkatlah yang telah membesarkanku.",},
        [631] = {2018102,"","Lu Bu","Memang jodoh! Aku Lu Bu juga tidak memiliki orang tua, untungnya ahli dalam bela diri, jadi aku mengikuti ayah angkat sejak muda.","Memang jodoh! Aku Lu Bu juga tidak memiliki orang tua, untungnya ahli dalam bela diri, jadi aku mengikuti ayah angkat sejak muda.",},
        [632] = {2018102,"","Diao Chan","Ha, tidak disangka, Lu Gong dan Diao Chan memiliki takdir yang menyedihkan…","Ha, tidak disangka, Lu Gong dan Diao Chan memiliki takdir yang menyedihkan…",},
        [633] = {2018102,"","Lu Bu","Nona, jangan merasa aneh. Silahkan panggil aku Fengxian. Dunia sedang kacau, jika tidak keberatan, biarkan aku mengantarmu jalan ke tabib. Aku tidak akan membiarkan seseorang menyakitimu sedikitpun.","Nona, jangan merasa aneh. Silahkan panggil aku Fengxian. Dunia sedang kacau, jika tidak keberatan, biarkan aku mengantarmu jalan ke tabib. Aku tidak akan membiarkan seseorang menyakitimu sedikitpun.",},
        [634] = {2018102,"","Diao Chan","Terima kasih Tuan Lu… Fengxian!","Terima kasih Tuan Lu… Fengxian!",},
        [635] = {2018103,"Lu Bu","Diao Chan","Fengxian, aku lihat bulu merah di atas kepalamu sudah rusak, aku membuat sepasang yang baru untukmu, bagus atau tidak?","Fengxian, aku lihat bulu merah di atas kepalamu sudah rusak, aku membuat sepasang yang baru untukmu, bagus atau tidak?",},
        [636] = {2018103,"","Lu Bu","Sangat bagus, terima kasih atas perhatianmu! Chan, biarkan kulihat tanganmu, mengapa terluka, sakitkah?","Sangat bagus, terima kasih atas perhatianmu! Chan, biarkan kulihat tanganmu, mengapa terluka, sakitkah?",},
        [637] = {2018103,"","Diao Chan","(Malu-malu) Tidak sakit. Karena tidak ingin diketahui orang lain, jadi tidak sengaja tertusuk beberapa kali. Fengxian, kapan kamu akan melamarku?","(Malu-malu) Tidak sakit. Karena tidak ingin diketahui orang lain, jadi tidak sengaja tertusuk beberapa kali. Fengxian, kapan kamu akan melamarku?",},
        [638] = {2018103,"","Lu Bu","Chan, ayah angkatmu adalah Situ, salah satu Tiga Bangsawan! Bagaimana aku bisa membuat ayah angkatmu memandang rendah diriku? Tunggulah, hingga aku menjadi Jenderal Besar, lalu aku akan menikahimu.","Chan, ayah angkatmu adalah Situ, salah satu Tiga Bangsawan! Bagaimana aku bisa membuat ayah angkatmu memandang rendah diriku? Tunggulah, hingga aku menjadi Jenderal Besar, lalu aku akan menikahimu.",},
        [639] = {2018103,"","Diao Chan","Fengxian, yang aku mau hanyalah seseorang yang mencintaiku seumur hidup. Selama kamu baik padaku, ayah angkatku sangat menyayangiku dan tidak akan membencimu.","Fengxian, yang aku mau hanyalah seseorang yang mencintaiku seumur hidup. Selama kamu baik padaku, ayah angkatku sangat menyayangiku dan tidak akan membencimu.",},
        [640] = {2018103,"","Lu Bu","Seorang lelaki tidak bisa membuat cintanya merasa sedih bahkan sekecil apapun!","Seorang lelaki tidak bisa membuat cintanya merasa sedih bahkan sekecil apapun!",},
        [641] = {2018103,"","Lu Bu","Chan, tunggulah aku. Tunggu hingga aku menjadi seorang jenderal, menunggangi kuda bagus tiada tandingan, berjubah bagus lalu aku akan menikahimu!","Chan, tunggulah aku. Tunggu hingga aku menjadi seorang jenderal, menunggangi kuda bagus tiada tandingan, berjubah bagus lalu aku akan menikahimu!",},
        [642] = {2018104,"Wang Yun","Diao Chan","Fengxian memberitahuku bahwa dia diangkat menjadi Kolonel, mendapatkan jabatan resmi, waktunya untuk memberi tahu ayah angkat.","Fengxian memberitahuku bahwa dia diangkat menjadi Kolonel, mendapatkan jabatan resmi, waktunya untuk memberi tahu ayah angkat.",},
        [643] = {2018104,"","Wang Yun","Diao Chan, kamu mencariki ada urusan apa?","Diao Chan, kamu mencariki ada urusan apa?",},
        [644] = {2018104,"","Diao Chan","Ayah angkat, aku… (Wang Yun tiba-tiba pingsan, Diao Chan bergegas membantu Wang Yun duduk) Ayah angkat, ada masalah apa?","Ayah angkat, aku… (Wang Yun tiba-tiba pingsan, Diao Chan bergegas membantu Wang Yun duduk) Ayah angkat, ada masalah apa?",},
        [645] = {2018104,"","Wang Yun","(wajah pucat, menangis) Pemerintahan Dinasti Han dalam bahaya! Dong Zhuo berencana untuk menggulingkan kaisar, semua yang ada di istana tidak bisa melawannya. Aku sangat malu… sangat malu…","(wajah pucat, menangis) Pemerintahan Dinasti Han dalam bahaya! Dong Zhuo berencana untuk menggulingkan kaisar, semua yang ada di istana tidak bisa melawannya. Aku sangat malu… sangat malu…",},
        [646] = {2018104,"","Diao Chan","Diao Chan akan membantu ayah angkat.","Diao Chan akan membantu ayah angkat.",},
        [647] = {2018104,"","Wang Yun","(tiba-tiba bersujud kepada Diao Chan) Saat ini rakyat menghadapi kesulitan, keadaan kerajaan juga dalam bahaya, tidak disangka Pemerintahan Kaisar Han ada padamu! Diao Chan, aku memiliki siasat orang cantik, hanya kamulah yang bisa menyingkirkan Dong Zhuo. ","(tiba-tiba bersujud kepada Diao Chan) Saat ini rakyat menghadapi kesulitan, keadaan kerajaan juga dalam bahaya, tidak disangka Pemerintahan Kaisar Han ada padamu! Diao Chan, aku memiliki siasat orang cantik, hanya kamulah yang bisa menyingkirkan Dong Zhuo. ",},
        [648] = {2018104,"","Diao Chan","Aku dibesarkan oleh ayah angkat selama beberapa tahun ini, belajar menyanyi dan menari, diperlakukan dengan sangat baik, aku tidak bisa membalasnya meskipun dengan hidupku.","Aku dibesarkan oleh ayah angkat selama beberapa tahun ini, belajar menyanyi dan menari, diperlakukan dengan sangat baik, aku tidak bisa membalasnya meskipun dengan hidupku.",},
        [649] = {2018105,"Diao Chan","Wang Yun","Dong Zhuo berasal dari Xiliang, memiliki banyak orang, orang bisa sangat susah untuk mendekatinya, tetapi dia adalah orang mesum.","Dong Zhuo berasal dari Xiliang, memiliki banyak orang, orang bisa sangat susah untuk mendekatinya, tetapi dia adalah orang mesum.",},
        [650] = {2018105,"","Wang Yun","Dia memiliki anak angkat, bernama Lu Bu, sangat gagah… Aku akan menggunakan siasat berantai untuk menikahkanmu dengan Lu Bu, lalu menyerahkanmu pada Dong Zhuo, dengan begini akan ada pertentangan antara ayah dan anak dan membuat Lu Bu membunuh Dong Zhuo.","Dia memiliki anak angkat, bernama Lu Bu, sangat gagah… Aku akan menggunakan siasat berantai untuk menikahkanmu dengan Lu Bu, lalu menyerahkanmu pada Dong Zhuo, dengan begini akan ada pertentangan antara ayah dan anak dan membuat Lu Bu membunuh Dong Zhuo.",},
        [651] = {2018105,"","Diao Chan","(Diao Chan berseru dengan suara kecil) Ah~","(Diao Chan berseru dengan suara kecil) Ah~",},
        [652] = {2018105,"","Wang Yun","Diao Chan, wajahmu sangat pucat, apakah kamu tidak bersedia?","Diao Chan, wajahmu sangat pucat, apakah kamu tidak bersedia?",},
        [653] = {2018105,"","Diao Chan","Ayah angkat, jangan khawatir. Aku tidak akan bisa membalas kebaikanmu meskipun itu akan mengorbankan diriku.","Ayah angkat, jangan khawatir. Aku tidak akan bisa membalas kebaikanmu meskipun itu akan mengorbankan diriku.",},
        [654] = {2018105,"","Wang Yun","Anak pintar, untuk membunuh Dong Zhuo penjahat ini, aku hanya bisa melukai hatimu. Jika ini bocor, keluargaku akan dibunuh.","Anak pintar, untuk membunuh Dong Zhuo penjahat ini, aku hanya bisa melukai hatimu. Jika ini bocor, keluargaku akan dibunuh.",},
        [655] = {2018105,"","Diao Chan","Tenanglah ayah angkat, jika tidak bisa membalas kebaikan ayah, aku rela mati oleh ribuan pedang!","Tenanglah ayah angkat, jika tidak bisa membalas kebaikan ayah, aku rela mati oleh ribuan pedang!",},
        [656] = {2018201,"Zuo Ci","He Jin","Taoist, sepertinya kamu sangat hebat, dengan ilmu Tao yang dalam, sini ramalkan masa depanku!","Taoist, sepertinya kamu sangat hebat, dengan ilmu Tao yang dalam, sini ramalkan masa depanku!",},
        [657] = {2018201,"","Zuo Ci","Kamu diberkati dengan penampilan, dahi yang luas, dagu bulat, mata cerah dan telinga besar. Di masa depan pasti ditakdirkan menjadi jenderal besar!","Kamu diberkati dengan penampilan, dahi yang luas, dagu bulat, mata cerah dan telinga besar. Di masa depan pasti ditakdirkan menjadi jenderal besar!",},
        [658] = {2018201,"","He Jin","Hahaha, sangat konyol! Aku hanyalah penyembelih daging, masih bisa jadi jenderal?","Hahaha, sangat konyol! Aku hanyalah penyembelih daging, masih bisa jadi jenderal?",},
        [659] = {2018201,"","Zuo Ci","Mengapa datang kepadaku jika tidak percaya. Mengapa tertawa juga jika percaya? Jika kamu mengulanginya terus, saat nanti menjadi jenderal, takutnya juga tidak akan memiliki akhir yang bagus!","Mengapa datang kepadaku jika tidak percaya. Mengapa tertawa juga jika percaya? Jika kamu mengulanginya terus, saat nanti menjadi jenderal, takutnya juga tidak akan memiliki akhir yang bagus!",},
        [660] = {2018201,"","He Jin","Enyahlah, Taoist busuk, beraninya mengutuk aku cepat mati!","Enyahlah, Taoist busuk, beraninya mengutuk aku cepat mati!",},
        [661] = {2018202,"He Jin","Ibu Suri He","Sejak kepergian orangtuaku, kamulah yang telah membesarkan lima dari kami, terima kasih untuk beberapa tahun ini. Kakak, kami akhirnya dapat mengakhiri penderitaan ini, aku akan masuk ke dalam istana.","Sejak kepergian orangtuaku, kamulah yang telah membesarkan lima dari kami, terima kasih untuk beberapa tahun ini. Kakak, kami akhirnya dapat mengakhiri penderitaan ini, aku akan masuk ke dalam istana.",},
        [662] = {2018202,"","He Jin","Adik, kamu masuk ke istana, haruslah berhati-hati, jika kamu ditindas disana, beritahu aku, aku akan membantumu.","Adik, kamu masuk ke istana, haruslah berhati-hati, jika kamu ditindas disana, beritahu aku, aku akan membantumu.",},
        [663] = {2018202,"","Ibu Suri He","Kakak tenanglah, aku bukanlah orang yang mudah untuk ditindas. Tunggulah, aku akan menjadi permaisuri, dan akan memberikan pangkat yang tinggi kepadamu, agar kamu tidak perlu hidup susah lagi.","Kakak tenanglah, aku bukanlah orang yang mudah untuk ditindas. Tunggulah, aku akan menjadi permaisuri, dan akan memberikan pangkat yang tinggi kepadamu, agar kamu tidak perlu hidup susah lagi.",},
        [664] = {2018203,"","Ibu Suri He","Kakak, aku telah menjadi permaisuri! Aku berhutang pada anakku, aku telah melahirkan seorang pangeran untuk kaisar!","Kakak, aku telah menjadi permaisuri! Aku berhutang pada anakku, aku telah melahirkan seorang pangeran untuk kaisar!",},
        [665] = {2018203,"Ibu Suri He","He Jin","Bagus, keluarga He bisa dibedakan dari kebanyakan orang!","Bagus, keluarga He bisa dibedakan dari kebanyakan orang!",},
        [666] = {2018203,"","Ibu Suri He","Kakak, terima kasih atas usaha dalam menenangkan Turban Kuning, dan menangkap Ma Yuanyi! Kamu memang jenderal hebat!","Kakak, terima kasih atas usaha dalam menenangkan Turban Kuning, dan menangkap Ma Yuanyi! Kamu memang jenderal hebat!",},
        [667] = {2018203,"","He Jin","Hahaha, begitulah! Aku dapat melindungimu jika aku menjadi jenderal!","Hahaha, begitulah! Aku dapat melindungimu jika aku menjadi jenderal!",},
        [668] = {2018203,"","Ibu Suri He","Kakak, Kaisar akan menggulirkan anak pertama dan mengangkat yang paling kecil. Kaisar ingin Liu Xie anak Nyonya Wang menjadi kaisar. Hiks hiks, kamu harus membantuku.","Kakak, Kaisar akan menggulirkan anak pertama dan mengangkat yang paling kecil. Kaisar ingin Liu Xie anak Nyonya Wang menjadi kaisar. Hiks hiks, kamu harus membantuku.",},
        [669] = {2018203,"","He Jin","Tenanglah, adik. Kaisar ingin menggulirkan anak pertama, itu tidaklah mungkin, aku pasti tidak akan membiarkan hal itu terjadi!","Tenanglah, adik. Kaisar ingin menggulirkan anak pertama, itu tidaklah mungkin, aku pasti tidak akan membiarkan hal itu terjadi!",},
        [670] = {2018204,"Ibu Suri He","He Jin","Adik, Cao Cao dan Yuan Shao memberitahuku untuk mengeksekusi Sepuluh Kasim, aku akan membunuh Zhang Rang!","Adik, Cao Cao dan Yuan Shao memberitahuku untuk mengeksekusi Sepuluh Kasim, aku akan membunuh Zhang Rang!",},
        [671] = {2018204,"","Ibu Suri He","Kakak, jangan! Zhang Rang telah menyelamatkan hidupku, kalau bukan karena dia, Kaisar akan membuangku!","Kakak, jangan! Zhang Rang telah menyelamatkan hidupku, kalau bukan karena dia, Kaisar akan membuangku!",},
        [672] = {2018204,"","He Jin","Adik, untuk mendapatkan posisi kuat di istana, kita harus menyingkirkan Zhang Rang, atau Liu Bian akan menjadi ancaman besar bagi kita.","Adik, untuk mendapatkan posisi kuat di istana, kita harus menyingkirkan Zhang Rang, atau Liu Bian akan menjadi ancaman besar bagi kita.",},
        [673] = {2018204,"","Ibu Suri He","Kakak, tidak bisa. Bagaimanapun kamu juga tidak boleh membunuh Zhang Rang.","Kakak, tidak bisa. Bagaimanapun kamu juga tidak boleh membunuh Zhang Rang.",},
        [674] = {2018204,"","He Jin","Baiklah, akan kupikirkan cara lain lagi!","Baiklah, akan kupikirkan cara lain lagi!",},
        [675] = {2018205,"","Zhang Rang","Kalau bukan karena kasim melaporkan padaku secara diam-diam, aku tidak tahu, He Jin ingin membunuhku.","Kalau bukan karena kasim melaporkan padaku secara diam-diam, aku tidak tahu, He Jin ingin membunuhku.",},
        [676] = {2018205,"","Zhang Rang","Karena begini, jangan salahkan aku. Seseorang, tipu He Jin masuk ke istana atas nama Ibu Suri dan bunuh dia!","Karena begini, jangan salahkan aku. Seseorang, tipu He Jin masuk ke istana atas nama Ibu Suri dan bunuh dia!",},
        [677] = {2018206,"He Jin","Yuan Shao","Panggilan dari Ibu Suri ini, pasti merupakan siasat Sepuluh Kasim, jangan pergi atau akan ada masalah.","Panggilan dari Ibu Suri ini, pasti merupakan siasat Sepuluh Kasim, jangan pergi atau akan ada masalah.",},
        [678] = {2018206,"","He Jin","Ibu Suri adalah adik perempuanku, akan ada masalah apa?","Ibu Suri adalah adik perempuanku, akan ada masalah apa?",},
        [679] = {2018206,"","Yuan Shao","Jenderal besar jika masih ingin masuk, maka aku dan Yuan Shao akan mengantar, untuk berjaga-jaga.","Jenderal besar jika masih ingin masuk, maka aku dan Yuan Shao akan mengantar, untuk berjaga-jaga.",},
        [680] = {2018206,"","He Jin","Kakakku adalah Ibu Suri dan aku adalah Jenderal Besar, siapa yang berani membunuhku? Terlebih lagi, jika ini adalah siasat Sepuluh Kasim, aku harus melindungi adik perempuanku di sana!","Kakakku adalah Ibu Suri dan aku adalah Jenderal Besar, siapa yang berani membunuhku? Terlebih lagi, jika ini adalah siasat Sepuluh Kasim, aku harus melindungi adik perempuanku di sana!",},
        [681] = {2018301,"Li Jue","Hua Xiong","Li Jue, anak nakal, dimana kau! Ayo, kita pergi minum!","Li Jue, anak nakal, dimana kau! Ayo, kita pergi minum!",},
        [682] = {2018301,"","Li Jue","Minum tidak masalah, tapi untuk membayarnya…","Minum tidak masalah, tapi untuk membayarnya…",},
        [683] = {2018301,"","Hua Xiong","Bukanlah masalah! Bicara tentang uang dengan kakak, terdengar aneh.","Bukanlah masalah! Bicara tentang uang dengan kakak, terdengar aneh.",},
        [684] = {2018302,"Hua Xiong","Dong Zhuo","Para Pangeran telah tiba di Gerbang Hulao, siapa ingin bertarung?","Para Pangeran telah tiba di Gerbang Hulao, siapa ingin bertarung?",},
        [685] = {2018302,"","Lu Bu","Ayah janganlah khawatir, pangeran di perbatasan, mereka tidak berarti bagiku, biarkan aku membawa pasukan, memenggal kepala mereka dan menggantungnya di depan gerbang.","Ayah janganlah khawatir, pangeran di perbatasan, mereka tidak berarti bagiku, biarkan aku membawa pasukan, memenggal kepala mereka dan menggantungnya di depan gerbang.",},
        [686] = {2018302,"","Hua Xiong","Urusan sekecil ini, tidak perlu untuk pergi turun tangan. Memenggal kepala para pangeran itu, menurutku adalah hal yang sangat mudah!","Urusan sekecil ini, tidak perlu untuk pergi turun tangan. Memenggal kepala para pangeran itu, menurutku adalah hal yang sangat mudah!",},
        [687] = {2018303,"","Dong Zhuo","Hua Xiong, jasamu sangat besar, kamu telah membunuh Bao Zhong, juga Zu mao dan mengalahkan Sun Jian, sangat hebat. Semuanya, aku mengangkat Hua Xiong menjadi Gubernur!","Hua Xiong, jasamu sangat besar, kamu telah membunuh Bao Zhong, juga Zu mao dan mengalahkan Sun Jian, sangat hebat. Semuanya, aku mengangkat Hua Xiong menjadi Gubernur!",},
        [688] = {2018303,"","Hua Xiong","Terima kasih, Perdana Menteri!","Terima kasih, Perdana Menteri!",},
        [689] = {2018304,"Yuan Shao","Hua Xiong","(mengambil Turban Merah Sun Jian dengan tongkat panjang) Segerombolan pengecut, siapa berani menantangku?","(mengambil Turban Merah Sun Jian dengan tongkat panjang) Segerombolan pengecut, siapa berani menantangku?",},
        [690] = {2018304,"","Yuan Shao","Sayang sekali jenderalku Yan Liang dan Wen Chou tidak ada disini. Semuanya, siapa yang berani menantang Hua Xiong yang sombong itu?","Sayang sekali jenderalku Yan Liang dan Wen Chou tidak ada disini. Semuanya, siapa yang berani menantang Hua Xiong yang sombong itu?",},
        [691] = {2018304,"","Guan Yu","Biarkan aku pergi memotong kepala Hua Xiong dan memberikannya padamu! Hangatkan dulu araknya, aku akan kembali.","Biarkan aku pergi memotong kepala Hua Xiong dan memberikannya padamu! Hangatkan dulu araknya, aku akan kembali.",},
        [692] = {2018305,"","Hua Xiong","Aku telah membunuh Pan Feng. Siapa yang berani menantangku?","Aku telah membunuh Pan Feng. Siapa yang berani menantangku?",},
        [693] = {2018305,"","Guan Yu","Hua Xiong, jangan berlagak!","Hua Xiong, jangan berlagak!",},
        [694] = {2018305,"","Hua Xiong","Aura membunuh yang besar, bau arak yang besar!","Aura membunuh yang besar, bau arak yang besar!",},
        [695] = {2018305,"","Hua Xiong","Lelaki berwajah merah ini datangnya sangat cepat… Bertemu denganmu adalah takdirku… Kulit yang tebalpun tidak bisa menahan pedang…!","Lelaki berwajah merah ini datangnya sangat cepat… Bertemu denganmu adalah takdirku… Kulit yang tebalpun tidak bisa menahan pedang…!",},
        [696] = {2018401,"Xun Yu","Xun You","Paman, paman, ada masalah!","Paman, paman, ada masalah!",},
        [697] = {2018401,"Xun You","Xun Yu","Gongda, ada masalah apa? Kenapa panik?","Gongda, ada masalah apa? Kenapa panik?",},
        [698] = {2018401,"Xun Yu","Xun You","Pada saat itu, Kasim Tengah Tang Heng pernah menikahkan putri angkatnya denganmu, perermpuan ini telah sampai pada usia untuk menikah.","Pada saat itu, Kasim Tengah Tang Heng pernah menikahkan putri angkatnya denganmu, perermpuan ini telah sampai pada usia untuk menikah.",},
        [699] = {2018401,"Xun Yu","Xun You","Keluarga Xun dari Yingchuan, adalah keturunan Xunzi. Kita adalah kelahiran bangsawan, jika kita menikah dengan putri kasim, ini akan menjadi masalah, benarkan? Paman, Tang Heng meninggal muda, mengapa kami tidak membatalkan pernikahannya?","Keluarga Xun dari Yingchuan, adalah keturunan Xunzi. Kita adalah kelahiran bangsawan, jika kita menikah dengan putri kasim, ini akan menjadi masalah, benarkan? Paman, Tang Heng meninggal muda, mengapa kami tidak membatalkan pernikahannya?",},
        [700] = {2018401,"Xun You","Xun Yu","Konyol! Pernikahan ini sudah ditentukan dari awal, bagaimana bisa dibatalkan? Dengan begini akan kehilangan kepercayaan orang lain!","Konyol! Pernikahan ini sudah ditentukan dari awal, bagaimana bisa dibatalkan? Dengan begini akan kehilangan kepercayaan orang lain!",},
        [701] = {2018401,"Xun You","Xun Yu","Seorang pejabat, harus memiliki integritas. Meskipun Tang Heng adalah Kasim Kedua, tetapi putrinya tidak bersalah. Aku mendapat namaku saat muda dan berperilaku jujur, mengapa aku harus mengurus pendapat orang lain.","Seorang pejabat, harus memiliki integritas. Meskipun Tang Heng adalah Kasim Kedua, tetapi putrinya tidak bersalah. Aku mendapat namaku saat muda dan berperilaku jujur, mengapa aku harus mengurus pendapat orang lain.",},
        [702] = {2018401,"Xun Yu","Xun You","Paman, perkataanmu memang benar.","Paman, perkataanmu memang benar.",},
        [703] = {2018402,"Xun Yu","Cao Cao","Sekarang Yang Mulia telah kembali ke Luoyang, bagaimana menurut kalian?","Sekarang Yang Mulia telah kembali ke Luoyang, bagaimana menurut kalian?",},
        [704] = {2018402,"Cao Cao","Xun Yu","Adipati Wen dari Jin pernah merekrut Raja Xiang dari Zhou dan menundukkan para adipati lainnya; Kaisar Gaozu dari Han pernah mengirimkan berita kematian untuk Kaisar Yi untuk memenangkan dukungan rakyat.","Adipati Wen dari Jin pernah merekrut Raja Xiang dari Zhou dan menundukkan para adipati lainnya; Kaisar Gaozu dari Han pernah mengirimkan berita kematian untuk Kaisar Yi untuk memenangkan dukungan rakyat.",},
        [705] = {2018402,"Cao Cao","Xun Yu","Sekarang kaisar terlantar, jenderal sebaiknya mencari prajurit yang adil dan dapat memenuhi eskpektasi semua orang dan menyelesaikan tujuan besar yang akan dilihat oleh semua orang. Jika tidak mulai dari sekarang, maka akan direbut oleh orang lain. ","Sekarang kaisar terlantar, jenderal sebaiknya mencari prajurit yang adil dan dapat memenuhi eskpektasi semua orang dan menyelesaikan tujuan besar yang akan dilihat oleh semua orang. Jika tidak mulai dari sekarang, maka akan direbut oleh orang lain. ",},
        [706] = {2018402,"Xun Yu","Cao Cao","Haha, perkataan Tuan Xun benar, aku setuju. Aku akan membawa prajurit menuju Luoyang, mengantar Kaisar, memindahkan ibu kota ke Xuchang!","Haha, perkataan Tuan Xun benar, aku setuju. Aku akan membawa prajurit menuju Luoyang, mengantar Kaisar, memindahkan ibu kota ke Xuchang!",},
        [707] = {2018403,"Xun You","Cao Cao","Tentara kami berjaga di Guandu. Sejak Agustus hingga September, kekuatanmu menurun dan ransum berkekurangan. Aku ingin meninggalkan Guandu dan kembali ke Xuchang, bagaimana menurut kalian?","Tentara kami berjaga di Guandu. Sejak Agustus hingga September, kekuatanmu menurun dan ransum berkekurangan. Aku ingin meninggalkan Guandu dan kembali ke Xuchang, bagaimana menurut kalian?",},
        [708] = {2018403,"Cao Cao","Xun You","Mengapa jenderal tidak mengirimkan surat untuk bertanya pamanku?","Mengapa jenderal tidak mengirimkan surat untuk bertanya pamanku?",},
        [709] = {2018403,"Xun You","Cao Cao","Seseorang, segera kirimkan orang ke Xuchang untuk mengirimkan surat ini.","Seseorang, segera kirimkan orang ke Xuchang untuk mengirimkan surat ini.",},
        [710] = {2018403,"Cao Cao","Xun You","Jenderal, pamanku telah menjawab. Lihatlah!","Jenderal, pamanku telah menjawab. Lihatlah!",},
        [711] = {2018403,"Xun You","Cao Cao","(membaca surat Xun Yu) Yuan Shao telah mengumpulkan pasukan di Guandu, bersiap untuk pertarungan yang menentukan dengan Tuan. Yang kuat harus mengendalikan yang lemah, kalau tidak akan diserang kembali. Ini adalah kesempatan besar.","(membaca surat Xun Yu) Yuan Shao telah mengumpulkan pasukan di Guandu, bersiap untuk pertarungan yang menentukan dengan Tuan. Yang kuat harus mengendalikan yang lemah, kalau tidak akan diserang kembali. Ini adalah kesempatan besar.",},
        [712] = {2018403,"Xun You","Cao Cao","Tentara Yuan Shao banyak tetapi kurang berguna. Sekarang telah menempati tempat yang bagus, menghalangi keluar masuknya. Dengan berkembangnya situasi ini, pasti ada perubahan. Ini adalah waktu untuk menggunakan rencana, jangan lewatkan kesempatan bagus ini. ","Tentara Yuan Shao banyak tetapi kurang berguna. Sekarang telah menempati tempat yang bagus, menghalangi keluar masuknya. Dengan berkembangnya situasi ini, pasti ada perubahan. Ini adalah waktu untuk menggunakan rencana, jangan lewatkan kesempatan bagus ini. ",},
        [713] = {2018403,"Xun You","Cao Cao","Haha, Tuan Xun adalah Perdana Menteri yang pandai. Dengarkan perintahku, lindungi Guandu! Ini hanyalah masalah waktu!","Haha, Tuan Xun adalah Perdana Menteri yang pandai. Dengarkan perintahku, lindungi Guandu! Ini hanyalah masalah waktu!",},
        [714] = {2018404,"Xun Yu","Dong Zhao","Sejak dahulu, tidak ada menteri yang sesukses kamu. Selama tiga puluh tahun, kamu bersusah payah untuk membersihkan pemberontak dan pengaruh jahat, menyelamatkan rakyat dari bahaya dan mengembalikan kejayaan Dinasti Han. Karena itu kamu akan diangkat sebagai Menteri Besar dan dikenal dengan jasamu.","Sejak dahulu, tidak ada menteri yang sesukses kamu. Selama tiga puluh tahun, kamu bersusah payah untuk membersihkan pemberontak dan pengaruh jahat, menyelamatkan rakyat dari bahaya dan mengembalikan kejayaan Dinasti Han. Karena itu kamu akan diangkat sebagai Menteri Besar dan dikenal dengan jasamu.",},
        [715] = {2018404,"Dong Zhao","Xun Yu","Tidak bisa. Perdana Menteri membuat tentara untuk keadilan dan kebangkitan Dinasti Han. Dia harus menjaga kesetiaan dan rendah hati. Ini adalah hal yang seharusnya dilakukan oleh orang bajik.","Tidak bisa. Perdana Menteri membuat tentara untuk keadilan dan kebangkitan Dinasti Han. Dia harus menjaga kesetiaan dan rendah hati. Ini adalah hal yang seharusnya dilakukan oleh orang bajik.",},
        [716] = {2018404,"Xun Yu","Dong Zhao","Bagaimana bisa seseorang menggagalkan ekspektasi semua orang?","Bagaimana bisa seseorang menggagalkan ekspektasi semua orang?",},
        [717] = {2018404,"Dong Zhao","Xun Yu","Jangan bahas lagi hal ini hari ini!","Jangan bahas lagi hal ini hari ini!",},
        [718] = {2018404,"Xun Yu","Cao Cao","… (Cao Cao marah, menyimpan dendam pada Xun Yu)","… (Cao Cao marah, menyimpan dendam pada Xun Yu)",},
        [719] = {2018405,"","Cao Cao","Tuan Xun berkata dia sedang sakit di Shouchun. Seseorang, cepat kirimkan kotak makanan ini ke Shouchun!","Tuan Xun berkata dia sedang sakit di Shouchun. Seseorang, cepat kirimkan kotak makanan ini ke Shouchun!",},
        [720] = {2018405,"","Xun You","Paman, Cao Cao mengirimkan kotak makanan, diatasnya ada stempel pribadi.","Paman, Cao Cao mengirimkan kotak makanan, diatasnya ada stempel pribadi.",},
        [721] = {2018405,"Xun You","Xun Yu","(membuka kotak adan tidak ada apapun) Aku telah mengikut Cao Cao bertahun-tahun, melalui beribu badai dan ombak, saling mengerti satu sama lain, orang biasa tidak bisa membayangkan.","(membuka kotak adan tidak ada apapun) Aku telah mengikut Cao Cao bertahun-tahun, melalui beribu badai dan ombak, saling mengerti satu sama lain, orang biasa tidak bisa membayangkan.",},
        [722] = {2018405,"Xun Yu","Xun You","Paman, ini maksudnya apa?","Paman, ini maksudnya apa?",},
        [723] = {2018405,"Xun You","Xun Yu","Xun Yu tidak melayani Dinasti Han lagi, dia mengetahui hal itu, tetapi mengapa melakukan hal ini? (Xun Yu memberhentikan yang lain dan meracuni dirinya sendiri pada usia 49 tahun.)","Xun Yu tidak melayani Dinasti Han lagi, dia mengetahui hal itu, tetapi mengapa melakukan hal ini? (Xun Yu memberhentikan yang lain dan meracuni dirinya sendiri pada usia 49 tahun.)",},
        [724] = {2018501,"Nona muda","Sha Moke","Uhuk, karena beberapa hari lalu aku demam, aku tidak memiliki uang. Mohon kebaikan nona untuk memberiku sedikit uang, agar aku bisa pergi ke dokter.","Uhuk, karena beberapa hari lalu aku demam, aku tidak memiliki uang. Mohon kebaikan nona untuk memberiku sedikit uang, agar aku bisa pergi ke dokter.",},
        [725] = {2018501,"Sha Moke","Nona muda","Wabah kali ini cukup hebat. Dengar-dengar air jimat Taoist Besar Zhang Jiao dapat menyembuhkan penyakit, kamu sebaiknya meminta bantuannya.","Wabah kali ini cukup hebat. Dengar-dengar air jimat Taoist Besar Zhang Jiao dapat menyembuhkan penyakit, kamu sebaiknya meminta bantuannya.",},
        [726] = {2018501,"Nona muda","Sha Moke","Terima kasih atas nasihat nona muda. Taoist besar, tolong bantu aku, selamatkan aku!","Terima kasih atas nasihat nona muda. Taoist besar, tolong bantu aku, selamatkan aku!",},
        [727] = {2018501,"Sha Moke","Zhang Jiao","Aku Zhang Jiao mendapat Seni Kedamaian dari Imortal Tua Nan Hua, sejak berdirinya Jalan Kedamaian, sudah ada 360 ribu murid!","Aku Zhang Jiao mendapat Seni Kedamaian dari Imortal Tua Nan Hua, sejak berdirinya Jalan Kedamaian, sudah ada 360 ribu murid!",},
        [728] = {2018501,"Sha Moke","Zhang Jiao","Jika kalian bergabung dengan Jalan Kedamaianku, pasti akan mengusir penyakit dan menjaga keamanan keluargamu!","Jika kalian bergabung dengan Jalan Kedamaianku, pasti akan mengusir penyakit dan menjaga keamanan keluargamu!",},
        [729] = {2018501,"Zhang Jiao","Sha Moke","Sangat bagus, aku ingin bergabung Jalan Kedamaian!","Sangat bagus, aku ingin bergabung Jalan Kedamaian!",},
        [730] = {2018502,"","Zhang Jiao","Yang paling langka di dunia ini adalah kepercayaan rakyat. Sekarang kepercayaan rakyat sudah didapat, jika aku tidak memegang dunia, ini sangat disayangkan. Mulai sekarang, aku akan menyebut diriku sendiri sebagai Jenderal Langit.","Yang paling langka di dunia ini adalah kepercayaan rakyat. Sekarang kepercayaan rakyat sudah didapat, jika aku tidak memegang dunia, ini sangat disayangkan. Mulai sekarang, aku akan menyebut diriku sendiri sebagai Jenderal Langit.",},
        [731] = {2018502,"Zhang Jiao","Zhang Bao","Kakak, kakak, kalau aku?","Kakak, kakak, kalau aku?",},
        [732] = {2018502,"Zhang Bao","Zhang Jiao","Kamu adalah Jenderal Bumi.","Kamu adalah Jenderal Bumi.",},
        [733] = {2018502,"Zhang Jiao","Zhang Liang","Kakak, kakak, kalau aku?","Kakak, kakak, kalau aku?",},
        [734] = {2018502,"Zhang Liang","Zhang Jiao","Kamu adalah Jenderal Manusia.","Kamu adalah Jenderal Manusia.",},
        [735] = {2018502,"Zhang Liang","Zhang Jiao","Dinasti Han telah mencapai pada pengakhiran dan orang bijaksana telah turun. Kalian semua harus mengikuti arus keadilan dan menyambut kedamaian.","Dinasti Han telah mencapai pada pengakhiran dan orang bijaksana telah turun. Kalian semua harus mengikuti arus keadilan dan menyambut kedamaian.",},
        [736] = {2018502,"Zhang Liang","Zhang Jiao","Haha! Dinasti Han telah tiada, Turban Kuning akan bangkit, pada tahun Jia Zi, akan ada kemakmuran di dunia! Dengan sepenuh jiwaku, menggabungkan langit dan bumi!","Haha! Dinasti Han telah tiada, Turban Kuning akan bangkit, pada tahun Jia Zi, akan ada kemakmuran di dunia! Dengan sepenuh jiwaku, menggabungkan langit dan bumi!",},
        [737] = {2018503,"Zhang Jiao","Protagonis","Zhang Jiao, hari ini kamu mati, pergi ke neraka.","Zhang Jiao, hari ini kamu mati, pergi ke neraka.",},
        [738] = {2018503,"Protagonis","Zhang Jiao","Turban Kuning… telah tiada!","Turban Kuning… telah tiada!",},
        [739] = {2018601,"Bawahan Yuan Shu","Yuan Shu","Dengar- dengar Sun Jian dikenal dengan penyerangannya pada Turban Kuning, tidak tahu detilnya bagaimana?","Dengar- dengar Sun Jian dikenal dengan penyerangannya pada Turban Kuning, tidak tahu detilnya bagaimana?",},
        [740] = {2018601,"Yuan Shu","Bawahan Yuan Shu","Keluarga Sun selalu memegang jabatan di pemerintahan Wu selama beberapa generasi dan tinggal di Fuchun. Dengar-dengar terdapat awan berwarna-warni di atas kuburan leluhur keluarga Sun ketika Sun Jian lahir dengan panjang bermil-mil jauhnya.","Keluarga Sun selalu memegang jabatan di pemerintahan Wu selama beberapa generasi dan tinggal di Fuchun. Dengar-dengar terdapat awan berwarna-warni di atas kuburan leluhur keluarga Sun ketika Sun Jian lahir dengan panjang bermil-mil jauhnya.",},
        [741] = {2018601,"Bawahan Yuan Shu","Yuan Shu","Oh, ada juga hal aneh seperti ini.","Oh, ada juga hal aneh seperti ini.",},
        [742] = {2018601,"Yuan Shu","Bawahan Yuan Shu","Penduduk lokal berkata: Ini bukan pemandangan biasa, keluarga Sun akan menjadi semakin kuat. Saat Sun Jian lahir, memang anak ini terlihat luar biasa.","Penduduk lokal berkata: Ini bukan pemandangan biasa, keluarga Sun akan menjadi semakin kuat. Saat Sun Jian lahir, memang anak ini terlihat luar biasa.",},
        [743] = {2018601,"Yuan Shu","Bawahan Yuan Shu","Saat Sun Jian masih muda, dia melayani di tiga sesi prefektur dan sangat berprestasi. Dia diangkat menjadi Pemimpin Prefektur Changsha.","Saat Sun Jian masih muda, dia melayani di tiga sesi prefektur dan sangat berprestasi. Dia diangkat menjadi Pemimpin Prefektur Changsha.",},
        [744] = {2018601,"Bawahan Yuan Shu","Yuan Shu","Tidak peduli seberapa hebat dia, tidak bisa dibanding dengan empat Tuan Yuan.","Tidak peduli seberapa hebat dia, tidak bisa dibanding dengan empat Tuan Yuan.",},
        [745] = {2018601,"Yuan Shu","Bawahan Yuan Shu","Tuan, karena orang ini berkemampuan, lebih baik mengerjakan dia, bersama melawan Dong Zhuo.","Tuan, karena orang ini berkemampuan, lebih baik mengerjakan dia, bersama melawan Dong Zhuo.",},
        [746] = {2018601,"Bawahan Yuan Shu","Yuan Shu","Bagus juga, kalau begitu aku akan mengangkatnya menjadi Jenderal Polu dan Sekretariat Prefektur Yuzhou.","Bagus juga, kalau begitu aku akan mengangkatnya menjadi Jenderal Polu dan Sekretariat Prefektur Yuzhou.",},
        [747] = {2018602,"Sun Jian","Liu Biao","Sun Wentai, mengapa melewati Jingzhou?","Sun Wentai, mengapa melewati Jingzhou?",},
        [748] = {2018602,"Liu Biao","Sun Jian","Pangeran-pangeran saling menipu dan tidak percaya satu sama lain, menggunakan siasat untuk keuntungan diri sendiri. Jadi, aku memutuskan untuk kembali ke Jiangdong.","Pangeran-pangeran saling menipu dan tidak percaya satu sama lain, menggunakan siasat untuk keuntungan diri sendiri. Jadi, aku memutuskan untuk kembali ke Jiangdong.",},
        [749] = {2018602,"Liu Biao","Sun Jian","Saat aku dan Yuan Shao, Yuan Shu bersama membuat pasukan keadilan, bertujuan untuk menyelamatkan negara. Sekarang pemberontak akan dibersihkan, tetapi terjadi cekcok di dalam. Siapa yang bisa diajak kerjasama untuk menyelamatkan dunia?","Saat aku dan Yuan Shao, Yuan Shu bersama membuat pasukan keadilan, bertujuan untuk menyelamatkan negara. Sekarang pemberontak akan dibersihkan, tetapi terjadi cekcok di dalam. Siapa yang bisa diajak kerjasama untuk menyelamatkan dunia?",},
        [750] = {2018602,"Sun Jian","Liu Biao","Jika kamu ingin kembali ke Jiangdong, maka kembalilah, tetapi Segel Kekaisaran adalah harta kerajaan, mengapa kamu menyembunyikannya, apa yang kamu inginkan?","Jika kamu ingin kembali ke Jiangdong, maka kembalilah, tetapi Segel Kekaisaran adalah harta kerajaan, mengapa kamu menyembunyikannya, apa yang kamu inginkan?",},
        [751] = {2018602,"Liu Biao","Sun Jian","(marah) Jika kamu ingin bertarung, bertarunglah. Ada apa denganmu?","(marah) Jika kamu ingin bertarung, bertarunglah. Ada apa denganmu?",},
        [752] = {2018603,"Sun Jian","Han Dang","Jenderal, hari ini angin bertiup kencang, menghancurkan bendera jenderal. Ini bukan pertanda baik, kita harus mundur dulu.","Jenderal, hari ini angin bertiup kencang, menghancurkan bendera jenderal. Ini bukan pertanda baik, kita harus mundur dulu.",},
        [753] = {2018603,"Han Dang","Sun Jian","Aku tidak pernah kalah di peperangan, menangkap Xiangyang tidak membutuhkan waktu yang lama; mengapa hanya karena tiang bendera yang tertiup, lalu ingin mundur!","Aku tidak pernah kalah di peperangan, menangkap Xiangyang tidak membutuhkan waktu yang lama; mengapa hanya karena tiang bendera yang tertiup, lalu ingin mundur!",},
        [754] = {2018603,"Sun Jian","Kuai Liang","Aku memandang langit di suatu malam, terlihat bintang jenderal jatuh. Menurut pandanganku, aku harus berada dengan Sun Jian. Tuan segera tuliskan surat untuk Yuan Shao, meminta bantuannya.","Aku memandang langit di suatu malam, terlihat bintang jenderal jatuh. Menurut pandanganku, aku harus berada dengan Sun Jian. Tuan segera tuliskan surat untuk Yuan Shao, meminta bantuannya.",},
        [755] = {2018603,"Sun Jian","Liu Biao","Sekarang Xiangyang telah dikepung, siapa yang berani menembusnya?","Sekarang Xiangyang telah dikepung, siapa yang berani menembusnya?",},
        [756] = {2018603,"Liu Biao","Lu Gong","Biarkan aku yang pergi!","Biarkan aku yang pergi!",},
        [757] = {2018603,"Lu Gong","Kuai Liang","Karena kamu berani untuk pergi, maka dengarkan rencanaku. Akan kuberikan 500 pasukan. Pergi ke Gunung Xian dengan pemanah ahli.","Karena kamu berani untuk pergi, maka dengarkan rencanaku. Akan kuberikan 500 pasukan. Pergi ke Gunung Xian dengan pemanah ahli.",},
        [758] = {2018603,"Lu Gong","Kuai Liang","Sun Jian akan memimpin tentara untuk pengejaran, kamu mengirimkan seratus orang untuk ke gunung, mempersiapkan batu besar; seratus orang lain menyergap dengan busur silang di dalam hutan. Tarik musuh ke dalam dan sergap mereka dengan panah dan batu besar.","Sun Jian akan memimpin tentara untuk pengejaran, kamu mengirimkan seratus orang untuk ke gunung, mempersiapkan batu besar; seratus orang lain menyergap dengan busur silang di dalam hutan. Tarik musuh ke dalam dan sergap mereka dengan panah dan batu besar.",},
        [759] = {2018603,"Kuai Liang","Lu Gong","Rencana bagus!","Rencana bagus!",},
        [760] = {2018604,"Sun Jian","Sersan","Jenderal, ada pasukan lawan yang datang membunuh, mereka sedang menuju Gunung Xian.","Jenderal, ada pasukan lawan yang datang membunuh, mereka sedang menuju Gunung Xian.",},
        [761] = {2018604,"Sersan","Sun Jian","Aku akan membawa prajurit untuk mengejarnya!","Aku akan membawa prajurit untuk mengejarnya!",},
        [762] = {2018604,"Sun Jian","Sersan","Jenderal, hati-hati dengan serangan tiba-tiba!","Jenderal, hati-hati dengan serangan tiba-tiba!",},
        [763] = {2018604,"Sersan","Sun Jian","(Tidak mendengar bujukan, bersikeras menunggang kuda untuk mengejar) Musuh jangan kabur!","(Tidak mendengar bujukan, bersikeras menunggang kuda untuk mengejar) Musuh jangan kabur!",},
        [764] = {2018604,"Sun Jian","Sersan","Jenderal! (Batu bergulir dari atas gunung, panah-panah berterbangan dari hutan. Sun Jian terkena panah dan mati, saat itu masih berusia 37 tahun)","Jenderal! (Batu bergulir dari atas gunung, panah-panah berterbangan dari hutan. Sun Jian terkena panah dan mati, saat itu masih berusia 37 tahun)",},
        [765] = {2018701,"Selir","Hakim Huang","Sekarang terjadi cekcok antara prefektur, dan Sekretariat Luoyang (untuk hadiah dan hukuman pejabat) ditunjuk untuk menghakimi.","Sekarang terjadi cekcok antara prefektur, dan Sekretariat Luoyang (untuk hadiah dan hukuman pejabat) ditunjuk untuk menghakimi.",},
        [766] = {2018701,"Hakim Huang","Selir","Yang dapat lebih dulu mengirimkan monumen, akan mendapatkan keuntungan lebih banyak.","Yang dapat lebih dulu mengirimkan monumen, akan mendapatkan keuntungan lebih banyak.",},
        [767] = {2018701,"Selir","Hakim Huang","Jadi, siapa yang bisa mengirimkan monumen penting ini?","Jadi, siapa yang bisa mengirimkan monumen penting ini?",},
        [768] = {2018701,"Hakim Huang","Selir","Tuan, aku merekomendasikan seseorang untukmu. Dengar-dengar Taishi Ci berumur 21 tahun, tinggi enam kaki satu inci, ahli dalam menembak, setiap kali menembak pasti tepat sasaran, merupakan penembak sejati. Tuan bisa mengirimkan dia pergi.","Tuan, aku merekomendasikan seseorang untukmu. Dengar-dengar Taishi Ci berumur 21 tahun, tinggi enam kaki satu inci, ahli dalam menembak, setiap kali menembak pasti tepat sasaran, merupakan penembak sejati. Tuan bisa mengirimkan dia pergi.",},
        [769] = {2018701,"Selir","Hakim Huang","Baik, akan kudengar saranmu, kirimkan Taishi CI untuk mengirim monumen ke Luoyang dengan cepat! (Taishi Ci tiba di Luoyang, berjalan siang dan malam)","Baik, akan kudengar saranmu, kirimkan Taishi CI untuk mengirim monumen ke Luoyang dengan cepat! (Taishi Ci tiba di Luoyang, berjalan siang dan malam)",},
        [770] = {2018702,"Pejabat","Taishi Ci","(menunggu lama di depan pintu) Apakah kamu datang untuk memberikan monumen juga?","(menunggu lama di depan pintu) Apakah kamu datang untuk memberikan monumen juga?",},
        [771] = {2018702,"Taishi Ci","Pejabat","Iya.","Iya.",},
        [772] = {2018702,"Pejabat","Taishi Ci","Dimanakah monumennya? Apakah tandanya tidak salah tulis? Bisakah aku melihatnya? (Taishi Ci memotong monumen saat pejabat menunjukkannya)","Dimanakah monumennya? Apakah tandanya tidak salah tulis? Bisakah aku melihatnya? (Taishi Ci memotong monumen saat pejabat menunjukkannya)",},
        [773] = {2018702,"Taishi Ci","Pejabat","Mengapa kamu menghancurkan monumenku!","Mengapa kamu menghancurkan monumenku!",},
        [774] = {2018702,"Pejabat","Taishi Ci","Jika kamu tidak memberikan monumen padaku, aku juga tidak bisa merusaknya, takutnya kita semua akan mendapat hukuman. Daripada duduk dan menunggu mati, lebih baik kita semua kabur, setidaknya masih bisa hidup.","Jika kamu tidak memberikan monumen padaku, aku juga tidak bisa merusaknya, takutnya kita semua akan mendapat hukuman. Daripada duduk dan menunggu mati, lebih baik kita semua kabur, setidaknya masih bisa hidup.",},
        [775] = {2018702,"Taishi Ci","Pejabat","Oke.","Oke.",},
        [776] = {2018702,"Pejabat","Taishi Ci","Kalau begitu kamu dan aku pergi keluar kota dan kabur. (Lalu Taishi Ci kembali ke Luoyang dengan terburu-buru, mengirimkan monumen dan menyelesaikan misi, lalu namanya menjadi terkenal.)","Kalau begitu kamu dan aku pergi keluar kota dan kabur. (Lalu Taishi Ci kembali ke Luoyang dengan terburu-buru, mengirimkan monumen dan menyelesaikan misi, lalu namanya menjadi terkenal.)",},
        [777] = {2018703,"Sun Ce","Taishi Ci","Jika bukan sekarang menangkap Sun Ce, lalu kapan lagi! Yang berani, sini ikut denganku!","Jika bukan sekarang menangkap Sun Ce, lalu kapan lagi! Yang berani, sini ikut denganku!",},
        [778] = {2018703,"Taishi Ci","Sun Ce","Siapa kamu?","Siapa kamu?",},
        [779] = {2018703,"Sun Ce","Taishi Ci","Aku adalah Taishi Ci dari Donglai, datang untuk menangkap Sun Ce! Siapakah Sun Ce?","Aku adalah Taishi Ci dari Donglai, datang untuk menangkap Sun Ce! Siapakah Sun Ce?",},
        [780] = {2018703,"Taishi Ci","Sun Ce","Kamu bicara dengan orangnya. Kalian berdua datang melawanku, tidak takut! Jika aku takut, jangan panggil Sun Ce!","Kamu bicara dengan orangnya. Kalian berdua datang melawanku, tidak takut! Jika aku takut, jangan panggil Sun Ce!",},
        [781] = {2018703,"Sun Ce","Taishi Ci","Aku tidak takut meskipun kalian semua datang padaku! (Taishi Ci menunggangi kudanya dan mengangkat tombaknya kepada Sun Ce. Mereka bertarung selama 50 ronde dan tidak ada yang menang, sangat hebat.)","Aku tidak takut meskipun kalian semua datang padaku! (Taishi Ci menunggangi kudanya dan mengangkat tombaknya kepada Sun Ce. Mereka bertarung selama 50 ronde dan tidak ada yang menang, sangat hebat.)",},
        [782] = {2018801,"Da Qiao","Xiao Qiao","Kakak, kakak! Lelaki seperti apa yang ingin kakak nikahi di masa depan?","Kakak, kakak! Lelaki seperti apa yang ingin kakak nikahi di masa depan?",},
        [783] = {2018801,"Xiao Qiao","Da Qiao","Adik memang nakal!","Adik memang nakal!",},
        [784] = {2018801,"Da Qiao","Xiao Qiao","Kakak, Kakak, mukamu memerah? Apakah ada seseorang yang ada dihatimu?","Kakak, Kakak, mukamu memerah? Apakah ada seseorang yang ada dihatimu?",},
        [785] = {2018801,"Xiao Qiao","Qiao Gong","Xiao Qiao, kakakmu sangat pemalu, jangan menertawakan dia. Melihat Wancheng akan diserang hancur, kalian tinggal saja di dalam rumah dan jangan keluar, agar terhindar dari masalah.","Xiao Qiao, kakakmu sangat pemalu, jangan menertawakan dia. Melihat Wancheng akan diserang hancur, kalian tinggal saja di dalam rumah dan jangan keluar, agar terhindar dari masalah.",},
        [786] = {2018801,"Qiao Gong","Da Qiao","Ya, seperti yang Ayah katakan.","Ya, seperti yang Ayah katakan.",},
        [787] = {2018802,"Da Qiao","Xiao Qiao","Seharian di dalam rumah, sangat membosankan, saat ayah tidak di rumah, aku akan keluar diam-diam untuk bermain!","Seharian di dalam rumah, sangat membosankan, saat ayah tidak di rumah, aku akan keluar diam-diam untuk bermain!",},
        [788] = {2018802,"Xiao Qiao","Da Qiao","Adik, kembali denganku. Ayah sangat khawatir karena tidak bisa menemukanmu.","Adik, kembali denganku. Ayah sangat khawatir karena tidak bisa menemukanmu.",},
        [789] = {2018802,"Da Qiao","Sun Ce","Wanita ini sangat cantik. Bolehkah aku tahu kamu tinggal dimana? Akan kuantar kamu pulang, bagaimana?","Wanita ini sangat cantik. Bolehkah aku tahu kamu tinggal dimana? Akan kuantar kamu pulang, bagaimana?",},
        [790] = {2018802,"Sun Ce","Da Qiao","(Da Qiao memandang sekilas Sun Ce, mukanya memerah) Aku tidak ingin merepotkanmu. Kakak, ayo kita pulang sekarang!","(Da Qiao memandang sekilas Sun Ce, mukanya memerah) Aku tidak ingin merepotkanmu. Kakak, ayo kita pulang sekarang!",},
        [791] = {2018802,"Sun Ce","Zhou Yu","Bofu, jangan menakuti mereka!","Bofu, jangan menakuti mereka!",},
        [792] = {2018802,"Sun Ce","Da Qiao","Adik, kita pulang sekarang! (Da Qiao menarik Xiao Qiao kembali dengan gelisah ke Kediaman Qiao)","Adik, kita pulang sekarang! (Da Qiao menarik Xiao Qiao kembali dengan gelisah ke Kediaman Qiao)",},
        [793] = {2018803,"","Da Qiao","Wancheng telah ditembus, ayah dengan terpaksa akan menyerahkanku kepada jenderal lawan Sun Ce…","Wancheng telah ditembus, ayah dengan terpaksa akan menyerahkanku kepada jenderal lawan Sun Ce…",},
        [794] = {2018803,"","Da Qiao","Eh, aku sungguh tidak tahu siapa Sun Ce sebenarnya. Aku belum pernah bertemu dengannya sekalipun, dan sekarang harus menikah dengannya.","Eh, aku sungguh tidak tahu siapa Sun Ce sebenarnya. Aku belum pernah bertemu dengannya sekalipun, dan sekarang harus menikah dengannya.",},
        [795] = {2018803,"Da Qiao","Sun Ce","Nona, apakah kamu mengingatku? Sejak hari itu, aku terus memikirkanmu, apakah kamu bersedia menikah denganku dan hidup denganku hingga tua?","Nona, apakah kamu mengingatku? Sejak hari itu, aku terus memikirkanmu, apakah kamu bersedia menikah denganku dan hidup denganku hingga tua?",},
        [796] = {2018803,"Da Qiao","Sun Ce","Tenanglah, kalau kamu tidak mau, aku tidak akan memaksamu.","Tenanglah, kalau kamu tidak mau, aku tidak akan memaksamu.",},
        [797] = {2018803,"Sun Ce","Da Qiao","(sangat malu) …","(sangat malu) …",},
        [798] = {2018803,"Da Qiao","Sun Ce","Apakah kamu malu, hingga tidak berani bicara? Baiklah, jika ingin menikah denganku, cukup anggukkan kepalamu. Jika tidak, cukup gelengkan kepala.","Apakah kamu malu, hingga tidak berani bicara? Baiklah, jika ingin menikah denganku, cukup anggukkan kepalamu. Jika tidak, cukup gelengkan kepala.",},
        [799] = {2018803,"Sun Ce","Da Qiao","(mengangguk dengan lembut, berkata dengan suara kecil) Tuan menjagaku sepenuh hati, Da Qiao bersedia menyerahkan hatinya dan tidak akan berubah!","(mengangguk dengan lembut, berkata dengan suara kecil) Tuan menjagaku sepenuh hati, Da Qiao bersedia menyerahkan hatinya dan tidak akan berubah!",},
        [800] = {2018901,"Nyonya Gongsun","Prefektur Zhuo","Putriku yang baik, aku telah mempersiapkan pernikahanmu hari ini!","Putriku yang baik, aku telah mempersiapkan pernikahanmu hari ini!",},
        [801] = {2018901,"Prefektur Zhuo","Nyonya Gongsun","Ayah, untuk kebahagiaan putrimu, mengapa begini tergesa-gesa mengambil keputusan?","Ayah, untuk kebahagiaan putrimu, mengapa begini tergesa-gesa mengambil keputusan?",},
        [802] = {2018901,"Nyonya Gongsun","Prefektur Zhuo","Kamu pasti akan puas dengan pernikahan yang ayah siapkan untukmu. Orang ini bernama Gongsun Zan, kelahiran aristokrat keluarga Gongsun di sebelah barat Liao.","Kamu pasti akan puas dengan pernikahan yang ayah siapkan untukmu. Orang ini bernama Gongsun Zan, kelahiran aristokrat keluarga Gongsun di sebelah barat Liao.",},
        [803] = {2018901,"Nyonya Gongsun","Prefektur Zhuo","Gongsun Zan sangat tampan, suaranya merdu, cerdas, memiliki masa depan cerah.","Gongsun Zan sangat tampan, suaranya merdu, cerdas, memiliki masa depan cerah.",},
        [804] = {2018901,"Prefektur Zhuo","Nyonya Gongsun","Kalau begini, semuanya Ayah yang tentukan!","Kalau begini, semuanya Ayah yang tentukan!",},
        [805] = {2018901,"Nyonya Gongsun","Prefektur Zhuo","Baiklah, putriku akan menjadi Nyonya Gongsun, haha!","Baiklah, putriku akan menjadi Nyonya Gongsun, haha!",},
        [806] = {2018902,"Gongsun Zan","Liu Bei","Gongsun Zan, kamu sungguh beruntung!","Gongsun Zan, kamu sungguh beruntung!",},
        [807] = {2018902,"Liu Bei","Gongsun Zan","Liu Bei, kamu adalah keturunan Pangeran Jing dari Zhongshan, aku tidak bisa dibandingkan denganmu!","Liu Bei, kamu adalah keturunan Pangeran Jing dari Zhongshan, aku tidak bisa dibandingkan denganmu!",},
        [808] = {2018902,"Gongsun Zan","Liu Bei","Hentikan! Kamu baru saja menjadi menantu Sekretariat Zhuo. Mertuamu juga memberikan surat padamu, menjadikanmu pegawai di bawah Lu Zhi. Masa depanmu tidak bisa dihitung banyaknya.","Hentikan! Kamu baru saja menjadi menantu Sekretariat Zhuo. Mertuamu juga memberikan surat padamu, menjadikanmu pegawai di bawah Lu Zhi. Masa depanmu tidak bisa dihitung banyaknya.",},
        [809] = {2018902,"Liu Bei","Gongsun Zan","Haha, bukankah kamu juga akan bekerja untuk Lu Zhi! Bukan masalah, kamu dan aku adalah teman sekolah dan dari desa yang sama, harus menjaga satu sama lain!","Haha, bukankah kamu juga akan bekerja untuk Lu Zhi! Bukan masalah, kamu dan aku adalah teman sekolah dan dari desa yang sama, harus menjaga satu sama lain!",},
        [810] = {2018903,"Raja Wuheng","Gongsun Zan","Aku adalah Jenderal Kuda Putih Gongsun Zan! Atas perintah istana untuk melindungi perbatasan, aku akan membunuh kalian bandit Wuheng karena menyerang perbatasan kami lagi dan lagi.","Aku adalah Jenderal Kuda Putih Gongsun Zan! Atas perintah istana untuk melindungi perbatasan, aku akan membunuh kalian bandit Wuheng karena menyerang perbatasan kami lagi dan lagi.",},
        [811] = {2018903,"Gongsun Zan","Raja Wuheng","Jenderal, kamu dan aku hanyalah menjalankan perintah, mengapa harus saling membunuh? Mari kita saling tutup mata, bukankah ini lebih baik?","Jenderal, kamu dan aku hanyalah menjalankan perintah, mengapa harus saling membunuh? Mari kita saling tutup mata, bukankah ini lebih baik?",},
        [812] = {2018903,"Raja Wuheng","Gongsun Zan","Omong kosong! Kalian para bandit jika berani menyerbu kami, aku akan mengangkat pedangku dan membunuh kalian satu persatu! Tidak ada yang tersisa! Saudara-saudara, serang!","Omong kosong! Kalian para bandit jika berani menyerbu kami, aku akan mengangkat pedangku dan membunuh kalian satu persatu! Tidak ada yang tersisa! Saudara-saudara, serang!",},
        [813] = {2018903,"Gongsun Zan","Raja Wuheng","Sangat hebat, tidak disangka orang Han memiliki hero sehebat ini? Bailkah, aku sangat menghormati pejuang, semuanya, kita pergi!","Sangat hebat, tidak disangka orang Han memiliki hero sehebat ini? Bailkah, aku sangat menghormati pejuang, semuanya, kita pergi!",},
        [814] = {2018903,"Gongsun Zan","Raja Wuheng","Berikutnya jika melihat sekelompok berkuda putih, kita harus cepat pergi! Jangan sampai kehilangan nyawa hanya untuk harta!","Berikutnya jika melihat sekelompok berkuda putih, kita harus cepat pergi! Jangan sampai kehilangan nyawa hanya untuk harta!",},
        [815] = {20181001,"Jia Xu","Pemberontak Di","Hari ini beruntung, menangkap lebih dari sepuluh orang Han, membunuh mereka tidaklah rugi! Hahaha!","Hari ini beruntung, menangkap lebih dari sepuluh orang Han, membunuh mereka tidaklah rugi! Hahaha!",},
        [816] = {20181001,"Pemberontak Di","Jia Xu","(Sungguh tidak beruntung, bagaimana bisa aku bertemu dengan bandit ini di perjalanan pulang! Aku Jia Xu tidak bisa mati di tempat ini, aku harus memikirkan cara untuk menyelamatkan diri!)","(Sungguh tidak beruntung, bagaimana bisa aku bertemu dengan bandit ini di perjalanan pulang! Aku Jia Xu tidak bisa mati di tempat ini, aku harus memikirkan cara untuk menyelamatkan diri!)",},
        [817] = {20181001,"Pemberontak Di","Jia Xu","(Orang ini menangkap kami, dengan tujuan apa? Uang atau nyawa? Aku tahu!) Tahukah kalian siapa aku?","(Orang ini menangkap kami, dengan tujuan apa? Uang atau nyawa? Aku tahu!) Tahukah kalian siapa aku?",},
        [818] = {20181001,"Jia Xu","Pemberontak Di","Orang Han ini bicara apa?","Orang Han ini bicara apa?",},
        [819] = {20181001,"Pemberontak Di","Jia Xu","Apakah kalian kenal dengan Tuan Duan yang terkenal itu?","Apakah kalian kenal dengan Tuan Duan yang terkenal itu?",},
        [820] = {20181001,"Jia Xu","Pemberontak Di","Yang kamu bicarakan adalah Duan Ying, Zhang Huan dan Huangfu Gui yang terkenal dari Dinasti Han, juga disebut sebagai Tiga Orang Bijaksana Liangzhou.","Yang kamu bicarakan adalah Duan Ying, Zhang Huan dan Huangfu Gui yang terkenal dari Dinasti Han, juga disebut sebagai Tiga Orang Bijaksana Liangzhou.",},
        [821] = {20181001,"Pemberontak Di","Jia Xu","Betul! Aku adalah cucu Tuan Duan. Kalian jangan menyakitiku, keluargaku akan menebus dengan emas yang banyak. Saat mendapatkan emasnya, kalian bisa pergi dengan jauh.","Betul! Aku adalah cucu Tuan Duan. Kalian jangan menyakitiku, keluargaku akan menebus dengan emas yang banyak. Saat mendapatkan emasnya, kalian bisa pergi dengan jauh.",},
        [822] = {20181001,"Jia Xu","Pemberontak Di","Kalian orang Han memang licik, kamu bersumpahlah dan aku akan melepaskanmu! (Jia Xu bersumpah dan orang Di membiarkannya pergi, orang yang lain dibunuh. Jia Xu menyelamatkan diri sendiri dengan kecerdasannya)","Kalian orang Han memang licik, kamu bersumpahlah dan aku akan melepaskanmu! (Jia Xu bersumpah dan orang Di membiarkannya pergi, orang yang lain dibunuh. Jia Xu menyelamatkan diri sendiri dengan kecerdasannya)",},
        [823] = {20181002,"Jia Xu","Li Jue","Wang Yun Bandit tua itu, tidak mau melepaskan kami, karena begini, kita cepat melarikan diri!","Wang Yun Bandit tua itu, tidak mau melepaskan kami, karena begini, kita cepat melarikan diri!",},
        [824] = {20181002,"Li Jue","Jia Xu","Jika kamu meninggalkan tentaramu dan pergi sendiri, seorang kapten akan memburumu. Lebih baik kita panggil prajurit, maju ke Chang'an dan membalaskan dendam dengan Dong Zhuo.","Jika kamu meninggalkan tentaramu dan pergi sendiri, seorang kapten akan memburumu. Lebih baik kita panggil prajurit, maju ke Chang'an dan membalaskan dendam dengan Dong Zhuo.",},
