        [826] = {20181002,"Li Jue","Jia Xu","Jika berhasil, kita akan berjasa bagi kaisar dan negara. Jika gagal, pergi pun juga belum terlambat.","Jika berhasil, kita akan berjasa bagi kaisar dan negara. Jika gagal, pergi pun juga belum terlambat.",},
