        [1252] = {20183403,"Huang Gai","Zhou Yu","Cao Cao, dengan jutaan prajurit, membawa kapal ke arah selatan menuju Chibi, bersiap untuk menghancurkan Koalisi Shu dan Wu.","Cao Cao, dengan jutaan prajurit, membawa kapal ke arah selatan menuju Chibi, bersiap untuk menghancurkan Koalisi Shu dan Wu.",},
