        [1254] = {20183403,"Zhou Yu","Huang Gai","Tuan, aku bisa berpura-pura meminta pertolongan Cao Cao, membuat dia lengah.","Tuan, aku bisa berpura-pura meminta pertolongan Cao Cao, membuat dia lengah.",},
