        [1263] = {20183502,"Liu Bei","Fa Zheng","Kamu adalah Tuan yang bijaksana. Tetapi Liu Zhang tidak dapat memimpin. Kita bisa menggunakan Zhang Song sebagai orang dalam untuk menangkap Yizhou.","Kamu adalah Tuan yang bijaksana. Tetapi Liu Zhang tidak dapat memimpin. Kita bisa menggunakan Zhang Song sebagai orang dalam untuk menangkap Yizhou.",},
        [1264] = {20183502,"Liu Bei","Fa Zheng","Dengan kekayaan Yizhou dan lokasi Istana Langit, kita dapat mencapai tujuan besar dengan mudah.","Dengan kekayaan Yizhou dan lokasi Istana Langit, kita dapat mencapai tujuan besar dengan mudah.",},
