        [1266] = {20183503,"Fa Zheng","Liu Bei","Xiaohou Yuan menjaga di Benteng Barat Lembah Zouma. Sedangkan Zhang He menjaga di Benteng Timur Guangshi.","Xiaohou Yuan menjaga di Benteng Barat Lembah Zouma. Sedangkan Zhang He menjaga di Benteng Timur Guangshi.",},
        [1267] = {20183503,"Fa Zheng","Liu Bei","Bagaimana bisa menyerangnya?","Bagaimana bisa menyerangnya?",},
        [1268] = {20183503,"Liu Bei","Fa Zheng","Menurutku, kita seharusnya mengirimkan sepuluh ribu pasukan elit, dibagi menjadi sepuluh regu dan menyerang Guangshi dengan ramai malam ini. Zhang He akan mencari bantuan Xiahou Yuan.","Menurutku, kita seharusnya mengirimkan sepuluh ribu pasukan elit, dibagi menjadi sepuluh regu dan menyerang Guangshi dengan ramai malam ini. Zhang He akan mencari bantuan Xiahou Yuan.",},
        [1269] = {20183503,"Liu Bei","Fa Zheng","Saat Xiahou Yuan memisahkan prajurit untuk menyelamatkan Zhang He, kita langsung menyerang Lembah Zouma dengan diam-diam dan membakar untuk menghancurkan formasi Pasukan Cao.","Saat Xiahou Yuan memisahkan prajurit untuk menyelamatkan Zhang He, kita langsung menyerang Lembah Zouma dengan diam-diam dan membakar untuk menghancurkan formasi Pasukan Cao.",},
        [1270] = {20183503,"Liu Bei","Fa Zheng","Saat api membesar serang Xiahou Yuan dengan penuh tenaga, dengan begini pasti akan berhasil.","Saat api membesar serang Xiahou Yuan dengan penuh tenaga, dengan begini pasti akan berhasil.",},
        [1271] = {20183601,"Lu Su","Zhou Yu","Tentara kami kekurangan gandum, masalah sangat besar.","Tentara kami kekurangan gandum, masalah sangat besar.",},
