        [1275] = {20183602,"","Sun Quan","Xuande, memintaku beberapa kali untuk menukarkan setengah dari Jiangxia miliknya dengan setengah dari Jingzhou milikku, dan membiarkan dia membangun.","Xuande, memintaku beberapa kali untuk menukarkan setengah dari Jiangxia miliknya dengan setengah dari Jingzhou milikku, dan membiarkan dia membangun.",},
        [1276] = {20183602,"","Sun Quan","Hal yang merugikan seperti ini, bagaimana mungkin aku setuju, konyol!","Hal yang merugikan seperti ini, bagaimana mungkin aku setuju, konyol!",},
        [1277] = {20183602,"Sun Quan","Lu Su","Aku memiliki pandangan yang berbeda, kita harus meminjamkan Jingzhou padanya.","Aku memiliki pandangan yang berbeda, kita harus meminjamkan Jingzhou padanya.",},
        [1278] = {20183602,"Lu Su","Sun Quan","Kenapa?","Kenapa?",},
        [1279] = {20183602,"Sun Quan","Lu Su","Pertama, meskipun bilang meminjam Jingzhou, tetapi sebenarnya hanya perlu meminjamkan Nanjun dan Xiangyang saja.","Pertama, meskipun bilang meminjam Jingzhou, tetapi sebenarnya hanya perlu meminjamkan Nanjun dan Xiangyang saja.",},
        [1280] = {20183602,"Sun Quan","Lu Su","Kedua, Liu Bei adalah satu-satunya yang berani melawan Cao Cao di luar Dongwu. Musuh dari musuhku adalah teman.","Kedua, Liu Bei adalah satu-satunya yang berani melawan Cao Cao di luar Dongwu. Musuh dari musuhku adalah teman.",},
        [1281] = {20183602,"Sun Quan","Lu Su","Hal ini memiliki nilai strategi yang signifikan, nilainya jauh dari beberapa tempat-tempat ini.","Hal ini memiliki nilai strategi yang signifikan, nilainya jauh dari beberapa tempat-tempat ini.",},
        [1282] = {20183602,"Lu Su","Sun Quan","Perkataan Zijing ada benarnya.","Perkataan Zijing ada benarnya.",},
        [1283] = {20183603,"Lu Su","Guan Yu","Zijing, kamu menyarankan untuk mengirimkan pasukan seratus langkah di luar.","Zijing, kamu menyarankan untuk mengirimkan pasukan seratus langkah di luar.",},
        [1284] = {20183603,"Lu Su","Guan Yu","Apa kamu tidak takut aku akan dibunuh olehku sendiri?","Apa kamu tidak takut aku akan dibunuh olehku sendiri?",},
        [1285] = {20183603,"Guan Yu","Lu Su","Jika takut, maka aku tidak akan datang. Kamu telah dikalahkan dan tidak ada tempat untuk berdiri. Aku meminjamkanmu tanah Jiangdong dengan ikhlas.","Jika takut, maka aku tidak akan datang. Kamu telah dikalahkan dan tidak ada tempat untuk berdiri. Aku meminjamkanmu tanah Jiangdong dengan ikhlas.",},
        [1286] = {20183603,"Guan Yu","Lu Su","Sekarang kalian sudah mengambil Yizhou, karena tidak ada tanda kembalinya Jingzhou, aku hanya meminta kalian untuk mengembalikan tiga prefektur.","Sekarang kalian sudah mengambil Yizhou, karena tidak ada tanda kembalinya Jingzhou, aku hanya meminta kalian untuk mengembalikan tiga prefektur.",},
        [1287] = {20183603,"Lu Su","Zhou Cang","Hanya orang bajik di dunia ini yang bisa mendapatkan tanahnya. Bukan secara khusus dimiliki Dongwu, benar?","Hanya orang bajik di dunia ini yang bisa mendapatkan tanahnya. Bukan secara khusus dimiliki Dongwu, benar?",},
        [1288] = {20183603,"Lu Su","Guan Yu","Ini adalah perkara negara, diam dan cepatlah mundur!","Ini adalah perkara negara, diam dan cepatlah mundur!",},
        [1289] = {20183603,"Lu Su","Guan Yu","Zijing, hari ini aku mabuk. Jangan bahas lagi tentang Jingzhou, kalau tidak aku tidak bisa menjaga pertemanan kita dan akan bertarung.","Zijing, hari ini aku mabuk. Jangan bahas lagi tentang Jingzhou, kalau tidak aku tidak bisa menjaga pertemanan kita dan akan bertarung.",},
