        [1291] = {20183701,"Pang Tong","Liu Bei","Lu Su mengirimkan surat padaku, mengatakan kamu adalah talenta langka.","Lu Su mengirimkan surat padaku, mengatakan kamu adalah talenta langka.",},
        [1292] = {20183701,"Pang Tong","Liu Bei","Tuan Wolong juga sering membicarakan talentamu padaku.","Tuan Wolong juga sering membicarakan talentamu padaku.",},
        [1293] = {20183701,"Liu Bei","Pang Tong","Mendapat pengakuan Zijing dan Kongming, aku sangat senang.","Mendapat pengakuan Zijing dan Kongming, aku sangat senang.",},
        [1294] = {20183701,"Pang Tong","Liu Bei","Tidak tahu apakah tuan bersedia untuk bergabung denganku dan merancang siasat untukku?","Tidak tahu apakah tuan bersedia untuk bergabung denganku dan merancang siasat untukku?",},
