        [1296] = {20183702,"Liu Bei","Pang Tong","Jingzhou tandus dan hancur, talenta dan sumber dayanya juga sedikit.","Jingzhou tandus dan hancur, talenta dan sumber dayanya juga sedikit.",},
        [1297] = {20183702,"Liu Bei","Pang Tong","Di timur ada Sun Quan, di utara ada Cao Cao, tidak mudah untuk mendapatkan perkembangan positif.","Di timur ada Sun Quan, di utara ada Cao Cao, tidak mudah untuk mendapatkan perkembangan positif.",},
        [1298] = {20183702,"Liu Bei","Pang Tong","Yizhou memiliki populasi jutawan, tanah yang subur dan kaya sumber daya, jika dapat menangkap tempat ini untuk dijadikan pondasi, pasti akan menjadi sukses besar.","Yizhou memiliki populasi jutawan, tanah yang subur dan kaya sumber daya, jika dapat menangkap tempat ini untuk dijadikan pondasi, pasti akan menjadi sukses besar.",},
        [1299] = {20183702,"Pang Tong","Liu Bei","Cao Cao sangat jahat, maka aku berbaik hati. Cao Cao adalah tirani, maka aku penuh kebajikan. Cao Cao licik, maka aku setia.","Cao Cao sangat jahat, maka aku berbaik hati. Cao Cao adalah tirani, maka aku penuh kebajikan. Cao Cao licik, maka aku setia.",},
        [1300] = {20183702,"Pang Tong","Liu Bei","Yang kulakukan semuanya berlawanan dengannya sehingga ada keberhasilan hari ini. Untuk mendapat Yizhou, apakah harus kehilangan kepercayaan negara?","Yang kulakukan semuanya berlawanan dengannya sehingga ada keberhasilan hari ini. Untuk mendapat Yizhou, apakah harus kehilangan kepercayaan negara?",},
        [1301] = {20183702,"Liu Bei","Pang Tong","Di saat yang kacau seperti ini, kita tidak bisa bertahan pada peraturan yang lama. Harus bisa berubah sesuai dengan keadaan.","Di saat yang kacau seperti ini, kita tidak bisa bertahan pada peraturan yang lama. Harus bisa berubah sesuai dengan keadaan.",},
        [1302] = {20183702,"Liu Bei","Pang Tong","Telan yang lemah, serang raja yang kurang baik, khianati raja untuk mendapatkan dunia, memerintah negara sesuai dengan akal sehat, lalu membalas negara dengan kebaikan dan keadilan, inilah hal yang dihormati oleh orang kuno. Jika kita berhasil, berikan sebagian tanah padanya, siapa yang bisa berkata bahwa kamu tidak jujur?","Telan yang lemah, serang raja yang kurang baik, khianati raja untuk mendapatkan dunia, memerintah negara sesuai dengan akal sehat, lalu membalas negara dengan kebaikan dan keadilan, inilah hal yang dihormati oleh orang kuno. Jika kita berhasil, berikan sebagian tanah padanya, siapa yang bisa berkata bahwa kamu tidak jujur?",},
        [1303] = {20183702,"Pang Tong","Liu Bei","Masuk akal. Sekarang Zhuge Liang dan Guan Yu berada di Jingzhou. Kamu pergi denganku ke Yizhou.","Masuk akal. Sekarang Zhuge Liang dan Guan Yu berada di Jingzhou. Kamu pergi denganku ke Yizhou.",},
        [1304] = {20183801,"Zhang Zhao","Tao Qian","Dengar-dengar Zibu sangat menonjol, sangat berpengetahuan, memiliki bakat dan strategi yang luar biasa.","Dengar-dengar Zibu sangat menonjol, sangat berpengetahuan, memiliki bakat dan strategi yang luar biasa.",},
        [1305] = {20183801,"Zhang Zhao","Tao Qian","Aku merekomendasikanmu sebagai penasihat, bagaimana?","Aku merekomendasikanmu sebagai penasihat, bagaimana?",},
        [1306] = {20183801,"Tao Qian","Zhang Zhao","Terima kasih atas apresiasinya, tetapi aku tidak ingin menjadi pejabat.","Terima kasih atas apresiasinya, tetapi aku tidak ingin menjadi pejabat.",},
