        [1315] = {20183803,"Sun Quan","Zhang Zhao","Seorang raja harus bisa mengendalikan pahlawan dan menggunakan orang-orang ini sebagai kekuatan negara. Mengapa dia harus berlari ke medan liar dan terlihat lebih ganas daripada binatang buas?","Seorang raja harus bisa mengendalikan pahlawan dan menggunakan orang-orang ini sebagai kekuatan negara. Mengapa dia harus berlari ke medan liar dan terlihat lebih ganas daripada binatang buas?",},
        [1316] = {20183803,"Sun Quan","Zhang Zhao","Jika tiba-tiba terjadi masalah, tidak takut akan menjadi lelucon negara?","Jika tiba-tiba terjadi masalah, tidak takut akan menjadi lelucon negara?",},
        [1317] = {20183803,"Zhang Zhao","Sun Quan","Aku masih muda dan tidak berhati-hati. Maafkan aku.","Aku masih muda dan tidak berhati-hati. Maafkan aku.",},
