        [1321] = {20183902,"Mi Heng","Cao Cao","Mi Heng, mengapa kamu berani maju ke acara ini tanpa mengganti pakaianmu","Mi Heng, mengapa kamu berani maju ke acara ini tanpa mengganti pakaianmu",},
        [1322] = {20183902,"Cao Cao","Mi Heng","Baik! Aku akan ganti baju. (Lalu dia melepas baju, memukul gendang dengan telanjang, dan memakai seragam pelan-pelan.)","Baik! Aku akan ganti baju. (Lalu dia melepas baju, memukul gendang dengan telanjang, dan memakai seragam pelan-pelan.)",},
        [1323] = {20183902,"Mi Heng","Cao Cao","Sial, aku berpikir untuk mempermalukanmu, tidak disangka malah berbalik padaku.","Sial, aku berpikir untuk mempermalukanmu, tidak disangka malah berbalik padaku.",},
