        [1330] = {20184001,"","Yuan Shao","Aku menduduki Jizhou, mengambil Qingzhou dan Bingzhou. Mengalahkan Gongsun Zan di Pertempuran Yijing dan menyatukan Hebei.","Aku menduduki Jizhou, mengambil Qingzhou dan Bingzhou. Mengalahkan Gongsun Zan di Pertempuran Yijing dan menyatukan Hebei.",},
        [1331] = {20184001,"","Yuan Shao","Ini semua adalah usaha Qu Yi, Yan Liang, Wen Chou, Zhang He dan Gao Lan.","Ini semua adalah usaha Qu Yi, Yan Liang, Wen Chou, Zhang He dan Gao Lan.",},
        [1332] = {20184001,"","Yuan Shao","Yan Liang dan Wen Chou mereka adalah Macan Serigala Bersaudara!","Yan Liang dan Wen Chou mereka adalah Macan Serigala Bersaudara!",},
