        [1334] = {20184002,"Cao Cao","Xun You","Perdana Menteri, pasukan kita kalah dibanding lawan, kita harus memisahkan kekuatan lawan untuk menang. Jika kita mengirimkan prajurit yang melewati sungai di arah belakang mereka, Yuan Shao akan menuju barat.","Perdana Menteri, pasukan kita kalah dibanding lawan, kita harus memisahkan kekuatan lawan untuk menang. Jika kita mengirimkan prajurit yang melewati sungai di arah belakang mereka, Yuan Shao akan menuju barat.",},
        [1335] = {20184002,"Cao Cao","Xun You","Lalu serang Baima dengan ringan, membuat mereka lengah dan tangkap Yan Liang.","Lalu serang Baima dengan ringan, membuat mereka lengah dan tangkap Yan Liang.",},
        [1336] = {20184002,"Xun You","Cao Cao","Baik, akan kami lakukan.","Baik, akan kami lakukan.",},
