        [1338] = {20184003,"Cao Cao","Xun You","Waktu yang tepat, kirimkan Zhang Liao dan Guan Yu sebagai baris depan, pasti dapat mengusir mereka.","Waktu yang tepat, kirimkan Zhang Liao dan Guan Yu sebagai baris depan, pasti dapat mengusir mereka.",},
        [1339] = {20184003,"Xun You","Guan Yu","Melepaskan kepungan Baima, aku sendiri bisa melakukannya. Aku akan memenggal kepala Yan Liang untukmu.","Melepaskan kepungan Baima, aku sendiri bisa melakukannya. Aku akan memenggal kepala Yan Liang untukmu.",},
