        [1343] = {20184004,"Wen Chou","Guan Yu","Balas dendam? Takutnya ini juga akan mengambil nyawamu!","Balas dendam? Takutnya ini juga akan mengambil nyawamu!",},
        [1344] = {20184101,"Nyonya Cai","Huang Yueying","Tante mengundangku untuk mengunjunginya. Aku tidak tahu apa yang dia inginkan?","Tante mengundangku untuk mengunjunginya. Aku tidak tahu apa yang dia inginkan?",},
        [1345] = {20184101,"Huang Yueying","Nyonya Cai","Yueying, aku sangat merindukanmu. Kamu selalu menutupi wajahmu dengan topi bambu dan tidak pernah berias, banyak orang yang menyangka kamu berwajah jelek. Kenyataannya, Yueying adalah wanita tercantik.","Yueying, aku sangat merindukanmu. Kamu selalu menutupi wajahmu dengan topi bambu dan tidak pernah berias, banyak orang yang menyangka kamu berwajah jelek. Kenyataannya, Yueying adalah wanita tercantik.",},
        [1346] = {20184101,"Nyonya Cai","Huang Yueying","Sangat lucu. Yueying tidak terbiasa dengan orang tidak dikenal.","Sangat lucu. Yueying tidak terbiasa dengan orang tidak dikenal.",},
        [1347] = {20184101,"Huang Yueying","Nyonya Cai","Cepat lihat, pamanmu Cai Mao selalu memanjakanmu. Dia mengirimkan beberapa pak Brokat Sichuan. Lihat, mana yang kamu suka?","Cepat lihat, pamanmu Cai Mao selalu memanjakanmu. Dia mengirimkan beberapa pak Brokat Sichuan. Lihat, mana yang kamu suka?",},
        [1348] = {20184101,"Nyonya Cai","Huang Yueying","Tante, Yueying membaca buku sepanjang hari, juga menyukai pekerjaan kerajinan kayu. Aku takut menyia-nyiakan nilai Brokat Sichuan ini.","Tante, Yueying membaca buku sepanjang hari, juga menyukai pekerjaan kerajinan kayu. Aku takut menyia-nyiakan nilai Brokat Sichuan ini.",},
        [1349] = {20184101,"Huang Yueying","Nyonya Cai","Brokat Sichuan tidak mudah didapatkan, tetapi pamanmu Cai Mao mengirimkan orang untuk membelinya di Shu. Kamu jangan mengecewakannya. Dan kamu akan segera menikah, jadi harus memakai gaun pernikahan yang cerah.","Brokat Sichuan tidak mudah didapatkan, tetapi pamanmu Cai Mao mengirimkan orang untuk membelinya di Shu. Kamu jangan mengecewakannya. Dan kamu akan segera menikah, jadi harus memakai gaun pernikahan yang cerah.",},
        [1350] = {20184101,"Nyonya Cai","Huang Yueying","Ini… Tante, tolong pilihkan satu untukku.","Ini… Tante, tolong pilihkan satu untukku.",},
        [1351] = {20184102,"Cai Mao","Liu Biao","Istana mengangkatku menjadi Sekretariat Jingzhou, aku berjalan sendiri ke Jingzhou, tetapi tidak bisa masuk. Banyak bandit di Jingzhou, rakyat tidak dekat dengan istana. Cai Mao, keluargamu adalah keluarga terkemuka di Xiangyang. Apakah kamu memiliki rencana bagus untuk menyelesaikan kekacauan?","Istana mengangkatku menjadi Sekretariat Jingzhou, aku berjalan sendiri ke Jingzhou, tetapi tidak bisa masuk. Banyak bandit di Jingzhou, rakyat tidak dekat dengan istana. Cai Mao, keluargamu adalah keluarga terkemuka di Xiangyang. Apakah kamu memiliki rencana bagus untuk menyelesaikan kekacauan?",},
        [1352] = {20184102,"Liu Biao","Cai Mao","Ketua-ketua bandit serakah dan kejam, menyusahkan bawahannya. Aku memiliki beberapa orang berkemampuan, jika mengirimkan orang ini untuk memberitahukan keuntungan, mereka pasti datang beramai-ramai. Kita bisa menghukum yang tidak bermoral dan menentramkan yang tidak bersalah.","Ketua-ketua bandit serakah dan kejam, menyusahkan bawahannya. Aku memiliki beberapa orang berkemampuan, jika mengirimkan orang ini untuk memberitahukan keuntungan, mereka pasti datang beramai-ramai. Kita bisa menghukum yang tidak bermoral dan menentramkan yang tidak bersalah.",},
        [1353] = {20184102,"Liu Biao","Cai Mao","Dengan begini, orang Jingzhou akan mengetahui bahwa kamu murah hati dan baik, Mereka pasti akan kembali dengan orang tua dan anak mereka. Lalu mengumpulkan prajurit, membuat banyak orang kembali selamat, menempati bagian selatan Jiangling dan bagian utara XIangyang, hingga delapan prefektur JIngzhou dapat ditenangkan.","Dengan begini, orang Jingzhou akan mengetahui bahwa kamu murah hati dan baik, Mereka pasti akan kembali dengan orang tua dan anak mereka. Lalu mengumpulkan prajurit, membuat banyak orang kembali selamat, menempati bagian selatan Jiangling dan bagian utara XIangyang, hingga delapan prefektur JIngzhou dapat ditenangkan.",},
        [1354] = {20184102,"Cai Mao","Liu Biao","Jika ini berhasil, aku akan melaporkan pada istana dan menghadiahimu!","Jika ini berhasil, aku akan melaporkan pada istana dan menghadiahimu!",},
        [1355] = {20184103,"","Liu Cong","Ayahku telah tiada, kakakku berada di Jiangxia sekarang, pamanku Xuande ada di Xinye. Kalian menjadikanku sebagai raja, jika saudara dan pamanku datang, bagaimana aku menjelaskannya?","Ayahku telah tiada, kakakku berada di Jiangxia sekarang, pamanku Xuande ada di Xinye. Kalian menjadikanku sebagai raja, jika saudara dan pamanku datang, bagaimana aku menjelaskannya?",},
        [1356] = {20184103,"Liu Cong","Li Gui","Kita bisa mengirimkan surat darurat ke Jiangxia, meminta Tuan Muda Pertama untuk memerintah dan Xuande untuk memerintah Jinzhou, lalu melawan Cao Cao di utara dan Sun Quan di selatan. Ini adalah strategi sempurna.","Kita bisa mengirimkan surat darurat ke Jiangxia, meminta Tuan Muda Pertama untuk memerintah dan Xuande untuk memerintah Jinzhou, lalu melawan Cao Cao di utara dan Sun Quan di selatan. Ini adalah strategi sempurna.",},
        [1357] = {20184103,"Li Gui","Cai Mao","Siapa kamu? Beraninya bicara sembarangan dan melanggar perintah Tuan!","Siapa kamu? Beraninya bicara sembarangan dan melanggar perintah Tuan!",},
        [1358] = {20184103,"Cai Mao","Li Gui","Kamu bersekongkol dengan lawan, memalsukan wasiat kaisar dan memahkotakan putra bungsu bukan putra sulung. Kamu memberikan sembilan prefektur kepada keluarga Cai. Jika Kaisar masih hidup, kamu pasti akan dihukum mati!","Kamu bersekongkol dengan lawan, memalsukan wasiat kaisar dan memahkotakan putra bungsu bukan putra sulung. Kamu memberikan sembilan prefektur kepada keluarga Cai. Jika Kaisar masih hidup, kamu pasti akan dihukum mati!",},
        [1359] = {20184103,"Li Gui","Cai Mao","Seseorang, orang ini berusaha untuk membingungkan rakyat, penggal kepalanya! Wasiat Tuan adalah, menjadikan Liu Cong sebagai pemimpin Jingzhou!","Seseorang, orang ini berusaha untuk membingungkan rakyat, penggal kepalanya! Wasiat Tuan adalah, menjadikan Liu Cong sebagai pemimpin Jingzhou!",},
        [1360] = {20184104,"Nyonya Cai","Cai Mao","Adik, Liu Bei mengirimkan tiga jenderal keluar tetapi dia tinggal di Jingzhou sendiri. Dia akan menjadi ancaman. ","Adik, Liu Bei mengirimkan tiga jenderal keluar tetapi dia tinggal di Jingzhou sendiri. Dia akan menjadi ancaman. ",},
        [1361] = {20184104,"Cai Mao","Nyonya Cai","Aku mendengar bahwa banyak orang Jingzhou yang bekerjasama dengan Liu Bei, haruslah berhati-hati.","Aku mendengar bahwa banyak orang Jingzhou yang bekerjasama dengan Liu Bei, haruslah berhati-hati.",},
        [1362] = {20184104,"Nyonya Cai","Cai Mao","Menurutku, lebih baik pergi ke kamar Liu Bei dulu dan bunuh dia, lalu beritahu pada Tuan.","Menurutku, lebih baik pergi ke kamar Liu Bei dulu dan bunuh dia, lalu beritahu pada Tuan.",},
        [1363] = {20184104,"Cai Mao","Yi Ji","Cai Mao berencana membunuhmu, ada penjaga di sisi timur, selatan dan utara luar kota. Kamu bisa kabur lewat gerbang barat, cepat!","Cai Mao berencana membunuhmu, ada penjaga di sisi timur, selatan dan utara luar kota. Kamu bisa kabur lewat gerbang barat, cepat!",},
        [1364] = {20184104,"Yi Ji","Cai Mao","Mengapa kamu ingin pergi di pertengahan jalan?","Mengapa kamu ingin pergi di pertengahan jalan?",},
        [1365] = {20184104,"Cai Mao","Liu Bei","Tidak ada dendam antara kamu dan aku. Mengapa kamu ingin membunuhku? Untungnya, aku memiliki Dilu yang membawaku melewati Sungai Tan, kalau tidak aku sudah mati!","Tidak ada dendam antara kamu dan aku. Mengapa kamu ingin membunuhku? Untungnya, aku memiliki Dilu yang membawaku melewati Sungai Tan, kalau tidak aku sudah mati!",},
        [1366] = {20184105,"Liu Qi","Cai Mao","Tuan, Cao Cao memimpin tentara ke Xiangyang! Tuan mengapa tidak memberikan sembilan prefektur ke Cao Cao, dia pasti akan memperlakukanmu dengan baik.","Tuan, Cao Cao memimpin tentara ke Xiangyang! Tuan mengapa tidak memberikan sembilan prefektur ke Cao Cao, dia pasti akan memperlakukanmu dengan baik.",},
        [1367] = {20184105,"Cai Mao","Liu Qi","Aku mewarisi tahta dari kaisar sebelumnya, bagaimana bisa memberikannya dengan sembarangan?","Aku mewarisi tahta dari kaisar sebelumnya, bagaimana bisa memberikannya dengan sembarangan?",},
        [1368] = {20184105,"Liu Qi","Cai Mao","Cao Cao menyerang utara dan selatan dan menggunakan nama Istana. Jika Tuan menolaknya, ini juga tidak baik. Pondasi Tuan juga belum stabil, di luar masih belum tenang, begitu juga yang di dalam, bagaimana mungkin menyinggung Cao Cao? Tuan harus cepat mengambil keputusan.","Cao Cao menyerang utara dan selatan dan menggunakan nama Istana. Jika Tuan menolaknya, ini juga tidak baik. Pondasi Tuan juga belum stabil, di luar masih belum tenang, begitu juga yang di dalam, bagaimana mungkin menyinggung Cao Cao? Tuan harus cepat mengambil keputusan.",},
        [1369] = {20184105,"Cai Mao","Liu Qi","Kalau begini, sesuai dengan saran jenderal, serahkan Jingzhou pada Cao Cao.","Kalau begini, sesuai dengan saran jenderal, serahkan Jingzhou pada Cao Cao.",},
        [1370] = {20184106,"Cai Mao","Cao Cao","Pada pertempuran Sanjiangkou, Dongwu dengan sedikit prajurit, masih dapat mengalahkanmu, itu karena kamu kurang penuh perhatian!","Pada pertempuran Sanjiangkou, Dongwu dengan sedikit prajurit, masih dapat mengalahkanmu, itu karena kamu kurang penuh perhatian!",},
        [1371] = {20184106,"Cao Cao","Cai Mao","Pasukan Air Jingzhou tidak telatih untuk cukup lama. Tentara Qingzhou dan Xuzhou tidak terbiasa dalam pertarungan di air, sehingga kami kalah. Kita harus membangun pertahanan air dulu, Tentara Qingzhou dan Xuzhou di dalam dan Tentara Jingzhou di luar. Berlatih setiap hari hingga ahli, maka bisa bertarung dengan baik.","Pasukan Air Jingzhou tidak telatih untuk cukup lama. Tentara Qingzhou dan Xuzhou tidak terbiasa dalam pertarungan di air, sehingga kami kalah. Kita harus membangun pertahanan air dulu, Tentara Qingzhou dan Xuzhou di dalam dan Tentara Jingzhou di luar. Berlatih setiap hari hingga ahli, maka bisa bertarung dengan baik.",},
        [1372] = {20184106,"Cai Mao","Cao Cao","Kamu adalah Gubernur Marinir, lakukan sesuai keputusanmu, tidak perlu melapor padaku!","Kamu adalah Gubernur Marinir, lakukan sesuai keputusanmu, tidak perlu melapor padaku!",},
        [1373] = {20184106,"Cao Cao","Cai Mao","Perdana Menteri tenanglah, serahkan pasukan marinir kepadaku Cai Mao, aku pasti akan berlatih dengan keras, dan mendapatkan Zhou Yu!","Perdana Menteri tenanglah, serahkan pasukan marinir kepadaku Cai Mao, aku pasti akan berlatih dengan keras, dan mendapatkan Zhou Yu!",},
        [1374] = {20184107,"Cao Cao","Jiang Gan","Perdana Menteri, kepergianku ke Dongwu kali ini, meskipun belum membujuk Zhou Yu, tetapi aku mendengar suatu hal. Cai Mao dan Zhang Yun bersekongkol dengan Zhou Yu di belakang, mungkin ini tidak baik untukmu!","Perdana Menteri, kepergianku ke Dongwu kali ini, meskipun belum membujuk Zhou Yu, tetapi aku mendengar suatu hal. Cai Mao dan Zhang Yun bersekongkol dengan Zhou Yu di belakang, mungkin ini tidak baik untukmu!",},
        [1375] = {20184107,"Jiang Gan","Cao Cao","Dua orang yang tidak tahu terima kasih! Panggil Cai Mao dan Zhang Yun! Aku akan menyuruh mereka berdua maju.","Dua orang yang tidak tahu terima kasih! Panggil Cai Mao dan Zhang Yun! Aku akan menyuruh mereka berdua maju.",},
        [1376] = {20184107,"Cao Cao","Cai Mao","Perdana Menteri, pasukan marinir belum terlatih, saat ini tidak bisa bergerak dengan gegabah.","Perdana Menteri, pasukan marinir belum terlatih, saat ini tidak bisa bergerak dengan gegabah.",},
        [1377] = {20184107,"Cai Mao","Cao Cao","Kepalaku akan diserahkan kepada Zhou Yu saat pasukan telah terlatih dengan baik. Seseorang, eksekusi Cai Mao dan Zhang Yun!","Kepalaku akan diserahkan kepada Zhou Yu saat pasukan telah terlatih dengan baik. Seseorang, eksekusi Cai Mao dan Zhang Yun!",},
        [1378] = {20184107,"Cao Cao","Cai Mao","Perdana Menteri, Perdana Menteri! Cai Mao adalah orang yang sangat loyal dan jujur!","Perdana Menteri, Perdana Menteri! Cai Mao adalah orang yang sangat loyal dan jujur!",},
        [1379] = {20184201,"Li Yong","Dian Wei","Li Yong, kamu telah membunuh Nyonya Liu, akan kuambil nyawamu untuk membalaskan dendam.","Li Yong, kamu telah membunuh Nyonya Liu, akan kuambil nyawamu untuk membalaskan dendam.",},
        [1380] = {20184201,"Dian Wei","Li Yong","Aku adalah Pemimpin Prefektur Fuchun, kami terjaga dengan baik, tidak takut padamu, pembunuh gegabah.","Aku adalah Pemimpin Prefektur Fuchun, kami terjaga dengan baik, tidak takut padamu, pembunuh gegabah.",},
        [1381] = {20184201,"Li Yong","Dian Wei","Tunggu saja, akan kuambil nyawamu! (Lalu, Dian Wei berpura-pura menjadi orang yang mengirimkan salam kepada Li Yong dengan ayam dan anggur di tangan. Saat pintu terbuka, dia berlari dan membunuh Li Yong, mendapatkan namanya di kalangan hero setempat.)","Tunggu saja, akan kuambil nyawamu! (Lalu, Dian Wei berpura-pura menjadi orang yang mengirimkan salam kepada Li Yong dengan ayam dan anggur di tangan. Saat pintu terbuka, dia berlari dan membunuh Li Yong, mendapatkan namanya di kalangan hero setempat.)",},
        [1382] = {20184202,"Dian Wei","Zhang Miao","Siapa kamu? Bendera gigi panjang dan besar, tidak ada yang bisa mengangkat, tidak disangka kamulah yang bisa mengangkat dengan satu tangan.","Siapa kamu? Bendera gigi panjang dan besar, tidak ada yang bisa mengangkat, tidak disangka kamulah yang bisa mengangkat dengan satu tangan.",},
        [1383] = {20184202,"Zhang Miao","Dian Wei","Aku bernama Dian Wei.","Aku bernama Dian Wei.",},
        [1384] = {20184202,"Dian Wei","Zhang Miao","Jadi kamu yang bernama Dian Wei! Namaku Zhang Miao, pemimpin Chenliu. Saat aku membentuk aliansi Anti-Dong Zhuo dengan Cao Cao, aku mendengar nama besarmu, menginginkanmu menjadi sersanku, bersediakah?","Jadi kamu yang bernama Dian Wei! Namaku Zhang Miao, pemimpin Chenliu. Saat aku membentuk aliansi Anti-Dong Zhuo dengan Cao Cao, aku mendengar nama besarmu, menginginkanmu menjadi sersanku, bersediakah?",},
        [1385] = {20184202,"Zhang Miao","Dian Wei","Dong Zhuo telah meracuni istana, Dian Wei bersedia untuk mengabdi pada istana!","Dong Zhuo telah meracuni istana, Dian Wei bersedia untuk mengabdi pada istana!",},
        [1386] = {20184202,"Dian Wei","Zhang Miao","Bagus!","Bagus!",},
        [1387] = {20184203,"Dian Wei","Cao Cao","Dian Wei loyal dan berani, benar-benar seperti E Lai! Dengar-dengar ada peribahasa tentangmu. Ada Dian Wei di tenda, dengan dua tombak ditangan.","Dian Wei loyal dan berani, benar-benar seperti E Lai! Dengar-dengar ada peribahasa tentangmu. Ada Dian Wei di tenda, dengan dua tombak ditangan.",},
        [1388] = {20184203,"Cao Cao","Dian Wei","Hahaha, mereka menertawakanku.","Hahaha, mereka menertawakanku.",},
        [1389] = {20184203,"Dian Wei","Cao Cao","Jangan rendah diri, aku tahu kamu menyukai makanan dan arak. Pelayan, sediakan makanan dan arak!","Jangan rendah diri, aku tahu kamu menyukai makanan dan arak. Pelayan, sediakan makanan dan arak!",},
        [1390] = {20184203,"Cao Cao","Dian Wei","Terima kasih, Tuan!","Terima kasih, Tuan!",},
        [1391] = {20184204,"Dian Wei","Cao Cao","Ada keributan apa di luar sana?","Ada keributan apa di luar sana?",},
        [1392] = {20184204,"Cao Cao","Dian Wei","Tuan, Zhang Xiu melakukan pemberontakan, aku menghentikan mereka, cepatlah mundur dari belakang!","Tuan, Zhang Xiu melakukan pemberontakan, aku menghentikan mereka, cepatlah mundur dari belakang!",},
        [1393] = {20184204,"Dian Wei","Cao Cao","Bukankah Zhang Xiu menyerah? Mengapa masih membelot?","Bukankah Zhang Xiu menyerah? Mengapa masih membelot?",},
        [1394] = {20184204,"Cao Cao","Dian Wei","Terlalu banyak orang! Tuan… pergilah!","Terlalu banyak orang! Tuan… pergilah!",},
        [1395] = {20184301,"Li Jue","Dong Zhuo","Li Jue, kamu memang berani, dan hebat dalam strategi. Sun Jian hebat dalam berperang , kami telah kalah berkali-kali, apakah kamu memiliki rencana bagus?","Li Jue, kamu memang berani, dan hebat dalam strategi. Sun Jian hebat dalam berperang , kami telah kalah berkali-kali, apakah kamu memiliki rencana bagus?",},
        [1396] = {20184301,"Dong Zhuo","Li Jue","Perdana Menteri, terdengar bahwa Sun Jian memiliki putra yang ternama di saat muda. Lebih baik menikahkan putri Perdana Menteri dengan anak Sun Jian. Dengan begini Sun Jian bisa digunakan oleh Perdana Menteri.","Perdana Menteri, terdengar bahwa Sun Jian memiliki putra yang ternama di saat muda. Lebih baik menikahkan putri Perdana Menteri dengan anak Sun Jian. Dengan begini Sun Jian bisa digunakan oleh Perdana Menteri.",},
        [1397] = {20184301,"Li Jue","Dong Zhuo","Baiklah, kalau begitu bantulah aku untuk melamar, jika berhasil, aku akan memberikan hadiah besar padamu.","Baiklah, kalau begitu bantulah aku untuk melamar, jika berhasil, aku akan memberikan hadiah besar padamu.",},
        [1398] = {20184301,"Dong Zhuo","Li Jue","Perdana Menteri tunggu kabar baik dariku!","Perdana Menteri tunggu kabar baik dariku!",},
        [1399] = {20184302,"Jia Xu","Li Jue","Perdana Menteri Dong Zhuo telah mati. Ayo cepat kembali ke Xiliang, mungkin masih ada kesempatan disana.","Perdana Menteri Dong Zhuo telah mati. Ayo cepat kembali ke Xiliang, mungkin masih ada kesempatan disana.",},
        [1400] = {20184302,"Li Jue","Jia Xu","Semua jangan lari, aku memiliki rencana! Jika berhasil, maka kita akan menyelamatkan dunia dan berjasa bagi istana. Jika tidak berhasil, kita masih bisa kabur.","Semua jangan lari, aku memiliki rencana! Jika berhasil, maka kita akan menyelamatkan dunia dan berjasa bagi istana. Jika tidak berhasil, kita masih bisa kabur.",},
        [1401] = {20184302,"Jia Xu","Li Jue","Wenhe, kamu selalu penuh akal, cepat katakan, rencana apa yang kamu miliki?","Wenhe, kamu selalu penuh akal, cepat katakan, rencana apa yang kamu miliki?",},
        [1402] = {20184302,"Li Jue","Jia Xu","Jika meninggalkan prajuritmu dan berlari sendiri, bahkan seorang kapten dapat menangkap kalian. Sebaiknya panggil pasukan dari kamp, menuju Chang'an dan membalaskan dendam untuk Dong Zhuo.","Jika meninggalkan prajuritmu dan berlari sendiri, bahkan seorang kapten dapat menangkap kalian. Sebaiknya panggil pasukan dari kamp, menuju Chang'an dan membalaskan dendam untuk Dong Zhuo.",},
        [1403] = {20184302,"Jia Xu","Li Jue","Rencana bagus, Wang Yun sedang membasmi sisa prajurit Dong Zhuo di Chang'an. Kita sebarkan rumor ke segala penjuru, bahwa Wang Yun akan membasmi orang Xiliang, lalu kita bisa memanggil pasukan dengan cepat dan kembali ke Chang'an.","Rencana bagus, Wang Yun sedang membasmi sisa prajurit Dong Zhuo di Chang'an. Kita sebarkan rumor ke segala penjuru, bahwa Wang Yun akan membasmi orang Xiliang, lalu kita bisa memanggil pasukan dengan cepat dan kembali ke Chang'an.",},
        [1404] = {20184303,"Jia Xu","Kaisar Xian Han","Aku adalah kaisar yang sangat menyedihkan. Li Jue dan Guo Si seperti macan dan serigala, membuat Chang'an menjadi sangat kacau.","Aku adalah kaisar yang sangat menyedihkan. Li Jue dan Guo Si seperti macan dan serigala, membuat Chang'an menjadi sangat kacau.",},
        [1405] = {20184303,"Kaisar Xian Han","Jia Xu","Yang Mulia, lebih baik kembali ke Luoyang dan meninggalkan Chang'an tempat bermasalah ini.","Yang Mulia, lebih baik kembali ke Luoyang dan meninggalkan Chang'an tempat bermasalah ini.",},
        [1406] = {20184303,"Jia Xu","Kaisar Xian Han","Aku takut bahwa Li Jue dan Guo Si tidak akan setuju dengan kepergianku ke Kota Timur.","Aku takut bahwa Li Jue dan Guo Si tidak akan setuju dengan kepergianku ke Kota Timur.",},
        [1407] = {20184303,"Kaisar Xian Han","Jia Xu","Jangan khawatir, Yang Mulia! Li Jue akan mendengarkan perkataanku. Aku memiliki rencana bagus. Dengar-dengar istri Guo Si adalah pencemburu, kita bisa menggunakan siasat perpecahan agar mereka membunuh satu sama lain.","Jangan khawatir, Yang Mulia! Li Jue akan mendengarkan perkataanku. Aku memiliki rencana bagus. Dengar-dengar istri Guo Si adalah pencemburu, kita bisa menggunakan siasat perpecahan agar mereka membunuh satu sama lain.",},
        [1408] = {20184304,"Li Jue","Guo Si","Li Jue, kamu mengundangku ke pesta, tetapi meracuni anggurku, mengapa ingin membunuhku tanpa sebab?","Li Jue, kamu mengundangku ke pesta, tetapi meracuni anggurku, mengapa ingin membunuhku tanpa sebab?",},
        [1409] = {20184304,"Li Jue","Guo Si","Kalau bukan karena istriku meminum dan memuntahkan kotoran itu, dia pasti tidak akan hidup lagi.","Kalau bukan karena istriku meminum dan memuntahkan kotoran itu, dia pasti tidak akan hidup lagi.",},
        [1410] = {20184304,"Guo Si","Li Jue","Siapa yang memperbolehkanmu menggoda istriku dulu! Tidak tahu malu! Istrimu belum mati, itu adalah berkat dari langit.","Siapa yang memperbolehkanmu menggoda istriku dulu! Tidak tahu malu! Istrimu belum mati, itu adalah berkat dari langit.",},
        [1411] = {20184304,"Li Jue","Guo Si","Kamu percaya dengan penyihir dan mengizinkan mereka untuk memukul gendang di dalam kemah. Aku tidak pernah menggoda istrimu, dia sangat bodoh dan jelek. Siapa yang tertarik padanya?","Kamu percaya dengan penyihir dan mengizinkan mereka untuk memukul gendang di dalam kemah. Aku tidak pernah menggoda istrimu, dia sangat bodoh dan jelek. Siapa yang tertarik padanya?",},
        [1412] = {20184304,"Guo Si","Li Jue","Kamu bisa membunuhku, tetapi tidak bisa menghinaku! Beraninya kamu melawanku? Akan kupanggilkan prajuritku untuk memenggal kepalamu!","Kamu bisa membunuhku, tetapi tidak bisa menghinaku! Beraninya kamu melawanku? Akan kupanggilkan prajuritku untuk memenggal kepalamu!",},
        [1413] = {20184305,"Li Jue","Guo Si","Jadi bagaimana, dulu kamu selalu ingin membunuhku, tetapi sekarang malah mencariku.","Jadi bagaimana, dulu kamu selalu ingin membunuhku, tetapi sekarang malah mencariku.",},
        [1414] = {20184305,"Guo Si","Li Jue","Kakak, tidak ada lawan yang abadi, hanya ada keuntungan yang abadi, sekarang jika kita tidak bersatu, takutnya akan ada bahaya.","Kakak, tidak ada lawan yang abadi, hanya ada keuntungan yang abadi, sekarang jika kita tidak bersatu, takutnya akan ada bahaya.",},
        [1415] = {20184305,"Guo Si","Li Jue","Yang Feng dan Dong Cheng melindungi Kaisar Xian kabur dari Chang'an dan pergi ke Hongnong. Jika mereka tiba di Shandong dan menetap, mereka akan memberitakan di seluruh negara, membuat para pangeran menyerang kamu dan aku, pada saatnya mungkin keluarga kami tidak akan selamat.","Yang Feng dan Dong Cheng melindungi Kaisar Xian kabur dari Chang'an dan pergi ke Hongnong. Jika mereka tiba di Shandong dan menetap, mereka akan memberitakan di seluruh negara, membuat para pangeran menyerang kamu dan aku, pada saatnya mungkin keluarga kami tidak akan selamat.",},
        [1416] = {20184305,"Li Jue","Guo Si","Bagus, Zhang Ji berada di Chang'an. Kita tidak bertarung langsung dengannya. Kita gabungkan kekuatan untuk membunuh Kaisar Han di Hannong dan membagi dunia, bagaimana? Namun, tentara Li Le dan Yang Feng banyak dan kuat, apakah kamu memiliki rencana yang bagus?","Bagus, Zhang Ji berada di Chang'an. Kita tidak bertarung langsung dengannya. Kita gabungkan kekuatan untuk membunuh Kaisar Han di Hannong dan membagi dunia, bagaimana? Namun, tentara Li Le dan Yang Feng banyak dan kuat, apakah kamu memiliki rencana yang bagus?",},
        [1417] = {20184305,"Guo Si","Li Jue","Haha! Bunuh yang tua dan lemah, tinggalkan orang yang kuat. Saat musuh datang, gunakan penduduk di baris depan, dengan sebutan Pasukan Berani Mati. Perintahkan prajurit untuk membuang baju dan jubah di jalan untuk membingungkan pikiran lawan. Kita pasti akan menang!","Haha! Bunuh yang tua dan lemah, tinggalkan orang yang kuat. Saat musuh datang, gunakan penduduk di baris depan, dengan sebutan Pasukan Berani Mati. Perintahkan prajurit untuk membuang baju dan jubah di jalan untuk membingungkan pikiran lawan. Kita pasti akan menang!",},
        [1418] = {20184305,"Li Jue","Guo Si","Kakak Li sangat berani dan pandai, memang hebat!","Kakak Li sangat berani dan pandai, memang hebat!",},
        [1419] = {20184401,"Da Qiao","Xiao Qiao","Kakak, kakak, tolong, berikan kelincimu padaku?","Kakak, kakak, tolong, berikan kelincimu padaku?",},
        [1420] = {20184401,"Xiao Qiao","Da Qiao","Ini adalah hadiah ulang tahunku saat usia dewasa, mana mungkin aku memberikannya padamu? Kamu ini, sejak kecil suka merebut barangku, kali ini aku tidak akan memberikannya padamu.","Ini adalah hadiah ulang tahunku saat usia dewasa, mana mungkin aku memberikannya padamu? Kamu ini, sejak kecil suka merebut barangku, kali ini aku tidak akan memberikannya padamu.",},
        [1421] = {20184401,"Da Qiao","Xiao Qiao","Kakak, kakak, jika kamu tidak memberiku, aku tidak akan menghiraukanmu lagi.","Kakak, kakak, jika kamu tidak memberiku, aku tidak akan menghiraukanmu lagi.",},
        [1422] = {20184401,"Xiao Qiao","Da Qiao","Kalau tidak mau ya sudah, kamu tidak menganggapku, aku masih bisa tenang untuk berhari-hari…","Kalau tidak mau ya sudah, kamu tidak menganggapku, aku masih bisa tenang untuk berhari-hari…",},
        [1423] = {20184401,"Da Qiao","Xiao Qiao","Humph, kalau kakak tidak kasih, aku, aku, aku akan menangis, waaa….","Humph, kalau kakak tidak kasih, aku, aku, aku akan menangis, waaa….",},
        [1424] = {20184401,"Xiao Qiao","Da Qiao","Baiklah, baiklah, kuberikan padamu. Lihat kamu, menangis sambil tertawa, kalau nanti menikah bakal bagaimana jadinya?","Baiklah, baiklah, kuberikan padamu. Lihat kamu, menangis sambil tertawa, kalau nanti menikah bakal bagaimana jadinya?",},
        [1425] = {20184401,"Da Qiao","Xiao Qiao","(tertawa) Terima kasih kakak, di dunia ini kakaklah yang terbaik untukku! Xiao Qiao pasti akan melindungi kakak!","(tertawa) Terima kasih kakak, di dunia ini kakaklah yang terbaik untukku! Xiao Qiao pasti akan melindungi kakak!",},
        [1426] = {20184402,"Zhou Yu","Xiao Qiao","Gong Jin, sejak kakak ipar pergi, kakak selalu sendirian. Kasihan.","Gong Jin, sejak kakak ipar pergi, kakak selalu sendirian. Kasihan.",},
        [1427] = {20184402,"Xiao Qiao","Zhou Yu","Sering-seringlah menemani dia berbicara, melepaskan jenuh. Untungnya, dia masih memiliki adik sebaik kamu ini.","Sering-seringlah menemani dia berbicara, melepaskan jenuh. Untungnya, dia masih memiliki adik sebaik kamu ini.",},
        [1428] = {20184402,"Zhou Yu","Xiao Qiao","Aku ingin kakakku datang kesini selama beberapa hari. Bisakah, Gong Jin?","Aku ingin kakakku datang kesini selama beberapa hari. Bisakah, Gong Jin?",},
        [1429] = {20184402,"Xiao Qiao","Zhou Yu","Semuanya tergantung padamu.","Semuanya tergantung padamu.",},
        [1430] = {20184403,"Xiao Qiao","Zhuge Liang","… Siapkan dua teras, dengan naga giok dan phoenix emas. Undang kedua Qiao ke tenggara dan ini akan menjadi surga.","… Siapkan dua teras, dengan naga giok dan phoenix emas. Undang kedua Qiao ke tenggara dan ini akan menjadi surga.",},
        [1431] = {20184403,"Zhuge Liang","Xiao Qiao","Syair yang dibacakan Tuan Zhuge, apakah itu Paviliun Pipit Tembaga karangan Cao Zhi, anak Cao Cao?","Syair yang dibacakan Tuan Zhuge, apakah itu Paviliun Pipit Tembaga karangan Cao Zhi, anak Cao Cao?",},
        [1432] = {20184403,"Xiao Qiao","Zhuge Liang","Bagus, tidak disangka Nyonya Xiao Qiao juga tahu syair ini.","Bagus, tidak disangka Nyonya Xiao Qiao juga tahu syair ini.",},
        [1433] = {20184403,"Zhuge Liang","Xiao Qiao","Jika Xiao Qiao mengingat dengan benar, tulisan sebenarnya adalah Gabungkan dua jembatan di barat dan timur untum membuatnya terlihat seperti burung terbang. Apakah kamu melakukan ini untuk membuat Zhou geram? ","Jika Xiao Qiao mengingat dengan benar, tulisan sebenarnya adalah Gabungkan dua jembatan di barat dan timur untum membuatnya terlihat seperti burung terbang. Apakah kamu melakukan ini untuk membuat Zhou geram? ",},
        [1434] = {20184403,"Xiao Qiao","Zhuge Liang","Tidak disangka Xiao Qiao sangat cerdik, aku sangat terkagum.","Tidak disangka Xiao Qiao sangat cerdik, aku sangat terkagum.",},
        [1435] = {20184403,"Zhuge Liang","Xiao Qiao","Cao Cao pergi ke selatan, membahayakan Jingzhou dan Jiangdong. Jika kita tidak bersatu, cepat atau lambat akan menjadi mangsa Cao Cao.","Cao Cao pergi ke selatan, membahayakan Jingzhou dan Jiangdong. Jika kita tidak bersatu, cepat atau lambat akan menjadi mangsa Cao Cao.",},
        [1436] = {20184403,"Zhuge Liang","Xiao Qiao","Meskipun Xiao Qiao adalah seorang perempuan, tetapi dia tahu keadaannya dalam bahaya. Waktunya untuk masuk aliansi anti Cao Cao. Tuan Zhuge, aku pasti akan kembali membujuk Zhou untuk memberimu bantuan.","Meskipun Xiao Qiao adalah seorang perempuan, tetapi dia tahu keadaannya dalam bahaya. Waktunya untuk masuk aliansi anti Cao Cao. Tuan Zhuge, aku pasti akan kembali membujuk Zhou untuk memberimu bantuan.",},
        [1437] = {20184404,"Zhou Yu","Xiao Qiao","Gongjin, mengapa mengerutkan wajah? Akhir-akhir ini ada masalah apa?","Gongjin, mengapa mengerutkan wajah? Akhir-akhir ini ada masalah apa?",},
        [1438] = {20184404,"Xiao Qiao","Zhou Yu","Akhir-akhir ini, masalah di militer bertambah banyak.","Akhir-akhir ini, masalah di militer bertambah banyak.",},
        [1439] = {20184404,"Zhou Yu","Xiao Qiao","Gong Jin, sebaiknya istiharat dulu, biarkan Xiao Qiao menari untukmu.","Gong Jin, sebaiknya istiharat dulu, biarkan Xiao Qiao menari untukmu.",},
        [1440] = {20184404,"Xiao Qiao","Zhou Yu","Xiao Qiao saat kamu biasanya menari dengan baju elegan, sangat anggun dan menarik, mengapa hari ini menarikan Syair Angin Ribut?","Xiao Qiao saat kamu biasanya menari dengan baju elegan, sangat anggun dan menarik, mengapa hari ini menarikan Syair Angin Ribut?",},
        [1441] = {20184404,"Zhou Yu","Xiao Qiao","Syair Angin Ribut ini adalah ciptaan Kaisar Han Liu Bang. Pada saat itu selalu dikalahkan oleh Xiang Yu, tetapi dia menyatukan kekuatan untuk melawan Xiang Yu dari banyak tempat, dan pada akhirnya memenagkan pertarungan. Setelah mengalahkan Xiang Yu, menyatukan negara-negara dan membangun Dinasti Han.","Syair Angin Ribut ini adalah ciptaan Kaisar Han Liu Bang. Pada saat itu selalu dikalahkan oleh Xiang Yu, tetapi dia menyatukan kekuatan untuk melawan Xiang Yu dari banyak tempat, dan pada akhirnya memenagkan pertarungan. Setelah mengalahkan Xiang Yu, menyatukan negara-negara dan membangun Dinasti Han.",},
        [1442] = {20184404,"Xiao Qiao","Zhou Yu","Ha, kamu ingin membujukku untuk bersekutu dengan Liu melawan Cao. Tenanglah, segala hal yang kulakukan, bertujuan untuk diperlihatkan kepada orang-orang, aku telah berkata dengan Tuan, rencana yang diatur bersama Kongming untuk melawan Cao Cao.","Ha, kamu ingin membujukku untuk bersekutu dengan Liu melawan Cao. Tenanglah, segala hal yang kulakukan, bertujuan untuk diperlihatkan kepada orang-orang, aku telah berkata dengan Tuan, rencana yang diatur bersama Kongming untuk melawan Cao Cao.",},
        [1443] = {20184404,"Zhou Yu","Xiao Qiao","Kamu sangat cerdas, dan aku hanya terlihat pintar. Maaf, hehe! ","Kamu sangat cerdas, dan aku hanya terlihat pintar. Maaf, hehe! ",},
        [1444] = {20184501,"Wang Lang","Sun Ce","Aku membawa prajurit kemari, bertujuan untuk mendamaikan Zhejiang, mengapa kamu mau membantu Cao Cao pengkhianat itu?","Aku membawa prajurit kemari, bertujuan untuk mendamaikan Zhejiang, mengapa kamu mau membantu Cao Cao pengkhianat itu?",},
        [1445] = {20184501,"Sun Ce","Wang Lang","Kamu memang serakah! Kamu telah mendapat Komandan Wu, sekarang ingin menyerang wilayahku! Hari ini, aku akan membalaskan dendam Nyonya Yan","Kamu memang serakah! Kamu telah mendapat Komandan Wu, sekarang ingin menyerang wilayahku! Hari ini, aku akan membalaskan dendam Nyonya Yan",},
        [1446] = {20184501,"Wang Lang","Sun Ce","Jingxing tua bangka, hentikan omong kosongmu!","Jingxing tua bangka, hentikan omong kosongmu!",},
        [1447] = {20184501,"Wang Lang","Sun Ce","Taishi Ci keluar, bunuh dia untukku!","Taishi Ci keluar, bunuh dia untukku!",},
        [1448] = {20184502,"Wang Lang","Cao Cao","Tidak bisa belajar dari contohmu dulu yang kehilangan jabatan tinggi di Kuaiji.","Tidak bisa belajar dari contohmu dulu yang kehilangan jabatan tinggi di Kuaiji.",},
        [1449] = {20184502,"Cao Cao","Wang Lang","Untuk bertindak dengan tepat sesuai perkataan, benar-benar hal yang sulit.","Untuk bertindak dengan tepat sesuai perkataan, benar-benar hal yang sulit.",},
        [1450] = {20184502,"Wang Lang","Cao Cao","Mengapa kamu bicara seperti itu?","Mengapa kamu bicara seperti itu?",},
        [1451] = {20184502,"Cao Cao","Wang Lang","Seperti aku, pada saat itu adalah pejabat Han, tidak bisa melindungi rakyat, jadi aku membuat kompromi.","Seperti aku, pada saat itu adalah pejabat Han, tidak bisa melindungi rakyat, jadi aku membuat kompromi.",},
        [1452] = {20184502,"Cao Cao","Wang Lang","Tapi kamu hari ini di acara ini, sebenarnya untuk menujukkan hormat kepada tamu, merendahkan diri untuk mendapatkan toleransi talenta, tidak disangka kamu melakukan hal seperti ini pada tamu.","Tapi kamu hari ini di acara ini, sebenarnya untuk menujukkan hormat kepada tamu, merendahkan diri untuk mendapatkan toleransi talenta, tidak disangka kamu melakukan hal seperti ini pada tamu.",},
        [1453] = {20184502,"Cao Cao","Wang Lang","Ini adalah membuat kompromi palsu.","Ini adalah membuat kompromi palsu.",},
        [1454] = {20184502,"Wang Lang","Cao Cao","Hahahaha, kamu memang pandai bicara.","Hahahaha, kamu memang pandai bicara.",},
        [1455] = {20184502,"Wang Lang","Cao Cao","Sejak aku merekomendasikanmu sebagai Sekretaris Penasihat, Penasihat Militer, kamu tidak mengecewakanku.","Sejak aku merekomendasikanmu sebagai Sekretaris Penasihat, Penasihat Militer, kamu tidak mengecewakanku.",},
        [1456] = {20184503,"","Wang Lang","Yuan Shao, Sun Ce, Liu Bei, kamu adalah penjahat yang memisahkan dunia.","Yuan Shao, Sun Ce, Liu Bei, kamu adalah penjahat yang memisahkan dunia.",},
        [1457] = {20184503,"","Wang Lang","Aku telah bekerja sebagai Sekretaris Sensor, Sikong dan Situ menulis Buku Perubahan, Negara Damai, Kitab Berbakti dan lainnya dengan total 34 jilid.","Aku telah bekerja sebagai Sekretaris Sensor, Sikong dan Situ menulis Buku Perubahan, Negara Damai, Kitab Berbakti dan lainnya dengan total 34 jilid.",},
        [1458] = {20184503,"","Wang Lang","Cucuku Wang Yuanji menikah dengan Sima Zhao, putra kedua Sima Yi, melahirkan Sima Yan, Kaisar Wu dari Jin Barat.","Cucuku Wang Yuanji menikah dengan Sima Zhao, putra kedua Sima Yi, melahirkan Sima Yan, Kaisar Wu dari Jin Barat.",},
        [1459] = {20184503,"","Wang Lang","Aku bukanlah orang tua yang tidak tahu malu, juga tidak menyia-nyiakan hidupku yang panjang.","Aku bukanlah orang tua yang tidak tahu malu, juga tidak menyia-nyiakan hidupku yang panjang.",},
        [1460] = {20184601,"Zhang Rang","Cao Cao","Kasim Zhang Rang, aku akan membersihkan ancaman di dunia. Matilah!","Kasim Zhang Rang, aku akan membersihkan ancaman di dunia. Matilah!",},
        [1461] = {20184601,"Cao Cao","Zhang Rang","Seseorang, tolong! Cao Cao telah menyerang masuk dari aula!","Seseorang, tolong! Cao Cao telah menyerang masuk dari aula!",},
        [1462] = {20184601,"Zhang Rang","Cao Cao","Lari kemana!","Lari kemana!",},
        [1463] = {20184602,"Cao Cao","Zhang Rang","Masuk dan kepung! Serang dia!","Masuk dan kepung! Serang dia!",},
        [1464] = {20184602,"Cao Cao","Zhang Rang","Cao Cao ingin menembus tembok, jangan biarkan dia lari.","Cao Cao ingin menembus tembok, jangan biarkan dia lari.",},
        [1465] = {20184602,"Zhang Rang","Cao Cao","Kali ini kamu beruntung, cepat atau lambat aku akan membunuhmu!","Kali ini kamu beruntung, cepat atau lambat aku akan membunuhmu!",},
        [1466] = {20184602,"Cao Cao","Zhang Rang","Kejar dia!","Kejar dia!",},
        [1467] = {20184603,"Ibu Suri He","Zhang Rang","Orang yang awalnya berencana untuk menjebak Jenderal Besar, sebenarnya hanyalah Saisuho seorang, kita tidak ikut serta.","Orang yang awalnya berencana untuk menjebak Jenderal Besar, sebenarnya hanyalah Saisuho seorang, kita tidak ikut serta.",},
        [1468] = {20184603,"Ibu Suri He","Zhang Rang","Jenderal Besar mendengar perkataan Yuan Shao dan ingin membunuh kami semua. Lepaskan kami!","Jenderal Besar mendengar perkataan Yuan Shao dan ingin membunuh kami semua. Lepaskan kami!",},
        [1469] = {20184603,"Zhang Rang","Ibu Suri He","Jangan khawatir, aku akan melindungi kalian.","Jangan khawatir, aku akan melindungi kalian.",},
        [1470] = {20184604,"He Jin","Ibu Suri He","Aku dan kamu bermula dari awal yang biasa, jika bukan karena Zhang Rang, bagaimana aku bisa menikmati kekayaan ini?","Aku dan kamu bermula dari awal yang biasa, jika bukan karena Zhang Rang, bagaimana aku bisa menikmati kekayaan ini?",},
        [1471] = {20184604,"He Jin","Ibu Suri He","Sekarang, Jian Shuo tidak bajik, telah dihukum oleh negara. Mengapa kamu bisa mendengarkan fitnah orang lain dan berusaha untuk membunuh semua kasim? ","Sekarang, Jian Shuo tidak bajik, telah dihukum oleh negara. Mengapa kamu bisa mendengarkan fitnah orang lain dan berusaha untuk membunuh semua kasim? ",},
        [1472] = {20184604,"Ibu Suri He","He Jin","Jian Shuo menjebakku, aku bisa membunuh semua keluarganya. Orang yang lain, akan kulepaskan.","Jian Shuo menjebakku, aku bisa membunuh semua keluarganya. Orang yang lain, akan kulepaskan.",},
        [1473] = {20184604,"He Jin","Yuan Shao","Jika tidak membasmi hingga akarnya, mereka pasti akan menjadi berbahaya.","Jika tidak membasmi hingga akarnya, mereka pasti akan menjadi berbahaya.",},
        [1474] = {20184604,"Yuan Shao","He Jin","Aku telah memutuskan, kamu tidak perlu berkata lagi.","Aku telah memutuskan, kamu tidak perlu berkata lagi.",},
        [1475] = {20184605,"Zhang Rang","Ibu Suri Dong","Adik perempuan He Jin, pada awalnya aku menganggapnya sebagai teman. Sekarang anaknya adalah kaisar. Dia memiliki koneksi baik di dalam maupun di luar. Dengan kekuatannya, apa yang harus kulakukan?","Adik perempuan He Jin, pada awalnya aku menganggapnya sebagai teman. Sekarang anaknya adalah kaisar. Dia memiliki koneksi baik di dalam maupun di luar. Dengan kekuatannya, apa yang harus kulakukan?",},
        [1476] = {20184605,"Ibu Suri Dong","Zhang Rang","Yang Mulia bisa turun ke istana dan menangani masalah di balik layar; Mahkotakan sang pangeran menjadi raja, dan angkat Paman Pertama Dong Zhong dan gunakan kami kembali untuk mencapai tujuan besar.","Yang Mulia bisa turun ke istana dan menangani masalah di balik layar; Mahkotakan sang pangeran menjadi raja, dan angkat Paman Pertama Dong Zhong dan gunakan kami kembali untuk mencapai tujuan besar.",},
        [1477] = {20184605,"Zhang Rang","Ibu Suri Dong","Baik, aku akan menentukan bahwa pangeranku adalah Pangeran Chenliu, Dong Zhuo akan menjadi Jenderal Piaoqi, kamu Zhang Rang dan lainnya akan ikut serta dalam urusan politik.","Baik, aku akan menentukan bahwa pangeranku adalah Pangeran Chenliu, Dong Zhuo akan menjadi Jenderal Piaoqi, kamu Zhang Rang dan lainnya akan ikut serta dalam urusan politik.",},
        [1478] = {20184701,"Nyonya Zou","Cao Cao","Siapa kamu, berwajah secantik ini?","Siapa kamu, berwajah secantik ini?",},
        [1479] = {20184701,"Cao Cao","Nyonya Zou","Aku adalah Nyonya Zou, istri Zhang Ji.","Aku adalah Nyonya Zou, istri Zhang Ji.",},
        [1480] = {20184701,"Nyonya Zou","Cao Cao","Apakah kamu mengenaliku?","Apakah kamu mengenaliku?",},
        [1481] = {20184701,"Cao Cao","Nyonya Zou","Aku telah lama mendengar nama Perdana Menteri, merupakan kehormatan bagiku dapat bertemu hari ini.","Aku telah lama mendengar nama Perdana Menteri, merupakan kehormatan bagiku dapat bertemu hari ini.",},
        [1482] = {20184701,"Nyonya Zou","Cao Cao","Untuk kebaikanmu, aku menerima penyerahan Zhang Xiu. Jika tidak keluarganya akan dimusnahkan.","Untuk kebaikanmu, aku menerima penyerahan Zhang Xiu. Jika tidak keluarganya akan dimusnahkan.",},
        [1483] = {20184701,"Cao Cao","Nyonya Zou","Benar-benar sangat berterima kasih padamu.","Benar-benar sangat berterima kasih padamu.",},
        [1484] = {20184701,"Nyonya Zou","Cao Cao","Bertemu denganmu, sungguh membuatku senang. Aku ingin melalui malam ini bersamamu kembali ke ibu kota. Aku berjanji akan memberikanmu uang dan kekuasaan, bagaimana?","Bertemu denganmu, sungguh membuatku senang. Aku ingin melalui malam ini bersamamu kembali ke ibu kota. Aku berjanji akan memberikanmu uang dan kekuasaan, bagaimana?",},
        [1485] = {20184701,"Cao Cao","Nyonya Zou","Terima kasih atas kebaikan Perdana Menteri.","Terima kasih atas kebaikan Perdana Menteri.",},
        [1486] = {20184702,"Cao Cao","Nyonya Zou","Terlalu lama tinggal di dalam kota, akan membuat Zhang Xiu curiga dan membuat orang lain bergosip.","Terlalu lama tinggal di dalam kota, akan membuat Zhang Xiu curiga dan membuat orang lain bergosip.",},
        [1487] = {20184702,"Nyonya Zou","Cao Cao","Besok kita akan berpindah keluar kota dan tinggal bersama.","Besok kita akan berpindah keluar kota dan tinggal bersama.",},
        [1488] = {20184702,"Nyonya Zou","Cao Cao","Dian Wei, pergilah untuk berjaga-jaga di luar tenda.","Dian Wei, pergilah untuk berjaga-jaga di luar tenda.",},
        [1489] = {20184702,"Nyonya Zou","Cao Cao","Orang yang tidak dipanggil, tidak diizinkan masuk.","Orang yang tidak dipanggil, tidak diizinkan masuk.",},
        [1490] = {20184702,"Cao Cao","Dian Wei","Ya, Perdana Menteri.","Ya, Perdana Menteri.",},
        [1491] = {20184801,"Yue Jin","Li Dian","Orang berhelm emas itu adalah Sun Quan, di kiri adalah Song Qian, di kanan adalah Jia Hua, keduanya memakai Halberd Surga.","Orang berhelm emas itu adalah Sun Quan, di kiri adalah Song Qian, di kanan adalah Jia Hua, keduanya memakai Halberd Surga.",},
        [1492] = {20184801,"Yue Jin","Li Dian","Jika kamu menangkap Sun Quan, itu cukup untuk membalaskan dendam delapan ratus tiga puluh ribu pasukan.","Jika kamu menangkap Sun Quan, itu cukup untuk membalaskan dendam delapan ratus tiga puluh ribu pasukan.",},
        [1493] = {20184801,"Li Dian","Yue Jin","Akan kulihat kemampuan Sun Quan!","Akan kulihat kemampuan Sun Quan!",},
        [1494] = {20184802,"Taishi Ci","Sun Quan","Ketika kamu bertarung dengan Zhang Liao, seorang jenderal Cao Cao ingin memenggal kepalaku dari samping.","Ketika kamu bertarung dengan Zhang Liao, seorang jenderal Cao Cao ingin memenggal kepalaku dari samping.",},
        [1495] = {20184802,"Taishi Ci","Sun Quan","Masih beruntung ada Song Qian dan Jia Xu dengan cepat menggunakan halberd dan menahan serangan, kalau tidak aku pasti sudah mati.","Masih beruntung ada Song Qian dan Jia Xu dengan cepat menggunakan halberd dan menahan serangan, kalau tidak aku pasti sudah mati.",},
        [1496] = {20184802,"Taishi Ci","Sun Quan","Berkuda perang dan berpedang, seperti kilat, mematahkan tombak ganda Jia Hua dan Song Qian dengan sekali kibas!","Berkuda perang dan berpedang, seperti kilat, mematahkan tombak ganda Jia Hua dan Song Qian dengan sekali kibas!",},
        [1497] = {20184802,"Taishi Ci","Sun Quan","Tidak tahu siapa yang ingin membunuhku?","Tidak tahu siapa yang ingin membunuhku?",},
        [1498] = {20184802,"Sun Quan","Taishi Ci","Mungkin itu Yue Jin, salah satu 5 Jenderal Hebat Cao Wei!","Mungkin itu Yue Jin, salah satu 5 Jenderal Hebat Cao Wei!",},
        [1499] = {20184803,"","Cao Cao","Tahun pertama Xiangpin, Wen Qian melawan Lu Bu di Puyang, Zhang Chao di Yong Qiu, Qiao Rui di Prefektur Ku.","Tahun pertama Xiangpin, Wen Qian melawan Lu Bu di Puyang, Zhang Chao di Yong Qiu, Qiao Rui di Prefektur Ku.",},
        [1500] = {20184803,"","Cao Cao","Tahun ketiga Jian'an, direkrut oleh Zhang Xiu di Anzhong, dia mengepung Lu Bu di Xiapi, melumpuhkan barisan depan lawan dan menyerang Sui Gu di Shequan dan menyerang Liu Bei di Peixian.","Tahun ketiga Jian'an, direkrut oleh Zhang Xiu di Anzhong, dia mengepung Lu Bu di Xiapi, melumpuhkan barisan depan lawan dan menyerang Sui Gu di Shequan dan menyerang Liu Bei di Peixian.",},
        [1501] = {20184803,"","Cao Cao","Tahun kelima Jian'an, dia menyeberangi sungai dengan Yu Jin dan menyerang Yuan Shao di Guandu, membunuh jenderal Yan Shao, Chunyu Qiong!","Tahun kelima Jian'an, dia menyeberangi sungai dengan Yu Jin dan menyerang Yuan Shao di Guandu, membunuh jenderal Yan Shao, Chunyu Qiong!",},
        [1502] = {20184803,"","Cao Cao","Jian'an tahun ke-sembilan, dia menyerang anak Yuan Shao, Yuan Tan dan Yuan Shang di Liyang dan membunuh Jenderal Yan Jing!","Jian'an tahun ke-sembilan, dia menyerang anak Yuan Shao, Yuan Tan dan Yuan Shang di Liyang dan membunuh Jenderal Yan Jing!",},
        [1503] = {20184803,"","Cao Cao","Wen Qian telah bersamaku dalam pertempuran di segala tempat, selama dua puluh pertempuran besar maupun kecil. Tak ada satupun pertempuran yang gagal. Dia benar-benar seorang jenderal yang gagah berani!","Wen Qian telah bersamaku dalam pertempuran di segala tempat, selama dua puluh pertempuran besar maupun kecil. Tak ada satupun pertempuran yang gagal. Dia benar-benar seorang jenderal yang gagah berani!",},
        [1504] = {20184901,"Li Ru","Dong Zhuo","Mengapa kamu kemari?","Mengapa kamu kemari?",},
        [1505] = {20184901,"Dong Zhuo","Li Ru","Tidak lama setelah aku tiba di sini, aku mengetahui bahwa Perdana Menteri memasuki taman belakang dengan marah untuk mencari Lu Bu. Aku melihat Lu Bu pergi, mengatakan Perdana Menteri ingin dia mati!","Tidak lama setelah aku tiba di sini, aku mengetahui bahwa Perdana Menteri memasuki taman belakang dengan marah untuk mencari Lu Bu. Aku melihat Lu Bu pergi, mengatakan Perdana Menteri ingin dia mati!",},
        [1506] = {20184901,"Dong Zhuo","Li Ru","Aku cepat-cepat kemari ingin membujuknya berdamai.","Aku cepat-cepat kemari ingin membujuknya berdamai.",},
        [1507] = {20184901,"Li Ru","Dong Zhuo","Lu Bu penjahat! Tidak disangka menggoda wanitaku, aku harus membunuhnya!","Lu Bu penjahat! Tidak disangka menggoda wanitaku, aku harus membunuhnya!",},
        [1508] = {20184901,"Dong Zhuo","Li Ru","Tolong pikirkan lagi. Raja Zhuang dari Chu tidak mencari-cari kesalahan dengan Jiang Xiong yang menggoda wanita kesayangannya. Kemudian ketika dia dikepung oleh tentara Qin, Jiang mempertaruhkan nyawanya untuk menyelamatkannya.","Tolong pikirkan lagi. Raja Zhuang dari Chu tidak mencari-cari kesalahan dengan Jiang Xiong yang menggoda wanita kesayangannya. Kemudian ketika dia dikepung oleh tentara Qin, Jiang mempertaruhkan nyawanya untuk menyelamatkannya.",},
        [1509] = {20184901,"Dong Zhuo","Li Ru","Diao Chan hanyalah perempuan biasa, sedangakan Lu Bu adalah jenderal hebatmu. Jika kamu mengambil kesempatan ini dan memberikan Diao Chan pada Lu Bu, dia pasti akan berterima kasih, dan bersedia bertarung untukmu.","Diao Chan hanyalah perempuan biasa, sedangakan Lu Bu adalah jenderal hebatmu. Jika kamu mengambil kesempatan ini dan memberikan Diao Chan pada Lu Bu, dia pasti akan berterima kasih, dan bersedia bertarung untukmu.",},
        [1510] = {20184901,"Dong Zhuo","Li Ru","Perdana Menteri, harap pertimbangkan baik-baik.","Perdana Menteri, harap pertimbangkan baik-baik.",},
        [1511] = {20184901,"Li Ru","Dong Zhuo","Perkataanmu masuk akal, akan kupikirkan dulu.","Perkataanmu masuk akal, akan kupikirkan dulu.",},
        [1512] = {20184902,"","Lu Bu","Yang membantu Dong Zhuo adalah Li Ru! Siapa yang bisa menangkapnya?","Yang membantu Dong Zhuo adalah Li Ru! Siapa yang bisa menangkapnya?",},
        [1513] = {20184902,"Lu Bu","Li Su","Kirimkan aku!","Kirimkan aku!",},
        [1514] = {20184902,"Lu Bu","Wang Yun","Pelayan Li Ru telah mengikat Li Ru dan memberikannya padaku.","Pelayan Li Ru telah mengikat Li Ru dan memberikannya padaku.",},
        [1515] = {20184902,"Wang Yun","Lu Bu","Bawa dia ke jalanan dan penggal kepalanya!","Bawa dia ke jalanan dan penggal kepalanya!",},
        [1516] = {20185001,"Lu Lingju","Lu Bu","Siapa yang berani mengganggu wanitaku! Aku akan mencabiknya hingga berkeping-keping!","Siapa yang berani mengganggu wanitaku! Aku akan mencabiknya hingga berkeping-keping!",},
        [1517] = {20185001,"Lu Bu","Lu Lingju","Humph, dengan dukungan ayahku, lihat siapa dari kalian yang berani menggangguku!","Humph, dengan dukungan ayahku, lihat siapa dari kalian yang berani menggangguku!",},
        [1518] = {20185001,"Lu Bu","Lu Lingju","Siapa yang tidak terima? Tunjukkan dirimu!","Siapa yang tidak terima? Tunjukkan dirimu!",},
        [1519] = {20185002,"Lu Bu","Lu Lingju","Ayah, aku tidak ingin menikah!","Ayah, aku tidak ingin menikah!",},
        [1520] = {20185002,"Lu Bu","Lu Lingju","Aku ingin bertarung dan menjadi pahlawan hebat sepertimu!","Aku ingin bertarung dan menjadi pahlawan hebat sepertimu!",},
        [1521] = {20185002,"Lu Lingju","Lu Bu","Seorang perempuan harus menikah dengan lelaki dan mengajari anaknya dengan baik.","Seorang perempuan harus menikah dengan lelaki dan mengajari anaknya dengan baik.",},
        [1522] = {20185002,"Lu Lingju","Lu Bu","Salahkan aku karena saat itu tidak memperhatikanmu dengan baik, membuatmu menyukai senjata, aih.","Salahkan aku karena saat itu tidak memperhatikanmu dengan baik, membuatmu menyukai senjata, aih.",},
        [1523] = {20185101,"Cao Cao","Cheng Yu","Aku sering bermimpi aneh, dalam mimpi aku berada di puncak Gunung Tai sambil memegang matahari. Lalu muncullah pemberontakan Turban Kuning.","Aku sering bermimpi aneh, dalam mimpi aku berada di puncak Gunung Tai sambil memegang matahari. Lalu muncullah pemberontakan Turban Kuning.",},
        [1524] = {20185101,"Cao Cao","Cheng Yu","Aku menyadari bahwa mimpi ini mungkin adalah peringatan dari langit agar aku mendukung pemimpin yang bijaksana.","Aku menyadari bahwa mimpi ini mungkin adalah peringatan dari langit agar aku mendukung pemimpin yang bijaksana.",},
        [1525] = {20185101,"Cheng Yu","Cao Cao","Ahahaha.","Ahahaha.",},
        [1526] = {20185101,"Cheng Yu","Cao Cao","Kamu sering bermimpi memegang matahari di Gunung Tai, mengapa tidak menambahkan kata matahari pada namanya.","Kamu sering bermimpi memegang matahari di Gunung Tai, mengapa tidak menambahkan kata matahari pada namanya.",},
        [1527] = {20185101,"Cheng Yu","Cao Cao","Bagaimana kalau diubah menjadi Cheng Yu?","Bagaimana kalau diubah menjadi Cheng Yu?",},
        [1528] = {20185101,"Cao Cao","Cheng Yu","Perkatan Perdana Menteri benar.","Perkatan Perdana Menteri benar.",},
        [1529] = {20185102,"Xun Yu","Cheng Yu","Wenruo, apakah kamu tahu aku sering bermimpi memegang matahari di Gunung Tai?","Wenruo, apakah kamu tahu aku sering bermimpi memegang matahari di Gunung Tai?",},
        [1530] = {20185102,"Cheng Yu","Xun Yu","Sering sekali mendengarmu mengatakan mimpi ini.","Sering sekali mendengarmu mengatakan mimpi ini.",},
        [1531] = {20185102,"Xun Yu","Cheng Yu","Anehnya, setelah Perdana Menteri menyuruhku mengganti nama, mimpi itu tidak datang lagi.","Anehnya, setelah Perdana Menteri menyuruhku mengganti nama, mimpi itu tidak datang lagi.",},
        [1532] = {20185102,"Cheng Yu","Xun Yu","Hahahaha, itu berarti nama baru ini bagus.","Hahahaha, itu berarti nama baru ini bagus.",},
        [1533] = {20185103,"Cheng Yu","Cao Cao","Yuan Shao memiliki banyak orang dan tentara yang lebih kuat.","Yuan Shao memiliki banyak orang dan tentara yang lebih kuat.",},
        [1534] = {20185103,"Cheng Yu","Cao Cao","Siapa yang memiliki rencana untuk mengalahkannya?","Siapa yang memiliki rencana untuk mengalahkannya?",},
        [1535] = {20185103,"Cao Cao","Cheng Yu","Aku memiliki rencana, bernama Penyergapan Semua Sisi, ini dapat mengalahkan Yuan Shao.","Aku memiliki rencana, bernama Penyergapan Semua Sisi, ini dapat mengalahkan Yuan Shao.",},
        [1536] = {20185103,"Cheng Yu","Cao Cao","Apa yang dimaksud dengan Penyergapan Semua Sisi?","Apa yang dimaksud dengan Penyergapan Semua Sisi?",},
        [1537] = {20185103,"Cao Cao","Cheng Yu","Mundurkan pasukan ke sungai, sergap dengan 10 regu.","Mundurkan pasukan ke sungai, sergap dengan 10 regu.",},
        [1538] = {20185103,"Cao Cao","Cheng Yu","Hari kedua, pasukan garis depan berpura-pura untuk menyerang dan menarik Yuan Shao kesini.","Hari kedua, pasukan garis depan berpura-pura untuk menyerang dan menarik Yuan Shao kesini.",},
        [1539] = {20185103,"Cao Cao","Cheng Yu","Lawan kembali dan bekerja sama dengan pasukan yang menyergap. Yuan Shao pasti dapat dikalahkan.","Lawan kembali dan bekerja sama dengan pasukan yang menyergap. Yuan Shao pasti dapat dikalahkan.",},
        [1540] = {20185103,"Cheng Yu","Cao Cao","Rencana bagus!","Rencana bagus!",},
        [1541] = {20185201,"Huang Zu","Su Fei","Gan Xingba berkemampuan perang di air. Kalahkan Sun Quan dan rebut Xiakou.","Gan Xingba berkemampuan perang di air. Kalahkan Sun Quan dan rebut Xiakou.",},
        [1542] = {20185201,"Huang Zu","Su Fei","Dia harus diperlakukan dengan baik!","Dia harus diperlakukan dengan baik!",},
        [1543] = {20185201,"Su Fei","Huang Zu","Gan Ning adalah bandit di air, bagaimana bisa dibandingkan dengan kami yang merupakan keluarga bangsawan. ","Gan Ning adalah bandit di air, bagaimana bisa dibandingkan dengan kami yang merupakan keluarga bangsawan. ",},
        [1544] = {20185201,"Su Fei","Huang Zu","Tidak bisa menempatkannya pada posisi penting!","Tidak bisa menempatkannya pada posisi penting!",},
        [1545] = {20185201,"Huang Zu","Su Fei","Ini akan menimbulkan dendam!","Ini akan menimbulkan dendam!",},
        [1546] = {20185202,"Lu Meng","Ling Tong","Gan Xingba mengapa mencari perlindungan Dongwu?","Gan Xingba mengapa mencari perlindungan Dongwu?",},
        [1547] = {20185202,"Lu Meng","Ling Tong","Pada pertempuran Xiakou, dia menembak mati ayahku!","Pada pertempuran Xiakou, dia menembak mati ayahku!",},
        [1548] = {20185202,"Lu Meng","Ling Tong","Aku juga tidak setuju bergabung dengannya!","Aku juga tidak setuju bergabung dengannya!",},
        [1549] = {20185202,"Ling Tong","Lu Meng","Dia hebat bertarung di air, Tuan memandang tinggi dirinya.","Dia hebat bertarung di air, Tuan memandang tinggi dirinya.",},
        [1550] = {20185202,"Ling Tong","Lu Meng","Di waktu yang kacau ini, kamu seharusnya mendahulukan nasib dunia lebih dulu daripada dendam di masa lalu!","Di waktu yang kacau ini, kamu seharusnya mendahulukan nasib dunia lebih dulu daripada dendam di masa lalu!",},
        [1551] = {20185203,"Gan Ning","Lu Meng","Kamu menembak Ling Cao adalah fakta. Dan pastinya Ling Tong memiliki dendam padamu.","Kamu menembak Ling Cao adalah fakta. Dan pastinya Ling Tong memiliki dendam padamu.",},
        [1552] = {20185203,"Gan Ning","Lu Meng","Tuan sangat tahu konflik antara kalian berdua, jadi dia mengirimkanku sebagai penengah.","Tuan sangat tahu konflik antara kalian berdua, jadi dia mengirimkanku sebagai penengah.",},
        [1553] = {20185203,"Gan Ning","Lu Meng","Aku bertukar pendapat dengannya. Dia bersedia untuk melupakan yang telah berlalu dan memprioritaskan urusan negara.","Aku bertukar pendapat dengannya. Dia bersedia untuk melupakan yang telah berlalu dan memprioritaskan urusan negara.",},
        [1554] = {20185203,"Gan Ning","Lu Meng","Mohon maafkan jika sebelumnya pernah menyinggung.","Mohon maafkan jika sebelumnya pernah menyinggung.",},
        [1555] = {20185203,"Lu Meng","Gan Ning","Aku adalah orang yang terus terang! Kita akan bekerja sama untuk Tuan.","Aku adalah orang yang terus terang! Kita akan bekerja sama untuk Tuan.",},
        [1556] = {20185301,"Xu Huang","Yang Feng","Dimanakah Gongming?","Dimanakah Gongming?",},
        [1557] = {20185301,"Xu Huang","Yang Feng","Cepat lindungi Yang Mulia!","Cepat lindungi Yang Mulia!",},
        [1558] = {20185301,"Yang Feng","Xu Huang","Gongming disini, segera antarkan Yang Mulia ke Luoyang.","Gongming disini, segera antarkan Yang Mulia ke Luoyang.",},
        [1559] = {20185301,"Yang Feng","Xu Huang","Biarkan aku melawan Cui Yong, jenderal Guo Si!","Biarkan aku melawan Cui Yong, jenderal Guo Si!",},
        [1560] = {20185302,"Yang Feng","Kaisar Xian Han","Kamu telah menyelamatkanku, jasamu sangat besar!","Kamu telah menyelamatkanku, jasamu sangat besar!",},
        [1561] = {20185302,"Kaisar Xian Han","Yang Feng","Ini adalah kewajibanku.","Ini adalah kewajibanku.",},
        [1562] = {20185302,"Yang Feng","Kaisar Xian Han","Siapa yang tadi membunuh jenderal lawan?","Siapa yang tadi membunuh jenderal lawan?",},
        [1563] = {20185302,"Kaisar Xian Han","Yang Feng","Orang ini adalah dari Yangjun, Hedong, marga Xu, nama Huang, nama kehormatan Gongming.","Orang ini adalah dari Yangjun, Hedong, marga Xu, nama Huang, nama kehormatan Gongming.",},
        [1564] = {20185302,"Yang Feng","Kaisar Xian Han","Xu Huang akan kuangkat menjadi bangsawan karena berhasil melindungiku.","Xu Huang akan kuangkat menjadi bangsawan karena berhasil melindungiku.",},
        [1565] = {20185303,"Guan Yu","Xu Huang","Kakak Yunchang, atas perintah Perdana Menteri, aku datang untuk melepaskan sergapan di Fancheng dan Xiangyang.","Kakak Yunchang, atas perintah Perdana Menteri, aku datang untuk melepaskan sergapan di Fancheng dan Xiangyang.",},
        [1566] = {20185303,"Xu Huang","Guan Yu","Kamu dan aku berasal dari tempat yang sama. Sayangnya kita harus bekerja pada Tuan yang berbeda. Tidak dapat dihindari, kita akan bertemu di medan perang.","Kamu dan aku berasal dari tempat yang sama. Sayangnya kita harus bekerja pada Tuan yang berbeda. Tidak dapat dihindari, kita akan bertemu di medan perang.",},
        [1567] = {20185303,"Guan Yu","Xu Huang","Jangan diambil hati, ini adalah urusan negara.","Jangan diambil hati, ini adalah urusan negara.",},
        [1568] = {20185303,"Guan Yu","Xu Huang","Dengarkan perintahku, jenderal-jenderal, siapa yang bisa mendapatkan kepala Guan Yunchang, akan mendapat emas berlimpah!","Dengarkan perintahku, jenderal-jenderal, siapa yang bisa mendapatkan kepala Guan Yunchang, akan mendapat emas berlimpah!",},
        [1569] = {20185304,"Cao Cao","Xu Huang","Aku sangat tersanjung, Perdana Menteri berjalan sejauh tujuh mil untuk menemuiku.","Aku sangat tersanjung, Perdana Menteri berjalan sejauh tujuh mil untuk menemuiku.",},
        [1570] = {20185304,"Xu Huang","Cao Cao","Ada 10 barisan prajurit mengepung Lujiao. Jenderal telah memenangkan semua pertempuran, membuat mereka dalam kesulitan dan memenggal kaptennya.","Ada 10 barisan prajurit mengepung Lujiao. Jenderal telah memenangkan semua pertempuran, membuat mereka dalam kesulitan dan memenggal kaptennya.",},
        [1571] = {20185304,"Xu Huang","Cao Cao","Aku telah berperang selama lebih dari tiga puluh tahun dan aku telah membaca tentang seseorang yang menggunakan strategi dengan baik, tetapi tidak ada seorangpun yang bisa melawan kepungan lawan yang tampaknya tidak bisa diusir.","Aku telah berperang selama lebih dari tiga puluh tahun dan aku telah membaca tentang seseorang yang menggunakan strategi dengan baik, tetapi tidak ada seorangpun yang bisa melawan kepungan lawan yang tampaknya tidak bisa diusir.",},
        [1572] = {20185304,"Xu Huang","Cao Cao","Dan kepungan Fancheng dan Xiangyang lebih hebat daripada kepungan Kota Ju dan Jimo sebelumnya. Jadi usaha jenderal, lebih baik daripada Sun Su dan Rang Ju.","Dan kepungan Fancheng dan Xiangyang lebih hebat daripada kepungan Kota Ju dan Jimo sebelumnya. Jadi usaha jenderal, lebih baik daripada Sun Su dan Rang Ju.",},
        [1573] = {20185304,"Cao Cao","Xu Huang","Terima kasih atas apresiasi Perdana Menteri, aku pasti akan berusaha untuk mencapai ekspetasimu.","Terima kasih atas apresiasi Perdana Menteri, aku pasti akan berusaha untuk mencapai ekspetasimu.",},
        [1574] = {20185401,"Ma Yunlu","Ma Chao","Tidak ada yang pernah berani mengganggu adik perempuanku, yang ada hanya dia yang mengganggu orang lain!","Tidak ada yang pernah berani mengganggu adik perempuanku, yang ada hanya dia yang mengganggu orang lain!",},
        [1575] = {20185401,"Ma Chao","Ma Yunlu","Kakak, jangan berkata begini, jika tidak aku tidak akan bisa menikah!","Kakak, jangan berkata begini, jika tidak aku tidak akan bisa menikah!",},
        [1576] = {20185401,"Ma Yunlu","Ma Chao","Karakter adik sangat baik, memiliki bentuk bagus, berwajah cantik dan ahli dalam bertombak.","Karakter adik sangat baik, memiliki bentuk bagus, berwajah cantik dan ahli dalam bertombak.",},
        [1577] = {20185401,"Ma Yunlu","Ma Chao","Orang biasa tentunya tidak bisa menikahimu!","Orang biasa tentunya tidak bisa menikahimu!",},
        [1578] = {20185402,"Zhao Yun","Zhang Fei","Adik perempuan Ma Chao datang mengunjungi kakaknya, dalam perjalanan menyelamatkan calon istri Zhang Bao.","Adik perempuan Ma Chao datang mengunjungi kakaknya, dalam perjalanan menyelamatkan calon istri Zhang Bao.",},
        [1579] = {20185402,"Zhao Yun","Zhang Fei","Adik perempuan Ma Chao bertubuh indah, berwajah cantik dan belum menikah.","Adik perempuan Ma Chao bertubuh indah, berwajah cantik dan belum menikah.",},
        [1580] = {20185402,"Zhao Yun","Zhang Fei","Kebetulan adik keempat juga belum menikah, lebih baik memperkenalkan perempuan ini padamu, bagaimana?","Kebetulan adik keempat juga belum menikah, lebih baik memperkenalkan perempuan ini padamu, bagaimana?",},
        [1581] = {20185402,"Zhang Fei","Zhao Yun","Tidak bisa! Tidak bisa!","Tidak bisa! Tidak bisa!",},
        [1582] = {20185402,"Zhao Yun","Zhang Fei","Mengapa? Bagaimana bisa Zhao Zilong yang pantang menyerah begini malu?","Mengapa? Bagaimana bisa Zhao Zilong yang pantang menyerah begini malu?",},
        [1583] = {20185501,"Ju Shou","Yuan Shao","Sekarang menteri jahat itu masih membuat kekacauan dan Kaisar terlantar. Keluargaku telah diberkati oleh Dinasti Han selama beberapa generasi. Aku ingin untuk menghidupkan kembali pemerintahan Dinasti Han dengan sepenuh tenagaku.","Sekarang menteri jahat itu masih membuat kekacauan dan Kaisar terlantar. Keluargaku telah diberkati oleh Dinasti Han selama beberapa generasi. Aku ingin untuk menghidupkan kembali pemerintahan Dinasti Han dengan sepenuh tenagaku.",},
        [1584] = {20185501,"Ju Shou","Yuan Shao","Tetapi Tuan Huan dari Qi tidak bisa mencapai tujuan besar tanpa Guan Zhong. Gou Jian tidak bisa menjaga Kerajaan Yue tanpa Fan Li.","Tetapi Tuan Huan dari Qi tidak bisa mencapai tujuan besar tanpa Guan Zhong. Gou Jian tidak bisa menjaga Kerajaan Yue tanpa Fan Li.",},
        [1585] = {20185501,"Ju Shou","Yuan Shao","Sekarang aku ingin bekerja sama denganmu untuk membuat negara lebih stabil. Apa rencana yang kamu miliki untuk membantuku?","Sekarang aku ingin bekerja sama denganmu untuk membuat negara lebih stabil. Apa rencana yang kamu miliki untuk membantuku?",},
        [1586] = {20185501,"Yuan Shao","Ju Shou","Jenderal digunakan dengan baik oleh istana sebelum berusia dua puluh tahun, mendapatkan ketenaran di seluruh negeri.","Jenderal digunakan dengan baik oleh istana sebelum berusia dua puluh tahun, mendapatkan ketenaran di seluruh negeri.",},
        [1587] = {20185501,"Yuan Shao","Ju Shou","Dong Zhuo menggulingkan kaisar, hal ini menggerakkan hatimu yang penuh kesetiaan dan keadilanmu, membuat Dong Zhuo sangat ketakutan.","Dong Zhuo menggulingkan kaisar, hal ini menggerakkan hatimu yang penuh kesetiaan dan keadilanmu, membuat Dong Zhuo sangat ketakutan.",},
        [1588] = {20185501,"Yuan Shao","Ju Shou","Kamu menyeberangi Sungai Kuning menuju utara. Orang di Bohai akan mengikuti perintahmu. Kamu memiliki tentara di satu prefektur, mengumpulkan prajurit di Jizhou, memiliki kekuatan untuk menguasai bagian utara Sungai Kuning, ketenaranmu terdengar di seluruh dunia. ","Kamu menyeberangi Sungai Kuning menuju utara. Orang di Bohai akan mengikuti perintahmu. Kamu memiliki tentara di satu prefektur, mengumpulkan prajurit di Jizhou, memiliki kekuatan untuk menguasai bagian utara Sungai Kuning, ketenaranmu terdengar di seluruh dunia. ",},
        [1589] = {20185501,"Yuan Shao","Ju Shou","Jika meluncurkan serangan ke arah timur, kamu bisa membersihkan Turban Kuning, saat kembali masih bisa menyerang Heishan dan menghancurkan Zhang Yan. Ke arah utara, kamu pasti bisa mengalahkan Gongsun Zan dan menaklukkan Xiongnu.","Jika meluncurkan serangan ke arah timur, kamu bisa membersihkan Turban Kuning, saat kembali masih bisa menyerang Heishan dan menghancurkan Zhang Yan. Ke arah utara, kamu pasti bisa mengalahkan Gongsun Zan dan menaklukkan Xiongnu.",},
        [1590] = {20185501,"Yuan Shao","Ju Shou","Sapu bagian utara Sungai Kuning, satukan kekuatan empat prefektur, rekrut para hero dan orang bertalenta dan sambut Kaisar di Chang'an dengan jutaan prajurit.","Sapu bagian utara Sungai Kuning, satukan kekuatan empat prefektur, rekrut para hero dan orang bertalenta dan sambut Kaisar di Chang'an dengan jutaan prajurit.",},
        [1591] = {20185501,"Yuan Shao","Ju Shou","Memulihkan istana di Luoyang dan menyerukan kepada dunia bahwa kamu akan menyerang orang yang tidak menurut dengan Kaisar.","Memulihkan istana di Luoyang dan menyerukan kepada dunia bahwa kamu akan menyerang orang yang tidak menurut dengan Kaisar.",},
        [1592] = {20185501,"Yuan Shao","Ju Shou","Dengan kondisi seperti ini untuk menentukan kalah menang, siapapun tidak dapat menghentikanmu! Beberapa tahun kemudian, kamu akan mencapai kesuksesan dan tidak ada kesulitan. ","Dengan kondisi seperti ini untuk menentukan kalah menang, siapapun tidak dapat menghentikanmu! Beberapa tahun kemudian, kamu akan mencapai kesuksesan dan tidak ada kesulitan. ",},
        [1593] = {20185502,"Yuan Shao","Ju Shou","Baru saja aku memandangi bintang-bintang. Venus berlari antara Liu dan Gui. Dan bintang itu menyinari Niu dan Dou. Aku khawatir mungkin ada serangan bandit.","Baru saja aku memandangi bintang-bintang. Venus berlari antara Liu dan Gui. Dan bintang itu menyinari Niu dan Dou. Aku khawatir mungkin ada serangan bandit.",},
        [1594] = {20185502,"Yuan Shao","Ju Shou","Wuchao adalah gudang gandum, tidak mungkin tidak dijaga. Sebaiknya kirim pasukan elit untuk berpatroli di sekitar jalur gunung, mungkin Cao Cao memiliki desain jahat.","Wuchao adalah gudang gandum, tidak mungkin tidak dijaga. Sebaiknya kirim pasukan elit untuk berpatroli di sekitar jalur gunung, mungkin Cao Cao memiliki desain jahat.",},
        [1595] = {20185502,"Ju Shou","Yuan Shao","Kamu adalah orang penuh dosa, beraninya membuat kebohongan, mengacaukan rakyat!","Kamu adalah orang penuh dosa, beraninya membuat kebohongan, mengacaukan rakyat!",},
        [1596] = {20185502,"Ju Shou","Yuan Shao","Seseorang! Masukkan dia ke penjara!","Seseorang! Masukkan dia ke penjara!",},
        [1597] = {20185502,"Yuan Shao","Ju Shou","Tentara kami dalah bahaya, aku tidak tahu dimana jasadku akan dikuburkan!","Tentara kami dalah bahaya, aku tidak tahu dimana jasadku akan dikuburkan!",},
        [1598] = {20185503,"Ju Shou","Cao Cao","Pasukan Yuan Shao kalah dan kabur.","Pasukan Yuan Shao kalah dan kabur.",},
        [1599] = {20185503,"Ju Shou","Cao Cao","Ju Shou, akankah kau menyerah?","Ju Shou, akankah kau menyerah?",},
        [1600] = {20185503,"Cao Cao","Ju Shou","Aku takkan menyerah!","Aku takkan menyerah!",},
        [1601] = {20185503,"Ju Shou","Cao Cao","Benchu tidaklah bijaksana. Hal ini, tidak perlu dikatakanpun aku sudah tahu. Mengapa kamu masih keras kepala? Jika kamu bekerja padaku, mendapatkan dunia ini bukanlah masalah bagiku.","Benchu tidaklah bijaksana. Hal ini, tidak perlu dikatakanpun aku sudah tahu. Mengapa kamu masih keras kepala? Jika kamu bekerja padaku, mendapatkan dunia ini bukanlah masalah bagiku.",},
        [1602] = {20185601,"Cao Hong","Cao Ren","Saat ini Istana Han tidak memiliki pemimpin, Dong Zhuo adalah tiran yang menipu Kaisar dan mengotori rakyat. Semua orang membenci Dong Zhuo.","Saat ini Istana Han tidak memiliki pemimpin, Dong Zhuo adalah tiran yang menipu Kaisar dan mengotori rakyat. Semua orang membenci Dong Zhuo.",},
        [1603] = {20185601,"Cao Hong","Cao Ren","Cao Cao mengangkat bendera putih yang bertuliskan Kesetiaan dan merekrut prajurit penuh keadilan.","Cao Cao mengangkat bendera putih yang bertuliskan Kesetiaan dan merekrut prajurit penuh keadilan.",},
        [1604] = {20185601,"Cao Hong","Cao Ren","Zilian, Cao cao adalah sepupuku, mari pergi meminta bantuannya.","Zilian, Cao cao adalah sepupuku, mari pergi meminta bantuannya.",},
        [1605] = {20185601,"Cao Ren","Cao Hong","Zixiao, aku juga berpikir sama.","Zixiao, aku juga berpikir sama.",},
        [1606] = {20185602,"Man Chong","Cao Ren","Sebelumnya karena aku tidak mendengarkanmu, aku kehilangan kedua jenderalku dan Xiangyang. Apa yang harus kulakukan?","Sebelumnya karena aku tidak mendengarkanmu, aku kehilangan kedua jenderalku dan Xiangyang. Apa yang harus kulakukan?",},
        [1607] = {20185602,"Cao Ren","Man Chong","Yunchang sangat berani, cerdik penuh siasat, jangan dianggap remeh, tetaplah bersiaga.","Yunchang sangat berani, cerdik penuh siasat, jangan dianggap remeh, tetaplah bersiaga.",},
        [1608] = {20185602,"Man Chong","Cao Ren","Segera kirimkan seseorang ke Chang'an dalam semalam untuk meminta pertolongan, dan katakan Yunchang telah menembus Xiangyang. Fancheng dalam bahaya. Berharap bala bantuan datang.","Segera kirimkan seseorang ke Chang'an dalam semalam untuk meminta pertolongan, dan katakan Yunchang telah menembus Xiangyang. Fancheng dalam bahaya. Berharap bala bantuan datang.",},
        [1609] = {20185602,"Man Chong","Cao Ren","Lindungi kota hingga akhir!","Lindungi kota hingga akhir!",},
        [1610] = {20185603,"Man Chong","Cao Ren","Ombak bergelombang tinggi di sekitar Fancheng, tembok terendam ke dalam air dan runtuh. Semua orang membawa batu bata yang mencoba untuk membungkamnya tetapi semuanya sia-sia.","Ombak bergelombang tinggi di sekitar Fancheng, tembok terendam ke dalam air dan runtuh. Semua orang membawa batu bata yang mencoba untuk membungkamnya tetapi semuanya sia-sia.",},
        [1611] = {20185603,"Man Chong","Cao Ren","Krisis saat ini bukan masalah yang bisa diselamatkan dengan tenaga kerja. Mengapa tidak naik perahu dan pergi sebelum musuh sepenuhnya datang. Meskipun kota itu mungkin hilang, tetapi kita akan tetap terjaga.","Krisis saat ini bukan masalah yang bisa diselamatkan dengan tenaga kerja. Mengapa tidak naik perahu dan pergi sebelum musuh sepenuhnya datang. Meskipun kota itu mungkin hilang, tetapi kita akan tetap terjaga.",},
        [1612] = {20185603,"Cao Ren","Man Chong","Tidak. Airnya tiba-tiba dan tidak akan bertahan lama. Tidak akan memakan waktu sepuluh hari sebelum hilang. Meskipun Guan belum menyerang, dia telah mengerahkan para jenderal di Jiaxia.","Tidak. Airnya tiba-tiba dan tidak akan bertahan lama. Tidak akan memakan waktu sepuluh hari sebelum hilang. Meskipun Guan belum menyerang, dia telah mengerahkan para jenderal di Jiaxia.",},
        [1613] = {20185603,"Cao Ren","Man Chong","Dia tidak berani menyerangku dengan terburu-buru karena khawatir aku akan menyerang dari belakang. Jika kita meninggalkan kota sekarang, di selatan Sungai Kuning bukanlah lagi wilayah kami.","Dia tidak berani menyerangku dengan terburu-buru karena khawatir aku akan menyerang dari belakang. Jika kita meninggalkan kota sekarang, di selatan Sungai Kuning bukanlah lagi wilayah kami.",},
        [1614] = {20185603,"Man Chong","Cao Ren","Kalau bukan karena pendapatmu, aku akan membuat kesalahan besar.","Kalau bukan karena pendapatmu, aku akan membuat kesalahan besar.",},
        [1615] = {20185603,"Man Chong","Cao Ren","Aku mendapat perintah dari Raja Wei untuk melindungi kota ini. Aku akan mengeksekusi orang yang akan meninggalkan kota!","Aku mendapat perintah dari Raja Wei untuk melindungi kota ini. Aku akan mengeksekusi orang yang akan meninggalkan kota!",},
        [1616] = {20185603,"Man Chong","Cao Ren","Semuanya akan melindungi Fancheng hingga mati. Kirimkan ratusan pemanah dan sersan untuk melindugi gerbang kota dan berpatroli siang dan malam. Jangan lengah.","Semuanya akan melindungi Fancheng hingga mati. Kirimkan ratusan pemanah dan sersan untuk melindugi gerbang kota dan berpatroli siang dan malam. Jangan lengah.",},
        [1617] = {20185604,"","Cao Ren","Guan Yu terluka karena panahku, dikalahkan oleh Xu Huang dan dipaksa munudr ke Maicheng.","Guan Yu terluka karena panahku, dikalahkan oleh Xu Huang dan dipaksa munudr ke Maicheng.",},
        [1618] = {20185604,"","Cao Ren","Sayang sekali, aku tidak bisa menyerang Mai Cheng dan menangkap Guan Yu hidup-hidup!","Sayang sekali, aku tidak bisa menyerang Mai Cheng dan menangkap Guan Yu hidup-hidup!",},
        [1619] = {20185604,"","Cao Ren","Malah Lu Meng dari Dongwu yang mengambil untung, benar-benar menyedihkan. ","Malah Lu Meng dari Dongwu yang mengambil untung, benar-benar menyedihkan. ",},
        [1620] = {20185701,"Sun Quan","Ibu Suri Wu","Merupakan suatu hukum bahwa pria dan wanita harus menikah pada usia yang sesuai. Aku adalah ibumu dan kamu harus menjalankan aturanku.","Merupakan suatu hukum bahwa pria dan wanita harus menikah pada usia yang sesuai. Aku adalah ibumu dan kamu harus menjalankan aturanku.",},
        [1621] = {20185701,"Sun Quan","Ibu Suri Wu","Mengapa kamu menyembunyikannya dariku bahwa kamu telah menerima Liu Xuande sebagai menantuku? Dia adalah putriku!","Mengapa kamu menyembunyikannya dariku bahwa kamu telah menerima Liu Xuande sebagai menantuku? Dia adalah putriku!",},
        [1622] = {20185701,"Ibu Suri Wu","Sun Quan","Darimana asal perkataanmu?","Darimana asal perkataanmu?",},
        [1623] = {20185701,"Sun Quan","Ibu Suri Wu","Jika tidak ingin orang lain mengetahui hal ini, sebaiknya jangan melakukannya. Semua orang di kota, siapa yang tidak tahu? Kamu masih menutupinya dariku!","Jika tidak ingin orang lain mengetahui hal ini, sebaiknya jangan melakukannya. Semua orang di kota, siapa yang tidak tahu? Kamu masih menutupinya dariku!",},
        [1624] = {20185701,"Ibu Suri Wu","Sun Quan","Tidak juga. Ini adalah rencana Zhou Yu, karena ingin mengambil Jingzhou, maka kita menipu dan menangkap Liu Bei, untuk ditukarkan dengan Jingzhou.","Tidak juga. Ini adalah rencana Zhou Yu, karena ingin mengambil Jingzhou, maka kita menipu dan menangkap Liu Bei, untuk ditukarkan dengan Jingzhou.",},
        [1625] = {20185701,"Ibu Suri Wu","Sun Quan","Jika dia tidak datang, kita bunuh dulu Liu Bei. Ini hanyalah rencana, bukan niat yang sebenarnya.","Jika dia tidak datang, kita bunuh dulu Liu Bei. Ini hanyalah rencana, bukan niat yang sebenarnya.",},
        [1626] = {20185701,"Sun Quan","Ibu Suri Wu","Kamu adalah Marsekal dari 81 kota, bagaimana bisa kamu menggunakan putrimu dalam siasat orang cantik untuk mendapatkan Jingzhou!","Kamu adalah Marsekal dari 81 kota, bagaimana bisa kamu menggunakan putrimu dalam siasat orang cantik untuk mendapatkan Jingzhou!",},
        [1627] = {20185701,"Sun Quan","Ibu Suri Wu","Membunuh Liu Bei dan membuat putriku menjadi janda, bagaimana dia bisa menikah lagi? Ini akan membuat hidup putriku terganggu! Kalian sangat palsu!","Membunuh Liu Bei dan membuat putriku menjadi janda, bagaimana dia bisa menikah lagi? Ini akan membuat hidup putriku terganggu! Kalian sangat palsu!",},
        [1628] = {20185701,"Sun Quan","Ibu Suri Wu","Jika menggunakan rencana ini, meskipun mendapatkan Jizhou, tapi akan ditertawakan oleh seluruh negara, jangan lakukan hal ini!","Jika menggunakan rencana ini, meskipun mendapatkan Jizhou, tapi akan ditertawakan oleh seluruh negara, jangan lakukan hal ini!",},
        [1629] = {20185701,"Sun Quan","Ibu Suri Wu","Aturkan pertemuan di Kuil Ganlu besok. Jika aku tidak menyukainya, aku akan membiarkanmu melakukannya. Jika aku setuju, aku akan menikahkan putriku dengan dia!","Aturkan pertemuan di Kuil Ganlu besok. Jika aku tidak menyukainya, aku akan membiarkanmu melakukannya. Jika aku setuju, aku akan menikahkan putriku dengan dia!",},
        [1630] = {20185702,"Zhou Yu","Sun Quan","Ibuku memaksa agar adik perempuanku menikah dengan Liu Bei. Semuanya menjadi bumerang. Apa yang harus dilakukan?","Ibuku memaksa agar adik perempuanku menikah dengan Liu Bei. Semuanya menjadi bumerang. Apa yang harus dilakukan?",},
        [1631] = {20185702,"Sun Quan","Zhou Yu","Rencana dari Zhou Yu, tidak disangka akan menjadi seperti ini. Karena sudah terjadi, maka tetap lakukan sesuai rencana.","Rencana dari Zhou Yu, tidak disangka akan menjadi seperti ini. Karena sudah terjadi, maka tetap lakukan sesuai rencana.",},
        [1632] = {20185702,"Sun Quan","Zhou Yu","Liu Bei adalah Hero yang licik, memiliki Guan, Zhang dan Zhao Yun sebagai jenderal, ditambah Zhuge Liang sebagai penasihat. Dia pasti tidak akan berdiam untuk waktu yang lama.","Liu Bei adalah Hero yang licik, memiliki Guan, Zhang dan Zhao Yun sebagai jenderal, ditambah Zhuge Liang sebagai penasihat. Dia pasti tidak akan berdiam untuk waktu yang lama.",},
        [1633] = {20185702,"Sun Quan","Zhou Yu","Menurutku kita bisa menempatkan dia di Wu, membangun istana dan memanjakannya dalam hawa nafsu dan hedonisme.","Menurutku kita bisa menempatkan dia di Wu, membangun istana dan memanjakannya dalam hawa nafsu dan hedonisme.",},
        [1634] = {20185702,"Sun Quan","Zhou Yu","Guan Yu dan Zhang Fei harus dipisahkan, jauh dari Zhuge Liang dan serang satu-persatu di tempat masing-masing, dengan begitu baru bisa berhasil.","Guan Yu dan Zhang Fei harus dipisahkan, jauh dari Zhuge Liang dan serang satu-persatu di tempat masing-masing, dengan begitu baru bisa berhasil.",},
        [1635] = {20185702,"Sun Quan","Zhou Yu","Saat ini jika memanjakan dia, dia akan menunjukkan kemampuannya saat mendapatkan kesempatan. Semoga Tuan mempertimbangkannya dengan baik.","Saat ini jika memanjakan dia, dia akan menunjukkan kemampuannya saat mendapatkan kesempatan. Semoga Tuan mempertimbangkannya dengan baik.",},
        [1636] = {20185702,"Zhou Yu","Sun Quan","Rencana Gongjin sama dengan pikiranku. Liu Bei mulai dari kehidupan sederhana, berlari kesana kemari, tidak pernah merasakan kekayaan.","Rencana Gongjin sama dengan pikiranku. Liu Bei mulai dari kehidupan sederhana, berlari kesana kemari, tidak pernah merasakan kekayaan.",},
        [1637] = {20185702,"Zhou Yu","Sun Quan","Jika kita memberikan rumah mewah dan emas untuk anaknya, ini akan menjauhkan dia dari Kongming, Guan dan Zhang.","Jika kita memberikan rumah mewah dan emas untuk anaknya, ini akan menjauhkan dia dari Kongming, Guan dan Zhang.",},
        [1638] = {20185702,"Zhou Yu","Sun Quan","Membuat mereka saling dendam, lalu kami dapat merebut Jingzhou.","Membuat mereka saling dendam, lalu kami dapat merebut Jingzhou.",},
        [1639] = {20185703,"Liu Bei","Sun Shangxiang","Apa yang mengganggumu, suamiku? ","Apa yang mengganggumu, suamiku? ",},
        [1640] = {20185703,"Sun Shangxiang","Liu Bei","Aku telah mengungsi sepanjang hidup saya. Aku tidak bisa mendukung orang tua saya atau mempersembahkan korban kepada leluhur. Hal ini sangat bertentangan dengan kesalehan seorang anak.","Aku telah mengungsi sepanjang hidup saya. Aku tidak bisa mendukung orang tua saya atau mempersembahkan korban kepada leluhur. Hal ini sangat bertentangan dengan kesalehan seorang anak.",},
        [1641] = {20185703,"Sun Shangxiang","Liu Bei","Sekarang sudah dekat tahun baru, aku sangat tidak senang.","Sekarang sudah dekat tahun baru, aku sangat tidak senang.",},
        [1642] = {20185703,"Liu Bei","Sun Shangxiang","Jangan bohong padaku, aku telah mendengarnya! Baru saja Zhao Zilong melaporkan bahwa Jingzhou dalam bahaya, kamu ingin kembali, karena itu kamu mengatakan seperti itu.","Jangan bohong padaku, aku telah mendengarnya! Baru saja Zhao Zilong melaporkan bahwa Jingzhou dalam bahaya, kamu ingin kembali, karena itu kamu mengatakan seperti itu.",},
        [1643] = {20185703,"Sun Shangxiang","Liu Bei","Karena kamu sudah tahu, aku tidak berani menutupinya. Jika aku tidak pergi, akan membuat Jingzhou jatuh dan akan ditertawakan oleh semua orang.","Karena kamu sudah tahu, aku tidak berani menutupinya. Jika aku tidak pergi, akan membuat Jingzhou jatuh dan akan ditertawakan oleh semua orang.",},
        [1644] = {20185703,"Sun Shangxiang","Liu Bei","Tapi aku akan sangat merindukanmu, itu yang menggangguku.","Tapi aku akan sangat merindukanmu, itu yang menggangguku.",},
        [1645] = {20185703,"Liu Bei","Sun Shangxiang","Kita telah menikah, kemanapun kamu pergi, aku pasti akan mengikutimu.","Kita telah menikah, kemanapun kamu pergi, aku pasti akan mengikutimu.",},
        [1646] = {20185703,"Sun Shangxiang","Liu Bei","Niatmu, meskipun begini, tetapi Ibu Suri dan Tuan dari Wu tidak akan membiarkannya. Jika kasihan padaku, biarkan aku pergi dulu.","Niatmu, meskipun begini, tetapi Ibu Suri dan Tuan dari Wu tidak akan membiarkannya. Jika kasihan padaku, biarkan aku pergi dulu.",},
        [1647] = {20185703,"Liu Bei","Sun Shangxiang","Jangan khawatir. Aku akan memberitahukan ini pada ibuku dan dia akan memperbolehkanku untuk pergi denganmu.","Jangan khawatir. Aku akan memberitahukan ini pada ibuku dan dia akan memperbolehkanku untuk pergi denganmu.",},
        [1648] = {20185703,"Sun Shangxiang","Liu Bei","Meskipun begitu, Tuan Wu pasti akan menentang.","Meskipun begitu, Tuan Wu pasti akan menentang.",},
        [1649] = {20185703,"Liu Bei","Sun Shangxiang","Saat Tahun Baru tiba, kamu dan aku akan menggunakan korban di tepi sungai sebagai dalih dan kita pergi tanpa mengucapkan selamat tinggal. Bagaimana?","Saat Tahun Baru tiba, kamu dan aku akan menggunakan korban di tepi sungai sebagai dalih dan kita pergi tanpa mengucapkan selamat tinggal. Bagaimana?",},
        [1650] = {20185703,"Sun Shangxiang","Liu Bei","Jika seperti ini, aku akan mengingatnya hingga mati! Jangan bocorkan informasi ini.","Jika seperti ini, aku akan mengingatnya hingga mati! Jangan bocorkan informasi ini.",},
        [1651] = {20185704,"Sun Shangxiang","Zhao Yun","Mengapa terburu-buru kembali ke Dongwu, kakak ipar?","Mengapa terburu-buru kembali ke Dongwu, kakak ipar?",},
        [1652] = {20185704,"Zhao Yun","Sun Shangxiang","Surat yang datang dari rumah mengatakan Ibu sakit keras. Aku ingin kembali untuk melihatnya.","Surat yang datang dari rumah mengatakan Ibu sakit keras. Aku ingin kembali untuk melihatnya.",},
        [1653] = {20185704,"Sun Shangxiang","Zhao Yun","Mengapa membawa A Dou jika hanya mengunjungi ibu?","Mengapa membawa A Dou jika hanya mengunjungi ibu?",},
        [1654] = {20185704,"Sun Shangxiang","Zhang Fei","Tolong jangan mempersulit keadaan pada kami, nyonya. Tinggalkan A Dou dan kamu akan kembali ke Dongwu untuk berkunjung.","Tolong jangan mempersulit keadaan pada kami, nyonya. Tinggalkan A Dou dan kamu akan kembali ke Dongwu untuk berkunjung.",},
        [1655] = {20185801,"Lu Zhi","Liu Hong","Zhang Jiao, seorang dari Julu, Jizhou memulai kerusuhan dan dijawab oleh delapan kota di seluruh negara.","Zhang Jiao, seorang dari Julu, Jizhou memulai kerusuhan dan dijawab oleh delapan kota di seluruh negara.",},
        [1656] = {20185801,"Lu Zhi","Liu Hong","Dengar-dengar Zigan berbakat dalam literatur dan militer, oleh karena itu diangkat menjadi Kolonel.","Dengar-dengar Zigan berbakat dalam literatur dan militer, oleh karena itu diangkat menjadi Kolonel.",},
        [1657] = {20185801,"Lu Zhi","Liu Hong","Kamu akan memimpin barak kelima untuk menekan Turban Kuning di Jizhou.","Kamu akan memimpin barak kelima untuk menekan Turban Kuning di Jizhou.",},
        [1658] = {20185801,"Liu Hong","Lu Zhi","Zigan akan mengirimkan tentara!","Zigan akan mengirimkan tentara!",},
        [1659] = {20185802,"Lu Zhi","He Jin","Dong Zhuo mengatakan dalam peringatannya, penyebab pemberontakan di dunia ini, disebabkan oleh Zhang Rang si Kasim itu.","Dong Zhuo mengatakan dalam peringatannya, penyebab pemberontakan di dunia ini, disebabkan oleh Zhang Rang si Kasim itu.",},
        [1660] = {20185802,"Lu Zhi","He Jin","Aku menyarankan membunyikan lonceng untuk memanggil Zhang Rang ke Luoyang dan mengeliminasinya. Ini akan menjadi hal yang baik untuk masyarakat dan negara!","Aku menyarankan membunyikan lonceng untuk memanggil Zhang Rang ke Luoyang dan mengeliminasinya. Ini akan menjadi hal yang baik untuk masyarakat dan negara!",},
        [1661] = {20185802,"He Jin","Lu Zhi","Aku telah mengenal Dong Zhuo cukup jelas. Dia adalah serigala meskipun wajahnya terlihat baik. Dia pasti akan menjadi bencana di istana.","Aku telah mengenal Dong Zhuo cukup jelas. Dia adalah serigala meskipun wajahnya terlihat baik. Dia pasti akan menjadi bencana di istana.",},
        [1662] = {20185802,"He Jin","Lu Zhi","Sebaiknya kita menghentikannya, tidak membiarkan dia datang, untuk menghindari terjadinya kekacauan.","Sebaiknya kita menghentikannya, tidak membiarkan dia datang, untuk menghindari terjadinya kekacauan.",},
        [1663] = {20185802,"Lu Zhi","He Jin","Kamu terlalu curiga, tidak bisa melakukan hal besar.","Kamu terlalu curiga, tidak bisa melakukan hal besar.",},
        [1664] = {20185901,"Hua Tuo","Sun Ce","Bandit gunung menyerang Xuancheng pada malam hari. Zhou Tai mengangkat Sun Quan dengan terburu-buru ke atas kuda, dia sendiri berjalan kaki.","Bandit gunung menyerang Xuancheng pada malam hari. Zhou Tai mengangkat Sun Quan dengan terburu-buru ke atas kuda, dia sendiri berjalan kaki.",},
        [1665] = {20185901,"Hua Tuo","Sun Ce","Berjuang untuk mengalahkan jalan bernoda darah, mendapat dua belas luka tusukan dan bintil, dan berkeliaran di dekat pintu kematian.","Berjuang untuk mengalahkan jalan bernoda darah, mendapat dua belas luka tusukan dan bintil, dan berkeliaran di dekat pintu kematian.",},
        [1666] = {20185901,"Hua Tuo","Sun Ce","Tolong bantu.","Tolong bantu.",},
        [1667] = {20185901,"Sun Ce","Hua Tuo","Sebagai dokter, menyelamatkan orang adalah panggilanku. Biarkanku melihatnya.","Sebagai dokter, menyelamatkan orang adalah panggilanku. Biarkanku melihatnya.",},
        [1668] = {20185901,"Sun Ce","Hua Tuo","Hmm, ini tidak susah.","Hmm, ini tidak susah.",},
        [1669] = {20185902,"Zhou Tai","Sun Quan","Zhou Tai bertarung dengan berani mengusir Cao Cao. Dia harus diangkat menjadi Jenderal Pinglu.","Zhou Tai bertarung dengan berani mengusir Cao Cao. Dia harus diangkat menjadi Jenderal Pinglu.",},
        [1670] = {20185902,"Zhou Tai","Sun Quan","Tos untukmu.","Tos untukmu.",},
        [1671] = {20185902,"Sun Quan","Zhou Tai","Terima kasih, Zhongmou!","Terima kasih, Zhongmou!",},
        [1672] = {20185902,"Zhou Tai","Sun Quan","Setelah minum ini, tolong buka bajumu.","Setelah minum ini, tolong buka bajumu.",},
        [1673] = {20185902,"Sun Quan","Zhou Tai","Lepaskan baju?","Lepaskan baju?",},
        [1674] = {20185902,"Zhou Tai","Sun Quan","Aku mendengar ada beberapa orang yang tidak percaya dengan ceritamu. Aku akan membuat mereka melihat dengan matanya sendiri.","Aku mendengar ada beberapa orang yang tidak percaya dengan ceritamu. Aku akan membuat mereka melihat dengan matanya sendiri.",},
        [1675] = {20185902,"Zhou Tai","Sun Quan","Luka-luka pedang di badan Youping berasal dari mana!","Luka-luka pedang di badan Youping berasal dari mana!",},
        [1676] = {20185902,"Zhou Tai","Sun Quan","Bagaimana aku tidak memperlakukan seperti saudara sendiri dan mempercayainya untuk memimpin prajuritku!","Bagaimana aku tidak memperlakukan seperti saudara sendiri dan mempercayainya untuk memimpin prajuritku!",},
        [1677] = {20186001,"Zuo Ci","Cao Cao","Perjamuan hari ini, kita memiliki semua jenis makanan.","Perjamuan hari ini, kita memiliki semua jenis makanan.",},
        [1678] = {20186001,"Zuo Ci","Cao Cao","Yang kurang hanyalah telur ikan kakap putih di Sungai Song Kerajaan Wu.","Yang kurang hanyalah telur ikan kakap putih di Sungai Song Kerajaan Wu.",},
        [1679] = {20186001,"Cao Cao","Zuo Ci","Ini hal yang mudah.","Ini hal yang mudah.",},
        [1680] = {20186001,"Cao Cao","Zuo Ci","Berikan padaku piring tembaga dan isi dengan air. Akan kugunakan tongkat bambu untuk umpan memancing ikan. (tidak lama kemudian, seekor ikan kakap tertangkap.)","Berikan padaku piring tembaga dan isi dengan air. Akan kugunakan tongkat bambu untuk umpan memancing ikan. (tidak lama kemudian, seekor ikan kakap tertangkap.)",},
        [1681] = {20186001,"Zuo Ci","Cao Cao","Seekor ikan tidak cukup untuk memberi makan para tamu, buat menjadi dua.","Seekor ikan tidak cukup untuk memberi makan para tamu, buat menjadi dua.",},
        [1682] = {20186001,"Cao Cao","Zuo Ci","Tidak masalah. (Mengumpan dan menangkap satu ekor lagi.)","Tidak masalah. (Mengumpan dan menangkap satu ekor lagi.)",},
        [1683] = {20186001,"Zuo Ci","Cao Cao","Tuan Yuan Fang memiliki ilmu taoisme yang mendalam.","Tuan Yuan Fang memiliki ilmu taoisme yang mendalam.",},
        [1684] = {20186002,"Liu Biao","Zuo Ci","Aku memiliki hadiah sederhana untuk tentaramu.","Aku memiliki hadiah sederhana untuk tentaramu.",},
        [1685] = {20186002,"Zuo Ci","Liu Biao","Kamu taoist seorang diri, aku dengan sepuluh ribu prajurit dan seribu tamu, apakah kamu mampu memberikan makan dan minum?","Kamu taoist seorang diri, aku dengan sepuluh ribu prajurit dan seribu tamu, apakah kamu mampu memberikan makan dan minum?",},
        [1686] = {20186002,"Liu Biao","Zuo Ci","Aku memiliki segentong arak dan dendeng.","Aku memiliki segentong arak dan dendeng.",},
        [1687] = {20186002,"Zuo Ci","Liu Biao","Aku memiliki satu gentong arak dan dendeng, apakah ini cukup?","Aku memiliki satu gentong arak dan dendeng, apakah ini cukup?",},
        [1688] = {20186002,"Liu Biao","Zuo Ci","Setiap prajurit bisa menikmati tiga gelas arak dan satu potong dendeng. (lalu mengirimkan orang untuk membagikan arak dan daging.)","Setiap prajurit bisa menikmati tiga gelas arak dan satu potong dendeng. (lalu mengirimkan orang untuk membagikan arak dan daging.)",},
        [1689] = {20186002,"Zuo Ci","Liu Biao","Bagaimana kamu bisa memastikan wadah arak tidak kurang, dan dendeng tidak termakan habis?","Bagaimana kamu bisa memastikan wadah arak tidak kurang, dan dendeng tidak termakan habis?",},
        [1690] = {20186002,"Liu Biao","Zuo Ci","Hahahahaha.","Hahahahaha.",},
        [1691] = {20186003,"Zuo Ci","Sun Ce","Zuo Ci Taoist itu, menggunakan Ilmu Gelap lagi!","Zuo Ci Taoist itu, menggunakan Ilmu Gelap lagi!",},
        [1692] = {20186003,"Zuo Ci","Sun Ce","Aku bisa memotong Yu Ji, juga bisa memotongmu!","Aku bisa memotong Yu Ji, juga bisa memotongmu!",},
        [1693] = {20186003,"Sun Ce","Zuo Ci","Ahahahaha, aku akan bergerak pelan.","Ahahahaha, aku akan bergerak pelan.",},
        [1694] = {20186003,"Sun Ce","Zuo Ci","Jika kamu dapat mengejarku, maka penggallah aku.","Jika kamu dapat mengejarku, maka penggallah aku.",},
        [1695] = {20186003,"Zuo Ci","Sun Ce","Ilmu gelap apa yang kamu gunakan? Mengapa aku tidak bisa mengejar kamu yang berjalan dengan pelan!","Ilmu gelap apa yang kamu gunakan? Mengapa aku tidak bisa mengejar kamu yang berjalan dengan pelan!",},
        [1696] = {20186101,"Shen Pei","Yuan Shao","Waktunya untuk memilih penerus. Yuan Tan sangat haus darah, sedangan Yuan Xi sangat lemah dan tidak berprestasi. Anak bungsu Yuan Shang terlihat lebih baik, bagaimana ini?","Waktunya untuk memilih penerus. Yuan Tan sangat haus darah, sedangan Yuan Xi sangat lemah dan tidak berprestasi. Anak bungsu Yuan Shang terlihat lebih baik, bagaimana ini?",},
        [1697] = {20186101,"Yuan Shao","Shen Pei","Mengapa tidak memberikan Yuan Tan kepada kakakmu yang sudah meninggal sebagai anak tiri? Dengan begitu, tidak ada yang akan mengatakan kamu menggulingkan yang tertua tetapi memahkotai yang termuda.","Mengapa tidak memberikan Yuan Tan kepada kakakmu yang sudah meninggal sebagai anak tiri? Dengan begitu, tidak ada yang akan mengatakan kamu menggulingkan yang tertua tetapi memahkotai yang termuda.",},
        [1698] = {20186101,"Shen Pei","Yuan Shao","Sangat masuk akal. Akan kuangkat Yuan Tan menjadi Gubernur, agar dia pergi menjaga Qingzhou.","Sangat masuk akal. Akan kuangkat Yuan Tan menjadi Gubernur, agar dia pergi menjaga Qingzhou.",},
        [1699] = {20186102,"Shen Pei","Yuan Tan","Aku adalah putra sulung ayahku, keturunan asli, kalian membicarakan hal rahasia apa dengan ayahku?","Aku adalah putra sulung ayahku, keturunan asli, kalian membicarakan hal rahasia apa dengan ayahku?",},
        [1700] = {20186102,"Yuan Tan","Shen Pei","Jenderal sendiri memberitahuku sebelum dia pergi bahwa dia ingin Yuan Shang untuk meneruskan tujuan besarnya.","Jenderal sendiri memberitahuku sebelum dia pergi bahwa dia ingin Yuan Shang untuk meneruskan tujuan besarnya.",},
        [1701] = {20186102,"Shen Pei","Yuan Tan","Humph! Jangan coba membohongiku, sudah jelas kamulah yang memutuskan hubungan ayah dan anak!","Humph! Jangan coba membohongiku, sudah jelas kamulah yang memutuskan hubungan ayah dan anak!",},
        [1702] = {20186102,"Yuan Tan","Shen Pei","Kamu sendiri tidak baik-baik dengan Jenderal, memang salahku?","Kamu sendiri tidak baik-baik dengan Jenderal, memang salahku?",},
        [1703] = {20186102,"Shen Pei","Yuan Tan","Sangat konyol!","Sangat konyol!",},
        [1704] = {20186103,"Yuan Shang","Yuan Tan","Zirah kami tidak baik, karena itu dikalahkan oleh Cao Cao, Pasukan Cao menyerang mundur, tidak ingin bertempur.","Zirah kami tidak baik, karena itu dikalahkan oleh Cao Cao, Pasukan Cao menyerang mundur, tidak ingin bertempur.",},
        [1705] = {20186103,"Yuan Shang","Yuan Tan","Kita harus menyerang mereka sebelum bersiap. Aku perlu untuk meningkatkan jubah dan kekuatan.","Kita harus menyerang mereka sebelum bersiap. Aku perlu untuk meningkatkan jubah dan kekuatan.",},
        [1706] = {20186103,"Yuan Tan","Yuan Shang","Tidak bisa, aku tidak punya, tidak bisa memberi.","Tidak bisa, aku tidak punya, tidak bisa memberi.",},
        [1707] = {20186103,"Yuan Shang","Yuan Tan","Jangan berlebihan! Percaya atau tidak, aku bisa bersekutu dengan Cao Cao dan menyerangmu!","Jangan berlebihan! Percaya atau tidak, aku bisa bersekutu dengan Cao Cao dan menyerangmu!",},
        [1708] = {20186201,"Zhang Rang","Cao Zhi","Seperti angsa terkaget, seperti ular naga melayang, seperti bunga musim gugur, seperti cemara musim semi. ","Seperti angsa terkaget, seperti ular naga melayang, seperti bunga musim gugur, seperti cemara musim semi. ",},
        [1709] = {20186201,"Cao Cao","Cao Zhi","Rambutnya terlihat seperti bulan tertutup oleh awan ringan, dan perilakunya seperti salju yang melayang tertiup angin. ","Rambutnya terlihat seperti bulan tertutup oleh awan ringan, dan perilakunya seperti salju yang melayang tertiup angin. ",},
        [1710] = {20186201,"Zhang Rang","Nyonya Zhen","Ah, ini membicarakanku?","Ah, ini membicarakanku?",},
        [1711] = {20186202,"Nyonya Zhen","Cao Pi","Jangan takut, aku adalah putra Perdana Menteri Cao, akan melindungi keluargamu, dan menjagamu.","Jangan takut, aku adalah putra Perdana Menteri Cao, akan melindungi keluargamu, dan menjagamu.",},
        [1712] = {20186202,"Cao Pi","Nyonya Zhen","Zhen bersedia untuk menjadi wanita Yang Mulia.","Zhen bersedia untuk menjadi wanita Yang Mulia.",},
        [1713] = {20186203,"","Nyonya Zhen","Gosip membuat orang terpisah. Kesedihan menindasku saat kamu pergi. Setiap saat teringat kamu berada di tempat yang jauh, aku merasa pahit seperti ditinggalkan suami.","Gosip membuat orang terpisah. Kesedihan menindasku saat kamu pergi. Setiap saat teringat kamu berada di tempat yang jauh, aku merasa pahit seperti ditinggalkan suami.",},
        [1714] = {20186203,"","Nyonya Zhen","Cinta tanpa saling pengertian. Jika ada kehidupan berikutnya, aku tidak bersedia bertemu denganmu lagi.","Cinta tanpa saling pengertian. Jika ada kehidupan berikutnya, aku tidak bersedia bertemu denganmu lagi.",},
        [1715] = {20186301,"Zhuge Liang","Zhuge Jin","Kali ini, aku datang untuk mengucapkan selamat pada Xuande telah menduduki Shu.","Kali ini, aku datang untuk mengucapkan selamat pada Xuande telah menduduki Shu.",},
        [1716] = {20186301,"Zhuge Jin","Zhuge Liang","Terima kasih~","Terima kasih~",},
        [1717] = {20186301,"Zhuge Liang","Zhuge Jin","Kedua, aku ingin bertanya, Jingzhou yang kamu pinjam dulu, kapan akan dikembalikan?","Kedua, aku ingin bertanya, Jingzhou yang kamu pinjam dulu, kapan akan dikembalikan?",},
        [1718] = {20186301,"Zhuge Jin","Zhuge Liang","Urusan mudah~","Urusan mudah~",},
        [1719] = {20186302,"Zhuge Ke","Sun Quan","Mengapa ada tanda bertuliskan Zhuge Ziyu di leher keledai ini? Apakah ini kamu? Ziyu?","Mengapa ada tanda bertuliskan Zhuge Ziyu di leher keledai ini? Apakah ini kamu? Ziyu?",},
        [1720] = {20186302,"Sun Quan","Zhuge Ke","Ada dua kata yang belum dituliskan, izinkan aku untuk menambahkannya di atas tanda.","Ada dua kata yang belum dituliskan, izinkan aku untuk menambahkannya di atas tanda.",},
        [1721] = {20186302,"Zhuge Ke","Sun Quan","Oh? Apa yang kamu tulis? Zhuge Ziyu… keledai? Baik, baik! Tentunya ada cara.","Oh? Apa yang kamu tulis? Zhuge Ziyu… keledai? Baik, baik! Tentunya ada cara.",},
        [1722] = {20186302,"Sun Quan","Zhuge Ke","Sekarang keledai ini adalah milikku! Akan kubawa pergi!","Sekarang keledai ini adalah milikku! Akan kubawa pergi!",},
        [1723] = {20186303,"Zhuge Jin","Sun Quan","Bagaimana jika aku mengangkat Ziyu sebagai Jenderal Besar, menjaga bagian kiri dan bekerja sebagai Pemerintah Yuzhou?","Bagaimana jika aku mengangkat Ziyu sebagai Jenderal Besar, menjaga bagian kiri dan bekerja sebagai Pemerintah Yuzhou?",},
        [1724] = {20186303,"Sun Quan","Zhuge Jin","Yuzhou sekarang adalah wilayah Wei, bukanlah milik kami.","Yuzhou sekarang adalah wilayah Wei, bukanlah milik kami.",},
        [1725] = {20186303,"Zhuge Jin","Sun Quan","Jadi, Ziyu lakukan dengan baik dan aku akan memberikan wilayah ini jika bisa menangkapnya!","Jadi, Ziyu lakukan dengan baik dan aku akan memberikan wilayah ini jika bisa menangkapnya!",},
        [1726] = {20186401,"Huang Yueying","Huang Chengyan","Putriku Yueying, nama panggilan Jiao. Dia cantik dan pintar. Tidak tahu siapakah yang beruntung dapat menikahi putri kecintaanku.","Putriku Yueying, nama panggilan Jiao. Dia cantik dan pintar. Tidak tahu siapakah yang beruntung dapat menikahi putri kecintaanku.",},
        [1727] = {20186401,"Huang Chengyan","Huang Yueying","Dengar-dengar Zhuge Kongming memiliki pengetahuan dan karakter yang baik. Aku sangat mengaguminya dan ingin meminta ayahku untuk membantu menikahkanku dengannya.","Dengar-dengar Zhuge Kongming memiliki pengetahuan dan karakter yang baik. Aku sangat mengaguminya dan ingin meminta ayahku untuk membantu menikahkanku dengannya.",},
        [1728] = {20186401,"Huang Chengyan","Huang Yueying","Tapi tolong katakan padanya bahwa aku adalah wanita jelek dengan rambut kuning dan kulit gelap. Kita akan tahu karakternya dengan melihat bagaimana dia bereaksi.","Tapi tolong katakan padanya bahwa aku adalah wanita jelek dengan rambut kuning dan kulit gelap. Kita akan tahu karakternya dengan melihat bagaimana dia bereaksi.",},
        [1729] = {20186401,"Huang Yueying","Huang Chengyan","Rencana bagus, jika Kongming adalah orang yang menginginkan orang cantik, pernikahan ini tidak perlu dibahas.","Rencana bagus, jika Kongming adalah orang yang menginginkan orang cantik, pernikahan ini tidak perlu dibahas.",},
        [1730] = {20186402,"Huang Yueying","Zhuge Liang","Anjing kayu, macan kayu, orang kayu ciptaan Yueying sangat luar biasa, aku sangat terkagum.","Anjing kayu, macan kayu, orang kayu ciptaan Yueying sangat luar biasa, aku sangat terkagum.",},
        [1731] = {20186402,"Zhuge Liang","Huang Yueying","Satu pertanyaan lagi. Saat kita menikah, yang pertama tidak ingin naik tandu, yang kedua naik kuda, ketiga kapal, kamu memiliki cara apa?","Satu pertanyaan lagi. Saat kita menikah, yang pertama tidak ingin naik tandu, yang kedua naik kuda, ketiga kapal, kamu memiliki cara apa?",},
        [1732] = {20186402,"Huang Yueying","Zhuge Liang","Ini… biarkan aku berpikir dulu.","Ini… biarkan aku berpikir dulu.",},
        [1733] = {20186403,"Huang Yueying","Zhuge Liang","Terima kasih atas pertanyaan Yue Ying, membuatku menciptakan Sapi & Kuda kayu, dan menyelesaikan permasalahan logistik persediaan.","Terima kasih atas pertanyaan Yue Ying, membuatku menciptakan Sapi & Kuda kayu, dan menyelesaikan permasalahan logistik persediaan.",},
        [1734] = {20186403,"Zhuge Liang","Huang Yueying","Aku tersanjung. Aku akan sangat senang jika dapat membantumu.","Aku tersanjung. Aku akan sangat senang jika dapat membantumu.",},
        [1735] = {20186403,"Zhuge Liang","Huang Yueying","Akan kuberikan kipas bulu padamu, dapat membantu untuk menaklukkan kota-kota dan mengamankan negara.","Akan kuberikan kipas bulu padamu, dapat membantu untuk menaklukkan kota-kota dan mengamankan negara.",},
        [1736] = {20186501,"","Pan Zhang","Zhang Liao menyerang kamp militer kami, kalian tidak menyerang kedepan, tetapi malah mundur kabur, benar-benar keterlaluan!","Zhang Liao menyerang kamp militer kami, kalian tidak menyerang kedepan, tetapi malah mundur kabur, benar-benar keterlaluan!",},
        [1737] = {20186501,"","Pan Zhang","Dua pembelot itu telah kubunuh, yang tidak ingin mati, pergi bersamaku!","Dua pembelot itu telah kubunuh, yang tidak ingin mati, pergi bersamaku!",},
        [1738] = {20186501,"Pan Zhang","Sun Quan","Pan Zhang sangat berani, aku mengangkatmu menjadi Asisten Jenderal, memipin seratus pasukan dan berdiam di Banzhou.","Pan Zhang sangat berani, aku mengangkatmu menjadi Asisten Jenderal, memipin seratus pasukan dan berdiam di Banzhou.",},
        [1739] = {20186502,"Pan Zhang","Guan Yu","Siapa kamu? Pasukan kecil biasa, beraninya memotong jalan belakangku? Cepat minggir dan akan kuampuni kamu.","Siapa kamu? Pasukan kecil biasa, beraninya memotong jalan belakangku? Cepat minggir dan akan kuampuni kamu.",},
        [1740] = {20186502,"Guan Yu","Pan Zhang","Tentu saja, itu adalah Guan Yunchang, yang tidak ada siapa pun di matanya. Kamu terlalu meremehkan kekuatan Dongwu.","Tentu saja, itu adalah Guan Yunchang, yang tidak ada siapa pun di matanya. Kamu terlalu meremehkan kekuatan Dongwu.",},
        [1741] = {20186502,"Pan Zhang","Guan Yu","Jika aku tidak terdampar dari perang, bagaimana aku akan berakhir seperti ini? Dan kamu tidak akan dapat berbicara dengan saya.","Jika aku tidak terdampar dari perang, bagaimana aku akan berakhir seperti ini? Dan kamu tidak akan dapat berbicara dengan saya.",},
        [1742] = {20186502,"Guan Yu","Pan Zhang","Sudah cukup, rasakan kehebatan jebakan kami!","Sudah cukup, rasakan kehebatan jebakan kami!",},
        [1743] = {20186601,"Sun Quan","Sun Ce","Dalam membangun dunia kamu tidak sebaik aku, tetapi dalam menjaga perkara aku tidak sebaik kamu.","Dalam membangun dunia kamu tidak sebaik aku, tetapi dalam menjaga perkara aku tidak sebaik kamu.",},
        [1744] = {20186601,"Sun Ce","Sun Quan","Dengan kakak, bagaimana mungkin tujuan besar tidak bisa tercapai? Aku pasti akan membantu kakakku.","Dengan kakak, bagaimana mungkin tujuan besar tidak bisa tercapai? Aku pasti akan membantu kakakku.",},
        [1745] = {20186601,"Sun Quan","Sun Ce","Kamu sangat pintar sejak kecil, selanjutnya pejabat-pejabat itu akan menjadi milikmu.","Kamu sangat pintar sejak kecil, selanjutnya pejabat-pejabat itu akan menjadi milikmu.",},
        [1746] = {20186602,"Zhuge Liang","Zhang Zhao","Tuanku merasa idemu yang mengatakan Sun bergabung dengan Liu melawan Cao sangat baik. Kita sangat setuju dan juga menunjukkan rasa hormat sepenuhnya pada tuan.","Tuanku merasa idemu yang mengatakan Sun bergabung dengan Liu melawan Cao sangat baik. Kita sangat setuju dan juga menunjukkan rasa hormat sepenuhnya pada tuan.",},
        [1747] = {20186602,"Zhuge Liang","Zhang Zhao","Tidak tahu bisakah tuan tinggal di Jiangdong dan memulai tujuan besar bersama?","Tidak tahu bisakah tuan tinggal di Jiangdong dan memulai tujuan besar bersama?",},
        [1748] = {20186602,"Zhang Zhao","Zhuge Liang","Jenderal Sun bisa disebut sebagai legenda hidup, dilihat dari kemampuannya, dia akan memperlakukanku dengan baik tetapi dia tidak mempercayai kemampuanku, karena itu aku tidak akan tinggal di Jiangdong.","Jenderal Sun bisa disebut sebagai legenda hidup, dilihat dari kemampuannya, dia akan memperlakukanku dengan baik tetapi dia tidak mempercayai kemampuanku, karena itu aku tidak akan tinggal di Jiangdong.",},
        [1749] = {20186603,"Sun Quan","Zhuge Liang","Jika kekuatan militer negaramu cukup untuk melawan Pasukan Cao, kamu harus memutuskan hubungan diplomasi dengan Pasukan Cao lebih awal. Jika tidak bisa bersaing, sebaiknya kamu menyerah padanya.","Jika kekuatan militer negaramu cukup untuk melawan Pasukan Cao, kamu harus memutuskan hubungan diplomasi dengan Pasukan Cao lebih awal. Jika tidak bisa bersaing, sebaiknya kamu menyerah padanya.",},
        [1750] = {20186603,"Zhuge Liang","Sun Quan","Liu Bei mengapa tidak menyerah pada Cao Cao?","Liu Bei mengapa tidak menyerah pada Cao Cao?",},
        [1751] = {20186603,"Sun Quan","Zhuge Liang","Tuanku Liu Bei adalah keturunan Dinasti Han, banyak orang yang mengaguminya dan bergabung dengan kami, bagaimana mungkin kami menyerah?","Tuanku Liu Bei adalah keturunan Dinasti Han, banyak orang yang mengaguminya dan bergabung dengan kami, bagaimana mungkin kami menyerah?",},
        [1752] = {20186603,"Zhuge Liang","Sun Quan","Aku memiliki Jiangdong yang berwilayah besar ini dan seratus ribu pasukan elit, bagaimana mungkin menjadi boneka orang lain? Lakukan saja!","Aku memiliki Jiangdong yang berwilayah besar ini dan seratus ribu pasukan elit, bagaimana mungkin menjadi boneka orang lain? Lakukan saja!",},
        [1753] = {20186701,"Yan Liang","Wen Chou","Mereka selalu menyebutkan dua nama kami bersama, tetapi tidak ada yang tahu kami berdua siapakah yang lebih hebat.","Mereka selalu menyebutkan dua nama kami bersama, tetapi tidak ada yang tahu kami berdua siapakah yang lebih hebat.",},
        [1754] = {20186701,"Wen Chou","Yan Liang","Aku telah mengalahkan Xu Huang!","Aku telah mengalahkan Xu Huang!",},
        [1755] = {20186701,"Yan Liang","Wen Chou","Aku telah menembak Zhang Liao! Juga berimbang dengan Zhao Yun!","Aku telah menembak Zhang Liao! Juga berimbang dengan Zhao Yun!",},
        [1756] = {20186701,"Wen Chou","Yan Liang","Lebih baik kamu dan aku bertarung!","Lebih baik kamu dan aku bertarung!",},
        [1757] = {20186702,"Yuan Shao","Ju Shou","Tuan, Yan Liang ahli bertempur tapi mudah marah, tidak bisa dibiarkan untuk bertarung sendiri.","Tuan, Yan Liang ahli bertempur tapi mudah marah, tidak bisa dibiarkan untuk bertarung sendiri.",},
        [1758] = {20186702,"Ju Shou","Yuan Shao","Apa yang kalian tahu? Yan Liang adalah jenderal kelas satu, kekuatannya tidak bisa kalian bayangkan.","Apa yang kalian tahu? Yan Liang adalah jenderal kelas satu, kekuatannya tidak bisa kalian bayangkan.",},
        [1759] = {20186703,"Yan Liang","Liu Bei","Adik kedua, Guan Yunchang, tinggi sembilan kaki lima inci dan janggut dengan panjang hampir dua kaki. Dia suka memakai brokat hijau, menunggangi kuda perang kuning dan membawa Pedang Naga, Jika melihatnya, beritahu dia untuk bergabung denganku.","Adik kedua, Guan Yunchang, tinggi sembilan kaki lima inci dan janggut dengan panjang hampir dua kaki. Dia suka memakai brokat hijau, menunggangi kuda perang kuning dan membawa Pedang Naga, Jika melihatnya, beritahu dia untuk bergabung denganku.",},
        [1760] = {20186703,"Liu Bei","Yan Liang","Oh? Kalau begini, aku akan menemui orang ini.","Oh? Kalau begini, aku akan menemui orang ini.",},
        [1761] = {20186801,"Wang Yi","Zhao Ang","Ma Chao meningkatkan penyerangan, sekarang di dalam kota kekurangan ransum, situasi sangat kritis. Sekretariat Wei kang berencana untuk menyerah pada Ma Chao. Aku membujuknya agar tidak melakukannya, tetapi dia tidak mendengarkanku.","Ma Chao meningkatkan penyerangan, sekarang di dalam kota kekurangan ransum, situasi sangat kritis. Sekretariat Wei kang berencana untuk menyerah pada Ma Chao. Aku membujuknya agar tidak melakukannya, tetapi dia tidak mendengarkanku.",},
        [1762] = {20186801,"Zhao Ang","Wang Yi","Siapa yang bilang bahwa penyelamat Zhongyuan tidak dapat datang tepat waktu? Kita harus mendorong prajurit untuk melayani negara dengan sepenuh hati dan jiwa dan tidak mendengar pemberontak.","Siapa yang bilang bahwa penyelamat Zhongyuan tidak dapat datang tepat waktu? Kita harus mendorong prajurit untuk melayani negara dengan sepenuh hati dan jiwa dan tidak mendengar pemberontak.",},
        [1763] = {20186802,"Wang Yi","Zhao Ang","Ma Chao menguasai wilayah kami dan membunuh We Kang karena kata-katanya. Aku harus membalaskan dendam!","Ma Chao menguasai wilayah kami dan membunuh We Kang karena kata-katanya. Aku harus membalaskan dendam!",},
        [1764] = {20186802,"Wang Yi","Zhao Ang","Tetapi sekarang Zhao Yue telah disandera olehnya. Jika kita bertindak secara tergesa-gesa, dia pasti akan menyakiti Zhao Yue. Apa yang harus kita lakukan?","Tetapi sekarang Zhao Yue telah disandera olehnya. Jika kita bertindak secara tergesa-gesa, dia pasti akan menyakiti Zhao Yue. Apa yang harus kita lakukan?",},
        [1765] = {20186802,"Zhao Ang","Wang Yi","Kesetiaan adalah pondasi kehidupan, kami ingin membalaskan dendam raja dan tidak akan ragu untuk mengorbankan hidup, apalagi seorang putra?","Kesetiaan adalah pondasi kehidupan, kami ingin membalaskan dendam raja dan tidak akan ragu untuk mengorbankan hidup, apalagi seorang putra?",},
        [1766] = {20186802,"Wang Yi","Zhao Ang","Istriku adalah pahlawan negara!","Istriku adalah pahlawan negara!",},
        [1767] = {20186901,"Liu Bei","Guan Ding","Ini adalah putra keduaku, Guan Ping, Sejak kecil berlatih beladiri, sekarang aku menginginkannya untuk ikut dengan jenderal, tidak tahu apakah jenderal bersedia?","Ini adalah putra keduaku, Guan Ping, Sejak kecil berlatih beladiri, sekarang aku menginginkannya untuk ikut dengan jenderal, tidak tahu apakah jenderal bersedia?",},
        [1768] = {20186901,"Guan Ding","Liu Bei","Tahun ini umur berapa?","Tahun ini umur berapa?",},
        [1769] = {20186901,"Liu Bei","Guan Ding","Delapan belas tahun.","Delapan belas tahun.",},
        [1770] = {20186901,"Guan Ding","Liu Bei","Dengan kebaikan dan anugerahmu, adikku yang saat ini belum memiliki putra, akan mengangkatmu sebagai putra angkat, bagaimana?","Dengan kebaikan dan anugerahmu, adikku yang saat ini belum memiliki putra, akan mengangkatmu sebagai putra angkat, bagaimana?",},
        [1771] = {20186901,"Guan Ping","Guan Ding","Guan Ping, datang dan temui ayahmu dan pamanmu.","Guan Ping, datang dan temui ayahmu dan pamanmu.",},
        [1772] = {20186902,"Guan Ping","Guan Yu","Anakku, dengarkan baik-baik, kekuatan dan keberanian seseorang itu tidak cukup. Kita harus mengerti bagaimana menggunakan hikmat dan strategi untuk mencapai tujuan yang lebih besar.","Anakku, dengarkan baik-baik, kekuatan dan keberanian seseorang itu tidak cukup. Kita harus mengerti bagaimana menggunakan hikmat dan strategi untuk mencapai tujuan yang lebih besar.",},
        [1773] = {20186902,"Guan Yu","Guan Ping","Perkataan ayah benar, jadi ayah jangan membunuh utusan Zhuge Jin dari Wu dengan tergesa-gesa!","Perkataan ayah benar, jadi ayah jangan membunuh utusan Zhuge Jin dari Wu dengan tergesa-gesa!",},
        [1774] = {20186902,"Guan Ping","Guan Yu","Putraku benar, untuk kebaikan Kongming, aku tidak akan membunuhnya, tenanglah saja.","Putraku benar, untuk kebaikan Kongming, aku tidak akan membunuhnya, tenanglah saja.",},
        [1775] = {20187001,"Meng Huo","Zhuge Liang","Almarhum kaisar memperlakukanmu dengan baik, mengapa kamu memberontak?","Almarhum kaisar memperlakukanmu dengan baik, mengapa kamu memberontak?",},
        [1776] = {20187001,"Zhuge Liang","Meng Huo","Di tanah dengan dua sungai, kita telah hidup disini selama beberapa generasi. Tetapi kamu merusak wilayah kami dan menyalahkanku karena pemberontakan? Siapa yang memulainya?","Di tanah dengan dua sungai, kita telah hidup disini selama beberapa generasi. Tetapi kamu merusak wilayah kami dan menyalahkanku karena pemberontakan? Siapa yang memulainya?",},
        [1777] = {20187001,"Meng Huo","Zhuge Liang","Tapi sekarang kamu telah kutangkap, menyerah atau tidak?","Tapi sekarang kamu telah kutangkap, menyerah atau tidak?",},
        [1778] = {20187001,"Zhuge Liang","Meng Huo","Jalan gunung sempit dan aku tidak sengaja jatuh dalam perangkapmu. Bagaimana aku bisa menerimanya?","Jalan gunung sempit dan aku tidak sengaja jatuh dalam perangkapmu. Bagaimana aku bisa menerimanya?",},
        [1779] = {20187001,"Meng Huo","Zhuge Liang","Jika kamu tidak menerimanya, aku akan membiarkanmu pergi, bagaimana?","Jika kamu tidak menerimanya, aku akan membiarkanmu pergi, bagaimana?",},
        [1780] = {20187001,"Zhuge Liang","Meng Huo","Jika kamu membiarkanku pergi, aku akan mengumpulkan tentara dan lihat siapa yang lebih hebat; Jika kamu menangkapku lagi, aku akan menerimanya.","Jika kamu membiarkanku pergi, aku akan mengumpulkan tentara dan lihat siapa yang lebih hebat; Jika kamu menangkapku lagi, aku akan menerimanya.",},
        [1781] = {20187002,"Zhuge Liang","Meng Huo","Zhuge Liang, ada apa denganmu? Kamu tidak bisa menangkap nyonyaku.","Zhuge Liang, ada apa denganmu? Kamu tidak bisa menangkap nyonyaku.",},
        [1782] = {20187002,"Meng Huo","Zhuge Liang","Jangan marah, aku hanya ingin menukarkan nyonyamu dengan Zhang Ni dan Ma Zhong.","Jangan marah, aku hanya ingin menukarkan nyonyamu dengan Zhang Ni dan Ma Zhong.",},
        [1783] = {20187002,"Zhuge Liang","Meng Huo","Humph, tukar denganmu!","Humph, tukar denganmu!",},
        [1784] = {20187002,"Meng Huo","Zhu Rong","Bisa atau tidak? Kamu telah ditangkap enak kal dan sekarang tertangkap lagi olehku. Benar-benar!","Bisa atau tidak? Kamu telah ditangkap enak kal dan sekarang tertangkap lagi olehku. Benar-benar!",},
        [1785] = {20187003,"Meng Huo","Zhuge Liang","Kembalilah dan panggil lagi beberapa prajurit, kita akan bertarung lagi.","Kembalilah dan panggil lagi beberapa prajurit, kita akan bertarung lagi.",},
        [1786] = {20187003,"Zhuge Liang","Meng Huo","Huhuhu… Tangkap & lepas 7 kali, tidak pernah terjadi dalam sejarah. Meskipun aku berasal dari daerah yang tidak maju, aku juga tahu etika dan kejujuran, menurutmu aku tidak tahu malu?","Huhuhu… Tangkap & lepas 7 kali, tidak pernah terjadi dalam sejarah. Meskipun aku berasal dari daerah yang tidak maju, aku juga tahu etika dan kejujuran, menurutmu aku tidak tahu malu?",},
        [1787] = {20187003,"Meng Huo","Zhu Rong","Jangan menangis, benar-benar memalukan.","Jangan menangis, benar-benar memalukan.",},
        [1788] = {20187003,"Meng Huo","Zhuge Liang","Sekarang kamu sudah menerimanya?","Sekarang kamu sudah menerimanya?",},
        [1789] = {20187003,"Zhuge Liang","Meng Huo","Anak dan cucuku semuanya berterima kasih atas rahmatmu, bagaimana aku bisa tidak menerima? Huhuhu…","Anak dan cucuku semuanya berterima kasih atas rahmatmu, bagaimana aku bisa tidak menerima? Huhuhu…",},
        [1790] = {20187101,"Kaisar Xian Han","Cao Cao","Meskipun Dong Zhuo telah membantu Kaisar untuk mendapatkan tahta, dia sendiri telah melakukan banyak kejahatan. Dong Zhuo telah mati, aku akan membantu Kaisar dengan baik.","Meskipun Dong Zhuo telah membantu Kaisar untuk mendapatkan tahta, dia sendiri telah melakukan banyak kejahatan. Dong Zhuo telah mati, aku akan membantu Kaisar dengan baik.",},
        [1791] = {20187101,"Kaisar Xian Han","Cao Cao","Akan kunikahkan putriku denganmu dan menjadi ibu suri, bagaimana?","Akan kunikahkan putriku denganmu dan menjadi ibu suri, bagaimana?",},
        [1792] = {20187101,"Cao Cao","Kaisar Xian Han","Yang dikatakan Perdana Menteri sangat bagus.","Yang dikatakan Perdana Menteri sangat bagus.",},
        [1793] = {20187102,"Liu Bei","Kaisar Xian Han","Siapakah leluhurmu?","Siapakah leluhurmu?",},
        [1794] = {20187102,"Kaisar Xian Han","Liu Bei","Aku adalah keturunan Pangeran Jing dari Zhongshan, cicit dari Kaisar Xiaojing, cucu dari Liu Xiong, dan putra Liu Hong.","Aku adalah keturunan Pangeran Jing dari Zhongshan, cicit dari Kaisar Xiaojing, cucu dari Liu Xiong, dan putra Liu Hong.",},
        [1795] = {20187102,"Liu Bei","Kaisar Xian Han","Dilihat dari garis keturunan, ah, Xuande seharusnya adalah pamanku.","Dilihat dari garis keturunan, ah, Xuande seharusnya adalah pamanku.",},
        [1796] = {20187102,"Liu Bei","Kaisar Xian Han","Cao Cao memanipulasi kekuasaan, dan aku tidak memiliki kuasa atas negara. Hari ini dengan adanya Paman Kerajaan, pasti bisa membantuku!","Cao Cao memanipulasi kekuasaan, dan aku tidak memiliki kuasa atas negara. Hari ini dengan adanya Paman Kerajaan, pasti bisa membantuku!",},
        [1797] = {20187103,"","Kaisar Xian Han","Sejak aku menduduki tahta, bandit-bandit muncul bersama. Awalnya ada Dong Zhuo, lalu ada Li Jue dan Guo Si. Lalu muncullah Cao Cao, kukira dia adalah menteri yang loyal terhadap negara; Tidak disangka dia memanipulasi kekuasaan dan tindakan atas namaku.","Sejak aku menduduki tahta, bandit-bandit muncul bersama. Awalnya ada Dong Zhuo, lalu ada Li Jue dan Guo Si. Lalu muncullah Cao Cao, kukira dia adalah menteri yang loyal terhadap negara; Tidak disangka dia memanipulasi kekuasaan dan tindakan atas namaku.",},
        [1798] = {20187103,"","Kaisar Xian Han","Setiap kali aku melihatnya, punggungku terasa sakit. Banyak menteri hanya mengambil keuntungan dari negara, tidak adakah seorangpun yang bisa menyelamatkan negara dari bahaya?","Setiap kali aku melihatnya, punggungku terasa sakit. Banyak menteri hanya mengambil keuntungan dari negara, tidak adakah seorangpun yang bisa menyelamatkan negara dari bahaya?",},
        [1799] = {20187103,"","Kaisar Xian Han","Aku menulis surat darah, menyembunyikannya dalam sabuk giok, dan menyerahkan ke Dong Cheng, berharap dia dapat memanggil petarung yang adil untuk membersihkan pengkhianat dan mengembalikan tahtaku!","Aku menulis surat darah, menyembunyikannya dalam sabuk giok, dan menyerahkan ke Dong Cheng, berharap dia dapat memanggil petarung yang adil untuk membersihkan pengkhianat dan mengembalikan tahtaku!",},
        [1800] = {20187201,"Sun Jian","Han Dang","Angin besar meniup jatuh bendera jenderal, ini bukan pertanda baik, sebaiknya kita mundur dulu!","Angin besar meniup jatuh bendera jenderal, ini bukan pertanda baik, sebaiknya kita mundur dulu!",},
        [1801] = {20187201,"Han Dang","Sun Jian","Aku selalu menang dalam segala peperangan. Penangkapan Xiangyang hanya berjarak beberapa hari saja; bagaimana bisa mundur hanya karena bendera rusak terhembus angin!","Aku selalu menang dalam segala peperangan. Penangkapan Xiangyang hanya berjarak beberapa hari saja; bagaimana bisa mundur hanya karena bendera rusak terhembus angin!",},
        [1802] = {20187201,"Sun Jian","Han Dang","Tetapi selalu ada saja firasat buruk, tetaplah berhati-hati!","Tetapi selalu ada saja firasat buruk, tetaplah berhati-hati!",},
        [1803] = {20187202,"Han Dang","Sun Ce","Terima kasih Han Dang, Jiangdong bisa memiliki tanah seluas ini, semuanya karena Han Dang membantuku memenangkan banyak peperangan, dan membuat prestasi besar!","Terima kasih Han Dang, Jiangdong bisa memiliki tanah seluas ini, semuanya karena Han Dang membantuku memenangkan banyak peperangan, dan membuat prestasi besar!",},
        [1804] = {20187202,"Sun Ce","Han Dang","Pada saat itu aku mengikut Jenderal Sun Jian pergi menguasai utara dan selatan. Sekarang aku akan tetap membantunya untuk memperluas tujuan besar Kerajaan Wu!","Pada saat itu aku mengikut Jenderal Sun Jian pergi menguasai utara dan selatan. Sekarang aku akan tetap membantunya untuk memperluas tujuan besar Kerajaan Wu!",},
        [1805] = {20187203,"","Han Dang","Dengar-dengar ada orang yang menanyakan siapa yang lebih hebat, Zhou Tai, Lu Meng atau aku?","Dengar-dengar ada orang yang menanyakan siapa yang lebih hebat, Zhou Tai, Lu Meng atau aku?",},
        [1806] = {20187203,"","Han Dang","Dalam militer, Zhou Tai lebih baik; dalam pengetahuan, Lu Meng yang lebih baik.","Dalam militer, Zhou Tai lebih baik; dalam pengetahuan, Lu Meng yang lebih baik.",},
        [1807] = {20187203,"","Han Dang","Dalam pengalaman, tentunya aku yang paling hebat!","Dalam pengalaman, tentunya aku yang paling hebat!",},
        [1808] = {20187301,"Zhang Chunhua","Cao Pi","Akan kuberikan Bai Lingyun pada Sima Yi untuk dijadikan istri. Semoga kalian tidak mengecewakanku.","Akan kuberikan Bai Lingyun pada Sima Yi untuk dijadikan istri. Semoga kalian tidak mengecewakanku.",},
        [1809] = {20187301,"Sima Yi","Zhang Chunhua","Siapa yang tidak tahu? Sudah jelas dia adalah mata-mata yang dikirim Cao Pi untuk mengawasi keluarga ini. Bagaimana bisa menerima dengan mudah?","Siapa yang tidak tahu? Sudah jelas dia adalah mata-mata yang dikirim Cao Pi untuk mengawasi keluarga ini. Bagaimana bisa menerima dengan mudah?",},
        [1810] = {20187301,"Zhang Chunhua","Sima Yi","Perkataanmu benar. Aku tidak menerimanya, aku ingin melawan, biarkan Kaisar menghukum mati aku.","Perkataanmu benar. Aku tidak menerimanya, aku ingin melawan, biarkan Kaisar menghukum mati aku.",},
        [1811] = {20187301,"Sima Yi","Zhang Chunhua","Aku benar-benar marah padamu! Kamu telah mengalahkanku! Biarkan dia datang!","Aku benar-benar marah padamu! Kamu telah mengalahkanku! Biarkan dia datang!",},
        [1812] = {20187302,"Zhang Chunhua","Sima Yi","Istriku melahirkan tiga putra dan satu putri untukku. Sungguh berterima kasih pada istriku.","Istriku melahirkan tiga putra dan satu putri untukku. Sungguh berterima kasih pada istriku.",},
        [1813] = {20187302,"Sima Yi","Zhang Chunhua","Kamu juga tidak baik padaku, yang aku inginkan adalah anak yang berbakti.","Kamu juga tidak baik padaku, yang aku inginkan adalah anak yang berbakti.",},
        [1814] = {20187302,"Zhang Chunhua","Sima Yi","Itu tidak benar. Kamu adalah seorang pahlawan wanita dengan julukan Permaisuri Muda, bagaimana mungkin aku berani memperlakukanmu dengan buruk?","Itu tidak benar. Kamu adalah seorang pahlawan wanita dengan julukan Permaisuri Muda, bagaimana mungkin aku berani memperlakukanmu dengan buruk?",},
        [1815] = {20187302,"Sima Yi","Zhang Chunhua","Humph, baguslah jika tidak berani!","Humph, baguslah jika tidak berani!",},
        [1816] = {20187303,"Zhang Chunhua","Sima Yi","Jangan melewatkan makananmu meskipun kamu sedang marah. Ini tidak sehat. Anak-anak juga ikut tidak makan, sangat tidak baik. Aku akan minta maaf, tolong ampuni aku, nyonya.","Jangan melewatkan makananmu meskipun kamu sedang marah. Ini tidak sehat. Anak-anak juga ikut tidak makan, sangat tidak baik. Aku akan minta maaf, tolong ampuni aku, nyonya.",},
        [1817] = {20187303,"Sima Yi","Zhang Chunhua","Baiklah, aku makan dulu lalu memarahimu lagi.","Baiklah, aku makan dulu lalu memarahimu lagi.",},
        [1818] = {20187303,"Zhang Chunhua","Sima Yi","… Aku sebenarnya tidak takut istri, melainkan takut kedua anakku kelaparan~","… Aku sebenarnya tidak takut istri, melainkan takut kedua anakku kelaparan~",},
        [1819] = {20187401,"Lu Meng","Gan Ning","Sun Jiao bertengkar denganku karena masalah kecil, aku tidak ingin melihatnya. Aku ingin mengikutmu~","Sun Jiao bertengkar denganku karena masalah kecil, aku tidak ingin melihatnya. Aku ingin mengikutmu~",},
        [1820] = {20187401,"Gan Ning","Lu Meng","Tidak sampai seperti ini. Kalau tidak kamu mengalah saja untuknya, bagaimanapun dia adalah sepupu Tuan.","Tidak sampai seperti ini. Kalau tidak kamu mengalah saja untuknya, bagaimanapun dia adalah sepupu Tuan.",},
        [1821] = {20187401,"Lu Meng","Gan Ning","Sepupu Tuan tidak bisa menghina seenak hati. Aku akan membalaskan tuanku dengan sepenuh tenaga, tetapi bukan berarti aku bisa menyerah pada orang yang salah.","Sepupu Tuan tidak bisa menghina seenak hati. Aku akan membalaskan tuanku dengan sepenuh tenaga, tetapi bukan berarti aku bisa menyerah pada orang yang salah.",},
        [1822] = {20187401,"Gan Ning","Lu Meng","Kamu, benar-benar orang keras kepala.","Kamu, benar-benar orang keras kepala.",},
        [1823] = {20187402,"Lu Meng","Sun Quan","Sekarang kamu berada di posisi penting dan memegang hak khusus, kamu harus belajar.","Sekarang kamu berada di posisi penting dan memegang hak khusus, kamu harus belajar.",},
        [1824] = {20187402,"Sun Quan","Lu Meng","Ada begitu banyak urusan dalam militer sehingga aku tidak memiliki waktu.","Ada begitu banyak urusan dalam militer sehingga aku tidak memiliki waktu.",},
        [1825] = {20187402,"Lu Meng","Sun Quan","Aku juga tidak menginginkanmu menjadi ahli atau sarjana, kamu hanya butuh membaca secara luas dan mengerti kejadian di masa lalu.","Aku juga tidak menginginkanmu menjadi ahli atau sarjana, kamu hanya butuh membaca secara luas dan mengerti kejadian di masa lalu.",},
        [1826] = {20187402,"Lu Meng","Sun Quan","Kamu bilang sangat sibuk, apakah sesibuk aku? Aku sering membaca buku dan banyak mendapatkan ilmu.","Kamu bilang sangat sibuk, apakah sesibuk aku? Aku sering membaca buku dan banyak mendapatkan ilmu.",},
        [1827] = {20187402,"Sun Quan","Lu Meng","Baik, aku akan termotivasi untuk belajar dengan rajin!","Baik, aku akan termotivasi untuk belajar dengan rajin!",},
        [1828] = {20187403,"Lu Su","Lu Meng","Kamu mendapatkan tugas berat, bertarung dengan Guan Yu. Cara apa yang akan kamu gunakan, untuk mencegah hal yang tidak diduga terjadi?","Kamu mendapatkan tugas berat, bertarung dengan Guan Yu. Cara apa yang akan kamu gunakan, untuk mencegah hal yang tidak diduga terjadi?",},
        [1829] = {20187403,"Lu Meng","Lu Su","Ini… sementara ini tergantung pada kondisi sebenarnya.","Ini… sementara ini tergantung pada kondisi sebenarnya.",},
        [1830] = {20187403,"Lu Su","Lu Meng","Meskipun sekarang Sun dan Liu bersatu, tetapi Guan Yu adalah jenderal yang ganas, harus mencegahnya. Bagaimana bisa kita tidak membuat rencana dari awal?","Meskipun sekarang Sun dan Liu bersatu, tetapi Guan Yu adalah jenderal yang ganas, harus mencegahnya. Bagaimana bisa kita tidak membuat rencana dari awal?",},
        [1831] = {20187403,"Lu Meng","Lu Su","Lu Ziming, aku tidak menyangkan bahwa kecerdasanmu bisa sampai tingkat seperti ini. Dengan kemampuan seperti ini, aku tidak merasa kamu adalah orang bodoh lagi! ","Lu Ziming, aku tidak menyangkan bahwa kecerdasanmu bisa sampai tingkat seperti ini. Dengan kemampuan seperti ini, aku tidak merasa kamu adalah orang bodoh lagi! ",},
        [1832] = {20187403,"Lu Su","Lu Meng","Keadaan bisa berubah drastis dalam tiga hari. Sekarang sudah terlambat untuk kamu menyadarinya!","Keadaan bisa berubah drastis dalam tiga hari. Sekarang sudah terlambat untuk kamu menyadarinya!",},
        [1833] = {20187501,"Pang De","Ma Chao","Disini ada ratusan kuda baik yang bisa kamu pilih. Mengapa kamu memilih kuda kuning yang kurus dan jelek ini?","Disini ada ratusan kuda baik yang bisa kamu pilih. Mengapa kamu memilih kuda kuning yang kurus dan jelek ini?",},
        [1834] = {20187501,"Ma Chao","Pang De","Meskipun dia jelek, tetapi dalam kecepatan, kuda-kuda yang bagus tidak bisa menandinginya. Kita membicarakan tentang kekuatan!","Meskipun dia jelek, tetapi dalam kecepatan, kuda-kuda yang bagus tidak bisa menandinginya. Kita membicarakan tentang kekuatan!",},
        [1835] = {20187501,"Pang De","Ma Chao","Pang De benar-benar mengerti kuda.","Pang De benar-benar mengerti kuda.",},
        [1836] = {20187502,"Jia Xu","Cao Cao","Jenderal lawan Pang De sungguh merupakan jenderal berani Xiliang, jika bisa kugunakan, maka pasti akan membantuku untuk mencapai sukses besar!","Jenderal lawan Pang De sungguh merupakan jenderal berani Xiliang, jika bisa kugunakan, maka pasti akan membantuku untuk mencapai sukses besar!",},
        [1837] = {20187502,"Cao Cao","Jia Xu","Aku ada ide, dengarkan aku.","Aku ada ide, dengarkan aku.",},
        [1838] = {20187502,"Pang De","Cao Cao","Jenderal Pang De, biarkan aku yang melepaskan ikatanmu. Pemimpinmu Zhang Lu berkata dia kaan mengeksekusimu jika kamu tidak menang hari ini, dan sekarang kamu tertangkap olehku.","Jenderal Pang De, biarkan aku yang melepaskan ikatanmu. Pemimpinmu Zhang Lu berkata dia kaan mengeksekusimu jika kamu tidak menang hari ini, dan sekarang kamu tertangkap olehku.",},
        [1839] = {20187502,"Pang De","Cao Cao","Kamu akan mati meskipun aku melepaskanmu, sebaiknya ikut aku, membantuku untuk mencapai tujuan besar, bagaimana?","Kamu akan mati meskipun aku melepaskanmu, sebaiknya ikut aku, membantuku untuk mencapai tujuan besar, bagaimana?",},
        [1840] = {20187502,"Cao Cao","Pang De","Jangan salahkan aku atas perbuatan mereka sebelumnya! Baik, aku menyerah! Aku bersedia mendengar perintahmu.","Jangan salahkan aku atas perbuatan mereka sebelumnya! Baik, aku menyerah! Aku bersedia mendengar perintahmu.",},
        [1841] = {20187503,"Pang De","Guan Yu","Kakakmu di Hanzhong, kami ingin mengangkatmu menjadi jenderal jika menyerah pada kami.","Kakakmu di Hanzhong, kami ingin mengangkatmu menjadi jenderal jika menyerah pada kami.",},
        [1842] = {20187503,"Guan Yu","Pang De","Humph, Raja Wei memiliki jutaan pasukan. Tentaranya tak terkalahkan dan menakutkan. Liu Bei tidak akan bisa menandingi kami!","Humph, Raja Wei memiliki jutaan pasukan. Tentaranya tak terkalahkan dan menakutkan. Liu Bei tidak akan bisa menandingi kami!",},
        [1843] = {20187503,"Guan Yu","Pang De","Kalau mau bunuh, bunuh saja. Lebih baik aku menjadi hantu daripada menjadi jenderal bandit!","Kalau mau bunuh, bunuh saja. Lebih baik aku menjadi hantu daripada menjadi jenderal bandit!",},
        [1844] = {20187601,"Guan Yinping","Zhang Xingcai","Kakak Yinping, dengar-dengar namamu adalah pemberian dari ayahku!","Kakak Yinping, dengar-dengar namamu adalah pemberian dari ayahku!",},
        [1845] = {20187601,"Zhang Xingcai","Guan Yinping","Ya, paman ketiga juga memberikanku harta yang telah disimpan bertahun-tahun, kabarnya adalah Mahkota Emas Ungu yang diambil dari Lu Bu.","Ya, paman ketiga juga memberikanku harta yang telah disimpan bertahun-tahun, kabarnya adalah Mahkota Emas Ungu yang diambil dari Lu Bu.",},
        [1846] = {20187601,"Guan Yinping","Zhang Xingcai","Kabarnya bisa membawa keberuntungan! Ayah tidak memberikannya padaku, tidak adil.","Kabarnya bisa membawa keberuntungan! Ayah tidak memberikannya padaku, tidak adil.",},
        [1847] = {20187602,"Zhuge Jin","Sun Quan","Dengar-dengar Jenderal Guan Yunchang memiliki seorang putri. Akan lebih baik jika Ziyu mewakilkan anaku Sun Deng untuk melamar Nona Sun dan menunjukkan ketulusan aliansi kami, bagaimana?","Dengar-dengar Jenderal Guan Yunchang memiliki seorang putri. Akan lebih baik jika Ziyu mewakilkan anaku Sun Deng untuk melamar Nona Sun dan menunjukkan ketulusan aliansi kami, bagaimana?",},
        [1848] = {20187602,"Sun Quan","Zhuge Jin","Sangat baik, jika Jenderal Guan tidak setuju… Kita akan bergabung dengan Cao Cao menyerang Jingzhou, menurut Tuan bagaimana?","Sangat baik, jika Jenderal Guan tidak setuju… Kita akan bergabung dengan Cao Cao menyerang Jingzhou, menurut Tuan bagaimana?",},
        [1849] = {20187603,"Guan Yu","Zhuge Jin","Tuanku melamar putranya Sun Deng dan nona jenderal. Bagaimana menurut jenderal?","Tuanku melamar putranya Sun Deng dan nona jenderal. Bagaimana menurut jenderal?",},
        [1850] = {20187603,"Zhuge Jin","Guan Yu","Humph, bagaimana bisa wanita macan menikahi anak macan?","Humph, bagaimana bisa wanita macan menikahi anak macan?",},
        [1851] = {20187701,"Guan Suo","Bao Sanniang","Terima kasih Hero telah membantuku mengusir orang jahat itu.","Terima kasih Hero telah membantuku mengusir orang jahat itu.",},
        [1852] = {20187701,"Bao Sanniang","Guan Suo","Sama-sama, hal kecil.","Sama-sama, hal kecil.",},
        [1853] = {20187701,"Guan Suo","Bao Sanniang","Aku bersedia untuk membalas budi dengan menikahimu.","Aku bersedia untuk membalas budi dengan menikahimu.",},
        [1854] = {20187702,"Guan Yu","Guan Suo","Ayah, aku telah mencarimu selama bertahun-tahun dan akhirnya menemukanmu!","Ayah, aku telah mencarimu selama bertahun-tahun dan akhirnya menemukanmu!",},
        [1855] = {20187702,"Guan Suo","Guan Yu","Selama bertahun-tahun kamu telah menderita.","Selama bertahun-tahun kamu telah menderita.",},
        [1856] = {20187702,"Guan Yu","Guan Suo","Aku bersedia mengikutimu, mengabdi untuk Shu Han!","Aku bersedia mengikutimu, mengabdi untuk Shu Han!",},
        [1857] = {20187703,"Zhuge Liang","Guan Suo","Aku bersedia meneruskan ayahku, melanjutkan pertarungan untuk Shu Han, menaklukkan dunia.","Aku bersedia meneruskan ayahku, melanjutkan pertarungan untuk Shu Han, menaklukkan dunia.",},
        [1858] = {20187703,"Zhuge Liang","Guan Suo","Perdana Menteri, aku dan istriku bersedia untuk mengikutimu menaklukkan Barbarian Selatan, melindungi Nanzhong.","Perdana Menteri, aku dan istriku bersedia untuk mengikutimu menaklukkan Barbarian Selatan, melindungi Nanzhong.",},
        [1859] = {20187703,"Guan Suo","Zhuge Liang","Anak pintar. Kamu terlihat seperti Jenderal Yuncahng. Memang merupakan berkat untuk Shu Han memiliki ayah dan anak ini.","Anak pintar. Kamu terlihat seperti Jenderal Yuncahng. Memang merupakan berkat untuk Shu Han memiliki ayah dan anak ini.",},
        [1860] = {20187801,"Sun Quan","Lu Xun","Hero saling beradu. Untuk mengalahkan lawan, kita membutuhkan banyak pasukan.","Hero saling beradu. Untuk mengalahkan lawan, kita membutuhkan banyak pasukan.",},
        [1861] = {20187801,"Lu Xun","Lu Xun","Sekarang masih ada bandit di dalam negeri, kita harus memperluas tentara dan memilih prajurit elit.","Sekarang masih ada bandit di dalam negeri, kita harus memperluas tentara dan memilih prajurit elit.",},
        [1862] = {20187801,"Lu Xun","Sun Quan","Masuk akal. Aku suka denganmu, memutuskan untuk menikahkan keponakanku denganmu.","Masuk akal. Aku suka denganmu, memutuskan untuk menikahkan keponakanku denganmu.",},
        [1863] = {20187802,"Lu Meng","Lu Xun","Guan Yu sangat bangga dengan kegagahan dan keberaniannya, jika dia mendengar kabar bahwa kamu sakit, pasti tidak akan waspada. Kita diskusi dengan baik.","Guan Yu sangat bangga dengan kegagahan dan keberaniannya, jika dia mendengar kabar bahwa kamu sakit, pasti tidak akan waspada. Kita diskusi dengan baik.",},
        [1864] = {20187802,"Lu Xun","Lu Meng","Semua tahu Guan Yu sangat berani, kamu jangan berpikir untuk melawannya.","Semua tahu Guan Yu sangat berani, kamu jangan berpikir untuk melawannya.",},
        [1865] = {20187802,"Lu Meng","Sun Quan","Waktunya untuk memilih seseorang untuk menggantikanmu, siapa orang yang ada dipikiranmu?","Waktunya untuk memilih seseorang untuk menggantikanmu, siapa orang yang ada dipikiranmu?",},
        [1866] = {20187802,"Lu Xun","Lu Meng","Lu Xun berpandangan jauh dan bisa memikul tanggung jawab berat. Saat ini dia masih belum memiliki nama, Guan Yu tidak terlalu berhati-hati dengannya. Dia adalah kandidat yang paling cocok.","Lu Xun berpandangan jauh dan bisa memikul tanggung jawab berat. Saat ini dia masih belum memiliki nama, Guan Yu tidak terlalu berhati-hati dengannya. Dia adalah kandidat yang paling cocok.",},
        [1867] = {20187802,"Lu Xun","Lu Meng","Jika ingin mengangkatnya, kamu harus menyembunyikannya dulu, agar dunia luar tidak tahu, lalu cari kesempatan baik untuk membuatnya bersinar.","Jika ingin mengangkatnya, kamu harus menyembunyikannya dulu, agar dunia luar tidak tahu, lalu cari kesempatan baik untuk membuatnya bersinar.",},
        [1868] = {20187901,"Sun Quan","Ibu Suri Wu","Aku tidak pernah bertemu dengan Paman Kerajaan Liu. Besok aku akan menemuinya di Kuil Ganlu. Jika aku setuju, aku akan menikahkan putriku dengannya. Jika tidak, terserah kalian mau diapakan.","Aku tidak pernah bertemu dengan Paman Kerajaan Liu. Besok aku akan menemuinya di Kuil Ganlu. Jika aku setuju, aku akan menikahkan putriku dengannya. Jika tidak, terserah kalian mau diapakan.",},
        [1869] = {20187901,"Ibu Suri Wu","Sun Quan","Aku telah mempersiapkan Pasukan Kapak, dan ini tergantung dari perilakumu.","Aku telah mempersiapkan Pasukan Kapak, dan ini tergantung dari perilakumu.",},
        [1870] = {20187902,"Sun Shangxiang","Ibu Suri Wu","Emm… Keluarga, penampilan dan kepribadiannya baik. Menurutku dia sangat baik, pernikahan ini menurutku sangat bagus.","Emm… Keluarga, penampilan dan kepribadiannya baik. Menurutku dia sangat baik, pernikahan ini menurutku sangat bagus.",},
        [1871] = {20187902,"Ibu Suri Wu","Sun Shangxiang","Semuanya keputusan di tanganmu.","Semuanya keputusan di tanganmu.",},
        [1872] = {20187902,"Sun Shangxiang","Ibu Suri Wu","Semoga Xuande dapat memperlakukan putriku dengan baik.","Semoga Xuande dapat memperlakukan putriku dengan baik.",},
        [1873] = {20188001,"Zhang Liao","Lu Bu","Wenyuan! Kamu adalah bawahanku yang mendukung. Aku dijebak dan ditangkap oleh Cao Cao. Cepat bawa saudara-saudara yang tersisa untuk menyelamatkanku!","Wenyuan! Kamu adalah bawahanku yang mendukung. Aku dijebak dan ditangkap oleh Cao Cao. Cepat bawa saudara-saudara yang tersisa untuk menyelamatkanku!",},
        [1874] = {20188001,"Zhang Liao","Cao Cao","Jenderal Wenyuan, kamu akan menyia-nyiakan talentamu jika mengikut dengan Lu Bu. Ikutlah denganku saja, kamu akan menjadi jenderal yang tak terkalahkan.","Jenderal Wenyuan, kamu akan menyia-nyiakan talentamu jika mengikut dengan Lu Bu. Ikutlah denganku saja, kamu akan menjadi jenderal yang tak terkalahkan.",},
        [1875] = {20188001,"Cao Cao","Zhang Liao","Baik, Zhang Liao bersedia untuk melakukan perkara besar dengan Tuan Cao.","Baik, Zhang Liao bersedia untuk melakukan perkara besar dengan Tuan Cao.",},
        [1876] = {20188002,"Zhang Liao","Guan Yu","Jangan berkata lagi, aku tidak akan menyerah!","Jangan berkata lagi, aku tidak akan menyerah!",},
        [1877] = {20188002,"Guan Yu","Zhang Liao","Kakak Yunchang, menyerahlah dulu. Jangan takut ada aku disini, tunggu pesan dari Liu Bei, lalu kamu bebas untuk pergi.","Kakak Yunchang, menyerahlah dulu. Jangan takut ada aku disini, tunggu pesan dari Liu Bei, lalu kamu bebas untuk pergi.",},
        [1878] = {20188002,"Zhang Liao","Guan Yu","Apakah ini benar?","Apakah ini benar?",},
        [1879] = {20188002,"Guan Yu","Zhang Liao","Percayalah padaku dan tenang.","Percayalah padaku dan tenang.",},
        [1880] = {20188003,"","Zhang Liao","Kemenangan kali ini, sebagian besar karena persiapan yang baik, ditambah dengan keberanian prajurit yang bertarung hingga mati, maka dari itu mendapatkan kemenangan penuh.","Kemenangan kali ini, sebagian besar karena persiapan yang baik, ditambah dengan keberanian prajurit yang bertarung hingga mati, maka dari itu mendapatkan kemenangan penuh.",},
        [1881] = {20188003,"Zhang Liao","Sun Quan","Zhang Liao adalah jenderal gagah, dia mengalahkan tentaraku dengan 800 kaveleri, aku telah meremehkan dia.","Zhang Liao adalah jenderal gagah, dia mengalahkan tentaraku dengan 800 kaveleri, aku telah meremehkan dia.",},
        [1882] = {20188003,"Zhang Liao","Sun Quan","Dikatakan bahwa saat anak kecil menangis pada malam hari, orang tua dapat menghentikannya dengan menyebutkan nama Zhang Liao. Setelah peperangan ini, Zhang Liao telah mendapatkan ketenaran di Jiangdong.","Dikatakan bahwa saat anak kecil menangis pada malam hari, orang tua dapat menghentikannya dengan menyebutkan nama Zhang Liao. Setelah peperangan ini, Zhang Liao telah mendapatkan ketenaran di Jiangdong.",},
        [1883] = {20188101,"Yang Xiu","Cao Zhi","Meskipun aku bukan orang yang baik, aku masih bekerja keras untuk negara dan rakyatku sebagai adipati. Aku bercita-cita untuk mencapai tujuan yang permanen dan bermakna.","Meskipun aku bukan orang yang baik, aku masih bekerja keras untuk negara dan rakyatku sebagai adipati. Aku bercita-cita untuk mencapai tujuan yang permanen dan bermakna.",},
        [1884] = {20188101,"Yang Xiu","Cao Zhi","Bagaimana aku bisa mengandalkan pada performa di akademi dan mendapat pujian sebagai pria terhormat?","Bagaimana aku bisa mengandalkan pada performa di akademi dan mendapat pujian sebagai pria terhormat?",},
        [1885] = {20188101,"Yang Xiu","Cao Zhi","Jika aku tidak berhasil atau caraku tidak berjalan, aku akan menerima catatan resmi sejarahwan, menimbang untung dan ruginya dengan akal sehat, menentukan arti sebenarnya dari kemurahan hati dan membuat amanat sebagai seorang sarjana.","Jika aku tidak berhasil atau caraku tidak berjalan, aku akan menerima catatan resmi sejarahwan, menimbang untung dan ruginya dengan akal sehat, menentukan arti sebenarnya dari kemurahan hati dan membuat amanat sebagai seorang sarjana.",},
        [1886] = {20188101,"Yang Xiu","Cao Zhi","Walaupun aku tidak menyembunyikan diri di gunung, aku masih mendengarnya diantara orang-orang. Dengan begini masih lebih baik daripada bertambah tua dan tidak mencapai apapun, bukan? Tetap berdiri tegak, inilah yang dimaksudkan.","Walaupun aku tidak menyembunyikan diri di gunung, aku masih mendengarnya diantara orang-orang. Dengan begini masih lebih baik daripada bertambah tua dan tidak mencapai apapun, bukan? Tetap berdiri tegak, inilah yang dimaksudkan.",},
        [1887] = {20188101,"Cao Zhi","Yang Xiu","Terima kasih atas pengertian Zijian. Orang mati untuk teman terbaiknya, selesaikan misi jika tidak maka berikan hidupnya.","Terima kasih atas pengertian Zijian. Orang mati untuk teman terbaiknya, selesaikan misi jika tidak maka berikan hidupnya.",},
        [1888] = {20188102,"Yang Xiu","Sima Yi","Perdana Menteri ingin menguji kemampuan Cao Pi dan Cao Zhi, dan memerintahkan mereka untuk pergi melalui Gerbang Yecheng. Tetapi dia memerintahkan penjaga untuk tidak membiarkan mereka pergi.","Perdana Menteri ingin menguji kemampuan Cao Pi dan Cao Zhi, dan memerintahkan mereka untuk pergi melalui Gerbang Yecheng. Tetapi dia memerintahkan penjaga untuk tidak membiarkan mereka pergi.",},
        [1889] = {20188102,"Yang Xiu","Sima Yi","Apakah kamu menghasut Cao Zhi untuk mengatakan bahwa dia meninggalkan kota karena perintah Tuan dan membunuh pasukan yang menghentikan dia?","Apakah kamu menghasut Cao Zhi untuk mengatakan bahwa dia meninggalkan kota karena perintah Tuan dan membunuh pasukan yang menghentikan dia?",},
        [1890] = {20188102,"Sima Yi","Yang Xiu","Ya.","Ya.",},
        [1891] = {20188102,"Yang Xiu","Sima Yi","Ah, Dezu, jangan sia-siakan talentamu, kamu kira dengan mengerti niat Perdana Menteri maka kamu bisa bergerak.","Ah, Dezu, jangan sia-siakan talentamu, kamu kira dengan mengerti niat Perdana Menteri maka kamu bisa bergerak.",},
