        [1896] = {20188103,"Cao Cao","Xiahou Dun","Dia berkata bahwa sandi hari ini adalah iga ayam, maka dia tahu bahwa raja akan kembali dalam beberapa hari. Iga ayam, tidak berdaging, dibuangpun juga sisa-sia karena rasanya.","Dia berkata bahwa sandi hari ini adalah iga ayam, maka dia tahu bahwa raja akan kembali dalam beberapa hari. Iga ayam, tidak berdaging, dibuangpun juga sisa-sia karena rasanya.",},
        [1897] = {20188103,"Cao Cao","Xiahou Dun","Tidak bisa memenangkan pertarungan, akan menjadi bahan tawaan di belakang. Tinggal disini tidaklah berarti, lebih baik segera mundur dan tunggu kemunculan kembali berikutnya. Maka mereka harus berkemas dulu, agar tidak panik sebelum mereka pergi.","Tidak bisa memenangkan pertarungan, akan menjadi bahan tawaan di belakang. Tinggal disini tidaklah berarti, lebih baik segera mundur dan tunggu kemunculan kembali berikutnya. Maka mereka harus berkemas dulu, agar tidak panik sebelum mereka pergi.",},
        [1898] = {20188103,"Xiahou Dun","Cao Cao","Yang Xiu sial, menganggap dirinya pandai, membuat rumor dan mengacaukan tentaraku!","Yang Xiu sial, menganggap dirinya pandai, membuat rumor dan mengacaukan tentaraku!",},
