        [1902] = {20188201,"Sima Zhao","Sima Yi","Aku telah mengabdi pada Wei selama bertahun-tahun sebagai Sekretaris Besar. Ini adalah tingkat yang tinggi untuk menteri. Orang-orang mengira aku akan membelot, ini mengejutkanku.","Aku telah mengabdi pada Wei selama bertahun-tahun sebagai Sekretaris Besar. Ini adalah tingkat yang tinggi untuk menteri. Orang-orang mengira aku akan membelot, ini mengejutkanku.",},
