        [2017] = {20189401,"Sima Yi","Deng Ai","Untuk menenangkan pemberontakan Turban Kuning, aku mengumpulkan tentara dan bertani. Aku telah menyimpan sejumlah besar gandum di Xudu, dengan tujuan menaklukkan dunia.","Untuk menenangkan pemberontakan Turban Kuning, aku mengumpulkan tentara dan bertani. Aku telah menyimpan sejumlah besar gandum di Xudu, dengan tujuan menaklukkan dunia.",},
        [2018] = {20189401,"Sima Yi","Deng Ai","Dan sekarang kita telah menenangkan perang di tiga sisi, kita masih memiliki pertempuran yang berlangsung di selatan Sungai Huaihe. Untuk setiap Ekspedisi Selatan, setengah dari prajurit akan dikirimkan untuk pengiriman persediaan. Merupakan biaya dan tenaga yang berat.","Dan sekarang kita telah menenangkan perang di tiga sisi, kita masih memiliki pertempuran yang berlangsung di selatan Sungai Huaihe. Untuk setiap Ekspedisi Selatan, setengah dari prajurit akan dikirimkan untuk pengiriman persediaan. Merupakan biaya dan tenaga yang berat.",},
        [2019] = {20189401,"Sima Yi","Deng Ai","Antara Chen dan Cai, ada tanah subur yang dapat menyelamatkan ladang padi disekitar Xuchang dan mengalihkan air ke timur.","Antara Chen dan Cai, ada tanah subur yang dapat menyelamatkan ladang padi disekitar Xuchang dan mengalihkan air ke timur.",},
        [2020] = {20189401,"Sima Yi","Deng Ai","Hari ini, ada dua puluh ribu prajurit berjaga di utara Sungai Huaihe dan tiga puluh ribu prajurit di selatan Sungai Huaihe. Menurut rasio pergantian giliran dalam 2:10, terdapat empat puluh ribu prajurit yang bertani dan berjaga.","Hari ini, ada dua puluh ribu prajurit berjaga di utara Sungai Huaihe dan tiga puluh ribu prajurit di selatan Sungai Huaihe. Menurut rasio pergantian giliran dalam 2:10, terdapat empat puluh ribu prajurit yang bertani dan berjaga.",},
        [2021] = {20189401,"Sima Yi","Deng Ai","Ketika cuaca bagus, panen seringkali tiga kali lipat lebih banyak dari bagian barat. Setelah mengurangi biaya prajurit dan warga sipil, lima juta hu butir dapat digunakan untuk keperluan militer setiap tahun.","Ketika cuaca bagus, panen seringkali tiga kali lipat lebih banyak dari bagian barat. Setelah mengurangi biaya prajurit dan warga sipil, lima juta hu butir dapat digunakan untuk keperluan militer setiap tahun.",},
        [2022] = {20189401,"Sima Yi","Deng Ai","Dalam enam atau tujuh tahun, 30 juta hu gandum akan disimpan di udik Sungai Huaihe. Gandum-gandum ini cukup untuk mendukung ratusan ribu prajurit dan penduduk selama lima tahun.","Dalam enam atau tujuh tahun, 30 juta hu gandum akan disimpan di udik Sungai Huaihe. Gandum-gandum ini cukup untuk mendukung ratusan ribu prajurit dan penduduk selama lima tahun.",},
