        [2079] = {20189902,"","Ding Feng","Pastikan Dongwu aman. Perang Dong Xing harus menang.","Pastikan Dongwu aman. Perang Dong Xing harus menang.",},
        [2080] = {20189902,"","Ding Feng","Waktu untuk mendapat hadiah telah tiba!","Waktu untuk mendapat hadiah telah tiba!",},
        [2081] = {20189902,"","Ding Feng","Semuanya lepaskan Jubah dan Helm bersamaku, bunuh lawan dengan senjata jarak dekat.","Semuanya lepaskan Jubah dan Helm bersamaku, bunuh lawan dengan senjata jarak dekat.",},
        [2082] = {201810001,"Lu Kang","Yang Hu","Ini adalah obat mutakhir ciptaanku, belum kuminum, dengar-dengar kamu sedang sakit, maka akan kuberikan padamu dulu.","Ini adalah obat mutakhir ciptaanku, belum kuminum, dengar-dengar kamu sedang sakit, maka akan kuberikan padamu dulu.",},
        [2083] = {201810001,"Lu Kang","Jenderal Dongwu","Takutnya ada sesuatu, jenderal jangan meminumnya.","Takutnya ada sesuatu, jenderal jangan meminumnya.",},
        [2084] = {201810001,"Jenderal Dongwu","Lu Kang","Bagimana mungkin Yang Hu adalah peracun!","Bagimana mungkin Yang Hu adalah peracun!",},
        [2085] = {201810001,"Jenderal Dongwu","Lu Kang","Dia berbudi luhur dan aku kasar. Ini akan menimbulkan kerugian tanpa bertarung di pertempuran. Semua orang berusaha keras dan tidak mencari kepentingan pribadi.","Dia berbudi luhur dan aku kasar. Ini akan menimbulkan kerugian tanpa bertarung di pertempuran. Semua orang berusaha keras dan tidak mencari kepentingan pribadi.",},
        [2086] = {201810002,"","Lu Kang","Membangun negara dan melanjutkan keluarga, tidak menggunakan orang rendahan, tidak mendengarkan tipuan dan menggunakan orang jahat.","Membangun negara dan melanjutkan keluarga, tidak menggunakan orang rendahan, tidak mendengarkan tipuan dan menggunakan orang jahat.",},
        [2087] = {201810002,"","Lu Kang","Mustahil untuk menyambut lingkungan yang damai tanpa korupsi ketika mereka memegang posisi resmi yang penting dan mendesak hak dan wewenang khusus.","Mustahil untuk menyambut lingkungan yang damai tanpa korupsi ketika mereka memegang posisi resmi yang penting dan mendesak hak dan wewenang khusus.",},
        [2088] = {201810002,"","Lu Kang","Meskipun hanya ada sedikit talenta hebat di istana sekarang, tetapi kebanyakan dari mereka adalah keturunan kerajaan dan bangsawan yang telah mendapatkan pendidikan moral sejak kecil.","Meskipun hanya ada sedikit talenta hebat di istana sekarang, tetapi kebanyakan dari mereka adalah keturunan kerajaan dan bangsawan yang telah mendapatkan pendidikan moral sejak kecil.",},
        [2089] = {201810002,"","Lu Kang","Atau mereka mengandalkan dan menahan diri sendiri, oleh karena itu layak untuk diangkat.Alaminya, mereka bisa diangkat untuk menempati sesuai talenta masing-masing, untuk menahan dan memberhentikan orang rendah.","Atau mereka mengandalkan dan menahan diri sendiri, oleh karena itu layak untuk diangkat.Alaminya, mereka bisa diangkat untuk menempati sesuai talenta masing-masing, untuk menahan dan memberhentikan orang rendah.",},
        [2090] = {201810002,"","Lu Kang","Kemudian kondisi masyarakat bisa dimurnikan, urusan negara tidak akan ternodai.","Kemudian kondisi masyarakat bisa dimurnikan, urusan negara tidak akan ternodai.",},
        [2091] = {1701,"Guan Yinping","Protagonis","Kali ini aku pergi ke Prefektur Pingyuan untuk mengirimkan surat pada kakak, siapa tahu bisa bertemu dengan Jenderal Besar Zhao Zilong! Dengar-dengar hubungannya dengan kakak sangat baik.","Kali ini aku pergi ke Prefektur Pingyuan untuk mengirimkan surat pada kakak, siapa tahu bisa bertemu dengan Jenderal Besar Zhao Zilong! Dengar-dengar hubungannya dengan kakak sangat baik.",},
        [2092] = {1701,"","Guan Yinping","Benarkah? Kita dapat bertemu dengan Jenderal Legendaris Zhao Zilong! Tidak sabar!","Benarkah? Kita dapat bertemu dengan Jenderal Legendaris Zhao Zilong! Tidak sabar!",},
        [2093] = {1701,"","Zhang Xingcai","Ha, kakak Yinping, kamu berbuat konyol lagi!","Ha, kakak Yinping, kamu berbuat konyol lagi!",},
        [2094] = {1701,"","Guan Yinping","Mengenakan zirah putih dan menunggang kuda putih, bertombak perak dan berperilaku mengesankan. Maju seorang diri ditengah dunia yang penuh kekacauan, tidak ada yang berani menantangnya!","Mengenakan zirah putih dan menunggang kuda putih, bertombak perak dan berperilaku mengesankan. Maju seorang diri ditengah dunia yang penuh kekacauan, tidak ada yang berani menantangnya!",},
        [2095] = {1701,"","Guan Yinping","Jenderal Zhao Zilong masih muda, tampan dan hebat. Apakah dia tidak layak dengan kekagumanku?","Jenderal Zhao Zilong masih muda, tampan dan hebat. Apakah dia tidak layak dengan kekagumanku?",},
        [2096] = {1701,"","Zhang Xingcai","Baiklah, memang pantas! Tetapi dihatiku, Tuan adalah orang yang paling kukagumi di dunia ini!","Baiklah, memang pantas! Tetapi dihatiku, Tuan adalah orang yang paling kukagumi di dunia ini!",},
        [2097] = {1701,"","Protagonis","Hahaha! Xingcai memujiku lagi! Tenang, aku pasti tidak akan membuatmu kecewa!","Hahaha! Xingcai memujiku lagi! Tenang, aku pasti tidak akan membuatmu kecewa!",},
        [2098] = {1702,"Tian Kai","Protagonis","Tian Kai, kamu pasti telah mendengar tentang Cao Cao menyerang Xuzhou. Kong Rong dari Behai telah berjanji untuk menyelamatkan Xuzhou, bagaimana dengamu?","Tian Kai, kamu pasti telah mendengar tentang Cao Cao menyerang Xuzhou. Kong Rong dari Behai telah berjanji untuk menyelamatkan Xuzhou, bagaimana dengamu?",},
        [2099] = {1702,"","Tian Kai","Xuzhou dan Qingzhou memiliki nasib yang sama. Aku harus memberikan bantuanku. Tetapi Qingzhou saat ini sedang dalam perang dengan Yuan Shao dari Jizhou. Jika aku memisahkan prajuritku dengan tergesa-gesa, takutnya ini tidak akan baik…","Xuzhou dan Qingzhou memiliki nasib yang sama. Aku harus memberikan bantuanku. Tetapi Qingzhou saat ini sedang dalam perang dengan Yuan Shao dari Jizhou. Jika aku memisahkan prajuritku dengan tergesa-gesa, takutnya ini tidak akan baik…",},
        [2100] = {1702,"","Tian Kai","Namun, setelah Cao Cao menyerang Xuzhou, takutnya dia akan menyerang Qingzhou… Apa yang harus dilakukan?","Namun, setelah Cao Cao menyerang Xuzhou, takutnya dia akan menyerang Qingzhou… Apa yang harus dilakukan?",},
        [2101] = {1702,"","Protagonis","Di hidupku aku paling benci dengan orang yang tidak bisa mengambil keputusan. Katakan padaku, apakah kamu ikut atau tidak?","Di hidupku aku paling benci dengan orang yang tidak bisa mengambil keputusan. Katakan padaku, apakah kamu ikut atau tidak?",},
        [2102] = {1702,"","Tian Kai","Tunggu dulu, Hero muda. Cao Cao sepertinya tak terkalahkan, dia lebih buruk dari Yuan Shao. Jadi aku akan membantu di Xuzhou!","Tunggu dulu, Hero muda. Cao Cao sepertinya tak terkalahkan, dia lebih buruk dari Yuan Shao. Jadi aku akan membantu di Xuzhou!",},
        [2103] = {1702,"","Protagonis","Baik, ini baru keren!","Baik, ini baru keren!",},
        [2104] = {1703,"Liu Bei","Protagonis","Kakak, Cao Cao ingin menyerang Xuzhou, kami awalnya membantu Tao Qian pergi ke Beihai untuk meminta Kong Rong mengirimkan prajurit, tidak disangka Beihai dikepung oleh Turban Kuning. Kong Rong mengirimku untuk memberikan surat ini padamu, memintamu untuk membawa prajurit dan membantu Xuzhou.","Kakak, Cao Cao ingin menyerang Xuzhou, kami awalnya membantu Tao Qian pergi ke Beihai untuk meminta Kong Rong mengirimkan prajurit, tidak disangka Beihai dikepung oleh Turban Kuning. Kong Rong mengirimku untuk memberikan surat ini padamu, memintamu untuk membawa prajurit dan membantu Xuzhou.",},
        [2105] = {1703,"","Liu Bei","Kong Rong dari Beihai tahu tentang aku! Namun, Pingyuan hanyalah tempat kecil, tidak bisa memberikan banyak bantuan.","Kong Rong dari Beihai tahu tentang aku! Namun, Pingyuan hanyalah tempat kecil, tidak bisa memberikan banyak bantuan.",},
        [2106] = {1703,"","Protagonis","Kakak, jangan khawatir, kita pergi mencari Gongsun Zan untuk meminjam tiga ribu prajurit, dan membawa Jenderal Zhao Zilong bersama, bagaimana?","Kakak, jangan khawatir, kita pergi mencari Gongsun Zan untuk meminjam tiga ribu prajurit, dan membawa Jenderal Zhao Zilong bersama, bagaimana?",},
        [2107] = {1703,"","Liu Bei","Adik sangat bijaksana. Aku akan meminta bantuan dari Gongsun Zan.","Adik sangat bijaksana. Aku akan meminta bantuan dari Gongsun Zan.",},
        [2108] = {1704,"Liu Bei","Gongsun Zan","Cao Cao bukanlah musuhmu, mengapa repot-repot melakukan ini?","Cao Cao bukanlah musuhmu, mengapa repot-repot melakukan ini?",},
        [2109] = {1704,"","Liu Bei","Aku telah berjanji dengan Kong Rong, tidak bisa melanggarnya.","Aku telah berjanji dengan Kong Rong, tidak bisa melanggarnya.",},
        [2110] = {1704,"","Gongsun Zan","Xuande, kamu sangat bermoral tetapi kamu akan membuat musuh dimana-mana! Baiklah, aku berjanji untuk meminjamkan tiga ribu prajurit elit. Tetapi untuk Zilong, kamu harus melewati ujiannya!","Xuande, kamu sangat bermoral tetapi kamu akan membuat musuh dimana-mana! Baiklah, aku berjanji untuk meminjamkan tiga ribu prajurit elit. Tetapi untuk Zilong, kamu harus melewati ujiannya!",},
        [2111] = {1704,"","Protagonis","Kakak, biarkan aku mencoba ujian Jenderal Zilong! Tanganku sangat gatal, sudah lama tidak menemukan lawan tangguh, ingin bertarung sekali!","Kakak, biarkan aku mencoba ujian Jenderal Zilong! Tanganku sangat gatal, sudah lama tidak menemukan lawan tangguh, ingin bertarung sekali!",},
        [2112] = {1705,"Protagonis","Zhao Yun","Hebat, kemampuan Hero muda hebat, benar-benar penuh masa depan!","Hebat, kemampuan Hero muda hebat, benar-benar penuh masa depan!",},
        [2113] = {1705,"","Protagonis","Aku sangat tersanjung! Jenderal Zhao Zilong, bersediakah untuk menyelamatkan Xuzhou bersama aku dan kakakku?","Aku sangat tersanjung! Jenderal Zhao Zilong, bersediakah untuk menyelamatkan Xuzhou bersama aku dan kakakku?",},
        [2114] = {1705,"","Zhao Yun","Pastinya! Karena kamu sudah lolos ujian, aku Zhao Yun dari Changshan mana mungkin mengingkari janji!","Pastinya! Karena kamu sudah lolos ujian, aku Zhao Yun dari Changshan mana mungkin mengingkari janji!",},
        [2115] = {1705,"","Zhao Yun","Selain itu, Xuande bukanlah orang asing bagiku. Kamu adalah adik keempat Xuande, Token Hero ini adalah hadiah pertemuan untukmu! Akan kusiapkan orang dan kudaku!","Selain itu, Xuande bukanlah orang asing bagiku. Kamu adalah adik keempat Xuande, Token Hero ini adalah hadiah pertemuan untukmu! Akan kusiapkan orang dan kudaku!",},
        [2116] = {1705,"","Protagonis","Hebat! Dengan bantuan Tian Kai dan Kong Rong, dan pasukan Zhao Zilong dan kakak, pengepungan di Xuzhou pasti bisa diselesaikan, dapat memaksa Cao Cao mundur!","Hebat! Dengan bantuan Tian Kai dan Kong Rong, dan pasukan Zhao Zilong dan kakak, pengepungan di Xuzhou pasti bisa diselesaikan, dapat memaksa Cao Cao mundur!",},
        [2117] = {1705,"","Zhang Xingcai","Tuan sangat hebat! Di dunia ini, tidak ada masalah yang tidak dapat diselesaikan oleh Tuan!","Tuan sangat hebat! Di dunia ini, tidak ada masalah yang tidak dapat diselesaikan oleh Tuan!",},
        [2118] = {1705,"","Protagonis","Hahaha! Xingcai, Yinping, mari kita kembali ke Xuzhou!","Hahaha! Xingcai, Yinping, mari kita kembali ke Xuzhou!",},
        [2119] = {1801,"Lu Bu","Cao Cao","Lu Bu, aku dan kamu tidak memiliki dendam. Mengapa menangkap Yanzhou dan Puyang saat aku menyerang Xuzhou?","Lu Bu, aku dan kamu tidak memiliki dendam. Mengapa menangkap Yanzhou dan Puyang saat aku menyerang Xuzhou?",},
        [2120] = {1801,"","Lu Bu","Kota-kota Han adalah milik semua orang. Apa hakmu berkata ini adalah milikmu, Cao Cao? Chen Gong dan Zhang Miao, mereka berdua bersedia untuk menerimaku menjadi Pemerintah Yanzhou, itu karena kemampuanku!","Kota-kota Han adalah milik semua orang. Apa hakmu berkata ini adalah milikmu, Cao Cao? Chen Gong dan Zhang Miao, mereka berdua bersedia untuk menerimaku menjadi Pemerintah Yanzhou, itu karena kemampuanku!",},
        [2121] = {1801,"","Cao Cao","Beraninya kamu! Saat aku masuk ke Puyang, akan kupenggal kepalamu!","Beraninya kamu! Saat aku masuk ke Puyang, akan kupenggal kepalamu!",},
        [2122] = {1801,"","Lu Bu","Aku Dewa Perang Lu Bu, mana mungkin takut dengan Cao Aman! Jika kamu berani menyerang Puyang, aku akan membuatmu mati disini!","Aku Dewa Perang Lu Bu, mana mungkin takut dengan Cao Aman! Jika kamu berani menyerang Puyang, aku akan membuatmu mati disini!",},
        [2123] = {1802,"Protagonis","Zhang Xingcai","Tuan, Cao Cao dan Lu Bu berperang! Cao Cao baru saja mengirimkan surat dengan utusan, mengatakan bersedia untuk menarik prajuritnya dari Xuzhou dan meminta kami untuk membantunya di Puyang.","Tuan, Cao Cao dan Lu Bu berperang! Cao Cao baru saja mengirimkan surat dengan utusan, mengatakan bersedia untuk menarik prajuritnya dari Xuzhou dan meminta kami untuk membantunya di Puyang.",},
        [2124] = {1802,"","Protagonis","Sejak kapan Lu Bu memiliki pasukan sebanyak ini, dan telah merebut dua kota dari Cao Cao!","Sejak kapan Lu Bu memiliki pasukan sebanyak ini, dan telah merebut dua kota dari Cao Cao!",},
        [2125] = {1802,"","Zhang Xingcai","Setelah kekacauan Li Jue dan Guo Si di Chang'an, Lu Bu pergi ke kamp Yuan Shu. Tetapi Yuan Shu berpikiran sempit dan Lu Bu sangat ambisius, jadi mereka tidak bisa berdiam cukup lama.","Setelah kekacauan Li Jue dan Guo Si di Chang'an, Lu Bu pergi ke kamp Yuan Shu. Tetapi Yuan Shu berpikiran sempit dan Lu Bu sangat ambisius, jadi mereka tidak bisa berdiam cukup lama.",},
        [2126] = {1802,"","Zhang Xingcai","Kemudian, Cao Cao pergi menyerang Xuzhou, Pemimpin Prefektur Zhang Miao dan Chen Gong membuka gerbang dan mengangkat Lu Bu menjadi Pemerintah Yanzhou.","Kemudian, Cao Cao pergi menyerang Xuzhou, Pemimpin Prefektur Zhang Miao dan Chen Gong membuka gerbang dan mengangkat Lu Bu menjadi Pemerintah Yanzhou.",},
        [2127] = {1802,"","Protagonis","Pada saat itu aku memberitahu Cao Cao untuk mundur dari Xuzhou, tetapi dia menghindariku, sekarang mencari bantuanku! Lupakan, aku cukup baik untuk menyelamatkannya sekali lagi! ","Pada saat itu aku memberitahu Cao Cao untuk mundur dari Xuzhou, tetapi dia menghindariku, sekarang mencari bantuanku! Lupakan, aku cukup baik untuk menyelamatkannya sekali lagi! ",},
        [2128] = {1803,"Protagonis","Zhang Miao","Siapa yang berani datang mencari masalah di Puyang? Apakah kamu mata-mata yang dikirim Cao Cao?","Siapa yang berani datang mencari masalah di Puyang? Apakah kamu mata-mata yang dikirim Cao Cao?",},
        [2129] = {1803,"","Zhang Xingcai","Tuan, Zhang Miao adalah orang terkenal, sebagai salah satu dari delapan Chu, harus berhati-hati saat bertarung dengannya.","Tuan, Zhang Miao adalah orang terkenal, sebagai salah satu dari delapan Chu, harus berhati-hati saat bertarung dengannya.",},
        [2130] = {1803,"","Protagonis","Delapan Chu? Jangan-jangan dia adalah koki, masakannya enak?","Delapan Chu? Jangan-jangan dia adalah koki, masakannya enak?",},
        [2131] = {1803,"","Zhang Xingcai","Hehe! Bukan itu. Yang dimaksud dengan delapan Chu adalah kelompok delapan orang seperti Zhang Miao dan Du Shang, yang berarti membantu orang lain dengan kekayaan.","Hehe! Bukan itu. Yang dimaksud dengan delapan Chu adalah kelompok delapan orang seperti Zhang Miao dan Du Shang, yang berarti membantu orang lain dengan kekayaan.",},
        [2132] = {1803,"","Zhang Xingcai","Zhang Miao saat muda dikenal dengan keberaniannya, membantu yang miskin dan yang membutuhkan menggunakan kekayaannya sendiri, banyak pelajar dan orang pintar yang berhubungan dengannya, Cao Cao dan Yuan Shao pernah menjadi teman Yuan Shao.","Zhang Miao saat muda dikenal dengan keberaniannya, membantu yang miskin dan yang membutuhkan menggunakan kekayaannya sendiri, banyak pelajar dan orang pintar yang berhubungan dengannya, Cao Cao dan Yuan Shao pernah menjadi teman Yuan Shao.",},
        [2133] = {1803,"","Zhang Xingcai","Nama Zhang Miao semakin lama semakin besar, lalu istana memanggilnya untuk menjadi pemimpin Chenliu.","Nama Zhang Miao semakin lama semakin besar, lalu istana memanggilnya untuk menjadi pemimpin Chenliu.",},
        [2134] = {1803,"","Zhang Miao","Humph! Jangan karena aku membawa pisau dapur, kamu menganggapku sebagai koki! Yang kubawa adalah pedang tanpa tandingan!","Humph! Jangan karena aku membawa pisau dapur, kamu menganggapku sebagai koki! Yang kubawa adalah pedang tanpa tandingan!",},
        [2135] = {1803,"","Protagonis","Zhang Miao, sepertinya kamu hebat. Tapi di depanku, itu tidak ada apa-apanya!","Zhang Miao, sepertinya kamu hebat. Tapi di depanku, itu tidak ada apa-apanya!",},
        [2136] = {1804,"Protagonis","Zhang Miao","Jenderal memang hebat, dapat mengalahkanku! Aku bersedia untuk memberikan pedang ini untukmu!","Jenderal memang hebat, dapat mengalahkanku! Aku bersedia untuk memberikan pedang ini untukmu!",},
        [2137] = {1804,"","Protagonis","Terima kasih, tetapi pedang ini, telah bengkok karena seranganku, sebaiknya kamu simpan baik-baik saja untuk memotong bawang!","Terima kasih, tetapi pedang ini, telah bengkok karena seranganku, sebaiknya kamu simpan baik-baik saja untuk memotong bawang!",},
        [2138] = {1804,"","Zhang Miao","Tidak disangka aku Zhang Miao dari Delapan Chu, juga dibenci oleh orang pada suatu hari!","Tidak disangka aku Zhang Miao dari Delapan Chu, juga dibenci oleh orang pada suatu hari!",},
        [2139] = {1805,"Cao Cao","Yu Jin","Tuan berdiam dulu di luar kota, biarkan aku masuk dulu!","Tuan berdiam dulu di luar kota, biarkan aku masuk dulu!",},
        [2140] = {1805,"Yu Jin","Cao Cao","Siapa yang berani pergi tanpaku?","Siapa yang berani pergi tanpaku?",},
        [2141] = {1805,"Zhang Xingcai","Protagonis","Dimana Cao Cao? Mengapa dia menghilang dalam sekejap, baru saja mendengarnya berbicara dengan seseorang!","Dimana Cao Cao? Mengapa dia menghilang dalam sekejap, baru saja mendengarnya berbicara dengan seseorang!",},
        [2142] = {1805,"","Zhang Xingcai","Tuan, Cao Cao masuk ke perangkap Chen Gong dan Lu Bu, dia telah membawa tentara dan menyerbu ke kota!","Tuan, Cao Cao masuk ke perangkap Chen Gong dan Lu Bu, dia telah membawa tentara dan menyerbu ke kota!",},
        [2143] = {1805,"","Zhang Xingcai","Di dalam terjadi kebakaran dan asap dimana-mana, tidak tahu bagaimana keadaan Cao Cao! Baru saja bertemu dengan Yue Jin, Li Dian, dan Dian Wei sedang mencari Cao-cao dimana-mana!","Di dalam terjadi kebakaran dan asap dimana-mana, tidak tahu bagaimana keadaan Cao Cao! Baru saja bertemu dengan Yue Jin, Li Dian, dan Dian Wei sedang mencari Cao-cao dimana-mana!",},
        [2144] = {1805,"","Protagonis","Kita akan mengalahkan Lu Bu dan menyelamatkan dia.","Kita akan mengalahkan Lu Bu dan menyelamatkan dia.",},
        [2145] = {1806,"Protagonis","Lu Bu","Haha, pertempuran yang menyenangkan! Hero muda, kamu dan aku bukanlah orang asing, jika bukan karena kamu, maka tidak ada aku dan Diao Chan hari ini! Baiklah, untuk kebaikanmu, hari ini akan kulepaskan Cao Cao! ","Haha, pertempuran yang menyenangkan! Hero muda, kamu dan aku bukanlah orang asing, jika bukan karena kamu, maka tidak ada aku dan Diao Chan hari ini! Baiklah, untuk kebaikanmu, hari ini akan kulepaskan Cao Cao! ",},
        [2146] = {1806,"Lu Bu","Protagonis","Terima kasih, Lu Bu memang keren!","Terima kasih, Lu Bu memang keren!",},
        [2147] = {1806,"Protagonis","Cao Cao","Sepotong balok yang terbakar runtuh dari gerbang kota dan mengenai lenganku. Lengan, rambut dan jenggotku, semuanya terbakar!","Sepotong balok yang terbakar runtuh dari gerbang kota dan mengenai lenganku. Lengan, rambut dan jenggotku, semuanya terbakar!",},
        [2148] = {1806,"","Cao Cao","Jika bukan karena Hero muda tiba tepat waktu dan mengalahkan Lu Bu, hari ini benar-benar bahaya! Token Hero ini adalah hadiah untuk Hero muda sebagai terima kasihku!","Jika bukan karena Hero muda tiba tepat waktu dan mengalahkan Lu Bu, hari ini benar-benar bahaya! Token Hero ini adalah hadiah untuk Hero muda sebagai terima kasihku!",},
        [2149] = {1806,"","Protagonis","Mohon kakak Cao menepati janji dan mundur dari Xuzhou!","Mohon kakak Cao menepati janji dan mundur dari Xuzhou!",},
        [2150] = {1806,"","Cao Cao","Hero muda tenanglah, aku telah memerintahkan prajurit untuk mundur dari Xuzhou. Maafkan aku karena menghindarimu sebelumnya.","Hero muda tenanglah, aku telah memerintahkan prajurit untuk mundur dari Xuzhou. Maafkan aku karena menghindarimu sebelumnya.",},
        [2151] = {1806,"","Protagonis","Baiklah, karena sekarang kamu menepati janji, aku akan melupakan yang telah berlalu. Cao, sampai jumpa, aku harus menemukan saudaraku di Xuzhou","Baiklah, karena sekarang kamu menepati janji, aku akan melupakan yang telah berlalu. Cao, sampai jumpa, aku harus menemukan saudaraku di Xuzhou",},
        [2152] = {1806,"","Cao Cao","Silahkan, Hero muda! Aku jatuh dalam jebakan anak muda itu. Aku harus merebut kembali Puyang cepat atau lambat!","Silahkan, Hero muda! Aku jatuh dalam jebakan anak muda itu. Aku harus merebut kembali Puyang cepat atau lambat!",},
        [2153] = {1901,"Liu Bei","Tao Qian","Seseorang, ambilkan Stempel Xuzhou!","Seseorang, ambilkan Stempel Xuzhou!",},
        [2154] = {1901,"","Liu Bei","Tuan Tao, apa yang kamu inginkan?","Tuan Tao, apa yang kamu inginkan?",},
        [2155] = {1901,"","Tao Qian","Xuande, kamu terlihat tampan, bersifat terbuka, murah hati dan bertalenta. Kamu juga merupakan keturunan Dinasti Han, aku bersedia memberikan Xuzhou kepadamu!","Xuande, kamu terlihat tampan, bersifat terbuka, murah hati dan bertalenta. Kamu juga merupakan keturunan Dinasti Han, aku bersedia memberikan Xuzhou kepadamu!",},
        [2156] = {1901,"","Liu Bei","Aku tidak berani janji tentang hal ini. Meskipun aku adalah keturunan Dinasti Ham, tetapi jasaku masih sedikit, tidak berani menerimanya. Mengapa tidak memberikannya pada Yuan Shao?","Aku tidak berani janji tentang hal ini. Meskipun aku adalah keturunan Dinasti Ham, tetapi jasaku masih sedikit, tidak berani menerimanya. Mengapa tidak memberikannya pada Yuan Shao?",},
        [2157] = {1901,"","Tao Qian","Yuan Shao hanyalah ranting di kuburan, sangat tidak berarti! Bagaimana dia bisa dibandingkan denganmu!","Yuan Shao hanyalah ranting di kuburan, sangat tidak berarti! Bagaimana dia bisa dibandingkan denganmu!",},
        [2158] = {1901,"","Liu Bei","Aku memimpin pasukan untuk menyelamatkan Xuzhou demi keadilan bukan untuk tujuan pribadi. Aku benar-benar tidak bisa menerima tawaran baikmu.","Aku memimpin pasukan untuk menyelamatkan Xuzhou demi keadilan bukan untuk tujuan pribadi. Aku benar-benar tidak bisa menerima tawaran baikmu.",},
        [2159] = {1902,"Protagonis","Tao Qian","Hero muda memiliki masa depan, penuh dengan ambisi. Aku ingin meminta sedikit bantuan dari Hero muda.","Hero muda memiliki masa depan, penuh dengan ambisi. Aku ingin meminta sedikit bantuan dari Hero muda.",},
        [2160] = {1902,"","Protagonis","Tuan Tao, sialhkan bicara.","Tuan Tao, sialhkan bicara.",},
        [2161] = {1902,"","Tao Qian","Dunia sedang dalam kekacauan, umurku sudah tua, anakku tidak bertalenta untuk memerintah negara. Aku ingin memindahkan posisiku sebagai Pemimpin Prefektur Xuzhou pada Liu Bei, tidak disangka Liu Bei menolaknya, mohon Hero muda membantu untuk membujuk dia.","Dunia sedang dalam kekacauan, umurku sudah tua, anakku tidak bertalenta untuk memerintah negara. Aku ingin memindahkan posisiku sebagai Pemimpin Prefektur Xuzhou pada Liu Bei, tidak disangka Liu Bei menolaknya, mohon Hero muda membantu untuk membujuk dia.",},
        [2162] = {1902,"","Protagonis","Aneh, mengapa tidak kamu serahkan pada putramu!","Aneh, mengapa tidak kamu serahkan pada putramu!",},
        [2163] = {1902,"","Tao Qian","Ada yang Hero muda tidak ketahui, aku memiliki dua putra, Shang dan Ying. Mereka tidak berkemampuan untuk memimpin. Apa yang harus kulakukan? (meneteskan air mata)","Ada yang Hero muda tidak ketahui, aku memiliki dua putra, Shang dan Ying. Mereka tidak berkemampuan untuk memimpin. Apa yang harus kulakukan? (meneteskan air mata)",},
        [2164] = {1902,"","Protagonis","Jangan khawatir, Tuan Tao, aku akan membujuk kakakku!","Jangan khawatir, Tuan Tao, aku akan membujuk kakakku!",},
        [2165] = {1903,"Protagonis","Guan Yu","Adik keempat, kakak tahu kamu ingin membujuknya, menyuruhku dan Yide untuk menghentikanmu.","Adik keempat, kakak tahu kamu ingin membujuknya, menyuruhku dan Yide untuk menghentikanmu.",},
        [2166] = {1903,"","Protagonis","Kakak kedua, maaf! Kebetulan kita bisa ambil kesempatan ini untuk beradu.","Kakak kedua, maaf! Kebetulan kita bisa ambil kesempatan ini untuk beradu.",},
        [2167] = {1904,"Zhang Fei","Zhang Xingcai","Ayah memang bodoh. Mengapa menghentikan Tuanku?","Ayah memang bodoh. Mengapa menghentikan Tuanku?",},
        [2168] = {1904,"","Zhang Fei","Anak pintar, jangan salahkan ayah karena menjalankan perintah militer.","Anak pintar, jangan salahkan ayah karena menjalankan perintah militer.",},
        [2169] = {1904,"","Zhang Xingcai","Saat bertarung nanti, jangan sakiti Tuanku.","Saat bertarung nanti, jangan sakiti Tuanku.",},
        [2170] = {1904,"","Zhang Fei","Baik, seperti yang dikatakan anak tercintaku, Ayah harus melakukannya! Tenang, Ayah akan berhenti pada tempatnya.","Baik, seperti yang dikatakan anak tercintaku, Ayah harus melakukannya! Tenang, Ayah akan berhenti pada tempatnya.",},
        [2171] = {1905,"Liu Bei","Protagonis","Kakak, Xuzhou selalu menjadi tempat pertempuran. Di utara ada Cao Cao yang menduduki Yanzhou, banyak pasukan dan gandum; Di selatan ada Yuan Shu, yang selalu melihat dengan ganas. Jika kamu tidak mengambil alih Xuzhou, aku takut rakyat Xuzhou akan menghadapi bahaya.","Kakak, Xuzhou selalu menjadi tempat pertempuran. Di utara ada Cao Cao yang menduduki Yanzhou, banyak pasukan dan gandum; Di selatan ada Yuan Shu, yang selalu melihat dengan ganas. Jika kamu tidak mengambil alih Xuzhou, aku takut rakyat Xuzhou akan menghadapi bahaya.",},
        [2172] = {1905,"","Liu Bei","Perkataan adik keempat sangat benar, aku sangat bodoh. Namun, bagaimana bisa memikul tanggung jawab ini sendiri!","Perkataan adik keempat sangat benar, aku sangat bodoh. Namun, bagaimana bisa memikul tanggung jawab ini sendiri!",},
        [2173] = {1905,"","Protagonis","Sun Qian, Mi Zhu, dan Chen Deng dari Xuzhou akan membantumu. Masih ada kami beberapa saudaramu. Kakak, jangan menolaknya!","Sun Qian, Mi Zhu, dan Chen Deng dari Xuzhou akan membantumu. Masih ada kami beberapa saudaramu. Kakak, jangan menolaknya!",},
        [2174] = {1905,"","Liu Bei","Baik, aku akan dengar perkataan adik keempat!","Baik, aku akan dengar perkataan adik keempat!",},
        [2175] = {1905,"","Liu Bei","Adik keempat, Token Hero ini, adalah hadiah dari Tuan Tao dia ingin memberikannya padamu sebelum meninggal, untuk berterima kasih telah membuat Cao Cao mundur dan menyelesaikan krisis di Xuzhou!","Adik keempat, Token Hero ini, adalah hadiah dari Tuan Tao dia ingin memberikannya padamu sebelum meninggal, untuk berterima kasih telah membuat Cao Cao mundur dan menyelesaikan krisis di Xuzhou!",},
        [2176] = {1905,"","Protagonis","Terima kasih, kakak! Aku akan mengambilnya, haha!","Terima kasih, kakak! Aku akan mengambilnya, haha!",},
        [2177] = {2001,"","Protagonis","Xuzhou sekarang sudah stabil, aku akan pergi, kakak. Aku ingin melihat bagaimana keadaan Chang'an sekarang!","Xuzhou sekarang sudah stabil, aku akan pergi, kakak. Aku ingin melihat bagaimana keadaan Chang'an sekarang!",},
        [2178] = {2001,"Zhang Xingcai","Protagonis","Ha? Terakhir kali aku datang ke Chang'an untuk membunuh Dong Zhuo, tempat itu adalah tempat yang sejahtera. Mengapa sekarang menjadi miskin? Xingcai, apakah kamu tahu apa yang telah terjadi?","Ha? Terakhir kali aku datang ke Chang'an untuk membunuh Dong Zhuo, tempat itu adalah tempat yang sejahtera. Mengapa sekarang menjadi miskin? Xingcai, apakah kamu tahu apa yang telah terjadi?",},
        [2179] = {2001,"","Zhang Xingcai","Tuan, Li Jue dan Guo Si mengambil Kaisar sebagai tawanan setelah mereka menangkap Chang'an. Mereka mengendalikan istana tetapi juga saling curiga dan sering berperang, kali ini sudha berbulan-bulan lamanya, ratusan ribu orang telah mati, membuat Chang'an yang makmur menjadi seperti reruntuhan.","Tuan, Li Jue dan Guo Si mengambil Kaisar sebagai tawanan setelah mereka menangkap Chang'an. Mereka mengendalikan istana tetapi juga saling curiga dan sering berperang, kali ini sudha berbulan-bulan lamanya, ratusan ribu orang telah mati, membuat Chang'an yang makmur menjadi seperti reruntuhan.",},
        [2180] = {2001,"","Guan Yinping","Humph, anjing menggigit anjing, mulutnya akan penuh bulu! Bukankah pada saat itu Jia Xu berkata akan menahan Li Jue dan Guo Si dan melindingi Yang Mulia dan menteri-menteri?","Humph, anjing menggigit anjing, mulutnya akan penuh bulu! Bukankah pada saat itu Jia Xu berkata akan menahan Li Jue dan Guo Si dan melindingi Yang Mulia dan menteri-menteri?",},
        [2181] = {2001,"","Protagonis","Ayo, mari kita bereskan Li Jue dan Guo Si, menemukan Jia Xu dan menyelamatkan Kaisar!","Ayo, mari kita bereskan Li Jue dan Guo Si, menemukan Jia Xu dan menyelamatkan Kaisar!",},
        [2182] = {2002,"Protagonis","Kaisar Xian Han","Hero muda, kamu telah salah sangka. Jika bukan karena mediasi Jia Xu, mungkin Li Jue dan Guo Si telah membunuhku.","Hero muda, kamu telah salah sangka. Jika bukan karena mediasi Jia Xu, mungkin Li Jue dan Guo Si telah membunuhku.",},
        [2183] = {2002,"","Protagonis","Ternyata begini. Jia Xu, akan kubiarkan kamu hidup demi Yang Mulia.","Ternyata begini. Jia Xu, akan kubiarkan kamu hidup demi Yang Mulia.",},
        [2184] = {2002,"","Jia Xu","Yang Mulia, Li Jue dan Guo Si berencana untuk membunuhku, aku harus meninggalkan Chang'an. (Jia Xu pergi)","Yang Mulia, Li Jue dan Guo Si berencana untuk membunuhku, aku harus meninggalkan Chang'an. (Jia Xu pergi)",},
        [2185] = {2002,"","Kaisar Xian Han","Jia Xu sudah pergi, siapa yang akan melindungiku sekarang? ","Jia Xu sudah pergi, siapa yang akan melindungiku sekarang? ",},
        [2186] = {2002,"","Protagonis","Yang Mulia, lebih baik kembali ke Luoyang dan meninggalkan Chang'an tempat bermasalah ini.","Yang Mulia, lebih baik kembali ke Luoyang dan meninggalkan Chang'an tempat bermasalah ini.",},
        [2187] = {2002,"","Kaisar Xian Han","Aku takut bahwa Li Jue dan Guo Si tidak akan setuju dengan kepergianku ke Kota Timur.","Aku takut bahwa Li Jue dan Guo Si tidak akan setuju dengan kepergianku ke Kota Timur.",},
        [2188] = {2002,"","Protagonis","Jangan khawatir, Yang Mulia! Guo Si telah dikalahkan, aku akan mencari Li Jue! Dia harus setuju bagaimanapun!","Jangan khawatir, Yang Mulia! Guo Si telah dikalahkan, aku akan mencari Li Jue! Dia harus setuju bagaimanapun!",},
        [2189] = {2003,"Yang Feng","Guan Yinping","Yang Feng, sebagai Menteri Han, mengapa bisa bersekongkol dengan musuh dan tidak melindungi Kaisar?","Yang Feng, sebagai Menteri Han, mengapa bisa bersekongkol dengan musuh dan tidak melindungi Kaisar?",},
        [2190] = {2003,"","Guan Yinping","Li Jue sangat serakah tapi bodoh. Dia bahkan percaya dengan ilmu gelap, tidak pernah menghargai jenderal, malah menghadiahi penyihir, dengan pemimpin seperti ini, ada hal baik apa yang bisa kamu peroleh?","Li Jue sangat serakah tapi bodoh. Dia bahkan percaya dengan ilmu gelap, tidak pernah menghargai jenderal, malah menghadiahi penyihir, dengan pemimpin seperti ini, ada hal baik apa yang bisa kamu peroleh?",},
        [2191] = {2003,"","Yang Feng","Baik! Aku telah bertarung dalam pertarungan maut dengan dia. Apakah aku lebih buruk daripada penyihir? Tunggulah kalian, aku akan memanggil pasukan dan memberontak Li Jue!","Baik! Aku telah bertarung dalam pertarungan maut dengan dia. Apakah aku lebih buruk daripada penyihir? Tunggulah kalian, aku akan memanggil pasukan dan memberontak Li Jue!",},
        [2192] = {2003,"Protagonis","Guan Yinping","Yey, pemberontakan yang dipicu oleh jenderal! Dengan prajurit Yang Feng, Tuan bisa tenang.","Yey, pemberontakan yang dipicu oleh jenderal! Dengan prajurit Yang Feng, Tuan bisa tenang.",},
        [2193] = {2003,"","Protagonis","Menurutku Yang Feng tidak seberapa hebat, tetapi jenderal dengan kapak besar terlihat bagus, siapa orang ini?","Menurutku Yang Feng tidak seberapa hebat, tetapi jenderal dengan kapak besar terlihat bagus, siapa orang ini?",},
        [2194] = {2003,"","Guan Yinping","Tuan, dia adalah Xu Huang, nama kehormatan Gongming, orang Prefektur Yang, Hedong.","Tuan, dia adalah Xu Huang, nama kehormatan Gongming, orang Prefektur Yang, Hedong.",},
        [2195] = {2003,"","Protagonis","Ternyata jenderal ternama Xu Huang, sayang sekali dia mengikut dengan Yang Feng.","Ternyata jenderal ternama Xu Huang, sayang sekali dia mengikut dengan Yang Feng.",},
        [2196] = {2004,"Dong Cheng","Kaisar Xian Han","Aku benar-benar kaisar yang memalukan. Dulu Dong Zhuo menyalahgunakan kekuasaan untuk membakar Luoyang dan memaksaku ke Chang'an. Setelah Dong Zhuo mati, ada lagi Li Jue dan Guo Si yang memberontak di Chang'an…","Aku benar-benar kaisar yang memalukan. Dulu Dong Zhuo menyalahgunakan kekuasaan untuk membakar Luoyang dan memaksaku ke Chang'an. Setelah Dong Zhuo mati, ada lagi Li Jue dan Guo Si yang memberontak di Chang'an…",},
        [2197] = {2004,"","Kaisar Xian Han","Setelah bertahun-tahun tanpa tempat tinggal dan penderitaaan, akhirnya aku dapat kembali ke Luoyang, masih ada lagi kesombongan Han Xian yang mendapatkan caranya sendiri sementara yang kelaparan harus keluar; Bahkan menteri yang mengikutiku tidak bisa memberi makan sendiri, aih!","Setelah bertahun-tahun tanpa tempat tinggal dan penderitaaan, akhirnya aku dapat kembali ke Luoyang, masih ada lagi kesombongan Han Xian yang mendapatkan caranya sendiri sementara yang kelaparan harus keluar; Bahkan menteri yang mengikutiku tidak bisa memberi makan sendiri, aih!",},
        [2198] = {2004,"","Dong Cheng","Yang Mulia, aku memiliki rencana. Anda bisa mengeluarkan dekrit rahasia untuk memanggil Cao Cao Pemimpin Yanzhou untuk tugas istana. Pasukan dan persediaannya banyak, dapat menjami keselamatan Yang Mulia.","Yang Mulia, aku memiliki rencana. Anda bisa mengeluarkan dekrit rahasia untuk memanggil Cao Cao Pemimpin Yanzhou untuk tugas istana. Pasukan dan persediaannya banyak, dapat menjami keselamatan Yang Mulia.",},
        [2199] = {2004,"","Protagonis","Ini tidak susah, Cao Cao adalah teman lamaku, aku akan memberitahu dia sekarang.","Ini tidak susah, Cao Cao adalah teman lamaku, aku akan memberitahu dia sekarang.",},
        [2200] = {2004,"","Dong Cheng","Hanya takutnya Yang Feng tidak akan senang, jenderal bawahannya Xu Huang sangat susah untuk ditangani.","Hanya takutnya Yang Feng tidak akan senang, jenderal bawahannya Xu Huang sangat susah untuk ditangani.",},
        [2201] = {2004,"","Protagonis","Yang Feng dan Han Xian tidak layak untuk disebut, Xu Huang adalah jenderal baik. Aku akan menemuinya.","Yang Feng dan Han Xian tidak layak untuk disebut, Xu Huang adalah jenderal baik. Aku akan menemuinya.",},
        [2202] = {2005,"Xu Huang","Protagonis","Kamu berani dan pintar tidak seperti kebanyakan orang. Mengapa kamu tunduk kepada orang seperti Yang dan Han?","Kamu berani dan pintar tidak seperti kebanyakan orang. Mengapa kamu tunduk kepada orang seperti Yang dan Han?",},
        [2203] = {2005,"","Xu Huang","Aku tahu dengan pasti bahwa Yang Feng dan Han Xian bukanlah orang yang menjanjikan, tetapi aku telah mengikuti mereka sangat lama, hingga tidak bisa meninggalkannya.","Aku tahu dengan pasti bahwa Yang Feng dan Han Xian bukanlah orang yang menjanjikan, tetapi aku telah mengikuti mereka sangat lama, hingga tidak bisa meninggalkannya.",},
        [2204] = {2005,"","Protagonis","Unggas yang bagus hinggap hanya di pohon yang bagus. Seorang menteri yang bijaksana hanya melayani Tuan yang baik. Cao Cao, Pemimpin Yanzhou adalah pahlawan di masanya yang sangat membutuhkan talenta, kamu bergabunglah dengannya.","Unggas yang bagus hinggap hanya di pohon yang bagus. Seorang menteri yang bijaksana hanya melayani Tuan yang baik. Cao Cao, Pemimpin Yanzhou adalah pahlawan di masanya yang sangat membutuhkan talenta, kamu bergabunglah dengannya.",},
        [2205] = {2005,"","Xu Huang","Terima kasih Hero muda, kamu telah membangunkanku dari mimpu dengan kata-katamu. Token hero ini adalah tanda terima kasihku. (Xu Huang pamit)","Terima kasih Hero muda, kamu telah membangunkanku dari mimpu dengan kata-katamu. Token hero ini adalah tanda terima kasihku. (Xu Huang pamit)",},
        [2206] = {2005,"Guan Yinping","Protagonis","Bencana alam terjadi dimana-mana tiap tahun. Meskipun kaisar telah kembali ke Luoyang di timur, tanpa negara atau prefektur yang berkontribusi dan tanpa penjaga, ini pasti bukanlah strategi jangka panjang.","Bencana alam terjadi dimana-mana tiap tahun. Meskipun kaisar telah kembali ke Luoyang di timur, tanpa negara atau prefektur yang berkontribusi dan tanpa penjaga, ini pasti bukanlah strategi jangka panjang.",},
        [2207] = {2005,"","Guan Yinping","Kaisar ini benar-benar memalukan. Tuan masih lebih baik, hidup bebas, tidak ada yang berani mengganggu.","Kaisar ini benar-benar memalukan. Tuan masih lebih baik, hidup bebas, tidak ada yang berani mengganggu.",},
        [2208] = {2005,"","Protagonis","Haha, karena dia adalah Kaisar Xian Han! Aku berbeda! Meskipun aku bukan kaisar, tetapi aku yang paling kuat! Di dunia ini semua ditentukan oleh kekuatan!","Haha, karena dia adalah Kaisar Xian Han! Aku berbeda! Meskipun aku bukan kaisar, tetapi aku yang paling kuat! Di dunia ini semua ditentukan oleh kekuatan!",},
        [2209] = {2005,"","Guan Yinping","Tuan, selanjutnya kita kemana?","Tuan, selanjutnya kita kemana?",},
        [2210] = {2005,"","Protagonis","Hehe, ayo, kutunjukkan sesuatu yang menyenangkan.","Hehe, ayo, kutunjukkan sesuatu yang menyenangkan.",},
        [2211] = {2101,"Protagonis","Zhang Xingcai","Tuan, akan pergi kemanakah kita?","Tuan, akan pergi kemanakah kita?",},
        [2212] = {2101,"","Protagonis","Yuan Shao dan Cao Cao adalah dua kekuatan terhebat saat ini, ayo, kita pergi melihat pendapat mereka tentang kembalinya kaisar ke Luoyang.","Yuan Shao dan Cao Cao adalah dua kekuatan terhebat saat ini, ayo, kita pergi melihat pendapat mereka tentang kembalinya kaisar ke Luoyang.",},
        [2213] = {2101,"","Zhang Xingcai","Tuan, kamu sepertinya memiliki senjata rahasia. Apakah kamu telah memprediksi pemikiran Yuan Shao dan Cao Cao?","Tuan, kamu sepertinya memiliki senjata rahasia. Apakah kamu telah memprediksi pemikiran Yuan Shao dan Cao Cao?",},
        [2214] = {2101,"","Protagonis","Rahasia!","Rahasia!",},
        [2215] = {2101,"","Guan Yinping","Haha, Tuan, kita harus bergabung dalam kesenangan ini, ayo!","Haha, Tuan, kita harus bergabung dalam kesenangan ini, ayo!",},
        [2216] = {2102,"Yuan Shao","Ju Shou","Jenderal lahir dari keluarga perdana menteri dengan ideal bangsawan dan kerajaan. Sekarang Kaisar miskin dan terlantar, kamu harus menyambutnya dan membangun Yecheng menjadi ibu kota.","Jenderal lahir dari keluarga perdana menteri dengan ideal bangsawan dan kerajaan. Sekarang Kaisar miskin dan terlantar, kamu harus menyambutnya dan membangun Yecheng menjadi ibu kota.",},
        [2217] = {2102,"","Ju Shou","Kendalikan kaisar untuk memerintah para pangeran, mengumpulkan pasukan untuk menghukum yang melanggar aturan. Pada saatnya, siapa yang bisa melawanmu!","Kendalikan kaisar untuk memerintah para pangeran, mengumpulkan pasukan untuk menghukum yang melanggar aturan. Pada saatnya, siapa yang bisa melawanmu!",},
        [2218] = {2102,"","Yuan Shao","Guo Tu, bagaimana menurutmu?","Guo Tu, bagaimana menurutmu?",},
        [2219] = {2102,"","Guo Tu","Menjilat kaisar sangat salah! Dinasti Han telah melemah sejak lama, untuk menghidupkannya kembali sangat tidak mudah!","Menjilat kaisar sangat salah! Dinasti Han telah melemah sejak lama, untuk menghidupkannya kembali sangat tidak mudah!",},
        [2220] = {2102,"","Guo Tu","Jika kita menerima kaisar di sisi kami, kita harus menyerahkan monumen untuk semuanya. Menaati perintah sama dengan kehilangan kekuasaan, sedangkan menolak adalah suatu kejahatan. Bukan ide yang baik.","Jika kita menerima kaisar di sisi kami, kita harus menyerahkan monumen untuk semuanya. Menaati perintah sama dengan kehilangan kekuasaan, sedangkan menolak adalah suatu kejahatan. Bukan ide yang baik.",},
        [2221] = {2102,"","Yuan Shao","Pada saat itu, Dong Zhuo membantai Luoyang dan ingin membunuhku. Aku memulai karir di Bohai dari nol dan memanggil hero di seluruh dunia untuk menyerang Dong Zhuo, memimpin pangeran-pangeran.","Pada saat itu, Dong Zhuo membantai Luoyang dan ingin membunuhku. Aku memulai karir di Bohai dari nol dan memanggil hero di seluruh dunia untuk menyerang Dong Zhuo, memimpin pangeran-pangeran.",},
        [2222] = {2102,"","Yuan Shao","Sekarang aku telah menduduki Jizhou, pemusnahan Turban Kuning di Heishan dan penyatuan Hebei sudah dekat. Mengapa aku harus menyambut kaisar untuk mengikat tanganku sendiri? ","Sekarang aku telah menduduki Jizhou, pemusnahan Turban Kuning di Heishan dan penyatuan Hebei sudah dekat. Mengapa aku harus menyambut kaisar untuk mengikat tanganku sendiri? ",},
        [2223] = {2102,"","Ju Shou","Jenderal, keberhasilan berada pada kesempatan, jika kita tidak menyerang lebih dulu, pasti akan direbut oleh orang lain!","Jenderal, keberhasilan berada pada kesempatan, jika kita tidak menyerang lebih dulu, pasti akan direbut oleh orang lain!",},
        [2224] = {2102,"","Yuan Shao","Ju Shou, cukup, aku telah mengambil keputusan!","Ju Shou, cukup, aku telah mengambil keputusan!",},
        [2225] = {2103,"Cao Cao","Xun Yu","Adipati Wen dari Jin pernah merekrut Raja Xiang dari Zhou dan menundukkan para adipati lainnya; Kaisar Gaozu dari Han pernah mengirimkan berita kematian untuk Kaisar Yi untuk memenangkan dukungan rakyat.","Adipati Wen dari Jin pernah merekrut Raja Xiang dari Zhou dan menundukkan para adipati lainnya; Kaisar Gaozu dari Han pernah mengirimkan berita kematian untuk Kaisar Yi untuk memenangkan dukungan rakyat.",},
        [2226] = {2103,"","Xun Yu","Sekarang setelah kaisar dipermalukan, kamu harus menerimanya untuk memenuhi harapan orang lain dan menunjukkan kepandaianmu. Jangan biarkan orang lain mengalahkan kita karenanya.","Sekarang setelah kaisar dipermalukan, kamu harus menerimanya untuk memenuhi harapan orang lain dan menunjukkan kepandaianmu. Jangan biarkan orang lain mengalahkan kita karenanya.",},
        [2227] = {2103,"","Dong Zhao","Sekarang jenderal-jenderal di Luoyang sangat banyak dan tidak setuju, mereka tidak tunduk pada kami. Untuk mengamankan kemenangan, kita harus tidak hanya menerima kaisar, tetapi juga memindahkan ibu kota ke Xuchang. Inilah rencana yang terbaik!","Sekarang jenderal-jenderal di Luoyang sangat banyak dan tidak setuju, mereka tidak tunduk pada kami. Untuk mengamankan kemenangan, kita harus tidak hanya menerima kaisar, tetapi juga memindahkan ibu kota ke Xuchang. Inilah rencana yang terbaik!",},
        [2228] = {2103,"","Cao Cao","Ini juga merupakan niat awalku, tanpa tunggu lebih lama lagi, aku akan memberikan monumen kepada kaisar sekarang.","Ini juga merupakan niat awalku, tanpa tunggu lebih lama lagi, aku akan memberikan monumen kepada kaisar sekarang.",},
        [2229] = {2104,"Kaisar Xian Han","Cao Cao","Aku telah bermandikan keanggunan negara ini, jadi aku ingin mengembalikan kebaikanmu. Dua kekuatan jahat Li Jue dan Guo Si penuh dengan kejahatan. Aku akan dan akan memimpin pasukan crack saya lebih dari 200.000 tentara untuk menginjak-injak mereka atas nama kebenaran. Yang Mulia, jaga kesehatan selalu, agar tetap bisa memperhatikan negara!","Aku telah bermandikan keanggunan negara ini, jadi aku ingin mengembalikan kebaikanmu. Dua kekuatan jahat Li Jue dan Guo Si penuh dengan kejahatan. Aku akan dan akan memimpin pasukan crack saya lebih dari 200.000 tentara untuk menginjak-injak mereka atas nama kebenaran. Yang Mulia, jaga kesehatan selalu, agar tetap bisa memperhatikan negara!",},
        [2230] = {2104,"","Kaisar Xian Han","Ya, tolong!","Ya, tolong!",},
        [2231] = {2104,"","Cao Cao","Yang Mulia, Ibu Kota Timur telah ditelantarkan cukup lama dan tidak bisa diperbaiki, juga pengiriman ransum tidak mudah. Ruang istana Xuchang kaya akan uang, ransum dan persedianan sebagai cadangan. Apakah Yang Mulia setuju jika aku mengajak Yang Mulia untuk pergi ke Xuchang? ","Yang Mulia, Ibu Kota Timur telah ditelantarkan cukup lama dan tidak bisa diperbaiki, juga pengiriman ransum tidak mudah. Ruang istana Xuchang kaya akan uang, ransum dan persedianan sebagai cadangan. Apakah Yang Mulia setuju jika aku mengajak Yang Mulia untuk pergi ke Xuchang? ",},
        [2232] = {2104,"","Kaisar Xian Han","Setelah waktu pengasingan yang lama, situasi berubah lebih tenang. Pemindahan lebih jauh mungkin akan mendapat kritik dari banyak orang.","Setelah waktu pengasingan yang lama, situasi berubah lebih tenang. Pemindahan lebih jauh mungkin akan mendapat kritik dari banyak orang.",},
        [2233] = {2104,"","Cao Cao","Yang Mulia, urusan ini tidak bisa diundur, mohon segera pindahkan ke Xuchang!","Yang Mulia, urusan ini tidak bisa diundur, mohon segera pindahkan ke Xuchang!",},
        [2234] = {2104,"","Kaisar Xian Han","Kalau begitu, pindahkan ke Xuchang sesuai perkataanmu!","Kalau begitu, pindahkan ke Xuchang sesuai perkataanmu!",},
        [2235] = {2105,"Guan Yinping","Protagonis","Haha, sesuai dugaan, Cao Cao adalah hero yang berani bertemu langsung dengan kaisar!","Haha, sesuai dugaan, Cao Cao adalah hero yang berani bertemu langsung dengan kaisar!",},
        [2236] = {2105,"","Guan Yinping","Yuan Shao buta, tidak mendengar perkataan Ju Shou.","Yuan Shao buta, tidak mendengar perkataan Ju Shou.",},
        [2237] = {2105,"","Zhang Xingcai","Tuan, Cao Cao mengendalikan kaisar dan memerintah para pangeran. Sekarang kekuasaan besar ada pada Keluarga Cao, sedangkan Dinasti Han hanyalah nama, takutnya Kaisar Xian akan…","Tuan, Cao Cao mengendalikan kaisar dan memerintah para pangeran. Sekarang kekuasaan besar ada pada Keluarga Cao, sedangkan Dinasti Han hanyalah nama, takutnya Kaisar Xian akan…",},
        [2238] = {2105,"","Protagonis","Xingcai terlalu panik! Saat ini, Cao Cao tidak akan membunuh Kaisar Xian jika iingin situasi stabil. Kaisar Xian bisa mati tua.","Xingcai terlalu panik! Saat ini, Cao Cao tidak akan membunuh Kaisar Xian jika iingin situasi stabil. Kaisar Xian bisa mati tua.",},
        [2239] = {2105,"","Zhang Xingcai","Perkataan Tuan masuk akal.","Perkataan Tuan masuk akal.",},
        [2240] = {2105,"","Protagonis","Kaisar Xian telah mengangkatku menjadi Jenderal Yangwei, aku akan melaksanakan kewajibanku untuk mengantarnya ke Xuchang! Ayo, kita pergi ke Xuchang!","Kaisar Xian telah mengangkatku menjadi Jenderal Yangwei, aku akan melaksanakan kewajibanku untuk mengantarnya ke Xuchang! Ayo, kita pergi ke Xuchang!",},
        [2241] = {2106,"Xun Yu","Cao Cao","Sejak kematian Zhicai, tidak ada yang bisa membahas rencana denganku. Ruying adalah tempat penuh orang aneh. Siapa yang bisa menggantikannya?","Sejak kematian Zhicai, tidak ada yang bisa membahas rencana denganku. Ruying adalah tempat penuh orang aneh. Siapa yang bisa menggantikannya?",},
        [2242] = {2106,"","Xun Yu","Guo Jia dari Yingchuan, memiliki bakat dan pandai berstrategi, adalah talenta luar biasa saat ini.","Guo Jia dari Yingchuan, memiliki bakat dan pandai berstrategi, adalah talenta luar biasa saat ini.",},
        [2243] = {2106,"","Protagonis","Guo Jia yang terkenal itu! Kakak Cao, biarkan aku bertemu dan bertarung dengannya dulu!","Guo Jia yang terkenal itu! Kakak Cao, biarkan aku bertemu dan bertarung dengannya dulu!",},
        [2244] = {2107,"Guo Jia","Xun Yu","Fengxiao, hero muda ini yang pernah kusebutkan dulu, dialah yang menenangkan Pemberontakan Sepuluh Kasim, memenggal Dong Zhuo di Paviliun Fengyi, mengalahkan Li Jue dan Guo Si, juga mengantar kaisar kembali ke Luoyang di timur.","Fengxiao, hero muda ini yang pernah kusebutkan dulu, dialah yang menenangkan Pemberontakan Sepuluh Kasim, memenggal Dong Zhuo di Paviliun Fengyi, mengalahkan Li Jue dan Guo Si, juga mengantar kaisar kembali ke Luoyang di timur.",},
        [2245] = {2107,"","Xun Yu","Kaisar telah menyatakan pada dunia, bahwa dia telah diangkat menjadi Jenderal Yangwei. Namun, dia tidak menyukai kekayaan dan ketenara, hanya menerima pangkat biasa, tidak ingin memimpin prajurit.","Kaisar telah menyatakan pada dunia, bahwa dia telah diangkat menjadi Jenderal Yangwei. Namun, dia tidak menyukai kekayaan dan ketenara, hanya menerima pangkat biasa, tidak ingin memimpin prajurit.",},
        [2246] = {2107,"Protagonis","Guo Jia","Hero muda adalah Jenderal Yangwei! Aku telah lama menantikan untuk dapat bertemu denganmu.","Hero muda adalah Jenderal Yangwei! Aku telah lama menantikan untuk dapat bertemu denganmu.",},
        [2247] = {2107,"","Guo Jia","Ahli sipil & militer, berpikiran luas, benar-benar hero di masanya, membuat orang terkagum! Aku ingin memberikan Token Hero ini pada jenderal!","Ahli sipil & militer, berpikiran luas, benar-benar hero di masanya, membuat orang terkagum! Aku ingin memberikan Token Hero ini pada jenderal!",},
        [2248] = {2107,"","Protagonis","Terima kasih, aku sangat tersanjung, hahahaha!","Terima kasih, aku sangat tersanjung, hahahaha!",},
        [2249] = {35,"Zhang Xingcai","Guan Yinping","Xingcai, aku tahu banyak tentang rahasia Tiga Negara, apakah kamu ingin tahu?","Xingcai, aku tahu banyak tentang rahasia Tiga Negara, apakah kamu ingin tahu?",},
        [2250] = {35,"","Zhang Xingcai","Tentu! Kakak yang baik, cepat beritahu aku ada rahasia apa saja?","Tentu! Kakak yang baik, cepat beritahu aku ada rahasia apa saja?",},
        [2251] = {35,"","Guan Yinping","Contohnya, Cao Cao and Yuan Shao mencuri pengantin bersama saat masih muda, Xu Shu suka berlatih pedang dan berperan sebagai pahlawan saat muda, dan Yuan Shu adalah ayah bagi semua orang…","Contohnya, Cao Cao and Yuan Shao mencuri pengantin bersama saat masih muda, Xu Shu suka berlatih pedang dan berperan sebagai pahlawan saat muda, dan Yuan Shu adalah ayah bagi semua orang…",},
        [2252] = {35,"","Zhang Xingcai","Haha, ternyata Para Hero Terkenal ini memiliki cerita yang lucu, dimanakah aku bisa melihat cerita ini?","Haha, ternyata Para Hero Terkenal ini memiliki cerita yang lucu, dimanakah aku bisa melihat cerita ini?",},
        [2253] = {35,"","Guan Yinping","Di dalam Instance Hero! Tantang Instance Hero untuk bertemu dengan lebih banyak Hero Terkenal dan telusuri latar belakang mereka.","Di dalam Instance Hero! Tantang Instance Hero untuk bertemu dengan lebih banyak Hero Terkenal dan telusuri latar belakang mereka.",},
        [2254] = {35,"","Zhang Xingcai","Tuan, kalau begitu kita pergi menantang Instance Hero pertama.","Tuan, kalau begitu kita pergi menantang Instance Hero pertama.",},
        [2255] = {36,"Zhang Xingcai","Guan Yinping","Tuan, pertama kali melewati Instance Hero, akan mendapat banyak hadiah Ingot, Ingot adalah barang yang bagus!","Tuan, pertama kali melewati Instance Hero, akan mendapat banyak hadiah Ingot, Ingot adalah barang yang bagus!",},
        [2256] = {36,"","Zhang Xingcai","Menantang Instance Hero untuk mendapatkan Roh Hero, Roh Hero bisa ditukarkan dengan Hero tingkat tinggi pada Toko Hero!","Menantang Instance Hero untuk mendapatkan Roh Hero, Roh Hero bisa ditukarkan dengan Hero tingkat tinggi pada Toko Hero!",},
        [2257] = {36,"","Guan Yinping","Tuan, ingatlah untuk menantang Instance Hero tiap harinya!","Tuan, ingatlah untuk menantang Instance Hero tiap harinya!",},
        [2258] = {37,"Zhang Xingcai","Protagonis","Xingcai, aku mendapatkan Hero Biru dan Hero Hijau, mereka sepertinya lemah dan tidak berguna!","Xingcai, aku mendapatkan Hero Biru dan Hero Hijau, mereka sepertinya lemah dan tidak berguna!",},
        [2259] = {37,"","Zhang Xingcai","Tuan, Hero hijau atau lebih kuat bisa untuk #Recycle#. Recycle untuk mendapat sumber daya yang berguna!","Tuan, Hero hijau atau lebih kuat bisa untuk #Recycle#. Recycle untuk mendapat sumber daya yang berguna!",},
        [2260] = {37,"","Zhang Xingcai","Sekarang, biarkan Xingcai beritahu cara #Recycle# Hero.","Sekarang, biarkan Xingcai beritahu cara #Recycle# Hero.",},
        [2261] = {38,"Protagonis","Zhang Xingcai","Tuan sudah melihatnya, kan? Roh Hero yang didapat dari recycle, bisa ditukar dengan Hero dan sumber daya yang berharga lainnya di Toko Hero.","Tuan sudah melihatnya, kan? Roh Hero yang didapat dari recycle, bisa ditukar dengan Hero dan sumber daya yang berharga lainnya di Toko Hero.",},
        [2262] = {38,"","Protagonis","Aku melihatnya! Roh Hero bisa ditukar dengan Hero, Pil Terobosan dan EXP Hero. Haha, aku ingin recycle semua Hero Biru dan Hero Hijau untuk ditukar dengan Roh Hero!","Aku melihatnya! Roh Hero bisa ditukar dengan Hero, Pil Terobosan dan EXP Hero. Haha, aku ingin recycle semua Hero Biru dan Hero Hijau untuk ditukar dengan Roh Hero!",},
        [2263] = {38,"","Zhang Xingcai","Tuan, Hero Ungu dan Hero Jingga yang telah diperkuat bisa juga di Recycle jika sudah tidak dibutuhkan lagi, dan bisa mendapat pengembalian penuh sumber daya dari penguatan!","Tuan, Hero Ungu dan Hero Jingga yang telah diperkuat bisa juga di Recycle jika sudah tidak dibutuhkan lagi, dan bisa mendapat pengembalian penuh sumber daya dari penguatan!",},
        [2264] = {38,"","Protagonis","Wow, bisakah?! #Pengembalian Penuh# untuk sumber daya!","Wow, bisakah?! #Pengembalian Penuh# untuk sumber daya!",},
        [2265] = {38,"","Zhang Xingcai","Ya! Selain Hero, Gear dan Artefak bisa di Recycle. Ingat untuk Recycle, Tuan.","Ya! Selain Hero, Gear dan Artefak bisa di Recycle. Ingat untuk Recycle, Tuan.",},
        [2266] = {38,"","Protagonis","Terima kasih Xingcai, pasti akan kuingat!","Terima kasih Xingcai, pasti akan kuingat!",},
        [2267] = {39,"Protagonis","Guan Yinping","Tuan, #Invasi Barbarian# sering terjadi di perbatasan barat daya, mereka sangat licik, selalu datang menyerbu saat kita sibuk bertarung pada saat kita berperang di Stage Skenario dan Blitz.","Tuan, #Invasi Barbarian# sering terjadi di perbatasan barat daya, mereka sangat licik, selalu datang menyerbu saat kita sibuk bertarung pada saat kita berperang di Stage Skenario dan Blitz.",},
        [2268] = {39,"","Protagonis","Sial, Barbarian Selatan ini ternyata licik!","Sial, Barbarian Selatan ini ternyata licik!",},
        [2269] = {39,"","Guan Yinping","Tuan jangan khawatir, menurut kami, menyerang Barbarian Selatan adalah kesempatan bertarung yang bagus! Karena dengan menyerang Barbarian Selatan akan mendapat bahan Artefak.","Tuan jangan khawatir, menurut kami, menyerang Barbarian Selatan adalah kesempatan bertarung yang bagus! Karena dengan menyerang Barbarian Selatan akan mendapat bahan Artefak.",},
        [2270] = {39,"","Protagonis","Artefak? Apa itu artefak? Kedengarannya sangat hebat.","Artefak? Apa itu artefak? Kedengarannya sangat hebat.",},
        [2271] = {39,"","Guan Yinping","Setiap Hero memiliki #Artefak Khusus#-nya masing-masing, contohnya Artefak ayahku adalah Pedang Sabit Naga, dan Artefak Da Qiao adalah Payung Teratai.","Setiap Hero memiliki #Artefak Khusus#-nya masing-masing, contohnya Artefak ayahku adalah Pedang Sabit Naga, dan Artefak Da Qiao adalah Payung Teratai.",},
        [2272] = {39,"","Guan Yinping","Tuan, pukul Barbarian Selatan beberapa kali lagi lalu bisa menuju Toko Artefak untuk membeli Artefak.","Tuan, pukul Barbarian Selatan beberapa kali lagi lalu bisa menuju Toko Artefak untuk membeli Artefak.",},
        [2273] = {39,"","Protagonis","Aku sudah tidak sabar untuk mendapatkan Artefak! Ayo serang Barbarian Selatan!","Aku sudah tidak sabar untuk mendapatkan Artefak! Ayo serang Barbarian Selatan!",},
        [2274] = {40,"Protagonis","Zhang Xingcai","Wow, selamat Tuan mencapai level 58! Bisa memasang #Insignia# pada saat level 58!","Wow, selamat Tuan mencapai level 58! Bisa memasang #Insignia# pada saat level 58!",},
        [2275] = {40,"","Protagonis","#Insignia#? Apa kegunaan Insignia?","#Insignia#? Apa kegunaan Insignia?",},
        [2276] = {40,"","Zhang Xingcai","Insignia dapat meningkatkan status Hero, contohnya tipe Guan Yinping adalah DPS, dengan memasang Isignianya akan meningkatkan serangan; Tipe Diao Chan adalah Reduksi Amarah, dengan memasang Insignianya akan mengurangi amarah.","Insignia dapat meningkatkan status Hero, contohnya tipe Guan Yinping adalah DPS, dengan memasang Isignianya akan meningkatkan serangan; Tipe Diao Chan adalah Reduksi Amarah, dengan memasang Insignianya akan mengurangi amarah.",},
        [2277] = {40,"","Zhang Xingcai","Singkatnya, Insignia memberikan lebih banyak kombinasi dan pilihan skill. Pakai Insignia untuk membuat Hero menjadi lebih kuat.","Singkatnya, Insignia memberikan lebih banyak kombinasi dan pilihan skill. Pakai Insignia untuk membuat Hero menjadi lebih kuat.",},
        [2278] = {40,"","Protagonis","Kedengarannya Insignia keren yah.","Kedengarannya Insignia keren yah.",},
        [2279] = {40,"","Zhang Xingcai","Iya! Tuan, biarkan aku memasangkan Insignia padamu.","Iya! Tuan, biarkan aku memasangkan Insignia padamu.",},
        [2280] = {41,"Protagonis","Zhang Xingcai","Hebat! Setelah memakai Insignia Guan Yinping, serangan meningkat 1000 poin!","Hebat! Setelah memakai Insignia Guan Yinping, serangan meningkat 1000 poin!",},
        [2281] = {41,"","Protagonis","Ini hanya Insignia Hero Ungu, bukankah Insignia Hero Jingga lebih kuat?","Ini hanya Insignia Hero Ungu, bukankah Insignia Hero Jingga lebih kuat?",},
        [2282] = {41,"","Zhang Xingcai","Tuan memang pintar! Semakin tinggi atribut Insignia, semakin kuat kemampuannya.","Tuan memang pintar! Semakin tinggi atribut Insignia, semakin kuat kemampuannya.",},
        [2283] = {41,"","Protagonis","Insignia sangat hebat, dimana untuk mendapatkannya?","Insignia sangat hebat, dimana untuk mendapatkannya?",},
        [2284] = {41,"","Zhang Xingcai","Tuan, Insignia sama dengan Segel Pangkat, bisa didapatkan dari Lelang! Insignia juga bisa didapatkan dari event seperti BOSS Legiun, Percobaan Legiun dan Kuis Legiun!","Tuan, Insignia sama dengan Segel Pangkat, bisa didapatkan dari Lelang! Insignia juga bisa didapatkan dari event seperti BOSS Legiun, Percobaan Legiun dan Kuis Legiun!",},
        [2285] = {41,"","Protagonis","Oh, dengan sering-sering ikut event legiun dan lelang akan mendapatkan Insignia.","Oh, dengan sering-sering ikut event legiun dan lelang akan mendapatkan Insignia.",},
        [2286] = {41,"","Zhang Xingcai","Ya, Tuan bisa melihat Galeri Insignia untuk mempelajari bagaimana cara menggabungkannya untuk mendapatkan yang lebih kuat.","Ya, Tuan bisa melihat Galeri Insignia untuk mempelajari bagaimana cara menggabungkannya untuk mendapatkan yang lebih kuat.",},
        [2287] = {41,"","Protagonis","Oke, terima kasih Xingcai!","Oke, terima kasih Xingcai!",},
        [2288] = {41,"","Zhang Xingcai","Tidak masalah, Tuanku! Aku akan selalu bersamamu!","Tidak masalah, Tuanku! Aku akan selalu bersamamu!",},
        [2289] = {42,"Protagonis","Guan Yinping","Tuan telah mencapai level 70, sangat kuat dan terkenal, hingga Pet juga ingin bergabung untuk bertarung!","Tuan telah mencapai level 70, sangat kuat dan terkenal, hingga Pet juga ingin bergabung untuk bertarung!",},
        [2290] = {42,"","Protagonis","Pet? Seperti Naga, Macan Putih, Suzaku, Kura Hitam?","Pet? Seperti Naga, Macan Putih, Suzaku, Kura Hitam?",},
        [2291] = {42,"","Guan Yinping","Ya, di Daratan Tiongkok, ada legenda tentang Pet, hanya orang yang terpilih dan pejuang sejati yang dapat melihatnya. Ayahku Guan Yu pernah mendapat berkat Naga Tsunami.","Ya, di Daratan Tiongkok, ada legenda tentang Pet, hanya orang yang terpilih dan pejuang sejati yang dapat melihatnya. Ayahku Guan Yu pernah mendapat berkat Naga Tsunami.",},
        [2292] = {42,"","Protagonis","Pantas kakak kedua begini hebat, ternyata ada berkat dari Pet! Aku juga ingin Pet untuk diriku sendiri!","Pantas kakak kedua begini hebat, ternyata ada berkat dari Pet! Aku juga ingin Pet untuk diriku sendiri!",},
        [2293] = {42,"","Guan Yinping","Tuan jangan khawatir, kami telah mempersiapkan Pet pertama untuk Tuan. Sekarang biarkan Yinping membawa Tuan untuk melihat-lihat.","Tuan jangan khawatir, kami telah mempersiapkan Pet pertama untuk Tuan. Sekarang biarkan Yinping membawa Tuan untuk melihat-lihat.",},
        [2294] = {43,"Protagonis","Guan Yinping","Tuan, ini Pet pertama Tuan!","Tuan, ini Pet pertama Tuan!",},
        [2295] = {43,"","Protagonis","Ternyata adalah kombo Panda ayah dan anak! Panda besar terlihat tangguh, yang kecil sangat lucu!","Ternyata adalah kombo Panda ayah dan anak! Panda besar terlihat tangguh, yang kecil sangat lucu!",},
        [2296] = {43,"","Guan Yinping","Tuan, Pet berada pada posisi ke-7 saat bertarung, sama dengan bertambah satu Hero lagi.","Tuan, Pet berada pada posisi ke-7 saat bertarung, sama dengan bertambah satu Hero lagi.",},
        [2297] = {43,"","Protagonis","Yinping, panda hanya tingkat biru. Dimana untuk mendapat Pet lebih hebat?","Yinping, panda hanya tingkat biru. Dimana untuk mendapat Pet lebih hebat?",},
        [2298] = {43,"","Guan Yinping","Tuan bisa menukarkan #Roh Pet# dengan Pet di Toko Pet.","Tuan bisa menukarkan #Roh Pet# dengan Pet di Toko Pet.",},
        [2299] = {43,"","Protagonis","Bagaimana cara mendapatkan #Roh Pet#?","Bagaimana cara mendapatkan #Roh Pet#?",},
        [2300] = {43,"","Guan Yinping","Rumah Pet dapat menghasilkan Roh Pet. Biarkan aku membawamu kesana.","Rumah Pet dapat menghasilkan Roh Pet. Biarkan aku membawamu kesana.",},
        [2301] = {44,"Protagonis","Guan Yinping","Tuan, lihat, ini adalah Rumah Pet.","Tuan, lihat, ini adalah Rumah Pet.",},
        [2302] = {44,"","Guan Yinping","Ada Pohon Dewa di Rumah Pet. Pohon Dewa ini dibentuk dari aura langit dan bumu, mampu untuk memadatkan Roh Pet yang dapat menarik Pet. Semakin tinggi level Pohon Dewa, Roh Pet yang dihasilkan juga semakin banyak.","Ada Pohon Dewa di Rumah Pet. Pohon Dewa ini dibentuk dari aura langit dan bumu, mampu untuk memadatkan Roh Pet yang dapat menarik Pet. Semakin tinggi level Pohon Dewa, Roh Pet yang dihasilkan juga semakin banyak.",},
        [2303] = {44,"","Protagonis","Mengerti! Meningkatkan Pohon Dewa untuk mendapatkan lebih banyak Roh Pet! Roh Pet bisa ditukar dengan Pet level tinggi di Toko Pet.","Mengerti! Meningkatkan Pohon Dewa untuk mendapatkan lebih banyak Roh Pet! Roh Pet bisa ditukar dengan Pet level tinggi di Toko Pet.",},
        [2304] = {44,"","Guan Yinping","Hebat, Tuan! Mengerti dengan cepat, jadi Tuan ingatlah untuk meningkatkan Pohon Dewa!","Hebat, Tuan! Mengerti dengan cepat, jadi Tuan ingatlah untuk meningkatkan Pohon Dewa!",},
        [2305] = {44,"","Protagonis","Pastinya, aku mau Pet paling hebat di dunia!","Pastinya, aku mau Pet paling hebat di dunia!",},
        [2306] = {44,"","Guan Yinping","Tuan, semangat! Tuan akan segera menguasai Tiga Negara!","Tuan, semangat! Tuan akan segera menguasai Tiga Negara!",},
        [2307] = {2201,"Xun Yu","Cao Cao","Liu Bei menempatkan prajurit di Xuzhou dan memerintah provinsi itu; Lu Bu pergi dan mencari bantuan setelah kekalahannya, Liu Bei membiarkannya tinggal di Peixian. Jika dua orang itu menyerang bersama, ini akan menjadi masalah besar. Kalian memiliki rencana apa?","Liu Bei menempatkan prajurit di Xuzhou dan memerintah provinsi itu; Lu Bu pergi dan mencari bantuan setelah kekalahannya, Liu Bei membiarkannya tinggal di Peixian. Jika dua orang itu menyerang bersama, ini akan menjadi masalah besar. Kalian memiliki rencana apa?",},
        [2308] = {2201,"","Xun Yu","Sekarang Xuchang baru dibangun sebagai ibu kota, tidak bisa bertempur sesuka hati. Aku memiliki rencana, bernama dua macan bertarung untuk makanan, membuat Liu Bei membunuh Lu Bu.","Sekarang Xuchang baru dibangun sebagai ibu kota, tidak bisa bertempur sesuka hati. Aku memiliki rencana, bernama dua macan bertarung untuk makanan, membuat Liu Bei membunuh Lu Bu.",},
        [2309] = {2201,"","Cao Cao","Mata-mata baru saja melaporkan, rencana ini telah diselesaikan Liu Bei, Liu Bei tidak membunuh Lu Bu.","Mata-mata baru saja melaporkan, rencana ini telah diselesaikan Liu Bei, Liu Bei tidak membunuh Lu Bu.",},
        [2310] = {2201,"","Xun Yu","Ada satu rencana lagi, bernama Dorong macan untuk melahap serigala. Kamu bisa membuat dekrit untuk memerintahkan Liu Bei menekan Yuan Shu, dan beritahu Yuan Shu di belakang bahwa Liu Bei akan menyerang Nanjun. Saat dua sisi saling berperang, Lu Bu akan menjadi penjaga pagar.","Ada satu rencana lagi, bernama Dorong macan untuk melahap serigala. Kamu bisa membuat dekrit untuk memerintahkan Liu Bei menekan Yuan Shu, dan beritahu Yuan Shu di belakang bahwa Liu Bei akan menyerang Nanjun. Saat dua sisi saling berperang, Lu Bu akan menjadi penjaga pagar.",},
        [2311] = {2201,"","Cao Cao","Rencana bagus! Lakukan seperti yang kamu katakan.","Rencana bagus! Lakukan seperti yang kamu katakan.",},
        [2312] = {2201,"","Protagonis","Kabar buruk, Cao Cao ingin melawan kakak! Kita pergi mencari kakak dan beritahu dia, agar dia tidak jatuh pada perangkap Cao Cao!","Kabar buruk, Cao Cao ingin melawan kakak! Kita pergi mencari kakak dan beritahu dia, agar dia tidak jatuh pada perangkap Cao Cao!",},
        [2313] = {2202,"Liu Bei","Yuan Shu","Liu Bei awalnya hanya perajut sandal, sekarang dia memiliki Xuzhou dan mendaki pangkatnya di antara pejabat. Aku sedang menyerang dia, tetapi dia berani menyerangku! Sial!","Liu Bei awalnya hanya perajut sandal, sekarang dia memiliki Xuzhou dan mendaki pangkatnya di antara pejabat. Aku sedang menyerang dia, tetapi dia berani menyerangku! Sial!",},
        [2314] = {2202,"","Liu Bei","Atas dekrit kaisar, aku akan menghukum siapapun yang melanggar perintah. Kamu berani melawanku, dosamu sangat besar, matipun tidak akan disesalkan!","Atas dekrit kaisar, aku akan menghukum siapapun yang melanggar perintah. Kamu berani melawanku, dosamu sangat besar, matipun tidak akan disesalkan!",},
        [2315] = {2202,"","Protagonis","Kakak, ini adalah kejahatan Yuan Shu, biarkan kuberi pelajaran padanya!","Kakak, ini adalah kejahatan Yuan Shu, biarkan kuberi pelajaran padanya!",},
        [2316] = {2203,"","Protagonis","Kakak, jangan serang Yuan Shu, ini adalah siasat Cao Cao.","Kakak, jangan serang Yuan Shu, ini adalah siasat Cao Cao.",},
        [2317] = {2203,"","Liu Bei","Meskipun ini siasat, tetapi perintah raja tidak bisa dilanggar. Yu, Fei, siapakah dari kalian yang bisa melindungi kota?","Meskipun ini siasat, tetapi perintah raja tidak bisa dilanggar. Yu, Fei, siapakah dari kalian yang bisa melindungi kota?",},
        [2318] = {2203,"","Zhang Fei","Aku.","Aku.",},
        [2319] = {2203,"","Liu Bei","Kamu tidak bisa melindungi kota. Pertama, karena setelah minum-minum kamu menyerang prajuritmu. Kedua, saat kamu bertindak, tidak menerima opini orang lain dan bertindak ceroboh, aku tidak bisa tenang.","Kamu tidak bisa melindungi kota. Pertama, karena setelah minum-minum kamu menyerang prajuritmu. Kedua, saat kamu bertindak, tidak menerima opini orang lain dan bertindak ceroboh, aku tidak bisa tenang.",},
        [2320] = {2203,"","Zhang Fei","Mulai sekarang, aku tidak minum arak, tidak memukul prajurit, dan akan berpikiran terbuka.","Mulai sekarang, aku tidak minum arak, tidak memukul prajurit, dan akan berpikiran terbuka.",},
        [2321] = {2203,"","Protagonis","Kakak ketiga, jaga baik-baik kota ini, aku akan membantu kakak pertama dan kedua menyerang Yuan Shu.","Kakak ketiga, jaga baik-baik kota ini, aku akan membantu kakak pertama dan kedua menyerang Yuan Shu.",},
        [2322] = {2204,"Liu Bei","Protagonis","Lu Bu sangat membencikan. Dia merebut Xuzhou saat tentara kami keluar.","Lu Bu sangat membencikan. Dia merebut Xuzhou saat tentara kami keluar.",},
        [2323] = {2204,"","Liu Bei","Jangan marah! Lu Bu telah mengembalikan keluargaku dan kedua istriku bersama dengan makanan dan satin sebagai hadiah. Adik ketiga memang bersalah. Aku dan Fengxian telah berdamai, dia mengambil Xuzhou dan aku mengambil Peixian.","Jangan marah! Lu Bu telah mengembalikan keluargaku dan kedua istriku bersama dengan makanan dan satin sebagai hadiah. Adik ketiga memang bersalah. Aku dan Fengxian telah berdamai, dia mengambil Xuzhou dan aku mengambil Peixian.",},
        [2324] = {2204,"","Liu Bei","Saat ini, jika aku bertarung dengan Lu Bu, bukankah sama dengan keinginan Cao Cao, membuat Cao Cao dan Yuan Shu akan mendapat keuntungan dari hal ini.","Saat ini, jika aku bertarung dengan Lu Bu, bukankah sama dengan keinginan Cao Cao, membuat Cao Cao dan Yuan Shu akan mendapat keuntungan dari hal ini.",},
        [2325] = {2204,"","Protagonis","Meskipun begitu, tetapi aku tidak bisa menerima penghinaan ini. Kakak, tunggulah, aku akan mencari keadilan untukmu dari Lu Bu!","Meskipun begitu, tetapi aku tidak bisa menerima penghinaan ini. Kakak, tunggulah, aku akan mencari keadilan untukmu dari Lu Bu!",},
        [2326] = {2205,"Protagonis","Ji Ling","Dimana Liu Bei? Dengan nama Tuan Yuan Shu, aku memimpin 100.000 prajurit untuk menangkap Liu Bei!","Dimana Liu Bei? Dengan nama Tuan Yuan Shu, aku memimpin 100.000 prajurit untuk menangkap Liu Bei!",},
        [2327] = {2205,"","Protagonis","Ji Ling, hentikan omong kosongnya! Kamu adalah lawan yang telah kukalahkan! Kakakku adalah pahlawan yang membasmi Turban Kuning, apakah kamu lebih baik dari 1 juta pasukan Turban Kuning dan berani menyerang kakakku?","Ji Ling, hentikan omong kosongnya! Kamu adalah lawan yang telah kukalahkan! Kakakku adalah pahlawan yang membasmi Turban Kuning, apakah kamu lebih baik dari 1 juta pasukan Turban Kuning dan berani menyerang kakakku?",},
        [2328] = {2205,"","Lu Bu","Hero muda, dengarkan aku!","Hero muda, dengarkan aku!",},
        [2329] = {2205,"","Protagonis","Kamu merebut Xuzhou milik kakakku, kamulah yang seharusnya dihajar!","Kamu merebut Xuzhou milik kakakku, kamulah yang seharusnya dihajar!",},
        [2330] = {2206,"Protagonis","Lu Bu","Haha, aku suka temperamenmu, tetapi aku tidak menyarankan kalian berdua untuk membunuh.","Haha, aku suka temperamenmu, tetapi aku tidak menyarankan kalian berdua untuk membunuh.",},
        [2331] = {2206,"","Lu Bu","Gerbang itu berjarak 150 langkah dari prajurit tengah. Jika aku menembak lubang di atas halberd dengan satu tembakan, kalian berdua akan menarik prajurit. Jika tidak kena, kalian kembali ke kamp untuk mengatur pertempuran. ","Gerbang itu berjarak 150 langkah dari prajurit tengah. Jika aku menembak lubang di atas halberd dengan satu tembakan, kalian berdua akan menarik prajurit. Jika tidak kena, kalian kembali ke kamp untuk mengatur pertempuran. ",},
        [2332] = {2206,"","Lu Bu","Hya! (Lu Bu mengambil busur dan panah, lalu menembak ke atas halberd dengan satu tembakan) Hahaha, langit telah berbicara.","Hya! (Lu Bu mengambil busur dan panah, lalu menembak ke atas halberd dengan satu tembakan) Hahaha, langit telah berbicara.",},
        [2333] = {2206,"","Protagonis","Busur ditarik seperti bulan purnama, menembakkan panah secepat bintang jatuh! Baiklah, karena Lu Bu ingin berdamai, maka berdamailah. Ji Ling, jika kamu berani menyerang lagi, jangan salahkan aku kalau tidak sopan.","Busur ditarik seperti bulan purnama, menembakkan panah secepat bintang jatuh! Baiklah, karena Lu Bu ingin berdamai, maka berdamailah. Ji Ling, jika kamu berani menyerang lagi, jangan salahkan aku kalau tidak sopan.",},
        [2334] = {2206,"","Ji Ling","Tidak berani! Aku mundur sekarang!","Tidak berani! Aku mundur sekarang!",},
        [2335] = {2206,"","Lu Bu","Xuande, Token Hero ini adalah tanda permintaan maafku, aku bersedia untuk mengembalikan Xuzhou kepadamu!","Xuande, Token Hero ini adalah tanda permintaan maafku, aku bersedia untuk mengembalikan Xuzhou kepadamu!",},
        [2336] = {2206,"","Liu Bei","Tidak. Aku sudah lama ingin memberikannya kepadamu. Biarkan aku tinggal di Peixian sehingga kita bisa saling mendukung melawan musuh di masa depan.","Tidak. Aku sudah lama ingin memberikannya kepadamu. Biarkan aku tinggal di Peixian sehingga kita bisa saling mendukung melawan musuh di masa depan.",},
        [2337] = {2206,"","Liu Bei","Adik keempat, ambil Token Hero ini.","Adik keempat, ambil Token Hero ini.",},
        [2338] = {2206,"","Protagonis","Terima kasih, kakak. Dengan aku disini, Yuan Shu tidak akan berani maju lagi!","Terima kasih, kakak. Dengan aku disini, Yuan Shu tidak akan berani maju lagi!",},
        [2339] = {2301,"Yuan Shu","Ji Ling","Tuan, Lu Bu menembakkan tombaknya dan memaksaku mundur, tidak ada hubungannya denganku.","Tuan, Lu Bu menembakkan tombaknya dan memaksaku mundur, tidak ada hubungannya denganku.",},
        [2340] = {2301,"","Yuan Shu","Aku memberikan Lu Bu begitu banyak makanan dan pakaian, tidak hanya dia menerima seperti bukan apa-apa, dia masih membantu Liu Bei!","Aku memberikan Lu Bu begitu banyak makanan dan pakaian, tidak hanya dia menerima seperti bukan apa-apa, dia masih membantu Liu Bei!",},
        [2341] = {2301,"","Yuan Shu","Seseorang, aku akan mengirimkan banyak prajurit dan pergi sendiri untuk menyerang Liu Bei juga menekan Lu Bu.","Seseorang, aku akan mengirimkan banyak prajurit dan pergi sendiri untuk menyerang Liu Bei juga menekan Lu Bu.",},
        [2342] = {2301,"","Ji Ling","Tuan, jangan tergesa-gesa. Lu Bu sangat kuat dan dia memiliki Xuzhou, jika dia dan Liu Bei saling berhubungan, ini akan menjadi masalah.","Tuan, jangan tergesa-gesa. Lu Bu sangat kuat dan dia memiliki Xuzhou, jika dia dan Liu Bei saling berhubungan, ini akan menjadi masalah.",},
        [2343] = {2301,"","Ji Ling","Aku mendengar Lu Bu memiliki seorang putri, sudah pada usia untuk menikah. Tuan memiliki seorang putra, bisa menikahkannya dengan putri Lu Bu.","Aku mendengar Lu Bu memiliki seorang putri, sudah pada usia untuk menikah. Tuan memiliki seorang putra, bisa menikahkannya dengan putri Lu Bu.",},
        [2344] = {2301,"","Yuan Shu","Rencana bagus, pada saatnya aku menjadi keluarga dengan Lu Bu, akan kujanjikan dia keuntungan lebih lagi, dengan begini di dunia ini tidak ada yang bisa menghentikanku. Waktuku menjadi kaisar sudah dekat.","Rencana bagus, pada saatnya aku menjadi keluarga dengan Lu Bu, akan kujanjikan dia keuntungan lebih lagi, dengan begini di dunia ini tidak ada yang bisa menghentikanku. Waktuku menjadi kaisar sudah dekat.",},
        [2345] = {2302,"Nyonya Yan","Lu Bu","Yuan Shu mengirimkan orang untuk aliansi pernikahan, bagaimana menurut kalian akan hal ini?","Yuan Shu mengirimkan orang untuk aliansi pernikahan, bagaimana menurut kalian akan hal ini?",},
        [2346] = {2302,"","Nyonya Yan","Tuan Yuan telah mendominasi Huainan cukup lama, memiliki banyak tentara dan ransum, cepat atau lambat akan menjadi kaisar. Dia hanya memiliki seorang putra, jika kita menikahkan putri kami kepadanya, dia akan menjadi Ibu Suri di masa depan.","Tuan Yuan telah mendominasi Huainan cukup lama, memiliki banyak tentara dan ransum, cepat atau lambat akan menjadi kaisar. Dia hanya memiliki seorang putra, jika kita menikahkan putri kami kepadanya, dia akan menjadi Ibu Suri di masa depan.",},
        [2347] = {2302,"","Chen Gong","Sekarang para pangeran saling berebut untuk menjadi yang terhebat dan kamu berusaha untuk mendapatkan aliansi pernikahan, mereka pasti cemburu. Bagaimana jika dia diambil dengan serangan mendadak pada saat di jalan. Segera kriimkan Ling Ju ke Shouchun, tinggal dulu di penginapan, lalu memilih kesempatan untuk menikahkannya, untuk menghindari adanya kesalahan.","Sekarang para pangeran saling berebut untuk menjadi yang terhebat dan kamu berusaha untuk mendapatkan aliansi pernikahan, mereka pasti cemburu. Bagaimana jika dia diambil dengan serangan mendadak pada saat di jalan. Segera kriimkan Ling Ju ke Shouchun, tinggal dulu di penginapan, lalu memilih kesempatan untuk menikahkannya, untuk menghindari adanya kesalahan.",},
        [2348] = {2302,"","Lu Bu","Haha, kalau begitu biarkan Lu Lingju menikahinya. Seseorang, laporkan kembali ke Yuan Shu dengan cepat, aku bersedia untuk menikahkan putriku.","Haha, kalau begitu biarkan Lu Lingju menikahinya. Seseorang, laporkan kembali ke Yuan Shu dengan cepat, aku bersedia untuk menikahkan putriku.",},
        [2349] = {2303,"Lu Bu","Chen Gui","Aku dengar kamu akan meninggal, jadi aku datang untuk menyatakan belasungkawa.","Aku dengar kamu akan meninggal, jadi aku datang untuk menyatakan belasungkawa.",},
        [2350] = {2303,"","Lu Bu","Mengapa berkata seperti ini?","Mengapa berkata seperti ini?",},
        [2351] = {2303,"","Chen Gui","Yuan Shu memiliki niat untuk menyebut dirinya sebagai kaisar, dengan melakukannya, maka sama dengan memberontak. Jika kalian berdua menjadi keluarga, kamu tidak akan diterima oleh semua orang di dunia.","Yuan Shu memiliki niat untuk menyebut dirinya sebagai kaisar, dengan melakukannya, maka sama dengan memberontak. Jika kalian berdua menjadi keluarga, kamu tidak akan diterima oleh semua orang di dunia.",},
        [2352] = {2303,"","Protagonis","Akhirnya! Lu Bu, dengar-dengar kamu akan menikahkan putrimu dengan putra Yuan Shu, jangan lakukan itu!","Akhirnya! Lu Bu, dengar-dengar kamu akan menikahkan putrimu dengan putra Yuan Shu, jangan lakukan itu!",},
        [2353] = {2303,"","Lu Bu","Hero muda, mengapa berkata seperti ini?","Hero muda, mengapa berkata seperti ini?",},
        [2354] = {2303,"","Protagonis","Setelah insiden Li Jue dan Guo Si, kamu berpihak pada Yuan Shu tetapi dia selalu membuat susah untukmu, apakah kamu lupa? Tikus seperti Yuan Shu ini, akan membawamu pada masalah di masa depan, jika kamu mengikut padanya.","Setelah insiden Li Jue dan Guo Si, kamu berpihak pada Yuan Shu tetapi dia selalu membuat susah untukmu, apakah kamu lupa? Tikus seperti Yuan Shu ini, akan membawamu pada masalah di masa depan, jika kamu mengikut padanya.",},
        [2355] = {2303,"","Lu Bu","Aku percaya padamu! Chen Gong menyesatkanku! Seseorang, cepat bawa Lingju kembali!","Aku percaya padamu! Chen Gong menyesatkanku! Seseorang, cepat bawa Lingju kembali!",},
        [2356] = {2303,"","Protagonis","Ini tidak bisa ditunda lagi. Aku segera pergi!","Ini tidak bisa ditunda lagi. Aku segera pergi!",},
        [2357] = {2304,"Protagonis","Diao Chan","Fengxian, Hero muda membawa kembali Lingju!","Fengxian, Hero muda membawa kembali Lingju!",},
        [2358] = {2304,"","Protagonis","Yang diminta oleh Nona Diao Chan, pasti akan kulakukan dengan baik!","Yang diminta oleh Nona Diao Chan, pasti akan kulakukan dengan baik!",},
        [2359] = {2304,"","Diao Chan","Fengxian, aku merasa, urusan pernikahan meskipun ada tuntunan dari orang tua, tetapi keinginan Lingju sendiri juga tidak dapat diabaikan. Jika dia tidak ingin menikah, bukankah ini menyia-nyiakan hidupnya?","Fengxian, aku merasa, urusan pernikahan meskipun ada tuntunan dari orang tua, tetapi keinginan Lingju sendiri juga tidak dapat diabaikan. Jika dia tidak ingin menikah, bukankah ini menyia-nyiakan hidupnya?",},
        [2360] = {2304,"","Lu Bu","Perkataan Chan benar.","Perkataan Chan benar.",},
        [2361] = {2304,"","Protagonis","Lu Bu, kamu juga merupakan pahlawan pada saat ini, mengapa menggunakan putri sendiri untuk mempertaruhkan masa depan?","Lu Bu, kamu juga merupakan pahlawan pada saat ini, mengapa menggunakan putri sendiri untuk mempertaruhkan masa depan?",},
        [2362] = {2304,"","Lu Bu","Benar sekali! Sebagai petarung hebat yang melangkahi tanah ini layaknya macan, aku tidak takut dengan siapapun! Dan putriku bisa menikah dengan siapapun yang dia mau! Aku akan menanyakan keinginan Lingju sekarang.","Benar sekali! Sebagai petarung hebat yang melangkahi tanah ini layaknya macan, aku tidak takut dengan siapapun! Dan putriku bisa menikah dengan siapapun yang dia mau! Aku akan menanyakan keinginan Lingju sekarang.",},
        [2363] = {2305,"Protagonis","Lu Bu","Hero muda silahkan ambil Token Hero ini, jika bukan karenamu, aku pasti akan membuat kesalahan besar!","Hero muda silahkan ambil Token Hero ini, jika bukan karenamu, aku pasti akan membuat kesalahan besar!",},
        [2364] = {2305,"","Protagonis","Tidak masalah! Terima kasih!","Tidak masalah! Terima kasih!",},
        [2365] = {2305,"","Lu Lingju","Ayah, aku tidak mau menikahi anak Yuan Shu, aku mau menikah dengan Hero besar, tidak ingin menikah dengan pengecut!","Ayah, aku tidak mau menikahi anak Yuan Shu, aku mau menikah dengan Hero besar, tidak ingin menikah dengan pengecut!",},
        [2366] = {2305,"","Lu Bu","Lingju, ayah tidak akan memaksamu untuk menikah lagi. Katakan, kamu ingin menikah dengan Hero mana?","Lingju, ayah tidak akan memaksamu untuk menikah lagi. Katakan, kamu ingin menikah dengan Hero mana?",},
        [2367] = {2305,"","Lu Lingju","Aku mendengar bahwa kaisar mengangkat Jenderal Yangwei baru, masih muda dan berbakat, aku ingin menikah dengannya!","Aku mendengar bahwa kaisar mengangkat Jenderal Yangwei baru, masih muda dan berbakat, aku ingin menikah dengannya!",},
        [2368] = {2305,"","Protagonis","Ah, apakah kamu ingin menikah denganku? (Jika begitu, bukankah Diao Chan akan menjadi mertuaku? Tidak bisa!)","Ah, apakah kamu ingin menikah denganku? (Jika begitu, bukankah Diao Chan akan menjadi mertuaku? Tidak bisa!)",},
        [2369] = {2305,"","Protagonis","Terima kasih atas kebaikanmu, aku masih muda, belum ingin menikah, sampai jumpa!","Terima kasih atas kebaikanmu, aku masih muda, belum ingin menikah, sampai jumpa!",},
        [2370] = {2305,"","Lu Lingju","Jenderal Yangwei, jangan lari, meskipun kamu lari ke ujung dunia, aku masih akan menikahimu!","Jenderal Yangwei, jangan lari, meskipun kamu lari ke ujung dunia, aku masih akan menikahimu!",},
        [2371] = {2401,"Liu Bei","Lu Bu","Xuande, aku menembakkan halberd untuk menyelamatkanmu, mengapa kamu berpura-pura menjadi bandit, merampok 150 kuda baik dariku?","Xuande, aku menembakkan halberd untuk menyelamatkanmu, mengapa kamu berpura-pura menjadi bandit, merampok 150 kuda baik dariku?",},
        [2372] = {2401,"","Liu Bei","Karena kekurangan kuda, aku memerintahkan orang-orangku membeli, tapi aku tidak akan merampokmu.","Karena kekurangan kuda, aku memerintahkan orang-orangku membeli, tapi aku tidak akan merampokmu.",},
        [2373] = {2401,"","Zhang Fei","Lu Bu, akulah yang mengambil kuda bagusmu, jangan memfitnah kakakku.","Lu Bu, akulah yang mengambil kuda bagusmu, jangan memfitnah kakakku.",},
        [2374] = {2401,"","Lu Bu","Bandit Mata Cincin, beraninya menghinaku berkali-kali?","Bandit Mata Cincin, beraninya menghinaku berkali-kali?",},
        [2375] = {2401,"","Zhang Fei","Kamu terganggu denganku mengambil kudamu? Bagaimana dengan kamu mengambil Xuzhou kakakku?","Kamu terganggu denganku mengambil kudamu? Bagaimana dengan kamu mengambil Xuzhou kakakku?",},
        [2376] = {2401,"","Lu Bu","Humph, mari kita lihat kemampuan masing-masing. Aku akan memimpin prajuritku untuk mengambil kembali kuda-kudaku!","Humph, mari kita lihat kemampuan masing-masing. Aku akan memimpin prajuritku untuk mengambil kembali kuda-kudaku!",},
        [2377] = {2402,"Protagonis","Guan Yinping","Tuan, Tuan, gawat! Lu Bu membawa pasukan menyerang Peixian! Pasukan Lu Bu berkali lipat lebih banyak dari ayahku, apa yang harus dilakukan?","Tuan, Tuan, gawat! Lu Bu membawa pasukan menyerang Peixian! Pasukan Lu Bu berkali lipat lebih banyak dari ayahku, apa yang harus dilakukan?",},
        [2378] = {2402,"","Zhang Xingcai","Itu pasti kesalahan ayahku lagi! Dia selalu gegabah dan tidak patuh, suka minum dan membuat masalah, apa yang harus kita lakukan?","Itu pasti kesalahan ayahku lagi! Dia selalu gegabah dan tidak patuh, suka minum dan membuat masalah, apa yang harus kita lakukan?",},
        [2379] = {2402,"","Protagonis","Xingcai, Yinping, jangan khawatir, aku segera membantunya!","Xingcai, Yinping, jangan khawatir, aku segera membantunya!",},
        [2380] = {2402,"","Protagonis","Lu Bu, jika aku bisa membantu mengembalikan kuda-kudamu, maka kamu harus mundur. Jika aku gagal, kamu bisa mengirimkan lagi prajuritmu, bagaimana?","Lu Bu, jika aku bisa membantu mengembalikan kuda-kudamu, maka kamu harus mundur. Jika aku gagal, kamu bisa mengirimkan lagi prajuritmu, bagaimana?",},
        [2381] = {2402,"","Lu Bu","Baiklah, untuk kebaikan Hero muda, maka begini saja.","Baiklah, untuk kebaikan Hero muda, maka begini saja.",},
        [2382] = {2403,"Protagonis","Guan Yu","Adik keempat, mengapa kamu membantu orang luar melawan kakak?","Adik keempat, mengapa kamu membantu orang luar melawan kakak?",},
        [2383] = {2403,"","Protagonis","Kakak kedua jangan menyalahkanku, aku memiliki alasan sendiri!","Kakak kedua jangan menyalahkanku, aku memiliki alasan sendiri!",},
        [2384] = {2404,"Protagonis","Zhang Fei","Adik keempat, jika kamu membelot dan membantu orang itu, jangan salahkan aku jika tidak mengenalmu!","Adik keempat, jika kamu membelot dan membantu orang itu, jangan salahkan aku jika tidak mengenalmu!",},
        [2385] = {2404,"","Protagonis","Kakak ketiga, jangan salah paham, dengarkan aku dulu.","Kakak ketiga, jangan salah paham, dengarkan aku dulu.",},
        [2386] = {2404,"","Zhang Fei","Siapa yang ingin mendengar omong kosongmu! Huh! Terima ini!","Siapa yang ingin mendengar omong kosongmu! Huh! Terima ini!",},
        [2387] = {2405,"Zhang Fei","Protagonis","Kakak ketiga, kamu salah sangka. Aku disini untuk membantu kalian bertiga. Ini adalah strategi untuk mengulur waktu.","Kakak ketiga, kamu salah sangka. Aku disini untuk membantu kalian bertiga. Ini adalah strategi untuk mengulur waktu.",},
        [2388] = {2405,"","Protagonis","Sebagai tangan kanan Lu Bu, Chen Gong selalu tidak baik pada Liu Bei. Sementara Lu Bu sibuk mengumpulkan prajurit, aku akan mengantar kalian keluar, Peixian ini kalau tidak mau juga tidak masalah!","Sebagai tangan kanan Lu Bu, Chen Gong selalu tidak baik pada Liu Bei. Sementara Lu Bu sibuk mengumpulkan prajurit, aku akan mengantar kalian keluar, Peixian ini kalau tidak mau juga tidak masalah!",},
        [2389] = {2405,"","Zhang Fei","Ternyata begini, kakak ketiga adalah orang yang kasar, jika telah menyinggungmu, janganlah marah.","Ternyata begini, kakak ketiga adalah orang yang kasar, jika telah menyinggungmu, janganlah marah.",},
        [2390] = {2405,"","Zhang Xingcai","Ayah, kamu terlalu suka minum, melalaikan pekerjaan, hampir membuat kita terbunuh. Jangan minum-minum lagi untuk seterusnya.","Ayah, kamu terlalu suka minum, melalaikan pekerjaan, hampir membuat kita terbunuh. Jangan minum-minum lagi untuk seterusnya.",},
        [2391] = {2405,"","Protagonis","Sebaiknya kita meninggalkan kota ini dan bergabung Cao Cao di Xuchang.","Sebaiknya kita meninggalkan kota ini dan bergabung Cao Cao di Xuchang.",},
        [2392] = {2405,"","Protagonis","Orang yang dibenci Cao Cao, hanyalah Lu Bu. Lu Bu dulu pernah menyerang Yanzhou dan hampir membunuhnya.","Orang yang dibenci Cao Cao, hanyalah Lu Bu. Lu Bu dulu pernah menyerang Yanzhou dan hampir membunuhnya.",},
        [2393] = {2405,"","Liu Bei","Perkataan adik keempat masuk akal.","Perkataan adik keempat masuk akal.",},
        [2394] = {2405,"","Zhang Fei","Adik keempat, aku telah salah paham, kakak ketiga akan memberikan Token Hero untukmu, jangan marah lagi.","Adik keempat, aku telah salah paham, kakak ketiga akan memberikan Token Hero untukmu, jangan marah lagi.",},
        [2395] = {2501,"Zhang Xingcai","Protagonis","Mereka telah menetap di Xuchang. Xingcai, Yinping, kita sudah lama tidak berkeliling, maukah pergi jalan-jalan?","Mereka telah menetap di Xuchang. Xingcai, Yinping, kita sudah lama tidak berkeliling, maukah pergi jalan-jalan?",},
        [2396] = {2501,"","Zhang Xingcai","Akhir-akhir ini selalu membantu ayah dan lainnya, benar-benar berterima kasih pada Tuan.","Akhir-akhir ini selalu membantu ayah dan lainnya, benar-benar berterima kasih pada Tuan.",},
        [2397] = {2501,"","Guan Yinping","Tuan, kemanakah kita? Setelah tinggal di Zhongyuan begini lama, sebaiknya ganti pemandangan baru, dan pergi ke Jiangdong.","Tuan, kemanakah kita? Setelah tinggal di Zhongyuan begini lama, sebaiknya ganti pemandangan baru, dan pergi ke Jiangdong.",},
        [2398] = {2501,"","Protagonis","Sejak kematian Sun Jian, Sun Ce mengikut Yuan Shu dan mundur ke Jiangnan. Sejak saat itu dia sangat perhatian dan baik pada orang bertalenta. Ayo pergi dan lihat apakah kami bisa membantu.","Sejak kematian Sun Jian, Sun Ce mengikut Yuan Shu dan mundur ke Jiangnan. Sejak saat itu dia sangat perhatian dan baik pada orang bertalenta. Ayo pergi dan lihat apakah kami bisa membantu.",},
        [2399] = {2501,"","Guan Yinping","Baik, maharaja Jiangdong, yang tampan dan mendominasi, kita pergi mencarinya.","Baik, maharaja Jiangdong, yang tampan dan mendominasi, kita pergi mencarinya.",},
        [2400] = {2502,"Sun Ce","Protagonis","Kakak Sun, lama tak berjumpa, mengapa terlihat tidak senang!","Kakak Sun, lama tak berjumpa, mengapa terlihat tidak senang!",},
        [2401] = {2502,"","Sun Ce","Yuan Shu selalu berubah-ubah dan tidak bisa dipercaya. Dia berjanji bahwa aku akan menjadi Pemimpin Prefektur Jiujiang, tetapi dia malah menempatkan temannya di posisi itui. Kemudian, aku dikirimkan untuk melawan Lu Kang, Pemimpin Prefektur Lujiang dan dijanjikan bahwa aku akan menjadi Pemimpin Prefektur baru, hasilnya dia menggantikanku dengan temannya Liu Xun. Sangat mengecewakan.","Yuan Shu selalu berubah-ubah dan tidak bisa dipercaya. Dia berjanji bahwa aku akan menjadi Pemimpin Prefektur Jiujiang, tetapi dia malah menempatkan temannya di posisi itui. Kemudian, aku dikirimkan untuk melawan Lu Kang, Pemimpin Prefektur Lujiang dan dijanjikan bahwa aku akan menjadi Pemimpin Prefektur baru, hasilnya dia menggantikanku dengan temannya Liu Xun. Sangat mengecewakan.",},
        [2402] = {2502,"","Sun Ce","Ayahku Sun Jian sangat heroik, sedangkan aku hanya berada di bawah orang lain, tidak bisa meneruskan ambisi ayahku.","Ayahku Sun Jian sangat heroik, sedangkan aku hanya berada di bawah orang lain, tidak bisa meneruskan ambisi ayahku.",},
        [2403] = {2502,"","Protagonis","Sun Ce, Yuan Shu bukanlah orang baik dan tidak dapat dipercaya. Sebaiknya panggil pengikut ayahmu dan bergerak menuju Jiangdong, bangun pondasi di sana.","Sun Ce, Yuan Shu bukanlah orang baik dan tidak dapat dipercaya. Sebaiknya panggil pengikut ayahmu dan bergerak menuju Jiangdong, bangun pondasi di sana.",},
        [2404] = {2502,"","Sun Ce","Hanya takut Yuan Shu tidak akan melepasku!","Hanya takut Yuan Shu tidak akan melepasku!",},
        [2405] = {2502,"","Protagonis","Yuan Shu selalu berkeinginan untuk menjadi kaisar, jika kamu memberikan Stempel Kerajaan yang ditinggalkan ayahmu kepada Yuan Shu, dia akan setuju.","Yuan Shu selalu berkeinginan untuk menjadi kaisar, jika kamu memberikan Stempel Kerajaan yang ditinggalkan ayahmu kepada Yuan Shu, dia akan setuju.",},
        [2406] = {2502,"","Sun Ce","Rencana bagus! Pamanku Wu Jing Pemimpin Prefektur Danyang dipaksa oleh Sekretariat Yangzhou - Liu Yao, aku harus memanfaatkan kesempatan ini.","Rencana bagus! Pamanku Wu Jing Pemimpin Prefektur Danyang dipaksa oleh Sekretariat Yangzhou - Liu Yao, aku harus memanfaatkan kesempatan ini.",},
        [2407] = {2502,"","Protagonis","Hehe, jika dia tidak setuju, aku akan menghajarnya hingga setuju.","Hehe, jika dia tidak setuju, aku akan menghajarnya hingga setuju.",},
        [2408] = {2503,"Protagonis","Yuan Shu","Aku Yuan Shu adalah ayah dari semua orang, kalian tidak bisa memperlakukanku seperti ini.","Aku Yuan Shu adalah ayah dari semua orang, kalian tidak bisa memperlakukanku seperti ini.",},
        [2409] = {2503,"","Guan Yinping","Kamu adalah jenderal yang dikalahkan Tuanku, juga berani menyebut diri sebagai ayah semua orang, terima ini!","Kamu adalah jenderal yang dikalahkan Tuanku, juga berani menyebut diri sebagai ayah semua orang, terima ini!",},
        [2410] = {2503,"","Protagonis","Akan kubuat kamu bersujud dan memanggilku ayah hari ini, percaya atau tidak.","Akan kubuat kamu bersujud dan memanggilku ayah hari ini, percaya atau tidak.",},
        [2411] = {2504,"Protagonis","Sun Ce","Kali ini dapat kembali ke Jiangdong dengan lancar, sungguh karena bantuan Hero muda, terima kasih!","Kali ini dapat kembali ke Jiangdong dengan lancar, sungguh karena bantuan Hero muda, terima kasih!",},
        [2412] = {2504,"","Protagonis","Kita adalah saudara, jangan sungkan! Langit akan membantu orang yang membantu dirinya sendiri.","Kita adalah saudara, jangan sungkan! Langit akan membantu orang yang membantu dirinya sendiri.",},
        [2413] = {2504,"","Protagonis","Kekuatan seseorang terbatas dan membutuhkan bantuan orang lain. Jika ingin membangun pondasi di Jiangdong, kamu harus merekrut beberapa bangsawan disini.","Kekuatan seseorang terbatas dan membutuhkan bantuan orang lain. Jika ingin membangun pondasi di Jiangdong, kamu harus merekrut beberapa bangsawan disini.",},
        [2414] = {2504,"","Protagonis","Diantara Zhang, Zhu, Lu dan Gu, empat keluarga besar Prefektur Wu, Zhang Zhao dari Keluarga Zhang adalah yang paling besar. Zhang Zhao memiliki talenta untuk menguasai dunia, jika bisa mendapatkan Zhang Zhao, dan memperlakukan orang bertalenta dengan hormat, keluarga lainnya akan bergabung denganmu.","Diantara Zhang, Zhu, Lu dan Gu, empat keluarga besar Prefektur Wu, Zhang Zhao dari Keluarga Zhang adalah yang paling besar. Zhang Zhao memiliki talenta untuk menguasai dunia, jika bisa mendapatkan Zhang Zhao, dan memperlakukan orang bertalenta dengan hormat, keluarga lainnya akan bergabung denganmu.",},
        [2415] = {2505,"Protagonis","Guan Yinping","Tuan, lihat, siapa orang di depan itu? Ganteng, menawan dan elegan, benar-benar seorang pria tampan!","Tuan, lihat, siapa orang di depan itu? Ganteng, menawan dan elegan, benar-benar seorang pria tampan!",},
        [2416] = {2505,"","Protagonis","Dia sangat luar biasa, kakak Sun, apakah mengenalnya?","Dia sangat luar biasa, kakak Sun, apakah mengenalnya?",},
        [2417] = {2505,"","Sun Ce","Ini adalah teman lamaku, Zhou Yu, nama kehormatan Zhou Gongjin. Saat aku di Shouchun, kita bertemu dan sangat cocok satu sama lain. Saat ayahku melewati Jingzhou untuk menyerang Dong Zhuo, keluargaku tinggal di kediaman Zhou Yu. Kita saling menyambut masing-masing ibu dan menjadi sahabat karib.","Ini adalah teman lamaku, Zhou Yu, nama kehormatan Zhou Gongjin. Saat aku di Shouchun, kita bertemu dan sangat cocok satu sama lain. Saat ayahku melewati Jingzhou untuk menyerang Dong Zhuo, keluargaku tinggal di kediaman Zhou Yu. Kita saling menyambut masing-masing ibu dan menjadi sahabat karib.",},
        [2418] = {2505,"","Protagonis","Oh, ternyata Zhou Yu, jenderal terkenal! Baik, biarkan aku beradu dulu dengannya!","Oh, ternyata Zhou Yu, jenderal terkenal! Baik, biarkan aku beradu dulu dengannya!",},
        [2419] = {2506,"Zhou Yu","Sun Ce","Gongjin, inilah Hero muda yang pernah kusebutkan, Kaisar telah mengangkatnya sebagai Jenderal Yangwei. Kali ini aku telah melepaskan kendali Yuan Shu dan mengambil kembali pengikut ayahku, ini semua karena bantuannya.","Gongjin, inilah Hero muda yang pernah kusebutkan, Kaisar telah mengangkatnya sebagai Jenderal Yangwei. Kali ini aku telah melepaskan kendali Yuan Shu dan mengambil kembali pengikut ayahku, ini semua karena bantuannya.",},
        [2420] = {2506,"","Zhou Yu","Ternyata Jenderal Yangwei, sudah lama ingin bertemu denganmu.","Ternyata Jenderal Yangwei, sudah lama ingin bertemu denganmu.",},
        [2421] = {2506,"","Sun Ce","Kita bertiga memiliki usia yang mirip, sangat cocok saat pertama kali bertemu, mengapa tidak membentuk ikatan saudara?","Kita bertiga memiliki usia yang mirip, sangat cocok saat pertama kali bertemu, mengapa tidak membentuk ikatan saudara?",},
        [2422] = {2506,"","Protagonis","Liu Bei, Guan Yu, Zhang Fei dan aku telah bersumpah menjadi saudara. Mengapa kalian berdua tidak bersumpah? Aku akan menjadi saksinya.","Liu Bei, Guan Yu, Zhang Fei dan aku telah bersumpah menjadi saudara. Mengapa kalian berdua tidak bersumpah? Aku akan menjadi saksinya.",},
        [2423] = {2506,"","Sun Ce","Biarkan langit dan bumi menjadi saksi, aku dan Zhou Yu hari ini bersumpah menjadi saudara. Mulai sekarang, kita akan memperlakukan satu sama lain dengan penuh ketulusan dan berbagi suka dan duka. Aku akan meneruskan ambisi ayahku dan menguasai dunia bersama Gongjin.","Biarkan langit dan bumi menjadi saksi, aku dan Zhou Yu hari ini bersumpah menjadi saudara. Mulai sekarang, kita akan memperlakukan satu sama lain dengan penuh ketulusan dan berbagi suka dan duka. Aku akan meneruskan ambisi ayahku dan menguasai dunia bersama Gongjin.",},
        [2424] = {2506,"","Zhou Yu","Biarkan langit dan bumi menjadi saksi, aku dan Sun Ce hari ini bersumpah menjadi saudara. Mulai sekarang, kita akan memperlakukan satu sama lain dengan penuh ketulusan dan berbagi suka dan duka. Aku bersedia untuk membantunya untuk meraih sukses besar bersama Bofu.","Biarkan langit dan bumi menjadi saksi, aku dan Sun Ce hari ini bersumpah menjadi saudara. Mulai sekarang, kita akan memperlakukan satu sama lain dengan penuh ketulusan dan berbagi suka dan duka. Aku bersedia untuk membantunya untuk meraih sukses besar bersama Bofu.",},
        [2425] = {2506,"","Sun Ce","Token Hero ini, kuberikan pada Hero muda, sebagai tanda pertemanan kita!","Token Hero ini, kuberikan pada Hero muda, sebagai tanda pertemanan kita!",},
        [2426] = {2601,"Sun Ce","Protagonis","Kakak Sun, perang Jiangdong kami, mulai dari mana?","Kakak Sun, perang Jiangdong kami, mulai dari mana?",},
        [2427] = {2601,"","Sun Ce","Hero muda, kita pergi menyerang Sekretariat Yangzhou - Liu Yao dulu yang sedang berjaga di Qu'a.","Hero muda, kita pergi menyerang Sekretariat Yangzhou - Liu Yao dulu yang sedang berjaga di Qu'a.",},
        [2428] = {2601,"","Protagonis","Dia adalah Sekretariat Yangzhou, mengapa dia berada di Qu'a? Di antaranya ada sungai.","Dia adalah Sekretariat Yangzhou, mengapa dia berada di Qu'a? Di antaranya ada sungai.",},
        [2429] = {2601,"","Sun Ce","Ada hal yang tidak diketahui Hero muda, Istana mengangkat Liu Yao sebagai Sekretariat Yangzhou, memerintah Shouchun, tetapi para pangeran saat ini saling bermusuhan, Shouchun telah lama diduduki oleh Yuan Shu.","Ada hal yang tidak diketahui Hero muda, Istana mengangkat Liu Yao sebagai Sekretariat Yangzhou, memerintah Shouchun, tetapi para pangeran saat ini saling bermusuhan, Shouchun telah lama diduduki oleh Yuan Shu.",},
        [2430] = {2601,"","Sun Ce","Pamanku Wujing Pemimpin Prefektur Danyang dan sepupuku Sun Ben membantu Liu Yao membangun gedung pemerintahan di Qu'a. Tidak disangka Liu Yao membalas kebaikan kami dengan rasa tidak berterimakasih. Dia mengusir pamanku dan merebut wilayahnya.","Pamanku Wujing Pemimpin Prefektur Danyang dan sepupuku Sun Ben membantu Liu Yao membangun gedung pemerintahan di Qu'a. Tidak disangka Liu Yao membalas kebaikan kami dengan rasa tidak berterimakasih. Dia mengusir pamanku dan merebut wilayahnya.",},
        [2431] = {2601,"","Protagonis","Orang yang tidak tahu terima kasih seperti ini. Tunggu kakak Sun, akan kubantu untuk menyerang!","Orang yang tidak tahu terima kasih seperti ini. Tunggu kakak Sun, akan kubantu untuk menyerang!",},
        [2432] = {2602,"Zhang Xingcai","Protagonis","Sekretariat Yangzhou - Liu Yao bukanlah siapa-siapa.","Sekretariat Yangzhou - Liu Yao bukanlah siapa-siapa.",},
        [2433] = {2602,"","Zhang Xingcai","Tuan memang hebat, seorang Liu Yao mana bisa menandingi Tuan!","Tuan memang hebat, seorang Liu Yao mana bisa menandingi Tuan!",},
        [2434] = {2602,"","Protagonis","Tetapi pengikut Liu Yao, sangat berbakat. Aku teringat kembali, bukankah dia Taishi Ci, yang membantu Kong Rong mengirimkan surat? Mengapa dia sekarang mengikuti Liu Yao!","Tetapi pengikut Liu Yao, sangat berbakat. Aku teringat kembali, bukankah dia Taishi Ci, yang membantu Kong Rong mengirimkan surat? Mengapa dia sekarang mengikuti Liu Yao!",},
        [2435] = {2602,"","Zhang Xingcai","Ingatan Tuan bagus! Itu dia. Taishi Ci menembak dengan baik, dia adalah penembak sejati. Dia dan Liu Yao adalah teman kampung halaman, jadi saling membantu.","Ingatan Tuan bagus! Itu dia. Taishi Ci menembak dengan baik, dia adalah penembak sejati. Dia dan Liu Yao adalah teman kampung halaman, jadi saling membantu.",},
        [2436] = {2602,"","Protagonis","Ternyata begini. Taishi Ci akan menjadi tambahan yang bagus jika aku berhasil merekrutnya.","Ternyata begini. Taishi Ci akan menjadi tambahan yang bagus jika aku berhasil merekrutnya.",},
        [2437] = {2603,"Protagonis","Yan Baihu","Siapa yang datang? Aku adalah Yan Baihu, Raja De dari Dongwu! Takut, kan!","Siapa yang datang? Aku adalah Yan Baihu, Raja De dari Dongwu! Takut, kan!",},
        [2438] = {2603,"","Protagonis","Macan Putih? Aku memiliki tato semua binatang mistis di seluruh tubuhku! Siapapun tidak ada yang bisa melawanku!","Macan Putih? Aku memiliki tato semua binatang mistis di seluruh tubuhku! Siapapun tidak ada yang bisa melawanku!",},
        [2439] = {2603,"","Yan Baihu","Anak kecil, jangan sombong, hati-hati ini akan menjadi bumerang!","Anak kecil, jangan sombong, hati-hati ini akan menjadi bumerang!",},
        [2440] = {2603,"","Zhang Xingcai","Yan Baihu ini awalnya adalah bandit gunung, menganggap diri sebagai Raja De dari Dongwu, menduduki Prefektur Wu. Saat Tuan bertarung dengannya, haruslah berhati-hati!","Yan Baihu ini awalnya adalah bandit gunung, menganggap diri sebagai Raja De dari Dongwu, menduduki Prefektur Wu. Saat Tuan bertarung dengannya, haruslah berhati-hati!",},
        [2441] = {2603,"","Protagonis","Seorang bandit gunung lemah, beraninya menduduki Prefektur Wu, aku akan menghajarmu hingga kencing di celana! Mulai bertarung!","Seorang bandit gunung lemah, beraninya menduduki Prefektur Wu, aku akan menghajarmu hingga kencing di celana! Mulai bertarung!",},
        [2442] = {2604,"Sun Ce","Wang Lang","Sialan kau, Sun Ce, kau bisa membunuhku, tetapi kau tidak akan pernah menundukkanku.","Sialan kau, Sun Ce, kau bisa membunuhku, tetapi kau tidak akan pernah menundukkanku.",},
        [2443] = {2604,"","Sun Ce","Wang Lang, karena kamu tidak bersedia mengikutku, maka sudahlah! Aku tidak pernah memaksa orang lain! Cao Cao telah menyampaikan memorial untuk memanggilmu ke Xuchang, aku akan mengirimkan orang untuk mengantarmu kesana.","Wang Lang, karena kamu tidak bersedia mengikutku, maka sudahlah! Aku tidak pernah memaksa orang lain! Cao Cao telah menyampaikan memorial untuk memanggilmu ke Xuchang, aku akan mengirimkan orang untuk mengantarmu kesana.",},
        [2444] = {2604,"","Protagonis","Wang Lang tidak menghargainya, kakak Sun kamu sangat berpikiran luas dan mengagumkan!","Wang Lang tidak menghargainya, kakak Sun kamu sangat berpikiran luas dan mengagumkan!",},
        [2445] = {2604,"","Sun Ce","Hahaha, kamu terlalu memujiku.","Hahaha, kamu terlalu memujiku.",},
        [2446] = {2605,"Sun Ce","Protagonis","Sekarang hanya tersisa Taishi Ci. Kakak Sun, aku akan pergi membantumu melawan Taishi Ci!","Sekarang hanya tersisa Taishi Ci. Kakak Sun, aku akan pergi membantumu melawan Taishi Ci!",},
        [2447] = {2605,"","Sun Ce","Sebelumnya saat aku melawan Taishi Ci di Shenting, aku mengambil tombak belakangnya dan dia mengambil helmku. Kita tidak pernah menyelesaikan duel, bagaimana bisa dengan mudah memberikannya padamu?","Sebelumnya saat aku melawan Taishi Ci di Shenting, aku mengambil tombak belakangnya dan dia mengambil helmku. Kita tidak pernah menyelesaikan duel, bagaimana bisa dengan mudah memberikannya padamu?",},
        [2448] = {2605,"","Protagonis","Lebih baik kita beradu, yang menang akan bertarung dengan Taishi Ci, bagaimana?","Lebih baik kita beradu, yang menang akan bertarung dengan Taishi Ci, bagaimana?",},
        [2449] = {2605,"","Sun Ce","Hahaha, baiklah, ayo bertarung!","Hahaha, baiklah, ayo bertarung!",},
        [2450] = {2606,"Protagonis","Taishi Ci","Jenderal Yangwei memang hebat, aku sangat terkagum, Token Hero ini kuberikan untuk Hero muda.","Jenderal Yangwei memang hebat, aku sangat terkagum, Token Hero ini kuberikan untuk Hero muda.",},
        [2451] = {2606,"","Protagonis","Terima kasih banyak!","Terima kasih banyak!",},
        [2452] = {2606,"","Sun Ce","Ziyi benar-benar jenderal berani! Liu Yao sangat bodoh, tidak menggunakan Ziyi sebagai jenderal, maka dari itu dia gagal. Jalan Ziyi di depan, akan kuambil bersama.","Ziyi benar-benar jenderal berani! Liu Yao sangat bodoh, tidak menggunakan Ziyi sebagai jenderal, maka dari itu dia gagal. Jalan Ziyi di depan, akan kuambil bersama.",},
        [2453] = {2606,"","Taishi Ci","Tentara Liu baru saja dikalahkan, bawahannya telah ditinggalkan, aku bersedia pergi menerima prajurit yang tersisa dan membantumu.","Tentara Liu baru saja dikalahkan, bawahannya telah ditinggalkan, aku bersedia pergi menerima prajurit yang tersisa dan membantumu.",},
        [2454] = {2606,"","Sun Ce","Baik, ini seperti yang kuinginkan. Besok siang, tunggu kamu kembali dengan kesuksesan. (Taishi Ci berjanji dan pergi)","Baik, ini seperti yang kuinginkan. Besok siang, tunggu kamu kembali dengan kesuksesan. (Taishi Ci berjanji dan pergi)",},
        [2455] = {2606,"","Protagonis","Kakak Sun, apakah kamu tidak takut bahwa Taishi Ci tidak akan kembali lagi?","Kakak Sun, apakah kamu tidak takut bahwa Taishi Ci tidak akan kembali lagi?",},
        [2456] = {2606,"","Sun Ce","Ziyi adalah orang yang bisa dipercaya, tidak mungkin mengkhianatiku.","Ziyi adalah orang yang bisa dipercaya, tidak mungkin mengkhianatiku.",},
        [2457] = {2606,"","Protagonis","Akan kuberitahukan yang sebenarnya, Cao Cao mendengar martabat Taishi Ci dan mengirimkan surat padanya. Surat tidak berisi, melainkan sedikit ginseng, yang berarti menginginkan Taishi Ci untuk bergabung dengannya. Tidak disangka, pada akhirnya masih diambil olehmu. Hahaha!","Akan kuberitahukan yang sebenarnya, Cao Cao mendengar martabat Taishi Ci dan mengirimkan surat padanya. Surat tidak berisi, melainkan sedikit ginseng, yang berarti menginginkan Taishi Ci untuk bergabung dengannya. Tidak disangka, pada akhirnya masih diambil olehmu. Hahaha!",},
        [2458] = {2606,"","Sun Ce","Aku tidak pernah percaya pada orang yang tidak bisa dipercaya. Jika aku percaya, maka akan kutaruh keyakinanku pada orang itu. Taishi Ci pasti akan menjadi Jenderal Besar Dongwu, haha!","Aku tidak pernah percaya pada orang yang tidak bisa dipercaya. Jika aku percaya, maka akan kutaruh keyakinanku pada orang itu. Taishi Ci pasti akan menjadi Jenderal Besar Dongwu, haha!",},
        [2459] = {2701,"Hua Tuo","Guan Yinping","Apa yang dilakukan lelaki di depan itu, senam?","Apa yang dilakukan lelaki di depan itu, senam?",},
        [2460] = {2701,"","Hua Tuo","(Berbisik sambil berlatih Latihan Lima Binatang) Macan naik, macan menerkam; Rusa maju, rusa lari; Beruang membawa, beruang bergoyang; Kera mengangkat, kera mengambil; Burung mengepakkan, burung terbang…","(Berbisik sambil berlatih Latihan Lima Binatang) Macan naik, macan menerkam; Rusa maju, rusa lari; Beruang membawa, beruang bergoyang; Kera mengangkat, kera mengambil; Burung mengepakkan, burung terbang…",},
        [2461] = {2701,"","Zhang Xingcai","Hei, bukankah itu guruku? Guru! Tidak disangka bisa bertemu denganmu disini!","Hei, bukankah itu guruku? Guru! Tidak disangka bisa bertemu denganmu disini!",},
        [2462] = {2701,"","Hua Tuo","Haha. Xingcai muridku! Aku telah berkeliling di seluruh dunia untuk melatih ilmu medisku, kebetulan saja aku tiba di Jiangdong akhir-akhir ini.","Haha. Xingcai muridku! Aku telah berkeliling di seluruh dunia untuk melatih ilmu medisku, kebetulan saja aku tiba di Jiangdong akhir-akhir ini.",},
        [2463] = {2701,"","Zhang Xingcai","Guru, ini adalah Tuanku, Tuan ini adalah guruku Hua Tuo!","Guru, ini adalah Tuanku, Tuan ini adalah guruku Hua Tuo!",},
        [2464] = {2701,"","Hua Tuo","Oh, ini adalah Jenderal Yangwei! Muda namun berbakat! (Memang merupakan orang terpilih seperti yang dikatakan Zuo Ci!)","Oh, ini adalah Jenderal Yangwei! Muda namun berbakat! (Memang merupakan orang terpilih seperti yang dikatakan Zuo Ci!)",},
        [2465] = {2701,"","Protagonis","Senang bertemu denganmu, Hua Tuo Tabib Sakti!","Senang bertemu denganmu, Hua Tuo Tabib Sakti!",},
        [2466] = {2701,"","Hua Tuo","Xingcai, ambil Latihan Lima Binatang ini dan berikan pada Tuanmu, agar menjadi lebih kuat, panjang umur dan terlihat muda selamanya. Guru memiliki urusan dan harus pergi ke Kuaiji, sampai jumpa.","Xingcai, ambil Latihan Lima Binatang ini dan berikan pada Tuanmu, agar menjadi lebih kuat, panjang umur dan terlihat muda selamanya. Guru memiliki urusan dan harus pergi ke Kuaiji, sampai jumpa.",},
        [2467] = {2701,"","Guan Yinping","Xingcai, gurumu sangat muda… Eh, kenapa dia pergi! Benar-benar orang aneh!","Xingcai, gurumu sangat muda… Eh, kenapa dia pergi! Benar-benar orang aneh!",},
        [2468] = {2701,"","Zhang Xingcai","Guru selalu begini, Tuan dan kakak Yinping jangan tersinggung.","Guru selalu begini, Tuan dan kakak Yinping jangan tersinggung.",},
        [2469] = {2702,"Protagonis","Zhang Xingcai","Lihat, mengapa Xuancheng dikepung oleh bandit gunung? Banyak sekali!","Lihat, mengapa Xuancheng dikepung oleh bandit gunung? Banyak sekali!",},
        [2470] = {2702,"","Protagonis","Bukankah Xuancheng dijaga oleh adik Sun Ce, Sun Quan? Ayo pergi masuk dalam kota untuk selamatkan Sun Quan!","Bukankah Xuancheng dijaga oleh adik Sun Ce, Sun Quan? Ayo pergi masuk dalam kota untuk selamatkan Sun Quan!",},
        [2471] = {2702,"","Guan Yinping","Banyak sekali bandit gunung! Haha, ayo bunuh mereka!","Banyak sekali bandit gunung! Haha, ayo bunuh mereka!",},
        [2472] = {2703,"Protagonis","Zhou Tai","Terima kasih atas pertolonganmu! Mohon lindungi Jenderal Sun Quan! (Zhou Tai jatuh dan pingsan karena lukanya yang parah)","Terima kasih atas pertolonganmu! Mohon lindungi Jenderal Sun Quan! (Zhou Tai jatuh dan pingsan karena lukanya yang parah)",},
        [2473] = {2703,"","Sun Quan","Jenderal Zhou Tai! Dia terluka begini parah demi menyelamatkanku!","Jenderal Zhou Tai! Dia terluka begini parah demi menyelamatkanku!",},
        [2474] = {2703,"","Protagonis","Zhou Tai ini benar-benar pria sejati. Aku paling menghormati orang seperti ini! Xingcai, cepat pikirkan cara untuk menyembuhkannya!","Zhou Tai ini benar-benar pria sejati. Aku paling menghormati orang seperti ini! Xingcai, cepat pikirkan cara untuk menyembuhkannya!",},
        [2475] = {2703,"","Zhang Xingcai","Biarkan aku melihatnya, di badan Zhou Tai ada 12 luka tombak dan sangat parah. Aku hanya bisa menutup titik akupuntur untuk membuatnya hidup sementara. Untuk penyembuhan total, dibutuhkan bantuan guruku Hua Tuo.","Biarkan aku melihatnya, di badan Zhou Tai ada 12 luka tombak dan sangat parah. Aku hanya bisa menutup titik akupuntur untuk membuatnya hidup sementara. Untuk penyembuhan total, dibutuhkan bantuan guruku Hua Tuo.",},
        [2476] = {2703,"","Sun Quan","Terima kasih, nona! Bolehkah aku bertanya dimana gurumu Hua Tuo sekarang?","Terima kasih, nona! Bolehkah aku bertanya dimana gurumu Hua Tuo sekarang?",},
        [2477] = {2703,"","Zhang Xingcai","Kita bertemu dengan guruku sebelum memasuki kota, dia berkata akan pergi ke Kuaiji.","Kita bertemu dengan guruku sebelum memasuki kota, dia berkata akan pergi ke Kuaiji.",},
        [2478] = {2703,"","Sun Quan","Cepat kirimkan orang ke Kuaiji dan minta bantuan Tabib Sakti Hua Tuo untuk menyembuhkan Zhou Tai!","Cepat kirimkan orang ke Kuaiji dan minta bantuan Tabib Sakti Hua Tuo untuk menyembuhkan Zhou Tai!",},
        [2479] = {2704,"Protagonis","Hua Tuo","Jenderal Yangwei memang hebat! Token Hero ini akan kuberikan pada jenderal!","Jenderal Yangwei memang hebat! Token Hero ini akan kuberikan pada jenderal!",},
        [2480] = {2704,"","Protagonis","Tabib Sakti dulu memberikanku Latihan Lima Binatang, sekarng memberikanku Token Hero lagi, sungguh terima kasih!","Tabib Sakti dulu memberikanku Latihan Lima Binatang, sekarng memberikanku Token Hero lagi, sungguh terima kasih!",},
        [2481] = {2704,"","Hua Tuo","Kamu adalah orang yang ditakdirkan untuk menghentikan kekacauan di dunia ini! Jenderal rajin-rajinlah berlatih, dengan Latihan Lima Binatang yang kuciptakan, kamu pasti dapat memperpanjang usia dan memperkuat staminamu.","Kamu adalah orang yang ditakdirkan untuk menghentikan kekacauan di dunia ini! Jenderal rajin-rajinlah berlatih, dengan Latihan Lima Binatang yang kuciptakan, kamu pasti dapat memperpanjang usia dan memperkuat staminamu.",},
        [2482] = {2704,"","Protagonis","Bolehkah aku bertanya, apakah wajahmu yang terlihat muda ini, adalah hasil dari Latihan Lima Binatang?","Bolehkah aku bertanya, apakah wajahmu yang terlihat muda ini, adalah hasil dari Latihan Lima Binatang?",},
        [2483] = {2704,"","Hua Tuo","Betul!","Betul!",},
        [2484] = {2704,"","Protagonis","Tenanglah, aku berjanji akan berlatih setiap pagi dan malam! Tidak tua, tampil muda selamanya! Haha! Xingcai, Yinping, berlatihlah denganku, akan kucarikan keluarga baik pada kalian untuk menikah! ","Tenanglah, aku berjanji akan berlatih setiap pagi dan malam! Tidak tua, tampil muda selamanya! Haha! Xingcai, Yinping, berlatihlah denganku, akan kucarikan keluarga baik pada kalian untuk menikah! ",},
        [2485] = {2704,"","Zhang Xingcai","Aku tidak ingin menikah, yang kuinginkan hanya bersama dengan Tuan selamanya!","Aku tidak ingin menikah, yang kuinginkan hanya bersama dengan Tuan selamanya!",},
        [2486] = {2704,"","Guan Yinping","Aku juga, aku juga! Aku akan bertarung untuk Tuan, selamanya!","Aku juga, aku juga! Aku akan bertarung untuk Tuan, selamanya!",},
        [2487] = {2704,"","Protagonis","Hahaha! Baik! Aku mendengar Chenliu masih memiliki Residu Turban Kuning lagi! Ayo, kita pergi memusnahkan mereka!","Hahaha! Baik! Aku mendengar Chenliu masih memiliki Residu Turban Kuning lagi! Ayo, kita pergi memusnahkan mereka!",},
        [2488] = {2801,"Zhang Xingcai","Protagonis","Chenliu adalah daerah tengah di Zhongyuan. Mengapa rakyat tidak bisa bertahan hidup dan banyak kelaparan dimana-mana?","Chenliu adalah daerah tengah di Zhongyuan. Mengapa rakyat tidak bisa bertahan hidup dan banyak kelaparan dimana-mana?",},
        [2489] = {2801,"Protagonis","Zhang Xingcai","Tuan, wabah belalang dua tahun ini sangat parah, tanaman-tanaman dimakan habis oleh belalang. Di sebelah timur Shanhaiguan, makanan sangat mahal dan langka sehingga orang memakan satu sama lain, terlalu mengerikan untuk dilihat.","Tuan, wabah belalang dua tahun ini sangat parah, tanaman-tanaman dimakan habis oleh belalang. Di sebelah timur Shanhaiguan, makanan sangat mahal dan langka sehingga orang memakan satu sama lain, terlalu mengerikan untuk dilihat.",},
        [2490] = {2801,"Zhang Xingcai","Protagonis","Tempat ini dalam ruang lingkup pengaruh Cao Cao, kita pergi meminta Cao Cao sedikit makanan, untuk membantu korban bencana.","Tempat ini dalam ruang lingkup pengaruh Cao Cao, kita pergi meminta Cao Cao sedikit makanan, untuk membantu korban bencana.",},
        [2491] = {2802,"Cao Cao","Protagonis","Kakak Cao, pada perjalananku dari Jiangdong ke Chenliu, aku melihat korban bencana dimana-mana. Mengapa tidak memberikan makanan kepada korban bencana ini?","Kakak Cao, pada perjalananku dari Jiangdong ke Chenliu, aku melihat korban bencana dimana-mana. Mengapa tidak memberikan makanan kepada korban bencana ini?",},
        [2492] = {2802,"Protagonis","Cao Cao","Saudaraku, ada yang kamu tidak ketahui. Akhir-akhir ini wabah belalang sangat hebat sehingga tentaraku juga tidak banyak makanan tersisa, ditambah lagi baru saja bertarung dengan Lu Bu, aku sendiri juga khawatir!","Saudaraku, ada yang kamu tidak ketahui. Akhir-akhir ini wabah belalang sangat hebat sehingga tentaraku juga tidak banyak makanan tersisa, ditambah lagi baru saja bertarung dengan Lu Bu, aku sendiri juga khawatir!",},
        [2493] = {2802,"Protagonis","Xun Yu","Kalian berdua, Residu Turban Kuning seperti He Yi dan Huang Shao merampok daerah orang kaya yang memiliki banyak emas dan makanan,","Kalian berdua, Residu Turban Kuning seperti He Yi dan Huang Shao merampok daerah orang kaya yang memiliki banyak emas dan makanan,",},
        [2494] = {2802,"Protagonis","Xun Yu","Bandit seperti ini, mudah untuk dilawan: Mengalahkan mereka bisa memberikan kita ransum, untuk memberi makan prajurit, Istana akan puas, rakyat juga bahagia, benar-benar seperti kehendak dari langit.","Bandit seperti ini, mudah untuk dilawan: Mengalahkan mereka bisa memberikan kita ransum, untuk memberi makan prajurit, Istana akan puas, rakyat juga bahagia, benar-benar seperti kehendak dari langit.",},
        [2495] = {2802,"Xun Yu","Protagonis","Ide bagus. Kakak Cao, aku akan menjadi baris depan dalam pemberantasan Turban Kuning, tunggu kabar baik mengenai kemenanganku.","Ide bagus. Kakak Cao, aku akan menjadi baris depan dalam pemberantasan Turban Kuning, tunggu kabar baik mengenai kemenanganku.",},
        [2496] = {2803,"Guan Yinping","Huang Shao","Aku adalah Huang Shao, Penghancur Langit! Siapa kalian?","Aku adalah Huang Shao, Penghancur Langit! Siapa kalian?",},
        [2497] = {2803,"Huang Shao","Guan Yinping","Tuanku adalah Jenderal Yangwei yang diangkat oleh kaisar sendiri. Turban Kuning lemah, masih tidak menyerah!","Tuanku adalah Jenderal Yangwei yang diangkat oleh kaisar sendiri. Turban Kuning lemah, masih tidak menyerah!",},
        [2498] = {2803,"Guan Yinping","Huang Shao","Jenderal Yangwei siapa, belum pernah dengar! Tidak peduli siapa kamu, kamu akan meminta ampun jika berani menyerang Turban Kuning!","Jenderal Yangwei siapa, belum pernah dengar! Tidak peduli siapa kamu, kamu akan meminta ampun jika berani menyerang Turban Kuning!",},
        [2499] = {2804,"Guan Yinping","Huang Shao","Aku tidak mengenalmu Jenderal Yangwei! Maafkan aku!","Aku tidak mengenalmu Jenderal Yangwei! Maafkan aku!",},
        [2500] = {2804,"Huang Shao","Guan Yinping","Sekarang meminta pengampunan dari Tuanku! Humph!","Sekarang meminta pengampunan dari Tuanku! Humph!",},
        [2501] = {2804,"Huang Shao","Protagonis","Baiklah, tidak mau hidupmu juga tidak apa-apa, serahkan makanan dan emasmu, maka kamu bisa hidup.","Baiklah, tidak mau hidupmu juga tidak apa-apa, serahkan makanan dan emasmu, maka kamu bisa hidup.",},
        [2502] = {2804,"Protagonis","Huang Shao","Sejujurnya, kami kedatangan seseorang yang kuat disini, menangkap ratusan prajuritku di desa gunung. Jika kamu menginginkan makanan dan emas, maka harus mengalahkannya.","Sejujurnya, kami kedatangan seseorang yang kuat disini, menangkap ratusan prajuritku di desa gunung. Jika kamu menginginkan makanan dan emas, maka harus mengalahkannya.",},
        [2503] = {2804,"Huang Shao","Guan Yinping","Siapa orang ini, beraninya merebut barang Tuanku? Ayo pergi dan lihat!","Siapa orang ini, beraninya merebut barang Tuanku? Ayo pergi dan lihat!",},
        [2504] = {2805,"Protagonis","Guan Yinping","Tuan cepat lihat, si gendut inilah yang mengambil barangku.","Tuan cepat lihat, si gendut inilah yang mengambil barangku.",},
        [2505] = {2805,"Guan Yinping","Protagonis","Orang kuat ini sangat tinggi dan berbadan besar, terlihat sangat kuat.","Orang kuat ini sangat tinggi dan berbadan besar, terlihat sangat kuat.",},
        [2506] = {2805,"Protagonis","Guan Yinping","Tuan terlalu baik, dia hanya gemuk. Orang gemuk, cepat serahkan Residu Turban Kuning!","Tuan terlalu baik, dia hanya gemuk. Orang gemuk, cepat serahkan Residu Turban Kuning!",},
        [2507] = {2805,"Protagonis","Xu Chu","Humph, jika kalian berhasil mengalahkan Hujan Palu dengan 180 pon ditanganku, aku akan memberikannya! Bagaimana?","Humph, jika kalian berhasil mengalahkan Hujan Palu dengan 180 pon ditanganku, aku akan memberikannya! Bagaimana?",},
        [2508] = {2805,"Xu Chu","Protagonis","Yinping, mundurlah, biarkan aku yang maju, jangan terkena Hujan Palunya!","Yinping, mundurlah, biarkan aku yang maju, jangan terkena Hujan Palunya!",},
        [2509] = {2806,"Protagonis","Xu Chu","Aku yakin. Token Hero ini, akan kuberikan pada jenderal! Xu Chu bersedia untuk mengikut dengan jenderal!","Aku yakin. Token Hero ini, akan kuberikan pada jenderal! Xu Chu bersedia untuk mengikut dengan jenderal!",},
        [2510] = {2806,"Xu Chu","Protagonis","Aku berkeliling di semua tempat dalam waktu yang lama, sebaiknya kamu mengikut Cao Cao.","Aku berkeliling di semua tempat dalam waktu yang lama, sebaiknya kamu mengikut Cao Cao.",},
        [2511] = {2806,"Cao Cao","Protagonis","Kakak Cao, kurekomendasikan seorang jenderal besar, dia bernama Xu Chu, sama hebatnya dengan Dian Wei.","Kakak Cao, kurekomendasikan seorang jenderal besar, dia bernama Xu Chu, sama hebatnya dengan Dian Wei.",},
        [2512] = {2806,"Protagonis","Cao Cao","Haha, aku sangat beruntung mendapat dua Pelindung macan, Dian Wei di kiri dan Xu Chu di kanan, mungkin di dunia ini tidak ada yang bisa menyakitiku!","Haha, aku sangat beruntung mendapat dua Pelindung macan, Dian Wei di kiri dan Xu Chu di kanan, mungkin di dunia ini tidak ada yang bisa menyakitiku!",},
        [2513] = {2901,"Protagonis","Cao Cao","Hero muda, Zhang Xiu menunjuk Jia Xu sebagai penasihat, berteman dengan Liu Biao, menempatkan prajurit di Wancheng, apa pendapatmu tentang hal ini?","Hero muda, Zhang Xiu menunjuk Jia Xu sebagai penasihat, berteman dengan Liu Biao, menempatkan prajurit di Wancheng, apa pendapatmu tentang hal ini?",},
        [2514] = {2901,"Cao Cao","Protagonis","Kakak Cao, menurutku lebih baik membujuk Zhang Xiu untuk menyerah. Aku pernah kontak dengan Jia Xu sebelumnya, dia penuh dengan siasat, dan sangat berpengetahuan. Biarkan aku membantumu membujuknya, kamu akan mendapat Wancheng tanpa bertarung.","Kakak Cao, menurutku lebih baik membujuk Zhang Xiu untuk menyerah. Aku pernah kontak dengan Jia Xu sebelumnya, dia penuh dengan siasat, dan sangat berpengetahuan. Biarkan aku membantumu membujuknya, kamu akan mendapat Wancheng tanpa bertarung.",},
        [2515] = {2901,"Protagonis","Cao Cao","Begini juga bagus, terima kasih Hero muda!","Begini juga bagus, terima kasih Hero muda!",},
        [2516] = {2902,"Nyonya Zou","Cao Cao","Apa nama margamu?","Apa nama margamu?",},
        [2517] = {2902,"Cao Cao","Nyonya Zou","Aku adalah Nyonya Zou, istri Zhang Ji.","Aku adalah Nyonya Zou, istri Zhang Ji.",},
        [2518] = {2902,"Nyonya Zou","Cao Cao","Apakah kamu mengenaliku?","Apakah kamu mengenaliku?",},
        [2519] = {2902,"Cao Cao","Nyonya Zou","Aku telah lama mendengar nama Perdana Menteri, merupakan kehormatan bagiku dapat bertemu hari ini.","Aku telah lama mendengar nama Perdana Menteri, merupakan kehormatan bagiku dapat bertemu hari ini.",},
        [2520] = {2902,"Nyonya Zou","Cao Cao","Untuk kebaikanmu, aku menerima penyerahan Zhang Xiu. Jika tidak keluarganya akan dimusnahkan.","Untuk kebaikanmu, aku menerima penyerahan Zhang Xiu. Jika tidak keluarganya akan dimusnahkan.",},
        [2521] = {2902,"Nyonya Zou","Cao Cao","Bertemu denganmu, sungguh membuatku senang. Aku ingin melalui malam ini bersamamu kembali ke ibu kota. Aku berjanji akan memberikanmu uang dan kekuasaan, bagaimana?","Bertemu denganmu, sungguh membuatku senang. Aku ingin melalui malam ini bersamamu kembali ke ibu kota. Aku berjanji akan memberikanmu uang dan kekuasaan, bagaimana?",},
        [2522] = {2902,"Cao Cao","Nyonya Zou","Aku bersedia mengikut Perdana Menteri.","Aku bersedia mengikut Perdana Menteri.",},
        [2523] = {2903,"Jia Xu","Zhang Xiu","Cao Cao mempermalukan bibiku, keterlaluan! Aku pasti akan membunuh Cao Cao, maka baru bisa melepaskan kebencianku!","Cao Cao mempermalukan bibiku, keterlaluan! Aku pasti akan membunuh Cao Cao, maka baru bisa melepaskan kebencianku!",},
        [2524] = {2903,"Zhang Xiu","Jia Xu","Hal ini tidak bisa bocor. Beberapa hari lagi, saat Cao Cao keluar dari kamp untuk berdiskusi, kamu bisa menyebutkan bahwa banyak pembelot di antara yang menyerah, sedangkan kamu menempatkan tentaramu di tengah prajurit-prajurit.","Hal ini tidak bisa bocor. Beberapa hari lagi, saat Cao Cao keluar dari kamp untuk berdiskusi, kamu bisa menyebutkan bahwa banyak pembelot di antara yang menyerah, sedangkan kamu menempatkan tentaramu di tengah prajurit-prajurit.",},
        [2525] = {2903,"Jia Xu","Zhang Xiu","Tetapi bawahan Cao Cao Dian Wei sangat kuat, bagaimana melawannya?","Tetapi bawahan Cao Cao Dian Wei sangat kuat, bagaimana melawannya?",},
        [2526] = {2903,"Zhang Xiu","Jia Xu","Bukan masalah. Besok undang dia kemari untuk minum dan buat dia mabuk sebelum kembali. Pada saatnya kirimkan orang untuk menyelinap masuk ke tendanya dan curi tombaknya, dengan begitu dia tidak akan jadi menakutkan lagi.","Bukan masalah. Besok undang dia kemari untuk minum dan buat dia mabuk sebelum kembali. Pada saatnya kirimkan orang untuk menyelinap masuk ke tendanya dan curi tombaknya, dengan begitu dia tidak akan jadi menakutkan lagi.",},
        [2527] = {2903,"Jia Xu","Zhang Xiu","Rencana bagus, Wenhe! Aku akan membunuh Cao Cao.","Rencana bagus, Wenhe! Aku akan membunuh Cao Cao.",},
        [2528] = {2904,"Guan Yinping","Protagonis","Aneh, mengapa kota ini sangat kacau? Bukankah Zhang Xiu telah menyerah pada Cao Cao?","Aneh, mengapa kota ini sangat kacau? Bukankah Zhang Xiu telah menyerah pada Cao Cao?",},
        [2529] = {2904,"Protagonis","Guan Yinping","Gawat Tuanku, Zhang Xiu menyerah sejak awal, tetapi setelah mendapatkan Wancheng, Cao Cao telah mencari kesenangan dari tante Zhang Xiu, Nyonya Zou. Setelah Zhang Xiu mengetahuinya, dia membuat rencana untuk melawan Cao Cao.","Gawat Tuanku, Zhang Xiu menyerah sejak awal, tetapi setelah mendapatkan Wancheng, Cao Cao telah mencari kesenangan dari tante Zhang Xiu, Nyonya Zou. Setelah Zhang Xiu mengetahuinya, dia membuat rencana untuk melawan Cao Cao.",},
        [2530] = {2904,"Guan Yinping","Protagonis","Kalau begitu kita pergi selamatkan Cao Cao.","Kalau begitu kita pergi selamatkan Cao Cao.",},
        [2531] = {2905,"Protagonis","Zhang Xingcai","Kita datang terlambat, Dian Wei terluka parah demi melindungi Cao Cao.","Kita datang terlambat, Dian Wei terluka parah demi melindungi Cao Cao.",},
        [2532] = {2905,"Zhang Xingcai","Protagonis","Xingcai, bantulah Dian Wei sebentar.","Xingcai, bantulah Dian Wei sebentar.",},
        [2533] = {2905,"Protagonis","Zhang Xingcai","Tuan, Xingcai tidak bisa berbuat apa-apa lagi, luka Jenderal Dian sangat parah!","Tuan, Xingcai tidak bisa berbuat apa-apa lagi, luka Jenderal Dian sangat parah!",},
        [2534] = {2905,"Protagonis","Dian Wei","Aku menghadang gerbang depan, Perdana Menteri kabur melalui gerbang belakang, tetapi pengejar sangat banyak, sangat berbahaya.","Aku menghadang gerbang depan, Perdana Menteri kabur melalui gerbang belakang, tetapi pengejar sangat banyak, sangat berbahaya.",},
        [2535] = {2905,"Protagonis","Dian Wei","Jenderal Yangwei, hubunganmu dengan Perdana Menteri sangat dekat! Tolong segera pergi dan selamatkan dia, kalau tidak aku tidak bisa mati dengan tenang!","Jenderal Yangwei, hubunganmu dengan Perdana Menteri sangat dekat! Tolong segera pergi dan selamatkan dia, kalau tidak aku tidak bisa mati dengan tenang!",},
        [2536] = {2905,"Dian Wei","Protagonis","Jenderal Dian tenanglah, aku akan menyelamatkan Cao Cao!","Jenderal Dian tenanglah, aku akan menyelamatkan Cao Cao!",},
        [2537] = {2905,"Protagonis","Dian Wei","Tuan, pergilah… (Dian Wei mengeluarkan suara kecil dan mati)","Tuan, pergilah… (Dian Wei mengeluarkan suara kecil dan mati)",},
        [2538] = {3001,"Protagonis","Zhang Xingcai","Tuan, mengapa kita belum melihat Cao Cao di perjalanan? Bukankah dia mengikuti jalan ini?","Tuan, mengapa kita belum melihat Cao Cao di perjalanan? Bukankah dia mengikuti jalan ini?",},
        [2539] = {3001,"Zhang Xingcai","Protagonis","Mungkin Cao Cao panik di atas kudanya dan tidak tahu lari kemana arahnya. Jangan khawatir, orang di depan sepertinya adalah Yu Jin, pengikut Cao Cao.","Mungkin Cao Cao panik di atas kudanya dan tidak tahu lari kemana arahnya. Jangan khawatir, orang di depan sepertinya adalah Yu Jin, pengikut Cao Cao.",},
        [2540] = {3001,"Protagonis","Yu Jin","Jenderal Yangwei, dengar-dengar ada kekacauan lagi di Wancheng, apakah kamu pernah bertemu Perdana Menteri?","Jenderal Yangwei, dengar-dengar ada kekacauan lagi di Wancheng, apakah kamu pernah bertemu Perdana Menteri?",},
        [2541] = {3001,"Yu Jin","Protagonis","Aku baru saja keluar dari Wancheng. Zhang Xiu tiba-tiba berkhianat, Jenderal Dian Wei tewas dalam peperangan, Perdana Menteri tidak tahu kemana kaburnya.","Aku baru saja keluar dari Wancheng. Zhang Xiu tiba-tiba berkhianat, Jenderal Dian Wei tewas dalam peperangan, Perdana Menteri tidak tahu kemana kaburnya.",},
        [2542] = {3001,"Protagonis","Yu Jin","Ada juga masalah ini! Jenderal telah berjuang keras, aku akan mengirimkan prajurit untuk membantu saat aku kembali ke Yanzhou!","Ada juga masalah ini! Jenderal telah berjuang keras, aku akan mengirimkan prajurit untuk membantu saat aku kembali ke Yanzhou!",},
        [2543] = {3001,"Yu Jin","Protagonis","Prajurit Zhang Xiu sangat banyak, inilah yang terbaik, kita membagi pasukan menjadi dua arah, aku akan meneruskan pencarian Perdana Menteri!","Prajurit Zhang Xiu sangat banyak, inilah yang terbaik, kita membagi pasukan menjadi dua arah, aku akan meneruskan pencarian Perdana Menteri!",},
        [2544] = {3002,"Cao Cao","Cao Ang","Ayah, kudamu telah terkena tiga panah, sekarang terkena pada matanya dan tidak bisa berlari lagi. Ayah, ambil kudaku dan pergi!","Ayah, kudamu telah terkena tiga panah, sekarang terkena pada matanya dan tidak bisa berlari lagi. Ayah, ambil kudaku dan pergi!",},
        [2545] = {3002,"Cao Ang","Cao Cao","Kalau aku menunggangi kudamu, lalu bagaimana denganmu?","Kalau aku menunggangi kudamu, lalu bagaimana denganmu?",},
        [2546] = {3002,"Cao Cao","Cao Ang","Ayah jangan khawatir, ilmuku sangat hebat, aku akan menghadang dari belakang! (Lalu dia memukul panggul kuda, kuda membawa Cao Cao dan pergi. Di belakang terdapat hujan panah, dan Cao Ang mengerahkan seluruh energi untuk bertarung)","Ayah jangan khawatir, ilmuku sangat hebat, aku akan menghadang dari belakang! (Lalu dia memukul panggul kuda, kuda membawa Cao Cao dan pergi. Di belakang terdapat hujan panah, dan Cao Ang mengerahkan seluruh energi untuk bertarung)",},
        [2547] = {3003,"Cao Cao","Nyonya Ding","(Nyonya Ding mendengar Cao Ang mati dalam perang dan kembali ke kampung halaman dengan amarah) Cao Cao, kamu telah membunuh anakku, sekarang tidak ada lagi yang kucintai!","(Nyonya Ding mendengar Cao Ang mati dalam perang dan kembali ke kampung halaman dengan amarah) Cao Cao, kamu telah membunuh anakku, sekarang tidak ada lagi yang kucintai!",},
        [2548] = {3003,"Nyonya Ding","Cao Cao","Nyonya, kita pulang bersama dengan kereta, bagaimana?","Nyonya, kita pulang bersama dengan kereta, bagaimana?",},
        [2549] = {3003,"Cao Cao","Nyonya Ding","Tidak!","Tidak!",},
        [2550] = {3003,"Nyonya Ding","Cao Cao","Nyonya, bisakah kamu kembali denganku?","Nyonya, bisakah kamu kembali denganku?",},
        [2551] = {3003,"Cao Cao","Nyonya Ding","Tidak!","Tidak!",},
        [2552] = {3003,"Nyonya Ding","Cao Cao","Aku tidak pernah menyesal seumur hidupku. Seumpama masih ada arwah setelah mati, jika Cao Ang bertanya padaku dimana ibunya, bagaimana aku menjawabnya!","Aku tidak pernah menyesal seumur hidupku. Seumpama masih ada arwah setelah mati, jika Cao Ang bertanya padaku dimana ibunya, bagaimana aku menjawabnya!",},
        [2553] = {3004,"Protagonis","Xiahou Dun","Jenderal Yangwei, aku menghargai pertemananmu dengan Perdana Menteri, tetapi mengapa kamu membunuh prajurit Qingzhou yang ada di bawah perintahku?","Jenderal Yangwei, aku menghargai pertemananmu dengan Perdana Menteri, tetapi mengapa kamu membunuh prajurit Qingzhou yang ada di bawah perintahku?",},
        [2554] = {3004,"Xiahou Dun","Protagonis","Jenderal Xiahou, beraninya mempertanyakanku? Prajurit Qingzhou mu adalah Residu Turban Kuning yang dibawa di bawah perintah Perdana Menteri dengan bantuanku.","Jenderal Xiahou, beraninya mempertanyakanku? Prajurit Qingzhou mu adalah Residu Turban Kuning yang dibawa di bawah perintah Perdana Menteri dengan bantuanku.",},
        [2555] = {3004,"Xiahou Dun","Protagonis","Aku menyelamatkan Perdana Menteri dari Wancheng, lalu aku melihat Prajurit Qingzhou merampok penduduk saat berjalan kembali, dan aku membunuh mereka! Mengapa, jenderal tidak menerimanya?","Aku menyelamatkan Perdana Menteri dari Wancheng, lalu aku melihat Prajurit Qingzhou merampok penduduk saat berjalan kembali, dan aku membunuh mereka! Mengapa, jenderal tidak menerimanya?",},
        [2556] = {3004,"Protagonis","Xiahou Dun","Maafkan kecerobohanku! Aku tidak tahu ada hal seperti ini, semua salahku karena tidak seksama dalam memimpin prajurit!","Maafkan kecerobohanku! Aku tidak tahu ada hal seperti ini, semua salahku karena tidak seksama dalam memimpin prajurit!",},
        [2557] = {3005,"Yu Jin","Cao Cao","Yu Jin, Prajurit Qingzhou mengatakan kamu menggunakan insiden Wancheng untuk memberontak. Apakah kamu tahu kamu bersalah?","Yu Jin, Prajurit Qingzhou mengatakan kamu menggunakan insiden Wancheng untuk memberontak. Apakah kamu tahu kamu bersalah?",},
        [2558] = {3005,"Cao Cao","Protagonis","Kakak Cao, ini adalah kesalahan besar!","Kakak Cao, ini adalah kesalahan besar!",},
        [2559] = {3005,"Protagonis","Cao Cao","Oh?","Oh?",},
        [2560] = {3005,"Cao Cao","Protagonis","Turban Kuning di Qingzhou awalnya adalah bandit, apakah kamu masih mengingatnya? Diantara mereka ada kekacauan, beberapa dari mereka menjarah penduduk seperti yang mereka lakukan di masa lalu. Saat Yu Jin dan aku melihatnya, kita menghukumnya tanpa ampun.","Turban Kuning di Qingzhou awalnya adalah bandit, apakah kamu masih mengingatnya? Diantara mereka ada kekacauan, beberapa dari mereka menjarah penduduk seperti yang mereka lakukan di masa lalu. Saat Yu Jin dan aku melihatnya, kita menghukumnya tanpa ampun.",},
        [2561] = {3005,"Yu Jin","Cao Cao","Ternyata begini. Yu Jin, hampir saja menyalahkanmu dengan tidak adil, mengapa kamu tidak memberitahuku dari awal?","Ternyata begini. Yu Jin, hampir saja menyalahkanmu dengan tidak adil, mengapa kamu tidak memberitahuku dari awal?",},
        [2562] = {3005,"Cao Cao","Yu Jin","Pada saat itu situasi darurat, musuh mengejar dari belakang, aku memilih untuk menghadang dulu. Tuan Cao adalah orang yang bijaksana, rumor akan berhenti pada orang yang bijaksana.","Pada saat itu situasi darurat, musuh mengejar dari belakang, aku memilih untuk menghadang dulu. Tuan Cao adalah orang yang bijaksana, rumor akan berhenti pada orang yang bijaksana.",},
        [2563] = {3005,"Protagonis","Cao Cao","Memendam dalam-dalam semua masalah ini, tapi kamu masih berhasil mengatur tentara sambil mengabaikan fitnah sehingga kita bisa menang dalam pertempuran ini. Bahkan jenderal terhebat di zaman kuno tidak bisa melebihimu!","Memendam dalam-dalam semua masalah ini, tapi kamu masih berhasil mengatur tentara sambil mengabaikan fitnah sehingga kita bisa menang dalam pertempuran ini. Bahkan jenderal terhebat di zaman kuno tidak bisa melebihimu!",},
        [2564] = {3005,"Cao Cao","Protagonis","Kakak Cao bijaksana!","Kakak Cao bijaksana!",},
        [2565] = {3005,"Protagonis","Cao Cao","Pada pertempuran Wancheng, aku kehilangan putra sulungku dan keponakanku. Tetapi semua tragedi itu tidak bisa dibandingkan dengan kematian Dian Wei hingga membuatku menangis!","Pada pertempuran Wancheng, aku kehilangan putra sulungku dan keponakanku. Tetapi semua tragedi itu tidak bisa dibandingkan dengan kematian Dian Wei hingga membuatku menangis!",},
        [2566] = {3101,"Ge Xiang","Yuan Shu","Kaisar Gaozu Dinasti Han dulunya hanya seorang Kepala Desa di Sungai Si, tetapi bisa memerintah negara; Dan sekarang Dinasti Han telah melalui 400 tahun dan mendekati akhir, situasi telah menjadi kacau.","Kaisar Gaozu Dinasti Han dulunya hanya seorang Kepala Desa di Sungai Si, tetapi bisa memerintah negara; Dan sekarang Dinasti Han telah melalui 400 tahun dan mendekati akhir, situasi telah menjadi kacau.",},
        [2567] = {3101,"Ge Xiang","Yuan Shu","Keluargaku selalu berada di kedudukan tinggi, rakyat menyambut dominasiku; Aku akan mematuhi kehendak langit dan menyatakan diri sebagai kaisar. Bagaimana menurut kalian?","Keluargaku selalu berada di kedudukan tinggi, rakyat menyambut dominasiku; Aku akan mematuhi kehendak langit dan menyatakan diri sebagai kaisar. Bagaimana menurut kalian?",},
        [2568] = {3101,"Yuan Shu","Ge Xiang","Tidak bisa. Pada saat itu Dinasti Zhou mengumpulkan kebajikan dan pahala hingga Raja Wen memegang kendali 2/3 negara, tetapi raknya masih tundung pada Yin Zhou dari Shang. Meskipun kamu dan keluargamu adalah kaum ningrat, pengaruhmu masih belum bisa mengalahkan Raja Wen. Selain itu, Dinasti Han yang kecil, tetapi kaisar saat ini tidak sekejam Yin Zhou. Jadi hal ini tidaklah mungkin.","Tidak bisa. Pada saat itu Dinasti Zhou mengumpulkan kebajikan dan pahala hingga Raja Wen memegang kendali 2/3 negara, tetapi raknya masih tundung pada Yin Zhou dari Shang. Meskipun kamu dan keluargamu adalah kaum ningrat, pengaruhmu masih belum bisa mengalahkan Raja Wen. Selain itu, Dinasti Han yang kecil, tetapi kaisar saat ini tidak sekejam Yin Zhou. Jadi hal ini tidaklah mungkin.",},
        [2569] = {3101,"Ge Xiang","Yuan Shu","Margaku Yuan berasal dari Chen, dan Chen adalah keturunan Yu Bebat dan Shun. Menuruskan elemen api dengan tanah Dinasti Han. Dan ada nubuat mengakatan: Pengganti Dinasti Han, adalah seorang yang besar berada dalam perjalanan. Namaku Shu, nama kehormatan Gonglu, aku akan menggantikannya seperti nubuat ini.","Margaku Yuan berasal dari Chen, dan Chen adalah keturunan Yu Bebat dan Shun. Menuruskan elemen api dengan tanah Dinasti Han. Dan ada nubuat mengakatan: Pengganti Dinasti Han, adalah seorang yang besar berada dalam perjalanan. Namaku Shu, nama kehormatan Gonglu, aku akan menggantikannya seperti nubuat ini.",},
        [2570] = {3101,"Ge Xiang","Yuan Shu","Dan Stempel Kerajaan ada di tanganku. Jika tidak menjadi kaisar, ini sama dengan menentang hukum alam! Aku telah memutuskan, yang tidak setuju akan dibunuh!","Dan Stempel Kerajaan ada di tanganku. Jika tidak menjadi kaisar, ini sama dengan menentang hukum alam! Aku telah memutuskan, yang tidak setuju akan dibunuh!",},
        [2571] = {3102,"Protagonis","Zhang Xingcai","Tuan, dengar-dengar Yuan Shu tidak tahu malu dan sombong, menyatakan diri sebagai kaisar di Shouchun!","Tuan, dengar-dengar Yuan Shu tidak tahu malu dan sombong, menyatakan diri sebagai kaisar di Shouchun!",},
        [2572] = {3102,"Protagonis","Guan Yinping","Yuan Shu orang ini penuh dengan niat jahat, dan ingin menjadi kaisar! Hah! Tuanku adalah Jenderal Yangwei yang diangkat oleh Kaisar Han Sendiri!","Yuan Shu orang ini penuh dengan niat jahat, dan ingin menjadi kaisar! Hah! Tuanku adalah Jenderal Yangwei yang diangkat oleh Kaisar Han Sendiri!",},
        [2573] = {3102,"Guan Yinping","Protagonis","Jika Yuan Shu kaisar murahan ini bisa duduk tenang, aku akan memanjat tiga putaran dengan telanjang di atas tembok Luoyang! Humph!","Jika Yuan Shu kaisar murahan ini bisa duduk tenang, aku akan memanjat tiga putaran dengan telanjang di atas tembok Luoyang! Humph!",},
        [2574] = {3102,"Protagonis","Zhang Xingcai","Tuan, cuaca sangat dingin, kalau membuka baju dan memanjat di Luoyang, bisa mati kedinginan!","Tuan, cuaca sangat dingin, kalau membuka baju dan memanjat di Luoyang, bisa mati kedinginan!",},
        [2575] = {3102,"Protagonis","Guan Yinping","Xingcai, leluconmu ini sangat dingin!","Xingcai, leluconmu ini sangat dingin!",},
        [2576] = {3102,"Guan Yinping","Protagonis","(Tertawa canggung) Ayo, ayo, kita cari seseorang untuk melawan Yuan Shu bersama!","(Tertawa canggung) Ayo, ayo, kita cari seseorang untuk melawan Yuan Shu bersama!",},
        [2577] = {3103,"Yuan Shu","Protagonis","Yuan Shu, kamu dengan sombongnya menyebut diri sebagai kaisar, hingga dipandang rendah oleh para pangeran. Aku telah bersatu dengan Cao Cao, Liu Bei dan Lu Bu, tentara tiga arah kami akan maju menuju Shouchun. Kamu pasti akan menjadi sasaran banyak orang!","Yuan Shu, kamu dengan sombongnya menyebut diri sebagai kaisar, hingga dipandang rendah oleh para pangeran. Aku telah bersatu dengan Cao Cao, Liu Bei dan Lu Bu, tentara tiga arah kami akan maju menuju Shouchun. Kamu pasti akan menjadi sasaran banyak orang!",},
        [2578] = {3103,"Protagonis","Yuan Shu","Stempel Kerajaan ada ditangan, dunia adalah milikku! Siapa yang berani menghentikanku, akan kuhancurkan dia!","Stempel Kerajaan ada ditangan, dunia adalah milikku! Siapa yang berani menghentikanku, akan kuhancurkan dia!",},
        [2579] = {3104,"Protagonis","Guan Yinping","Yuan Shu benar-benar konyol! Lihat dia, lari karena kalah! Untungnya tidak sia-sia kemari, kita mendapatkan Token Hero!","Yuan Shu benar-benar konyol! Lihat dia, lari karena kalah! Untungnya tidak sia-sia kemari, kita mendapatkan Token Hero!",},
        [2580] = {3104,"Guan Yinping","Protagonis","Meskipun Yuan Shu telah dikalahkan oleh kami, tetapi ruang lingkup pengaruhnya sangat luas, sebaiknya kita memikirkan rencana dengan baik.","Meskipun Yuan Shu telah dikalahkan oleh kami, tetapi ruang lingkup pengaruhnya sangat luas, sebaiknya kita memikirkan rencana dengan baik.",},
        [2581] = {3104,"Protagonis","Guan Yinping","Yuan Shu menempati area makmur di Nanyang, Runan dan Jianghuai. Wilayahnya besar, populasinya banyak dan dia kaya akan uang dan ransum. Kita harus memperlemah kekuatannya.","Yuan Shu menempati area makmur di Nanyang, Runan dan Jianghuai. Wilayahnya besar, populasinya banyak dan dia kaya akan uang dan ransum. Kita harus memperlemah kekuatannya.",},
        [2582] = {3104,"Guan Yinping","Protagonis","Tidak masalah! Pengaruh Yuan Shu, tidak perlu dikatakan lagi, di Jiangdong ini aku bisa memusnahkannya!","Tidak masalah! Pengaruh Yuan Shu, tidak perlu dikatakan lagi, di Jiangdong ini aku bisa memusnahkannya!",},
        [2583] = {3104,"Protagonis","Guan Yinping","Sun Jian menemukan Stempel Kerajaan di Luoyang dan membawanya ke Jiangdong, lalu dirampok oleh Yuan Shu. Sepertinya Sun Ce selalu memiliki dendam terhadap Yuan Shu!","Sun Jian menemukan Stempel Kerajaan di Luoyang dan membawanya ke Jiangdong, lalu dirampok oleh Yuan Shu. Sepertinya Sun Ce selalu memiliki dendam terhadap Yuan Shu!",},
        [2584] = {3104,"Guan Yinping","Protagonis","Ayo kita pergi ke Jiangdong dan bertemu dengan Sun Ce!","Ayo kita pergi ke Jiangdong dan bertemu dengan Sun Ce!",},
        [2585] = {3201,"Protagonis","Sun Ce","Jarang ada Hero muda datang ke Jiangdong, kamu membantuku berkali-kali, seperti keluarga sendiri! Aku pasti akan menjamumu dengan baik! Seseorang, bawakan anggur bagus dan makanan lezat untuknya!","Jarang ada Hero muda datang ke Jiangdong, kamu membantuku berkali-kali, seperti keluarga sendiri! Aku pasti akan menjamumu dengan baik! Seseorang, bawakan anggur bagus dan makanan lezat untuknya!",},
        [2586] = {3201,"Sun Ce","Protagonis","Terima kasih banyak kakak Sun, haha! Kalau begitu seharusnya keluarkan arak bagus simpananmu, jangan merasa tidak rela!","Terima kasih banyak kakak Sun, haha! Kalau begitu seharusnya keluarkan arak bagus simpananmu, jangan merasa tidak rela!",},
        [2587] = {3201,"Protagonis","Sun Ce","Tidak masalah, ayo, kita tos.","Tidak masalah, ayo, kita tos.",},
        [2588] = {3201,"Sun Ce","Protagonis","(Sedang minum dengan bahagia) Kakak Sun, aku memiliki nasihat untukmu!","(Sedang minum dengan bahagia) Kakak Sun, aku memiliki nasihat untukmu!",},
        [2589] = {3201,"Protagonis","Sun Ce","Kita bukanlah orang asing, jika ada masalah bisa langsung bicara!","Kita bukanlah orang asing, jika ada masalah bisa langsung bicara!",},
        [2590] = {3201,"Sun Ce","Protagonis","Yuan Shu mencuri gelar kaisar dan sekarang dikucilkan, dia adalah sasaran banyak orang. Kamu sebaiknya memutuskan hubungan dengannya.","Yuan Shu mencuri gelar kaisar dan sekarang dikucilkan, dia adalah sasaran banyak orang. Kamu sebaiknya memutuskan hubungan dengannya.",},
        [2591] = {3201,"Protagonis","Sun Ce","Haha, aku juga berpikir sama. Yuan Shu ingin menjadi kaisar sejak dulu, aku pernah menuliskan surat untuk membujuknya, tidak disangka dia tidak mendengarkannya. Mendengarkan perkataanmu lagi hari ini, aku semakin berkeinginan untuk berpisah dengannya!","Haha, aku juga berpikir sama. Yuan Shu ingin menjadi kaisar sejak dulu, aku pernah menuliskan surat untuk membujuknya, tidak disangka dia tidak mendengarkannya. Mendengarkan perkataanmu lagi hari ini, aku semakin berkeinginan untuk berpisah dengannya!",},
        [2592] = {3201,"Sun Ce","Protagonis","Haha, kakak Sun sangat bijaksana!","Haha, kakak Sun sangat bijaksana!",},
        [2593] = {3201,"Protagonis","Sun Ce","Aku akan menyerang Lujiang dalam waktu dekat, menyatukan enam prefektur Jiangdong, Hero muda bersediakah membantuku?","Aku akan menyerang Lujiang dalam waktu dekat, menyatukan enam prefektur Jiangdong, Hero muda bersediakah membantuku?",},
        [2594] = {3201,"Sun Ce","Protagonis","Sangat bersedia, akan kubantu dengan sepenuh tenaga!","Sangat bersedia, akan kubantu dengan sepenuh tenaga!",},
        [2595] = {3201,"Protagonis","Sun Ce","Haha! Hero muda memang hebat!","Haha! Hero muda memang hebat!",},
        [2596] = {3202,"Protagonis","Sun Ce","Pemimpin Prefektur Lujiang - Liu Xun telah kabur dan mencari perlindungan dari Cao Cao di Xuchang.","Pemimpin Prefektur Lujiang - Liu Xun telah kabur dan mencari perlindungan dari Cao Cao di Xuchang.",},
        [2597] = {3202,"Sun Ce","Protagonis","Huang Zu juga diserang hingga kabur oleh mereka, sayang sekali kami belum bisa membantu membalaskan dendam ayahmu!","Huang Zu juga diserang hingga kabur oleh mereka, sayang sekali kami belum bisa membantu membalaskan dendam ayahmu!",},
        [2598] = {3202,"Protagonis","Sun Ce","Ini bisa menunggu. Saat aku menyatukan Jiangdong, cepat atau lambat aku akan memenggal kepalanya dan mempersembahkannya pada ayahku!","Ini bisa menunggu. Saat aku menyatukan Jiangdong, cepat atau lambat aku akan memenggal kepalanya dan mempersembahkannya pada ayahku!",},
        [2599] = {3202,"Sun Ce","Protagonis","Hanya tersisa satu yaitu Yuzhang. Ayo pergi dan ambil semuanya!","Hanya tersisa satu yaitu Yuzhang. Ayo pergi dan ambil semuanya!",},
        [2600] = {3203,"Sun Ce","Protagonis","Hari ini kakak Sun sangat bahagia!","Hari ini kakak Sun sangat bahagia!",},
        [2601] = {3203,"Protagonis","Sun Ce","Haha, Yu Fan berhasil dibujuk untuk menyerah. Yuzhang ditangkap tanpa satu serangan pun, tentunya aku sangat senang!","Haha, Yu Fan berhasil dibujuk untuk menyerah. Yuzhang ditangkap tanpa satu serangan pun, tentunya aku sangat senang!",},
        [2602] = {3203,"Sun Ce","Protagonis","Bawahan kakak Sun penuh dengan talenta. Hei, siapa orang muda di depan itu? Berwajah tampan dan terlihat fasih, pasti merupakan kelahiran bangsawan.","Bawahan kakak Sun penuh dengan talenta. Hei, siapa orang muda di depan itu? Berwajah tampan dan terlihat fasih, pasti merupakan kelahiran bangsawan.",},
        [2603] = {3203,"Protagonis","Sun Ce","Jarang ada orang yang dipuji oleh Hero muda, ayo, kita maju melihat siapa orangnya.","Jarang ada orang yang dipuji oleh Hero muda, ayo, kita maju melihat siapa orangnya.",},
        [2604] = {3204,"Lu Xun","Sun Ce","Aku adalah Sun Ce, siapa kamu?","Aku adalah Sun Ce, siapa kamu?",},
        [2605] = {3204,"Sun Ce","Lu Xun","Hormat, jenderal. Namaku Lu Xun, nama kehormatan Boyan. Aku berasal dari Prefektur Wu.","Hormat, jenderal. Namaku Lu Xun, nama kehormatan Boyan. Aku berasal dari Prefektur Wu.",},
        [2606] = {3204,"Lu Xun","Sun Ce","Aku mendengar bahwa ada empat keluarga besar di Prefektur Wu: Lu, Gu, Zhu dan Zhang. Apakah kamu berasal dari keluarga Lu?","Aku mendengar bahwa ada empat keluarga besar di Prefektur Wu: Lu, Gu, Zhu dan Zhang. Apakah kamu berasal dari keluarga Lu?",},
        [2607] = {3204,"Sun Ce","Lu Xun","Iya.","Iya.",},
        [2608] = {3204,"Lu Xun","Sun Ce","Sangat bagus, sebagai seorang pria yang sederhana dan terpelajar, kamu akan memiliki kesuksesan besar di masa depan. Apakah kamu sudah menikah? ","Sangat bagus, sebagai seorang pria yang sederhana dan terpelajar, kamu akan memiliki kesuksesan besar di masa depan. Apakah kamu sudah menikah? ",},
        [2609] = {3204,"Sun Ce","Lu Xun","Lapor jenderal, belum menikah.","Lapor jenderal, belum menikah.",},
        [2610] = {3204,"Lu Xun","Sun Ce","Haha, baiklah, kamu adalah menantu priaku! Akan kunikahkan putri pertamaku padamu, saat dia dewasa, kamu akan kemari untuk menikah dengannya.","Haha, baiklah, kamu adalah menantu priaku! Akan kunikahkan putri pertamaku padamu, saat dia dewasa, kamu akan kemari untuk menikah dengannya.",},
        [2611] = {3205,"Protagonis","Sun Ce","Hero muda, menurutmu bagaimana menantu priaku yang baru?","Hero muda, menurutmu bagaimana menantu priaku yang baru?",},
        [2612] = {3205,"Sun Ce","Protagonis","Kelahiran ningrat, rendah hati tetapi keras pada diri sendiri, berkarakter lembutm rajin membaca buku, memiliki masa depan yang tak terbatas. ","Kelahiran ningrat, rendah hati tetapi keras pada diri sendiri, berkarakter lembutm rajin membaca buku, memiliki masa depan yang tak terbatas. ",},
        [2613] = {3205,"Protagonis","Sun Ce","Hahaha, menurutku tidak buruk, hari ini benar-benar bahagia. Mari, mari, kita minum-minum dan pergi berburu bersama!","Hahaha, menurutku tidak buruk, hari ini benar-benar bahagia. Mari, mari, kita minum-minum dan pergi berburu bersama!",},
        [2614] = {3205,"Sun Ce","Protagonis","Kakak Sun sangat suka bepergian, aku harus membawakannya banyak pengikut.","Kakak Sun sangat suka bepergian, aku harus membawakannya banyak pengikut.",},
        [2615] = {3205,"Protagonis","Sun Ce","Apa yang kamu takutkan? Aku Sun Ce, maharaja hebat! Sekarang aku telah memiliki enam prefektur, Jiangdong adalah milikku sepenuhnya! Siapa yang masih berani melawanku? Aku tahu kamu suka Token Hero, aku memerintahkan orangku untuk mencarinya di segala tempat dan mendapatkan satu buah untukmu!","Apa yang kamu takutkan? Aku Sun Ce, maharaja hebat! Sekarang aku telah memiliki enam prefektur, Jiangdong adalah milikku sepenuhnya! Siapa yang masih berani melawanku? Aku tahu kamu suka Token Hero, aku memerintahkan orangku untuk mencarinya di segala tempat dan mendapatkan satu buah untukmu!",},
        [2616] = {3205,"Sun Ce","Protagonis","Kakak Sun memang murah hati, terima kasih!","Kakak Sun memang murah hati, terima kasih!",},
        [2617] = {3301,"Protagonis","Sun Ce","Hero muda, bisakah membantuku?","Hero muda, bisakah membantuku?",},
        [2618] = {3301,"Sun Ce","Protagonis","Kamu datang kesini untuk kedua putrimu Da Qiao dan Xiao Qiao?","Kamu datang kesini untuk kedua putrimu Da Qiao dan Xiao Qiao?",},
        [2619] = {3301,"Protagonis","Sun Ce","Hero muda menebak dengan benar.","Hero muda menebak dengan benar.",},
        [2620] = {3301,"Sun Ce","Protagonis","Haha, Xingcai dan Xiao Qiao saling kenal, dia telah memberitahuku dari awal!","Haha, Xingcai dan Xiao Qiao saling kenal, dia telah memberitahuku dari awal!",},
        [2621] = {3301,"Protagonis","Sun Ce","Ternyata begini, aku ingin meminta bantuan dengan tulus. Saat Gongjin dan aku bertemu dengan mereka, kami menyukai mereka. ","Ternyata begini, aku ingin meminta bantuan dengan tulus. Saat Gongjin dan aku bertemu dengan mereka, kami menyukai mereka. ",},
        [2622] = {3301,"Protagonis","Sun Ce","Tetapi Qiao Gong tidak bersedia untuk menikahkan mereka dengan kami karena aku menyerang Wancheng. Kamu adalah Jenderal Yangwei yang diangkat oleh kaisar sendiri, bantu kami untuk menanyakan tentang pernikahannya, dia pasti tidak akan menolak.","Tetapi Qiao Gong tidak bersedia untuk menikahkan mereka dengan kami karena aku menyerang Wancheng. Kamu adalah Jenderal Yangwei yang diangkat oleh kaisar sendiri, bantu kami untuk menanyakan tentang pernikahannya, dia pasti tidak akan menolak.",},
        [2623] = {3301,"Sun Ce","Protagonis","Baik, akan kucoba, ingatlah untuk mengundangku ke pernikahanmu!","Baik, akan kucoba, ingatlah untuk mengundangku ke pernikahanmu!",},
        [2624] = {3302,"Zhang Xingcai","Protagonis","Eh, Xingcai mengapa kamu disini?","Eh, Xingcai mengapa kamu disini?",},
        [2625] = {3302,"Protagonis","Zhang Xingcai","Tuan, Paman Qiao mengatakan kamu harus melewati pertandingan dua saudari untuk dapat menikah!","Tuan, Paman Qiao mengatakan kamu harus melewati pertandingan dua saudari untuk dapat menikah!",},
        [2626] = {3302,"Zhang Xingcai","Protagonis","Haha, sangat mudah. Tidak perlu bicara lagi, aku sangat hebat, dapat melewati ujian ini dengan mudah!","Haha, sangat mudah. Tidak perlu bicara lagi, aku sangat hebat, dapat melewati ujian ini dengan mudah!",},
        [2627] = {3302,"Protagonis","Zhang Xingcai","Tuan sehebat ini, kalau begitu bertarunglah!","Tuan sehebat ini, kalau begitu bertarunglah!",},
        [2628] = {3303,"Sun Shangxiang","Guan Yinping","Sun Shangxiang, ilmu-mu sangat hebat, di masa depan harus menikah dengan Hero hebat!","Sun Shangxiang, ilmu-mu sangat hebat, di masa depan harus menikah dengan Hero hebat!",},
        [2629] = {3303,"Guan Yinping","Sun Shangxiang","Aku sebagai wanita perkasa yang bisa menembakkan panah di atas kuda dengan mengenakan gaun, mengapa harus menikah, aku ingin bertempur dan membunuh lawan!","Aku sebagai wanita perkasa yang bisa menembakkan panah di atas kuda dengan mengenakan gaun, mengapa harus menikah, aku ingin bertempur dan membunuh lawan!",},
        [2630] = {3303,"Sun Shangxiang","Guan Yinping","Kakak, kamu harus menikah dengan hero besar, maka baru bisa mendapatkan kesempatan untuk bertarung bersama suamimu! Jika menikah dengan lelaki biasa, seumur hidupmu hanya untuk membantu suami dan mendidik anak!","Kakak, kamu harus menikah dengan hero besar, maka baru bisa mendapatkan kesempatan untuk bertarung bersama suamimu! Jika menikah dengan lelaki biasa, seumur hidupmu hanya untuk membantu suami dan mendidik anak!",},
        [2631] = {3303,"Guan Yinping","Sun Shangxiang","Yang kamu katakan masuk akal, aku akan pergi mencari ibu, dalam hidup ini, aku hanya ingin menikahi seorang hero!","Yang kamu katakan masuk akal, aku akan pergi mencari ibu, dalam hidup ini, aku hanya ingin menikahi seorang hero!",},
        [2632] = {3304,"Da Qiao","Zhang Xingcai","Kakak Da Qiao kamu sangat cantik, seperti seorang dewi!","Kakak Da Qiao kamu sangat cantik, seperti seorang dewi!",},
        [2633] = {3304,"Zhang Xingcai","Da Qiao","Adik Xingcai, kamu juga sangat lucu.","Adik Xingcai, kamu juga sangat lucu.",},
        [2634] = {3304,"Zhang Xingcai","Guan Yinping","Kaki panjangku adalah yang terbaik di dunia!","Kaki panjangku adalah yang terbaik di dunia!",},
        [2635] = {3304,"Guan Yinping","Zhang Xingcai","… Guan Yinping!","… Guan Yinping!",},
        [2636] = {3304,"Da Qiao","Guan Yinping","Baiklah, jangan saling membual! Kakak Da Qiao, Tuanku ingin memintaku untuk bertanya padamu, apakah kamu bersedia menikahi Sun Ce?","Baiklah, jangan saling membual! Kakak Da Qiao, Tuanku ingin memintaku untuk bertanya padamu, apakah kamu bersedia menikahi Sun Ce?",},
        [2637] = {3304,"Zhang Xingcai","Da Qiao","Aku, aku, bersedia menikahi dia!","Aku, aku, bersedia menikahi dia!",},
        [2638] = {3304,"Da Qiao","Guan Yinping","Haha, hebat! Kalian berdua memang cocok!","Haha, hebat! Kalian berdua memang cocok!",},
        [2639] = {3305,"Protagonis","Xiao Qiao","Jenderal Yangwei legendaris, akhirnya dapat bertemu denganmu! Mohon maafkan kecerobohan Xiao Qiao!","Jenderal Yangwei legendaris, akhirnya dapat bertemu denganmu! Mohon maafkan kecerobohan Xiao Qiao!",},
        [2640] = {3305,"Xiao Qiao","Protagonis","Kenapa?","Kenapa?",},
        [2641] = {3305,"Protagonis","Xiao Qiao","Sebenarnya Gongjin dan aku telah kenal cukup lama, kelinci putihku adalah pemberian Gongjin! Memperkenalkan Da Qiao dan Sun adalah ideku! Kontes ini juga adalah ideku!","Sebenarnya Gongjin dan aku telah kenal cukup lama, kelinci putihku adalah pemberian Gongjin! Memperkenalkan Da Qiao dan Sun adalah ideku! Kontes ini juga adalah ideku!",},
        [2642] = {3305,"Xiao Qiao","Guan Yinping","Xiao Qiao, kamu memang nakal, banyak ide jahat, benar-benar tidak terlihat!","Xiao Qiao, kamu memang nakal, banyak ide jahat, benar-benar tidak terlihat!",},
        [2643] = {3305,"Guan Yinping","Xiao Qiao","Mereka membuat kontes ini, hanya ingin melihat Jenderal Yangwei legendaris itu!","Mereka membuat kontes ini, hanya ingin melihat Jenderal Yangwei legendaris itu!",},
        [2644] = {3305,"Protagonis","Xiao Qiao","Jenderal Yangwei, Xiao Qiao meskipun jauh di Jiangdong, tetapi aku pernah mendengar namamu sejak lama.","Jenderal Yangwei, Xiao Qiao meskipun jauh di Jiangdong, tetapi aku pernah mendengar namamu sejak lama.",},
        [2645] = {3305,"Protagonis","Xiao Qiao","Sekarang aku bertemu denganmu, merasa ilmumu tidak biasa, berwajah tampan, sangat hebat! Gongjin mengatakan kamu suka dengan Token Hero, aku memiliki sebuah Token dan akan kuberikan padamu!","Sekarang aku bertemu denganmu, merasa ilmumu tidak biasa, berwajah tampan, sangat hebat! Gongjin mengatakan kamu suka dengan Token Hero, aku memiliki sebuah Token dan akan kuberikan padamu!",},
        [2646] = {3305,"Xiao Qiao","Protagonis","Haha, terima kasih! Karena kalian dua saudari telah setuju, kalau begitu menikahlah lebih cepat dan undang kami di pernikahannya!","Haha, terima kasih! Karena kalian dua saudari telah setuju, kalau begitu menikahlah lebih cepat dan undang kami di pernikahannya!",},
        [2647] = {3401,"Protagonis","Zhou Yu","Jenderal Yangwei, kali ini aku datang untuk berterima kasih. Tanpamu, aku tidak bisa menikah semudah ini.","Jenderal Yangwei, kali ini aku datang untuk berterima kasih. Tanpamu, aku tidak bisa menikah semudah ini.",},
        [2648] = {3401,"Zhou Yu","Protagonis","Haha, sejak jaman kuno, Jiangdong merupakan tanah yang indah. Da Qiao dan Xiao Qiao cantik seperti bunga, kamu dan Bofu sangat beruntung dapat menikahi mereka.","Haha, sejak jaman kuno, Jiangdong merupakan tanah yang indah. Da Qiao dan Xiao Qiao cantik seperti bunga, kamu dan Bofu sangat beruntung dapat menikahi mereka.",},
        [2649] = {3401,"Protagonis","Zhou Yu","Jenderal Yangwei bercanda…","Jenderal Yangwei bercanda…",},
        [2650] = {3401,"Zhou Yu","Protagonis","Cepat tuangkan arak untuk Gongjin! Tos, aku minum habis, kamu terserah!","Cepat tuangkan arak untuk Gongjin! Tos, aku minum habis, kamu terserah!",},
        [2651] = {3401,"Protagonis","Zhou Yu","Jenderal sepertinya minum terlalu banyak!","Jenderal sepertinya minum terlalu banyak!",},
        [2652] = {3401,"Zhou Yu","Protagonis","Tidak, aku masih belum mabuk! Ayo, bukankah itu Jenderal Taishi Ci? Aku ingin beradu dengannya!","Tidak, aku masih belum mabuk! Ayo, bukankah itu Jenderal Taishi Ci? Aku ingin beradu dengannya!",},
        [2653] = {3402,"Taishi Ci","Guan Yinping","Jenderal Taishi Ci, Tuanku mabuk! Ingin beradu bela diri denganmu!","Jenderal Taishi Ci, Tuanku mabuk! Ingin beradu bela diri denganmu!",},
        [2654] = {3402,"Guan Yinping","Taishi Ci","Yinping, tenanglah. Aku pasti akan menahan diri sendiri untuk tidak menyakiti Tuanmu!","Yinping, tenanglah. Aku pasti akan menahan diri sendiri untuk tidak menyakiti Tuanmu!",},
        [2655] = {3402,"Taishi Ci","Guan Yinping","Salah, jenderal! Tuanku kuat dari awal, dia bahkan akan lebih kuat setelah mabuk! Aku hanya khawatir setelah mabuk, dia kaan menyakitimu, aku kemari untuk mengingatkanmu!","Salah, jenderal! Tuanku kuat dari awal, dia bahkan akan lebih kuat setelah mabuk! Aku hanya khawatir setelah mabuk, dia kaan menyakitimu, aku kemari untuk mengingatkanmu!",},
        [2656] = {3402,"Guan Yinping","Taishi Ci","… Terima kasih atas peringatannya, nona. ","… Terima kasih atas peringatannya, nona. ",},
        [2657] = {3403,"Protagonis","Zhang Xingcai","Tuan, Xingcai telah mempersiapkan sup anti mabuk! Apakah sudah merasa baikan setelah minum sup ini?","Tuan, Xingcai telah mempersiapkan sup anti mabuk! Apakah sudah merasa baikan setelah minum sup ini?",},
        [2658] = {3403,"Zhang Xingcai","Protagonis","Terima kasih Xingcai, aku sudah baikan! Kemarin malam aku minum terlalu banyak hahaha.","Terima kasih Xingcai, aku sudah baikan! Kemarin malam aku minum terlalu banyak hahaha.",},
        [2659] = {3403,"Protagonis","Zhang Xingcai","Tuan, ada beberapa Hero yang telah menunggu cukup lama di luar pintu.","Tuan, ada beberapa Hero yang telah menunggu cukup lama di luar pintu.",},
        [2660] = {3403,"Zhang Xingcai","Protagonis","Oh, siapa mereka?","Oh, siapa mereka?",},
        [2661] = {3403,"Protagonis","Zhang Xingcai","Ini adalah kartu kunjungan mereka, mohon Tuan melihatnya!","Ini adalah kartu kunjungan mereka, mohon Tuan melihatnya!",},
        [2662] = {3403,"Zhang Xingcai","Protagonis","Ternyata Lu Su dan Lu Meng. Beritahu Zhou Yu untuk menemui mereka bersama-sama.","Ternyata Lu Su dan Lu Meng. Beritahu Zhou Yu untuk menemui mereka bersama-sama.",},
        [2663] = {3404,"Protagonis","Lu Su","Hormat, jenderal!","Hormat, jenderal!",},
        [2664] = {3404,"Lu Su","Protagonis","Kakak Zijing, telah lama mendengar tentangmu! Aku telah lama mendengar dari Gongjin, kamu adalah teman lamanya.","Kakak Zijing, telah lama mendengar tentangmu! Aku telah lama mendengar dari Gongjin, kamu adalah teman lamanya.",},
        [2665] = {3404,"Lu Su","Zhou Yu","Pada saat itu aku adalah kepala kediaman, mendengar bahwa Zijing suka beramal, aku meminta sedikit makanan darinya. Tanpa berkata, Zijing memberikan seluruh gudang dengan 3000 dou beras padaku.","Pada saat itu aku adalah kepala kediaman, mendengar bahwa Zijing suka beramal, aku meminta sedikit makanan darinya. Tanpa berkata, Zijing memberikan seluruh gudang dengan 3000 dou beras padaku.",},
        [2666] = {3404,"Lu Su","Protagonis","Kakak Zijing sungguh terus terang! Cerita rakyat mengatakan kamu adalah Dewa Kekayaan yang bahagia dan baik hati, ternyata memang benar!","Kakak Zijing sungguh terus terang! Cerita rakyat mengatakan kamu adalah Dewa Kekayaan yang bahagia dan baik hati, ternyata memang benar!",},
        [2667] = {3404,"Protagonis","Lu Su","Haha! Jika jenderal memiliki kesulitan apapun di waktu mendatang, carilah aku, aku pasti tidak akan menolaknya!","Haha! Jika jenderal memiliki kesulitan apapun di waktu mendatang, carilah aku, aku pasti tidak akan menolaknya!",},
        [2668] = {3405,"Protagonis","Lu Meng","Hormat, jenderal!","Hormat, jenderal!",},
        [2669] = {3405,"Lu Meng","Protagonis","Kamu masih muda, tetapi luar biasa, benar-benar Hero bermasa depan!","Kamu masih muda, tetapi luar biasa, benar-benar Hero bermasa depan!",},
        [2670] = {3405,"Protagonis","Lu Meng","Jenderal sangat baik!","Jenderal sangat baik!",},
        [2671] = {3405,"Lu Meng","Protagonis","Hei, mengapa kamu selalu membawa jangkar dan gulungan bambu?","Hei, mengapa kamu selalu membawa jangkar dan gulungan bambu?",},
        [2672] = {3405,"Protagonis","Lu Meng","Jangkar adalah senjata yang kubuat secara khusus, gulungan bambu adalah buku perang. Zijing menyarankanku untuk membaca buku ini, mempelajari dengan baik untuk membantu negara.","Jangkar adalah senjata yang kubuat secara khusus, gulungan bambu adalah buku perang. Zijing menyarankanku untuk membaca buku ini, mempelajari dengan baik untuk membantu negara.",},
        [2673] = {3405,"Lu Meng","Protagonis","Hebat, hebat! Masa depan Ziming tidak terbatas, Jiangdong memiliki banyak orang bertalenta!","Hebat, hebat! Masa depan Ziming tidak terbatas, Jiangdong memiliki banyak orang bertalenta!",},
        [2674] = {3406,"Protagonis","Zhou Yu","Jenderal Yangwei, silahkan lihat!","Jenderal Yangwei, silahkan lihat!",},
        [2675] = {3406,"Zhou Yu","Protagonis","Ini adalah surat Cao Cao untukmu!","Ini adalah surat Cao Cao untukmu!",},
        [2676] = {3406,"Protagonis","Zhou Yu","Cao Cao ingin membujukku untuk bergabung dengannya.","Cao Cao ingin membujukku untuk bergabung dengannya.",},
        [2677] = {3406,"Zhou Yu","Protagonis","Haha, Gongjin ahil sipil & militer, merupakan talenta di masanya, jika Cao Cao menginginkanmu itu bukanlah hal yang aneh.","Haha, Gongjin ahil sipil & militer, merupakan talenta di masanya, jika Cao Cao menginginkanmu itu bukanlah hal yang aneh.",},
        [2678] = {3406,"Protagonis","Zhou Yu","Meskipun begitu, tetapi bagaimana bisa hubunganku dan Bofu diprovokasi! Sekarang Cao Cao memegang kendali para pangeran, dia sangat ambisius, cepat atau lambat akan ada peperangan.","Meskipun begitu, tetapi bagaimana bisa hubunganku dan Bofu diprovokasi! Sekarang Cao Cao memegang kendali para pangeran, dia sangat ambisius, cepat atau lambat akan ada peperangan.",},
        [2679] = {3406,"Zhou Yu","Protagonis","Gongjin tenanglah, waktunya masih terlalu dini! Sekarang Yuan Shao menguasai Jizhou, Yuan Shu menduduki Huainan, masih ada Lu Bu yang memandang layaknya macan, Cao Cao berada di tengah-tengahnya, tidak mudah untuk melawan, terlebih lagi dia berada di sisi lain Sungai Panjang!","Gongjin tenanglah, waktunya masih terlalu dini! Sekarang Yuan Shao menguasai Jizhou, Yuan Shu menduduki Huainan, masih ada Lu Bu yang memandang layaknya macan, Cao Cao berada di tengah-tengahnya, tidak mudah untuk melawan, terlebih lagi dia berada di sisi lain Sungai Panjang!",},
        [2680] = {3406,"Protagonis","Zhou Yu","Jenderal memiliki pandangan jauh ke depan dan visi yang besar, membuat orang terkesima. Kunjungan jenderal ke Jiangdong kali ini telah banyak membantu kami. Aku bersedia memberikan Token Hero ini kepada jenderal.","Jenderal memiliki pandangan jauh ke depan dan visi yang besar, membuat orang terkesima. Kunjungan jenderal ke Jiangdong kali ini telah banyak membantu kami. Aku bersedia memberikan Token Hero ini kepada jenderal.",},
        [2681] = {3501,"Cao Cao","Xiahou Yuan","Perdana Menteri, jika ingin menenangkan dunia yang kacau ini, harus menaklukkan Zhang Xiu dulu, lalu menaklukkan Hebei.","Perdana Menteri, jika ingin menenangkan dunia yang kacau ini, harus menaklukkan Zhang Xiu dulu, lalu menaklukkan Hebei.",},
        [2682] = {3501,"Xiahou Yuan","Cao Cao","Zhang Xiu, siapa?","Zhang Xiu, siapa?",},
        [2683] = {3501,"Cao Cao","Protagonis","Lapor Perdana Menteri, Zhang Xiu adalah keponakan jauh dari Jenderal Piaoqi Zhang Ji. Dia memiliki Token Hero dan tinggal di Wancheng.","Lapor Perdana Menteri, Zhang Xiu adalah keponakan jauh dari Jenderal Piaoqi Zhang Ji. Dia memiliki Token Hero dan tinggal di Wancheng.",},
        [2684] = {3501,"Cao Cao","Protagonis","Dikenal sebagai Raja Tombak dari Utara, dia membawa tombak emas kepala macan. Teknik Burung Memandang Phoenix miliknya menggetarkan dunia.","Dikenal sebagai Raja Tombak dari Utara, dia membawa tombak emas kepala macan. Teknik Burung Memandang Phoenix miliknya menggetarkan dunia.",},
        [2685] = {3501,"Cao Cao","Protagonis","Ini adalah orang hebat di masanya. Jika dapat membuatnya bergabung, pasti akan ada sukses besar.","Ini adalah orang hebat di masanya. Jika dapat membuatnya bergabung, pasti akan ada sukses besar.",},
        [2686] = {3501,"Protagonis","Cao Cao","Perkataanmu benar, aku akan membawa tentara ke arah selatan, sesuai perkataanmu.","Perkataanmu benar, aku akan membawa tentara ke arah selatan, sesuai perkataanmu.",},
        [2687] = {3502,"Yu Jin","Cao Cao","Yu Jin, apakah prajurit telah berkumpul?","Yu Jin, apakah prajurit telah berkumpul?",},
        [2688] = {3502,"Cao Cao","Yu Jin","Lapor Perdana Menteri, prajurit telah berkumpul dan siap untuk berangkat kapanpun.","Lapor Perdana Menteri, prajurit telah berkumpul dan siap untuk berangkat kapanpun.",},
        [2689] = {3502,"Yu Jin","Cao Cao","Perintahkan pada prajurit, pergi sekarang tanpa menunda.","Perintahkan pada prajurit, pergi sekarang tanpa menunda.",},
        [2690] = {3503,"Guo Jia","Cao Cao","Fengxiao, gandum di sepanjang jalan telah masak, mengapa tidak ada yang memanen gandum?","Fengxiao, gandum di sepanjang jalan telah masak, mengapa tidak ada yang memanen gandum?",},
        [2691] = {3503,"Cao Cao","Guo Jia","Lapor Perdana Menteri, mungkin karena kami maju ke arah selatan, mengganggu petani.","Lapor Perdana Menteri, mungkin karena kami maju ke arah selatan, mengganggu petani.",},
        [2692] = {3503,"Guo Jia","Cao Cao","Fengxiao, segera beritahu penduduk desa dan pejabat yang berada di sekitar sini.","Fengxiao, segera beritahu penduduk desa dan pejabat yang berada di sekitar sini.",},
        [2693] = {3503,"Guo Jia","Cao Cao","Atas dekrit dari kaisar, dengan ini aku akan membawa prajurit melawan pemberontak dan kejahatan.","Atas dekrit dari kaisar, dengan ini aku akan membawa prajurit melawan pemberontak dan kejahatan.",},
        [2694] = {3503,"Guo Jia","Cao Cao","Aku tidak punya alternatif selain mengirimkan pasukan selama musim panen gandum. Semua perwira dan tentara tidak diizinkan menginjak ladang jagung. Siapa pun yang melanggar perintah ini akan dipenggal.","Aku tidak punya alternatif selain mengirimkan pasukan selama musim panen gandum. Semua perwira dan tentara tidak diizinkan menginjak ladang jagung. Siapa pun yang melanggar perintah ini akan dipenggal.",},
        [2695] = {3503,"Guo Jia","Cao Cao","Peraturan militer sangat ketat, jangan kaget atau takut.","Peraturan militer sangat ketat, jangan kaget atau takut.",},
        [2696] = {3503,"Cao Cao","Guo Jia","Ini adalah tindakan dengan kebaikan.","Ini adalah tindakan dengan kebaikan.",},
        [2697] = {3504,"Protagonis","Cao Cao","Seekor merpati mengganggu kudaku dan membatnya kabur ke ladang jagung dan menginjak gandum. Aku pasti akan dihukum sesuai aturan.","Seekor merpati mengganggu kudaku dan membatnya kabur ke ladang jagung dan menginjak gandum. Aku pasti akan dihukum sesuai aturan.",},
        [2698] = {3504,"Cao Cao","Protagonis","Perdana Menteri mengapa menghukum diri sendiri?","Perdana Menteri mengapa menghukum diri sendiri?",},
