        [2700] = {3504,"Cao Cao","Guo Jia","Buku kuno Negara Damai mengatakan: Hukum Taurat tidak berlaku bagi Kaisar. Kamu memimpin seluruh pasukan, bagaimana bisa menghukum diri sendiri sampai mati?","Buku kuno Negara Damai mengatakan: Hukum Taurat tidak berlaku bagi Kaisar. Kamu memimpin seluruh pasukan, bagaimana bisa menghukum diri sendiri sampai mati?",},
        [2701] = {3504,"Guo Jia","Cao Cao","Karena buku kuno Negara Damai mengatakan bahwa hukum itu tidak berlaku bagi Yang Mulia, saya tidak punya pilihan selain melepaskan diri.","Karena buku kuno Negara Damai mengatakan bahwa hukum itu tidak berlaku bagi Yang Mulia, saya tidak punya pilihan selain melepaskan diri.",},
        [2702] = {3504,"Guo Jia","Cao Cao","Beritahukan pada tentara bahwa Perdana Menteri telah menginjak ladang jagung, seharusnya dia sudah dipenggal, tetapi sekarang hanya rambutnya yang dipotong sebagai gantinya.","Beritahukan pada tentara bahwa Perdana Menteri telah menginjak ladang jagung, seharusnya dia sudah dipenggal, tetapi sekarang hanya rambutnya yang dipotong sebagai gantinya.",},
        [2703] = {3601,"Xun You","Cao Cao","Aku ingin menyerang Lu Bu, tidak takut dengan gangguan Yuan Shao, hanya takut dengan Liu Biao dan Zhang Xiu yang menyerang dari belakang.","Aku ingin menyerang Lu Bu, tidak takut dengan gangguan Yuan Shao, hanya takut dengan Liu Biao dan Zhang Xiu yang menyerang dari belakang.",},
        [2704] = {3601,"Cao Cao","Xun You","Mereka baru-baru ini dikalahkan dan tidak berani bertindak gegabah. Lu Bu gagah, jika dia bergabung dengan Yuan Shu dan menyatukan wilayah mereka yang panjang dan luas, situasinya akan sulit untuk ditangani.","Mereka baru-baru ini dikalahkan dan tidak berani bertindak gegabah. Lu Bu gagah, jika dia bergabung dengan Yuan Shu dan menyatukan wilayah mereka yang panjang dan luas, situasinya akan sulit untuk ditangani.",},
        [2705] = {3601,"Cao Cao","Guo Jia","Sekarang bisa melancarkan serangan mendadak padanya sementara dia baru saja diberontak akhir-akhir ini dan tidak mendapat dukungan semua orang.","Sekarang bisa melancarkan serangan mendadak padanya sementara dia baru saja diberontak akhir-akhir ini dan tidak mendapat dukungan semua orang.",},
