        [2708] = {3601,"Xiahou Dun","Cao Cao","Bawa 50.000 prajurit bersama dengan Xiaohou Yuan, Lu Qian dan Li Dian. Maju kedepan, Jian Yong akan mengikutmu.","Bawa 50.000 prajurit bersama dengan Xiaohou Yuan, Lu Qian dan Li Dian. Maju kedepan, Jian Yong akan mengikutmu.",},
        [2709] = {3602,"Lu Bu","Gao Shun","Fengxian, Cao Cao ingin mengirimkan prajurit untuk menyelamatkan Liu Bei dan menyerangmu.","Fengxian, Cao Cao ingin mengirimkan prajurit untuk menyelamatkan Liu Bei dan menyerangmu.",},
