        [2721] = {3604,"","Xiahou Dun","Tubuh berasal dari orang tua, tidak dapat disia-siakan! (Lalu menarik keluar panah dengan tangannya, tidak disangka bola matanya juga tertarik keluar. Dia memasukkannya ke mulut dan memakannya.)","Tubuh berasal dari orang tua, tidak dapat disia-siakan! (Lalu menarik keluar panah dengan tangannya, tidak disangka bola matanya juga tertarik keluar. Dia memasukkannya ke mulut dan memakannya.)",},
