        [2764] = {3804,"Protagonis","Cao Cao","Chen Gong semasa hidupnya selalu setia, dia adalah pahlawan yang sesungguhnya. Kekerasan hatinya membuatku tahu bahwa keras kepala tidak akan berhasil, menyia-nyiakan talentnya. Kita berikan pemakaman yang baik untuknya.","Chen Gong semasa hidupnya selalu setia, dia adalah pahlawan yang sesungguhnya. Kekerasan hatinya membuatku tahu bahwa keras kepala tidak akan berhasil, menyia-nyiakan talentnya. Kita berikan pemakaman yang baik untuknya.",},
        [2765] = {3804,"Protagonis","Cao Cao","Semuanya, menurut kalian apa yang harus kita lakukan terhadap Zhang Liao?","Semuanya, menurut kalian apa yang harus kita lakukan terhadap Zhang Liao?",},
        [2766] = {3804,"Cao Cao","Protagonis","Wenyuan adalah orang loyal dengan hati murni, kamu harus menjaganya.","Wenyuan adalah orang loyal dengan hati murni, kamu harus menjaganya.",},
        [2767] = {3804,"Protagonis","Cao Cao","Aku juga tahu Wenyuan sangat loyal dan adil, hanya bercanda.","Aku juga tahu Wenyuan sangat loyal dan adil, hanya bercanda.",},
        [2768] = {3804,"Protagonis","Cao Cao","Baik, sampaikan perintahku: Angkat Zhang Liao menjadi Kolonel dan berikan gelar Bangsawan Dalam. Biarkan dia pergi merekrut Zang Ba.","Baik, sampaikan perintahku: Angkat Zhang Liao menjadi Kolonel dan berikan gelar Bangsawan Dalam. Biarkan dia pergi merekrut Zang Ba.",},
        [2769] = {3901,"","Liu Bei","Rumor berkata, kakakku Gongsun Zan dikepung oleh Yuan Shao di Youzhou, apa yang harus kulakukan?","Rumor berkata, kakakku Gongsun Zan dikepung oleh Yuan Shao di Youzhou, apa yang harus kulakukan?",},
        [2770] = {3901,"Liu Bei","Protagonis","Xuande jangan panik, aku akan memimpin tentara dan pergi menyelamatkannya.","Xuande jangan panik, aku akan memimpin tentara dan pergi menyelamatkannya.",},
        [2771] = {3901,"Protagonis","Liu Bei","Tolong, terima kasih.","Tolong, terima kasih.",},
        [2772] = {3902,"Gongsun Zan","Yuan Shao","Hahahaha, Jenderal Kuda Putih dulu juga masih ada hari ini.","Hahahaha, Jenderal Kuda Putih dulu juga masih ada hari ini.",},
        [2773] = {3902,"Yuan Shao","Gongsun Zan","Jangan senang terlalu cepat, tunggu pasukan bantuan datang dan menyerang dalam kota, pasti akan kudapatkan kepalamu.","Jangan senang terlalu cepat, tunggu pasukan bantuan datang dan menyerang dalam kota, pasti akan kudapatkan kepalamu.",},
        [2774] = {3902,"Gongsun Zan","Yuan Shao","Bala bantuan? Surat permintaan bantuanmu telah kudapatkan sejak lama.","Bala bantuan? Surat permintaan bantuanmu telah kudapatkan sejak lama.",},
        [2775] = {3902,"Gongsun Zan","Yuan Shao","Kamu sebaiknya menurut saja dan menyerah.","Kamu sebaiknya menurut saja dan menyerah.",},
        [2776] = {3902,"Yuan Shao","Gongsun Zan","Meskipun tidak ada bala bantuan, aku telah membangun tembok dan Menara Yijing dengan tinggi puluhan meter. Aku juga menimbun ransum sebanyak 300.000 dan.","Meskipun tidak ada bala bantuan, aku telah membangun tembok dan Menara Yijing dengan tinggi puluhan meter. Aku juga menimbun ransum sebanyak 300.000 dan.",},
        [2777] = {3902,"Yuan Shao","Gongsun Zan","Menurutku kamu juga tidak bisa mengalahkanku, Yuan Shao.","Menurutku kamu juga tidak bisa mengalahkanku, Yuan Shao.",},
