        [2782] = {3904,"Gongsun Zan","Protagonis","Bogui, pasukan Yuan Shao telah menggali dalam-dalam dan akan menangkap Menara Yijing ini.","Bogui, pasukan Yuan Shao telah menggali dalam-dalam dan akan menangkap Menara Yijing ini.",},
        [2783] = {3904,"Gongsun Zan","Protagonis","Waktu mendesak, ikutlah bersamaku keluar dari kepungan.","Waktu mendesak, ikutlah bersamaku keluar dari kepungan.",},
        [2784] = {3904,"Protagonis","Gongsun Zan","Tidak perlu menyelamatkanku…","Tidak perlu menyelamatkanku…",},
        [2785] = {3904,"Gongsun Zan","Protagonis","Mengapa berkata seperti ini?","Mengapa berkata seperti ini?",},
        [2786] = {3904,"Protagonis","Gongsun Zan","Prajuritku telah habis setengah dan tidak ada lagi yang bisa dilakukan sekarang, hariku telah berakhir.","Prajuritku telah habis setengah dan tidak ada lagi yang bisa dilakukan sekarang, hariku telah berakhir.",},
