        [2789] = {4001,"Liu Bei","Kaisar Xian Han","Siapakah leluhurmu?","Siapakah leluhurmu?",},
        [2790] = {4001,"Kaisar Xian Han","Liu Bei","Aku adalah keturunan Pangeran Jing dari Zhongshan, cicit dari Kaisar Xiaojing, cucu dari Liu Xiong, dan putra Liu Hong.","Aku adalah keturunan Pangeran Jing dari Zhongshan, cicit dari Kaisar Xiaojing, cucu dari Liu Xiong, dan putra Liu Hong.",},
        [2791] = {4001,"Liu Bei","Kaisar Xian Han","Cucu Liu Xiong, putra Liu Hong… Jadi kamu adalah Paman Kerajaanku.","Cucu Liu Xiong, putra Liu Hong… Jadi kamu adalah Paman Kerajaanku.",},
        [2792] = {4001,"Liu Bei","Kaisar Xian Han","Sampaikan perintahku, angkat Xuande menjadi Jenderal Kiri dan Bangsawan Kota Yi.","Sampaikan perintahku, angkat Xuande menjadi Jenderal Kiri dan Bangsawan Kota Yi.",},
        [2793] = {4001,"Kaisar Xian Han","Liu Bei","Xuande berterima kasih atas kebaikan Kaisar.","Xuande berterima kasih atas kebaikan Kaisar.",},
        [2794] = {4002,"Cao Cao","Xun Yu","Kaisar menganggap Liu Bei sebagai paman, takutnya tidak ada keuntungan bagimu.","Kaisar menganggap Liu Bei sebagai paman, takutnya tidak ada keuntungan bagimu.",},
        [2795] = {4002,"Xun Yu","Cao Cao","Karena Kaisar menganggapnya sebagai Paman Kerajaan, aku memerintahnya dengan dekrit kaisar, dengan begitu dia tidak akan berani tidak patuh padaku.","Karena Kaisar menganggapnya sebagai Paman Kerajaan, aku memerintahnya dengan dekrit kaisar, dengan begitu dia tidak akan berani tidak patuh padaku.",},
        [2796] = {4002,"Xun Yu","Cao Cao","Dan lagi aku menjaganya di Xuchang. Meskipun dia dekat dengan kaisar, tetapi dia masih di dalam kendaliku, apa yang kutakutkan?","Dan lagi aku menjaganya di Xuchang. Meskipun dia dekat dengan kaisar, tetapi dia masih di dalam kendaliku, apa yang kutakutkan?",},
        [2797] = {4002,"Xun Yu","Cao Cao","Kekhawatiranku adalah bahwa Komandan Besar Yang Biao adalah kerabat Yuan Shu. Ini akan menjadi penyebab masalah jika dia bekerja sebagai agen yang ditanam bersama Yuan. Kita harus segera menyingkirkannya.","Kekhawatiranku adalah bahwa Komandan Besar Yang Biao adalah kerabat Yuan Shu. Ini akan menjadi penyebab masalah jika dia bekerja sebagai agen yang ditanam bersama Yuan. Kita harus segera menyingkirkannya.",},
        [2798] = {4002,"Cao Cao","Cheng Yu","Kamu sekarang sudah dikenal oleh banyak orang, mengapa tidak menggunakan kesempatan ini untuk menyatakan diri sebagai kaisar?","Kamu sekarang sudah dikenal oleh banyak orang, mengapa tidak menggunakan kesempatan ini untuk menyatakan diri sebagai kaisar?",},
        [2799] = {4002,"Cheng Yu","Cao Cao","Istana memiliki banyak jumlah orang tangan kanan dan tidak bisa dipancing dengan mudah. Aku akan mengundang kaisar untuk pergi berburu dan melihat keadaan.","Istana memiliki banyak jumlah orang tangan kanan dan tidak bisa dipancing dengan mudah. Aku akan mengundang kaisar untuk pergi berburu dan melihat keadaan.",},
        [2800] = {4003,"Kaisar Xian Han","Cao Cao","Aku telah memillih dan mempersiapkan kuda bagus, elang dan anjing hebat, busur dan panah. Pengawal juga sedang menunggu di bagian luar kota.","Aku telah memillih dan mempersiapkan kuda bagus, elang dan anjing hebat, busur dan panah. Pengawal juga sedang menunggu di bagian luar kota.",},
        [2801] = {4003,"Kaisar Xian Han","Cao Cao","Aku mengundangmu dengan hormat untuk berburu bersama.","Aku mengundangmu dengan hormat untuk berburu bersama.",},
        [2802] = {4003,"Cao Cao","Kaisar Xian Han","Berburu sepertinya bukan hal yang benar…","Berburu sepertinya bukan hal yang benar…",},
        [2803] = {4003,"Kaisar Xian Han","Cao Cao","Para kaisar sebelumnya berburu di setiap musim untuk berbagai tujuan baik, menunjukkan kekuatan militer mereka ke seluruh negara.","Para kaisar sebelumnya berburu di setiap musim untuk berbagai tujuan baik, menunjukkan kekuatan militer mereka ke seluruh negara.",},
        [2804] = {4003,"Kaisar Xian Han","Cao Cao","Sekarang seluruh negara sedang kacau, kamu harus lebih banyak berburu untuk menunjukkan kemampuanmu.","Sekarang seluruh negara sedang kacau, kamu harus lebih banyak berburu untuk menunjukkan kemampuanmu.",},
