        [2806] = {4003,"Cao Cao","Kaisar Xian Han","Namun aku ingin mengundang Xuande, Guan Yu dan Zhang Fei untuk pergi bersama.","Namun aku ingin mengundang Xuande, Guan Yu dan Zhang Fei untuk pergi bersama.",},
        [2807] = {4004,"Liu Bei","Kaisar Xian Han","Aku ingin melihat paman berburu hari ini.","Aku ingin melihat paman berburu hari ini.",},
        [2808] = {4004,"Kaisar Xian Han","Liu Bei","Ya, Yang Mulia. (Lalu menembak seekor kelinci di sawah tepat pada sasaran.)","Ya, Yang Mulia. (Lalu menembak seekor kelinci di sawah tepat pada sasaran.)",},
        [2809] = {4004,"Liu Bei","Kaisar Xian Han","Mengde mengapa tidak mencoba untuk berburu juga?","Mengde mengapa tidak mencoba untuk berburu juga?",},
        [2810] = {4004,"Kaisar Xian Han","Cao Cao","Ya, Yang Mulia. (Lalu mengambil panah dan busur kaisar untuk menembak rusa. Para menteri berteriak hebat, Yang Mulia, mengira tembakan kaisar terkena rusa. Cao Cao menunggangi kuda di depan, menghalangi kaisar dan menerima sorakan.)","Ya, Yang Mulia. (Lalu mengambil panah dan busur kaisar untuk menembak rusa. Para menteri berteriak hebat, Yang Mulia, mengira tembakan kaisar terkena rusa. Cao Cao menunggangi kuda di depan, menghalangi kaisar dan menerima sorakan.)",},
        [2811] = {4004,"Liu Bei","Guan Yu","Cao Cao menipu dan menentang kaisar, jika orang ini tidak dibunuh hari ini, dia pasti akan menjadi bencana besar. (Berbisik dengan Liu Bei)","Cao Cao menipu dan menentang kaisar, jika orang ini tidak dibunuh hari ini, dia pasti akan menjadi bencana besar. (Berbisik dengan Liu Bei)",},
