        [2845] = {4204,"Cao Cao","Liu Bei","Petir barusan, membuatku terkejut. (Xuande sangat terkejut ketika dia mendengar ini hingga sendok di tangannya jatuh, dia menjelaskan dengan segera.)","Petir barusan, membuatku terkejut. (Xuande sangat terkejut ketika dia mendengar ini hingga sendok di tangannya jatuh, dia menjelaskan dengan segera.)",},
