        [2852] = {4301,"Liu Bei","Cao Cao","Tetapi Yuan Shu terlalu sombong dan boros, bawahannya berpaling darinya dan ingin memberikan gelar kaisar kepada Yuan Shao. Sekarang telah meninggalkan Huainan dan kembali ke Hebei dengan membawa Stempel Kerajaan.","Tetapi Yuan Shu terlalu sombong dan boros, bawahannya berpaling darinya dan ingin memberikan gelar kaisar kepada Yuan Shao. Sekarang telah meninggalkan Huainan dan kembali ke Hebei dengan membawa Stempel Kerajaan.",},
        [2853] = {4301,"Cao Cao","Liu Bei","Jika mereka berdua bekerja sama, kita tidak bisa mengambil kembali.","Jika mereka berdua bekerja sama, kita tidak bisa mengambil kembali.",},
