        [2856] = {4301,"Liu Bei","Cao Cao","Baik, cepat bawa 50.000 pasukan pergi.","Baik, cepat bawa 50.000 pasukan pergi.",},
        [2857] = {4302,"Liu Bei","Guan Yu","Mengapa kamu mengemas senjata dan sadel pada tengah malam, dengan begini terburu-buru?","Mengapa kamu mengemas senjata dan sadel pada tengah malam, dengan begini terburu-buru?",},
        [2858] = {4302,"Guan Yu","Liu Bei","Aku bagaikan burung di kandang dan ikan di jaring. Pergi seperti ini akan membebaskanku dari belenggu, aku tidak lagi terikat!","Aku bagaikan burung di kandang dan ikan di jaring. Pergi seperti ini akan membebaskanku dari belenggu, aku tidak lagi terikat!",},
        [2859] = {4302,"Guan Yu","Liu Bei","Pastinya lebih cepat lebih baik!","Pastinya lebih cepat lebih baik!",},
        [2860] = {4303,"Cao Cao","Cheng Yu","Perdana Menteri mengapa membiarkan Liu Bei pergi dengan membawa 50.000 prajurit?","Perdana Menteri mengapa membiarkan Liu Bei pergi dengan membawa 50.000 prajurit?",},
        [2861] = {4303,"Cheng Yu","Cao Cao","Aku membiarkannya pergi ke Xuzhou untuk menghadang Yuan Shu.","Aku membiarkannya pergi ke Xuzhou untuk menghadang Yuan Shu.",},
        [2862] = {4303,"Cao Cao","Cheng Yu","Saat Liu Bei memerintah Yuzhou, kita memintamu untuk membunuhnya, tetapi kamu tidak mendengarkannya.","Saat Liu Bei memerintah Yuzhou, kita memintamu untuk membunuhnya, tetapi kamu tidak mendengarkannya.",},
        [2863] = {4303,"Cao Cao","Cheng Yu","Sekarang kamu memberinya prajurit lagi, sama seperti melepaskan macan kembali ke gunung. Bagaimana menekannya jika dia kembali?","Sekarang kamu memberinya prajurit lagi, sama seperti melepaskan macan kembali ke gunung. Bagaimana menekannya jika dia kembali?",},
        [2864] = {4303,"Cao Cao","Guo Jia","Meskipun Perdana Menteri tidak membunuh Liu Bei, tetapi juga tidak bisa membiarkannya pergi. Orang kuno berkata: Melepaskan musuh sehari, akan menjadi bencana selamanya. Semoga Perdana Menteri mempertimbangkannya dengan baik.","Meskipun Perdana Menteri tidak membunuh Liu Bei, tetapi juga tidak bisa membiarkannya pergi. Orang kuno berkata: Melepaskan musuh sehari, akan menjadi bencana selamanya. Semoga Perdana Menteri mempertimbangkannya dengan baik.",},
        [2865] = {4303,"Guo Jia","Cao Cao","Xu Chu, bawa beberapa prajurit maju, pastikan Xuande dapat dibawa kembali.","Xu Chu, bawa beberapa prajurit maju, pastikan Xuande dapat dibawa kembali.",},
        [2866] = {4303,"Cao Cao","Xu Chu","Baik, aku segera pergi.","Baik, aku segera pergi.",},
        [2867] = {4304,"Liu Bei","Guan Yu","Pasukan Cao mendekat!","Pasukan Cao mendekat!",},
        [2868] = {4304,"Guan Yu","Liu Bei","Jangan panik, kirimkan perintah pada para prajurit untuk bersiap.","Jangan panik, kirimkan perintah pada para prajurit untuk bersiap.",},
        [2869] = {4304,"Liu Bei","Xu Chu","Dimana Xuande?","Dimana Xuande?",},
        [2870] = {4304,"Xu Chu","Liu Bei","Bolehkah aku bertanya, apa yang terjadi, Jenderal Xu Chu?","Bolehkah aku bertanya, apa yang terjadi, Jenderal Xu Chu?",},
        [2871] = {4304,"Liu Bei","Xu Chu","Atas perintah Perdana Menteri, aku datang untuk meminta jenderal kembali, jika ada masalah bisa didiskusikan.","Atas perintah Perdana Menteri, aku datang untuk meminta jenderal kembali, jika ada masalah bisa didiskusikan.",},
        [2872] = {4304,"Xu Chu","Liu Bei","Komandan terbebas dari perintah raja saat di medan perang. Aku telah bertemu kaisar dan menerima perintah Perdana Menteri.","Komandan terbebas dari perintah raja saat di medan perang. Aku telah bertemu kaisar dan menerima perintah Perdana Menteri.",},
        [2873] = {4304,"Xu Chu","Liu Bei","Tidak perlu berkata lagi. Mohon kembali secepatnya untuk memberitahukan kepada Perdana Menteri.","Tidak perlu berkata lagi. Mohon kembali secepatnya untuk memberitahukan kepada Perdana Menteri.",},
        [2874] = {4304,"Liu Bei","Xu Chu","Kalau begitu jangan salahkan aku kalau tidak sopan.","Kalau begitu jangan salahkan aku kalau tidak sopan.",},
        [2875] = {4304,"Xu Chu","Protagonis","Biarkan aku bertarung dengannya, kemari!","Biarkan aku bertarung dengannya, kemari!",},
        [2876] = {4401,"Che Zhou","Liu Bei","Sekretariat Xuzhou, bagaimana keadaan Yuan Shu sekarang?","Sekretariat Xuzhou, bagaimana keadaan Yuan Shu sekarang?",},
        [2877] = {4401,"Liu Bei","Che Zhou","Yuan Shu sangat berlebihan, bawahannya Lei Bo dan Chen Lan telah bergabung di Gunung Songshan.","Yuan Shu sangat berlebihan, bawahannya Lei Bo dan Chen Lan telah bergabung di Gunung Songshan.",},
        [2878] = {4401,"Liu Bei","Che Zhou","Kekuatan Yuan Shu melemah, Yuan Shu telah menyerahkan gelar kaisar kepada Yuan Shao, mengemas prajurit dan hartanya, dia akan segera tiba di Xuzhou.","Kekuatan Yuan Shu melemah, Yuan Shu telah menyerahkan gelar kaisar kepada Yuan Shao, mengemas prajurit dan hartanya, dia akan segera tiba di Xuzhou.",},
        [2879] = {4401,"Che Zhou","Liu Bei","Datang pada waktu yang tepat, siapa yang bersedia pergi?","Datang pada waktu yang tepat, siapa yang bersedia pergi?",},
        [2880] = {4401,"Liu Bei","Protagonis","Aku bersedia pergi untuk membunuh Yuan Shu pengkhianat ini!","Aku bersedia pergi untuk membunuh Yuan Shu pengkhianat ini!",},
        [2881] = {4401,"Protagonis","Liu Bei","Baik, cepat bawa prajurit dan pergi.","Baik, cepat bawa prajurit dan pergi.",},
        [2882] = {4402,"Protagonis","Ji Ling","Siapa kalian? Beraninya menghentikan pasukan garis depan Yuan Shu.","Siapa kalian? Beraninya menghentikan pasukan garis depan Yuan Shu.",},
        [2883] = {4402,"Ji Ling","Protagonis","Jenderal Yangwei disini untuk memenggal kalian.","Jenderal Yangwei disini untuk memenggal kalian.",},
        [2884] = {4402,"Protagonis","Ji Ling","Jangan congkak!","Jangan congkak!",},
        [2885] = {4403,"Yuan Shu","Liu Bei","Kamu telah melakukan kejahatan besar, saat ini aku akan menghukummu atas nama kaisar! Prajurit baris depanmu Ji Ling telah dibunuh oleh kami.","Kamu telah melakukan kejahatan besar, saat ini aku akan menghukummu atas nama kaisar! Prajurit baris depanmu Ji Ling telah dibunuh oleh kami.",},
        [2886] = {4403,"Yuan Shu","Liu Bei","Serahkan dirimu.","Serahkan dirimu.",},
        [2887] = {4403,"Liu Bei","Yuan Shu","Perajut sandal, beraninya kamu memandang rendah diriku!","Perajut sandal, beraninya kamu memandang rendah diriku!",},
        [2888] = {4404,"","Yuan Shu","Dimana kokinya! Dimana kokinya!","Dimana kokinya! Dimana kokinya!",},
        [2889] = {4404,"Yuan Shu","Koki Pasukan","Ya Tuan, ada perintah apa?","Ya Tuan, ada perintah apa?",},
        [2890] = {4404,"Koki Pasukan","Yuan Shu","Nasi terlalu keras, susah untuk ditelan, cepat ambilkan air madu untuk melegakan dahagaku.","Nasi terlalu keras, susah untuk ditelan, cepat ambilkan air madu untuk melegakan dahagaku.",},
        [2891] = {4404,"Yuan Shu","Koki Pasukan","Kita diserang oleh bandit tidak lama setelah dikalahkan oleh Jenderal Yangwei dan Liu Bei. Kita telah cukup lama kehabisan ransum.","Kita diserang oleh bandit tidak lama setelah dikalahkan oleh Jenderal Yangwei dan Liu Bei. Kita telah cukup lama kehabisan ransum.",},
        [2892] = {4404,"Yuan Shu","Koki Pasukan","Di sini hanya ada air darah!","Di sini hanya ada air darah!",},
        [2893] = {4404,"Koki Pasukan","Yuan Shu","Sial!","Sial!",},
        [2894] = {4404,"Koki Pasukan","Yuan Shu","Aku adalah keturunan keluarga bangsawan, sekarang aku jatuh hingga seperti ini! Sial! (Lalu dia jatuh ke lantai, memuntahkan banyak darah dan mati.)","Aku adalah keturunan keluarga bangsawan, sekarang aku jatuh hingga seperti ini! Sial! (Lalu dia jatuh ke lantai, memuntahkan banyak darah dan mati.)",},
        [2895] = {4501,"Kaisar Xian Han","Cao Cao","Benar-benar dekrit sabuk! Ingin berkomplot menyingkirkanku?","Benar-benar dekrit sabuk! Ingin berkomplot menyingkirkanku?",},
        [2896] = {4501,"Kaisar Xian Han","Cao Cao","Seluruh keluarga pengkhianat Dong Cheng telah dibunuh, kamu istri Dong juga tidak bisa lari!","Seluruh keluarga pengkhianat Dong Cheng telah dibunuh, kamu istri Dong juga tidak bisa lari!",},
        [2897] = {4501,"Cao Cao","Kaisar Xian Han","Aku tidak tahu tentang dekrit sabuk ini, semua adalah perbuatan Dong Cheng seorang, tidak ada hubungannya denganku!","Aku tidak tahu tentang dekrit sabuk ini, semua adalah perbuatan Dong Cheng seorang, tidak ada hubungannya denganku!",},
        [2898] = {4501,"Kaisar Xian Han","Cao Cao","Aku berharap kamu tidak tahu!","Aku berharap kamu tidak tahu!",},
        [2899] = {4502,"Che Zhou","Cao Cao","Liu Bei telah membunuh Ji Ling dan mengalahkan Yuan Shu. Dia memerintahkan Zhu Ling dan Lu Zhao untuk kembali ke Xuchang. Sepertinya, prajuritnya berjaga di Xuzhou, tetapi dia telah lama berencana untuk memberontak.","Liu Bei telah membunuh Ji Ling dan mengalahkan Yuan Shu. Dia memerintahkan Zhu Ling dan Lu Zhao untuk kembali ke Xuchang. Sepertinya, prajuritnya berjaga di Xuzhou, tetapi dia telah lama berencana untuk memberontak.",},
        [2900] = {4502,"Che Zhou","Cao Cao","Kamu sebagai Sekretariat Xuzhou, seharusnya memikirkan cara untuk membunuhnya.","Kamu sebagai Sekretariat Xuzhou, seharusnya memikirkan cara untuk membunuhnya.",},
        [2901] = {4502,"Cao Cao","Che Zhou","Ya, Tuanku.","Ya, Tuanku.",},
        [2902] = {4503,"Chen Deng","Che Zhou","Yuanlong, Liu Bei memiliki rencana untuk memberontak.","Yuanlong, Liu Bei memiliki rencana untuk memberontak.",},
        [2903] = {4503,"Chen Deng","Che Zhou","Perdana Menteri Cao menginginkanku untuk membunuh Liu Bei secara rahasia, apakah kamu memiliki rencana?","Perdana Menteri Cao menginginkanku untuk membunuh Liu Bei secara rahasia, apakah kamu memiliki rencana?",},
        [2904] = {4503,"Che Zhou","Chen Deng","Hal ini sangat mudah. Sekarang Liu Bei keluar kota untuk menenangkan rakyat, akan kembali dalam beberapa hari.","Hal ini sangat mudah. Sekarang Liu Bei keluar kota untuk menenangkan rakyat, akan kembali dalam beberapa hari.",},
        [2905] = {4503,"Che Zhou","Chen Deng","Kamu bisa memerintahkan sersan untuk bersembunyi di tepi desa barbar. Begitu dia tiba, orang-orangmu menyerang dan memotong kepalanya dalam satu serangan.","Kamu bisa memerintahkan sersan untuk bersembunyi di tepi desa barbar. Begitu dia tiba, orang-orangmu menyerang dan memotong kepalanya dalam satu serangan.",},
        [2906] = {4503,"Che Zhou","Chen Deng","Aku akan memimpin pasukan pemanah di tembok kota untuk menembak dan menghadang pasukan mereka. Kita pasti berhasil!","Aku akan memimpin pasukan pemanah di tembok kota untuk menembak dan menghadang pasukan mereka. Kita pasti berhasil!",},
        [2907] = {4503,"Chen Deng","Che Zhou","Kita bergerak sesuai rencanamu, Yuanlong.","Kita bergerak sesuai rencanamu, Yuanlong.",},
        [2908] = {4504,"Guan Yu","Chen Deng","Kakak Yunchang, Cao Cao memerintahkan Che Zhou untuk membunuh Tuanmu Liu Bei.","Kakak Yunchang, Cao Cao memerintahkan Che Zhou untuk membunuh Tuanmu Liu Bei.",},
        [2909] = {4504,"Guan Yu","Chen Deng","Saat Xuande kembali dari menenangkan rakyat, dia akan diserang di tepi desa barbar untuk membunuhnya.","Saat Xuande kembali dari menenangkan rakyat, dia akan diserang di tepi desa barbar untuk membunuhnya.",},
        [2910] = {4504,"Chen Deng","Guan Yu","Kalau begitu lawan kembali rencana ini, aku akan berpura-pura menjadi pasukan Cao Cao pada malam hari, sebelum Liu Bei tiba di Xuzhou, menarik Che Zhou keluar kota, lalu menyergap dan membunuhnya.","Kalau begitu lawan kembali rencana ini, aku akan berpura-pura menjadi pasukan Cao Cao pada malam hari, sebelum Liu Bei tiba di Xuzhou, menarik Che Zhou keluar kota, lalu menyergap dan membunuhnya.",},
        [2911] = {4504,"Guan Yu","Chen Deng","Baik, Jika Che Zhou keluar kota, aku akan menembakkan banyak panah di tembok kota.","Baik, Jika Che Zhou keluar kota, aku akan menembakkan banyak panah di tembok kota.",},
        [2912] = {4505,"Liu Bei","Guan Yu","Chen Deng memberitahuku tentang pembunuhan rahasia Che Zhou padamu di bawah perintah Cao Cao.","Chen Deng memberitahuku tentang pembunuhan rahasia Che Zhou padamu di bawah perintah Cao Cao.",},
        [2913] = {4505,"Liu Bei","Guan Yu","Aku dan Chen Deng berhasil melakukan rencana balasan untuk membunuhnya!","Aku dan Chen Deng berhasil melakukan rencana balasan untuk membunuhnya!",},
        [2914] = {4505,"Guan Yu","Liu Bei","Bagaimana jika Cao Cao datang?","Bagaimana jika Cao Cao datang?",},
        [2915] = {4505,"Liu Bei","Guan Yu","Zhang Fei dan aku yang akan melawannya.","Zhang Fei dan aku yang akan melawannya.",},
        [2916] = {4505,"Guan Yu","Liu Bei","Aku telah membunuh orang kepercayaan Cao cao, mana mungkin dia akan melepaskanku?","Aku telah membunuh orang kepercayaan Cao cao, mana mungkin dia akan melepaskanku?",},
        [2917] = {4505,"Liu Bei","Chen Deng","Jangan khawatir Xuande, pergilah ke Xuzhou, aku memiliki sebuah rencana, dapat membantumu mengusir Cao Cao.","Jangan khawatir Xuande, pergilah ke Xuzhou, aku memiliki sebuah rencana, dapat membantumu mengusir Cao Cao.",},
        [2918] = {4601,"Liu Bei","Chen Deng","Yuan Shao menduduki banyak prefektur seperi Ji, Qing, You dan lainnya, memiliki jutaan prajurit dan petugas sipil yang banyak. Cao Cao masih takut padanya.","Yuan Shao menduduki banyak prefektur seperi Ji, Qing, You dan lainnya, memiliki jutaan prajurit dan petugas sipil yang banyak. Cao Cao masih takut padanya.",},
        [2919] = {4601,"Liu Bei","Chen Deng","Mengapa kamu tidak mengirimkan seseorang untuk meminta bantuannya?","Mengapa kamu tidak mengirimkan seseorang untuk meminta bantuannya?",},
        [2920] = {4601,"Chen Deng","Liu Bei","Yuan Shao tidak pernah berhubungan denganku, hari ini kita telah membunuh adiknya, bagaimana dia akan membantuku?","Yuan Shao tidak pernah berhubungan denganku, hari ini kita telah membunuh adiknya, bagaimana dia akan membantuku?",},
        [2921] = {4601,"Liu Bei","Chen Deng","Disini ada orang yang berhubungan baik dengan keluarga Yuan Shao selama tiga generasi, jika bisa memintanya untuk mengirimkan surat kepada Yuan Shao, dia pasti akan membantu.","Disini ada orang yang berhubungan baik dengan keluarga Yuan Shao selama tiga generasi, jika bisa memintanya untuk mengirimkan surat kepada Yuan Shao, dia pasti akan membantu.",},
        [2922] = {4601,"Chen Deng","Liu Bei","Siapa?","Siapa?",},
        [2923] = {4601,"Liu Bei","Chen Deng","Orang ini adalah yang membuatmu tunduk. Apakah kamu sudah lupa?","Orang ini adalah yang membuatmu tunduk. Apakah kamu sudah lupa?",},
        [2924] = {4601,"Chen Deng","Liu Bei","Apakah yang dimaksud adalah Zheng Kangcheng?","Apakah yang dimaksud adalah Zheng Kangcheng?",},
        [2925] = {4601,"Liu Bei","Chen Deng","Betul.","Betul.",},
        [2926] = {4602,"","Yuan Shao","Menteri Zheng mengirimkan surat padaku, memintaku untuk mengirimkan prajurit dan membantu Liu Bei menyerang Cao Cao. Apakah aku mengirimkan prajurit? Atau tidak?","Menteri Zheng mengirimkan surat padaku, memintaku untuk mengirimkan prajurit dan membantu Liu Bei menyerang Cao Cao. Apakah aku mengirimkan prajurit? Atau tidak?",},
        [2927] = {4602,"Yuan Shao","Ju Shou","Di bawah kehendak mayoritas, kamu memimpin pasukan melawan yang tidak berkuasa dan lemah; Kamu menghukum para pemberontak Han untuk memantapkan posisi keluargamu. Ini adalah hal yang tepat.","Di bawah kehendak mayoritas, kamu memimpin pasukan melawan yang tidak berkuasa dan lemah; Kamu menghukum para pemberontak Han untuk memantapkan posisi keluargamu. Ini adalah hal yang tepat.",},
        [2928] = {4602,"Ju Shou","Yuan Shao","Aku juga berpikir seperti itu.","Aku juga berpikir seperti itu.",},
        [2929] = {4602,"Ju Shou","Yuan Shao","Tian Feng, Xun Chen dan Xu You akan menjadi penasihat; Yan Liang dan Wen Chou akan menjadi jenderal, memimpin 300.000 pasukan untuk maju ke Liyang.","Tian Feng, Xun Chen dan Xu You akan menjadi penasihat; Yan Liang dan Wen Chou akan menjadi jenderal, memimpin 300.000 pasukan untuk maju ke Liyang.",},
        [2930] = {4602,"Ju Shou","Yuan Shao","Perintahkan sekretaris Chen Lin untuk menuliskan panggilan perang resmi melawan Cao Cao dan beritahukan pada semua orang menngenai kejahatannya.","Perintahkan sekretaris Chen Lin untuk menuliskan panggilan perang resmi melawan Cao Cao dan beritahukan pada semua orang menngenai kejahatannya.",},
        [2931] = {4603,"Cao Cao","Kong Rong","Cao Cao, panggilan perang yang menuliskan kejahatanmu telah tersebar di seluruh Xuchang.","Cao Cao, panggilan perang yang menuliskan kejahatanmu telah tersebar di seluruh Xuchang.",},
        [2932] = {4603,"Kong Rong","Cao Cao","Aku sudah tahu. Awalnya terkena sakit kepala, saat aku melihat panggilan perang, tiba-tiba badanku berkeringat dingin, rasanya seperti sembuh dari sakit kepalaku!","Aku sudah tahu. Awalnya terkena sakit kepala, saat aku melihat panggilan perang, tiba-tiba badanku berkeringat dingin, rasanya seperti sembuh dari sakit kepalaku!",},
        [2933] = {4603,"Cao Cao","Kong Rong","Baiklah kalau sakit kepalamu sudah sembuh, tetapi Yuan Shao memiliki kekuatan yang besar, kita tidak bisa melawannya, hanya bisa berdamai.","Baiklah kalau sakit kepalamu sudah sembuh, tetapi Yuan Shao memiliki kekuatan yang besar, kita tidak bisa melawannya, hanya bisa berdamai.",},
        [2934] = {4603,"Kong Rong","Xun Yu","Yuan Shao orang tidak berguna, mengapa harus berdamai dengannya?","Yuan Shao orang tidak berguna, mengapa harus berdamai dengannya?",},
        [2935] = {4603,"Xun Yu","Kong Rong","Yuan Shao memiliki banyak harta dan orang bertalenta. Bawahannya seperti Xu You, Guo Tu, Shen Pei dan Feng Ji semuanya adalah orang pintar.","Yuan Shao memiliki banyak harta dan orang bertalenta. Bawahannya seperti Xu You, Guo Tu, Shen Pei dan Feng Ji semuanya adalah orang pintar.",},
        [2936] = {4603,"Xun Yu","Kong Rong","Tian Feng dan Ju Shou adalah menteri yang setia, Yan Liang dan Wen Chou memiliki keberanian tiada tara, dan masih ada Hero Terkenal lainnya seperti Gao Lan, Zhang He dan Chunyu Qiong.","Tian Feng dan Ju Shou adalah menteri yang setia, Yan Liang dan Wen Chou memiliki keberanian tiada tara, dan masih ada Hero Terkenal lainnya seperti Gao Lan, Zhang He dan Chunyu Qiong.",},
        [2937] = {4603,"Xun Yu","Kong Rong","Bagaimana bisa mengatakan bahwa Yuan Shao adalah orang yang tidak berguna?","Bagaimana bisa mengatakan bahwa Yuan Shao adalah orang yang tidak berguna?",},
        [2938] = {4603,"Kong Rong","Xun Yu","Pasukan Shao meskipun banyak tetapi tidak disiplin. Karakter Tian Feng sangat angkuh, Xu You serakah dan tidak bijaksana, Shen Pei sombong dan tidak berpengetahuan, Feng Ji tegas tetapi tidak berguna.","Pasukan Shao meskipun banyak tetapi tidak disiplin. Karakter Tian Feng sangat angkuh, Xu You serakah dan tidak bijaksana, Shen Pei sombong dan tidak berpengetahuan, Feng Ji tegas tetapi tidak berguna.",},
        [2939] = {4603,"Kong Rong","Xun Yu","Orang-orang ini tidak cocok satu sama lain dan akan muncul masalah internal. Yan Liang dan Wen Chou lebih sering menggunakan otot daripada otak, mereka dapat ditangkap hanya dalam satu pertempuran.","Orang-orang ini tidak cocok satu sama lain dan akan muncul masalah internal. Yan Liang dan Wen Chou lebih sering menggunakan otot daripada otak, mereka dapat ditangkap hanya dalam satu pertempuran.",},
        [2940] = {4603,"Kong Rong","Xun Yu","Dan sisanya, hanyalah orang yang biasa. Meskipun memiliki jutaan, juga tidak layak untuk diungkit!","Dan sisanya, hanyalah orang yang biasa. Meskipun memiliki jutaan, juga tidak layak untuk diungkit!",},
        [2941] = {4603,"Xun Yu","Cao Cao","Semuanya sesuai perkiraanmu, Wenruo.","Semuanya sesuai perkiraanmu, Wenruo.",},
        [2942] = {4603,"Xun Yu","Cao Cao","Perintahkan Liu Dai dan prajurit susulan yang dipimpin oleh Wang Zhong untuk membawa 50.000 prajurit di bawah benderaku, dan pergi menyerang Liu Bei di Xuzhou.","Perintahkan Liu Dai dan prajurit susulan yang dipimpin oleh Wang Zhong untuk membawa 50.000 prajurit di bawah benderaku, dan pergi menyerang Liu Bei di Xuzhou.",},
        [2943] = {4604,"Chen Deng","Liu Bei","Meskipun Yuan Benchu menempatkan prajuritnya di Liyang, dia belum membuat kemajuan karena hubungannya dengan penasihat yang tegang.","Meskipun Yuan Benchu menempatkan prajuritnya di Liyang, dia belum membuat kemajuan karena hubungannya dengan penasihat yang tegang.",},
        [2944] = {4604,"Chen Deng","Liu Bei","Cao Cao tidak ditemukan dimanapun. Aku mendengar bahwa tentara di Liyang tidak membawa bendera Cao Cao, mengapa disini malah ada benderanya?","Cao Cao tidak ditemukan dimanapun. Aku mendengar bahwa tentara di Liyang tidak membawa bendera Cao Cao, mengapa disini malah ada benderanya?",},
        [2945] = {4604,"Liu Bei","Chen Deng","Siasat Cao Cao sangat banyak, dia pasti sedang memusatkan di Hebei dan mengawasinya sendiri, tetapi secara sengaja tidak menancapkan bendera, melainkan menancapkan bendera di tempat palsu ini, namun sebenarnya Cao Cao tidak disini.","Siasat Cao Cao sangat banyak, dia pasti sedang memusatkan di Hebei dan mengawasinya sendiri, tetapi secara sengaja tidak menancapkan bendera, melainkan menancapkan bendera di tempat palsu ini, namun sebenarnya Cao Cao tidak disini.",},
        [2946] = {4604,"Chen Deng","Liu Bei","Siapa yang bisa pergi mencari informasi?","Siapa yang bisa pergi mencari informasi?",},
        [2947] = {4604,"Liu Bei","Guan Yu","Adik akan pergi.","Adik akan pergi.",},
        [2948] = {4604,"Liu Bei","Protagonis","Aku bersedia membantu Yunchang dan pergi dengannya.","Aku bersedia membantu Yunchang dan pergi dengannya.",},
        [2949] = {4605,"Guan Yu","Wang Zhong","Perdana Menteri sudah disini, mengapa kalian tidak menyerah?","Perdana Menteri sudah disini, mengapa kalian tidak menyerah?",},
        [2950] = {4605,"Wang Zhong","Guan Yu","Biarkan Perdana Menteri keluar, aku ingin berbicara dengannya.","Biarkan Perdana Menteri keluar, aku ingin berbicara dengannya.",},
        [2951] = {4605,"Guan Yu","Wang Zhong","Perdana Menteri mana mungkin bersedia untuk bertemu denganmu!","Perdana Menteri mana mungkin bersedia untuk bertemu denganmu!",},
        [2952] = {4605,"Wang Zhong","Guan Yu","Dia tidak ada disini. Menurutmu seberapa bodohnya aku?","Dia tidak ada disini. Menurutmu seberapa bodohnya aku?",},
        [2953] = {4605,"Wang Zhong","Protagonis","Tunggu hingga aku menangkapmu!","Tunggu hingga aku menangkapmu!",},
        [2954] = {4606,"Liu Bei","Protagonis","Wang Zhong telah ditangkap hidup-hidup!","Wang Zhong telah ditangkap hidup-hidup!",},
        [2955] = {4606,"Protagonis","Liu Bei","Bagus! Sangat bagus!","Bagus! Sangat bagus!",},
        [2956] = {4606,"Liu Bei","Zhang Fei","Kakak kedua telah menangkap Wang Zhong, biarkan aku menangkap Liu Dai!","Kakak kedua telah menangkap Wang Zhong, biarkan aku menangkap Liu Dai!",},
        [2957] = {4606,"Zhang Fei","Liu Bei","Liu Dai dulunya adalah Sekretariat Yanzhou, Saat menyerang Dong Zhuo di Gerbang Hulao, dia juga merupakan salah satu dari pangeran. Saat ini dia memimpin baris depan, tidak bisa diremehkan.","Liu Dai dulunya adalah Sekretariat Yanzhou, Saat menyerang Dong Zhuo di Gerbang Hulao, dia juga merupakan salah satu dari pangeran. Saat ini dia memimpin baris depan, tidak bisa diremehkan.",},
        [2958] = {4606,"Liu Bei","Zhang Fei","Sepertinya orang ini tidak memiliki kemampuan! Aku akan menangkapnya seperti yang dilakukan kakak kedua dan Jenderal Yangwei.","Sepertinya orang ini tidak memiliki kemampuan! Aku akan menangkapnya seperti yang dilakukan kakak kedua dan Jenderal Yangwei.",},
        [2959] = {4606,"Zhang Fei","Liu Bei","Yang kutakutkan adalah kamu akan membunuhnya, dan membuat urusan kami terhalang!","Yang kutakutkan adalah kamu akan membunuhnya, dan membuat urusan kami terhalang!",},
        [2960] = {4606,"Liu Bei","Protagonis","Jangan takut, aku akan pergi dengan Zhang Fei.","Jangan takut, aku akan pergi dengan Zhang Fei.",},
        [2961] = {4606,"Protagonis","Liu Bei","Jika Jenderal Yangwei pergi, aku akan merasa tenang.","Jika Jenderal Yangwei pergi, aku akan merasa tenang.",},
        [2962] = {4607,"","Zhang Fei","Liu Dai lemah, dia tertangkap hidup-hidup olehku!","Liu Dai lemah, dia tertangkap hidup-hidup olehku!",},
        [2963] = {4607,"","Zhang Fei","Ahahahaha.","Ahahahaha.",},
        [2964] = {4608,"Liu Bei","Zhang Fei","Kakak, aku membawa kembali Wang Zhong dan Liu Dai untukmu!","Kakak, aku membawa kembali Wang Zhong dan Liu Dai untukmu!",},
        [2965] = {4608,"Liu Bei","Liu Dai","Humph! Terserah kalian ingin melakukan apa terhadapku!","Humph! Terserah kalian ingin melakukan apa terhadapku!",},
        [2966] = {4608,"Liu Dai","Liu Bei","Maaf jika telah salah menangkap kalian, biarkan aku melepas ikatannya!","Maaf jika telah salah menangkap kalian, biarkan aku melepas ikatannya!",},
        [2967] = {4608,"Liu Dai","Liu Bei","Che Zhou menginginkanku mati, aku tidak ada pilihan lagi selain membunuhnya. Perdana Menteri mencurigaiku atas pemberontakan, jadi dia mengirimkan kalian berdua untuk menghukumku.","Che Zhou menginginkanku mati, aku tidak ada pilihan lagi selain membunuhnya. Perdana Menteri mencurigaiku atas pemberontakan, jadi dia mengirimkan kalian berdua untuk menghukumku.",},
        [2968] = {4608,"Liu Dai","Liu Bei","Perdana Menteri adalah donaturku, aku tidak ingin apa-apa selain membalasnya kebaikannya. Bagaimana aku bisa melawannya? Ketika kalian kembali ke Xuchang, berikan penjelasan padanya untukku. Aku akan sangat berterima kasih.","Perdana Menteri adalah donaturku, aku tidak ingin apa-apa selain membalasnya kebaikannya. Bagaimana aku bisa melawannya? Ketika kalian kembali ke Xuchang, berikan penjelasan padanya untukku. Aku akan sangat berterima kasih.",},
        [2969] = {4608,"Liu Bei","Wang Zhong","Terima kasih telah membiarkanku hidup.","Terima kasih telah membiarkanku hidup.",},
        [2970] = {4608,"Liu Bei","Liu Dai","Terima kasih telah membiarkanku hidup. Aku akan berjanji untuk setia dengan Perdana Menteri, meskipun itu akan mengorbankan keluargaku.","Terima kasih telah membiarkanku hidup. Aku akan berjanji untuk setia dengan Perdana Menteri, meskipun itu akan mengorbankan keluargaku.",},
        [2971] = {4608,"Liu Dai","Liu Bei","Akan kusiapkan kuda untukmu. Kembalikan pasukan mereka.","Akan kusiapkan kuda untukmu. Kembalikan pasukan mereka.",},
        [2972] = {4609,"Liu Dai","Zhang Fei","Berhenti!","Berhenti!",},
        [2973] = {4609,"Liu Dai","Zhang Fei","Kakakku terlalu bodoh! Kamu tidak bisa kabur, bandit!","Kakakku terlalu bodoh! Kamu tidak bisa kabur, bandit!",},
        [2974] = {4609,"Zhang Fei","Liu Dai","Kamu, kamu, apa yang kamu inginkan?","Kamu, kamu, apa yang kamu inginkan?",},
        [2975] = {4609,"Zhang Fei","Guan Yu","Jangan berbuat tidak sopan!","Jangan berbuat tidak sopan!",},
        [2976] = {4609,"Zhang Fei","Guan Yu","Karena kakak telah melepaskan mereka, mengapa kamu sekarang menentangnya?","Karena kakak telah melepaskan mereka, mengapa kamu sekarang menentangnya?",},
        [2977] = {4609,"Guan Yu","Zhang Fei","Jika kakak melepaskan mereka, berikutnya akan datang lagi.","Jika kakak melepaskan mereka, berikutnya akan datang lagi.",},
        [2978] = {4609,"Zhang Fei","Guan Yu","Tunggu saat mereka datang lagi lalu bunuh mereka, itu juga belum terlambat.","Tunggu saat mereka datang lagi lalu bunuh mereka, itu juga belum terlambat.",},
        [2979] = {4609,"Zhang Fei","Wang Zhong","Meskipun Perdana Menteri memerintahkan eksekusi seluruh keluargaku, aku tidak akan menyerangmu lagi. Semoga jenderal mengampuniku.","Meskipun Perdana Menteri memerintahkan eksekusi seluruh keluargaku, aku tidak akan menyerangmu lagi. Semoga jenderal mengampuniku.",},
        [2980] = {4609,"Wang Zhong","Zhang Fei","Akan kubersihkan mereka semua meskipun Cao Cao datang sendiri! Anggap aku mengampunimu kali ini.","Akan kubersihkan mereka semua meskipun Cao Cao datang sendiri! Anggap aku mengampunimu kali ini.",},
        [2981] = {4609,"Wang Zhong","Liu Dai","Wang Zhong, kita pergi, takutnya orang Yan ini berubah pikiran.","Wang Zhong, kita pergi, takutnya orang Yan ini berubah pikiran.",},
        [2982] = {4610,"","Cao Cao","Wang Zhong, Liu Dai, kalian dua orang bodoh, beraninya kembali! Penggal mereka.","Wang Zhong, Liu Dai, kalian dua orang bodoh, beraninya kembali! Penggal mereka.",},
        [2983] = {4610,"Cao Cao","Liu Dai","Ampun, Perdana Menteri!","Ampun, Perdana Menteri!",},
        [2984] = {4610,"Cao Cao","Wang Zhong","Ampun, Perdana Menteri!","Ampun, Perdana Menteri!",},
        [2985] = {4610,"Cao Cao","Kong Rong","Dua orang ini bukanlah lawan Liu Bei. Jika membunuh mereka, mungkin akan kehilangan dukungan dari prajurit.","Dua orang ini bukanlah lawan Liu Bei. Jika membunuh mereka, mungkin akan kehilangan dukungan dari prajurit.",},
        [2986] = {4610,"Kong Rong","Cao Cao","Mereka boleh tetap hidup, tetapi harus menderita!","Mereka boleh tetap hidup, tetapi harus menderita!",},
        [2987] = {4610,"Kong Rong","Cao Cao","Lepaskan jabatan dan gaji mereka, bawa mereka keluar dari sini!","Lepaskan jabatan dan gaji mereka, bawa mereka keluar dari sini!",},
        [2988] = {4610,"Cao Cao","Liu Dai","Terima kasih, Kong Rong, untuk persuasimu; Dan terima kasih Perdana Menteri, karena melepaskan kami!","Terima kasih, Kong Rong, untuk persuasimu; Dan terima kasih Perdana Menteri, karena melepaskan kami!",},
        [2989] = {4610,"Cao Cao","Wang Zhong","Terima kasih, Perdana Menteri, telah mengampuni kami!","Terima kasih, Perdana Menteri, telah mengampuni kami!",},
        [2990] = {4701,"Protagonis","Liu Bei","Sebelumnya, Cao Cao memerintahkan kematian Dong Cheng, Wang Zifu, Zhong Ji, Wu Shuo dan lainnya untuk dekrit sabuk.","Sebelumnya, Cao Cao memerintahkan kematian Dong Cheng, Wang Zifu, Zhong Ji, Wu Shuo dan lainnya untuk dekrit sabuk.",},
        [2991] = {4701,"Protagonis","Liu Bei","Bahkan Istri Dong yang sedang hamil lima bulan tidak dilepaskan.","Bahkan Istri Dong yang sedang hamil lima bulan tidak dilepaskan.",},
        [2992] = {4701,"Protagonis","Liu Bei","Aku juga berkaitan dengan dekrit sabuk, Cao Cao mungkin akan mengirimkan prajurit untuk melawanku lagi.","Aku juga berkaitan dengan dekrit sabuk, Cao Cao mungkin akan mengirimkan prajurit untuk melawanku lagi.",},
        [2993] = {4701,"Liu Bei","Protagonis","Jangan khawatir, aku akan segera pergi ke Yizhou dan meminta bantuan Yuan Shao.","Jangan khawatir, aku akan segera pergi ke Yizhou dan meminta bantuan Yuan Shao.",},
        [2994] = {4702,"Yuan Shao","Protagonis","Mengapa kamu terlihat lemas dan kacau, Benchu?","Mengapa kamu terlihat lemas dan kacau, Benchu?",},
        [2995] = {4702,"Protagonis","Yuan Shao","Tak lama lagi aku akan mati!","Tak lama lagi aku akan mati!",},
        [2996] = {4702,"Yuan Shao","Protagonis","Mengapa berkata begini, Tuanku?","Mengapa berkata begini, Tuanku?",},
        [2997] = {4702,"Protagonis","Yuan Shao","Aku memiliki lima putra, putra bungsu adalah putra yang paling membuatku senang; Saat ini dia berpenyakit kudis, hidupnya dalam bahaya. Bagaimana mungkin aku masih bisa memikirkan hal lain?","Aku memiliki lima putra, putra bungsu adalah putra yang paling membuatku senang; Saat ini dia berpenyakit kudis, hidupnya dalam bahaya. Bagaimana mungkin aku masih bisa memikirkan hal lain?",},
        [2998] = {4702,"Yuan Shao","Protagonis","Cao Cao sekarang maju melawan Liu Xuande di timur, Xuchang tidak terjaga, jika menggunakan prajurit keadilan memasukinya, kamu bisa melindungi kaisar dan menyelamatkan rakyat.","Cao Cao sekarang maju melawan Liu Xuande di timur, Xuchang tidak terjaga, jika menggunakan prajurit keadilan memasukinya, kamu bisa melindungi kaisar dan menyelamatkan rakyat.",},
        [2999] = {4702,"Yuan Shao","Protagonis","Ini adalah kesempatan langka, semoga kamu mempertimbangkannya dengan baik.","Ini adalah kesempatan langka, semoga kamu mempertimbangkannya dengan baik.",},
        [3000] = {4702,"Protagonis","Yuan Shao","Tetapi hatiku masih mengkhawatirkan anakku, ini mungkin akan mempengaruhi keputusanku.","Tetapi hatiku masih mengkhawatirkan anakku, ini mungkin akan mempengaruhi keputusanku.",},
        [3001] = {4702,"Yuan Shao","Protagonis","Perkara negara adalah hal yang terpenting!","Perkara negara adalah hal yang terpenting!",},
        [3002] = {4703,"Liu Bei","Protagonis","Meskipun awalnya tidak berjalan baik, tetapi pada akhirnya dia bersedia untuk membantu.","Meskipun awalnya tidak berjalan baik, tetapi pada akhirnya dia bersedia untuk membantu.",},
        [3003] = {4703,"Liu Bei","Protagonis","Cao Cao mengirimkan prajurit untuk menyerang kami di timur, Yuan Shao akan menggunakan kesempatan ini untuk menyelinap dan menyerang Xuchang, membuat Cao Cao mundur ke Xuchang. Ini adalah strategi Kepung Wei untuk menyelamatkan Zhao.","Cao Cao mengirimkan prajurit untuk menyerang kami di timur, Yuan Shao akan menggunakan kesempatan ini untuk menyelinap dan menyerang Xuchang, membuat Cao Cao mundur ke Xuchang. Ini adalah strategi Kepung Wei untuk menyelamatkan Zhao.",},
        [3004] = {4703,"Liu Bei","Protagonis","Yuan Shao juga berkata, jika tidak sesuai harapan lagi, maka kamu bisa bergabung dengannya.","Yuan Shao juga berkata, jika tidak sesuai harapan lagi, maka kamu bisa bergabung dengannya.",},
        [3005] = {4703,"Protagonis","Liu Bei","Baik.","Baik.",},
        [3006] = {4801,"Jia Xu","Zhang Xiu","Yuan Shao lebih kuat daripada Cao Cao; Sekarang kamu telah merobek suratnya dan mencaci utusannya, kita harus berbuat apa jika Yuan Shao menyerang?","Yuan Shao lebih kuat daripada Cao Cao; Sekarang kamu telah merobek suratnya dan mencaci utusannya, kita harus berbuat apa jika Yuan Shao menyerang?",},
        [3007] = {4801,"Zhang Xiu","Jia Xu","Sebaiknya bergabung dengan Cao Cao.","Sebaiknya bergabung dengan Cao Cao.",},
        [3008] = {4801,"Jia Xu","Zhang Xiu","Aku dulu bermusuhan dengan Cao Cao, bagaimana dia bisa menerimaku?","Aku dulu bermusuhan dengan Cao Cao, bagaimana dia bisa menerimaku?",},
        [3009] = {4801,"Zhang Xiu","Jia Xu","Ada tiga keuntungan jika bergabung dengan Cao Cao: Pertama, Cao Cao mengendalikan kaisar dan mengirimkan ekspedisi hukuman dimana-mana atas nama Kaisar;","Ada tiga keuntungan jika bergabung dengan Cao Cao: Pertama, Cao Cao mengendalikan kaisar dan mengirimkan ekspedisi hukuman dimana-mana atas nama Kaisar;",},
        [3010] = {4801,"Zhang Xiu","Jia Xu","Kedua, Yuan Shao sangat kuat, orang kita sedikit untuk bergabung dengannya, dia pasti meremehkan kita. Meskipun kekuatan Cao Cao lebih lemah, jika kita bergabung dengannya, dia pasti senang.","Kedua, Yuan Shao sangat kuat, orang kita sedikit untuk bergabung dengannya, dia pasti meremehkan kita. Meskipun kekuatan Cao Cao lebih lemah, jika kita bergabung dengannya, dia pasti senang.",},
        [3011] = {4801,"Zhang Xiu","Jia Xu","Terakhir, Cao Cao memiliki ambisi untuk mendominasi seluruh negara, dia pasti akan melupakan yang telah berlalu dan menunjukkan pengampunannya. Semoga jenderal percaya padaku.","Terakhir, Cao Cao memiliki ambisi untuk mendominasi seluruh negara, dia pasti akan melupakan yang telah berlalu dan menunjukkan pengampunannya. Semoga jenderal percaya padaku.",},
        [3012] = {4802,"Cao Cao","Zhang Xiu","Kedatanganku dan Jia Xu ke Xuchang kali ini untuk menyerah padamu, Cao Cao.","Kedatanganku dan Jia Xu ke Xuchang kali ini untuk menyerah padamu, Cao Cao.",},
        [3013] = {4802,"Cao Cao","Jia Xu","Semoga Perdana Menteri memaafkan yang telah berlalu.","Semoga Perdana Menteri memaafkan yang telah berlalu.",},
        [3014] = {4802,"Jia Xu","Cao Cao","Itu hanya kesalahan kecil, jangan dimasukkan hati.","Itu hanya kesalahan kecil, jangan dimasukkan hati.",},
        [3015] = {4802,"Jia Xu","Cao Cao","Mulai sekarang, Zhang Xiu adalah Jenderal Yangwu, Jia Xu adalah Penjaga ibu kota.","Mulai sekarang, Zhang Xiu adalah Jenderal Yangwu, Jia Xu adalah Penjaga ibu kota.",},
        [3016] = {4901,"Liu Bei","Sun Qian","Yuan Shao bertarung dengan Cao Cao, tidak bisa mengirimkan prajurit untuk menyelamatkan Peixian.","Yuan Shao bertarung dengan Cao Cao, tidak bisa mengirimkan prajurit untuk menyelamatkan Peixian.",},
        [3017] = {4901,"Sun Qian","Liu Bei","Apa yang harus kita lakukan?","Apa yang harus kita lakukan?",},
        [3018] = {4901,"Liu Bei","Zhang Fei","Jangan khawatir, kakak. Pasukan Cao datang dari tempat jauh, pasti akan merasa kelelahan; Kita harus gunakan kesempatan ini dan serang saat mereka baru tiba, dengan begitu kita bisa mengalahkan Cao Cao.","Jangan khawatir, kakak. Pasukan Cao datang dari tempat jauh, pasti akan merasa kelelahan; Kita harus gunakan kesempatan ini dan serang saat mereka baru tiba, dengan begitu kita bisa mengalahkan Cao Cao.",},
        [3019] = {4901,"Zhang Fei","Liu Bei","Aku selalu mengira kamu adalah orang yang gagah berani. Sebelumnya saat menangkap Liu Dai dulu, kamu ahli dalam merancang siasat; Sekarang juga memberikan siasat lagi, sepertinya kamu memahami strategi berperang.","Aku selalu mengira kamu adalah orang yang gagah berani. Sebelumnya saat menangkap Liu Dai dulu, kamu ahli dalam merancang siasat; Sekarang juga memberikan siasat lagi, sepertinya kamu memahami strategi berperang.",},
        [3020] = {4902,"Cao Cao","Xun Yu","Dari mana datangnya angin? Meniup jatuh bendera warna apa? (Angin besar bertiup dan merusak sebuah bendera.)","Dari mana datangnya angin? Meniup jatuh bendera warna apa? (Angin besar bertiup dan merusak sebuah bendera.)",},
        [3021] = {4902,"Xun Yu","Cao Cao","Angin datang dari tenggara, menghancurkan ujung bendera, bendera berwarna hijau dan merah.","Angin datang dari tenggara, menghancurkan ujung bendera, bendera berwarna hijau dan merah.",},
        [3022] = {4902,"Cao Cao","Xun Yu","Tidak ada hal lain, malam ini Liu Bei pasti datang menyerang.","Tidak ada hal lain, malam ini Liu Bei pasti datang menyerang.",},
        [3023] = {4903,"","Zhang Fei","Mengapa serangan diam-diam begini mudah? Di dalam kamp tidak banyak prajurit.","Mengapa serangan diam-diam begini mudah? Di dalam kamp tidak banyak prajurit.",},
        [3024] = {4903,"","Zhang Fei","Gawat, ini adalah perangkap.","Gawat, ini adalah perangkap.",},
        [3025] = {4903,"Zhang Fei","Xu Huang","Mau lari kemana! Kamu sudah terkepung!","Mau lari kemana! Kamu sudah terkepung!",},
        [3026] = {4903,"Zhang Fei","Protagonis","Yide, ikuti aku lari keluar dari kepungan disini!","Yide, ikuti aku lari keluar dari kepungan disini!",},
        [3027] = {4903,"Protagonis","Zhang Fei","Jenderal Yangwei, terima kasih telah datang menyelamatkanku!","Jenderal Yangwei, terima kasih telah datang menyelamatkanku!",},
        [3028] = {4904,"Protagonis","Zhang Fei","Tidak mudah untuk keluar dari kepungan, kita kembali ke Peixian!","Tidak mudah untuk keluar dari kepungan, kita kembali ke Peixian!",},
        [3029] = {4904,"Zhang Fei","Protagonis","Tidak bisa, sekarang Peixian telah direbut lawan, kamu pergi dulu ke Gunung Mangdang untuk bersembunyi.","Tidak bisa, sekarang Peixian telah direbut lawan, kamu pergi dulu ke Gunung Mangdang untuk bersembunyi.",},
        [3030] = {4904,"Protagonis","Zhang Fei","Bagaiman dengan Xuande?","Bagaiman dengan Xuande?",},
        [3031] = {4904,"Zhang Fei","Protagonis","Jangan takut, aku akan menyelamatkannya, tenanglah.","Jangan takut, aku akan menyelamatkannya, tenanglah.",},
        [3032] = {4905,"","Liu Bei","Kabar buruk, Peixian kebakaran, kita harus meninggalkannya.","Kabar buruk, Peixian kebakaran, kita harus meninggalkannya.",},
        [3033] = {4905,"","Liu Bei","Kita pergi ke Xuzhou atau Xiapi.","Kita pergi ke Xuzhou atau Xiapi.",},
        [3034] = {4905,"Liu Bei","Xiahou Yuan","Xuzhou? Xiapi? Tanya pada busur ditanganku dulu!","Xuzhou? Xiapi? Tanya pada busur ditanganku dulu!",},
        [3035] = {4905,"Xiahou Yuan","Protagonis","Xuande, pergilah, aku akan menghadang Xiahou Yuan.","Xuande, pergilah, aku akan menghadang Xiahou Yuan.",},
        [3036] = {4906,"Protagonis","Liu Bei","Yide masih belum kembali dari kamp Cao Cao, apa yang harus dilakukan?","Yide masih belum kembali dari kamp Cao Cao, apa yang harus dilakukan?",},
        [3037] = {4906,"Liu Bei","Protagonis","Xuande jangan khawatir, aku telah membantu Yide dan menyuruhnya untuk bersembunyi di Gunung Mangdang.","Xuande jangan khawatir, aku telah membantu Yide dan menyuruhnya untuk bersembunyi di Gunung Mangdang.",},
        [3038] = {4906,"Liu Bei","Protagonis","Kamu memiliki rencana apa?","Kamu memiliki rencana apa?",},
        [3039] = {4906,"Protagonis","Liu Bei","Yuan Shao berkata kamu bisa bergabung dengannya jika ada masalah.","Yuan Shao berkata kamu bisa bergabung dengannya jika ada masalah.",},
        [3040] = {4906,"Protagonis","Liu Bei","Sekarang sebaiknya kamu bergabung dengannya, lalu pikirkan rencana lain.","Sekarang sebaiknya kamu bergabung dengannya, lalu pikirkan rencana lain.",},
        [3041] = {4906,"Liu Bei","Protagonis","Baiklah, kamu pergilah. Aku akan pergi mencari kakak Yunchang yang menghilang di Xuzhou.","Baiklah, kamu pergilah. Aku akan pergi mencari kakak Yunchang yang menghilang di Xuzhou.",},
        [3042] = {5001,"","Cao Cao","Yan Liang sungguh hebat!","Yan Liang sungguh hebat!",},
        [3043] = {5001,"","Cao Cao","Dalam beberapa ronde, dia membunuh Song Xian dan Wei Xu dua jenderal besar di sisi kami.","Dalam beberapa ronde, dia membunuh Song Xian dan Wei Xu dua jenderal besar di sisi kami.",},
        [3044] = {5001,"","Cao Cao","Apa yang harus dilakukan?","Apa yang harus dilakukan?",},
        [3045] = {5001,"Cao Cao","Cheng Yu","Aku merekomendasikan seseorang, dia bisa mengalahkan Yan Liang.","Aku merekomendasikan seseorang, dia bisa mengalahkan Yan Liang.",},
        [3046] = {5001,"Cheng Yu","Cao Cao","Siapa?","Siapa?",},
        [3047] = {5001,"Cao Cao","Cheng Yu","Guan Yu tentunya.","Guan Yu tentunya.",},
        [3048] = {5001,"Cheng Yu","Cao Cao","Takutnya dia hanya mengambil penghargaan lalu pergi.","Takutnya dia hanya mengambil penghargaan lalu pergi.",},
        [3049] = {5001,"Cao Cao","Cheng Yu","Jika Liu Bei disini, dia akan bergabung dengan Yuan Shao. Jika kamu memerintahkan Yunchang untuk merusak barisan tentara Yuan Shao hari ini, dia akan curiga dan bisa membunuh Liu Bei. Jika Liu Bei mati, Yunchang bisa mengikut kepada siapa lagi?","Jika Liu Bei disini, dia akan bergabung dengan Yuan Shao. Jika kamu memerintahkan Yunchang untuk merusak barisan tentara Yuan Shao hari ini, dia akan curiga dan bisa membunuh Liu Bei. Jika Liu Bei mati, Yunchang bisa mengikut kepada siapa lagi?",},
        [3050] = {5001,"Cheng Yu","Cao Cao","Aku akan mengirimkan seseorang untuk bertanya padanya.","Aku akan mengirimkan seseorang untuk bertanya padanya.",},
        [3051] = {5002,"Guan Yu","Cao Cao","Yang berdiri di kaki gunung adalah Yan Liang, sangat gagah dan tidak ada yang bisa melawannya, dia telah membunuh dua jenderal kami berturut-turut, aku ingin mendengar pendapatmu tentang hal ini.","Yang berdiri di kaki gunung adalah Yan Liang, sangat gagah dan tidak ada yang bisa melawannya, dia telah membunuh dua jenderal kami berturut-turut, aku ingin mendengar pendapatmu tentang hal ini.",},
        [3052] = {5002,"Cao Cao","Guan Yu","Biarkan aku melihatnya.","Biarkan aku melihatnya.",},
        [3053] = {5002,"Guan Yu","Cao Cao","Prajurit mereka, membawa bendera berwarna cerah, senjata lengkap, terlihat kuat, begitu megah!","Prajurit mereka, membawa bendera berwarna cerah, senjata lengkap, terlihat kuat, begitu megah!",},
        [3054] = {5002,"Cao Cao","Guan Yu","Jenderal Yangwei bagaimana menurutmu?","Jenderal Yangwei bagaimana menurutmu?",},
        [3055] = {5002,"Guan Yu","Protagonis","Menurutku, itu hanyalah reputasi kosong, tidak perlu takut! ","Menurutku, itu hanyalah reputasi kosong, tidak perlu takut! ",},
        [3056] = {5002,"Guan Yu","Cao Cao","Di bawah kanopi berdirilah Yan Liang, menggunakan tombak panjang dan mengenakan baju besi emas.","Di bawah kanopi berdirilah Yan Liang, menggunakan tombak panjang dan mengenakan baju besi emas.",},
        [3057] = {5002,"Cao Cao","Guan Yu","Aku melihat Yan Liang, dia seperti sedang memasang label harga dan menjual hidupnya.","Aku melihat Yan Liang, dia seperti sedang memasang label harga dan menjual hidupnya.",},
        [3058] = {5002,"Guan Yu","Cao Cao","Jangan meremehkan dia.","Jangan meremehkan dia.",},
        [3059] = {5002,"Cao Cao","Guan Yu","Meskipun aku tidak berkemampuan, aku bersedia untuk memenggal kepalanya dan memberikannya pada Perdana Menteri.","Meskipun aku tidak berkemampuan, aku bersedia untuk memenggal kepalanya dan memberikannya pada Perdana Menteri.",},
        [3060] = {5002,"Guan Yu","Zhang Liao","Dalam militer, perkataan harus dipertanggungjawabkan, tidak bisa sembarangan bicara, kalian jangan main-main.","Dalam militer, perkataan harus dipertanggungjawabkan, tidak bisa sembarangan bicara, kalian jangan main-main.",},
        [3061] = {5002,"Zhang Liao","Protagonis","Aku dan kakak Yunchang akan segera kembali!","Aku dan kakak Yunchang akan segera kembali!",},
        [3062] = {5003,"Cao Cao","Guan Yu","Ini adalah kepala Yan Liang, terimalah! (Lalu membuka ikatan kepala Yan Liang dari leher kuda dan memberikannya pada Cao Cao.)","Ini adalah kepala Yan Liang, terimalah! (Lalu membuka ikatan kepala Yan Liang dari leher kuda dan memberikannya pada Cao Cao.)",},
        [3063] = {5003,"Guan Yu","Cao Cao","Jenderal benar-benar merupakan dewa perang!","Jenderal benar-benar merupakan dewa perang!",},
        [3064] = {5003,"Cao Cao","Guan Yu","Memenggal kepala jenderal dari sejuta prajurit semudah membalikkan tangan.","Memenggal kepala jenderal dari sejuta prajurit semudah membalikkan tangan.",},
        [3065] = {5004,"","Yuan Shao","Siapa yang membunuh jenderalku Yan Liang?","Siapa yang membunuh jenderalku Yan Liang?",},
        [3066] = {5004,"Yuan Shao","Ju Shou","Seorang berwajah merah, janggut panjang dan menggunakan pedang sabit. Orang ini pasti adalah Guan Yunchang, adik Liu Xuande.","Seorang berwajah merah, janggut panjang dan menggunakan pedang sabit. Orang ini pasti adalah Guan Yunchang, adik Liu Xuande.",},
        [3067] = {5004,"Ju Shou","Yuan Shao","Kakakmu membunuh jenderal tercintaku, pasti kalian bersekongkol dengan musuh! Mengapa aku masih membiarkanmu hidup?","Kakakmu membunuh jenderal tercintaku, pasti kalian bersekongkol dengan musuh! Mengapa aku masih membiarkanmu hidup?",},
        [3068] = {5004,"Yuan Shao","Liu Bei","Kamu akan mengakhiri persahabatan kami hanya karena mendengar perkataan dari satu sisi?","Kamu akan mengakhiri persahabatan kami hanya karena mendengar perkataan dari satu sisi?",},
        [3069] = {5004,"Yuan Shao","Liu Bei","Sejak kekalahan kami di Xuzhou, tidak tahu apakah Yunchang masih hidup.","Sejak kekalahan kami di Xuzhou, tidak tahu apakah Yunchang masih hidup.",},
        [3070] = {5004,"Yuan Shao","Liu Bei","Di dunia ini banyak orang yang memiliki penampilan serupa, apakah orang dengan wajah merah dan janggut panjang pasti Guan Yu? Mengapa kamu tidak mencari tahu?","Di dunia ini banyak orang yang memiliki penampilan serupa, apakah orang dengan wajah merah dan janggut panjang pasti Guan Yu? Mengapa kamu tidak mencari tahu?",},
        [3071] = {5004,"Liu Bei","Yuan Shao","Salah mendengarkan perkataanmu, aku hampir saja membunuh orang baik.","Salah mendengarkan perkataanmu, aku hampir saja membunuh orang baik.",},
        [3072] = {5005,"","Wen Chou","Yan Liang dan aku seperti saudara. Sekarang dia dibunuh oleh bawahan Cao Cao, bagaimana mungkin aku tidak ingin balas dendam?","Yan Liang dan aku seperti saudara. Sekarang dia dibunuh oleh bawahan Cao Cao, bagaimana mungkin aku tidak ingin balas dendam?",},
        [3073] = {5005,"Wen Chou","Yuan Shao","Hanya kamu yang bisa membalaskan dendam Yan Liang. Akan kuberikan 100.000 prajurit untuk menyeberangi Sungai Kuning dan mengejar Cao Cao!","Hanya kamu yang bisa membalaskan dendam Yan Liang. Akan kuberikan 100.000 prajurit untuk menyeberangi Sungai Kuning dan mengejar Cao Cao!",},
        [3074] = {5005,"Yuan Shao","Ju Shou","Tidak bisa. Saat ini sebaiknya tinggal dulu di Yanjin dan pisahkan beberapa prajurit menuju Guandu. Jika kamu menyeberangi sungai dengan ringan, situasi akan berubah dan mereka mungkin tidak akan bisa kembali.","Tidak bisa. Saat ini sebaiknya tinggal dulu di Yanjin dan pisahkan beberapa prajurit menuju Guandu. Jika kamu menyeberangi sungai dengan ringan, situasi akan berubah dan mereka mungkin tidak akan bisa kembali.",},
        [3075] = {5005,"Ju Shou","Yuan Shao","Satu-satunya hal yang kalian ketahui sebagai penasihat adalah memperlambat keadaan! Apakah kamu tidak tahu pepatah yang mengatakan kecepatan sangat penting dalam perang?","Satu-satunya hal yang kalian ketahui sebagai penasihat adalah memperlambat keadaan! Apakah kamu tidak tahu pepatah yang mengatakan kecepatan sangat penting dalam perang?",},
        [3076] = {5005,"Yuan Shao","Ju Shou","Pemimpin itu sombong dan bawahannya serakah. Karena Sungai Kuning tidak dapat menentukan nasibku, aku harus menyeberanginya! (Lalu membanting pintu dan pergi.)","Pemimpin itu sombong dan bawahannya serakah. Karena Sungai Kuning tidak dapat menentukan nasibku, aku harus menyeberanginya! (Lalu membanting pintu dan pergi.)",},
        [3077] = {5005,"Yuan Shao","Liu Bei","Aku tidak bisa membalas kebaikan yang kudapatkan darimu, aku ingin pergi bersama Jenderal Wen.","Aku tidak bisa membalas kebaikan yang kudapatkan darimu, aku ingin pergi bersama Jenderal Wen.",},
        [3078] = {5005,"Yuan Shao","Liu Bei","Pertama, aku bisa membalas budi; Kedua, juga bisa mencari tahu kabar tentang Yunchang.","Pertama, aku bisa membalas budi; Kedua, juga bisa mencari tahu kabar tentang Yunchang.",},
        [3079] = {5005,"Liu Bei","Yuan Shao","Baik, Wen Chou, bawa 70.000 pasukan dan pergilah. Xuande, bawa 30.000 pasukdan dan ikuti dia.","Baik, Wen Chou, bawa 70.000 pasukan dan pergilah. Xuande, bawa 30.000 pasukdan dan ikuti dia.",},
        [3080] = {5006,"","Cao Cao","Wen Chou adalah jenderal terkenal Hebei, siapa yang bisa menangkapnya?","Wen Chou adalah jenderal terkenal Hebei, siapa yang bisa menangkapnya?",},
        [3081] = {5006,"Cao Cao","Protagonis","Karena telah memenggal Yan Liang, Wen Chou tidak menakutkan lagi. Tunggu aku dan Yunchang pergi dan kembali.","Karena telah memenggal Yan Liang, Wen Chou tidak menakutkan lagi. Tunggu aku dan Yunchang pergi dan kembali.",},
        [3082] = {5006,"Protagonis","Guan Yu","Jenderal Yangwei, kita pergi!","Jenderal Yangwei, kita pergi!",},
        [3083] = {5007,"","Guan Yu","Ini adalah kepala Wen Chou, ambillah! (Lalu membuka ikatan kepala Wen Chou dari leher kuda dan memberikannya pada Cao Cao.)","Ini adalah kepala Wen Chou, ambillah! (Lalu membuka ikatan kepala Wen Chou dari leher kuda dan memberikannya pada Cao Cao.)",},
        [3084] = {5007,"Guan Yu","Cao Cao","Kamu telah membunuh dua jenderal terbaik Yuan Shao. Yunchang dan Jenderal Yangwei, memang Hero yang hebat saat ini.","Kamu telah membunuh dua jenderal terbaik Yuan Shao. Yunchang dan Jenderal Yangwei, memang Hero yang hebat saat ini.",},
        [3085] = {5008,"Liu Bei","Yuan Shao","Kali ini Guan lagi yang membunuh Wen Chou, mengapa melakukan hal ini, masih adakah yang bisa kamu katakan!","Kali ini Guan lagi yang membunuh Wen Chou, mengapa melakukan hal ini, masih adakah yang bisa kamu katakan!",},
        [3086] = {5008,"Yuan Shao","Liu Bei","Apa salahku?","Apa salahku?",},
        [3087] = {5008,"Liu Bei","Yuan Shao","Kamu sengaja membuat adikmu membunuh seorang jenderalku, bagaimana itu tidak salah?","Kamu sengaja membuat adikmu membunuh seorang jenderalku, bagaimana itu tidak salah?",},
        [3088] = {5008,"Yuan Shao","Liu Bei","Biarkan aku menjelaskannya: Cao Cao selalu menyimpan dendam terhadapku. Mengetahui aku di sini, dia takut aku akan membantumu, jadi dia membuat Yunchang untuk membunuh dua jenderal.","Biarkan aku menjelaskannya: Cao Cao selalu menyimpan dendam terhadapku. Mengetahui aku di sini, dia takut aku akan membantumu, jadi dia membuat Yunchang untuk membunuh dua jenderal.",},
        [3089] = {5008,"Yuan Shao","Liu Bei","Kamu pasti marah setelah tahu. Dengan begini dia bisa menggunakan tanganmu untuk membunuhku. Pikirkan baik-baik.","Kamu pasti marah setelah tahu. Dengan begini dia bisa menggunakan tanganmu untuk membunuhku. Pikirkan baik-baik.",},
        [3090] = {5008,"Liu Bei","Yuan Shao","Kamu benar, Xuande. Kamu hampir saja membuatku membunuh orang tidak bersalah dan merusak reputasiku.","Kamu benar, Xuande. Kamu hampir saja membuatku membunuh orang tidak bersalah dan merusak reputasiku.",},
        [3091] = {5008,"Yuan Shao","Liu Bei","Kamu begitu murah hati dan toleran. Satu-satunya cara untukku agar dapat membayar kembali adalah dengan mengirim utusan yang dapat diandalkan untuk mengirimkan surat rahasia ke Yunchang.","Kamu begitu murah hati dan toleran. Satu-satunya cara untukku agar dapat membayar kembali adalah dengan mengirim utusan yang dapat diandalkan untuk mengirimkan surat rahasia ke Yunchang.",},
        [3092] = {5008,"Yuan Shao","Liu Bei","Beritahukan dia mengenai kabarku, dia pasti akan datang dalam semalam, untuk membantumu menyerang Cao Cao bersama, sebagai balas dendam Yan Liang dan Wen Chou. Bagaimana?","Beritahukan dia mengenai kabarku, dia pasti akan datang dalam semalam, untuk membantumu menyerang Cao Cao bersama, sebagai balas dendam Yan Liang dan Wen Chou. Bagaimana?",},
        [3093] = {5008,"Liu Bei","Yuan Shao","Jika aku memiliki Yunchang, ini 10 kali lebih baik daripada memiliki Yan Liang dan Wen Chou.","Jika aku memiliki Yunchang, ini 10 kali lebih baik daripada memiliki Yan Liang dan Wen Chou.",},
        [3094] = {5008,"Yuan Shao","Liu Bei","Aku akan menuliskan surat dan mengirim seseorang untuk menyampaikannya.","Aku akan menuliskan surat dan mengirim seseorang untuk menyampaikannya.",},
        [3095] = {5101,"Guan Yu","Zhang Liao","Mendengar kakak mendapatkan kabar dari Xuande, aku merasa senang.","Mendengar kakak mendapatkan kabar dari Xuande, aku merasa senang.",},
        [3096] = {5101,"Zhang Liao","Guan Yu","Dia masih hidup, tetapi kita belum bertemu, apa yang patut dibahagiakan?","Dia masih hidup, tetapi kita belum bertemu, apa yang patut dibahagiakan?",},
        [3097] = {5101,"Guan Yu","Zhang Liao","Hubunganmu dengan Xuande dan hubunganmu denganku, manakah yang lebih mendalam?","Hubunganmu dengan Xuande dan hubunganmu denganku, manakah yang lebih mendalam?",},
        [3098] = {5101,"Zhang Liao","Guan Yu","Aku dan kakak adalah teman; Aku dan Xuande, adalah teman sekaligus saudara, dia adalah pemimpin dan aku adalah menterinya. Hubungan kami bagaimana bisa dibandingkan?","Aku dan kakak adalah teman; Aku dan Xuande, adalah teman sekaligus saudara, dia adalah pemimpin dan aku adalah menterinya. Hubungan kami bagaimana bisa dibandingkan?",},
        [3099] = {5101,"Guan Yu","Zhang Liao","Sekarang Xuande di Hebei, apakah kamu pergi mencarinya?","Sekarang Xuande di Hebei, apakah kamu pergi mencarinya?",},
        [3100] = {5101,"Zhang Liao","Guan Yu","Aku tidak akan melanggar janjiku dulu! Wenyuan, kamu harus beritahu Perdana Menteri untukku.","Aku tidak akan melanggar janjiku dulu! Wenyuan, kamu harus beritahu Perdana Menteri untukku.",},
        [3101] = {5102,"Guan Yu","Cao Cao","Yunchang, mengapa terburu-buru?","Yunchang, mengapa terburu-buru?",},
        [3102] = {5102,"Cao Cao","Guan Yu","Aku pernah melaporkan kepada Perdana Menteri. Tuanku sekarang berada di Hebei, aku harus segera mencarinya.","Aku pernah melaporkan kepada Perdana Menteri. Tuanku sekarang berada di Hebei, aku harus segera mencarinya.",},
        [3103] = {5102,"Cao Cao","Guan Yu","Aku mengunjungi beberapa kali tetapi kamu tidak selalu tidak dapat ditemui, jadi aku harus meninggalkan surat, harta dan tokenku kepadamu. Semoga kamu tidak akan melupakan apa yang telah kamu janjikan kepadaku.","Aku mengunjungi beberapa kali tetapi kamu tidak selalu tidak dapat ditemui, jadi aku harus meninggalkan surat, harta dan tokenku kepadamu. Semoga kamu tidak akan melupakan apa yang telah kamu janjikan kepadaku.",},
        [3104] = {5102,"Guan Yu","Cao Cao","Aku akan menguasai dunia sebagai orang yang memegang janji, jadi aku tidak akan melanggarnya. Aku takut kamu kekurangan biaya perjalanan, ini sedikit persediaan untukmu. (Lalu memberikan sepiring emas.)","Aku akan menguasai dunia sebagai orang yang memegang janji, jadi aku tidak akan melanggarnya. Aku takut kamu kekurangan biaya perjalanan, ini sedikit persediaan untukmu. (Lalu memberikan sepiring emas.)",},
        [3105] = {5102,"Cao Cao","Guan Yu","Aku masih memiliki banyak hadiah. Ambil emas untuk dihadiahkan pada prajurit.","Aku masih memiliki banyak hadiah. Ambil emas untuk dihadiahkan pada prajurit.",},
        [3106] = {5102,"Guan Yu","Cao Cao","Hadiah ini hanyalah untuk salah satu kontribusimu yang sangat banyak, kamu janganlah menolaknya.","Hadiah ini hanyalah untuk salah satu kontribusimu yang sangat banyak, kamu janganlah menolaknya.",},
        [3107] = {5102,"Cao Cao","Guan Yu","Ini hanyalah masalah sepele, tidak perlu diungkit.","Ini hanyalah masalah sepele, tidak perlu diungkit.",},
        [3108] = {5102,"Guan Yu","Cao Cao","Yunchang adalah orang penuh keadilan, sayangnya aku tidak bisa menjagamu disini. Ini jubah brokat sebagai tanda terima kasihku, ambillah.","Yunchang adalah orang penuh keadilan, sayangnya aku tidak bisa menjagamu disini. Ini jubah brokat sebagai tanda terima kasihku, ambillah.",},
        [3109] = {5102,"Cao Cao","Guan Yu","Terima kasih atas jubah Perdana Menteri, semoga kita bisa bertemu lagi.","Terima kasih atas jubah Perdana Menteri, semoga kita bisa bertemu lagi.",},
        [3110] = {5103,"Guan Yu","Kong Xiu","Jenderal akan pergi kemana?","Jenderal akan pergi kemana?",},
        [3111] = {5103,"Kong Xiu","Guan Yu","Aku telah berpamitan dengan Perdana Menteri, untuk pergi ke Hebei dan mencari saudaraku.","Aku telah berpamitan dengan Perdana Menteri, untuk pergi ke Hebei dan mencari saudaraku.",},
        [3112] = {5103,"Guan Yu","Kong Xiu","Yuan Shao dari Hebei, adalah musuh Perdana Menteri. Jenderal pergi pada saat ini, pasti telah mendapatkan izin dari Perdana Menteri?","Yuan Shao dari Hebei, adalah musuh Perdana Menteri. Jenderal pergi pada saat ini, pasti telah mendapatkan izin dari Perdana Menteri?",},
        [3113] = {5103,"Kong Xiu","Guan Yu","Karena waktu yang ketat dan mendadak, aku tidak sempat meminta surat dari Perdana Menteri.","Karena waktu yang ketat dan mendadak, aku tidak sempat meminta surat dari Perdana Menteri.",},
        [3114] = {5103,"Guan Yu","Kong Xiu","Karena kamu tidak memiliki surat, tunggu aku mengirimkan seseorang untuk melaporkan pada Perdana Menteri.","Karena kamu tidak memiliki surat, tunggu aku mengirimkan seseorang untuk melaporkan pada Perdana Menteri.",},
        [3115] = {5103,"Kong Xiu","Guan Yu","Jika menunggumu kembali, ini pasti akan menunda perjalananku.","Jika menunggumu kembali, ini pasti akan menunda perjalananku.",},
        [3116] = {5103,"Guan Yu","Kong Xiu","Yang ditentukan oleh hukum, haruslah ditaati.","Yang ditentukan oleh hukum, haruslah ditaati.",},
        [3117] = {5103,"Kong Xiu","Guan Yu","Kamu tidak memberiku jalan?","Kamu tidak memberiku jalan?",},
        [3118] = {5103,"Guan Yu","Kong Xiu","Jika ingin pergi, tinggalkan keluargamu sebagai jaminan.","Jika ingin pergi, tinggalkan keluargamu sebagai jaminan.",},
        [3119] = {5103,"Kong Xiu","Guan Yu","Keterlaluan! Terima ini.","Keterlaluan! Terima ini.",},
        [3120] = {5104,"Guan Yu","Han Fu","Siapa yang datang?","Siapa yang datang?",},
        [3121] = {5104,"Han Fu","Guan Yu","Aku adalah Bangsawan Han, Guan. Biarkan aku lewat.","Aku adalah Bangsawan Han, Guan. Biarkan aku lewat.",},
        [3122] = {5104,"Guan Yu","Han Fu","Apakah kamu memiliki dokumen resmi Perdana Menteri?","Apakah kamu memiliki dokumen resmi Perdana Menteri?",},
        [3123] = {5104,"Han Fu","Guan Yu","Aku tidak ada waktu untuk meminta suratnya.","Aku tidak ada waktu untuk meminta suratnya.",},
        [3124] = {5104,"Guan Yu","Han Fu","Atas perintah Perdana Menteri, aku berjaga di sini untuk memeriksa mata-mata yang mencurigakan. Jika kamu tidak memiliki izin, maka kamu pasti adalah buronan.","Atas perintah Perdana Menteri, aku berjaga di sini untuk memeriksa mata-mata yang mencurigakan. Jika kamu tidak memiliki izin, maka kamu pasti adalah buronan.",},
        [3125] = {5104,"Han Fu","Guan Yu","Kong Xiu dari Dongling telah dibunuh olehku. Apakah kamu juga ingin mati?","Kong Xiu dari Dongling telah dibunuh olehku. Apakah kamu juga ingin mati?",},
        [3126] = {5104,"Han Fu","Guan Yu","Terima ini!","Terima ini!",},
        [3127] = {5105,"Guan Yu","Bian Xi","Jenderal telah dikenal semua orang, tidak ada yang tidak memujamu! Sekarang kembali mencari Paman Kerajaan, dapat terlihat kesetiaanmu!","Jenderal telah dikenal semua orang, tidak ada yang tidak memujamu! Sekarang kembali mencari Paman Kerajaan, dapat terlihat kesetiaanmu!",},
        [3128] = {5105,"Bian Xi","Guan Yu","Aku baru saja membunuh Kong Xiu dan Han Fu!","Aku baru saja membunuh Kong Xiu dan Han Fu!",},
        [3129] = {5105,"Guan Yu","Bian Xi","Jenderal membunuh dengan benar. Jika aku bertemu Perdana Menteri, akan kukatakan alasannya.","Jenderal membunuh dengan benar. Jika aku bertemu Perdana Menteri, akan kukatakan alasannya.",},
        [3130] = {5105,"Bian Xi","Guan Yu","Hahahaha, bagus untukmu.","Hahahaha, bagus untukmu.",},
        [3131] = {5105,"Guan Yu","Bian Xi","Yunchang apakah bersedia untuk minum teh di Kuil Zhenguo? Ada seorang biksu yang merupakan teman kampung halamanmu.","Yunchang apakah bersedia untuk minum teh di Kuil Zhenguo? Ada seorang biksu yang merupakan teman kampung halamanmu.",},
        [3132] = {5105,"Bian Xi","Guan Yu","Baiklah.","Baiklah.",},
        [3133] = {5106,"Bian Xi","Guan Yu","Apakah kamu memiliki niat baik, atau niat buruk, tuan Bian?","Apakah kamu memiliki niat baik, atau niat buruk, tuan Bian?",},
        [3134] = {5106,"Guan Yu","Bian Xi","Niat baik tentunya.","Niat baik tentunya.",},
        [3135] = {5106,"Bian Xi","Guan Yu","Aku mengira kamu adalah orang baik, tetapi aku salah, kamu berani melakukan hal ini!","Aku mengira kamu adalah orang baik, tetapi aku salah, kamu berani melakukan hal ini!",},
        [3136] = {5106,"Bian Xi","Guan Yu","Aku bisa melihat Pasukan Kapak sedang bersembunyi. (Lalu membunuh pasukan kapak dan Bian Xi dengan marah.)","Aku bisa melihat Pasukan Kapak sedang bersembunyi. (Lalu membunuh pasukan kapak dan Bian Xi dengan marah.)",},
        [3137] = {5107,"Guan Yu","Wang Zhi","Jenderal telah datang dari tempat jauh. Keluargamu pasti kelelahan di perjalanan. Silahkan masuk ke benteng dan beristirahat di penginapan. Kamu bisa melanjutkan perjalanan besok.","Jenderal telah datang dari tempat jauh. Keluargamu pasti kelelahan di perjalanan. Silahkan masuk ke benteng dan beristirahat di penginapan. Kamu bisa melanjutkan perjalanan besok.",},
        [3138] = {5107,"Wang Zhi","Guan Yu","Baik, silahkan pergi dulu, aku akan mengantar istri kakak kedua segera.","Baik, silahkan pergi dulu, aku akan mengantar istri kakak kedua segera.",},
        [3139] = {5107,"Guan Yu","Protagonis","Jangan!","Jangan!",},
        [3140] = {5107,"Guan Yu","Protagonis","Wang Zhi tidak berhati baik, ingin membunuh jenderal.","Wang Zhi tidak berhati baik, ingin membunuh jenderal.",},
        [3141] = {5107,"Protagonis","Guan Yu","Maksudnya?","Maksudnya?",},
        [3142] = {5107,"Guan Yu","Protagonis","Aku baru saja memeriksa di sekitar penginapan dan menemukan disana berselimutkan bahan yang mudah terbakar seperti kayu kering. Dia pasti telah merencanakan untuk membakar penginapan saat tengah malam.","Aku baru saja memeriksa di sekitar penginapan dan menemukan disana berselimutkan bahan yang mudah terbakar seperti kayu kering. Dia pasti telah merencanakan untuk membakar penginapan saat tengah malam.",},
        [3143] = {5107,"Protagonis","Guan Yu","Jenderal Yangwei, antarkan istri Bei keluar kota dengan kereta, aku akan pergi membunuh Wang Zhi. ","Jenderal Yangwei, antarkan istri Bei keluar kota dengan kereta, aku akan pergi membunuh Wang Zhi. ",},
        [3144] = {5108,"Guan Yu","Qin Qi","Siapa yang datang?","Siapa yang datang?",},
        [3145] = {5108,"Qin Qi","Guan Yu","Guan, Bangsawan Paviliun Hanshou.","Guan, Bangsawan Paviliun Hanshou.",},
        [3146] = {5108,"Guan Yu","Qin Qi","Sekarang akan pergi kemana?","Sekarang akan pergi kemana?",},
        [3147] = {5108,"Qin Qi","Guan Yu","Aku ingin pergi ke Hebei, mencari kakak Liu Xuande, mohon bantu aku menyeberangi sungai.","Aku ingin pergi ke Hebei, mencari kakak Liu Xuande, mohon bantu aku menyeberangi sungai.",},
        [3148] = {5108,"Guan Yu","Qin Qi","Tunjukkan padaku dokumen resmi Perdana Menteri.","Tunjukkan padaku dokumen resmi Perdana Menteri.",},
        [3149] = {5108,"Qin Qi","Guan Yu","Aku bukan dibawah perintah Perdana Menteri, dokumen resmi apa!","Aku bukan dibawah perintah Perdana Menteri, dokumen resmi apa!",},
        [3150] = {5108,"Guan Yu","Qin Qi","Atas perintah Jenderal Xiahou, aku akan menjaga kapal feri. Kamu tidak akan menyeberanginya bagaimanapun!","Atas perintah Jenderal Xiahou, aku akan menjaga kapal feri. Kamu tidak akan menyeberanginya bagaimanapun!",},
        [3151] = {5108,"Qin Qi","Guan Yu","Tahukah kamu aku telah membunuh siapapun yang menghalangi jalanku?","Tahukah kamu aku telah membunuh siapapun yang menghalangi jalanku?",},
        [3152] = {5108,"Guan Yu","Qin Qi","Kamu hanya mampu mengalahkan yang lemah, apakah kamu berani melawanku?","Kamu hanya mampu mengalahkan yang lemah, apakah kamu berani melawanku?",},
        [3153] = {5108,"Qin Qi","Guan Yu","Menurutmu kamu lebih baik dari Yan Liang dan Wen Chou?","Menurutmu kamu lebih baik dari Yan Liang dan Wen Chou?",},
        [3154] = {5108,"Guan Yu","Qin Qi","Beraninya memandang rendah aku, Aaaaa! Kita mulai bertarung!","Beraninya memandang rendah aku, Aaaaa! Kita mulai bertarung!",},
        [3155] = {5109,"Guan Yu","Xiahou Dun","Jangan pergi, Guan!","Jangan pergi, Guan!",},
        [3156] = {5109,"Xiahou Dun","Guan Yu","Kamu mengejarku, membuatmu kehilangan karakter murah hati Perdana Menteri.","Kamu mengejarku, membuatmu kehilangan karakter murah hati Perdana Menteri.",},
        [3157] = {5109,"Guan Yu","Xiahou Dun","Perdana Menteri tidak memberikan izin maka kamu membantai semua orang di jalan. Sangat primitif, kamu bahkan membunuh beberapa jenderal kami! Aku di sini untuk menangkap dan membawamu kembali ke Perdana Menteri!","Perdana Menteri tidak memberikan izin maka kamu membantai semua orang di jalan. Sangat primitif, kamu bahkan membunuh beberapa jenderal kami! Aku di sini untuk menangkap dan membawamu kembali ke Perdana Menteri!",},
        [3158] = {5110,"","Zhang Liao","Yunchang, Yuanrang, berhenti bertarung!","Yunchang, Yuanrang, berhenti bertarung!",},
        [3159] = {5110,"","Zhang Liao","Menurut perintah Perdana Menteri, ia mendengar bahwa Yunchang telah membunuh para jenderal dalam perjalanannya untuk melewati blokade. Jika Yunchang menghadapi kesulitan lebih lanjut, dia mendesakku untuk melewati perintah yang memberi tahu semua pos pemeriksaan untuk membiarkan Yunchang lewat.","Menurut perintah Perdana Menteri, ia mendengar bahwa Yunchang telah membunuh para jenderal dalam perjalanannya untuk melewati blokade. Jika Yunchang menghadapi kesulitan lebih lanjut, dia mendesakku untuk melewati perintah yang memberi tahu semua pos pemeriksaan untuk membiarkan Yunchang lewat.",},
        [3160] = {5110,"Zhang Liao","Xiahou Dun","Qin Qi adalah keponakan Cai Yang. Dia mempercayakannya padaku, dan hari ini telah dibunuh oleh Guan. Bagaimana mungkin akan dibiarkannya begitu saja?","Qin Qi adalah keponakan Cai Yang. Dia mempercayakannya padaku, dan hari ini telah dibunuh oleh Guan. Bagaimana mungkin akan dibiarkannya begitu saja?",},
        [3161] = {5110,"Xiahou Dun","Zhang Liao","Aku akan membantumu menjelaskannya saat aku bertemu Jenderal Cai. Perdana Menteri cukup murah hati untuk membiarkan Yunchang pergi, kalian jangan melanggar perintahnya.","Aku akan membantumu menjelaskannya saat aku bertemu Jenderal Cai. Perdana Menteri cukup murah hati untuk membiarkan Yunchang pergi, kalian jangan melanggar perintahnya.",},
        [3162] = {5110,"Zhang Liao","Xiahou Dun","Humph, karena Perdana Menteri telah berkata, aku bisa apa lagi!","Humph, karena Perdana Menteri telah berkata, aku bisa apa lagi!",},
        [3163] = {5110,"Xiahou Dun","Zhang Liao","Yunchang, apa rencanamu?","Yunchang, apa rencanamu?",},
        [3164] = {5110,"Zhang Liao","Guan Yu","Aku mendengar bahwa Liu Bei tidak bersama Yuan Shao lagi, aku akan mencarinya di seluruh penjuru dunia.","Aku mendengar bahwa Liu Bei tidak bersama Yuan Shao lagi, aku akan mencarinya di seluruh penjuru dunia.",},
        [3165] = {5110,"Guan Yu","Zhang Liao","Karena kamu belum menemukan keberadaan Xuande, mengapa tidak kembali dulu menemui Perdana Menteri?","Karena kamu belum menemukan keberadaan Xuande, mengapa tidak kembali dulu menemui Perdana Menteri?",},
        [3166] = {5110,"Zhang Liao","Guan Yu","Bagaimana bisa begini! Wenyuan kembali temui Perdana Menteri, sampaikan maafku kepadanya.","Bagaimana bisa begini! Wenyuan kembali temui Perdana Menteri, sampaikan maafku kepadanya.",},
        [3167] = {5201,"Guan Yu","Zhou Cang","Inilah Jenderal Guan. Namaku Zhou Cang.","Inilah Jenderal Guan. Namaku Zhou Cang.",},
        [3168] = {5201,"Zhou Cang","Guan Yu","Apakah kita pernah bertemu sebelumnya?","Apakah kita pernah bertemu sebelumnya?",},
        [3169] = {5201,"Guan Yu","Zhou Cang","Dulu saat aku berada di bawah perintah Zhang Bao di Turban Kuning, aku memiliki kesempatan untuk bertemu denganmu. Sayangnya, aku tidak bisa bergabung denganmu karena aku bersama bandit.","Dulu saat aku berada di bawah perintah Zhang Bao di Turban Kuning, aku memiliki kesempatan untuk bertemu denganmu. Sayangnya, aku tidak bisa bergabung denganmu karena aku bersama bandit.",},
        [3170] = {5201,"Guan Yu","Zhou Cang","Sangat beruntung dapat bertemu denganmu hari ini. Semoga jenderal tidak meninggalkanku dan menerimaku sebagai prajurit, aku akan melayani dan menjaga pagi dan malam, matipun juga rela!","Sangat beruntung dapat bertemu denganmu hari ini. Semoga jenderal tidak meninggalkanku dan menerimaku sebagai prajurit, aku akan melayani dan menjaga pagi dan malam, matipun juga rela!",},
        [3171] = {5201,"Zhou Cang","Guan Yu","Jika kamu mengikutiku, bagaimana dengan pasukanmu?","Jika kamu mengikutiku, bagaimana dengan pasukanmu?",},
        [3172] = {5201,"Guan Yu","Zhou Cang","Jika mereka bersedia, mereka bisa mengikutku; kalau tidak, maka pergilah mereka.","Jika mereka bersedia, mereka bisa mengikutku; kalau tidak, maka pergilah mereka.",},
        [3173] = {5201,"Guan Yu","Zhou Cang","Aku berjalan sendiri, bersedia mengikuti jenderal meskipun akan bepergian jauh!","Aku berjalan sendiri, bersedia mengikuti jenderal meskipun akan bepergian jauh!",},
        [3174] = {5202,"Guan Yu","Liao Hua","Jenderal Guan, berhenti!","Jenderal Guan, berhenti!",},
        [3175] = {5202,"Liao Hua","Guan Yu","Siapa kamu?","Siapa kamu?",},
        [3176] = {5202,"Guan Yu","Liao Hua","Aku adalah orang Xiangyang, bermarga Liao, nama Hua, nama kehormatan Yuanjian. Karena kekacauan di dunia ini, aku telah berkeliling ke banyak tempat, membawa lebih dari 500 orang, dan hidup dengan merampok.","Aku adalah orang Xiangyang, bermarga Liao, nama Hua, nama kehormatan Yuanjian. Karena kekacauan di dunia ini, aku telah berkeliling ke banyak tempat, membawa lebih dari 500 orang, dan hidup dengan merampok.",},
        [3177] = {5202,"Guan Yu","Liao Hua","Dalam perjalanan menuruni bukit, kawanku Du Yuan secara tidak sengaja merampok kedua nyonya dan membawa mereka ke bukit.","Dalam perjalanan menuruni bukit, kawanku Du Yuan secara tidak sengaja merampok kedua nyonya dan membawa mereka ke bukit.",},
        [3178] = {5202,"Guan Yu","Liao Hua","Dengan mendengarkannya, aku mendapati bahwa mereka adalah dua istri Paman Liu dari Han, dan aku mendengar bahwa kamu juga ada di sini, jadi aku ingin mengawal mereka menuruni bukit.","Dengan mendengarkannya, aku mendapati bahwa mereka adalah dua istri Paman Liu dari Han, dan aku mendengar bahwa kamu juga ada di sini, jadi aku ingin mengawal mereka menuruni bukit.",},
        [3179] = {5202,"Guan Yu","Liao Hua","Du Yuan berbicara dengan kasar, jadi aku membunuhnya. Sekarang aku di sini menghadiahkan kepalanya untuk meminta maaf kepadamu.","Du Yuan berbicara dengan kasar, jadi aku membunuhnya. Sekarang aku di sini menghadiahkan kepalanya untuk meminta maaf kepadamu.",},
        [3180] = {5202,"Liao Hua","Guan Yu","Dimana kedua nyonya itu?","Dimana kedua nyonya itu?",},
        [3181] = {5202,"Guan Yu","Liao Hua","Sekarang di gunung.","Sekarang di gunung.",},
        [3182] = {5202,"Liao Hua","Guan Yu","Cepat bawa aku kesana!","Cepat bawa aku kesana!",},
        [3183] = {5203,"Liu Bei","Guan Ding","Kehormatan bagiku Guan Gong bisa datang ke Rumah Guan Ding!","Kehormatan bagiku Guan Gong bisa datang ke Rumah Guan Ding!",},
        [3184] = {5203,"Liu Bei","Guan Ding","Aku memiliki dua putra: Guan Ning, anak sulung, sedang belajar literatur; Guan Ping, anak bungsu, sedang belajar ilmu bela diri.","Aku memiliki dua putra: Guan Ning, anak sulung, sedang belajar literatur; Guan Ping, anak bungsu, sedang belajar ilmu bela diri.",},
        [3185] = {5203,"Liu Bei","Guan Ding","Aku ingin merekomendasikan putra keduaku pada Jenderal Guan dan mengikut padanya, apakah kamu bersedia untuk menerimanya?","Aku ingin merekomendasikan putra keduaku pada Jenderal Guan dan mengikut padanya, apakah kamu bersedia untuk menerimanya?",},
        [3186] = {5203,"Guan Ding","Liu Bei","Umur berapa dia?","Umur berapa dia?",},
        [3187] = {5203,"Liu Bei","Guan Ding","Delapan belas tahun.","Delapan belas tahun.",},
        [3188] = {5203,"Guan Ding","Liu Bei","Dengan kebaikan dan anugerahmu, adikku yang saat ini belum memiliki putra, akan mengangkatmu sebagai putra angkat, bagaimana?","Dengan kebaikan dan anugerahmu, adikku yang saat ini belum memiliki putra, akan mengangkatmu sebagai putra angkat, bagaimana?",},
        [3189] = {5203,"Liu Bei","Guan Ding","Sangat bagus!","Sangat bagus!",},
        [3190] = {5203,"Liu Bei","Protagonis","Selamat, Yunchang telah mengadopsi seorang putra!","Selamat, Yunchang telah mengadopsi seorang putra!",},
        [3191] = {5203,"Protagonis","Guan Yu","Hahahahahaha.","Hahahahahaha.",},
        [3192] = {5301,"Zhang Fei","Guan Yu","Mengapa kamu melotot, menunjukkan muka garang, berbicara dengan suara keras dan menodongkan tombak kearahku?","Mengapa kamu melotot, menunjukkan muka garang, berbicara dengan suara keras dan menodongkan tombak kearahku?",},
        [3193] = {5301,"Zhang Fei","Guan Yu","Apakah kamu sudah lupa dengan Sumpah Taman Persik?","Apakah kamu sudah lupa dengan Sumpah Taman Persik?",},
        [3194] = {5301,"Guan Yu","Zhang Fei","Makhluk yang tidak setia, masih ada muka untuk menemuiku!","Makhluk yang tidak setia, masih ada muka untuk menemuiku!",},
        [3195] = {5301,"Zhang Fei","Guan Yu","Bagaimana aku tidak setia?","Bagaimana aku tidak setia?",},
        [3196] = {5301,"Guan Yu","Zhang Fei","Kamu mengkhianati kakak, menyerah pada Cao Cao untuk kekuasaan dan kekayaan. Sekarang mencariku lagi! Aku akan membuatmu mati!","Kamu mengkhianati kakak, menyerah pada Cao Cao untuk kekuasaan dan kekayaan. Sekarang mencariku lagi! Aku akan membuatmu mati!",},
        [3197] = {5301,"Zhang Fei","Protagonis","Jadi kamu tidak tahu! Jangan salahkan kakak Yunchang.","Jadi kamu tidak tahu! Jangan salahkan kakak Yunchang.",},
        [3198] = {5301,"Zhang Fei","Protagonis","Yunchang membunuh enam jenderal saat melewati lima gerbang, lalu berkuda sendiri sepanjang ribuan mil, agar bisa masuk ke Gucheng!","Yunchang membunuh enam jenderal saat melewati lima gerbang, lalu berkuda sendiri sepanjang ribuan mil, agar bisa masuk ke Gucheng!",},
        [3199] = {5301,"Protagonis","Zhang Fei","Adiklah yang telah keliru!","Adiklah yang telah keliru!",},
        [3200] = {5302,"Guan Yu","Cai Yang","Kamu membunuh keponakanku Qin Qi dan kabur kesini!","Kamu membunuh keponakanku Qin Qi dan kabur kesini!",},
        [3201] = {5302,"Guan Yu","Cai Yang","Atas perintah Perdana Menteri, aku datang untuk menangkapmu!","Atas perintah Perdana Menteri, aku datang untuk menangkapmu!",},
        [3202] = {5302,"Cai Yang","Guan Yu","Adik pukullah gendang untukku, sebelum tiga lagu perang berakhir, aku pasti akan mendapatkan kepalanya.","Adik pukullah gendang untukku, sebelum tiga lagu perang berakhir, aku pasti akan mendapatkan kepalanya.",},
        [3203] = {5302,"Guan Yu","Zhang Fei","Baik!","Baik!",},
        [3204] = {5303,"Liu Bei","Zhou Cang","Sebelum aku tiba di Gunung Woniu, seorang penugngang kuda sendirian muncul dan melibatkan saudaraku Pei Yuanshao. Penunggang itu menikamnya hingga mati hanya dalam satu ronde.","Sebelum aku tiba di Gunung Woniu, seorang penugngang kuda sendirian muncul dan melibatkan saudaraku Pei Yuanshao. Penunggang itu menikamnya hingga mati hanya dalam satu ronde.",},
        [3205] = {5303,"Liu Bei","Zhou Cang","Dia memanggil semuanya untuk menyerah padanya dan menduduki desa di gunung.","Dia memanggil semuanya untuk menyerah padanya dan menduduki desa di gunung.",},
        [3206] = {5303,"Liu Bei","Zhou Cang","Merasa kesal, aku melawannya dan kalah berkali-kali, badanku terkena tiga kali tusukan, jadi aku kemari untuk melaporkannya padamu.","Merasa kesal, aku melawannya dan kalah berkali-kali, badanku terkena tiga kali tusukan, jadi aku kemari untuk melaporkannya padamu.",},
        [3207] = {5303,"Zhou Cang","Liu Bei","Orang itu seperti apa? Siapa namanya?","Orang itu seperti apa? Siapa namanya?",},
        [3208] = {5303,"Liu Bei","Zhou Cang","Orang it terlihat luar biasa, namanya tidak diketahui.","Orang it terlihat luar biasa, namanya tidak diketahui.",},
        [3209] = {5303,"Liu Bei","Guan Yu","Tunggu aku segera pergi memeriksanya!","Tunggu aku segera pergi memeriksanya!",},
        [3210] = {5303,"Liu Bei","Protagonis","Aku juga pergi!","Aku juga pergi!",},
        [3211] = {5304,"","Liu Bei","Apakah kamu Zilong?","Apakah kamu Zilong?",},
        [3212] = {5304,"Liu Bei","Zhao Yun","Sejak aku berpisah denganmu, tidak disangka Gongsun Zan tidak mendengar bujukanku, sehingga prajuritnya kalah dan membakar diri hingga mati.","Sejak aku berpisah denganmu, tidak disangka Gongsun Zan tidak mendengar bujukanku, sehingga prajuritnya kalah dan membakar diri hingga mati.",},
        [3213] = {5304,"Liu Bei","Zhao Yun","Yuan Shao berusaha untuk merekrutku berkali-kali, aku merasa dia bukanlah seseorang yang bisa menggunakan orang dengan baik, karena itu aku menolaknya.","Yuan Shao berusaha untuk merekrutku berkali-kali, aku merasa dia bukanlah seseorang yang bisa menggunakan orang dengan baik, karena itu aku menolaknya.",},
        [3214] = {5304,"Liu Bei","Zhao Yun","Lalu, saat aku mencoba untuk bergabung denganmu di Xuzhou, aku mendengar Xuzhou telah jatuh, Yunchang telah ditangkap oleh Cao Cao dan kamu berada di Yuan Shao sana.","Lalu, saat aku mencoba untuk bergabung denganmu di Xuzhou, aku mendengar Xuzhou telah jatuh, Yunchang telah ditangkap oleh Cao Cao dan kamu berada di Yuan Shao sana.",},
        [3215] = {5304,"Liu Bei","Zhao Yun","Aku berpikir beberapa kali untuk bergabung dengamu, tetapi aku takut Yuan Shao akan tersinggung. Ternyata tidak ada tempat yang menerimaku dimanapun.","Aku berpikir beberapa kali untuk bergabung dengamu, tetapi aku takut Yuan Shao akan tersinggung. Ternyata tidak ada tempat yang menerimaku dimanapun.",},
        [3216] = {5304,"Liu Bei","Zhao Yun","Sebelumnya saat aku melewati tempat ini, Pei Yuanshao turun dari gunung mencoba merebut kudaku. Maka aku membunuhnya dan bersembunyi disini.","Sebelumnya saat aku melewati tempat ini, Pei Yuanshao turun dari gunung mencoba merebut kudaku. Maka aku membunuhnya dan bersembunyi disini.",},
        [3217] = {5304,"Liu Bei","Zhao Yun","Akhir-akhir ini aku mendengar bahwa Yide berada di Gucheng, aku berenacana untuk bergabung dengannya. Aku juga tidak tahu apakah informasi ini benar. Hari ini sangat beruntung dapat bertemu denganmu!","Akhir-akhir ini aku mendengar bahwa Yide berada di Gucheng, aku berenacana untuk bergabung dengannya. Aku juga tidak tahu apakah informasi ini benar. Hari ini sangat beruntung dapat bertemu denganmu!",},
        [3218] = {5304,"Zhao Yun","Liu Bei","Saat pertama kali bertemu Zilong, aku merasakan hubungan khusus dengannya. Sangat beruntung dapat bertemu denganmu lagi hari ini!","Saat pertama kali bertemu Zilong, aku merasakan hubungan khusus dengannya. Sangat beruntung dapat bertemu denganmu lagi hari ini!",},
        [3219] = {5304,"Liu Bei","Zhao Yun","Aku berpergian ke banyak tempat dan melayani raja yang berbeda-beda, tetapi tidak ada yang sebaik kamu. Saat ini bisa mengikutimu dan menunjukkan kemampuanku, impianku telah tercapai. Meskipun mati dengan cara kejam, aku tidak akan menyesal.","Aku berpergian ke banyak tempat dan melayani raja yang berbeda-beda, tetapi tidak ada yang sebaik kamu. Saat ini bisa mengikutimu dan menunjukkan kemampuanku, impianku telah tercapai. Meskipun mati dengan cara kejam, aku tidak akan menyesal.",},
        [3220] = {5305,"Liu Bei","Protagonis","Kamu telah bertemu dengan Yunchang dan Zhang Fei.","Kamu telah bertemu dengan Yunchang dan Zhang Fei.",},
        [3221] = {5305,"Liu Bei","Protagonis","Dengan bantuan Zhou Cang, Liao Hua, Guan Ping dan Zhao Yun, kamu pasti akan menenangkan wilayah besar dunia ini dari kekacauan.","Dengan bantuan Zhou Cang, Liao Hua, Guan Ping dan Zhao Yun, kamu pasti akan menenangkan wilayah besar dunia ini dari kekacauan.",},
        [3222] = {5305,"Liu Bei","Protagonis","Aku pergi dulu untuk sementara dan pergi berkeliling ke Jiangdong.","Aku pergi dulu untuk sementara dan pergi berkeliling ke Jiangdong.",},
        [3223] = {5305,"Protagonis","Liu Bei","Jenderal Yangwei berhati-hatilah, sampai bertemu lagi, selamat jalan!","Jenderal Yangwei berhati-hatilah, sampai bertemu lagi, selamat jalan!",},
        [3224] = {5401,"","Sun Ce","Aku mendengar bahwa Xu Gong menuliskan surat pribadi kepada Perdana Menteri.","Aku mendengar bahwa Xu Gong menuliskan surat pribadi kepada Perdana Menteri.",},
        [3225] = {5401,"","Sun Ce","Dikatakan bahwa aku hebat seperti Xiang Ji. Istana seharusnya menunjukkan kebaikannya padaku kepada publik, dan memerintahku untuk tetap di dalam kota, tidak bisa membiarkanku keluar kota, maka akan bisa menjadi bencana.","Dikatakan bahwa aku hebat seperti Xiang Ji. Istana seharusnya menunjukkan kebaikannya padaku kepada publik, dan memerintahku untuk tetap di dalam kota, tidak bisa membiarkanku keluar kota, maka akan bisa menjadi bencana.",},
        [3226] = {5401,"","Sun Ce","Kamu mengingkanku mati!","Kamu mengingkanku mati!",},
        [3227] = {5401,"","Sun Ce","Penjaga, bunuh Xu Gong dan keluarganya!","Penjaga, bunuh Xu Gong dan keluarganya!",},
        [3228] = {5402,"","Sun Ce","Siapa kalian?","Siapa kalian?",},
        [3229] = {5402,"Sun Ce","Tamu Xu Gong","Kita adalah pengikut Xu Gong dan kemari untuk membalaskan dendam!","Kita adalah pengikut Xu Gong dan kemari untuk membalaskan dendam!",},
        [3230] = {5402,"Tamu Xu Gong","Sun Ce","Bunuh mereka!","Bunuh mereka!",},
        [3231] = {5402,"Sun Ce","Cheng Pu","Bofu, tolong aku.","Bofu, tolong aku.",},
        [3232] = {5403,"Pengikut Hua Tuo","Sun Ce","Hua Tuo ada di rumah?","Hua Tuo ada di rumah?",},
        [3233] = {5403,"Sun Ce","Pengikut Hua Tuo","Tuanku telah pergi ke Zhongyuan, hanya kami beberapa muridnya yang berada di Wu.","Tuanku telah pergi ke Zhongyuan, hanya kami beberapa muridnya yang berada di Wu.",},
        [3234] = {5403,"Pengikut Hua Tuo","Sun Ce","Kalau begitu cepat lihat lukaku.","Kalau begitu cepat lihat lukaku.",},
        [3235] = {5403,"Sun Ce","Pengikut Hua Tuo","Racun di ujung panah telah masuk ke tulang. Harus beristirahat selama seratus hari untuk bisa sembuh. Jika kamu marah, maka akan membuat luka semakin parah dan susah untuk disembuhkan.","Racun di ujung panah telah masuk ke tulang. Harus beristirahat selama seratus hari untuk bisa sembuh. Jika kamu marah, maka akan membuat luka semakin parah dan susah untuk disembuhkan.",},
        [3236] = {5403,"Pengikut Hua Tuo","Sun Ce","Seratus hari? Aku tidak bisa menunggu satu haripun!","Seratus hari? Aku tidak bisa menunggu satu haripun!",},
        [3237] = {5404,"Sun Ce","Chen Zhen","Aku diminta Yuan Shao untuk datang kemari, dia ingin Dongwu untuk bergabung dan menyerang Cao Cao bersama.","Aku diminta Yuan Shao untuk datang kemari, dia ingin Dongwu untuk bergabung dan menyerang Cao Cao bersama.",},
        [3238] = {5404,"Chen Zhen","Sun Ce","Aku juga berpikir seperti ini, kita pergi mengambli Xuchang bersama-sama.","Aku juga berpikir seperti ini, kita pergi mengambli Xuchang bersama-sama.",},
        [3239] = {5404,"Chen Zhen","Sun Ce","Ayo, minum dan makan denganku di menara tembok.","Ayo, minum dan makan denganku di menara tembok.",},
        [3240] = {5405,"Zhang Zhao","Sun Ce","Mengapa semua orang di pesta perjamuanku saling berbisik dan turun ke bawah?","Mengapa semua orang di pesta perjamuanku saling berbisik dan turun ke bawah?",},
        [3241] = {5405,"Sun Ce","Zhang Zhao","Seorang imortal lewat di bawah menara, para jenderal pergi kesana untuk melihatnya.","Seorang imortal lewat di bawah menara, para jenderal pergi kesana untuk melihatnya.",},
        [3242] = {5405,"Zhang Zhao","Sun Ce","Siapa orang jahat ini? Cepat bawa dia kemari!","Siapa orang jahat ini? Cepat bawa dia kemari!",},
        [3243] = {5405,"Sun Ce","Zhang Zhao","Orang ini bermarga Yu, nama Ji, tinggal di timur dan sering datang ke Dongwu. Dia membagikan air jimat kepada rakyat, dapat menyembuhkan penyakit banyak orang, sangat berkhasiat.","Orang ini bermarga Yu, nama Ji, tinggal di timur dan sering datang ke Dongwu. Dia membagikan air jimat kepada rakyat, dapat menyembuhkan penyakit banyak orang, sangat berkhasiat.",},
        [3244] = {5405,"Sun Ce","Zhang Zhao","Semua orang menyebutnya imortal dan menghormati dia.","Semua orang menyebutnya imortal dan menghormati dia.",},
        [3245] = {5405,"Zhang Zhao","Sun Ce","Cepat bawa kemari! Sekarang!","Cepat bawa kemari! Sekarang!",},
        [3246] = {5406,"Yu Ji","Sun Ce","Beraninya membingungkan pikiran rakyat!","Beraninya membingungkan pikiran rakyat!",},
        [3247] = {5406,"Sun Ce","Yu Ji","Aku adalah Taoist Kuli Langya. Saat masa Kaisar Shun, pada perjalanan ke gunung untuk mengumpulkan rumput obat, aku mendapatkan buku ajaib pada mata air di Yangqu beranama Kitab Suci Kedamaian.","Aku adalah Taoist Kuli Langya. Saat masa Kaisar Shun, pada perjalanan ke gunung untuk mengumpulkan rumput obat, aku mendapatkan buku ajaib pada mata air di Yangqu beranama Kitab Suci Kedamaian.",},
        [3248] = {5406,"Sun Ce","Yu Ji","Lebih dari seratus jilid, semuanya adalah ilmu medis.","Lebih dari seratus jilid, semuanya adalah ilmu medis.",},
        [3249] = {5406,"Sun Ce","Yu Ji","Setelah mendapatkan buku ini, satu-satunya hal yang ingin kulakukan adalah mengolah dan menyelamatkan orang. Aku tidak mengambil apapun dari siapapun, bagaimana ini bisa dianggap membingungkan pikiran rakyat?","Setelah mendapatkan buku ini, satu-satunya hal yang ingin kulakukan adalah mengolah dan menyelamatkan orang. Aku tidak mengambil apapun dari siapapun, bagaimana ini bisa dianggap membingungkan pikiran rakyat?",},
        [3250] = {5406,"Yu Ji","Sun Ce","Jika kamu tidak mengambil hadiahnya, bagaimana bisa memenuhi kebutuhan pokok?","Jika kamu tidak mengambil hadiahnya, bagaimana bisa memenuhi kebutuhan pokok?",},
        [3251] = {5406,"Yu Ji","Sun Ce","Kamu pasti sama dengan Zhang Jiao dari Turban Kuning, jika tidak membunuhmu sekarang, kamu akan menjadi masalah nantinya!","Kamu pasti sama dengan Zhang Jiao dari Turban Kuning, jika tidak membunuhmu sekarang, kamu akan menjadi masalah nantinya!",},
        [3252] = {5406,"Sun Ce","Zhang Zhao","Aku telah berkelana di Jiangdong selama beberapa dekade dan aku belum pernah melakukan kejahatan sekalipun!","Aku telah berkelana di Jiangdong selama beberapa dekade dan aku belum pernah melakukan kejahatan sekalipun!",},
        [3253] = {5406,"Zhang Zhao","Sun Ce","Membunuh penyihir ini, tidak ada bedanya dengan membunuh babi!","Membunuh penyihir ini, tidak ada bedanya dengan membunuh babi!",},
        [3254] = {5406,"Sun Ce","Chen Zhen","Bofu, harap hati-hati mempertimbangkannya.","Bofu, harap hati-hati mempertimbangkannya.",},
        [3255] = {5406,"Chen Zhen","Sun Ce","Seseorang, masukkan dia ke penjara.","Seseorang, masukkan dia ke penjara.",},
        [3256] = {5407,"Yu Ji","Sun Ce","Aku mendengar bahwa kamu bisa berdoa untuk memanggil hujan. Hari ini cuaca kering, berikan aku hujan setinggi tiga kaki, dan aku akan membiarkanmu hidup.","Aku mendengar bahwa kamu bisa berdoa untuk memanggil hujan. Hari ini cuaca kering, berikan aku hujan setinggi tiga kaki, dan aku akan membiarkanmu hidup.",},
        [3257] = {5407,"Yu Ji","Sun Ce","Jika tidak turun hujan pada siang hari, maka kamu mati.","Jika tidak turun hujan pada siang hari, maka kamu mati.",},
        [3258] = {5407,"Sun Ce","Yu Ji","Aku akan membuka altar dan memulainya.","Aku akan membuka altar dan memulainya.",},
        [3259] = {5407,"Yu Ji","Protagonis","Siapa yang melakukan sihir, membuat jalan menjadi sungai, arus air sungai penuh dan menenggelamkan sawah.","Siapa yang melakukan sihir, membuat jalan menjadi sungai, arus air sungai penuh dan menenggelamkan sawah.",},
        [3260] = {5407,"Yu Ji","Sun Ce","Aku memintamu untuk berdoa untuk hujan, tetapi malah membuat Jiangdong banjir? Apakah kamu mencoba untuk memberontak?","Aku memintamu untuk berdoa untuk hujan, tetapi malah membuat Jiangdong banjir? Apakah kamu mencoba untuk memberontak?",},
        [3261] = {5407,"Sun Ce","Yu Ji","Hahahaha, aku akan memanggil badai dan hujan, dan akan menunggangi angin, apa yang bisa kamu lakukan?","Hahahaha, aku akan memanggil badai dan hujan, dan akan menunggangi angin, apa yang bisa kamu lakukan?",},
        [3262] = {5407,"Yu Ji","Protagonis","Di dunia yang kacau ini tidak bisa membiarkan taoist jahat sepertimu membuatnya lebih kacau, aku akan memusnahkanmu!","Di dunia yang kacau ini tidak bisa membiarkan taoist jahat sepertimu membuatnya lebih kacau, aku akan memusnahkanmu!",},
        [3263] = {5408,"Protagonis","Sun Ce","Terima kasih atas bantuan Hero, telah menyelamatkan Jiangdong dari bahaya.","Terima kasih atas bantuan Hero, telah menyelamatkan Jiangdong dari bahaya.",},
        [3264] = {5408,"Sun Ce","Protagonis","Tidak perlu berterima kasih padaku, pada perjalananku di Jiangdong, aku telah lama mendengar bahwa taoist jahat itu menggunakan ilmu tao sebagai kedok untuk menyembuhkan penyakit, tetapi sebenarnya adalah untuk mengguna-guna pikiran rakyat.","Tidak perlu berterima kasih padaku, pada perjalananku di Jiangdong, aku telah lama mendengar bahwa taoist jahat itu menggunakan ilmu tao sebagai kedok untuk menyembuhkan penyakit, tetapi sebenarnya adalah untuk mengguna-guna pikiran rakyat.",},
        [3265] = {5408,"Sun Ce","Protagonis","Hari ini dia bahkan membahayakan orang Jiangdong dengan manteranya, akan kuanggap ini sebagai menghukum yang jahat.","Hari ini dia bahkan membahayakan orang Jiangdong dengan manteranya, akan kuanggap ini sebagai menghukum yang jahat.",},
        [3266] = {5408,"Protagonis","Sun Ce","Jenderal Yangwei memberikan bantuan, Bofu sangat berterima kasih.","Jenderal Yangwei memberikan bantuan, Bofu sangat berterima kasih.",},
        [3267] = {5501,"Sun Ce","Zhang Zhao","Semalam terjadi hujan badai, saat matahari terbit, jasad Yu Ji tidak terlihat lagi!","Semalam terjadi hujan badai, saat matahari terbit, jasad Yu Ji tidak terlihat lagi!",},
        [3268] = {5501,"Zhang Zhao","Sun Ce","Orang jahat, benar-benar orang jahat!","Orang jahat, benar-benar orang jahat!",},
        [3269] = {5501,"Sun Ce","Zhang Zhao","Takutnya setelah Yu Ji mati di masih akan menyakitimu.","Takutnya setelah Yu Ji mati di masih akan menyakitimu.",},
        [3270] = {5501,"Zhang Zhao","Sun Ce","Aku telah ikut berperang dengan ayah sejak kecil, tak terhitung berapa yang kubunuh, aku tidak takut pada taoist itu.","Aku telah ikut berperang dengan ayah sejak kecil, tak terhitung berapa yang kubunuh, aku tidak takut pada taoist itu.",},
        [3271] = {5502,"Da Qiao","Sun Ce","Beberapa hari ini aku merasa kesal.","Beberapa hari ini aku merasa kesal.",},
        [3272] = {5502,"Sun Ce","Da Qiao","Bofu, jika ada hal yang tidak menyenangkan bisa mengatakannya padaku.","Bofu, jika ada hal yang tidak menyenangkan bisa mengatakannya padaku.",},
        [3273] = {5502,"Da Qiao","Sun Ce","Sejak aku membunuh Yu Ji taoist jahat itu, aku tidak bisa tenang.","Sejak aku membunuh Yu Ji taoist jahat itu, aku tidak bisa tenang.",},
        [3274] = {5502,"Da Qiao","Sun Ce","Di bawah bayang-bayang lampu malam itu, aku melihat Yu Ji berdiri di samping tempat tidur. Ketika aku pergi ke Biara Yuqing untuk berdoa, aku melihatnya lagi.","Di bawah bayang-bayang lampu malam itu, aku melihat Yu Ji berdiri di samping tempat tidur. Ketika aku pergi ke Biara Yuqing untuk berdoa, aku melihatnya lagi.",},
        [3275] = {5502,"Da Qiao","Sun Ce","Di dalam pikiranku, taoist itu tidak berhenti datang, menyebalkan bukan!","Di dalam pikiranku, taoist itu tidak berhenti datang, menyebalkan bukan!",},
        [3276] = {5502,"Sun Ce","Da Qiao","Bofu sepertinya terlalu lelah, beristirahatlah selama beberapa hari, setelah itu pasti akan lebih baik.","Bofu sepertinya terlalu lelah, beristirahatlah selama beberapa hari, setelah itu pasti akan lebih baik.",},
        [3277] = {5502,"Da Qiao","Sun Ce","Kamu mengetahui bahwa aku mudah marah, tidak perlu istirahat, bertarung di medan perang adalah cara istirahat terbaikku.","Kamu mengetahui bahwa aku mudah marah, tidak perlu istirahat, bertarung di medan perang adalah cara istirahat terbaikku.",},
        [3278] = {5502,"Da Qiao","Sun Ce","Perintahkan prajurit untuk berkumpul dan mendirikan kemah di luar kota. Panggil para jenderal untuk membahas tentang serangan kepungan ke Cao Cao.","Perintahkan prajurit untuk berkumpul dan mendirikan kemah di luar kota. Panggil para jenderal untuk membahas tentang serangan kepungan ke Cao Cao.",},
        [3279] = {5502,"Sun Ce","Da Qiao","Badanmu sedang sakit, jangan pergi. Tunggu badanmu sehat dulu dan pergilah berperang.","Badanmu sedang sakit, jangan pergi. Tunggu badanmu sehat dulu dan pergilah berperang.",},
        [3280] = {5502,"Da Qiao","Sun Ce","Aku telah memutuskan.","Aku telah memutuskan.",},
        [3281] = {5503,"","Sun Ce","Yu Ji taoist jahat, tunjukkan dirimu!","Yu Ji taoist jahat, tunjukkan dirimu!",},
        [3282] = {5503,"","Sun Ce","Cepat keluar, siapa yang mengizinkanmu membuat keributan di kampku?","Cepat keluar, siapa yang mengizinkanmu membuat keributan di kampku?",},
        [3283] = {5503,"","Sun Ce","Aaaaaa!","Aaaaaa!",},
        [3284] = {5503,"Sun Ce","Protagonis","Bofu mengapa marah-marah di dalam barak?","Bofu mengapa marah-marah di dalam barak?",},
        [3285] = {5503,"Protagonis","Sun Ce","Kamu tidak melihatnya? Yu Ji taoist jahat itu sedang duduk di dalam barakku dengan rambut terurai!","Kamu tidak melihatnya? Yu Ji taoist jahat itu sedang duduk di dalam barakku dengan rambut terurai!",},
        [3286] = {5503,"Sun Ce","Protagonis","Disini ada Yu Ji? Taoist jahat itu telah kubunuh beberapa hari lalu!","Disini ada Yu Ji? Taoist jahat itu telah kubunuh beberapa hari lalu!",},
        [3287] = {5503,"Sun Ce","Protagonis","Mungkin beberapa hari ini kamu bekerja terlalu keras, ditambah dengan beberapa bulan sebelumnya, pengikut Xu Gong menyerangmu secara diam-diam, membuatmu gelisah hingga berhalusinasi.","Mungkin beberapa hari ini kamu bekerja terlalu keras, ditambah dengan beberapa bulan sebelumnya, pengikut Xu Gong menyerangmu secara diam-diam, membuatmu gelisah hingga berhalusinasi.",},
        [3288] = {5503,"Sun Ce","Protagonis","Tidak masalah!","Tidak masalah!",},
        [3289] = {5503,"Protagonis","Sun Ce","Mengapa aku terlihat seperti ini! (Setelah mendengarmu, dia melihat ke cermin.)","Mengapa aku terlihat seperti ini! (Setelah mendengarmu, dia melihat ke cermin.)",},
        [3290] = {5503,"Protagonis","Sun Ce","Lihat! Yu Ji jelas-jelas berdiri di depan cerminku.","Lihat! Yu Ji jelas-jelas berdiri di depan cerminku.",},
        [3291] = {5503,"Protagonis","Sun Ce","Aaaaaa! (Sun Ce menghancurkan cermin dan berteriak. Lukanya terbuka dan jatuh pingsan.)","Aaaaaa! (Sun Ce menghancurkan cermin dan berteriak. Lukanya terbuka dan jatuh pingsan.)",},
        [3292] = {5503,"Sun Ce","Protagonis","Bofu, kamu tidak apa-apa? Bofu, bangun!","Bofu, kamu tidak apa-apa? Bofu, bangun!",},
        [3293] = {5504,"Sun Quan","Sun Ce","Dunia sangat kacau, andalkan jumlah orang Wu yang banyak, dimana kamu bisa dilindungi oleh tiga sungai. Kamu pasti bisa berhasil.","Dunia sangat kacau, andalkan jumlah orang Wu yang banyak, dimana kamu bisa dilindungi oleh tiga sungai. Kamu pasti bisa berhasil.",},
        [3294] = {5504,"Sun Quan","Sun Ce","Dalam hal memimpin orang Jiangdong, mengambil keuntungan dari kedua belah pihak dan menjaga keseimbangan, aku lebih baik darimu.","Dalam hal memimpin orang Jiangdong, mengambil keuntungan dari kedua belah pihak dan menjaga keseimbangan, aku lebih baik darimu.",},
        [3295] = {5504,"Sun Quan","Sun Ce","Dalam mencari orang yang berbakat dan menggunakannya, membuat mereka melindungi Jiangdong, kamu lebih hebat dariku. Kamu harus memikirkan kesusahan Dongwu yang dibangun oleh generasi sebelumnya, semoga kamu bisa termotivasi untuk menjaganya!","Dalam mencari orang yang berbakat dan menggunakannya, membuat mereka melindungi Jiangdong, kamu lebih hebat dariku. Kamu harus memikirkan kesusahan Dongwu yang dibangun oleh generasi sebelumnya, semoga kamu bisa termotivasi untuk menjaganya!",},
        [3296] = {5504,"Sun Ce","Sun Quan","Aku masih muda, tidak bisa melakukan perkara besar, apa yang harus kulakukan?","Aku masih muda, tidak bisa melakukan perkara besar, apa yang harus kulakukan?",},
        [3297] = {5504,"Sun Quan","Sun Ce","Adik, kemampuanmu lebih hebat jauh dari anakku, dapat menjadi pejabat Dongwu. Untuk urusan dalam, bisa bertanya dengan Zhang Zhao.","Adik, kemampuanmu lebih hebat jauh dari anakku, dapat menjadi pejabat Dongwu. Untuk urusan dalam, bisa bertanya dengan Zhang Zhao.",},
        [3298] = {5504,"Sun Quan","Sun Ce","Untuk urusan asing, tanya Zhou Yu.","Untuk urusan asing, tanya Zhou Yu.",},
        [3299] = {5504,"Sun Quan","Sun Ce","Dimana Jenderal Yangwei?","Dimana Jenderal Yangwei?",},
        [3300] = {5504,"Sun Ce","Protagonis","Aku disini.","Aku disini.",},
        [3301] = {5504,"Protagonis","Sun Ce","Aku sangat beruntung bisa mendapatkan bantuanmu. Jika adikku bertemu masalah apapun, aku berharap kamu bisa membantunya.","Aku sangat beruntung bisa mendapatkan bantuanmu. Jika adikku bertemu masalah apapun, aku berharap kamu bisa membantunya.",},
        [3302] = {5504,"Sun Ce","Protagonis","Jika ada masalah apapun, selama tidak berlawanan dengan keadilan, aku akan membantumu dengan sepenuh tenaga.","Jika ada masalah apapun, selama tidak berlawanan dengan keadilan, aku akan membantumu dengan sepenuh tenaga.",},
        [3303] = {5504,"Protagonis","Sun Ce","Sekali lagi, bantu aku memberitahukan pada Zhou Yu, untuk memintanya membantu adikku, jangan mengecewakan hubungan antara aku dan dia. (Setelah bicara, menutup mata dan mati.)","Sekali lagi, bantu aku memberitahukan pada Zhou Yu, untuk memintanya membantu adikku, jangan mengecewakan hubungan antara aku dan dia. (Setelah bicara, menutup mata dan mati.)",},
        [3304] = {5601,"Zhou Yu","Sun Quan","Sekarang aku telah mewarisi peninggalan ayah dan kakakku, cara apa yang digunakan untuk bisa menjaganya?","Sekarang aku telah mewarisi peninggalan ayah dan kakakku, cara apa yang digunakan untuk bisa menjaganya?",},
        [3305] = {5601,"Sun Quan","Zhou Yu","Sejak zaman kuno, siapapun yang memenangkan orang-orang berbakat akan mendapatkan kemenangan. Menilai dari situasi saat ini, kamu harus merekrut mereka yang memiliki pandangan jauh ke depan, dengan begitu Jiangdong dapat ditenangkan.","Sejak zaman kuno, siapapun yang memenangkan orang-orang berbakat akan mendapatkan kemenangan. Menilai dari situasi saat ini, kamu harus merekrut mereka yang memiliki pandangan jauh ke depan, dengan begitu Jiangdong dapat ditenangkan.",},
        [3306] = {5601,"Zhou Yu","Sun Quan","Perkataan terakhir kakak: Untuk urusan dalam, minta bantuan Zibu; Untuk urusan asing, minta bantuan Gongjin.","Perkataan terakhir kakak: Untuk urusan dalam, minta bantuan Zibu; Untuk urusan asing, minta bantuan Gongjin.",},
        [3307] = {5601,"Sun Quan","Zhou Yu","Zibu cukup berprestasi dan bijaksana untuk memikul tanggung jawab besar. Namun, tidak terpikir bahwa aku berkemampuan untuk menyelesaikan masalah eksternal sendirian. Aku ingin merekomendasikan seseorang yang dapat membantu.","Zibu cukup berprestasi dan bijaksana untuk memikul tanggung jawab besar. Namun, tidak terpikir bahwa aku berkemampuan untuk menyelesaikan masalah eksternal sendirian. Aku ingin merekomendasikan seseorang yang dapat membantu.",},
        [3308] = {5601,"Zhou Yu","Sun Quan","Siapa?","Siapa?",},
        [3309] = {5601,"Sun Quan","Zhou Yu","Marga Lu, nama Su, nama kehormatan Zijing, berasal dari Dongchuan, Linhuai.","Marga Lu, nama Su, nama kehormatan Zijing, berasal dari Dongchuan, Linhuai.",},
        [3310] = {5601,"Sun Quan","Zhou Yu","Ini adalah orang yang memiliki visi dan strategi. Setelah kehilangan ayahnya di masa mudanya, dia sangat berbakti kepada ibunya. Terlahir dari keluarga kaya, ia membagikan kekayaannya kepada orang miskin.","Ini adalah orang yang memiliki visi dan strategi. Setelah kehilangan ayahnya di masa mudanya, dia sangat berbakti kepada ibunya. Terlahir dari keluarga kaya, ia membagikan kekayaannya kepada orang miskin.",},
        [3311] = {5601,"Sun Quan","Zhou Yu","Dulu ketika aku menjadi kepala kediaman, setelah beberapa ratus orang yang kukelola pindah ke Linhuai, kami mengalami kekurangan makanan yang parah. Setelah mendengar bahwa keluarga Lu Su menyimpan dua gudang beras, masing-masing seberat 3000 dou, aku meminta makanan darinya.","Dulu ketika aku menjadi kepala kediaman, setelah beberapa ratus orang yang kukelola pindah ke Linhuai, kami mengalami kekurangan makanan yang parah. Setelah mendengar bahwa keluarga Lu Su menyimpan dua gudang beras, masing-masing seberat 3000 dou, aku meminta makanan darinya.",},
        [3312] = {5601,"Sun Quan","Zhou Yu","Tidak perlu mengatakan apa-apa lagi, Su menunjuk ke salah satu gudang, artinya aku harus mengambilnya. Dia sangat dermawan. Biasanya dia suka berlatih pedang, menunggang kuda dan menembak, dia tinggal di Qu'a. Ketika neneknya meninggal, dia membawanya kembali ke Dongcheng dan menguburnya di sana.","Tidak perlu mengatakan apa-apa lagi, Su menunjuk ke salah satu gudang, artinya aku harus mengambilnya. Dia sangat dermawan. Biasanya dia suka berlatih pedang, menunggang kuda dan menembak, dia tinggal di Qu'a. Ketika neneknya meninggal, dia membawanya kembali ke Dongcheng dan menguburnya di sana.",},
        [3313] = {5601,"Sun Quan","Zhou Yu","Temannya Liu Ziyang meminta dia untuk bergabung dengan Zheng Bao dari Chaohu, tetapi dia masih ragu dan tidak pergi. Sekarang cepat pergi cari dia.","Temannya Liu Ziyang meminta dia untuk bergabung dengan Zheng Bao dari Chaohu, tetapi dia masih ragu dan tidak pergi. Sekarang cepat pergi cari dia.",},
        [3314] = {5601,"Zhou Yu","Sun Quan","Hebat, lakukan seperti perkataan Zibu.","Hebat, lakukan seperti perkataan Zibu.",},
        [3315] = {5602,"Lu Su","Zhou Yu","Sun Quan sangat mengagumimu.","Sun Quan sangat mengagumimu.",},
        [3316] = {5602,"Zhou Yu","Lu Su","Liu Ziyang mengundangku untuk bergabung Chaohu akhir-akhir ini, aku bersiap untuk menerimanya.","Liu Ziyang mengundangku untuk bergabung Chaohu akhir-akhir ini, aku bersiap untuk menerimanya.",},
        [3317] = {5602,"Lu Su","Zhou Yu","Ma Yuan pernah mengatakan ini pada Kaisar Guangwu: Pada saat ini, tidak hanya raja memilih menteri, menteri juga memilih rajanya.","Ma Yuan pernah mengatakan ini pada Kaisar Guangwu: Pada saat ini, tidak hanya raja memilih menteri, menteri juga memilih rajanya.",},
        [3318] = {5602,"Lu Su","Zhou Yu","Jenderal Sun mencari talenta dengan sopan santun dan kebaikan seperti yang belum pernah dilakukan sebelumnya. Singkirkan semua ide buruk yang kamu punya, ikuti saja aku ke Dongwu.","Jenderal Sun mencari talenta dengan sopan santun dan kebaikan seperti yang belum pernah dilakukan sebelumnya. Singkirkan semua ide buruk yang kamu punya, ikuti saja aku ke Dongwu.",},
        [3319] = {5602,"Zhou Yu","Lu Su","Aku akan pergi bersamamu menemui Sun Quan.","Aku akan pergi bersamamu menemui Sun Quan.",},
        [3320] = {5603,"Lu Su","Sun Quan","Sekarang Dinasti Han dalam bahaya dan ada kekacauan di mana-mana, setelah mewarisi warisan ayah dan kakak saya, saya mencari hegemoni seperti Adipati Huan dari Qi dan Adipati Wen dari Jin. Katakan padaku, apa yang harus kulakukan?","Sekarang Dinasti Han dalam bahaya dan ada kekacauan di mana-mana, setelah mewarisi warisan ayah dan kakak saya, saya mencari hegemoni seperti Adipati Huan dari Qi dan Adipati Wen dari Jin. Katakan padaku, apa yang harus kulakukan?",},
        [3321] = {5603,"Sun Quan","Lu Su","Kaisar Gaozu dari Dinasti Han dulu mendukung Kaisar Yi tetapi gagal karena Kaisar Yi dibunuh oleh Xiang Yu. Sekarang Cao Cao seperti Xiang Yu, mengapa kamu menjadi seperti Duke Huan dan Duke Wen?","Kaisar Gaozu dari Dinasti Han dulu mendukung Kaisar Yi tetapi gagal karena Kaisar Yi dibunuh oleh Xiang Yu. Sekarang Cao Cao seperti Xiang Yu, mengapa kamu menjadi seperti Duke Huan dan Duke Wen?",},
        [3322] = {5603,"Sun Quan","Lu Su","Aku berpikir bahwa Dinasti Han tidak bisa diselamatkan, dan Cao Cao tidak bisa segera disingkirkan. Dari sudut pandangmu, kamu dapat membentuk rezim separatis dengan kekuatan senjata di sini di Jiangdong dan menonton dengan aman sementara yang lain bertarung.","Aku berpikir bahwa Dinasti Han tidak bisa diselamatkan, dan Cao Cao tidak bisa segera disingkirkan. Dari sudut pandangmu, kamu dapat membentuk rezim separatis dengan kekuatan senjata di sini di Jiangdong dan menonton dengan aman sementara yang lain bertarung.",},
        [3323] = {5603,"Sun Quan","Lu Su","Sekarang pejabat di utara berperang satu sama lain, kamu harus memusnahkan Huang Zu dan menyerang Liu Biao, kemudian sepenuhnya menduduki Sungai Panjang.","Sekarang pejabat di utara berperang satu sama lain, kamu harus memusnahkan Huang Zu dan menyerang Liu Biao, kemudian sepenuhnya menduduki Sungai Panjang.",},
        [3324] = {5603,"Sun Quan","Lu Su","Lalu kamu bisa menyatakan dirimu sebagai kaisar sebelum melanjutkan untuk menaklukkan seluruh negeri. Inilah cara yang dipakai Kaisar Gaozu.","Lalu kamu bisa menyatakan dirimu sebagai kaisar sebelum melanjutkan untuk menaklukkan seluruh negeri. Inilah cara yang dipakai Kaisar Gaozu.",},
        [3325] = {5603,"Lu Su","Sun Quan","Masuk akal, hahahaha.","Masuk akal, hahahaha.",},
        [3326] = {5604,"Sun Quan","Lu Su","Aku ingin memperkenalkan seseorang padamu, Sun Quan.","Aku ingin memperkenalkan seseorang padamu, Sun Quan.",},
        [3327] = {5604,"Lu Su","Sun Quan","Siapa?","Siapa?",},
        [3328] = {5604,"Sun Quan","Lu Su","Orang ini berpengetahuan dan bertalenta, sangat hormat pada ibunya; Bermarga Zhuge, nama Jin, nama kehormatan Ziyu, merupakan orang Nanyang, Langya.","Orang ini berpengetahuan dan bertalenta, sangat hormat pada ibunya; Bermarga Zhuge, nama Jin, nama kehormatan Ziyu, merupakan orang Nanyang, Langya.",},
        [3329] = {5604,"Lu Su","Sun Quan","Cepat kenalkan dia padaku.","Cepat kenalkan dia padaku.",},
        [3330] = {5605,"Zhuge Jin","Sun Quan","Apa pandanganmu tentang situasi yang saat ini terjadi di negara ini, Ziyu?","Apa pandanganmu tentang situasi yang saat ini terjadi di negara ini, Ziyu?",},
        [3331] = {5605,"Sun Quan","Zhuge Jin","Jangan bekerja sama dengan Yuan Shao, berpura-puralah membantu Cao Cao, lalu tunggu kesempatan untuk menggantikannya.","Jangan bekerja sama dengan Yuan Shao, berpura-puralah membantu Cao Cao, lalu tunggu kesempatan untuk menggantikannya.",},
        [3332] = {5605,"Zhuge Jin","Sun Quan","Ringkas dan masuk akal.","Ringkas dan masuk akal.",},
        [3333] = {5606,"Sun Quan","Protagonis","Setelah berkeliling di Jiangdong, ada seseorang yang ingin kuperkenalkan padamu.","Setelah berkeliling di Jiangdong, ada seseorang yang ingin kuperkenalkan padamu.",},
        [3334] = {5606,"Protagonis","Sun Quan","Siapa?","Siapa?",},
        [3335] = {5606,"Sun Quan","Protagonis","Orang ini bermarga Gu, nama Yong, nama kehormatan Yuantan, murid dari Kapten Cai Yong. Tidak banyak bicara, tidak minum-minum dan keras terhada diri sendiri, tulus terhadap orang lain.","Orang ini bermarga Gu, nama Yong, nama kehormatan Yuantan, murid dari Kapten Cai Yong. Tidak banyak bicara, tidak minum-minum dan keras terhada diri sendiri, tulus terhadap orang lain.",},
        [3336] = {5606,"Protagonis","Sun Quan","Baik, berikan dia jabatan sebagai asisten dan jadikan dia sebagai Pemimpin Prefektur.","Baik, berikan dia jabatan sebagai asisten dan jadikan dia sebagai Pemimpin Prefektur.",},
        [3337] = {5607,"Yuan Shao","Chen Zhen","Sun Ce telah mati, Sun Quan telah meneruskan dan mendapatkan dukungan orang-orang.","Sun Ce telah mati, Sun Quan telah meneruskan dan mendapatkan dukungan orang-orang.",},
        [3338] = {5607,"Yuan Shao","Chen Zhen","Cao Cao mengangkatnya menjadi jenderal dan menjadikannya sebagai pendukung.","Cao Cao mengangkatnya menjadi jenderal dan menjadikannya sebagai pendukung.",},
        [3339] = {5607,"Chen Zhen","Yuan Shao","Apa!","Apa!",},
        [3340] = {5607,"Chen Zhen","Yuan Shao","Kumpulkan 700.000 prajurit yang tersebar di Ji, Qing, you, Bing dan tempat lain, dan serang Xuchang.","Kumpulkan 700.000 prajurit yang tersebar di Ji, Qing, you, Bing dan tempat lain, dan serang Xuchang.",},
        [3341] = {5701,"Yuan Shao","Ju Shou","Prajurit kita banyak, sedangkan kemampuan bertarung tidak sehebat lawan. Meskipun prajurit lawan adalah prajurit elit, tetapi ransum mereka tidak sebanyak kita.","Prajurit kita banyak, sedangkan kemampuan bertarung tidak sehebat lawan. Meskipun prajurit lawan adalah prajurit elit, tetapi ransum mereka tidak sebanyak kita.",},
        [3342] = {5701,"Yuan Shao","Ju Shou","Karena itu, mereka pasti berpikir untuk serangan cepat. Karena kita memiliki lebih banyak ransum, kita harus bersiaga dan melindungi diri sendiri.","Karena itu, mereka pasti berpikir untuk serangan cepat. Karena kita memiliki lebih banyak ransum, kita harus bersiaga dan melindungi diri sendiri.",},
        [3343] = {5701,"Yuan Shao","Ju Shou","Jika dapat menunda dengan cukup lama, mereka akan kalah sebelum berperang.","Jika dapat menunda dengan cukup lama, mereka akan kalah sebelum berperang.",},
        [3344] = {5701,"Ju Shou","Yuan Shao","Tian Feng mengabaikan moral prajurit kami, aku pasti akan membunuhnya setelah aku kembali. Mengapa kamu juga sama dengannya! ","Tian Feng mengabaikan moral prajurit kami, aku pasti akan membunuhnya setelah aku kembali. Mengapa kamu juga sama dengannya! ",},
        [3345] = {5701,"Ju Shou","Yuan Shao","Kurung Ju Shou di penjara militer. Setelah mengalahkan Cao, ku akan menghukum dengan mereka berdua!","Kurung Ju Shou di penjara militer. Setelah mengalahkan Cao, ku akan menghukum dengan mereka berdua!",},
        [3346] = {5702,"Yuan Shao","Cao Cao","Aku di depan kaisar memberikanmu jabatan jenderal besar, mengapa kamu sekarang merencanakan pengkhianatan?","Aku di depan kaisar memberikanmu jabatan jenderal besar, mengapa kamu sekarang merencanakan pengkhianatan?",},
        [3347] = {5702,"Cao Cao","Yuan Shao","Kamu memanggil diri sendiri sebagai Perdana Menteri Dinasti Han, sebenarnya kamu adalah pengkhianat! Kejahatanmu sangat besar, lebih dari Mang dan Zhuo, masih berani menyalahkan orang lain?","Kamu memanggil diri sendiri sebagai Perdana Menteri Dinasti Han, sebenarnya kamu adalah pengkhianat! Kejahatanmu sangat besar, lebih dari Mang dan Zhuo, masih berani menyalahkan orang lain?",},
        [3348] = {5702,"Yuan Shao","Cao Cao","Dengan ini aku menghukummu sesuai dekrit kaisar!","Dengan ini aku menghukummu sesuai dekrit kaisar!",},
        [3349] = {5702,"Cao Cao","Yuan Shao","Dengan ini aku menghukummu sesuai dekrit sabuk!","Dengan ini aku menghukummu sesuai dekrit sabuk!",},
        [3350] = {5702,"Yuan Shao","Cao Cao","Zhang Liao, maju!","Zhang Liao, maju!",},
        [3351] = {5702,"Cao Cao","Yuan Shao","Zhang He, maju!","Zhang He, maju!",},
        [3352] = {5703,"","Yuan Shao","Pasukan Cao kalah total dan mundur kembali ke Guandu.","Pasukan Cao kalah total dan mundur kembali ke Guandu.",},
        [3353] = {5703,"","Yuan Shao","Perintahkan prajurit untuk mendekati Guandu dan berjaga disana.","Perintahkan prajurit untuk mendekati Guandu dan berjaga disana.",},
        [3354] = {5703,"Yuan Shao","Shen Pei","Sekarang bisa mengirimkan 100.000 prajurit untuk melindungi Guandu dan membangun bukit di depan kamp Cao Cao, lalu perintahkan prajurit untuk menembak panah dari sana.","Sekarang bisa mengirimkan 100.000 prajurit untuk melindungi Guandu dan membangun bukit di depan kamp Cao Cao, lalu perintahkan prajurit untuk menembak panah dari sana.",},
        [3355] = {5703,"Yuan Shao","Shen Pei","Jika Cao Cao meninggalkan tempat ini, kami bisa mendapatkan gerbang ini dan bisa menyerang Xuchang.","Jika Cao Cao meninggalkan tempat ini, kami bisa mendapatkan gerbang ini dan bisa menyerang Xuchang.",},
        [3356] = {5703,"Shen Pei","Yuan Shao","Perkataan Zhengnan masuk akal.","Perkataan Zhengnan masuk akal.",},
        [3357] = {5704,"","Cao Cao","Pasukan Yuan membangun bukit, aku ingin maju melawan mereka, pasukan pemanah Shen Pei menghalangi kamu untuk masuk dari gerbang.","Pasukan Yuan membangun bukit, aku ingin maju melawan mereka, pasukan pemanah Shen Pei menghalangi kamu untuk masuk dari gerbang.",},
        [3358] = {5704,"","Cao Cao","Apa yang harus dilakukan?","Apa yang harus dilakukan?",},
        [3359] = {5704,"Cao Cao","Protagonis","Mengde, jangan khawatir!","Mengde, jangan khawatir!",},
        [3360] = {5704,"Cao Cao","Protagonis","Aku datang dari Jiangdong, untuk membantumu mengalahkan pasukan Yuan Shao!","Aku datang dari Jiangdong, untuk membantumu mengalahkan pasukan Yuan Shao!",},
        [3361] = {5704,"Protagonis","Cao Cao","Bagus, kami mengandalkanmu Jenderal Yangwei.","Bagus, kami mengandalkanmu Jenderal Yangwei.",},
        [3362] = {5705,"Protagonis","Cao Cao","Setelah melindungi Guandu dari Agustus hingga September, kekuatan militer melemah dan ransum mulai habis.","Setelah melindungi Guandu dari Agustus hingga September, kekuatan militer melemah dan ransum mulai habis.",},
        [3363] = {5705,"Protagonis","Cao Cao","Aku berpikir untuk menyerahkan Guandu, kembali ke Xuchang.","Aku berpikir untuk menyerahkan Guandu, kembali ke Xuchang.",},
        [3364] = {5705,"Cao Cao","Protagonis","Menurutku masih belum bisa kembali ke Xuchang, mengapa kamu tidak bertanya pendapat dari Xun Yu?","Menurutku masih belum bisa kembali ke Xuchang, mengapa kamu tidak bertanya pendapat dari Xun Yu?",},
        [3365] = {5705,"Protagonis","Cao Cao","Apa pendapatmu, Wenruo?","Apa pendapatmu, Wenruo?",},
        [3366] = {5705,"Cao Cao","Xun Yu","Aku merasa Yuan Shao mengumpulkan pasukannya di Guandu untuk berselisih denganmu. Sebagai pihak terlemah, kamu sedang menghadapi yang terkuat.","Aku merasa Yuan Shao mengumpulkan pasukannya di Guandu untuk berselisih denganmu. Sebagai pihak terlemah, kamu sedang menghadapi yang terkuat.",},
        [3367] = {5705,"Cao Cao","Xun Yu","Jika gagal mengalahkan lawan, mereka akan mendapatkan keuntungan: Ini adalah kesempatan bagus untuk mengambil dunia.","Jika gagal mengalahkan lawan, mereka akan mendapatkan keuntungan: Ini adalah kesempatan bagus untuk mengambil dunia.",},
        [3368] = {5705,"Cao Cao","Xun Yu","Namun, meskipun unggul dalam jumlah, Yuan Shao tidak tahu bagaimana memanfaatkan dengan baik anak buahnya; Sedangkan kamu sangat bijaksana dan banyak akal, bagaimana mungkin kamu tidak dapat mengalahkannya! Meskipun jumlah kita lebih sedikit, situasi ini masih lebih baik daripada apa yang pernah terjadi di Xingyang dan Chenggao, dalam pertarungan antara Chu dan Han.","Namun, meskipun unggul dalam jumlah, Yuan Shao tidak tahu bagaimana memanfaatkan dengan baik anak buahnya; Sedangkan kamu sangat bijaksana dan banyak akal, bagaimana mungkin kamu tidak dapat mengalahkannya! Meskipun jumlah kita lebih sedikit, situasi ini masih lebih baik daripada apa yang pernah terjadi di Xingyang dan Chenggao, dalam pertarungan antara Chu dan Han.",},
        [3369] = {5705,"Cao Cao","Xun Yu","Sekarang kamu menjaga titik strategis dan menghentikan mereka dari mengambil area vital, saat semangat mereka menurun, situasi akan berubah. Ini waktunya untuk mengambil resiko dan menjalankan rencana besar. Jangan sampai melewatkan kesempatan ini. Semoga kamu mengerti.","Sekarang kamu menjaga titik strategis dan menghentikan mereka dari mengambil area vital, saat semangat mereka menurun, situasi akan berubah. Ini waktunya untuk mengambil resiko dan menjalankan rencana besar. Jangan sampai melewatkan kesempatan ini. Semoga kamu mengerti.",},
        [3370] = {5705,"Xun Yu","Cao Cao","Akan kuperintahkan para prajurit untuk melindungi hingga akhir sekarang!","Akan kuperintahkan para prajurit untuk melindungi hingga akhir sekarang!",},
        [3371] = {5801,"Xun You","Cao Cao","Patroli berkata pasukan Shao mundur lebih dari 15 kilometer. Cepat atau lambat Han Meng jenderal besar akan mengirimkan ransum ke baris depan.","Patroli berkata pasukan Shao mundur lebih dari 15 kilometer. Cepat atau lambat Han Meng jenderal besar akan mengirimkan ransum ke baris depan.",},
        [3372] = {5801,"Cao Cao","Xun You","Han Meng sangat bodoh. Jika kamu mengirim seseorang untuk memimpin beberapa ribu kavaleri ringan untuk mencegat mereka di tengah jalan dan menghentikan jalur pasokan mereka, pasukan Shao akan terguncang.","Han Meng sangat bodoh. Jika kamu mengirim seseorang untuk memimpin beberapa ribu kavaleri ringan untuk mencegat mereka di tengah jalan dan menghentikan jalur pasokan mereka, pasukan Shao akan terguncang.",},
        [3373] = {5801,"Xun You","Cao Cao","Siapa yang akan pergi?","Siapa yang akan pergi?",},
        [3374] = {5801,"Cao Cao","Protagonis","Aku bersedia untuk pergi!","Aku bersedia untuk pergi!",},
        [3375] = {5801,"Protagonis","Cao Cao","Baik!","Baik!",},
        [3376] = {5802,"","Yuan Shao","Ransum telah dirampok, kita harus bagaimana?","Ransum telah dirampok, kita harus bagaimana?",},
        [3377] = {5802,"Yuan Shao","Shen Pei","Makanan dan pakan ternak adalah bagian penting dalam perang, harus dipersiapkan dengan baik. Wuchao adalah gudang untuk persediaan, pasti dijaga berat oleh tentara.","Makanan dan pakan ternak adalah bagian penting dalam perang, harus dipersiapkan dengan baik. Wuchao adalah gudang untuk persediaan, pasti dijaga berat oleh tentara.",},
        [3378] = {5802,"Shen Pei","Yuan Shao","Rencanaku telah ditentukan. Kamu bisa kembali ke Kota Ye untuk mengawasi ransum, pastikan tidak akan kekurangan.","Rencanaku telah ditentukan. Kamu bisa kembali ke Kota Ye untuk mengawasi ransum, pastikan tidak akan kekurangan.",},
        [3379] = {5802,"Shen Pei","Yuan Shao","Akan kuperintahkan Jenderal Besar Chunyu Qiong untuk memimpin 20.000 prajurit dan beberapa jenderal seperti Sui Yuanjin, Lu Weihuang, Zhao Rui dan laiinya untuk melindungi Wuchao.","Akan kuperintahkan Jenderal Besar Chunyu Qiong untuk memimpin 20.000 prajurit dan beberapa jenderal seperti Sui Yuanjin, Lu Weihuang, Zhao Rui dan laiinya untuk melindungi Wuchao.",},
        [3380] = {5803,"Yuan Shao","Xu You","Kita mendapatkan surat Cao Cao.","Kita mendapatkan surat Cao Cao.",},
        [3381] = {5803,"Yuan Shao","Xu You","Pasukan Cao Cao berjaga di Guandu dan kita telah memandang satu sama lain untuk waktu yang lama, Xuchang pasti tidak ada yang menjaga; Jika kita membagi prajurit kami untuk menyerang jarak jauh pada Xuchang semalam, kita akan mendapatkannya dan Cao Cao juga bisa ditangkap.","Pasukan Cao Cao berjaga di Guandu dan kita telah memandang satu sama lain untuk waktu yang lama, Xuchang pasti tidak ada yang menjaga; Jika kita membagi prajurit kami untuk menyerang jarak jauh pada Xuchang semalam, kita akan mendapatkannya dan Cao Cao juga bisa ditangkap.",},
        [3382] = {5803,"Yuan Shao","Xu You","Sekarang tentara Cao Cao telah kehabisan ransum, kita bisa gunakan kesempatan ini, membagi dua arah untuk menyerangnya.","Sekarang tentara Cao Cao telah kehabisan ransum, kita bisa gunakan kesempatan ini, membagi dua arah untuk menyerangnya.",},
        [3383] = {5803,"Xu You","Yuan Shao","Cao Cao penuh siasat, surat ini adalah tipuannya.","Cao Cao penuh siasat, surat ini adalah tipuannya.",},
        [3384] = {5803,"Yuan Shao","Xu You","Jika kamu tidak menyerang sekarang, akan ada konsekuensinya.","Jika kamu tidak menyerang sekarang, akan ada konsekuensinya.",},
        [3385] = {5803,"Xu You","Yuan Shao","Saat kamu di Jizhou, sering mengambil harta rakyat, dan membiarkan anak dan keponakananmu memungut pajak sesuka hati, uang dan makanan semua kamu telan sendiri.","Saat kamu di Jizhou, sering mengambil harta rakyat, dan membiarkan anak dan keponakananmu memungut pajak sesuka hati, uang dan makanan semua kamu telan sendiri.",},
        [3386] = {5803,"Xu You","Yuan Shao","Menteri korupsi! Beraninya memberikan saran di depanku sekarang!","Menteri korupsi! Beraninya memberikan saran di depanku sekarang!",},
        [3387] = {5803,"Xu You","Yuan Shao","Aku dan Cao Cao saling kenal, menurutku kamu telah menerima suapannya dan menjadi pengkhianat!","Aku dan Cao Cao saling kenal, menurutku kamu telah menerima suapannya dan menjadi pengkhianat!",},
        [3388] = {5803,"Xu You","Yuan Shao","Aku seharusnya memenggal kepalamu, sekarang aku akan membiarkan kepalamu tetap pada lehernya dulu! Cepatlah pergi, jangan muncul di hadapanku lagi!","Aku seharusnya memenggal kepalamu, sekarang aku akan membiarkan kepalamu tetap pada lehernya dulu! Cepatlah pergi, jangan muncul di hadapanku lagi!",},
        [3389] = {5803,"Yuan Shao","Xu You","Kebenaran tidak enak terdengar di telinga, aku tidak akan mengikutimu lagi!","Kebenaran tidak enak terdengar di telinga, aku tidak akan mengikutimu lagi!",},
        [3390] = {5804,"Xu You","Cao Cao","Mengapa kamu datang di tengah malam, teman lamaku?","Mengapa kamu datang di tengah malam, teman lamaku?",},
        [3391] = {5804,"Cao Cao","Xu You","Aku tidak bisa memilih siapa rajaku, dan harus menyerahkan diri kepada Yuan Shao, tetapi dia tidak pernah mendengarkan saranku, jadi aku meninggalkan dia dan datang untuk bergabung denganmu. Semoga kamu bisa menerima saya.","Aku tidak bisa memilih siapa rajaku, dan harus menyerahkan diri kepada Yuan Shao, tetapi dia tidak pernah mendengarkan saranku, jadi aku meninggalkan dia dan datang untuk bergabung denganmu. Semoga kamu bisa menerima saya.",},
        [3392] = {5804,"Xu You","Cao Cao","Jika kamu bersedia untuk ikut, aku pasti menang! Mohon beritahu aku rencana untuk mengalahkan Yuan Shao.","Jika kamu bersedia untuk ikut, aku pasti menang! Mohon beritahu aku rencana untuk mengalahkan Yuan Shao.",},
        [3393] = {5804,"Cao Cao","Xu You","Saat ini ransum masih ada berapa banyak?","Saat ini ransum masih ada berapa banyak?",},
        [3394] = {5804,"Xu You","Cao Cao","Cukup untuk satu tahun.","Cukup untuk satu tahun.",},
        [3395] = {5804,"Cao Cao","Xu You","Aku mengikutmu dengan tulus, tetapi kamu membohongiku, benar-benar mengecewakan!","Aku mengikutmu dengan tulus, tetapi kamu membohongiku, benar-benar mengecewakan!",},
        [3396] = {5804,"Cao Cao","Xu You","Jangan menutupinya! Ransum sudah habis!","Jangan menutupinya! Ransum sudah habis!",},
        [3397] = {5804,"Xu You","Cao Cao","Aku tidak bisa menyembunyikannya darimu. Karena kamu datang kemari untuk mengenang masa lalu, semoga kamu bisa membantuku.","Aku tidak bisa menyembunyikannya darimu. Karena kamu datang kemari untuk mengenang masa lalu, semoga kamu bisa membantuku.",},
        [3398] = {5804,"Cao Cao","Xu You","Aku memiliki rencana yang dapat membuat 1.000.000 prajurit Yuan Shao tumbang sendirinya dalam tiga hari. Apakah kamu ingin mendengarkannya?","Aku memiliki rencana yang dapat membuat 1.000.000 prajurit Yuan Shao tumbang sendirinya dalam tiga hari. Apakah kamu ingin mendengarkannya?",},
        [3399] = {5804,"Xu You","Cao Cao","Katakan.","Katakan.",},
        [3400] = {5804,"Cao Cao","Xu You","Ransum dan persediaan Yuan Shao telah disimpan di Wuchao, saat ini dijaga oleh Chunyu Qiong yang sangat menyukai arak.","Ransum dan persediaan Yuan Shao telah disimpan di Wuchao, saat ini dijaga oleh Chunyu Qiong yang sangat menyukai arak.",},
        [3401] = {5804,"Cao Cao","Xu You","Kamu bisa mengumpulkan pasukan elit untuk menyamar sebagai jenderal Yuan, Jiang Qi yang bertanggung jawab menerima ransum. Sementara mereka berada di sana, bakar ransum dan persediaan. Pasukan Shao akan runtuh dengan sendirinya dalam 3 hari.","Kamu bisa mengumpulkan pasukan elit untuk menyamar sebagai jenderal Yuan, Jiang Qi yang bertanggung jawab menerima ransum. Sementara mereka berada di sana, bakar ransum dan persediaan. Pasukan Shao akan runtuh dengan sendirinya dalam 3 hari.",},
        [3402] = {5805,"Cao Cao","Zhang Liao","Gudang ransum Yuan Shao, bagaimana mungkin tidak dilindungi? Perdana Menteri jangan mengirimkan prajurit dengan mudah, Xu You mungkin menipumu.","Gudang ransum Yuan Shao, bagaimana mungkin tidak dilindungi? Perdana Menteri jangan mengirimkan prajurit dengan mudah, Xu You mungkin menipumu.",},
        [3403] = {5805,"Zhang Liao","Cao Cao","Bukan begini, kedatangan Xu You merupakan deklarasi kekalahan Yuan Shao.","Bukan begini, kedatangan Xu You merupakan deklarasi kekalahan Yuan Shao.",},
        [3404] = {5805,"Zhang Liao","Cao Cao","Kami menghadapi kekurangan randum saat ini, sangat susah untuk menjaganya untuk waktu yang panjang. Jika bukan karena rencana Xu You dan aku hanya bisa duduk terperangkap disini.","Kami menghadapi kekurangan randum saat ini, sangat susah untuk menjaganya untuk waktu yang panjang. Jika bukan karena rencana Xu You dan aku hanya bisa duduk terperangkap disini.",},
        [3405] = {5805,"Zhang Liao","Cao Cao","Jika dia telah menipuku, mengapa dia masih di kamp kami? Dan aku sudah lama mencoba merampok gudang Shao. Sekrang merampok ransum adalah hal yang sangat penting, janganlah curiga lagi.","Jika dia telah menipuku, mengapa dia masih di kamp kami? Dan aku sudah lama mencoba merampok gudang Shao. Sekrang merampok ransum adalah hal yang sangat penting, janganlah curiga lagi.",},
        [3406] = {5805,"Cao Cao","Zhang Liao","Dan kita harus bersiaga melawan serangan Yuan Shao.","Dan kita harus bersiaga melawan serangan Yuan Shao.",},
        [3407] = {5805,"Zhang Liao","Cao Cao","Aku telah mengaturnya.","Aku telah mengaturnya.",},
        [3408] = {5805,"Zhang Liao","Cao Cao","Xun You, Jia Xu, dan Cao Hong akan berjaga di kamp bersama Xu You.","Xun You, Jia Xu, dan Cao Hong akan berjaga di kamp bersama Xu You.",},
        [3409] = {5805,"Zhang Liao","Cao Cao","Xiahou Dun dan Xiahou Yuan akan memimpin prajurit dan menyergap di kirim Cao Ren dan Li Dian kaan memimpin prajurit dan menyerang di kanan, untuk berjaga-jaga.","Xiahou Dun dan Xiahou Yuan akan memimpin prajurit dan menyergap di kirim Cao Ren dan Li Dian kaan memimpin prajurit dan menyerang di kanan, untuk berjaga-jaga.",},
        [3410] = {5805,"Zhang Liao","Cao Cao","Zhang Liao dan Xu Chu berada di depan, Xu Huang dan Yu Jin akan mengikut dari belakang, aku dan Jenderal Yangwei di tengah: Total lima ribu prajurit.","Zhang Liao dan Xu Chu berada di depan, Xu Huang dan Yu Jin akan mengikut dari belakang, aku dan Jenderal Yangwei di tengah: Total lima ribu prajurit.",},
        [3411] = {5805,"Zhang Liao","Cao Cao","Mengelola panji-panji Yuan, para prajurit akan membawa ransum dan makanan ternak, memegang tongkat di mulut mereka dan menahan semua mulut kuda mereka. Saat menjelang senja kami berbaris melawan Wuchao.","Mengelola panji-panji Yuan, para prajurit akan membawa ransum dan makanan ternak, memegang tongkat di mulut mereka dan menahan semua mulut kuda mereka. Saat menjelang senja kami berbaris melawan Wuchao.",},
        [3412] = {5806,"","Yuan Shao","Ada keributan apa?","Ada keributan apa?",},
        [3413] = {5806,"Yuan Shao","Zhang He","Cao Cao menyerang pada malam hari dan membakar Wuchao!","Cao Cao menyerang pada malam hari dan membakar Wuchao!",},
        [3414] = {5806,"Zhang He","Yuan Shao","Apa!","Apa!",},
        [3415] = {5901,"","Zhang He","Aku bersedia pergi dengan Gao Lan untuk menyelamatkan Wuchao.","Aku bersedia pergi dengan Gao Lan untuk menyelamatkan Wuchao.",},
        [3416] = {5901,"Zhang He","Guo Tu","Tidak bisa! Pasukan Cao menyerang gudang ransum, dia pasti juga pergi bertarung, karena itu kampnya pasti tidak ada yang menjaga.","Tidak bisa! Pasukan Cao menyerang gudang ransum, dia pasti juga pergi bertarung, karena itu kampnya pasti tidak ada yang menjaga.",},
        [3417] = {5901,"Zhang He","Guo Tu","Kita bisa menyerang kamp Cao Cao dulu, dia akan kembali dalam waktu singkat. Ini seperti strategi Kepung Wei untuk menyelamatkan Zhao.","Kita bisa menyerang kamp Cao Cao dulu, dia akan kembali dalam waktu singkat. Ini seperti strategi Kepung Wei untuk menyelamatkan Zhao.",},
        [3418] = {5901,"Guo Tu","Zhang He","Menurutku bukan seperti itu! Cao Cao penuh dengan siasat. Dia pasti telah mempersiapkan semuanya dengan baik sebelum berangkat.","Menurutku bukan seperti itu! Cao Cao penuh dengan siasat. Dia pasti telah mempersiapkan semuanya dengan baik sebelum berangkat.",},
        [3419] = {5901,"Guo Tu","Zhang He","Jika kita tidak bisa kabur dari kamp Cao Cao, karena Qiong telah ditangkap, maka kita juga akan ditangkap.","Jika kita tidak bisa kabur dari kamp Cao Cao, karena Qiong telah ditangkap, maka kita juga akan ditangkap.",},
        [3420] = {5901,"Zhang He","Guo Tu","Cao Cao hanya berpikir untuk menjarah gandum, dia tidak akan meninggalkan prajurit di sana!","Cao Cao hanya berpikir untuk menjarah gandum, dia tidak akan meninggalkan prajurit di sana!",},
        [3421] = {5901,"Guo Tu","Yuan Shao","Berhenti berdebat. Zhang He, Gao Lan, kalian berdua pimpin 5.000 prajurit untuk menyerang kamp Cao CaO di Guandu. Jiang Qi, pimpin 10.000 prajurit untuk menyelamatkan Wuchao.","Berhenti berdebat. Zhang He, Gao Lan, kalian berdua pimpin 5.000 prajurit untuk menyerang kamp Cao CaO di Guandu. Jiang Qi, pimpin 10.000 prajurit untuk menyelamatkan Wuchao.",},
        [3422] = {5902,"Guo Tu","Yuan Shao","Mengapa Wuchao gugur? Sudah diperiksa dengan baik?","Mengapa Wuchao gugur? Sudah diperiksa dengan baik?",},
        [3423] = {5902,"Yuan Shao","Guo Tu","Chunyu Qiong mabuk, karena itu tidak bisa melawan musuh.","Chunyu Qiong mabuk, karena itu tidak bisa melawan musuh.",},
        [3424] = {5902,"Guo Tu","Yuan Shao","Zhang He dan Gao Lan yang menyerang diam-diam ke kamp Cao Cao mengapa masih belum kembali?","Zhang He dan Gao Lan yang menyerang diam-diam ke kamp Cao Cao mengapa masih belum kembali?",},
        [3425] = {5902,"Yuan Shao","Guo Tu","Zhang He dan Gao Lan akan sangat senang setelah mengetahui kegagalanmu. (Guo Tu berkata dengan jahat)","Zhang He dan Gao Lan akan sangat senang setelah mengetahui kegagalanmu. (Guo Tu berkata dengan jahat)",},
        [3426] = {5902,"Guo Tu","Yuan Shao","Mengapa berkata seperti ini?","Mengapa berkata seperti ini?",},
        [3427] = {5902,"Yuan Shao","Guo Tu","Mereka sudah lama ingin menyerah kepada Cao Cao. Selama serangan hari ini, mereka menarik pukulan mereka dan menyebabkan banyak korban di pihak kami.","Mereka sudah lama ingin menyerah kepada Cao Cao. Selama serangan hari ini, mereka menarik pukulan mereka dan menyebabkan banyak korban di pihak kami.",},
        [3428] = {5902,"Guo Tu","Yuan Shao","Apa! Bawa Zhang He dan Gao Lan kembali sekarang!","Apa! Bawa Zhang He dan Gao Lan kembali sekarang!",},
        [3429] = {5903,"Zhang He","Gao Lan","Guo Tu sangat jahat.","Guo Tu sangat jahat.",},
        [3430] = {5903,"Zhang He","Gao Lan","Setelah percaya omong kosongnya, Yuan Shao pasti akan ditangkap oleh Cao Cao. Kita tidak bisa hanya duduk di sini dan menunggu untuk mati! Lebih baik kita bergabung dengan Cao Cao.","Setelah percaya omong kosongnya, Yuan Shao pasti akan ditangkap oleh Cao Cao. Kita tidak bisa hanya duduk di sini dan menunggu untuk mati! Lebih baik kita bergabung dengan Cao Cao.",},
        [3431] = {5903,"Gao Lan","Zhang He","Aku juga telah lama memikirkan tentang hal itu.","Aku juga telah lama memikirkan tentang hal itu.",},
        [3432] = {5904,"Cao Cao","Xiahou Dun","Zhang He dan Gao Lan datang untuk menyerah. Tidak tahu apakah ini tipuan.","Zhang He dan Gao Lan datang untuk menyerah. Tidak tahu apakah ini tipuan.",},
        [3433] = {5904,"Xiahou Dun","Cao Cao","Aku akan membalas kebaikannya, meskipun begitu, tetapi itu bisa berubah.","Aku akan membalas kebaikannya, meskipun begitu, tetapi itu bisa berubah.",},
        [3434] = {5904,"Xiahou Dun","Cao Cao","Buka gerbang kamp dan izinkan mereka berdua masuk.","Buka gerbang kamp dan izinkan mereka berdua masuk.",},
        [3435] = {5905,"Cao Cao","Zhang He","Yuan Shao sangat bodoh, kami ingin bergabung dengan Perdana Menteri.","Yuan Shao sangat bodoh, kami ingin bergabung dengan Perdana Menteri.",},
        [3436] = {5905,"Zhang He","Cao Cao","Jika Yuan Shao mendengar perkataanmu, dia tidak akan kalah seperti ini.","Jika Yuan Shao mendengar perkataanmu, dia tidak akan kalah seperti ini.",},
        [3437] = {5905,"Zhang He","Cao Cao","Kedua jenderal ini bergabung, sama seperti Raja Wu dai Zhou dan Han Xin bergabung dengan Han.","Kedua jenderal ini bergabung, sama seperti Raja Wu dai Zhou dan Han Xin bergabung dengan Han.",},
        [3438] = {5905,"Zhang He","Cao Cao","Senang sekali!","Senang sekali!",},
        [3439] = {6001,"Cao Cao","Protagonis","Kegagalan di Guandu, Yuan Shao tidak menerimanya!","Kegagalan di Guandu, Yuan Shao tidak menerimanya!",},
        [3440] = {6001,"Cao Cao","Protagonis","Dia menyatukan prajurit empat prefektur, mendapatkan 200 hingga 300 ribu, membuat kamp di depan Cangting.","Dia menyatukan prajurit empat prefektur, mendapatkan 200 hingga 300 ribu, membuat kamp di depan Cangting.",},
        [3441] = {6001,"Protagonis","Cao Cao","Perintahkan seluruh prajurit pergi ke Cangting.","Perintahkan seluruh prajurit pergi ke Cangting.",},
        [3442] = {6002,"","Cao Cao","Prajurit Yuan Shao sangat banyak dan kuat, pada pertarungan pertama Yuan Shang mengalahkan jenderal kami Shi Huan dalam tiga ronde.","Prajurit Yuan Shao sangat banyak dan kuat, pada pertarungan pertama Yuan Shang mengalahkan jenderal kami Shi Huan dalam tiga ronde.",},
        [3443] = {6002,"","Cao Cao","Apa ada yang memiliki rencana?","Apa ada yang memiliki rencana?",},
        [3444] = {6002,"Cao Cao","Cheng Yu","Aku memiliki rencana untuk mengalahkan Yuan Shao, bernama Penyergapan Semua Sisi.","Aku memiliki rencana untuk mengalahkan Yuan Shao, bernama Penyergapan Semua Sisi.",},
        [3445] = {6002,"Cheng Yu","Cao Cao","Apa yang dimaksud dengan Penyergapan Semua Sisi?","Apa yang dimaksud dengan Penyergapan Semua Sisi?",},
        [3446] = {6002,"Cao Cao","Cheng Yu","Mundurkan pasukan ke sungai, sergap dengan 10 regu.","Mundurkan pasukan ke sungai, sergap dengan 10 regu.",},
        [3447] = {6002,"Cao Cao","Cheng Yu","Pemimpin dari lima unit di kiri adalah Xiahou Dun, Zhang Liao, Li Dian, Yue Jin dan Xiahou Yuan.","Pemimpin dari lima unit di kiri adalah Xiahou Dun, Zhang Liao, Li Dian, Yue Jin dan Xiahou Yuan.",},
        [3448] = {6002,"Cao Cao","Cheng Yu","Pemimpin dari lima unit di kanan adalah Cao Hong, Zhang he, Xu Huang, Yu Jin dan Gao Lan.","Pemimpin dari lima unit di kanan adalah Cao Hong, Zhang he, Xu Huang, Yu Jin dan Gao Lan.",},
        [3449] = {6002,"Cao Cao","Cheng Yu","Keesokan harinya, Xu Chu dan Jenderal Yangwei berada di tengah barisan depan. Mereka akan membuat serangan tipuan untuk menyerang kamp Shao dan memancing Yuan Shao ke utara Sungai Kuning.","Keesokan harinya, Xu Chu dan Jenderal Yangwei berada di tengah barisan depan. Mereka akan membuat serangan tipuan untuk menyerang kamp Shao dan memancing Yuan Shao ke utara Sungai Kuning.",},
        [3450] = {6002,"Cao Cao","Cheng Yu","Lawan kembali dan bekerja sama dengan pasukan yang menyergap. Yuan Shao pasti dapat dikalahkan.","Lawan kembali dan bekerja sama dengan pasukan yang menyergap. Yuan Shao pasti dapat dikalahkan.",},
        [3451] = {6002,"Cheng Yu","Protagonis","Rencana Penyergapan Semua Sisi Zhongde sangat hebat!","Rencana Penyergapan Semua Sisi Zhongde sangat hebat!",},
        [3452] = {6002,"Protagonis","Cao Cao","Baik, lakukan sesuai rencana.","Baik, lakukan sesuai rencana.",},
        [3453] = {6101,"Cheng Yu","Cao Cao","Kita telah memenangkan pertarungan Cangting. Mendengar perkataanmu, setelah lebih dari setahun menyimpan tenaga, ini adalah kesempatan untuk mengirimkan prajurit dan menyerang Shao.","Kita telah memenangkan pertarungan Cangting. Mendengar perkataanmu, setelah lebih dari setahun menyimpan tenaga, ini adalah kesempatan untuk mengirimkan prajurit dan menyerang Shao.",},
        [3454] = {6101,"Cheng Yu","Cao Cao","Xiahou Dun dan Man Chong akan melindungi Runan dari Liu Biao; Cao Ren dan Xun Yu akan tinggal dan melindungi Xuchang. Aku akan memimpin tentara untuk berjaga di Guandu sendiri sekali lagi.","Xiahou Dun dan Man Chong akan melindungi Runan dari Liu Biao; Cao Ren dan Xun Yu akan tinggal dan melindungi Xuchang. Aku akan memimpin tentara untuk berjaga di Guandu sendiri sekali lagi.",},
        [3455] = {6101,"Cao Cao","Cheng Yu","Kalahkan Yuan Shao dan ambil sembilan prefektur, kita dapat menyatukan utara dan selatan.","Kalahkan Yuan Shao dan ambil sembilan prefektur, kita dapat menyatukan utara dan selatan.",},
        [3456] = {6102,"Shen Pei","Yuan Shao","Sudah lebih dari setahun, aku berpikir untuk menyerang Xuchang.","Sudah lebih dari setahun, aku berpikir untuk menyerang Xuchang.",},
        [3457] = {6102,"Yuan Shao","Shen Pei","Kekalahan di Guandu dan Cangting tahun lalu membuat moral berkurang, saat ini masih belum kembali, kita harus berlindung dulu dan memulihkan kekuatan perang.","Kekalahan di Guandu dan Cangting tahun lalu membuat moral berkurang, saat ini masih belum kembali, kita harus berlindung dulu dan memulihkan kekuatan perang.",},
        [3458] = {6102,"Yuan Shao","Guo Tu","Lapor! Tentara Cao Cao memasuki Guandu, dan menyerang Jizhou.","Lapor! Tentara Cao Cao memasuki Guandu, dan menyerang Jizhou.",},
        [3459] = {6102,"Guo Tu","Yuan Shao","Jika kita hanya mencoba untuk mengusir mereka setelah mereka mencapai gerbang kota, itu sudah terlambat. Aku akan keluar dan melawan mereka sendiri.","Jika kita hanya mencoba untuk mengusir mereka setelah mereka mencapai gerbang kota, itu sudah terlambat. Aku akan keluar dan melawan mereka sendiri.",},
        [3460] = {6102,"Yuan Shao","Yuan Shang","Ayah penyakitmu belum sembuh, tidak bisa melakukan perjalanan jauh. Aku akan membawa prajurit dan melawan mereka.","Ayah penyakitmu belum sembuh, tidak bisa melakukan perjalanan jauh. Aku akan membawa prajurit dan melawan mereka.",},
        [3461] = {6102,"Yuan Shang","Yuan Shao","Baik!","Baik!",},
        [3462] = {6102,"Yuan Shang","Yuan Shao","Panggil Yuan Tan dari Qingzhou, Yuan Xi dari Youzhou dan Gao Gan dari Bingzhou, lalu serang Cao Cao dari empat arah pada waktu bersamaan.","Panggil Yuan Tan dari Qingzhou, Yuan Xi dari Youzhou dan Gao Gan dari Bingzhou, lalu serang Cao Cao dari empat arah pada waktu bersamaan.",},
        [3463] = {6103,"","Yuan Shang","Pasukan Cao tidak lebih baik dari ini.","Pasukan Cao tidak lebih baik dari ini.",},
        [3464] = {6103,"","Yuan Shang","Aku membunuh Shi Huan dengan mudah, siapa dari kalian yang berani menantangku?","Aku membunuh Shi Huan dengan mudah, siapa dari kalian yang berani menantangku?",},
        [3465] = {6103,"Yuan Shang","Zhang Liao","Takutnya kamu tidak berhasil, aku akan pergi bertarung!","Takutnya kamu tidak berhasil, aku akan pergi bertarung!",},
        [3466] = {6103,"Zhang Liao","Protagonis","Tidak perlu turun tangan, biarkan aku melawannya!","Tidak perlu turun tangan, biarkan aku melawannya!",},
        [3467] = {6104,"","Protagonis","Yuan Shang jenderal gagal, lari kemana!","Yuan Shang jenderal gagal, lari kemana!",},
        [3468] = {6104,"Protagonis","Zhang Liao","Hahahahaha.","Hahahahaha.",},
        [3469] = {6104,"Protagonis","Zhang Liao","Jenderal Yangwei jangan kejar. Tentara Yuan telah dikalahkan, biarkan Yuan Shang lari ke Jizhou dengan buntutnya di antara kakinya.","Jenderal Yangwei jangan kejar. Tentara Yuan telah dikalahkan, biarkan Yuan Shang lari ke Jizhou dengan buntutnya di antara kakinya.",},
        [3470] = {6105,"Yuan Shao","Shen Pei","Yuan Shang setelah membunuh Shi Huan sendiri, menjadi sangat sombong, tanpa menunggu bantuan dari Yuan Tan, pergi sendiri dengan puluhan ribu prajurit menuju Liyang dan melawan pasukan garis depan Cao Cao.","Yuan Shang setelah membunuh Shi Huan sendiri, menjadi sangat sombong, tanpa menunggu bantuan dari Yuan Tan, pergi sendiri dengan puluhan ribu prajurit menuju Liyang dan melawan pasukan garis depan Cao Cao.",},
        [3471] = {6105,"Yuan Shao","Shen Pei","Dia kalah total dalam tiga ronde dan pergi, telah membawa prajuritnya lari kembali ke Jizhou.","Dia kalah total dalam tiga ronde dan pergi, telah membawa prajuritnya lari kembali ke Jizhou.",},
        [3472] = {6105,"Shen Pei","Yuan Shao","Apa! (Yuan Shao terkejut saat mendengar laporan ini. Penyakit lamanya kambuh dan menyebabkan dia muntah banyak darah sebelum jatuh dan pingsan.)","Apa! (Yuan Shao terkejut saat mendengar laporan ini. Penyakit lamanya kambuh dan menyebabkan dia muntah banyak darah sebelum jatuh dan pingsan.)",},
        [3473] = {6105,"Yuan Shao","Nyonya Liu","Bawa Benchu kembali ke kamar, cepat!","Bawa Benchu kembali ke kamar, cepat!",},
        [3474] = {6106,"Yuan Shao","Nyonya Liu","Masih bisakah menamakan penerusnya?","Masih bisakah menamakan penerusnya?",},
        [3475] = {6106,"Nyonya Liu","Yuan Shao","Bisa…","Bisa…",},
        [3476] = {6106,"Yuan Shao","Shen Pei","Aku akan membantumu membuatkan wasiat.","Aku akan membantumu membuatkan wasiat.",},
        [3477] = {6106,"Yuan Shao","Nyonya Liu","Benchu! (Yuan Shao berbalik dan berteriak, memuntahkan darah dan mati.)","Benchu! (Yuan Shao berbalik dan berteriak, memuntahkan darah dan mati.)",},
        [3478] = {6201,"Sima Yi","Zhang Chunhua","Cao Cao telah mendengar tentang kemampuanmu, secara khusus mengirimkan orang ke kediaman kami memberikan jabatan di istana.","Cao Cao telah mendengar tentang kemampuanmu, secara khusus mengirimkan orang ke kediaman kami memberikan jabatan di istana.",},
        [3479] = {6201,"Zhang Chunhua","Sima Yi","Pemerintahan Han telah dikendalikan oleh Cao Cao, dan keluarga Cao adalah keturunan kasim.","Pemerintahan Han telah dikendalikan oleh Cao Cao, dan keluarga Cao adalah keturunan kasim.",},
        [3480] = {6201,"Zhang Chunhua","Sima Yi","Aku tidak ingin turun untuk menerima tawarannya, jadi aku beralasan bahwa aku sedang menderita asam urat dan tidak bisa mengurus diri sendiri.","Aku tidak ingin turun untuk menerima tawarannya, jadi aku beralasan bahwa aku sedang menderita asam urat dan tidak bisa mengurus diri sendiri.",},
        [3481] = {6201,"Zhang Chunhua","Sima Yi","Dan aku mengusir utusan itu.","Dan aku mengusir utusan itu.",},
        [3482] = {6201,"Sima Yi","Zhang Chunhua","Baik.","Baik.",},
        [3483] = {6202,"Sima Yi","Zhang Chunhua","Tidak baik, Zhongda!","Tidak baik, Zhongda!",},
        [3484] = {6202,"Sima Yi","Zhang Chunhua","Cao Cao tidak percaya kamu terkena asam urat dan mengirim utusan kemari lagi pada malam hari. ","Cao Cao tidak percaya kamu terkena asam urat dan mengirim utusan kemari lagi pada malam hari. ",},
        [3485] = {6202,"Zhang Chunhua","Sima Yi","Jangan panik, pergilah ke aula untuk menghentikannya, aku akan kembali ke kamar dan berbaring.","Jangan panik, pergilah ke aula untuk menghentikannya, aku akan kembali ke kamar dan berbaring.",},
        [3486] = {6202,"Zhang Chunhua","Sima Yi","Aku tidak akan bergerak sedikitpun, bairkan utusan melihat dan merasakan penyakitku.","Aku tidak akan bergerak sedikitpun, bairkan utusan melihat dan merasakan penyakitku.",},
        [3487] = {6202,"Sima Yi","Zhang Chunhua","Baik.","Baik.",},
        [3488] = {6301,"Cao Cao","Sun Quan","Aku memiliki seekor gajah raksasa, akan kuberikan padamu sebagai hadiah.","Aku memiliki seekor gajah raksasa, akan kuberikan padamu sebagai hadiah.",},
        [3489] = {6301,"Cao Cao","Sun Quan","Sebagai niat baikku.","Sebagai niat baikku.",},
        [3490] = {6301,"Sun Quan","Cao Cao","Terima kasih atas kebaikanmu.","Terima kasih atas kebaikanmu.",},
        [3491] = {6301,"Cao Cao","Sun Quan","Oh ya, maafkan aku karena tidak tahu dengan beratnya. Mengde, aku mendengar kamu memiliki banyak penasihat hebat.","Oh ya, maafkan aku karena tidak tahu dengan beratnya. Mengde, aku mendengar kamu memiliki banyak penasihat hebat.",},
        [3492] = {6301,"Cao Cao","Sun Quan","Jika dia dapat menimbangnya, pastikan untuk memberitahu aku.","Jika dia dapat menimbangnya, pastikan untuk memberitahu aku.",},
        [3493] = {6301,"Sun Quan","Cao Cao","Pasti. Pasti…","Pasti. Pasti…",},
        [3494] = {6302,"","Cao Cao","Sun Quan berpura-pura mengirimkan gajah, sebenarnya ingin mempermalukanku.","Sun Quan berpura-pura mengirimkan gajah, sebenarnya ingin mempermalukanku.",},
        [3495] = {6302,"","Cao Cao","Jika aku tidak bisa menimbang gajahnya, mau ditaruh mana mukaku.","Jika aku tidak bisa menimbang gajahnya, mau ditaruh mana mukaku.",},
        [3496] = {6302,"","Cao Cao","Kalian cepatlah bantu aku memikirkan cara.","Kalian cepatlah bantu aku memikirkan cara.",},
        [3497] = {6302,"Cao Cao","Xiahou Dun","Kamu hanya butuh untuk membangun timbangan yang cukup besar.","Kamu hanya butuh untuk membangun timbangan yang cukup besar.",},
        [3498] = {6302,"Cao Cao","Zhang Liao","Seberapa besar yang harus dibangun! Dan lagi gajah ini adalah makhluk hidup, bagaimana membuatnya tetap tenang saat ditimbang!","Seberapa besar yang harus dibangun! Dan lagi gajah ini adalah makhluk hidup, bagaimana membuatnya tetap tenang saat ditimbang!",},
        [3499] = {6302,"Cao Cao","Zhang Liao","Menurutku hanya dengan membunuhnya, lalu memotongnya kecil-kecil dan ditimbang.","Menurutku hanya dengan membunuhnya, lalu memotongnya kecil-kecil dan ditimbang.",},
        [3500] = {6302,"Zhang Liao","Cao Cao","Idiot!","Idiot!",},
        [3501] = {6302,"Zhang Liao","Cao Cao","Caramu ini tidak baik, hanya untuk menimbang berat maka kamu membunuh gajah yang hidup, sangat disayangkan bukan?","Caramu ini tidak baik, hanya untuk menimbang berat maka kamu membunuh gajah yang hidup, sangat disayangkan bukan?",},
        [3502] = {6303,"","Cao Cao","Yang lainnya?","Yang lainnya?",},
        [3503] = {6303,"Cao Cao","Cao Chong","Aku memiliki cara untuk menimbang gajahnya.","Aku memiliki cara untuk menimbang gajahnya.",},
        [3504] = {6303,"Cao Chong","Cao Cao","Bagaimana?","Bagaimana?",},
        [3505] = {6303,"Cao Cao","Cao Chong","Ini tidak susah, masukkan gajah besar di kapal besar, tandai dimana permukaan air berada.","Ini tidak susah, masukkan gajah besar di kapal besar, tandai dimana permukaan air berada.",},
        [3506] = {6303,"Cao Cao","Cao Chong","Isi ulang kapal dengan barang berat hingga air mencapai garisnya.","Isi ulang kapal dengan barang berat hingga air mencapai garisnya.",},
        [3507] = {6303,"Cao Cao","Cao Chong","Terakhir, timbang barang berat ini, maka akan mengetahui berat gajah raksasa.","Terakhir, timbang barang berat ini, maka akan mengetahui berat gajah raksasa.",},
        [3508] = {6303,"Cao Chong","Cao Cao","Hahahaha, memang anakku pintar.","Hahahaha, memang anakku pintar.",},
        [3509] = {6303,"Cao Chong","Cao Cao","Hahahaha.","Hahahaha.",},
        [3510] = {6401,"Guo Jia","Cao Cao","Tentara telah tiba di Jizhou, tetapi Yuan Tan dan Yuan Shang bertahan di dalam kota, sementara Yuan Xi dan Gao Gan mendirikan kamp-kamp mereka 15 km jauhnya, sudah berhari-hari kami masih belum bisa mengalahkannya.","Tentara telah tiba di Jizhou, tetapi Yuan Tan dan Yuan Shang bertahan di dalam kota, sementara Yuan Xi dan Gao Gan mendirikan kamp-kamp mereka 15 km jauhnya, sudah berhari-hari kami masih belum bisa mengalahkannya.",},
        [3511] = {6401,"Guo Jia","Cao Cao","Apa yang harus dilakukan?","Apa yang harus dilakukan?",},
        [3512] = {6401,"Cao Cao","Guo Jia","Keluarga Yuan menjadikan yang termuda sebagai pengganti, bukan putra-putranya yang lebih tua. Mereka bersatu ketika dalam bahaya, tetapi konflik terjadi antara pihak-pihak yang damai.","Keluarga Yuan menjadikan yang termuda sebagai pengganti, bukan putra-putranya yang lebih tua. Mereka bersatu ketika dalam bahaya, tetapi konflik terjadi antara pihak-pihak yang damai.",},
        [3513] = {6401,"Cao Cao","Guo Jia","Akan lebih baik untuk mengirim pasukan ke selatan ke Jingzhou dan menekan Liu Biao sementara kita menunggu pergulatan batin terjadi antara saudara-saudara Yuan. Lalu kita bisa menghadapi serangan terakhir.","Akan lebih baik untuk mengirim pasukan ke selatan ke Jingzhou dan menekan Liu Biao sementara kita menunggu pergulatan batin terjadi antara saudara-saudara Yuan. Lalu kita bisa menghadapi serangan terakhir.",},
        [3514] = {6401,"Guo Jia","Cao Cao","Perkataan Fengxiao sangat tepat!","Perkataan Fengxiao sangat tepat!",},
        [3515] = {6401,"Guo Jia","Cao Cao","Perintahkan Jia Xu menjadi Pemimpin Prefektur dan melindungi Liyang, Cao Hong akan memimpin tentara untuk melindungi Guandu. Aku akan memimpin tentara untuk maju menyerang Jingzhou.","Perintahkan Jia Xu menjadi Pemimpin Prefektur dan melindungi Liyang, Cao Hong akan memimpin tentara untuk melindungi Guandu. Aku akan memimpin tentara untuk maju menyerang Jingzhou.",},
        [3516] = {6402,"Guo Tu","Yuan Tan","Aku sebagai putra sulung, tidak bisa menuruskan usaha ayahku; Sedangkan Shang yang lahir dari ibu tiri, mendapatkan semuanya, hatiku sungguh tidak rela.","Aku sebagai putra sulung, tidak bisa menuruskan usaha ayahku; Sedangkan Shang yang lahir dari ibu tiri, mendapatkan semuanya, hatiku sungguh tidak rela.",},
        [3517] = {6402,"Yuan Tan","Guo Tu","Kamu dapat menempatkan pasukan di luar kota dan mengundang Xian Pu dan Shen Pei untuk minum, sementara pasukan kapak menyergapnya, ini pasti berhasil.","Kamu dapat menempatkan pasukan di luar kota dan mengundang Xian Pu dan Shen Pei untuk minum, sementara pasukan kapak menyergapnya, ini pasti berhasil.",},
        [3518] = {6403,"Yuan Shang","Shen Pei","Yuan Tan mengundangmu untuk bertemu sendiri, ini pasti siasat Guo Tu. Jika kamu pergi, maka akan jatuh dalam perangkapnya. Lebih baik gunakan kesempatan ini untuk menyerang.","Yuan Tan mengundangmu untuk bertemu sendiri, ini pasti siasat Guo Tu. Jika kamu pergi, maka akan jatuh dalam perangkapnya. Lebih baik gunakan kesempatan ini untuk menyerang.",},
        [3519] = {6403,"Shen Pei","Yuan Shang","Aku akan membawa prajurit pergi! (Yuan Shang membawa 50 ribu keluar kota.)","Aku akan membawa prajurit pergi! (Yuan Shang membawa 50 ribu keluar kota.)",},
        [3520] = {6403,"Yuan Shang","Yuan Tan","Mengapa kamu datang membawa prajurit?","Mengapa kamu datang membawa prajurit?",},
        [3521] = {6403,"Yuan Tan","Yuan Shang","Yuan Shao membuatku menjadi penerus, apakah kamu ingin memberontak?","Yuan Shao membuatku menjadi penerus, apakah kamu ingin memberontak?",},
        [3522] = {6403,"Yuan Shang","Yuan Tan","Kamu membunuh ayahku dengan racun, merebut posisinya dan sekarang membunuh saudaramu sendiri!","Kamu membunuh ayahku dengan racun, merebut posisinya dan sekarang membunuh saudaramu sendiri!",},
        [3523] = {6404,"Cao Cao","Guo Jia","Yuan Tan bersama dengan Lu Kuang dan Lu Xiang telah menyerah.","Yuan Tan bersama dengan Lu Kuang dan Lu Xiang telah menyerah.",},
        [3524] = {6404,"Guo Jia","Cao Cao","Aku telah menduganya.","Aku telah menduganya.",},
        [3525] = {6404,"Guo Jia","Cao Cao","Namun, Yuan Tan mengukir dua Stempel Jenderal, dan memberikannya kepada dua jenderal, mencoba untuk memberontak di masa depan.","Namun, Yuan Tan mengukir dua Stempel Jenderal, dan memberikannya kepada dua jenderal, mencoba untuk memberontak di masa depan.",},
        [3526] = {6404,"Guo Jia","Cao Cao","Dia tidak tahu bahwa mereka telah melaporkannya kepadaku. Setelah mengalahkan Yuan Shang, aku akan membunuh Yuan Tan.","Dia tidak tahu bahwa mereka telah melaporkannya kepadaku. Setelah mengalahkan Yuan Shang, aku akan membunuh Yuan Tan.",},
        [3527] = {6404,"Cao Cao","Guo Jia","Perdana Menteri sangat bijaksana.","Perdana Menteri sangat bijaksana.",},
        [3528] = {6405,"","Cao Cao","Sesuai dengan rencana Feng Li, aku memerintahkan tiga ratus pejuang berani untuk menggali terowongan di dalam tembok.","Sesuai dengan rencana Feng Li, aku memerintahkan tiga ratus pejuang berani untuk menggali terowongan di dalam tembok.",},
        [3529] = {6405,"","Cao Cao","Sayangnya semuanya terbocor. Shen Pei memerintahkan pasukan elit untuk menutup jalan keluar, Feng Li dan pejuang berani dikubur hidup-hidup","Sayangnya semuanya terbocor. Shen Pei memerintahkan pasukan elit untuk menutup jalan keluar, Feng Li dan pejuang berani dikubur hidup-hidup",},
        [3530] = {6405,"","Cao Cao","Masih ada rencana lain yang bisa dilakukan?","Masih ada rencana lain yang bisa dilakukan?",},
        [3531] = {6405,"Cao Cao","Xu You","Aku memiliki rencana. Mengapa tidak menggunakan saluran air Sungai Zhanghe dan membanjirinya? ","Aku memiliki rencana. Mengapa tidak menggunakan saluran air Sungai Zhanghe dan membanjirinya? ",},
        [3532] = {6405,"Xu You","Cao Cao","Sepertinya bisa, kita lakukan sesuai caramu.","Sepertinya bisa, kita lakukan sesuai caramu.",},
        [3533] = {6406,"Shen Pei","Yuan Shang","Pasukan Cao menggali jurang di luar kota!","Pasukan Cao menggali jurang di luar kota!",},
        [3534] = {6406,"Yuan Shang","Shen Pei","Biarkan aku melihatnya.","Biarkan aku melihatnya.",},
        [3535] = {6406,"Yuan Shang","Shen Pei","Mereka berusaha menembus tanggul Sungai Zhanghe dan membanjiri kota. Hanya jika parit itu cukup dalam, tidak ada gunanya jika itu begitu dangkal!","Mereka berusaha menembus tanggul Sungai Zhanghe dan membanjiri kota. Hanya jika parit itu cukup dalam, tidak ada gunanya jika itu begitu dangkal!",},
        [3536] = {6407,"Cao Cao","Xu You","Shen Pei ceroboh. Aku sudah memerintahkan sepuluh kali tentara untuk bergabung dengan penggalian malam ini. Besok pagi, kedalaman akan dua zhang.","Shen Pei ceroboh. Aku sudah memerintahkan sepuluh kali tentara untuk bergabung dengan penggalian malam ini. Besok pagi, kedalaman akan dua zhang.",},
        [3537] = {6407,"Cao Cao","Xu You","Ketika kita menyalurkan air sungai ke kota, kedalaman air di dalamnya akan sangat dalam sehingga semua ransum akan tenggelam. Pasukan mereka akan mati kelaparan.","Ketika kita menyalurkan air sungai ke kota, kedalaman air di dalamnya akan sangat dalam sehingga semua ransum akan tenggelam. Pasukan mereka akan mati kelaparan.",},
        [3538] = {6407,"Xu You","Cao Cao","Baik! Jenderal lawan Shen Rong ingin menyerah, buka gerbang barat dengan lebar, biarkan prajuritku masuk.","Baik! Jenderal lawan Shen Rong ingin menyerah, buka gerbang barat dengan lebar, biarkan prajuritku masuk.",},
        [3539] = {6407,"Xu You","Cao Cao","Perintahkan seluruh prajurit untuk menyerang Jizhou!","Perintahkan seluruh prajurit untuk menyerang Jizhou!",},
        [3540] = {6408,"Shen Pei","Cao Cao","Kamu telah membuktikan kesetiaanmu, tetapi ini harus kulakukan. Akankah kamu bergabung denganku hari ini?","Kamu telah membuktikan kesetiaanmu, tetapi ini harus kulakukan. Akankah kamu bergabung denganku hari ini?",},
        [3541] = {6408,"Cao Cao","Shen Pei","Aku tidak menyerah!","Aku tidak menyerah!",},
        [3542] = {6408,"Cao Cao","Shen Pei","Aku adalah menteri Yuan selamanya terlepas dari hidup dan mati, sementara kamu hanya seorang pemberontak licik! Bunuh saja aku!","Aku adalah menteri Yuan selamanya terlepas dari hidup dan mati, sementara kamu hanya seorang pemberontak licik! Bunuh saja aku!",},
        [3543] = {6408,"Shen Pei","Cao Cao","Bunuh orang bodoh ini!","Bunuh orang bodoh ini!",},
        [3544] = {6501,"Nyonya Liu","Cao Pi","Kalian berdua menangis, siapa kalian? (Cao Pi bertanya kepada dua wanita ini saat dia melihat mereka menangis setelah dia masuk ke Kediaman Yuan.)","Kalian berdua menangis, siapa kalian? (Cao Pi bertanya kepada dua wanita ini saat dia melihat mereka menangis setelah dia masuk ke Kediaman Yuan.)",},
        [3545] = {6501,"Cao Pi","Nyonya Liu","Liu, istri Jenderal Yuan.","Liu, istri Jenderal Yuan.",},
        [3546] = {6501,"Nyonya Liu","Cao Pi","Siapa wanita ini?","Siapa wanita ini?",},
        [3547] = {6501,"Cao Pi","Nyonya Liu","Ini adalah istri adik kedua Yuan Xi, Nyonya Zhen. Karena Yuan Xi keluar berjaga di Youzhou, Nyonya Zhen tidak ingin pergi jauh, maka tinggal disini.","Ini adalah istri adik kedua Yuan Xi, Nyonya Zhen. Karena Yuan Xi keluar berjaga di Youzhou, Nyonya Zhen tidak ingin pergi jauh, maka tinggal disini.",},
        [3548] = {6501,"Nyonya Liu","Cao Pi","Aku adalah Cao Pi, putra dari Perdana Menteri. Aku akan melindungi keluargamu, jangan khawatir.","Aku adalah Cao Pi, putra dari Perdana Menteri. Aku akan melindungi keluargamu, jangan khawatir.",},
        [3549] = {6502,"Cao Cao","Xu You","Apakah kamu berpikir kamu bisa memasuki gerbang ini kalau bukan karena aku?","Apakah kamu berpikir kamu bisa memasuki gerbang ini kalau bukan karena aku?",},
        [3550] = {6502,"Xu You","Cao Cao","Hahahaha, ayo, masuk ke dalam bersama-sama.","Hahahaha, ayo, masuk ke dalam bersama-sama.",},
        [3551] = {6502,"Xu You","Cao Cao","Kita pergi ke kediaman Shao dulu.","Kita pergi ke kediaman Shao dulu.",},
        [3552] = {6502,"Xu You","Cao Cao","Siapa yang telah datang kemari?","Siapa yang telah datang kemari?",},
        [3553] = {6502,"Cao Cao","Xu Huang","Cao Pi ada di dalam.","Cao Pi ada di dalam.",},
        [3554] = {6502,"Xu Huang","Cao Cao","Bawa dia keluar! Beraninya dia masuk tanpa izin!","Bawa dia keluar! Beraninya dia masuk tanpa izin!",},
        [3555] = {6502,"","Cao Pi","Nyonya Zhen sangat cantik, mengalahkan siapapun, aku ingin mendapatkannya!","Nyonya Zhen sangat cantik, mengalahkan siapapun, aku ingin mendapatkannya!",},
        [3556] = {6502,"Cao Cao","Nyonya Liu","Tidak ada seorangpun yang bisa melindungi keluargaku, aku bersedia untuk melanjutkan hidupku dengannya.","Tidak ada seorangpun yang bisa melindungi keluargaku, aku bersedia untuk melanjutkan hidupku dengannya.",},
        [3557] = {6502,"Nyonya Liu","Cao Cao","Baik! Akan kuperbolehkan.","Baik! Akan kuperbolehkan.",},
        [3558] = {6503,"","Cao Cao","Dulu aku dan Benchu adalah teman baik, sekarang dia telah tiada, aku hanya bisa menangis untuknya!","Dulu aku dan Benchu adalah teman baik, sekarang dia telah tiada, aku hanya bisa menangis untuknya!",},
        [3559] = {6503,"","Cao Cao","Kirimkan emas, pakaian, dan beras kepada istri Shao, Nyonya Liu. Sekarang penduduk di Hebei menderita karena kekacauan, pajak mereka tahun ini dihapuskan.","Kirimkan emas, pakaian, dan beras kepada istri Shao, Nyonya Liu. Sekarang penduduk di Hebei menderita karena kekacauan, pajak mereka tahun ini dihapuskan.",},
        [3560] = {6504,"Xu Chu","Xu You","Apakah kamu berpikir kamu bisa memasuki gerbang ini kalau bukan karena aku?","Apakah kamu berpikir kamu bisa memasuki gerbang ini kalau bukan karena aku?",},
        [3561] = {6504,"Xu You","Xu Chu","Kami telah melewati pertempuran sengit untuk merebut kota ini, beraninya kau bicara besar tentang dirimu sendiri?","Kami telah melewati pertempuran sengit untuk merebut kota ini, beraninya kau bicara besar tentang dirimu sendiri?",},
        [3562] = {6504,"Xu Chu","Xu You","Kalian semua orang bodoh, tidak layak untuk disebut!","Kalian semua orang bodoh, tidak layak untuk disebut!",},
        [3563] = {6504,"Xu You","Xu Chu","Sangat tidak sopan, menurutku kamu sudah bosan hidup!","Sangat tidak sopan, menurutku kamu sudah bosan hidup!",},
        [3564] = {6505,"Cao Cao","Xu Chu","Xu You tidak sopan dan sering berkata kasar, aku tidak tahan, jadi aku membunuhnya! (Lalu menyerahkan kepala Xu You.)","Xu You tidak sopan dan sering berkata kasar, aku tidak tahan, jadi aku membunuhnya! (Lalu menyerahkan kepala Xu You.)",},
        [3565] = {6505,"Xu Chu","Cao Cao","Ziyuan dan aku merupakan teman lama, kami hanya saling bercanda, mengapa kamu membunuhnya?","Ziyuan dan aku merupakan teman lama, kami hanya saling bercanda, mengapa kamu membunuhnya?",},
        [3566] = {6505,"Cao Cao","Xu Chu","Orang ini kasar dan berbicara dengan liar, aku tidak tahan melihatnya, jadi aku membunuhnya!","Orang ini kasar dan berbicara dengan liar, aku tidak tahan melihatnya, jadi aku membunuhnya!",},
        [3567] = {6505,"Xu Chu","Cao Cao","Ceroboh! Aku memerintahkanmu untuk mengubur Xu You sendiri.","Ceroboh! Aku memerintahkanmu untuk mengubur Xu You sendiri.",},
        [3568] = {6601,"","Cao Cao","Jizhou telah dikuasai, apakah ada kabar tentang Yuan Tan, Yuan Shang, Yuan Xi dan lainnya?","Jizhou telah dikuasai, apakah ada kabar tentang Yuan Tan, Yuan Shang, Yuan Xi dan lainnya?",},
        [3569] = {6601,"Cao Cao","Protagonis","Saat ini tidak memiliki keinginan untuk bertarung, mereka pergi ke Youzhou untuk bergabung dengan Yuan Xi.","Saat ini tidak memiliki keinginan untuk bertarung, mereka pergi ke Youzhou untuk bergabung dengan Yuan Xi.",},
        [3570] = {6601,"Cao Cao","Protagonis","Tan memimpin pasukan untuk menjarah Ganling, Anping, Bohai dan Hejian, dalam upaya untuk merebut kembali Jizhou.","Tan memimpin pasukan untuk menjarah Ganling, Anping, Bohai dan Hejian, dalam upaya untuk merebut kembali Jizhou.",},
        [3571] = {6601,"Protagonis","Cao Cao","Perintahkan prajurit untuk menyerang!","Perintahkan prajurit untuk menyerang!",},
        [3572] = {6602,"Cao Cao","Protagonis","Yuan Tan menuliskan surat kepada Liu Biao untuk bala bantuan, tetapi Liu Biao tidak berniat untuk mengirimkan prajurit. Dia berpikir dia bisa mengalahkan kami, maka dia pergi dan bersembunyi di Nanpi.","Yuan Tan menuliskan surat kepada Liu Biao untuk bala bantuan, tetapi Liu Biao tidak berniat untuk mengirimkan prajurit. Dia berpikir dia bisa mengalahkan kami, maka dia pergi dan bersembunyi di Nanpi.",},
        [3573] = {6602,"Protagonis","Cao Cao","Kejar dia!","Kejar dia!",},
        [3574] = {6603,"Cao Cao","Protagonis","Aku menyerang maju dengan Cao Hong untuk melawan Yuan Tan. Saat aku akan memenggal kepalanya, dia terbunuh di tengah kekacauan.","Aku menyerang maju dengan Cao Hong untuk melawan Yuan Tan. Saat aku akan memenggal kepalanya, dia terbunuh di tengah kekacauan.",},
        [3575] = {6603,"Cao Cao","Protagonis","Menyaksikan pasukan tersebar, Guo Tu bergegas ke kota. Aku menembaknya dengan panah yang mendorongnya ke parit dengan kudanya.","Menyaksikan pasukan tersebar, Guo Tu bergegas ke kota. Aku menembaknya dengan panah yang mendorongnya ke parit dengan kudanya.",},
        [3576] = {6603,"Protagonis","Cao Cao","Bagus! Jenderal Yangwei memang dewa!","Bagus! Jenderal Yangwei memang dewa!",},
        [3577] = {6603,"Protagonis","Cao Cao","Yuan Tan telah mati, sekarang serang Yuan Shang dan Yuan Xi!","Yuan Tan telah mati, sekarang serang Yuan Shang dan Yuan Xi!",},
        [3578] = {6604,"Guo Jia","Cao Cao","Sekarang Yuan Shang telah bergabung dengan Yuan Xi, apa langkah yang harus diambil?","Sekarang Yuan Shang telah bergabung dengan Yuan Xi, apa langkah yang harus diambil?",},
        [3579] = {6604,"Cao Cao","Guo Jia","Perintahkan Jiao Chu dan Zhang Nan yang telah menyerah pada kami dari Yuan utnuk menyerang Yuan.","Perintahkan Jiao Chu dan Zhang Nan yang telah menyerah pada kami dari Yuan utnuk menyerang Yuan.",},
        [3580] = {6604,"Guo Jia","Cao Cao","Jiao Chu, Zhang Nan, Lu Kuang, Lu Xiang dan Ma Yan akan memimpin tentara mereka untuk menyerang Youzhou dari tiga arah.","Jiao Chu, Zhang Nan, Lu Kuang, Lu Xiang dan Ma Yan akan memimpin tentara mereka untuk menyerang Youzhou dari tiga arah.",},
        [3581] = {6604,"Guo Jia","Cao Cao","Li Dian dan Yue Jin akan bertemu dengan Zhang Yan, lalu menyerang Gao Gan di Bingzhou.","Li Dian dan Yue Jin akan bertemu dengan Zhang Yan, lalu menyerang Gao Gan di Bingzhou.",},
        [3582] = {6605,"Cao Cao","Cao Hong","Gao Gan tidak menemukan jalan keluar, hanya bisa bergabung dengan Liu Biao. Pada perjalanan di Shangluo, dia dibunuh oleh Kapten Wang Yan, kepalanya dipenggal dan dikirimkan kemari.","Gao Gan tidak menemukan jalan keluar, hanya bisa bergabung dengan Liu Biao. Pada perjalanan di Shangluo, dia dibunuh oleh Kapten Wang Yan, kepalanya dipenggal dan dikirimkan kemari.",},
        [3583] = {6605,"Cao Cao","Protagonis","Yuan Xi dan Yuan Shang telah kalah dan kehilangan kekuatan militer. Mereka tidak ada pilihan lain kecuali pergi ke gurun yang jauh.","Yuan Xi dan Yuan Shang telah kalah dan kehilangan kekuatan militer. Mereka tidak ada pilihan lain kecuali pergi ke gurun yang jauh.",},
        [3584] = {6605,"Cao Cao","Protagonis","Jika aku membawa prajurit ke barat, ini akan menjadi bencana jika Liu Bei dan Liu Biao mengambil kesempatan ini untuk menyerang Xuchang dan aku tidak bisa kembali tepat waktu. Mohon kembali dengan kemenangan.","Jika aku membawa prajurit ke barat, ini akan menjadi bencana jika Liu Bei dan Liu Biao mengambil kesempatan ini untuk menyerang Xuchang dan aku tidak bisa kembali tepat waktu. Mohon kembali dengan kemenangan.",},
        [3585] = {6605,"Cao Cao","Guo Jia","Perkataan Jenderal Yangwei salah. Meskipun Tuan telah dikenal di seluruh dunia, orang padang pasir pasti tidak ada persiapan, karena mereka berpikir bahwa mereka sangat jauh.","Perkataan Jenderal Yangwei salah. Meskipun Tuan telah dikenal di seluruh dunia, orang padang pasir pasti tidak ada persiapan, karena mereka berpikir bahwa mereka sangat jauh.",},
        [3586] = {6605,"Cao Cao","Guo Jia","Jika kita mengambil kesempatan dengan ketidak siapan mereka dan menyerang secara mendadak, mereka pasti dapat dikalahkan. Ditambah lagi Yuan Shao adalah donatur Wuhuan, dan Shang dan Xi adalah saudara, mereka harus disingkirkan.","Jika kita mengambil kesempatan dengan ketidak siapan mereka dan menyerang secara mendadak, mereka pasti dapat dikalahkan. Ditambah lagi Yuan Shao adalah donatur Wuhuan, dan Shang dan Xi adalah saudara, mereka harus disingkirkan.",},
        [3587] = {6605,"Cao Cao","Guo Jia","Liu Biao hanyalah seorang bangsawan yang lemah. Dia tahu dia tidak memiliki apa yang diperlukan untuk mengendalikan Liu Bei dan Liu Bei tidak akan tunduk kepadanya.","Liu Biao hanyalah seorang bangsawan yang lemah. Dia tahu dia tidak memiliki apa yang diperlukan untuk mengendalikan Liu Bei dan Liu Bei tidak akan tunduk kepadanya.",},
        [3588] = {6605,"Cao Cao","Guo Jia","Meskipun tentaramu berbaris di luar, kamu tidak perlu mengkhawatirkannya.","Meskipun tentaramu berbaris di luar, kamu tidak perlu mengkhawatirkannya.",},
        [3589] = {6605,"Guo Jia","Cao Cao","Perkataan Fengxiao benar. Perintahkan seluruh tentara untuk maju dengan ribuan kereta.","Perkataan Fengxiao benar. Perintahkan seluruh tentara untuk maju dengan ribuan kereta.",},
        [3590] = {6606,"Guo Jia","Cao Cao","Kamu terserang penyakit setelah perjalanan panjang hanya karena aku ingin menenangkan padang pasir, aku merasakan kesusahan sepenuhnya! (Melihat Guo Jia terkurung di tempat tidur dalam kereta pasien.)","Kamu terserang penyakit setelah perjalanan panjang hanya karena aku ingin menenangkan padang pasir, aku merasakan kesusahan sepenuhnya! (Melihat Guo Jia terkurung di tempat tidur dalam kereta pasien.)",},
        [3591] = {6606,"Cao Cao","Guo Jia","Terima kasih Perdana Menteri, meskipun mati aku tidak bisa membalasnya.","Terima kasih Perdana Menteri, meskipun mati aku tidak bisa membalasnya.",},
        [3592] = {6606,"Guo Jia","Cao Cao","Aku melihat jalan menuju utara sangat kasar, bagaimana kalau kita mundur?","Aku melihat jalan menuju utara sangat kasar, bagaimana kalau kita mundur?",},
        [3593] = {6606,"Cao Cao","Guo Jia","Kecepatan sangat penting dalam perang. Kamu akan melakukan ekspedisi jarak jauh, ransum yang banyak akan memperlambat perjalananmu, lebih baik pergi dengan beban ringan dan serang saat mereka belum siap.","Kecepatan sangat penting dalam perang. Kamu akan melakukan ekspedisi jarak jauh, ransum yang banyak akan memperlambat perjalananmu, lebih baik pergi dengan beban ringan dan serang saat mereka belum siap.",},
        [3594] = {6606,"Guo Jia","Cao Cao","Beristirahatlah di Yizhou, aku akan menanyakan pemandu untuk menunjukkan jalan pada prajurit.","Beristirahatlah di Yizhou, aku akan menanyakan pemandu untuk menunjukkan jalan pada prajurit.",},
        [3595] = {6607,"","Cao Cao","Kematian Fengxiao adalah kehendak langit untuk menjatuhkanku! (Saat Cao Cao tiba di Yizhou lagi, Guo Jia telah meninggal karena sakit.)","Kematian Fengxiao adalah kehendak langit untuk menjatuhkanku! (Saat Cao Cao tiba di Yizhou lagi, Guo Jia telah meninggal karena sakit.)",},
        [3596] = {6607,"","Cao Cao","Kalian semua sudah tua sepertiku, Fengxiao adalah satu-satunya pemuda di sini, aku ingin mempercayakan warisanku kepadanya. Aku tidak berharap dia mati di usia paruh baya, hatiku hancur!","Kalian semua sudah tua sepertiku, Fengxiao adalah satu-satunya pemuda di sini, aku ingin mempercayakan warisanku kepadanya. Aku tidak berharap dia mati di usia paruh baya, hatiku hancur!",},
        [3597] = {6607,"Cao Cao","Protagonis","Pada saat terakhirnya, Guo menuliskan surat ini sendiri, mengatakan tentang Liaodong.","Pada saat terakhirnya, Guo menuliskan surat ini sendiri, mengatakan tentang Liaodong.",},
        [3598] = {6607,"Protagonis","Xiahou Dun","Apakah di surat menyebutkan agar kita segera maju ke Liaodong?","Apakah di surat menyebutkan agar kita segera maju ke Liaodong?",},
        [3599] = {6607,"Xiahou Dun","Protagonis","Tidak, kamu tidak perlu khawatir. Beberapa hari kemudian, Gongsun Kang akan membawa kepala Yuan bersaudara kemari.","Tidak, kamu tidak perlu khawatir. Beberapa hari kemudian, Gongsun Kang akan membawa kepala Yuan bersaudara kemari.",},
        [3600] = {6608,"Yuan Xi","Yuan Shang","Prajurit di Liaodong ada puluhan ribu banyaknya, cukup untuk mengimbangi Cao Cao.","Prajurit di Liaodong ada puluhan ribu banyaknya, cukup untuk mengimbangi Cao Cao.",},
        [3601] = {6608,"Yuan Xi","Yuan Shang","Sekarang kita telah bergabung dengan mereka, kita harus membunuh Gongsun Kang dan mengambil tanahnya. Tunggu sampai kita mengumpulkan kekuatan yang cukup untuk merebut kembali Hebei.","Sekarang kita telah bergabung dengan mereka, kita harus membunuh Gongsun Kang dan mengambil tanahnya. Tunggu sampai kita mengumpulkan kekuatan yang cukup untuk merebut kembali Hebei.",},
        [3602] = {6608,"Yuan Shang","Yuan Xi","Aku juga berpikir seperti itu!","Aku juga berpikir seperti itu!",},
        [3603] = {6609,"Cao Cao","Xiahou Dun","Gongsun Kang dari Liaodong telah memenggal Yuan Shang dan Yuan Xi dan mengirim seseorang untuk membawanya kemari.","Gongsun Kang dari Liaodong telah memenggal Yuan Shang dan Yuan Xi dan mengirim seseorang untuk membawanya kemari.",},
        [3604] = {6609,"Xiahou Dun","Cao Cao","Sesuai dugaan Fengxiao!","Sesuai dugaan Fengxiao!",},
        [3605] = {6609,"Cao Cao","Xiahou Dun","Apa yang sesuai dugaan Fengxiao?","Apa yang sesuai dugaan Fengxiao?",},
        [3606] = {6609,"Xiahou Dun","Protagonis","Suratnya menyebutkan seperti ini.","Suratnya menyebutkan seperti ini.",},
        [3607] = {6609,"Xiahou Dun","Protagonis","Aku mendengar Yuan Xi dan Yuan Shang sedang menuju Liaodong, kamu jangan mengirimkan prajurit kesana.","Aku mendengar Yuan Xi dan Yuan Shang sedang menuju Liaodong, kamu jangan mengirimkan prajurit kesana.",},
        [3608] = {6609,"Xiahou Dun","Protagonis","Gongsun Kang takut dengan pencaplokan keluarga Yuan, mereka akan curiga. Jika kamu menyerangnya, dia akan menyerang kembali, tidak perlu berusaha.","Gongsun Kang takut dengan pencaplokan keluarga Yuan, mereka akan curiga. Jika kamu menyerangnya, dia akan menyerang kembali, tidak perlu berusaha.",},
        [3609] = {6609,"Xiahou Dun","Protagonis","Jika menundanya, Gongsun Kang dan keluarga Yuan akan saling beradu, ini tidak dapat dihindari.","Jika menundanya, Gongsun Kang dan keluarga Yuan akan saling beradu, ini tidak dapat dihindari.",},
        [3610] = {6609,"Protagonis","Cao Cao","Guo Fengxiao telah menjadi orang bertalenta di antara para hero sejak lahir. Dia bisa membawa pena dan pedang!","Guo Fengxiao telah menjadi orang bertalenta di antara para hero sejak lahir. Dia bisa membawa pena dan pedang!",},
        [3611] = {6609,"Protagonis","Cao Cao","Bawa jenazah Guo Jia ke Xuchang dan persiapkan pemakaman luas untuknya!","Bawa jenazah Guo Jia ke Xuchang dan persiapkan pemakaman luas untuknya!",},
        [3612] = {6701,"Cao Cao","Cheng Yu","Bagian utara sudah tenang dan kita sekarang di Xuchang lagi. Kita harus merencanakan pendudukan di selatan secepatnya.","Bagian utara sudah tenang dan kita sekarang di Xuchang lagi. Kita harus merencanakan pendudukan di selatan secepatnya.",},
        [3613] = {6701,"Cheng Yu","Cao Cao","Aku telah berpikir lama tentang hal ini. Kalian telah membuatku mengeluarkan uneg-unegku.","Aku telah berpikir lama tentang hal ini. Kalian telah membuatku mengeluarkan uneg-unegku.",},
        [3614] = {6701,"Cheng Yu","Cao Cao","Bagian selatan terlihat berkembang dan berbunga, aku tidak yakin ini akan berhasil.","Bagian selatan terlihat berkembang dan berbunga, aku tidak yakin ini akan berhasil.",},
        [3615] = {6701,"Cao Cao","Xun You","Dengan kehebatan Perdana Menteri, ini pasti berhasil!","Dengan kehebatan Perdana Menteri, ini pasti berhasil!",},
        [3616] = {6701,"Cao Cao","Protagonis","Lihat, di depan ada cahaya yang berasal dari tanah.","Lihat, di depan ada cahaya yang berasal dari tanah.",},
        [3617] = {6701,"Cao Cao","Xun You","Di dalam tanah ini pasti ada harta!","Di dalam tanah ini pasti ada harta!",},
        [3618] = {6701,"Xun You","Cao Cao","Gali mengikuti sumber cahaya!","Gali mengikuti sumber cahaya!",},
        [3619] = {6702,"Xun You","Cao Cao","Pertanda apakah ini? (Mereka menggali keluar pipit tembaga dari sumber cahaya.)","Pertanda apakah ini? (Mereka menggali keluar pipit tembaga dari sumber cahaya.)",},
        [3620] = {6702,"Cao Cao","Xun You","Ibu Shun hamil dan melahirkan Shun karena dia melihat pipit giok di dalam mimpinya. Sekarang kamu mendapat pipit tembaga, ini juga adalah pertanda baik.","Ibu Shun hamil dan melahirkan Shun karena dia melihat pipit giok di dalam mimpinya. Sekarang kamu mendapat pipit tembaga, ini juga adalah pertanda baik.",},
        [3621] = {6702,"Xun You","Cao Cao","Bangun teras untuk perayaan!","Bangun teras untuk perayaan!",},
        [3622] = {6702,"Cao Cao","Cao Zhi","Jika membangun teras, harus membangun tiga unit: Yang paling tinggi di tengah, bernama Pipit Tembaga; Satu di kiri, bernama Naga Giok; Satu di kanan, bernama Phoenix Emas.","Jika membangun teras, harus membangun tiga unit: Yang paling tinggi di tengah, bernama Pipit Tembaga; Satu di kiri, bernama Naga Giok; Satu di kanan, bernama Phoenix Emas.",},
        [3623] = {6702,"Cao Cao","Cao Zhi","Dan tambahkan dua jembatan parit untuk menyambungkannya, itu akan terlihat menawan.","Dan tambahkan dua jembatan parit untuk menyambungkannya, itu akan terlihat menawan.",},
        [3624] = {6702,"Cao Zhi","Cao Cao","Bagus, anakku. Saat teras telah jadi, ini akan cukup untuk menghibur kita!","Bagus, anakku. Saat teras telah jadi, ini akan cukup untuk menghibur kita!",},
        [3625] = {6703,"","Cao Cao","Aku mendapatkan pasukan Yuan Shao, berjumlah 500.000 hingga 600.000 dan mengembalikan Xuchang setelah menang.","Aku mendapatkan pasukan Yuan Shao, berjumlah 500.000 hingga 600.000 dan mengembalikan Xuchang setelah menang.",},
        [3626] = {6703,"","Cao Cao","Sekarang aku ingin maju melawan Liu Biao di selatan, bagaimana menurutmu?","Sekarang aku ingin maju melawan Liu Biao di selatan, bagaimana menurutmu?",},
        [3627] = {6703,"Cao Cao","Protagonis","Pasukan besar baru saja kembali dari utara, jangan kirimkan lagi begitu cepat. Tunggu enam bulan dan pertahankan kekuatan, lalu kalahkan Liu Biao dan Sun Quan bersamaan.","Pasukan besar baru saja kembali dari utara, jangan kirimkan lagi begitu cepat. Tunggu enam bulan dan pertahankan kekuatan, lalu kalahkan Liu Biao dan Sun Quan bersamaan.",},
        [3628] = {6703,"Protagonis","Cao Cao","Perkataan Jenderal Yangwei masuk akal, aku akan memencarkan prajurit dan menimbun ransum, untuk dipakai nanti.","Perkataan Jenderal Yangwei masuk akal, aku akan memencarkan prajurit dan menimbun ransum, untuk dipakai nanti.",},
        [3629] = {6801,"","Cao Cao","Akhir-akhir ini aku sering memikirkan Kolonel Cai.","Akhir-akhir ini aku sering memikirkan Kolonel Cai.",},
        [3630] = {6801,"","Cao Cao","Dan putrinya Cai Wenji, dia tidak hanya terpelajar tetapi juga ahli musik.","Dan putrinya Cai Wenji, dia tidak hanya terpelajar tetapi juga ahli musik.",},
        [3631] = {6801,"","Cao Cao","Sudah bertahun-tahun, diamana keberadaan Wenji?","Sudah bertahun-tahun, diamana keberadaan Wenji?",},
        [3632] = {6801,"Cao Cao","Xiahou Dun","Aku akan membantu Perdana Menteri untuk mencari tahu keberadaannya.","Aku akan membantu Perdana Menteri untuk mencari tahu keberadaannya.",},
        [3633] = {6802,"Cao Cao","Xiahou Dun","Aku telah menemukan Wenji.","Aku telah menemukan Wenji.",},
        [3634] = {6802,"Xiahou Dun","Cao Cao","Cepat beritahu aku.","Cepat beritahu aku.",},
        [3635] = {6802,"Cao Cao","Xiahou Dun","Pada saat itu, Kapten Cai Yong terpaksa bunuh diri karena bergabung dengan Dong Zhuo, kemudian kekacauan bermunculan.","Pada saat itu, Kapten Cai Yong terpaksa bunuh diri karena bergabung dengan Dong Zhuo, kemudian kekacauan bermunculan.",},
        [3636] = {6802,"Cao Cao","Xiahou Dun","Pada perbatasan, orang Qiang dan Hun memanfaatkan kemalangan Zhongyuan dan menjarah dimana-mana.","Pada perbatasan, orang Qiang dan Hun memanfaatkan kemalangan Zhongyuan dan menjarah dimana-mana.",},
        [3637] = {6802,"Cao Cao","Xiahou Dun","Cai Wenji, bersama dengan wanita-wanita lain, dibawa ke Xiongnu, lalu menikah dengan Raja Zuoxian.","Cai Wenji, bersama dengan wanita-wanita lain, dibawa ke Xiongnu, lalu menikah dengan Raja Zuoxian.",},
        [3638] = {6802,"Cao Cao","Xiahou Dun","Untungnya dia sangat dicintai dan telah melahirkan dua anak laki-laki.","Untungnya dia sangat dicintai dan telah melahirkan dua anak laki-laki.",},
        [3639] = {6802,"Xiahou Dun","Cao Cao","Akhirnya, aku tahu dimana keberadaannya, baguslah kalau masih hidup.","Akhirnya, aku tahu dimana keberadaannya, baguslah kalau masih hidup.",},
        [3640] = {6803,"","Cao Cao","Pada saat itu, Cai Wenji telah ditangkap oleh Xiongnu dan menikah dengan Raja Zuoxian.","Pada saat itu, Cai Wenji telah ditangkap oleh Xiongnu dan menikah dengan Raja Zuoxian.",},
        [3641] = {6803,"","Cao Cao","Aku ingin membawa dia kembali ke Xuchang, kalian memiliki cara apa?","Aku ingin membawa dia kembali ke Xuchang, kalian memiliki cara apa?",},
        [3642] = {6803,"Cao Cao","Protagonis","Pada saat itu, pengikut keluarga Yuan, Gao Gan meminta bantuannya, tetapi dia tidak menjawabnya. Diantara dia dan kita, tidak ada masalah wilayah dan dendam.","Pada saat itu, pengikut keluarga Yuan, Gao Gan meminta bantuannya, tetapi dia tidak menjawabnya. Diantara dia dan kita, tidak ada masalah wilayah dan dendam.",},
        [3643] = {6803,"Cao Cao","Protagonis","Tanah Kepala Desa tidak subur. Mengapa kita tidak menghadiahkan seribu keping emas dan batu giok putih kepada mereka, untuk bersatu dengan mereka?","Tanah Kepala Desa tidak subur. Mengapa kita tidak menghadiahkan seribu keping emas dan batu giok putih kepada mereka, untuk bersatu dengan mereka?",},
        [3644] = {6803,"Cao Cao","Protagonis","Dan bisa menukarnya dengan Wenji.","Dan bisa menukarnya dengan Wenji.",},
        [3645] = {6803,"Protagonis","Cao Cao","Perkataan Jenderal Yangwei sepertinya masuk akal, tidak tahu apakah kamu bersedia pergi bertanya pada Kepala Xiongnu tentang hal ini.","Perkataan Jenderal Yangwei sepertinya masuk akal, tidak tahu apakah kamu bersedia pergi bertanya pada Kepala Xiongnu tentang hal ini.",},
        [3646] = {6803,"Cao Cao","Protagonis","Aku akan pergi.","Aku akan pergi.",},
        [3647] = {6804,"Cao Cao","Cai Wenji","Sudah dua belas tahun sejak kepergianku dari kampung halaman dan sekarang aku kembali. Terima kasih, Mengde.","Sudah dua belas tahun sejak kepergianku dari kampung halaman dan sekarang aku kembali. Terima kasih, Mengde.",},
        [3648] = {6804,"Cao Cao","Cai Wenji","Terimalah sujudku.","Terimalah sujudku.",},
        [3649] = {6804,"Cai Wenji","Cao Cao","Berdirilah, tidak perlu berterima kasih.","Berdirilah, tidak perlu berterima kasih.",},
