        [3748] = {7113,"Liu Biao","Cai Mao","Beberapa tahun ini, panen sangat memuaskan. Semua pejabat berkumpul di Xiangyang untuk menujukkan kepedulian mereka terhadap rakyat. Tuan silahkan ikut pergi.","Beberapa tahun ini, panen sangat memuaskan. Semua pejabat berkumpul di Xiangyang untuk menujukkan kepedulian mereka terhadap rakyat. Tuan silahkan ikut pergi.",},
        [3749] = {7113,"Cai Mao","Liu Biao","Akhir-akhir ini aku tidak sehat, tidak bisa pergi. Putra keduaku bisa menjamu para tamu.","Akhir-akhir ini aku tidak sehat, tidak bisa pergi. Putra keduaku bisa menjamu para tamu.",},
        [3750] = {7113,"Liu Biao","Cai Mao","Anak keduamu masih muda, masih belum tahu betul tentang etiket.","Anak keduamu masih muda, masih belum tahu betul tentang etiket.",},
        [3751] = {7113,"Cai Mao","Liu Biao","Minta Xuande dari Xinye untuk menjamu tamu.","Minta Xuande dari Xinye untuk menjamu tamu.",},
        [3752] = {7113,"Liu Biao","Cai Mao","Oke. (Senang melihat Liu Biao jatuh dalam perangkap dan mengirimkan seseorang untuk membawa Xuande ke Xiangyang.)","Oke. (Senang melihat Liu Biao jatuh dalam perangkap dan mengirimkan seseorang untuk membawa Xuande ke Xiangyang.)",},
        [3753] = {7114,"Liu Bei","Yi Ji","Undangan Cai Mao untukmu, sebenarnya adalah siasat jahatnya.","Undangan Cai Mao untukmu, sebenarnya adalah siasat jahatnya.",},
        [3754] = {7114,"Liu Bei","Yi Ji","Bagian timur, selatan, utara gerbang kota dijaga ketat, hanya bisa lewat gerbang barat, cepatlah pergi!","Bagian timur, selatan, utara gerbang kota dijaga ketat, hanya bisa lewat gerbang barat, cepatlah pergi!",},
        [3755] = {7114,"Yi Ji","Liu Bei","Aku akan menunggang Di Lu ke gerbang barat.","Aku akan menunggang Di Lu ke gerbang barat.",},
        [3756] = {7115,"Liu Bei","Cai Mao","Mengapa kamu ingin pergi di pertengahan jalan?","Mengapa kamu ingin pergi di pertengahan jalan?",},
        [3757] = {7115,"Cai Mao","Liu Bei","Kamu dan aku tidak ada dendam, mengapa harus saling membunuh?","Kamu dan aku tidak ada dendam, mengapa harus saling membunuh?",},
        [3758] = {7115,"Cai Mao","Liu Bei","Di Lu! Maju! (Di Lu melompat 10 meter melewati Sungai Tanxi menuju tepi sungai barat. Itulah asal cerita tentang Lompatan Sungai Tanxi.)","Di Lu! Maju! (Di Lu melompat 10 meter melewati Sungai Tanxi menuju tepi sungai barat. Itulah asal cerita tentang Lompatan Sungai Tanxi.)",},
        [3759] = {7201,"Liu Bei","Bocah Gembala","Apakah kamu Liu Xuande yang telah memusnahkan Turban Kuning?","Apakah kamu Liu Xuande yang telah memusnahkan Turban Kuning?",},
        [3760] = {7201,"Bocah Gembala","Liu Bei","Kamu hanyalah bocah dari desa terpencil, bagaimana bisa tahu namaku?","Kamu hanyalah bocah dari desa terpencil, bagaimana bisa tahu namaku?",},
        [3761] = {7201,"Liu Bei","Bocah Gembala","Aku awalnya tidak tahu, karena sering melayani guru, aku mendengar ada seorang tamu yang berkali-kali mengakatan Liu Xuande, tinggi tujuh kaki lima inci, dengan lengan panjang yang melebihi lutut, matanya bisa melihat telinga sendiri dan dia adalah seorang pahlawan.","Aku awalnya tidak tahu, karena sering melayani guru, aku mendengar ada seorang tamu yang berkali-kali mengakatan Liu Xuande, tinggi tujuh kaki lima inci, dengan lengan panjang yang melebihi lutut, matanya bisa melihat telinga sendiri dan dia adalah seorang pahlawan.",},
        [3762] = {7201,"Liu Bei","Bocah Gembala","Sekarang yang kulihat jenderal adalah seperti itu, aku yakin pasti kamu orangnya.","Sekarang yang kulihat jenderal adalah seperti itu, aku yakin pasti kamu orangnya.",},
        [3763] = {7201,"Bocah Gembala","Liu Bei","Siapa gurumu?","Siapa gurumu?",},
        [3764] = {7201,"Liu Bei","Bocah Gembala","Guruku bermarga Sima, nama Hui, nama kehormatan Caode, lahir di Yingchuan, dikenal sebagai Tuan Shui Jing.","Guruku bermarga Sima, nama Hui, nama kehormatan Caode, lahir di Yingchuan, dikenal sebagai Tuan Shui Jing.",},
        [3765] = {7201,"Bocah Gembala","Liu Bei","Gurumu tinggal dimana?","Gurumu tinggal dimana?",},
        [3766] = {7201,"Liu Bei","Bocah Gembala","Rumahnya ada di dalam hutan sana.","Rumahnya ada di dalam hutan sana.",},
        [3767] = {7201,"Bocah Gembala","Liu Bei","Aku Liu Xuande, bisakah kamu membawaku untuk menemui gurumu?","Aku Liu Xuande, bisakah kamu membawaku untuk menemui gurumu?",},
        [3768] = {7202,"Liu Bei","Sima Hui","Apa tujuanmu datang kemari?","Apa tujuanmu datang kemari?",},
        [3769] = {7202,"Sima Hui","Liu Bei","Aku hanya melewati tempat ini, dengan petunjuk muridmu. Sangat senang sekali dapat bertemu denganmu!","Aku hanya melewati tempat ini, dengan petunjuk muridmu. Sangat senang sekali dapat bertemu denganmu!",},
        [3770] = {7202,"Liu Bei","Sima Hui","Tidak perlu menutupinya, aku bisa melihat dari wajahmu bahwa kamu telah kabur hingga tiba di tempat ini.","Tidak perlu menutupinya, aku bisa melihat dari wajahmu bahwa kamu telah kabur hingga tiba di tempat ini.",},
        [3771] = {7202,"Sima Hui","Liu Bei","Sayang sekali, betul.","Sayang sekali, betul.",},
        [3772] = {7202,"Liu Bei","Sima Hui","Aku telah banyak mendengar tentangmu, mengapa berakhir di tempat seperti ini?","Aku telah banyak mendengar tentangmu, mengapa berakhir di tempat seperti ini?",},
        [3773] = {7202,"Sima Hui","Liu Bei","Takdirlah yang membawaku kesini.","Takdirlah yang membawaku kesini.",},
        [3774] = {7202,"Liu Bei","Sima Hui","Bukan, semua ini karena kamu tidak memiliki orang yang bisa membantumu.","Bukan, semua ini karena kamu tidak memiliki orang yang bisa membantumu.",},
        [3775] = {7202,"Sima Hui","Liu Bei","Aku meskipun tidak begitu pandai, tetapi aku memiliki Sun Qian, Mi Zhu dan Jian Yong sebagai penasihat, Guan Yu, Zhang Fei dan Zhao Yun sebagai petarung. Mereka sangat setia dan aku dapat mengandalkan mereka.","Aku meskipun tidak begitu pandai, tetapi aku memiliki Sun Qian, Mi Zhu dan Jian Yong sebagai penasihat, Guan Yu, Zhang Fei dan Zhao Yun sebagai petarung. Mereka sangat setia dan aku dapat mengandalkan mereka.",},
        [3776] = {7202,"Liu Bei","Sima Hui","Guan Yu, Zhang Fei dan Zhao Yun adalah petarung handal, tetapi sayangnya tidak ada yang bisa mempergunakannya dengan baik. Orang seperti Sun Qian dan Mi Zhu hanyalah seorang sarjana, tidak memiliki kemampuan dalam politik.","Guan Yu, Zhang Fei dan Zhao Yun adalah petarung handal, tetapi sayangnya tidak ada yang bisa mempergunakannya dengan baik. Orang seperti Sun Qian dan Mi Zhu hanyalah seorang sarjana, tidak memiliki kemampuan dalam politik.",},
        [3777] = {7202,"Sima Hui","Liu Bei","Aku juga pernah pergi ke gunung sendiri untuk mencari orang bijaksana, tetapi aku tidak menemukannya!","Aku juga pernah pergi ke gunung sendiri untuk mencari orang bijaksana, tetapi aku tidak menemukannya!",},
        [3778] = {7202,"Liu Bei","Sima Hui","Tidak pernahkah kamu mendengar perkataan dari Kong Hu Cu bahwa kesetiaan akan ditemukan setelah sepuluh rumah? Mengapa bilang tidak menemukannya?","Tidak pernahkah kamu mendengar perkataan dari Kong Hu Cu bahwa kesetiaan akan ditemukan setelah sepuluh rumah? Mengapa bilang tidak menemukannya?",},
        [3779] = {7202,"Sima Hui","Liu Bei","Betapa bodohnya aku. Tolong ajari aku.","Betapa bodohnya aku. Tolong ajari aku.",},
        [3780] = {7202,"Liu Bei","Sima Hui","Apakah kamu pernah mendengar lagu yang dinyanyikan anak-anak di prefektur Jingxiang? Berkata: keluarga akan menurun dalam 8 atau 9 tahun, keturunan mati dalam 13 tahun.","Apakah kamu pernah mendengar lagu yang dinyanyikan anak-anak di prefektur Jingxiang? Berkata: keluarga akan menurun dalam 8 atau 9 tahun, keturunan mati dalam 13 tahun.",},
        [3781] = {7202,"Liu Bei","Sima Hui","Pada akhirnya takdir akan memilih seorang rakyat biasa menjadi kaisar. Syair puisi ini mulai dinyanyikan pada periode awal Jian'an. Tahun 8 Jian'an, istri Liu Jingsheng meninggal, keluarganya kacau sehingga muncullah keluarga menurun ini.","Pada akhirnya takdir akan memilih seorang rakyat biasa menjadi kaisar. Syair puisi ini mulai dinyanyikan pada periode awal Jian'an. Tahun 8 Jian'an, istri Liu Jingsheng meninggal, keluarganya kacau sehingga muncullah keluarga menurun ini.",},
        [3782] = {7202,"Liu Bei","Sima Hui","Ahli waris mati menandakan bahwa Jingsheng akan segera mati, tidak ada keturunan dan hanya beberapa menteri yang akan berada di sisinya. Semuanya sudah ditakdirkan dan naga itu mengacu padamu.","Ahli waris mati menandakan bahwa Jingsheng akan segera mati, tidak ada keturunan dan hanya beberapa menteri yang akan berada di sisinya. Semuanya sudah ditakdirkan dan naga itu mengacu padamu.",},
        [3783] = {7202,"Sima Hui","Liu Bei","Aku tidak untuk pantas dipuji olehmu!","Aku tidak untuk pantas dipuji olehmu!",},
        [3784] = {7202,"Liu Bei","Sima Hui","Hari ini orang-orang bertalenta semuanya berkumpul disini. Kamu harus merekrut mereka.","Hari ini orang-orang bertalenta semuanya berkumpul disini. Kamu harus merekrut mereka.",},
        [3785] = {7202,"Sima Hui","Liu Bei","Dimana orang bijaksana ini? Siapa mereka?","Dimana orang bijaksana ini? Siapa mereka?",},
        [3786] = {7202,"Liu Bei","Sima Hui","Hari sudah malam, jenderal bisa tinggal ditempatku malam ini, besok kita bicara lagi.","Hari sudah malam, jenderal bisa tinggal ditempatku malam ini, besok kita bicara lagi.",},
        [3787] = {7203,"Xu Shu","Sima Hui","Mengapa datang selarut ini, Yuanzhi?","Mengapa datang selarut ini, Yuanzhi?",},
        [3788] = {7203,"Sima Hui","Xu Shu","Telah lama terdengar bahwa Liu Jingwen menyukai kebaikan dan membenci kejahatan, aku ingin bertemu dengannya. Saat aku bertemu dengannya, aku menemukan bahwa itu hanyalah kebohongan, tidak bisa menggunakan kebaikan dan tidak bisa mengusir kejahatan, oleh karena itu aku meninggalkan surat untuknya dan datang kemari.","Telah lama terdengar bahwa Liu Jingwen menyukai kebaikan dan membenci kejahatan, aku ingin bertemu dengannya. Saat aku bertemu dengannya, aku menemukan bahwa itu hanyalah kebohongan, tidak bisa menggunakan kebaikan dan tidak bisa mengusir kejahatan, oleh karena itu aku meninggalkan surat untuknya dan datang kemari.",},
        [3789] = {7203,"Xu Shu","Sima Hui","Kamu ingin mengabdi pada raja, maka harus membuat pilihan yang benar. Mengapa merendahkan dirimu untuk menyambut Jingsheng? Seorang hero berdiri didepanmu, tetapi kamu tidak mengenalnya.","Kamu ingin mengabdi pada raja, maka harus membuat pilihan yang benar. Mengapa merendahkan dirimu untuk menyambut Jingsheng? Seorang hero berdiri didepanmu, tetapi kamu tidak mengenalnya.",},
        [3790] = {7203,"Sima Hui","Xu Shu","Perkataanmu sangat tepat.","Perkataanmu sangat tepat.",},
        [3791] = {7204,"Sima Hui","Liu Bei","Siapa yang datang kemarin malam?","Siapa yang datang kemarin malam?",},
        [3792] = {7204,"Liu Bei","Sima Hui","Dia adalah temanku.","Dia adalah temanku.",},
        [3793] = {7204,"Sima Hui","Liu Bei","Bisakah aku bertemu dengannya?","Bisakah aku bertemu dengannya?",},
        [3794] = {7204,"Liu Bei","Sima Hui","Dia ingin melayani raja yang baik, sekarang sudah pergi ke tempat lain.","Dia ingin melayani raja yang baik, sekarang sudah pergi ke tempat lain.",},
        [3795] = {7204,"Sima Hui","Liu Bei","Siapa namanya?","Siapa namanya?",},
        [3796] = {7204,"Liu Bei","Sima Hui","Baik! Baik! (Senyum tanpa menjawab.)","Baik! Baik! (Senyum tanpa menjawab.)",},
        [3797] = {7204,"Sima Hui","Liu Bei","Fulong, Pang Tong, siapa orang ini?","Fulong, Pang Tong, siapa orang ini?",},
        [3798] = {7204,"Liu Bei","Sima Hui","Baik! Baik! (Senyum tanpa menjawab.)","Baik! Baik! (Senyum tanpa menjawab.)",},
        [3799] = {7204,"Sima Hui","Liu Bei","Tuan Shui Jing bersediakah keluar dari gunung dan membantuku, untuk membangkitkan Dinasti Han?","Tuan Shui Jing bersediakah keluar dari gunung dan membantuku, untuk membangkitkan Dinasti Han?",},
        [3800] = {7204,"Liu Bei","Sima Hui","Aku hanyalah pertapa di dunia liar, tidak bisa menangani masalah dunia.","Aku hanyalah pertapa di dunia liar, tidak bisa menangani masalah dunia.",},
        [3801] = {7204,"Liu Bei","Sima Hui","Kamu akan mendapat bantuan dari seseorang yang sepuluh kali lebih baik dariku, tetapi kamu harus mengunjunginya.","Kamu akan mendapat bantuan dari seseorang yang sepuluh kali lebih baik dariku, tetapi kamu harus mengunjunginya.",},
        [3802] = {7205,"Liu Bei","Bocah Gembala","Ada seorang jenderal yang menarik ratusan orang ke desa kami.","Ada seorang jenderal yang menarik ratusan orang ke desa kami.",},
        [3803] = {7205,"Bocah Gembala","Liu Bei","Siapa yang datang?","Siapa yang datang?",},
        [3804] = {7205,"Liu Bei","Zhao Yun","Itu aku, Zilong.","Itu aku, Zilong.",},
        [3805] = {7205,"Liu Bei","Zhao Yun","Aku kembali saat malam hari, tidak menemukan Tuan, sepanjang malam berjalan dan bertanya hingga sampai disini.","Aku kembali saat malam hari, tidak menemukan Tuan, sepanjang malam berjalan dan bertanya hingga sampai disini.",},
        [3806] = {7205,"Liu Bei","Zhao Yun","Tuan cepat kembali. Takutnya ada orang yang akan melakukan pembantaian.","Tuan cepat kembali. Takutnya ada orang yang akan melakukan pembantaian.",},
        [3807] = {7205,"Zhao Yun","Liu Bei","Baik, kita kembali ke Xinye.","Baik, kita kembali ke Xinye.",},
        [3808] = {7206,"Liu Bei","Xu Shu","Dunia akan terbalik, api membara, bangunan akan runtuh, satu kayu tidak akan bisa menahan. Orang bijak menginginkan tuan yang bijak, tuan bijak menginginkan orang bijak, tetapi tidak mengenalku.","Dunia akan terbalik, api membara, bangunan akan runtuh, satu kayu tidak akan bisa menahan. Orang bijak menginginkan tuan yang bijak, tuan bijak menginginkan orang bijak, tetapi tidak mengenalku.",},
        [3809] = {7206,"Xu Shu","Liu Bei","Apakah kalian Naga atau Phoenix yang dibicarakan Tuan Shui Jing?","Apakah kalian Naga atau Phoenix yang dibicarakan Tuan Shui Jing?",},
        [3810] = {7206,"Liu Bei","Xu Shu","Namaku Shan Fu, dari Yingchuan. Aku dengar Tuan ingin merekrut orang yang kompeten, aku ingin melayani Tuan tetapi tidak berani mengganggu Tuan, jadi aku bernyanyi di jalan untuk menarik perhatian Tuan.","Namaku Shan Fu, dari Yingchuan. Aku dengar Tuan ingin merekrut orang yang kompeten, aku ingin melayani Tuan tetapi tidak berani mengganggu Tuan, jadi aku bernyanyi di jalan untuk menarik perhatian Tuan.",},
        [3811] = {7206,"Liu Bei","Xu Shu","Kuda yang kamu barusan kendarai, boleh aku lihat?","Kuda yang kamu barusan kendarai, boleh aku lihat?",},
        [3812] = {7206,"Liu Bei","Xu Shu","Ini Kuda Dilu? Meskipun ini kuda bagus, tapi terkutuk bagi pemiliknya, tidak boleh mengendarainya.","Ini Kuda Dilu? Meskipun ini kuda bagus, tapi terkutuk bagi pemiliknya, tidak boleh mengendarainya.",},
        [3813] = {7206,"Xu Shu","Liu Bei","Kuda ini melompati sungai, menyelamatkan nyawaku satu kali.","Kuda ini melompati sungai, menyelamatkan nyawaku satu kali.",},
        [3814] = {7206,"Liu Bei","Xu Shu","Menyelamatkanmu tidak berarti tidak akan membunuhmu suatu hari nanti. Aku harus menghindarinya.","Menyelamatkanmu tidak berarti tidak akan membunuhmu suatu hari nanti. Aku harus menghindarinya.",},
        [3815] = {7206,"Xu Shu","Liu Bei","Bagaimana caramu.","Bagaimana caramu.",},
        [3816] = {7206,"Liu Bei","Xu Shu","Berikan ke salah satu musuhmu, setelah menyebabkan mati, kamu lalu bisa mengendarainya.","Berikan ke salah satu musuhmu, setelah menyebabkan mati, kamu lalu bisa mengendarainya.",},
        [3817] = {7206,"Xu Shu","Liu Bei","Kamu baru saja kemari, tidak memberitahuku jalan yang benar, hanya mengajariku menguntungkan diri sendiri dengan merugikan orang lain, aku tidak ingin mendengarkanmu","Kamu baru saja kemari, tidak memberitahuku jalan yang benar, hanya mengajariku menguntungkan diri sendiri dengan merugikan orang lain, aku tidak ingin mendengarkanmu",},
        [3818] = {7206,"Liu Bei","Xu Shu","Aku sering dengar bahwa kamu orang yang baik, tapi aku tidak percaya. Ini semua hanya untuk mengetesmu.","Aku sering dengar bahwa kamu orang yang baik, tapi aku tidak percaya. Ini semua hanya untuk mengetesmu.",},
        [3819] = {7206,"Xu Shu","Liu Bei","Aku berbuat begini demi kebaikan orang lain, aku harap Tuan bisa mengajariku.","Aku berbuat begini demi kebaikan orang lain, aku harap Tuan bisa mengajariku.",},
        [3820] = {7206,"Liu Bei","Xu Shu","Aku dari Yingchuan. Aku dengar rakyat Xinye berkata bahwa sejak Paman Imperial mulai memerintah Xinye, rakyat telah menjadi makmur. Kebajikanmu memang berpengaruh ke orang lain.","Aku dari Yingchuan. Aku dengar rakyat Xinye berkata bahwa sejak Paman Imperial mulai memerintah Xinye, rakyat telah menjadi makmur. Kebajikanmu memang berpengaruh ke orang lain.",},
        [3821] = {7206,"Xu Shu","Liu Bei","Aku beruntung bisa menerima bantuanmu, mulai hari ini kuangkat menjadi penasihat militerku, pasukanku di bawah kendalimu.","Aku beruntung bisa menerima bantuanmu, mulai hari ini kuangkat menjadi penasihat militerku, pasukanku di bawah kendalimu.",},
        [3822] = {7301,"Liu Bei","Xu Shu","Cao Ren sedang mengumpulkan pasukan di Fancheng, pasti akan terjadi perang besar.","Cao Ren sedang mengumpulkan pasukan di Fancheng, pasti akan terjadi perang besar.",},
        [3823] = {7301,"Xu Shu","Liu Bei","Bagaimana aku melawannya?","Bagaimana aku melawannya?",},
        [3824] = {7301,"Liu Bei","Xu Shu","Jika dia melakukan serangan penuh, Fancheng pasti berhasil direbut.","Jika dia melakukan serangan penuh, Fancheng pasti berhasil direbut.",},
        [3825] = {7301,"Xu Shu","Liu Bei","Lalu aku harus bagaimana?","Lalu aku harus bagaimana?",},
        [3826] = {7301,"Liu Bei","Xu Shu","Dengarkan bisikanku.","Dengarkan bisikanku.",},
        [3827] = {7302,"Xu Shu","Liu Bei","Pasukan Cao menabuh genderang dan membentuk formasi.","Pasukan Cao menabuh genderang dan membentuk formasi.",},
        [3828] = {7302,"Xu Shu","Liu Bei","Kamu tahu formasi ini?","Kamu tahu formasi ini?",},
        [3829] = {7302,"Liu Bei","Xu Shu","Ini Formasi Kunci Emas Delapan Pintu. Yaitu: Istirahat, Hidup, Luka, Blok, Pemandangan, Kematian, Kejutan, dan Terbuka.","Ini Formasi Kunci Emas Delapan Pintu. Yaitu: Istirahat, Hidup, Luka, Blok, Pemandangan, Kematian, Kejutan, dan Terbuka.",},
        [3830] = {7302,"Liu Bei","Xu Shu","Hidup, Pemandangan, dan Terbuka melambangkan keberuntungan; Luka, Kejutan, Istirahat melambangkan luka; Blok dan Kematian melambangkan kematian.","Hidup, Pemandangan, dan Terbuka melambangkan keberuntungan; Luka, Kejutan, Istirahat melambangkan luka; Blok dan Kematian melambangkan kematian.",},
        [3831] = {7302,"Liu Bei","Xu Shu","Formasi terstruktur dengan baik tetapi tidak memiliki dukungan di pusat. Jika kita menembus pintu hidup dari tenggara dan menerobos pintu pemandangan di barat, formasi akan berantakan.","Formasi terstruktur dengan baik tetapi tidak memiliki dukungan di pusat. Jika kita menembus pintu hidup dari tenggara dan menerobos pintu pemandangan di barat, formasi akan berantakan.",},
        [3832] = {7302,"Xu Shu","Liu Bei","Dengarkan perintahku, tahan formasi, Jenderal Yangwei akan menerobos dari tenggara, menuju barat","Dengarkan perintahku, tahan formasi, Jenderal Yangwei akan menerobos dari tenggara, menuju barat",},
        [3833] = {7302,"Liu Bei","Protagonis","Baiklah, aku akan memimpin pasukan untuk menembus Formasi Kunci Emas Delapan Pintu.","Baiklah, aku akan memimpin pasukan untuk menembus Formasi Kunci Emas Delapan Pintu.",},
        [3834] = {7303,"Li Dian","Cao Ren","Liu Bei pasti memiliki orang yang sangat bertalenta, formasiku dihancurkan.","Liu Bei pasti memiliki orang yang sangat bertalenta, formasiku dihancurkan.",},
        [3835] = {7303,"Cao Ren","Li Dian","Meskipun aku di sini, aku mengkhawatirkan Fancheng.","Meskipun aku di sini, aku mengkhawatirkan Fancheng.",},
        [3836] = {7303,"Li Dian","Cao Ren","Kita akan menyerang barak utama mereka malam ini! Jika menang, kita buat rencana selanjutnya. Jika kalah, kembali ke Fancheng.","Kita akan menyerang barak utama mereka malam ini! Jika menang, kita buat rencana selanjutnya. Jika kalah, kembali ke Fancheng.",},
        [3837] = {7303,"Cao Ren","Li Dian","Tidak, Liu Bei pasti sudah memiliki persiapan","Tidak, Liu Bei pasti sudah memiliki persiapan",},
        [3838] = {7303,"Li Dian","Cao Ren","Kamu tidak boleh ragu di dalam perang.!","Kamu tidak boleh ragu di dalam perang.!",},
        [3839] = {7304,"Liu Bei","Xu Shu","Cao Ren akan menyerang kita malam nanti.","Cao Ren akan menyerang kita malam nanti.",},
        [3840] = {7304,"Xu Shu","Liu Bei","Bagaimana kita melawan?","Bagaimana kita melawan?",},
        [3841] = {7304,"Liu Bei","Xu Shu","Aku punya rencana.","Aku punya rencana.",},
        [3842] = {7304,"Liu Bei","Xu Shu","Yunchang akan menunggu di luar Fancheng. Saat Cao ren meninggalkan kota, secepatnya rebut kota itu.","Yunchang akan menunggu di luar Fancheng. Saat Cao ren meninggalkan kota, secepatnya rebut kota itu.",},
        [3843] = {7304,"Liu Bei","Xu Shu","Kalian menunggu di dalam kota kosong, Zhao Yun dan Jenderal Yangwei akan menyergap dari luar, lalu menyudutkannya ke sungai.","Kalian menunggu di dalam kota kosong, Zhao Yun dan Jenderal Yangwei akan menyergap dari luar, lalu menyudutkannya ke sungai.",},
        [3844] = {7304,"Liu Bei","Xu Shu","Zhang Fei akan mencegat di sungai, bersama memukul mundur kembali ke Fancheng, lalu Yunchang dari Fancheng mengepung.","Zhang Fei akan mencegat di sungai, bersama memukul mundur kembali ke Fancheng, lalu Yunchang dari Fancheng mengepung.",},
        [3845] = {7304,"Xu Shu","Liu Bei","Rencana bagus!","Rencana bagus!",},
        [3846] = {7305,"","Cao Ren","Gawat, Liu Bei sudah memiliki rencana sejak awal, tidak hanya gagal menyerang tapi kita juga kehilangan Fancheng.","Gawat, Liu Bei sudah memiliki rencana sejak awal, tidak hanya gagal menyerang tapi kita juga kehilangan Fancheng.",},
        [3847] = {7305,"","Cao Ren","Kembali ke Xuchang sekarang juga.","Kembali ke Xuchang sekarang juga.",},
        [3848] = {7306,"Cao Cao","Cao Ren","Mohon hukum aku karena kehilangan pasukan.","Mohon hukum aku karena kehilangan pasukan.",},
        [3849] = {7306,"Cao Ren","Cao Cao","Menang kalah itu biasa dalam perang. Aku ingin tahu siapa yang membuatkan rencana untuk Liu Bei?","Menang kalah itu biasa dalam perang. Aku ingin tahu siapa yang membuatkan rencana untuk Liu Bei?",},
        [3850] = {7306,"Cao Cao","Cao Ren","Shan Fu.","Shan Fu.",},
        [3851] = {7306,"Cao Ren","Cao Cao","Siapa itu Shan Fu?","Siapa itu Shan Fu?",},
        [3852] = {7306,"Cao Cao","Cheng Yu","Bukan Shan Fu. Orang ini jago pedang sejak kecil. Di akhir masa tahun Zhongping, dia membunuh untuk membalaskan dendam, berkeliaran lalu ditangkap.","Bukan Shan Fu. Orang ini jago pedang sejak kecil. Di akhir masa tahun Zhongping, dia membunuh untuk membalaskan dendam, berkeliaran lalu ditangkap.",},
        [3853] = {7306,"Cao Cao","Cheng Yu","Ditanya siapa namanya dia tidak menjawab. Pejabat mengikatnya di pilar, dan menabuh genderang di jalanan, meskipun orang mengenalnya, tidak ada yang melaporkannya. Pada akhirnya temannya menyelamatkannya.","Ditanya siapa namanya dia tidak menjawab. Pejabat mengikatnya di pilar, dan menabuh genderang di jalanan, meskipun orang mengenalnya, tidak ada yang melaporkannya. Pada akhirnya temannya menyelamatkannya.",},
        [3854] = {7306,"Cao Cao","Cheng Yu","Lalu mengganti namanya dan melarikan diri, belajar dari orang bijak dan menjadi teman dari Sima Hui. Dia adalah Xu Shu dari Yingchuan, disebut juga Yuan Zhi. Shan Fu hanyalah nama samarannya.","Lalu mengganti namanya dan melarikan diri, belajar dari orang bijak dan menjadi teman dari Sima Hui. Dia adalah Xu Shu dari Yingchuan, disebut juga Yuan Zhi. Shan Fu hanyalah nama samarannya.",},
        [3855] = {7306,"Cheng Yu","Cao Cao","Talenta Xu Shu, bagaimana jika dibandingkan denganmu?","Talenta Xu Shu, bagaimana jika dibandingkan denganmu?",},
        [3856] = {7306,"Cao Cao","Cheng Yu","Sepuluh kali lebih hebat dariku.","Sepuluh kali lebih hebat dariku.",},
        [3857] = {7306,"Cheng Yu","Cao Cao","Sayang sekali talenta sepertinya menjadi milik Liu Bei! Bawahannya semakin kuat, bagaimana ini?","Sayang sekali talenta sepertinya menjadi milik Liu Bei! Bawahannya semakin kuat, bagaimana ini?",},
        [3858] = {7306,"Cao Cao","Cheng Yu","Tidak sulit untuk membuat Xu Shu berpaling kepada kita meskipun saat ini dia bersama Liu Bei.","Tidak sulit untuk membuat Xu Shu berpaling kepada kita meskipun saat ini dia bersama Liu Bei.",},
        [3859] = {7306,"Cheng Yu","Cao Cao","Bagaimana caranya?","Bagaimana caranya?",},
        [3860] = {7306,"Cao Cao","Cheng Yu","Xu Shu adalah anak yang sangat berbakti. Dia kehilangan ayahnya saat kecil dan saat ini ibunya sudah tua. Dengan kematian Xu Kang adiknya, tidak ada lagi yang merawat ibunya.","Xu Shu adalah anak yang sangat berbakti. Dia kehilangan ayahnya saat kecil dan saat ini ibunya sudah tua. Dengan kematian Xu Kang adiknya, tidak ada lagi yang merawat ibunya.",},
        [3861] = {7306,"Cao Cao","Cheng Yu","Perdana menteri bisa mengirim pasukan untuk membujuk ibunya ke Xuchang, menyuruh ibunya mengirimkan surat untuk memanggil anaknya, dengan begitu Xu Shu pasti datang.","Perdana menteri bisa mengirim pasukan untuk membujuk ibunya ke Xuchang, menyuruh ibunya mengirimkan surat untuk memanggil anaknya, dengan begitu Xu Shu pasti datang.",},
        [3862] = {7307,"Liu Bei","Xu Shu","Aku Xu Shu dari Yingchuan, nama lain Yuan Zhi. Karena menemui kesulitan, aku mengganti nama menjadi Shan Fu. Aku dengar Liu Jingsheng merekrut orang, sehingga aku pergi menemuinya dan berbicara, tetapi dia hanyalah orang tidak berguna. Karena itu aku meninggalkan surat tanda perpisahan","Aku Xu Shu dari Yingchuan, nama lain Yuan Zhi. Karena menemui kesulitan, aku mengganti nama menjadi Shan Fu. Aku dengar Liu Jingsheng merekrut orang, sehingga aku pergi menemuinya dan berbicara, tetapi dia hanyalah orang tidak berguna. Karena itu aku meninggalkan surat tanda perpisahan",},
        [3863] = {7307,"Liu Bei","Xu Shu","Aku di tengah malam pergi ke kediaman Tuan Shui Jing, untuk memberitahunya hal ini. Dia bilang aku tidak bisa memutuskan dengan baik. Dia bilang Liu Bei ada di sini, kenapa tidak melayaninya saja?","Aku di tengah malam pergi ke kediaman Tuan Shui Jing, untuk memberitahunya hal ini. Dia bilang aku tidak bisa memutuskan dengan baik. Dia bilang Liu Bei ada di sini, kenapa tidak melayaninya saja?",},
        [3864] = {7307,"Liu Bei","Xu Shu","Karena itulah aku bernyanyi di jalan untuk menarik perhatianmu, berharap kamu bisa merekrutku.","Karena itulah aku bernyanyi di jalan untuk menarik perhatianmu, berharap kamu bisa merekrutku.",},
        [3865] = {7307,"Liu Bei","Xu Shu","Tetapi Cao Cao yang licik menipu ibuku pergi ke Xuchang, dia ditahan dan dalam bahaya, dia menuliskan surat padaku dan harus pergi.","Tetapi Cao Cao yang licik menipu ibuku pergi ke Xuchang, dia ditahan dan dalam bahaya, dia menuliskan surat padaku dan harus pergi.",},
        [3866] = {7307,"Liu Bei","Xu Shu","Bukannya aku tidak ingin melayanimu, tetapi keluargaku dalam bahaya. Kalau begitu permisi, sampai jumpa lagi.","Bukannya aku tidak ingin melayanimu, tetapi keluargaku dalam bahaya. Kalau begitu permisi, sampai jumpa lagi.",},
        [3867] = {7307,"Xu Shu","Liu Bei","Dia ibumu, orang terdekatmu, tidak perlu mempedulikanku. Setelah kamu kembali bersama ibumu, jika ada kesempatan aku ingin belajar darimu lagi.","Dia ibumu, orang terdekatmu, tidak perlu mempedulikanku. Setelah kamu kembali bersama ibumu, jika ada kesempatan aku ingin belajar darimu lagi.",},
        [3868] = {7308,"Liu Bei","Sun Qian","Yuan Zhi sungguh bertalenta, dia mengenali kita setelah lama berada di Xinye. Kini jika dia mengikuti Cao Cao, maka dia ancaman buat kita.","Yuan Zhi sungguh bertalenta, dia mengenali kita setelah lama berada di Xinye. Kini jika dia mengikuti Cao Cao, maka dia ancaman buat kita.",},
        [3869] = {7308,"Liu Bei","Sun Qian","Tuan jangan lepaskan dia. Cao Cao akan memenggal ibunya jika dia tidak pergi melayaninya. Setelah tahu ibunya meninggal, dia akan membantu kita melawan Cao Cao demi membalaskan dendam ibunya.","Tuan jangan lepaskan dia. Cao Cao akan memenggal ibunya jika dia tidak pergi melayaninya. Setelah tahu ibunya meninggal, dia akan membantu kita melawan Cao Cao demi membalaskan dendam ibunya.",},
        [3870] = {7308,"Sun Qian","Liu Bei","Tidak, memanfaatkan anak melalui kematian ibunya adalah cara yang memalukan, memutus hubungan ibu dan anak juga tidak etis. Lebih baik aku mati daripada kehilangan integritasku.","Tidak, memanfaatkan anak melalui kematian ibunya adalah cara yang memalukan, memutus hubungan ibu dan anak juga tidak etis. Lebih baik aku mati daripada kehilangan integritasku.",},
        [3871] = {7309,"Xu Shu","Liu Bei","Sayang sekali, hubungan kita berakhir di sini. Semoga kamu berhasil di bawah kepemimpinan Tuanmu yang baru.","Sayang sekali, hubungan kita berakhir di sini. Semoga kamu berhasil di bawah kepemimpinan Tuanmu yang baru.",},
        [3872] = {7309,"Liu Bei","Xu Shu","Anda tetap memujiku meski talentaku tidak seberapa. Sangat disayangkan pengabdianku harus diputuskan berdasarkan ibuku. Bahkan jika Cao Cao memaksaku, aku juga tidak akan memberikan siasat apapun.","Anda tetap memujiku meski talentaku tidak seberapa. Sangat disayangkan pengabdianku harus diputuskan berdasarkan ibuku. Bahkan jika Cao Cao memaksaku, aku juga tidak akan memberikan siasat apapun.",},
        [3873] = {7309,"Xu Shu","Liu Bei","Berhubung kamu pergi, Liu Bei akan menyendiri di gunung.","Berhubung kamu pergi, Liu Bei akan menyendiri di gunung.",},
        [3874] = {7309,"Liu Bei","Xu Shu","Aku harus sepenuh hati melayanimu. Saat ini karena alasan ibuku, pikiranku kacau. Jika aku tetap di sini, juga tidak akan menghasilkan sesuatu yang baik.","Aku harus sepenuh hati melayanimu. Saat ini karena alasan ibuku, pikiranku kacau. Jika aku tetap di sini, juga tidak akan menghasilkan sesuatu yang baik.",},
        [3875] = {7309,"Liu Bei","Xu Shu","Anda harus mencari penasihat yang lain demi mewujudkan mimpi besarmu. Mengapa malah frustasi begini?","Anda harus mencari penasihat yang lain demi mewujudkan mimpi besarmu. Mengapa malah frustasi begini?",},
        [3876] = {7309,"Xu Shu","Liu Bei","Kamu adalah yang paling bijaksana di dunia.","Kamu adalah yang paling bijaksana di dunia.",},
        [3877] = {7309,"Liu Bei","Xu Shu","Aku hanya orang biasa saja, Anda terlalu tinggi menilaiku.","Aku hanya orang biasa saja, Anda terlalu tinggi menilaiku.",},
        [3878] = {7309,"Xu Shu","Liu Bei","Kita akan berpisah di masa depan, siapa tahu kita akan berjumpa lagi!","Kita akan berpisah di masa depan, siapa tahu kita akan berjumpa lagi!",},
        [3879] = {7309,"Liu Bei","Xu Shu","Anda tidak perlu mengantarku, sampai jumpa!","Anda tidak perlu mengantarku, sampai jumpa!",},
        [3880] = {7309,"Xu Shu","Liu Bei","Sampai jumpa!","Sampai jumpa!",},
        [3881] = {7310,"Xu Shu","Liu Bei","Mengapa kamu kembali?","Mengapa kamu kembali?",},
        [3882] = {7310,"Liu Bei","Xu Shu","Aku melupakan sesuatu karena pikiranku terlalu kacau. Ada orang bijak tinggal di Longzhong, 20 mil dari Xiangyang. Apakah Tuan tidak ingin menemuinya?","Aku melupakan sesuatu karena pikiranku terlalu kacau. Ada orang bijak tinggal di Longzhong, 20 mil dari Xiangyang. Apakah Tuan tidak ingin menemuinya?",},
        [3883] = {7310,"Xu Shu","Liu Bei","Bisakah kamu memintanya menemuiku?","Bisakah kamu memintanya menemuiku?",},
        [3884] = {7310,"Liu Bei","Xu Shu","Dia orang yang penuh gengsi, Tuan harus menemuinya secara pribadi. Ornag ini sama pentingnya seperti Lu Wang bagi Dinasti Zhou, atau Zhang Liang bagi dinasti Han.","Dia orang yang penuh gengsi, Tuan harus menemuinya secara pribadi. Ornag ini sama pentingnya seperti Lu Wang bagi Dinasti Zhou, atau Zhang Liang bagi dinasti Han.",},
        [3885] = {7310,"Xu Shu","Liu Bei","Jika dibandingkan denganmu?","Jika dibandingkan denganmu?",},
        [3886] = {7310,"Liu Bei","Xu Shu","Jika dia adalah naga, aku hanyalah serangga. Jika dia phoenix, aku hanyalah gagak. Dia menilai dirinya sendiri seperti Guan Zhong, atau Le Yi. Tapi bagiku, dia jauh lebih baik.","Jika dia adalah naga, aku hanyalah serangga. Jika dia phoenix, aku hanyalah gagak. Dia menilai dirinya sendiri seperti Guan Zhong, atau Le Yi. Tapi bagiku, dia jauh lebih baik.",},
        [3887] = {7310,"Liu Bei","Xu Shu","Kebijaksanaannya melebihi apapun, tidak ada yang sebaik dia di dunia!","Kebijaksanaannya melebihi apapun, tidak ada yang sebaik dia di dunia!",},
        [3888] = {7310,"Xu Shu","Liu Bei","Siapakah namanya?","Siapakah namanya?",},
        [3889] = {7310,"Liu Bei","Xu Shu","Dia orang Langya, namanya Zhuge Liang. Alias Kong Ming. Dia keturunan Zhuge Feng, komandan pasukan Han.","Dia orang Langya, namanya Zhuge Liang. Alias Kong Ming. Dia keturunan Zhuge Feng, komandan pasukan Han.",},
        [3890] = {7310,"Liu Bei","Xu Shu","Dia tinggal di bukit Wolong, sehingga orang memanggilnya Tuan Wolong.","Dia tinggal di bukit Wolong, sehingga orang memanggilnya Tuan Wolong.",},
        [3891] = {7310,"Liu Bei","Xu Shu","Dia adalah orang paling bijaksana di dunia, Tuan harus cepat menemuinya. Jika dia setuju menjadi penasihatmu, aku yakin Tuan akan menguasai dunia.","Dia adalah orang paling bijaksana di dunia, Tuan harus cepat menemuinya. Jika dia setuju menjadi penasihatmu, aku yakin Tuan akan menguasai dunia.",},
        [3892] = {7310,"Xu Shu","Liu Bei","Dulu Tuan Shui Jing berkata padaku: Naga atau Phoenix, salah satu dari mereka akan menguasai dunia. Orang ini adalah Naga atau Phoenix yang dimaksud?","Dulu Tuan Shui Jing berkata padaku: Naga atau Phoenix, salah satu dari mereka akan menguasai dunia. Orang ini adalah Naga atau Phoenix yang dimaksud?",},
        [3893] = {7310,"Liu Bei","Xu Shu","Phoenix adalah Pang Tong di Xiangyang. Naga adalah Zhuge Kongming.","Phoenix adalah Pang Tong di Xiangyang. Naga adalah Zhuge Kongming.",},
        [3894] = {7310,"Xu Shu","Liu Bei","Akhirnya aku tahu siapa itu Naga dan Phoenix. Ternyata dekat sekali dariku! Jika kamu tidak memberitahuku, mungkin aku masih tidak tahu apa-apa!","Akhirnya aku tahu siapa itu Naga dan Phoenix. Ternyata dekat sekali dariku! Jika kamu tidak memberitahuku, mungkin aku masih tidak tahu apa-apa!",},
        [3895] = {7311,"Zhuge Liang","Xu Shu","Aku awalnya mengabdi kepada Liu Bei, tapa sayangnya, surat dari ibuku memberitahu bahwa dia dipenjara oleh Cao Cao.","Aku awalnya mengabdi kepada Liu Bei, tapa sayangnya, surat dari ibuku memberitahu bahwa dia dipenjara oleh Cao Cao.",},
        [3896] = {7311,"Zhuge Liang","Xu Shu","Sebelum aku pergi, aku merekomendasikanmu kepada Xuan De. Dia akan mengunjungimu dalam waktu dekat. Jangan menolaknya dan mengabdilah padanya dengan segenap kebijaksanaanmu, menjadi penasihatnya sangatlah menjanjikan!","Sebelum aku pergi, aku merekomendasikanmu kepada Xuan De. Dia akan mengunjungimu dalam waktu dekat. Jangan menolaknya dan mengabdilah padanya dengan segenap kebijaksanaanmu, menjadi penasihatnya sangatlah menjanjikan!",},
        [3897] = {7311,"Xu Shu","Zhuge Liang","Kamu mengorbankanku!","Kamu mengorbankanku!",},
        [3898] = {7311,"Zhuge Liang","Xu Shu","Maaf.","Maaf.",},
        [3899] = {7312,"Zhuge Liang","Liu Bei","Aku keturunan Han, seorang pria bodoh dari prefektur Zhuo. Aku mendengar namamu yang melegenda sejak lama.","Aku keturunan Han, seorang pria bodoh dari prefektur Zhuo. Aku mendengar namamu yang melegenda sejak lama.",},
        [3900] = {7312,"Zhuge Liang","Liu Bei","Aku mengunjungimu dua kali tetapi tidak menemukanmu. Aku meninggalkan surat di sini, apakah kamu sudah melihatnya?","Aku mengunjungimu dua kali tetapi tidak menemukanmu. Aku meninggalkan surat di sini, apakah kamu sudah melihatnya?",},
        [3901] = {7312,"Liu Bei","Zhuge Liang","Aku hanyalah orang desa Nanyang, malas sudah menjadi kebiasaanku. Maaf sudah membuatmu datang dua kali. ","Aku hanyalah orang desa Nanyang, malas sudah menjadi kebiasaanku. Maaf sudah membuatmu datang dua kali. ",},
        [3902] = {7312,"Liu Bei","Zhuge Liang","Aku membaca suratmu kemarin, bisa terlihat bahwa kamu mengkhawatirkan rakyat dan negara. Tetapi maaf, aku masih muda dan tidak berpengetahuan, pasti ada kesalahpahaman.","Aku membaca suratmu kemarin, bisa terlihat bahwa kamu mengkhawatirkan rakyat dan negara. Tetapi maaf, aku masih muda dan tidak berpengetahuan, pasti ada kesalahpahaman.",},
        [3903] = {7312,"Zhuge Liang","Liu Bei","Apakah perkataan Sima Hui dan Xu Shu salah? Semoga Tuan tidak membenci statusku, tolong ajari aku.","Apakah perkataan Sima Hui dan Xu Shu salah? Semoga Tuan tidak membenci statusku, tolong ajari aku.",},
        [3904] = {7312,"Liu Bei","Zhuge Liang","Sima Hui dan Xu Shu adalah orang bertalenta, aku hanyalah petani. Bagaimana aku bisa membicarakan urusan negara? Mereka berdua mengatakan hal tidak relevan padamu. Mengapa melepaskan giok demi sebuah batu kasar?","Sima Hui dan Xu Shu adalah orang bertalenta, aku hanyalah petani. Bagaimana aku bisa membicarakan urusan negara? Mereka berdua mengatakan hal tidak relevan padamu. Mengapa melepaskan giok demi sebuah batu kasar?",},
        [3905] = {7312,"Zhuge Liang","Liu Bei","Seorang dengan kebijaksanaan tidak seharusnya menua begitu saja di gunung. Demi rakyat banyak, tolong bantu Liu Bei dengan memberi pencerahan.","Seorang dengan kebijaksanaan tidak seharusnya menua begitu saja di gunung. Demi rakyat banyak, tolong bantu Liu Bei dengan memberi pencerahan.",},
        [3906] = {7312,"Liu Bei","Zhuge Liang","Kalau begitu mari dengarkan apa visimu.","Kalau begitu mari dengarkan apa visimu.",},
        [3907] = {7312,"Zhuge Liang","Liu Bei","Kekaisaran Han sedang jatuh, kekuasaan diperebutkan manusia serakah. Meskipun aku tanpa kekuatan, aku ingin memulihkan negara atas nama kebenaran. Tetapi aku belum membuat progres apapun karena kebodohanku. Aku akan sangat tersanjung jika Tuan mau membantuku memberikan pencerahan.","Kekaisaran Han sedang jatuh, kekuasaan diperebutkan manusia serakah. Meskipun aku tanpa kekuatan, aku ingin memulihkan negara atas nama kebenaran. Tetapi aku belum membuat progres apapun karena kebodohanku. Aku akan sangat tersanjung jika Tuan mau membantuku memberikan pencerahan.",},
        [3908] = {7312,"Liu Bei","Zhuge Liang","Ini adalah peta 54 kota di Xichuan. Cao Cao memiliki keunggulan politik di utara, Sun Quan dengan keunggulan geografis selatan, Tuan memiliki keunggulan dukungan rakyat. ","Ini adalah peta 54 kota di Xichuan. Cao Cao memiliki keunggulan politik di utara, Sun Quan dengan keunggulan geografis selatan, Tuan memiliki keunggulan dukungan rakyat. ",},
        [3909] = {7312,"Liu Bei","Zhuge Liang","Rebut Jingzhou sebagai titik awal, lalu Xichuan untuk mendirikan rezim. Saat fondasi sudah kokoh, Zhongyuan menjadi tujuan berikutnya.","Rebut Jingzhou sebagai titik awal, lalu Xichuan untuk mendirikan rezim. Saat fondasi sudah kokoh, Zhongyuan menjadi tujuan berikutnya.",},
        [3910] = {7312,"Zhuge Liang","Liu Bei","Yang kamu katakan sungguh memberiku pencerahan, seperti langit cerah di balik awan. Tetapi Liu Biao menguasai Jingzhou, Liu Zhang menguasai Yizhou, keduanya anggota kerajaan Han, kerabatku sendiri. Bagaimana aku merebutnya?","Yang kamu katakan sungguh memberiku pencerahan, seperti langit cerah di balik awan. Tetapi Liu Biao menguasai Jingzhou, Liu Zhang menguasai Yizhou, keduanya anggota kerajaan Han, kerabatku sendiri. Bagaimana aku merebutnya?",},
        [3911] = {7312,"Liu Bei","Zhuge Liang","Aku mengamati bintang, Liu Biao tidak lama lagi akan mati, Liu Zhang tidak akan berhasil menjadi pemimpin, tidak lama kemudian akan menjadi milik Tuan.","Aku mengamati bintang, Liu Biao tidak lama lagi akan mati, Liu Zhang tidak akan berhasil menjadi pemimpin, tidak lama kemudian akan menjadi milik Tuan.",},
        [3912] = {7312,"Zhuge Liang","Liu Bei","Aku buka siapa-siapa saat ini, tapi aku harap Tuan bisa tetap membantuku memberi pencerahan. Setiap saran darimu akan aku dengarkan.","Aku buka siapa-siapa saat ini, tapi aku harap Tuan bisa tetap membantuku memberi pencerahan. Setiap saran darimu akan aku dengarkan.",},
        [3913] = {7312,"Liu Bei","Zhuge Liang","Aku lebih suka kehidupan sebagai petani, tidak ingin berkaitan dengan kehidupan luar, maaf aku tidak akan mendengarkan perintahmu.","Aku lebih suka kehidupan sebagai petani, tidak ingin berkaitan dengan kehidupan luar, maaf aku tidak akan mendengarkan perintahmu.",},
        [3914] = {7312,"Zhuge Liang","Liu Bei","Jika Tuan tidak keluar, bagaimana dengan rakyat di luar sana!","Jika Tuan tidak keluar, bagaimana dengan rakyat di luar sana!",},
        [3915] = {7312,"Liu Bei","Zhuge Liang","Berhubung Tuan tidak membenciku, aku bersedia menjadi penasihat Tuan.","Berhubung Tuan tidak membenciku, aku bersedia menjadi penasihat Tuan.",},
        [3916] = {7401,"Sun Quan","Lu Meng","Seorang kapten yang bertempur demi Huang Zu datang untuk mengabdi.","Seorang kapten yang bertempur demi Huang Zu datang untuk mengabdi.",},
        [3917] = {7401,"Lu Meng","Sun Quan","Siapa? Jelaskan lebih rinci!","Siapa? Jelaskan lebih rinci!",},
        [3918] = {7401,"Sun Quan","Lu Meng","Gan Ning, dari Linjiang, prefektur Ba. Tokoh heroik, ahli sastra dan militer.","Gan Ning, dari Linjiang, prefektur Ba. Tokoh heroik, ahli sastra dan militer.",},
        [3919] = {7401,"Sun Quan","Lu Meng","Dia mengikat lonceng tembaga di pinggangnya. Orang kabur saat mendengar loncengnya. Dulunya dia adalah perompak, menggunakan sutra Xichuan sebagai bendera, orang memanggilnya Kapten Bendera Sutra.","Dia mengikat lonceng tembaga di pinggangnya. Orang kabur saat mendengar loncengnya. Dulunya dia adalah perompak, menggunakan sutra Xichuan sebagai bendera, orang memanggilnya Kapten Bendera Sutra.",},
        [3920] = {7401,"Sun Quan","Lu Meng","Dia bermaksud untuk membalas kebaikan, memimpin orang melawan Liu Biao.","Dia bermaksud untuk membalas kebaikan, memimpin orang melawan Liu Biao.",},
        [3921] = {7401,"Sun Quan","Lu Meng","Setelah yakin bahwa Liu Biao pasti gagal, dia datang ke Dong Wu, tetapi Huang Zu menahannya di Xiakou. Saat Wu menyerang Huang Zu, beruntung ada Gan Ning mempertahankan Xiakou, meskipun tidak pernah memperlakukannya dengan baik.","Setelah yakin bahwa Liu Biao pasti gagal, dia datang ke Dong Wu, tetapi Huang Zu menahannya di Xiakou. Saat Wu menyerang Huang Zu, beruntung ada Gan Ning mempertahankan Xiakou, meskipun tidak pernah memperlakukannya dengan baik.",},
        [3922] = {7401,"Sun Quan","Lu Meng","Jenderal Su Fei merekomendasikan Gan Ning ke Huang Zu, tetapi di matanya dia hanyalah seorang perompak. Gan Ning membencinya karena diremehkan.","Jenderal Su Fei merekomendasikan Gan Ning ke Huang Zu, tetapi di matanya dia hanyalah seorang perompak. Gan Ning membencinya karena diremehkan.",},
        [3923] = {7401,"Sun Quan","Lu Meng","Aku memberitahunya bahwa kamu mencari talenta tanpa memandang masa lalu. Tidak salah kan untuk mengabdi kepada Tuan yang sekarang? Karena itu dia senang membawa orangnya menyeberangi sungai untuk menemuimu, tolong berikan keputusanmu.","Aku memberitahunya bahwa kamu mencari talenta tanpa memandang masa lalu. Tidak salah kan untuk mengabdi kepada Tuan yang sekarang? Karena itu dia senang membawa orangnya menyeberangi sungai untuk menemuimu, tolong berikan keputusanmu.",},
        [3924] = {7401,"Lu Meng","Sun Quan","Jenderal Yangwei pernah menyelamatkan Sun Ce saudaraku di Jiangdong, bagaimana menurutmu?","Jenderal Yangwei pernah menyelamatkan Sun Ce saudaraku di Jiangdong, bagaimana menurutmu?",},
        [3925] = {7401,"Sun Quan","Protagonis","Menurutku, Huang Zu akan dikalahkan setelah kita mendapatkan Xingba","Menurutku, Huang Zu akan dikalahkan setelah kita mendapatkan Xingba",},
        [3926] = {7401,"Protagonis","Sun Quan","Bawa dia menghadapku","Bawa dia menghadapku",},
        [3927] = {7402,"Gan Ning","Sun Quan","Aku senang melihatmu di sini Xingba, bagaimana bisa aku dendam padamu? Janganlah curiga padaku. Tolong ajari aku cara mengalahkan Huang Zu.","Aku senang melihatmu di sini Xingba, bagaimana bisa aku dendam padamu? Janganlah curiga padaku. Tolong ajari aku cara mengalahkan Huang Zu.",},
        [3928] = {7402,"Sun Quan","Gan Ning","Saat ini, Han dalam bahaya. Cao Cao akan merebut kekuasaan cepat atau lambat. Pada saat itu, Jingzhou akan menjadi target utamanya. Liu Biao tidak ada masa depan, putranya juga payah, tidak bisa meneruskan tahta. Anda harus mempertimbangkan Jingzhou cepat atau lambat.","Saat ini, Han dalam bahaya. Cao Cao akan merebut kekuasaan cepat atau lambat. Pada saat itu, Jingzhou akan menjadi target utamanya. Liu Biao tidak ada masa depan, putranya juga payah, tidak bisa meneruskan tahta. Anda harus mempertimbangkan Jingzhou cepat atau lambat.",},
        [3929] = {7402,"Sun Quan","Gan Ning","Jika tidak, Cao Cao akan merebut Jingzhou lebih dulu. Tapi saat ini Anda harus fokus mengalahkan Huang Zu. Dia tua, bodoh, dan tidak berpikir panjang. Rakyatnya membencinya, pasukannya tidak menghormati peraturan dan hukum.","Jika tidak, Cao Cao akan merebut Jingzhou lebih dulu. Tapi saat ini Anda harus fokus mengalahkan Huang Zu. Dia tua, bodoh, dan tidak berpikir panjang. Rakyatnya membencinya, pasukannya tidak menghormati peraturan dan hukum.",},
        [3930] = {7402,"Sun Quan","Gan Ning","Jika Tuan menyerangnya, dia akan kalah. Setelah mengalahkan Huang Zu, kita ke barat. Begitulah cara kita menaklukkan kekaisaran.","Jika Tuan menyerangnya, dia akan kalah. Setelah mengalahkan Huang Zu, kita ke barat. Begitulah cara kita menaklukkan kekaisaran.",},
        [3931] = {7402,"Gan Ning","Sun Quan","Saran yang bagus!","Saran yang bagus!",},
        [3932] = {7402,"Gan Ning","Sun Quan","Zhou Yu sebagai marsekal, memimpin pasukan air. Lu Meng dan Jenderal Yangwei sebagai pionir, dengan Dong Xi dan Gan Ning sebagai wakil kapten.","Zhou Yu sebagai marsekal, memimpin pasukan air. Lu Meng dan Jenderal Yangwei sebagai pionir, dengan Dong Xi dan Gan Ning sebagai wakil kapten.",},
        [3933] = {7402,"Gan Ning","Sun Quan","Aku akan memimpin 100000 pasukan untuk menyerang Huang Zu.","Aku akan memimpin 100000 pasukan untuk menyerang Huang Zu.",},
        [3934] = {7403,"","Huang Zu","Mata-mata mengatakan bahwa Sun Quan memimpin 100000 pasukan kemari.","Mata-mata mengatakan bahwa Sun Quan memimpin 100000 pasukan kemari.",},
        [3935] = {7403,"","Huang Zu","Su Fei sebagai Jenderal Besar, Chen Jiu & Deng Long sebagai pionir, memimpin pasukan Jiangxia untuk menyambut musuh.","Su Fei sebagai Jenderal Besar, Chen Jiu & Deng Long sebagai pionir, memimpin pasukan Jiangxia untuk menyambut musuh.",},
        [3936] = {7404,"Sun Quan","Protagonis","Su Fei, Chen Jiu, dan Deng Long sudah kubunuh, pasukan Huang Zu sudah kalah.","Su Fei, Chen Jiu, dan Deng Long sudah kubunuh, pasukan Huang Zu sudah kalah.",},
        [3937] = {7404,"Sun Quan","Protagonis","Pasukan Huang Zu kalah dan meninggalkan Jiangxia, kabur ke Jingzhou.","Pasukan Huang Zu kalah dan meninggalkan Jiangxia, kabur ke Jingzhou.",},
        [3938] = {7404,"Protagonis","Sun Quan","Kejar dia!","Kejar dia!",},
        [3939] = {7405,"Gan Ning","Huang Zu","Aku memperlakukanmu dengan baik, mengapa kamu ingin aku mati?","Aku memperlakukanmu dengan baik, mengapa kamu ingin aku mati?",},
        [3940] = {7405,"Huang Zu","Gan Ning","Saat aku bertarung untukmu, aku berkontribusi sangat banyak, tetapi kamu selalu memandangku sebagai perompak. Kamu bilang begitu apa tidak malu?","Saat aku bertarung untukmu, aku berkontribusi sangat banyak, tetapi kamu selalu memandangku sebagai perompak. Kamu bilang begitu apa tidak malu?",},
        [3941] = {7405,"Huang Zu","Protagonis","Cukup mengobrolnya, bunuh!","Cukup mengobrolnya, bunuh!",},
        [3942] = {7406,"","Sun Quan","Huang Zu sudah mati, bawa kepalanya pulang untuk dipersembahkan ke ayahku.","Huang Zu sudah mati, bawa kepalanya pulang untuk dipersembahkan ke ayahku.",},
        [3943] = {7406,"","Sun Quan","Hadiahi pasukan, angkat Gan Ning menjadi kapten.","Hadiahi pasukan, angkat Gan Ning menjadi kapten.",},
        [3944] = {7406,"Sun Quan","Zhang Zhao","Kota ini tidak perlu dipertahankan, lebih baik kembali ke Jiangdong. Liu Biao tahu aku mengalahkan Huang Zu, pasti akan membalas dendam.","Kota ini tidak perlu dipertahankan, lebih baik kembali ke Jiangdong. Liu Biao tahu aku mengalahkan Huang Zu, pasti akan membalas dendam.",},
        [3945] = {7406,"Sun Quan","Zhang Zhao","Jika kita bersiap, pasti bisa mengalahkan Liu Biao. Kita akan mendapatkan Jingzhou setelah mengalahkan Liu Biao.","Jika kita bersiap, pasti bisa mengalahkan Liu Biao. Kita akan mendapatkan Jingzhou setelah mengalahkan Liu Biao.",},
        [3946] = {7406,"Zhang Zhao","Sun Quan","Baiklah, tinggalkan Jiangxia, semua pasukan kembali ke Jiangdong.","Baiklah, tinggalkan Jiangxia, semua pasukan kembali ke Jiangdong.",},
        [3947] = {7501,"Zhuge Liang","Liu Bei","Liu Biao mengutus orang untuk mengundangku berdiskusi di Jingzhou.","Liu Biao mengutus orang untuk mengundangku berdiskusi di Jingzhou.",},
        [3948] = {7501,"Liu Bei","Zhuge Liang","Pasti karena Jiangdong mengalahkan Huang Zu, dia ingin berdiskusi dengan Tuan untuk membalas dendam. Aku akan pergi menemani Tuan, kita akan berimprovisasi dengan rencana bagus.","Pasti karena Jiangdong mengalahkan Huang Zu, dia ingin berdiskusi dengan Tuan untuk membalas dendam. Aku akan pergi menemani Tuan, kita akan berimprovisasi dengan rencana bagus.",},
        [3949] = {7501,"Zhuge Liang","Liu Bei","Hari ini aku bertemu Jingsheng, aku harus menjawab bagaimana?","Hari ini aku bertemu Jingsheng, aku harus menjawab bagaimana?",},
        [3950] = {7501,"Liu Bei","Zhuge Liang","Berterimakasihlah atas yang terjadi di Xiangyang. Jika dia meminta Tuan untuk menyerang Jiangdong, Tuan tidak perlu mengiyakan. Bilang saja Tuan perlu mengumpulkan pasukan di Xinye.","Berterimakasihlah atas yang terjadi di Xiangyang. Jika dia meminta Tuan untuk menyerang Jiangdong, Tuan tidak perlu mengiyakan. Bilang saja Tuan perlu mengumpulkan pasukan di Xinye.",},
        [3951] = {7502,"Liu Bei","Liu Biao","Aku tahu tentang kamu yang dijebak. Saat itu aku ingin memenggal Cai Mao, tetapi semua orang meminta pengampunanku, sehingga aku mengampuni nyawanya. Maafkan aku sepupu.","Aku tahu tentang kamu yang dijebak. Saat itu aku ingin memenggal Cai Mao, tetapi semua orang meminta pengampunanku, sehingga aku mengampuni nyawanya. Maafkan aku sepupu.",},
        [3952] = {7502,"Liu Biao","Liu Bei","Bukan Jenderal Cai yang melakukannya, bawahannya yang melakukannya.","Bukan Jenderal Cai yang melakukannya, bawahannya yang melakukannya.",},
        [3953] = {7502,"Liu Bei","Liu Biao","Sekarang Jiangxia kalah dan Huang Zu sudah mati, kamu dan aku harus berdiskusi untuk membalasnya.","Sekarang Jiangxia kalah dan Huang Zu sudah mati, kamu dan aku harus berdiskusi untuk membalasnya.",},
        [3954] = {7502,"Liu Biao","Liu Bei","Huang Zu brutal, tidak bisa memanfaatkan orang, sehingga semua itu terjadi padanya. Jika kita ke selatan, bagaimana jika Cao Cao menyerang dari utara?","Huang Zu brutal, tidak bisa memanfaatkan orang, sehingga semua itu terjadi padanya. Jika kita ke selatan, bagaimana jika Cao Cao menyerang dari utara?",},
        [3955] = {7502,"Liu Bei","Liu Biao","Aku tua dan sakit-sakitan, tidak bisa mengurus negara, adik bisa membantuku. Setelah aku mati, kamulah yang menjadi penguasa Jingzhou.","Aku tua dan sakit-sakitan, tidak bisa mengurus negara, adik bisa membantuku. Setelah aku mati, kamulah yang menjadi penguasa Jingzhou.",},
        [3956] = {7502,"Liu Biao","Liu Bei","Ini tanggung jawab yang terlalu besar buatku!","Ini tanggung jawab yang terlalu besar buatku!",},
        [3957] = {7502,"Liu Biao","Liu Bei","Berikan aku waktu untuk berpikir dulu.","Berikan aku waktu untuk berpikir dulu.",},
        [3958] = {7503,"Liu Bei","Zhuge Liang","Jingsheng ingin memberikan Jingzhou padamu, mengapa Tuan menolaknya?","Jingsheng ingin memberikan Jingzhou padamu, mengapa Tuan menolaknya?",},
        [3959] = {7503,"Zhuge Liang","Liu Bei","Bagaimana bisa aku mengambil Jingzhou saat dia lemah tak berdaya?","Bagaimana bisa aku mengambil Jingzhou saat dia lemah tak berdaya?",},
        [3960] = {7503,"Liu Bei","Zhuge Liang","Tuan terlalu baik!","Tuan terlalu baik!",},
        [3961] = {7504,"Liu Bei","Liu Qi","Ibu tiriku ingin aku mati, tolong aku, paman.","Ibu tiriku ingin aku mati, tolong aku, paman.",},
        [3962] = {7504,"Liu Qi","Liu Bei","Ini urusan keluargamu, bagaimana aku ikut campur?","Ini urusan keluargamu, bagaimana aku ikut campur?",},
        [3963] = {7504,"Liu Bei","Liu Qi","Tolong selamatkan aku, paman!","Tolong selamatkan aku, paman!",},
        [3964] = {7504,"Liu Qi","Liu Bei","Aku akan mengirim Kongming padamu, pasti dia memiliki siasat.","Aku akan mengirim Kongming padamu, pasti dia memiliki siasat.",},
        [3965] = {7504,"Liu Bei","Liu Qi","Terimakasih paman.","Terimakasih paman.",},
        [3966] = {7505,"Zhuge Liang","Liu Qi","Ibu tiriku ingin aku mati, tolong Tuan selamatkan aku.","Ibu tiriku ingin aku mati, tolong Tuan selamatkan aku.",},
        [3967] = {7505,"Liu Qi","Zhuge Liang","Aku hanya bertamu di sini, bagaimana aku bisa ikut campur urusan keluarga orang lain? Jika orang lain tahu, aku akan dalam masalah.","Aku hanya bertamu di sini, bagaimana aku bisa ikut campur urusan keluarga orang lain? Jika orang lain tahu, aku akan dalam masalah.",},
        [3968] = {7505,"Zhuge Liang","Liu Qi","Karena kamu adalah tamu, aku akan berhati-hati","Karena kamu adalah tamu, aku akan berhati-hati",},
        [3969] = {7505,"Zhuge Liang","Liu Qi","Ibu tiri ingin aku mati, Tuan tolong selamatkan aku.","Ibu tiri ingin aku mati, Tuan tolong selamatkan aku.",},
        [3970] = {7505,"Liu Qi","Zhuge Liang","Ini bukanlah sesuatu yang aku bisa ikut campur.","Ini bukanlah sesuatu yang aku bisa ikut campur.",},
        [3971] = {7505,"Zhuge Liang","Liu Qi","Ibu tiri ingin aku mati, nyawaku di ujung tanduk, Tuan tega berdiam diri saja tidak menyelamatkanku?","Ibu tiri ingin aku mati, nyawaku di ujung tanduk, Tuan tega berdiam diri saja tidak menyelamatkanku?",},
        [3972] = {7505,"Liu Qi","Zhuge Liang","Aku punya rencana.","Aku punya rencana.",},
        [3973] = {7505,"Zhuge Liang","Liu Qi","Aku dengarkan.","Aku dengarkan.",},
        [3974] = {7505,"Liu Qi","Zhuge Liang","Pernah dengar cerita tentang Shen Sheng dan Chong Er? Shen Sheng mati di dalam, Chong Er di luar dan tetap selamat.","Pernah dengar cerita tentang Shen Sheng dan Chong Er? Shen Sheng mati di dalam, Chong Er di luar dan tetap selamat.",},
        [3975] = {7505,"Liu Qi","Zhuge Liang","Saat ini Huang Zu baru mati, Jiangxia tidak ada yang mempertahankan, mengapa kamu tidak mengajukan diri kepada ayahmu untuk menjadi komandan garnisun? Dengan begitu kamu bisa kabur dari bencana.","Saat ini Huang Zu baru mati, Jiangxia tidak ada yang mempertahankan, mengapa kamu tidak mengajukan diri kepada ayahmu untuk menjadi komandan garnisun? Dengan begitu kamu bisa kabur dari bencana.",},
        [3976] = {7505,"Zhuge Liang","Liu Qi","Terimakasih atas saran Kongming.","Terimakasih atas saran Kongming.",},
        [3977] = {7506,"Liu Bei","Liu Biao","Liu Qi meminta untuk garnisun Jiangxia, aku ragu memutuskan.","Liu Qi meminta untuk garnisun Jiangxia, aku ragu memutuskan.",},
        [3978] = {7506,"Liu Biao","Liu Bei","Jiangxia adalah lokasi penting, harus dijaga oleh anakmu. Urusan timur dan selatan, kamu dan anakmu; Urusan barat dan utara, biar aku yang mengatasi.","Jiangxia adalah lokasi penting, harus dijaga oleh anakmu. Urusan timur dan selatan, kamu dan anakmu; Urusan barat dan utara, biar aku yang mengatasi.",},
        [3979] = {7506,"Liu Bei","Liu Biao","Aku dengar Cao Cao melatih pasukan di danau Xuanwu Prefektur Ye, pasti hendak ke selatan, kita harus bersiap.","Aku dengar Cao Cao melatih pasukan di danau Xuanwu Prefektur Ye, pasti hendak ke selatan, kita harus bersiap.",},
        [3980] = {7506,"Liu Biao","Liu Bei","Jangan khawatir, aku waspada dengan pergerakannya. Aku kembali ke Xinye.","Jangan khawatir, aku waspada dengan pergerakannya. Aku kembali ke Xinye.",},
        [3981] = {7507,"Zhuge Liang","Protagonis","Aku dengar Kongming ingin menikah.","Aku dengar Kongming ingin menikah.",},
        [3982] = {7507,"Zhuge Liang","Protagonis","Aku berkelana ke banyak tempat, mengenal seorang gadis, sangat bertalenta, kamu harus menemuinya.","Aku berkelana ke banyak tempat, mengenal seorang gadis, sangat bertalenta, kamu harus menemuinya.",},
        [3983] = {7507,"Protagonis","Zhuge Liang","Siapa?","Siapa?",},
        [3984] = {7507,"Zhuge Liang","Protagonis","Putri dari cendekiawan Jingzhou, Huang Chengyan, yaitu Huang Yueying.","Putri dari cendekiawan Jingzhou, Huang Chengyan, yaitu Huang Yueying.",},
        [3985] = {7507,"Protagonis","Zhuge Liang","Aku dengar dia jelek, rambutnya kuning, kulitnya gelap, mengapa Jenderal Yangwei merekomendasikannya padaku","Aku dengar dia jelek, rambutnya kuning, kulitnya gelap, mengapa Jenderal Yangwei merekomendasikannya padaku",},
        [3986] = {7507,"Zhuge Liang","Protagonis","Jangan percaya kata orang, kamu harus menemuinya sendiri.","Jangan percaya kata orang, kamu harus menemuinya sendiri.",},
        [3987] = {7508,"Huang Yueying","Zhuge Liang","Orang bilang putri Huang Chengyan jelek.","Orang bilang putri Huang Chengyan jelek.",},
        [3988] = {7508,"Huang Yueying","Zhuge Liang","Hari ini aku tahu semua itu tidak benar, kamu cerdas dan cantik, bertalenta, ahli sastra, dan juga jago beladiri.","Hari ini aku tahu semua itu tidak benar, kamu cerdas dan cantik, bertalenta, ahli sastra, dan juga jago beladiri.",},
        [3989] = {7508,"Huang Yueying","Zhuge Liang","Orang-orang ini buta tidak bisa mengenali permata di Jingzhou.","Orang-orang ini buta tidak bisa mengenali permata di Jingzhou.",},
        [3990] = {7508,"Zhuge Liang","Huang Yueying","Terimakasih atas pujian tuan.","Terimakasih atas pujian tuan.",},
        [3991] = {7508,"Zhuge Liang","Huang Yueying","Aku berikan kipas ini untukmu, tolong disimpan dengan baik.","Aku berikan kipas ini untukmu, tolong disimpan dengan baik.",},
        [3992] = {7508,"Huang Yueying","Zhuge Liang","Mengapa memberiku kipas?","Mengapa memberiku kipas?",},
        [3993] = {7508,"Zhuge Liang","Huang Yueying","Tuan Zhuge, saat kamu membicarakan masalah dunia dengan ayahku, membicarakan ambisi besarmu, auramu sangat impresif, penuh dengan sukacita.","Tuan Zhuge, saat kamu membicarakan masalah dunia dengan ayahku, membicarakan ambisi besarmu, auramu sangat impresif, penuh dengan sukacita.",},
        [3994] = {7508,"Zhuge Liang","Huang Yueying","Tetapi saat membicarakan Cao Cao dan Sun Quan, kamu terlihat khawatir. Aku memberikan kipas ini untuk menyembunyikan wajahmu.","Tetapi saat membicarakan Cao Cao dan Sun Quan, kamu terlihat khawatir. Aku memberikan kipas ini untuk menyembunyikan wajahmu.",},
        [3995] = {7508,"Huang Yueying","Zhuge Liang","Aku paham, seorang pria harus selalu terlihat tenang, tidak boleh terlihat emosinya. Masalah perasaan, tidak boleh terlihat oleh orang lain, jika ketahuan titik lemahnya, dia akan diremehkan dan direndahkan, tidak akan menjadi orang hebat.","Aku paham, seorang pria harus selalu terlihat tenang, tidak boleh terlihat emosinya. Masalah perasaan, tidak boleh terlihat oleh orang lain, jika ketahuan titik lemahnya, dia akan diremehkan dan direndahkan, tidak akan menjadi orang hebat.",},
        [3996] = {7508,"Huang Yueying","Zhuge Liang","Kipas ini tidak akan pernah aku lepaskan mulai saat ini!","Kipas ini tidak akan pernah aku lepaskan mulai saat ini!",},
        [3997] = {7509,"Zhuge Liang","Protagonis","Apakah Huang Yueying sesuai tipemu?","Apakah Huang Yueying sesuai tipemu?",},
        [3998] = {7509,"Protagonis","Zhuge Liang","Cantik dan cerdas, bertalenta, permata berkilau Jingzhou, aku suka!","Cantik dan cerdas, bertalenta, permata berkilau Jingzhou, aku suka!",},
        [3999] = {7509,"Zhuge Liang","Protagonis","Kongming tidak bisa menyembunyikan perasaannya, sangat tidak tenang, hahaha.","Kongming tidak bisa menyembunyikan perasaannya, sangat tidak tenang, hahaha.",},
        [4000] = {7509,"Protagonis","Zhuge Liang","Aku akan melamarnya sekarang juga!","Aku akan melamarnya sekarang juga!",},
        [4001] = {7601,"Cao Cao","Xiahou Dun","Aku dengar pasukan Liu Bei berlatih setiap hari di Xinye. Kita harus segera beraksi sebelum dia menjadi ancaman.","Aku dengar pasukan Liu Bei berlatih setiap hari di Xinye. Kita harus segera beraksi sebelum dia menjadi ancaman.",},
        [4002] = {7601,"Xiahou Dun","Cao Cao","Aku menunjukmu sebagai Jenderal Utama, dengan Yu Jin, Li Dian, Xiahou Lan, dan Han Hao sebagai wakil, pimpin seratus ribu pasukan ke kota Bowang, berjaga terhadap Xinye.","Aku menunjukmu sebagai Jenderal Utama, dengan Yu Jin, Li Dian, Xiahou Lan, dan Han Hao sebagai wakil, pimpin seratus ribu pasukan ke kota Bowang, berjaga terhadap Xinye.",},
        [4003] = {7601,"Cao Cao","Xun Yu","Liu Bei seorang pahlawan, dan kini dia memiliki Zhuge Liang sebagai penasihat, tidak bisa dianggap remeh.","Liu Bei seorang pahlawan, dan kini dia memiliki Zhuge Liang sebagai penasihat, tidak bisa dianggap remeh.",},
        [4004] = {7601,"Xun Yu","Xiahou Dun","Liu Bei bajingan, aku harus menangkapnya.","Liu Bei bajingan, aku harus menangkapnya.",},
        [4005] = {7601,"Xiahou Dun","Xu Shu","Harap jenderal jangan meremehkan Liu Xuande, dengan bantuan Zhuge Liang sekarang, kekuatannya berlipat.","Harap jenderal jangan meremehkan Liu Xuande, dengan bantuan Zhuge Liang sekarang, kekuatannya berlipat.",},
        [4006] = {7601,"Xu Shu","Cao Cao","Siapa itu Zhuge Liang?","Siapa itu Zhuge Liang?",},
        [4007] = {7601,"Cao Cao","Xu Shu","Zhuge Liang, nama lain Kongming, alias Tuan Naga. Kecerdasan setinggi langit, kebijaksanaan selebar lautan. Dia orang paling bijaksana yang pernah ada, tidak bisa diremehkan.","Zhuge Liang, nama lain Kongming, alias Tuan Naga. Kecerdasan setinggi langit, kebijaksanaan selebar lautan. Dia orang paling bijaksana yang pernah ada, tidak bisa diremehkan.",},
        [4008] = {7601,"Xu Shu","Cao Cao","Dibandingkan denganmu?","Dibandingkan denganmu?",},
        [4009] = {7601,"Cao Cao","Xu Shu","Aku tidak berani dibandingkan dengannya, jika dia cahaya bulan, aku hanya kunang-kunang.","Aku tidak berani dibandingkan dengannya, jika dia cahaya bulan, aku hanya kunang-kunang.",},
        [4010] = {7601,"Cao Cao","Xiahou Dun","Tidak bisa. Bagiku Zhuge Liang ini hanya orang biasa, kenapa harus takut padanya? Jika aku tidak bisa menangkap Liu Bei dan Zhuge Liang hidup-hidup, silahkan tuan mengambil nyawaku.","Tidak bisa. Bagiku Zhuge Liang ini hanya orang biasa, kenapa harus takut padanya? Jika aku tidak bisa menangkap Liu Bei dan Zhuge Liang hidup-hidup, silahkan tuan mengambil nyawaku.",},
        [4011] = {7601,"Xiahou Dun","Cao Cao","Aku tunggu berita keberhasilanmu.","Aku tunggu berita keberhasilanmu.",},
        [4012] = {7602,"Zhang Fei","Liu Bei","Cao Cao mengutus Xiahou Dun memimpin seratus ribu pasukan ke Xinye. Kita harus bagaimana?","Cao Cao mengutus Xiahou Dun memimpin seratus ribu pasukan ke Xinye. Kita harus bagaimana?",},
        [4013] = {7602,"Liu Bei","Zhang Fei","Kirim Kongming ke garis depan.","Kirim Kongming ke garis depan.",},
        [4014] = {7602,"Zhang Fei","Liu Bei","Kongming adalah otaknya, kamu adalah ototnya, kenapa kamu menghindari tugasmu?","Kongming adalah otaknya, kamu adalah ototnya, kenapa kamu menghindari tugasmu?",},
        [4015] = {7602,"Liu Bei","Zhang Fei","Huh! Yunchang, ayo kita pergi.","Huh! Yunchang, ayo kita pergi.",},
        [4016] = {7603,"Zhuge Liang","Liu Bei","Kongming, Xiahou Dun memimpin seratus ribu pasukan kemari, bagaimana menghadapinya?","Kongming, Xiahou Dun memimpin seratus ribu pasukan kemari, bagaimana menghadapinya?",},
        [4017] = {7603,"Liu Bei","Zhuge Liang","Aku khawatir Guan Yu dan Zhang Fei tidak akan mendengarkan perintahku. Jika Tuan ingin aku memimpin, aku memerlukan token pedang.","Aku khawatir Guan Yu dan Zhang Fei tidak akan mendengarkan perintahku. Jika Tuan ingin aku memimpin, aku memerlukan token pedang.",},
        [4018] = {7603,"Zhuge Liang","Liu Bei","Aku berikan token pedang padamu.","Aku berikan token pedang padamu.",},
        [4019] = {7604,"Zhang Fei","Liu Bei","Aku sudah memberikan token pedang ke Kongming, kalian harus mendengarkan perintahnya.","Aku sudah memberikan token pedang ke Kongming, kalian harus mendengarkan perintahnya.",},
        [4020] = {7604,"Liu Bei","Zhang Fei","Aku dengarkan, bagaimana taktikmu.","Aku dengarkan, bagaimana taktikmu.",},
        [4021] = {7604,"Zhang Fei","Zhuge Liang","Di sebelah timur Bowang ada gunung bernama Gunung Yu. Di barat ada hutan bernama Hutan An. Tempat yang bagus untuk menyergap.","Di sebelah timur Bowang ada gunung bernama Gunung Yu. Di barat ada hutan bernama Hutan An. Tempat yang bagus untuk menyergap.",},
        [4022] = {7604,"Zhang Fei","Zhuge Liang","Yunchang memimpin seribu pasukan untuk menyergap di gunung Yu, biarkan musuh lewat, ransum pasti ada di belakang. Saat api mulai berkobar di selatan, langsung serang, bakar ransum.","Yunchang memimpin seribu pasukan untuk menyergap di gunung Yu, biarkan musuh lewat, ransum pasti ada di belakang. Saat api mulai berkobar di selatan, langsung serang, bakar ransum.",},
        [4023] = {7604,"Zhang Fei","Zhuge Liang","Yide memimpin seribu pasukan ke Hutan An membelakangi lembah untuk menyergap. Saat melihat api di selatan berkobar, langsung serang. Bakar semua ransum di Bowang.","Yide memimpin seribu pasukan ke Hutan An membelakangi lembah untuk menyergap. Saat melihat api di selatan berkobar, langsung serang. Bakar semua ransum di Bowang.",},
        [4024] = {7604,"Zhang Fei","Zhuge Liang","Guan Ping dan Liu Feng memimpin lima ratus pasukan, persiapkan sinyal api dan tunggu di belakang Bowang. Saat melihat pasukan datang, nyalakan apinya.","Guan Ping dan Liu Feng memimpin lima ratus pasukan, persiapkan sinyal api dan tunggu di belakang Bowang. Saat melihat pasukan datang, nyalakan apinya.",},
        [4025] = {7604,"Zhang Fei","Zhuge Liang","Tarik Zhao Yun dari Fancheng untuk bertarung di garis depan, tetapi harus pura-pura kalah dari pasukan Cao. Tuan harus memimpin pasukan cadangan, semuanya harus sesuai rencana.","Tarik Zhao Yun dari Fancheng untuk bertarung di garis depan, tetapi harus pura-pura kalah dari pasukan Cao. Tuan harus memimpin pasukan cadangan, semuanya harus sesuai rencana.",},
        [4026] = {7604,"Zhuge Liang","Guan Yu","Apa yang kamu lakukan saat kami di luar melawan musuh?","Apa yang kamu lakukan saat kami di luar melawan musuh?",},
        [4027] = {7604,"Guan Yu","Zhuge Liang","Aku hanya duduk menjaga kota.","Aku hanya duduk menjaga kota.",},
        [4028] = {7604,"Zhuge Liang","Zhang Fei","Kami semua bertaruh nyawa, kamu enak-enakan di rumah, egois sekali!","Kami semua bertaruh nyawa, kamu enak-enakan di rumah, egois sekali!",},
        [4029] = {7604,"Zhang Fei","Zhuge Liang","Token Pedang ada di sini, yang melawan akan dieksekusi!","Token Pedang ada di sini, yang melawan akan dieksekusi!",},
        [4030] = {7604,"Zhang Fei","Liu Bei","Apakah kamu tidak pernah mendengar pepatah menang dengan strategi brilian dari ribuan mil? Adik jangan melanggar perintah.","Apakah kamu tidak pernah mendengar pepatah menang dengan strategi brilian dari ribuan mil? Adik jangan melanggar perintah.",},
        [4031] = {7604,"Liu Bei","Zhang Fei","Humph!","Humph!",},
        [4032] = {7604,"Liu Bei","Guan Yu","Kita bisa melihatnya saat taktiknya gagal.","Kita bisa melihatnya saat taktiknya gagal.",},
        [4033] = {7604,"Guan Yu","Zhuge Liang","Tuan bisa memimpin pasukan untuk berkemah di lembah Bowang malam ini. Musuh akan tiba di fajar hari berikutnya, Tuan harus meninggalkan kemah dan kabur, tetapi saat api berkobar, Tuan kembali untuk menghabisinya.","Tuan bisa memimpin pasukan untuk berkemah di lembah Bowang malam ini. Musuh akan tiba di fajar hari berikutnya, Tuan harus meninggalkan kemah dan kabur, tetapi saat api berkobar, Tuan kembali untuk menghabisinya.",},
        [4034] = {7604,"Guan Yu","Zhuge Liang","Aku bersama Mi Zhu dan Mi Fang akan garnisun lima ratus pasukan di kota.","Aku bersama Mi Zhu dan Mi Fang akan garnisun lima ratus pasukan di kota.",},
        [4035] = {7605,"","Xiahou Dun","Xu Yuanzhi di depan perdana menteri memuji Zhuge Liang layaknya dewa, lihatlah pasukan baris depannya, bagai domba yang siap diterkam macan!","Xu Yuanzhi di depan perdana menteri memuji Zhuge Liang layaknya dewa, lihatlah pasukan baris depannya, bagai domba yang siap diterkam macan!",},
        [4036] = {7605,"","Xiahou Dun","Aku menjanjikan perdana menteri untuk menangkap Liu Bei dan Zhuge Liang hidup-hidup, aku akan menepatinya.","Aku menjanjikan perdana menteri untuk menangkap Liu Bei dan Zhuge Liang hidup-hidup, aku akan menepatinya.",},
        [4037] = {7605,"Xiahou Dun","Zhao Yun","Jangan membual! Makan tombakku ini.","Jangan membual! Makan tombakku ini.",},
        [4038] = {7605,"Zhao Yun","Xiahou Dun","Kamu mengikuti Liu Bei, layaknya roh mengikuti hantu!","Kamu mengikuti Liu Bei, layaknya roh mengikuti hantu!",},
        [4039] = {7606,"Xiahou Dun","Li Dian","Zhao Yun hanyalah umpan, takutnya kita bakal disergap.","Zhao Yun hanyalah umpan, takutnya kita bakal disergap.",},
        [4040] = {7606,"Li Dian","Xiahou Dun","Lihatlah mereka, meskipun kita disergap segala arah, aku tidak akan takut!","Lihatlah mereka, meskipun kita disergap segala arah, aku tidak akan takut!",},
        [4041] = {7606,"Li Dian","Xiahou Dun","Maju ke lereng Bowang!","Maju ke lereng Bowang!",},
        [4042] = {7607,"Yu Jin","Li Dian","Siapapun yang meremehkan musuh akan kalah. Jalan di selatan sempit dengan tebing di sisinya.","Siapapun yang meremehkan musuh akan kalah. Jalan di selatan sempit dengan tebing di sisinya.",},
        [4043] = {7607,"Yu Jin","Li Dian","Apa yang harus kita lakukan jika mereka membakar kita saat melewati hutan?","Apa yang harus kita lakukan jika mereka membakar kita saat melewati hutan?",},
        [4044] = {7607,"Li Dian","Yu Jin","Kamu benar. Aku akan ke depan memperingatkan Jenderal Xiahou sementara kamu menahan pasukan di belakang.","Kamu benar. Aku akan ke depan memperingatkan Jenderal Xiahou sementara kamu menahan pasukan di belakang.",},
        [4045] = {7607,"Li Dian","Yu Jin","Pasukan belakang melambat! Jenderal berhenti!","Pasukan belakang melambat! Jenderal berhenti!",},
        [4046] = {7607,"Li Dian","Yu Jin","Jalan di selatan sempit dengan tebing di sisinya, hati-hati dengan api di hutan. ","Jalan di selatan sempit dengan tebing di sisinya, hati-hati dengan api di hutan. ",},
        [4047] = {7607,"Yu Jin","Xiahou Dun","Pasukan jangan memasuki hutan!","Pasukan jangan memasuki hutan!",},
        [4048] = {7608,"","Xiahou Dun","Li Dian dan Yu Jin keduanya memperingatkanku, aku sangat menyesal!","Li Dian dan Yu Jin keduanya memperingatkanku, aku sangat menyesal!",},
        [4049] = {7608,"","Xiahou Dun","Aku kalah hari ini, kumpulkan pasukan yang tersisa, kembali ke Xuchang.","Aku kalah hari ini, kumpulkan pasukan yang tersisa, kembali ke Xuchang.",},
        [4050] = {7609,"Zhuge Liang","Zhang Fei","Kongming sungguh cerdik!","Kongming sungguh cerdik!",},
        [4051] = {7609,"Zhuge Liang","Guan Yu","Kami sungguh mengagumimu.","Kami sungguh mengagumimu.",},
        [4052] = {7609,"Guan Yu","Zhuge Liang","Meskipun Xiahou Dun kalah dan pergi, Cao Cao pasti membawa pasukan lebih banyak kemari.","Meskipun Xiahou Dun kalah dan pergi, Cao Cao pasti membawa pasukan lebih banyak kemari.",},
        [4053] = {7609,"Zhuge Liang","Liu Bei","Apa yang harus kita lakukan?","Apa yang harus kita lakukan?",},
        [4054] = {7609,"Liu Bei","Zhuge Liang","Aku punya rencana menghadapi Pasukan Cao.","Aku punya rencana menghadapi Pasukan Cao.",},
        [4055] = {7609,"Zhuge Liang","Liu Bei","Silahkan Tuan Kongming menjelaskan.","Silahkan Tuan Kongming menjelaskan.",},
        [4056] = {7609,"Liu Bei","Zhuge Liang","Xinye itu kecil, tidak bisa tinggal terlalu lama di sini. Aku dengar Liu Jingsheng sakit keras, kita bisa mengambil kesempatan untuk menjadikan Jingzhou sebagai markas baru kita. Begitulah cara kita melawan Cao Cao.","Xinye itu kecil, tidak bisa tinggal terlalu lama di sini. Aku dengar Liu Jingsheng sakit keras, kita bisa mengambil kesempatan untuk menjadikan Jingzhou sebagai markas baru kita. Begitulah cara kita melawan Cao Cao.",},
        [4057] = {7609,"Zhuge Liang","Liu Bei","Ini rencana bagus, tapi aku berhutang budi ke Jingsheng, aku tidak bisa mengambil Jingzhou darinya!","Ini rencana bagus, tapi aku berhutang budi ke Jingsheng, aku tidak bisa mengambil Jingzhou darinya!",},
        [4058] = {7609,"Liu Bei","Zhuge Liang","Tuan akan menyesalinya nanti!","Tuan akan menyesalinya nanti!",},
        [4059] = {7609,"Zhuge Liang","Liu Bei","Aku lebih baik mati daripada tidak tahu balas budi.","Aku lebih baik mati daripada tidak tahu balas budi.",},
        [4060] = {7609,"Liu Bei","Zhuge Liang","Kalau begitu mari bahas itu lain kali.","Kalau begitu mari bahas itu lain kali.",},
        [4061] = {7701,"Cao Cao","Xiahou Dun","Aku masuk ke dalam siasat Zhuge Liang, menggunakan api untuk menghancurkan pasukan kami.","Aku masuk ke dalam siasat Zhuge Liang, menggunakan api untuk menghancurkan pasukan kami.",},
        [4062] = {7701,"Xiahou Dun","Cao Cao","Kamu ahli militer, bagaimana bisa tidak waspada serangan api di tempat sempit seperti itu?","Kamu ahli militer, bagaimana bisa tidak waspada serangan api di tempat sempit seperti itu?",},
        [4063] = {7701,"Cao Cao","Xiahou Dun","Li Dian dan Yu Jin keduanya memperingatkanku, aku sangat menyesal!","Li Dian dan Yu Jin keduanya memperingatkanku, aku sangat menyesal!",},
        [4064] = {7701,"Xiahou Dun","Cao Cao","Menang kalah itu biasa dalam perang, jangan dimasukkan hati.","Menang kalah itu biasa dalam perang, jangan dimasukkan hati.",},
        [4065] = {7701,"Cao Cao","Xiahou Dun","Liu Bei si gila itu, kita harus menyingkirkannya secepat mungkin.","Liu Bei si gila itu, kita harus menyingkirkannya secepat mungkin.",},
        [4066] = {7701,"Xiahou Dun","Cao Cao","Liu Bei dan Sun Quan adalah ancamanku saat ini, sisanya tidak masalah. Kita harus meratakan Jiangnan sesegera mungkin.","Liu Bei dan Sun Quan adalah ancamanku saat ini, sisanya tidak masalah. Kita harus meratakan Jiangnan sesegera mungkin.",},
        [4067] = {7701,"Xiahou Dun","Cao Cao","Kumpulkan setengah juta pasukan, Cao Ren dan Cao Hong memimpin pasukan pertama. Zhang Liao dan Zhang He memimpin pasukan kedua.","Kumpulkan setengah juta pasukan, Cao Ren dan Cao Hong memimpin pasukan pertama. Zhang Liao dan Zhang He memimpin pasukan kedua.",},
        [4068] = {7701,"Xiahou Dun","Cao Cao","Xiahou Yuan dan Xiahou Dun memimpin pasukan ketiga. Yu Jin dan Li Dian pasukan keempat. Dan aku akan memimpin sendiri pasukan kelima. Setiap pasukan berisi seratus ribu.","Xiahou Yuan dan Xiahou Dun memimpin pasukan ketiga. Yu Jin dan Li Dian pasukan keempat. Dan aku akan memimpin sendiri pasukan kelima. Setiap pasukan berisi seratus ribu.",},
        [4069] = {7701,"Xiahou Dun","Cao Cao","Xu Chu sebagai Jenderal Zhechong, memimpin tiga ribu pasukan sebagai pionir. Kita mulai di Juli tahun 13 Jian'an.","Xu Chu sebagai Jenderal Zhechong, memimpin tiga ribu pasukan sebagai pionir. Kita mulai di Juli tahun 13 Jian'an.",},
        [4070] = {7702,"Cao Cao","Kong Rong","Liu Bei dan Liu Biao keduanya adalah keturunan Han, tidak bisa diremehkan. Sun Quan memiliki 6 wilayah di Sungai Yangtze, juga bukan lawan yang mudah. Aku khawatir dunia tidak akan menyetujui ini.","Liu Bei dan Liu Biao keduanya adalah keturunan Han, tidak bisa diremehkan. Sun Quan memiliki 6 wilayah di Sungai Yangtze, juga bukan lawan yang mudah. Aku khawatir dunia tidak akan menyetujui ini.",},
        [4071] = {7702,"Kong Rong","Cao Cao","Liu Bei, Liu Biao, Sun Quan, semuanya adalah pemberontak, harus disingkirkan!","Liu Bei, Liu Biao, Sun Quan, semuanya adalah pemberontak, harus disingkirkan!",},
        [4072] = {7702,"Kong Rong","Cao Cao","Mundur! Siapapun yang tidak setuju, harus mati.","Mundur! Siapapun yang tidak setuju, harus mati.",},
        [4073] = {7703,"","Kong Rong","Humph!","Humph!",},
        [4074] = {7703,"","Kong Rong","Dia akan kalah dalam perang yang dia mulai sendiri!","Dia akan kalah dalam perang yang dia mulai sendiri!",},
        [4075] = {7704,"Cao Cao","Xi Lu","Kong Rong setiap hari sering mengkritikmu, dan dia berteman dengan Mi Heng. Keduanya saling mendukung satu sama lain.","Kong Rong setiap hari sering mengkritikmu, dan dia berteman dengan Mi Heng. Keduanya saling mendukung satu sama lain.",},
        [4076] = {7704,"Cao Cao","Xi Lu","Mi Heng mempermalukanmu Perdana Menteri, karena dia dihasut oleh Kong Rong.","Mi Heng mempermalukanmu Perdana Menteri, karena dia dihasut oleh Kong Rong.",},
        [4077] = {7704,"Cao Cao","Xi Lu","Kemarin saat dia keluar dari kediamanmu, dia bilang: Dia akan kalah dalam perang yang dia mulai sendiri!","Kemarin saat dia keluar dari kediamanmu, dia bilang: Dia akan kalah dalam perang yang dia mulai sendiri!",},
        [4078] = {7704,"Xi Lu","Cao Cao","Ini penghinaan!","Ini penghinaan!",},
        [4079] = {7704,"Xi Lu","Cao Cao","Tangkap seluruh keluarganya, bunuh semuanya!","Tangkap seluruh keluarganya, bunuh semuanya!",},
        [4080] = {7801,"Liu Bei","Liu Biao","Aku sakit keras, tidak lama lagi akan mati, anakku aku serahkan padamu, adikku. Anakku tidak bertalenta, tidak bisa melanjutkan tahta, setelah aku mati, adik bisa memerintah Jingzhou.","Aku sakit keras, tidak lama lagi akan mati, anakku aku serahkan padamu, adikku. Anakku tidak bertalenta, tidak bisa melanjutkan tahta, setelah aku mati, adik bisa memerintah Jingzhou.",},
        [4081] = {7801,"Liu Biao","Liu Bei","Aku akan melakukan yang terbaik untuk membantu keponakanku, bagaimana mungkin aku memiliki niat lain!","Aku akan melakukan yang terbaik untuk membantu keponakanku, bagaimana mungkin aku memiliki niat lain!",},
        [4082] = {7801,"Liu Biao","Liu Bei","Cao Cao memimpin sendiri pasukan kemari, Xuande kembali dulu ke Xinye, masalah lainnya kita bicarakan lagi nanti.","Cao Cao memimpin sendiri pasukan kemari, Xuande kembali dulu ke Xinye, masalah lainnya kita bicarakan lagi nanti.",},
        [4083] = {7802,"Cai Mao","Liu Qi","Aku dengar ayah sakit keras, karena itu aku dari Jiangxia datang kemari menjenguk.","Aku dengar ayah sakit keras, karena itu aku dari Jiangxia datang kemari menjenguk.",},
        [4084] = {7802,"Liu Qi","Cai Mao","Kamu harus garnisun Jiangxia atas perintah ayahmu, bagaimana jika tiba-tiba Wu menyerang saat kamu meninggalkannya?","Kamu harus garnisun Jiangxia atas perintah ayahmu, bagaimana jika tiba-tiba Wu menyerang saat kamu meninggalkannya?",},
        [4085] = {7802,"Liu Qi","Cai Mao","Jika kamu menemui Tuan sekarang, dia hanya akan tambah marah dan sakitnya bertambah parah, lebih baik kamu segera kembali.","Jika kamu menemui Tuan sekarang, dia hanya akan tambah marah dan sakitnya bertambah parah, lebih baik kamu segera kembali.",},
        [4086] = {7802,"Cai Mao","Liu Qi","Aku…","Aku…",},
        [4087] = {7802,"Cai Mao","Liu Qi","Tolong jaga ayahku baik-baik, jika ada apa=apa segera beritahu aku!","Tolong jaga ayahku baik-baik, jika ada apa=apa segera beritahu aku!",},
        [4088] = {7803,"Cai Mao","Nyonya Cai","Liu Biao sudah meninggal, bagaimana kita menunjuk penerusnya?","Liu Biao sudah meninggal, bagaimana kita menunjuk penerusnya?",},
        [4089] = {7803,"Nyonya Cai","Cai Mao","Kita buat wasiat palsu, kita buat Liu Cong, anak keduanya sebagai penguasa Jingzhou, lalu menggelar pemakaman.","Kita buat wasiat palsu, kita buat Liu Cong, anak keduanya sebagai penguasa Jingzhou, lalu menggelar pemakaman.",},
        [4090] = {7803,"Cai Mao","Nyonya Cai","Baik!","Baik!",},
        [4091] = {7804,"","Liu Cong","Ayahku tiada, saudaraku di Jiangxia, pamanku Xuande di Xinye. Kalian ingin mengangkatku menjadi penguasa, bagaimana aku menjelaskan nanti jika mereka bertanya padaku?","Ayahku tiada, saudaraku di Jiangxia, pamanku Xuande di Xinye. Kalian ingin mengangkatku menjadi penguasa, bagaimana aku menjelaskan nanti jika mereka bertanya padaku?",},
        [4092] = {7804,"Liu Cong","Li Gui","Kamu benar, kita bisa mengirim pesan darurat ke Jiangxia, meminta saudaramu kembali untuk menjadi penguasa Jingzhou, dan meminta Xuande untuk mengatur pemerintahan bersamanya.","Kamu benar, kita bisa mengirim pesan darurat ke Jiangxia, meminta saudaramu kembali untuk menjadi penguasa Jingzhou, dan meminta Xuande untuk mengatur pemerintahan bersamanya.",},
        [4093] = {7804,"Liu Cong","Li Gui","Melawan Cao Cao dari utara dan Sun Quan dari selatan, ini rencana terbaik.","Melawan Cao Cao dari utara dan Sun Quan dari selatan, ini rencana terbaik.",},
        [4094] = {7804,"Li Gui","Cai Mao","Siapa kamu? Beraninya bicara sembarangan dan melanggar perintah Tuan!","Siapa kamu? Beraninya bicara sembarangan dan melanggar perintah Tuan!",},
        [4095] = {7804,"Cai Mao","Li Gui","Kamu bersekongkol dengan lawan, memalsukan wasiat kaisar dan memahkotakan putra bungsu bukan putra sulung. Kamu memberikan sembilan prefektur kepada keluarga Cai. Jika Kaisar masih hidup, kamu pasti akan dihukum mati!","Kamu bersekongkol dengan lawan, memalsukan wasiat kaisar dan memahkotakan putra bungsu bukan putra sulung. Kamu memberikan sembilan prefektur kepada keluarga Cai. Jika Kaisar masih hidup, kamu pasti akan dihukum mati!",},
        [4096] = {7804,"Li Gui","Cai Mao","Eksekusi dia!","Eksekusi dia!",},
        [4097] = {7805,"Wang Can","Liu Cong","Pasukan Cao Cao mendekat, apa yang harus kita lakukan?","Pasukan Cao Cao mendekat, apa yang harus kita lakukan?",},
        [4098] = {7805,"Liu Cong","Wang Can","Bagaimana Jenderal membandingkan dirimu dengan Cao Gong?","Bagaimana Jenderal membandingkan dirimu dengan Cao Gong?",},
        [4099] = {7805,"Wang Can","Liu Cong","Aku lebih lemah darinya.","Aku lebih lemah darinya.",},
        [4100] = {7805,"Liu Cong","Wang Can","Cao Cao memiliki pasukan kuat dan dia juga penuh siasat. Dia mengalahkan Yuan Shao di Guandu, mengejar Liu Bei di Longyou, menghancurkan Wuhuan di Bailang. Dia menghancurkan siapapun yang melawannya.","Cao Cao memiliki pasukan kuat dan dia juga penuh siasat. Dia mengalahkan Yuan Shao di Guandu, mengejar Liu Bei di Longyou, menghancurkan Wuhuan di Bailang. Dia menghancurkan siapapun yang melawannya.",},
        [4101] = {7805,"Liu Cong","Wang Can","Sekarang dia dengan pasukan besar mendatangi kita, sulit untuk mengalahkannya. Fu dan Kuai memiliki rencana. Jenderal tidak boleh ragu, jika tidak maka akan menyesal.","Sekarang dia dengan pasukan besar mendatangi kita, sulit untuk mengalahkannya. Fu dan Kuai memiliki rencana. Jenderal tidak boleh ragu, jika tidak maka akan menyesal.",},
        [4102] = {7805,"Wang Can","Liu Cong","Tuan benar, bagaimana menurut ibu?","Tuan benar, bagaimana menurut ibu?",},
        [4103] = {7805,"Liu Cong","Nyonya Cai","Aku setuju untuk menyerah kepada Cao Cao.","Aku setuju untuk menyerah kepada Cao Cao.",},
        [4104] = {7805,"Nyonya Cai","Liu Cong","Aku akan menyerahkan surat menyerah.","Aku akan menyerahkan surat menyerah.",},
        [4105] = {7806,"","Liu Bei","Cai Mao dan Nyonya Cai tidak melaporkan yang sebenarnya, malah memalsukan untuk membuat Liu Cong sebagai penguasa saat Liu Qi mempertahankan Jiangxia.","Cai Mao dan Nyonya Cai tidak melaporkan yang sebenarnya, malah memalsukan untuk membuat Liu Cong sebagai penguasa saat Liu Qi mempertahankan Jiangxia.",},
        [4106] = {7806,"","Liu Bei","Aku rasa Liu Cong sudah menyerahkan sembilan wilayah di Jingxiang kepada Cao Cao!","Aku rasa Liu Cong sudah menyerahkan sembilan wilayah di Jingxiang kepada Cao Cao!",},
        [4107] = {7806,"","Liu Bei","Berdasarkan pengalihan kekuasaan dari sepupuku, jika aku mengambil kekuasaannya saat ini, bagaimana aku mempertanggungjawabkannya setelah aku mati nanti?","Berdasarkan pengalihan kekuasaan dari sepupuku, jika aku mengambil kekuasaannya saat ini, bagaimana aku mempertanggungjawabkannya setelah aku mati nanti?",},
        [4108] = {7806,"Liu Bei","Protagonis","Sial, aku akan memberi mereka pelajaran.","Sial, aku akan memberi mereka pelajaran.",},
        [4109] = {7807,"Zhuge Liang","Liu Bei","Pasukan Cao saat ini sudah mencapai Wancheng, bagaimana menghadapinya?","Pasukan Cao saat ini sudah mencapai Wancheng, bagaimana menghadapinya?",},
        [4110] = {7807,"Liu Bei","Zhuge Liang","Jangan dilawan, kita ke Fancheng.","Jangan dilawan, kita ke Fancheng.",},
        [4111] = {7807,"Zhuge Liang","Liu Bei","Kita lakukan sesuai rencana Kongming","Kita lakukan sesuai rencana Kongming",},
        [4112] = {7901,"Zhuge Liang","Liu Bei","Pasukan Cao sudah mencapai Bowang, Kongming ayo menyusun rencana bersamaku.","Pasukan Cao sudah mencapai Bowang, Kongming ayo menyusun rencana bersamaku.",},
        [4113] = {7901,"Liu Bei","Zhuge Liang","Jangan khawatir Tuanku. Api sudah membakar separuh pasukan Xiahou Dun, jika mereka datang lagi, mereka pasti terjebak siasat ini.","Jangan khawatir Tuanku. Api sudah membakar separuh pasukan Xiahou Dun, jika mereka datang lagi, mereka pasti terjebak siasat ini.",},
        [4114] = {7901,"Zhuge Liang","Liu Bei","Siasat apa?","Siasat apa?",},
        [4115] = {7901,"Liu Bei","Zhuge Liang","Ada hal yang harus kita siapkan.","Ada hal yang harus kita siapkan.",},
        [4116] = {7901,"Liu Bei","Zhuge Liang","Tolong beritahu rakyat Xinye untuk mengikutiku mencari tempat perlindungan di Fancheng, jika tidak mereka akan membuat diri mereka terbunuh.","Tolong beritahu rakyat Xinye untuk mengikutiku mencari tempat perlindungan di Fancheng, jika tidak mereka akan membuat diri mereka terbunuh.",},
        [4117] = {7902,"Zhuge Liang","Liu Bei","Apa rencanamu?","Apa rencanamu?",},
        [4118] = {7902,"Liu Bei","Zhuge Liang","Sun Qian naik perahu bersama rakyat menyeberangi sungai. Mi Zhu mengawal keluarga pejabat ke Fancheng. Yunchang memimpin seribu pasukan untuk menutup aliran air menggunakan kantong pasir.","Sun Qian naik perahu bersama rakyat menyeberangi sungai. Mi Zhu mengawal keluarga pejabat ke Fancheng. Yunchang memimpin seribu pasukan untuk menutup aliran air menggunakan kantong pasir.",},
        [4119] = {7902,"Liu Bei","Zhuge Liang","Setelah dini hari tiba, saat mendengar ringkikan kuda di hilir, ia mengeluarkan karung pasir untuk menenggelamkan Pasukan Cao, dan mengikuti aliran air untuk membunuh mereka.","Setelah dini hari tiba, saat mendengar ringkikan kuda di hilir, ia mengeluarkan karung pasir untuk menenggelamkan Pasukan Cao, dan mengikuti aliran air untuk membunuh mereka.",},
        [4120] = {7902,"Liu Bei","Zhuge Liang","Di saat yang sama, Zhang Fei memimpin seribu pasukan di dermaga Boling untuk menyergap. Aliran air di daerah itu lambat, pasukan Cao kebanjiran, mereka akan memilih untuk kabur dari dermaga Boling, di sanalah kita akan menyergap.","Di saat yang sama, Zhang Fei memimpin seribu pasukan di dermaga Boling untuk menyergap. Aliran air di daerah itu lambat, pasukan Cao kebanjiran, mereka akan memilih untuk kabur dari dermaga Boling, di sanalah kita akan menyergap.",},
        [4121] = {7902,"Liu Bei","Zhuge Liang","Zhao Yun memimpin tiga ribu pasukan, dibagi menjadi empat tim. Dia mesatu tim untuk menyergap di luar gerbang timur, sementara tiga tim menjaga gerbang barat, selatan, dan utara. Tapi sebelum itu, taruh banyak sulfur pemantik api di atas rumah penduduk.","Zhao Yun memimpin tiga ribu pasukan, dibagi menjadi empat tim. Dia mesatu tim untuk menyergap di luar gerbang timur, sementara tiga tim menjaga gerbang barat, selatan, dan utara. Tapi sebelum itu, taruh banyak sulfur pemantik api di atas rumah penduduk.",},
        [4122] = {7902,"Liu Bei","Zhuge Liang","Setelah pasukan Cao memasuki kota, mereka akan beristirahat di rumah penduduk. Akan ada angin kencang setelah senja. Setelah angin bertiup, perintahkan pasukan di gerbang barat, selatan dan utara untuk menembakkan panah api ke dalam kota.","Setelah pasukan Cao memasuki kota, mereka akan beristirahat di rumah penduduk. Akan ada angin kencang setelah senja. Setelah angin bertiup, perintahkan pasukan di gerbang barat, selatan dan utara untuk menembakkan panah api ke dalam kota.",},
        [4123] = {7902,"Liu Bei","Zhuge Liang","Saat api bertambah besar, buat kegaduhan di luar kota, dan sisakan gerbang timur untuk mereka keluar, di sanalah kita menghabisi mereka.","Saat api bertambah besar, buat kegaduhan di luar kota, dan sisakan gerbang timur untuk mereka keluar, di sanalah kita menghabisi mereka.",},
        [4124] = {7902,"Liu Bei","Zhuge Liang","Saat fajar kembali bersama Guan Yu dan Zhang Fei, tarik pasukan kembali ke Fancheng. Lalu perintahkan Mi Fang dan Liu Feng untuk memimpin masing-masing seribu pasukan, separuh bendera merah, separuh bendera hijau, pergi ke lereng Quewei, 30 mil di luar Xinye ","Saat fajar kembali bersama Guan Yu dan Zhang Fei, tarik pasukan kembali ke Fancheng. Lalu perintahkan Mi Fang dan Liu Feng untuk memimpin masing-masing seribu pasukan, separuh bendera merah, separuh bendera hijau, pergi ke lereng Quewei, 30 mil di luar Xinye ",},
        [4125] = {7902,"Liu Bei","Zhuge Liang","Saat melihat pasukan Cao, pasukan bendera merah berada di kiri, pasukan bendera hijau di kanan. Manusia penuh kecurigaan sepertinya tidak akan berani mengejar. Kalian berdua berpencar untuk menyergap.","Saat melihat pasukan Cao, pasukan bendera merah berada di kiri, pasukan bendera hijau di kanan. Manusia penuh kecurigaan sepertinya tidak akan berani mengejar. Kalian berdua berpencar untuk menyergap.",},
        [4126] = {7902,"Liu Bei","Zhuge Liang","Saat kota mulai terbakar, kalian bisa memburu desertir, dan mencegat di Sungai Bai.","Saat kota mulai terbakar, kalian bisa memburu desertir, dan mencegat di Sungai Bai.",},
        [4127] = {7902,"Zhuge Liang","Liu Bei","Baiklah, setiap jenderal jalankan sesuai rencana.","Baiklah, setiap jenderal jalankan sesuai rencana.",},
        [4128] = {7903,"Cao Ren","Xu Chu","Ada sekelompok pasukan membawa bendera hijau dan merah di lereng Quewei.","Ada sekelompok pasukan membawa bendera hijau dan merah di lereng Quewei.",},
        [4129] = {7903,"Cao Ren","Xu Chu","Di depan pasti hendak menyergap. Kita bermalam di sini saja.","Di depan pasti hendak menyergap. Kita bermalam di sini saja.",},
        [4130] = {7903,"Xu Chu","Cao Ren","Mereka hanyalah pancingan, tidak mungkin ada penyergapan. Kita harus segera menyerang.","Mereka hanyalah pancingan, tidak mungkin ada penyergapan. Kita harus segera menyerang.",},
        [4131] = {7904,"","Cao Ren","Tidak ada seorangpun di kota, pasti sudah dikosongkan.","Tidak ada seorangpun di kota, pasti sudah dikosongkan.",},
        [4132] = {7904,"","Cao Ren","Mereka pasti kehabisan strategi dan membawa keluar seluruh rakyat untuk melarikan diri. Pasukan kita bermalam di sini saja.","Mereka pasti kehabisan strategi dan membawa keluar seluruh rakyat untuk melarikan diri. Pasukan kita bermalam di sini saja.",},
        [4133] = {7904,"","Cao Ren","Pasukan kita kelelahan dan lapar, pilih rumah dan masak makanan.","Pasukan kita kelelahan dan lapar, pilih rumah dan masak makanan.",},
        [4134] = {7905,"Cao Ren","Xu Chu","Ada api di gerbang barat, selatan, dan utara!","Ada api di gerbang barat, selatan, dan utara!",},
        [4135] = {7905,"Xu Chu","Cao Ren","Tidak ada api di gerbang timur, semuanya ke sana.","Tidak ada api di gerbang timur, semuanya ke sana.",},
        [4136] = {7905,"Cao Ren","Zhao Yun","Cao Ren, jangan lari!","Cao Ren, jangan lari!",},
        [4137] = {7905,"Cao Ren","Mi Fang","Bandit, jangan lari!","Bandit, jangan lari!",},
        [4138] = {7905,"Cao Ren","Zhang Fei","Mati kau, bandit Cao!","Mati kau, bandit Cao!",},
        [4139] = {7906,"Cao Cao","Cao Ren","Perdana menteri, kekalahan ini adalah kesalahan kami! ","Perdana menteri, kekalahan ini adalah kesalahan kami! ",},
        [4140] = {7906,"Cao Ren","Cao Cao","Menang kalah itu biasa dalam perang, jangan dimasukkan hati.","Menang kalah itu biasa dalam perang, jangan dimasukkan hati.",},
        [4141] = {7906,"Cao Ren","Cao Cao","Zhuge Liang, petani bedebah, beraninya kau!","Zhuge Liang, petani bedebah, beraninya kau!",},
        [4142] = {7906,"Cao Ren","Cao Cao","Dengarkan perintahku, semua pasukan mencari di Xinye. Penuhi sungai Bai sambil mencari di lembah.","Dengarkan perintahku, semua pasukan mencari di Xinye. Penuhi sungai Bai sambil mencari di lembah.",},
        [4143] = {7906,"Cao Ren","Cao Cao","Bagi pasukan menjadi delapan, bersama rebut Fancheng.","Bagi pasukan menjadi delapan, bersama rebut Fancheng.",},
        [4144] = {8001,"Cao Cao","Liu Ye","Kita ini pendatang di Xiangyang, kita harus merebut hati rakyat lebih dulu. Hari ini Liu Bei memindahkan penduduk Xinye ke Fancheng, jika kita menerobos, kedua wilayah pasti hancur, bagaimana kalau kita beri kesempatan Liu Bei untuk menyerahkan diri lebih dulu?","Kita ini pendatang di Xiangyang, kita harus merebut hati rakyat lebih dulu. Hari ini Liu Bei memindahkan penduduk Xinye ke Fancheng, jika kita menerobos, kedua wilayah pasti hancur, bagaimana kalau kita beri kesempatan Liu Bei untuk menyerahkan diri lebih dulu?",},
        [4145] = {8001,"Cao Cao","Liu Ye","Jika dia menolak, paling tidak kita sudah menunjukkan kemurahan hati kepada penduduk. Jika dia menyerah, maka Jingzhou kita rebut tanpa adanya pengorbanan.","Jika dia menolak, paling tidak kita sudah menunjukkan kemurahan hati kepada penduduk. Jika dia menyerah, maka Jingzhou kita rebut tanpa adanya pengorbanan.",},
        [4146] = {8001,"Liu Ye","Cao Cao","Siapa yang diutus pergi menyampaikan pesan?","Siapa yang diutus pergi menyampaikan pesan?",},
        [4147] = {8001,"Cao Cao","Liu Ye","Xu Shu dan Liu Bei adalah teman baik, dia bersama kita sekarang, bagaimana kalau kita mengutusnya?","Xu Shu dan Liu Bei adalah teman baik, dia bersama kita sekarang, bagaimana kalau kita mengutusnya?",},
        [4148] = {8001,"Liu Ye","Cao Cao","Aku takut dia pergi tidak kembali lagi.","Aku takut dia pergi tidak kembali lagi.",},
        [4149] = {8001,"Cao Cao","Liu Ye","Jika dia tidak kembali, dia akan menjadi bahan ejekan, perdana menteri percayalah padaku.","Jika dia tidak kembali, dia akan menjadi bahan ejekan, perdana menteri percayalah padaku.",},
        [4150] = {8002,"Xu Shu","Cao Cao","Aku ingin menghancurkan Fancheng tetapi aku kasihan kepada nyawa penduduk. Kamu pergilah melobi Liu Bei, jika dia bersedia menyerah, aku akan mengampuninya dan memberikan jabatan. Jika dia melawan, aku akan membantai pasukan dan rakyatnya, dan seluruh harta benda akan dibakar.","Aku ingin menghancurkan Fancheng tetapi aku kasihan kepada nyawa penduduk. Kamu pergilah melobi Liu Bei, jika dia bersedia menyerah, aku akan mengampuninya dan memberikan jabatan. Jika dia melawan, aku akan membantai pasukan dan rakyatnya, dan seluruh harta benda akan dibakar.",},
        [4151] = {8002,"Xu Shu","Cao Cao","Aku tahu kamu orang yang setia, karena itu aku mengutusmu. Jangan kecewakan aku.","Aku tahu kamu orang yang setia, karena itu aku mengutusmu. Jangan kecewakan aku.",},
        [4152] = {8002,"Cao Cao","Xu Shu","Aku akan menyampaikan pesan.","Aku akan menyampaikan pesan.",},
        [4153] = {8003,"Liu Bei","Xu Shu","Cao Cao mengirimku untuk melobi Tuan. Dia seakan peduli dengan nyawa penduduk, padahal aslinya dia sudah memenuhi sungai Bai dengan delapan pasukan. Fancheng bukan tempat untuk dipertahankan lagi, Tuan harus membuat rencana lain.","Cao Cao mengirimku untuk melobi Tuan. Dia seakan peduli dengan nyawa penduduk, padahal aslinya dia sudah memenuhi sungai Bai dengan delapan pasukan. Fancheng bukan tempat untuk dipertahankan lagi, Tuan harus membuat rencana lain.",},
        [4154] = {8003,"Xu Shu","Liu Bei","Berhubung kamu di sini, kamu tinggallah di sini.","Berhubung kamu di sini, kamu tinggallah di sini.",},
        [4155] = {8003,"Liu Bei","Xu Shu","Jika aku tidak kembali, orang akan menertawakanku. Kini ibuku sudah tiada, dan aku memendam kebencian kepada Cao Cao. Meskipun aku adalah bagian dari pasukannya, aku bersumpah tidak akan memberikan saran apapun padanya. Tuan kini memiliki Wolong sebagai penasihat, dunia akan menjadi milik Tuan. Xu Shu pamit dulu.","Jika aku tidak kembali, orang akan menertawakanku. Kini ibuku sudah tiada, dan aku memendam kebencian kepada Cao Cao. Meskipun aku adalah bagian dari pasukannya, aku bersumpah tidak akan memberikan saran apapun padanya. Tuan kini memiliki Wolong sebagai penasihat, dunia akan menjadi milik Tuan. Xu Shu pamit dulu.",},
        [4156] = {8003,"Xu Shu","Liu Bei","Aku tidak akan memaksamu tinggal kalau begitu, sampai jumpa.","Aku tidak akan memaksamu tinggal kalau begitu, sampai jumpa.",},
        [4157] = {8004,"Cao Cao","Xu Shu","Perdana menteri, Xuande tidak bersedia menyerah.","Perdana menteri, Xuande tidak bersedia menyerah.",},
        [4158] = {8004,"Xu Shu","Cao Cao","Kalau begitu aku akan menyerang kota besok!","Kalau begitu aku akan menyerang kota besok!",},
        [4159] = {8005,"Liu Bei","Sun Qian","Rakyat, ikuti Tuan menyeberangi sungai!","Rakyat, ikuti Tuan menyeberangi sungai!",},
        [4160] = {8005,"Sun Qian","Liu Bei","Aku lebih baik mati daripada melihat rakyat mati demi aku!","Aku lebih baik mati daripada melihat rakyat mati demi aku!",},
        [4161] = {8005,"Liu Bei","Sun Qian","Xuande jangan menyalahkan dirimu sendiri!","Xuande jangan menyalahkan dirimu sendiri!",},
        [4162] = {8005,"Liu Bei","Sun Qian","Pasukan Cao segera tiba, Tuan harus bergegas menyeberang!","Pasukan Cao segera tiba, Tuan harus bergegas menyeberang!",},
        [4163] = {8005,"Sun Qian","Liu Bei","Lindungi rakyat, seberangi sungai, menuju Xiangyang.","Lindungi rakyat, seberangi sungai, menuju Xiangyang.",},
        [4164] = {8006,"Liu Cong","Liu Bei","Sepupuku Liu Cong, aku hanya ingin menyelamatkan rakyat, tidak ada maksud lain. Bisakah kamu membukakan gerbang Xinyang.","Sepupuku Liu Cong, aku hanya ingin menyelamatkan rakyat, tidak ada maksud lain. Bisakah kamu membukakan gerbang Xinyang.",},
        [4165] = {8006,"Liu Bei","Liu Cong","Membuka gerbang hanya akan membahayakanku!","Membuka gerbang hanya akan membahayakanku!",},
        [4166] = {8006,"Liu Bei","Wei Yan","Cai Mao dan Zhang Yun adalah pengkhianat! Liu Bei adalah orang baik, dia membawa rakyat untuk mencari perlindungan, bagaimana bisa kita menolaknya!","Cai Mao dan Zhang Yun adalah pengkhianat! Liu Bei adalah orang baik, dia membawa rakyat untuk mencari perlindungan, bagaimana bisa kita menolaknya!",},
        [4167] = {8006,"Liu Bei","Wei Yan","Aku akan menurunkan jembatan, Paman Imperial Liu cepatlah masuk! Bunuh para pengkhianat itu!","Aku akan menurunkan jembatan, Paman Imperial Liu cepatlah masuk! Bunuh para pengkhianat itu!",},
        [4168] = {8006,"Wei Yan","Liu Bei","Jangan menakuti rakyat!","Jangan menakuti rakyat!",},
        [4169] = {8007,"","Liu Bei","Tujuanku adalah melindungi rakyat, jika Xiangyang berbahaya bagi mereka, aku tidak akan membawa mereka kemari!","Tujuanku adalah melindungi rakyat, jika Xiangyang berbahaya bagi mereka, aku tidak akan membawa mereka kemari!",},
        [4170] = {8007,"Liu Bei","Zhuge Liang","Jiangling adalah lokasi penting bagi Jingzhou, bagaimana jika kita memilih Jiangling sebagai markas!","Jiangling adalah lokasi penting bagi Jingzhou, bagaimana jika kita memilih Jiangling sebagai markas!",},
        [4171] = {8007,"Zhuge Liang","Liu Bei","Sesuai keinginanku!","Sesuai keinginanku!",},
        [4172] = {8007,"Zhuge Liang","Liu Bei","Perintahkan semua kapten untuk membawa rakyat meninggalkan jalanan utama Xiangyang, kita pergi ke Jiangling.","Perintahkan semua kapten untuk membawa rakyat meninggalkan jalanan utama Xiangyang, kita pergi ke Jiangling.",},
        [4173] = {8101,"","Cao Cao","Aku menunjuk Kuai Yue sebagai Kepala Prefektur Jiangling dan penguasa Fancheng. Fu Xun, Wang Can sebagai marquis internal, Liu Cong sebagai sekretariat feodal Qingzhou. Jabatan ini efektif per hari ini.","Aku menunjuk Kuai Yue sebagai Kepala Prefektur Jiangling dan penguasa Fancheng. Fu Xun, Wang Can sebagai marquis internal, Liu Cong sebagai sekretariat feodal Qingzhou. Jabatan ini efektif per hari ini.",},
        [4174] = {8101,"Cao Cao","Liu Cong","Aku tidak ingin menjadi pejabat, aku ingin tinggal di rumah orang tuaku.","Aku tidak ingin menjadi pejabat, aku ingin tinggal di rumah orang tuaku.",},
        [4175] = {8101,"Liu Cong","Cao Cao","Qingzhou dekat dengan ibukota, aku menyuruhmu menjadi pejabat, untuk berjaga-jaga jika kamu tiba-tiba dibunuh orang di daerah Jingxiang.","Qingzhou dekat dengan ibukota, aku menyuruhmu menjadi pejabat, untuk berjaga-jaga jika kamu tiba-tiba dibunuh orang di daerah Jingxiang.",},
        [4176] = {8101,"Cao Cao","Liu Cong","Aku mohon Perdana Menteri membatalkan perintah.","Aku mohon Perdana Menteri membatalkan perintah.",},
        [4177] = {8101,"Liu Cong","Cao Cao","Semuanya segera ke posisi! Mundur.","Semuanya segera ke posisi! Mundur.",},
        [4178] = {8101,"Cao Cao","Liu Cong","Baik….","Baik….",},
        [4179] = {8101,"","Cao Cao","Di mana Yu Jin?","Di mana Yu Jin?",},
        [4180] = {8101,"Cao Cao","Yu Jin","Ya, Tuan.","Ya, Tuan.",},
        [4181] = {8101,"Yu Jin","Cao Cao","Pimpin kavaleri untuk membunuh Liu Cong dan ibunya, untuk menghindari masalah di kemudian hari.","Pimpin kavaleri untuk membunuh Liu Cong dan ibunya, untuk menghindari masalah di kemudian hari.",},
        [4182] = {8101,"Cao Cao","Yu Jin","Baik.","Baik.",},
        [4183] = {8102,"Nyonya Cai","Yu Jin","Atas perintah Perdana Menteri, aku di sini untuk membunuhmu! Jangan melawan!","Atas perintah Perdana Menteri, aku di sini untuk membunuhmu! Jangan melawan!",},
        [4184] = {8102,"Yu Jin","Nyonya Cai","Jenderal tolong ampuni kami!","Jenderal tolong ampuni kami!",},
        [4185] = {8102,"Nyonya Cai","Yu Jin","Prajurit, bawa mereka!","Prajurit, bawa mereka!",},
        [4186] = {8103,"Cao Cao","Yu Jin","Liu Bei membawa rakyatnya menempuh sepuluh mil perhari, mungkin total hanya berjarak tiga ratus mil dari kita","Liu Bei membawa rakyatnya menempuh sepuluh mil perhari, mungkin total hanya berjarak tiga ratus mil dari kita",},
        [4187] = {8103,"Yu Jin","Cao Cao","Pilih lima ribu kavaleri untuk berangkat malam ini, tangkap mereka dalam satu hari.","Pilih lima ribu kavaleri untuk berangkat malam ini, tangkap mereka dalam satu hari.",},
        [4188] = {8103,"Yu Jin","Cao Cao","Dan pasukan utama mengikuti dari belakang","Dan pasukan utama mengikuti dari belakang",},
        [4189] = {8104,"","Liu Bei","Angin bertiup kencang, debu menutupi matahari, apa maksudnya?","Angin bertiup kencang, debu menutupi matahari, apa maksudnya?",},
        [4190] = {8104,"Liu Bei","Jian Yong","Itu pertanda buruk Tuanku. Anda harus kabur meninggalkan para penduduk ini Tuanku.","Itu pertanda buruk Tuanku. Anda harus kabur meninggalkan para penduduk ini Tuanku.",},
        [4191] = {8104,"Jian Yong","Liu Bei","Bagaimana aku tega meninggalkan mereka yang sudah mengikuti hingga titik ini sejak di Xinye?","Bagaimana aku tega meninggalkan mereka yang sudah mengikuti hingga titik ini sejak di Xinye?",},
        [4192] = {8104,"Liu Bei","Jian Yong","Jika Tuan ragu, maka tamat sudah.","Jika Tuan ragu, maka tamat sudah.",},
        [4193] = {8104,"Jian Yong","Liu Bei","Apa yang di depan kita?","Apa yang di depan kita?",},
        [4194] = {8104,"Liu Bei","Jian Yong","Itu adalah prefektur Yang. Ada sebuah gunung bernama Jingshan di sana.","Itu adalah prefektur Yang. Ada sebuah gunung bernama Jingshan di sana.",},
        [4195] = {8104,"Jian Yong","Liu Bei","Mari berkemah di gunung.","Mari berkemah di gunung.",},
        [4196] = {8105,"Liu Bei","Mi Fang","Zhao Zilong pergi menuju Cao Cao!","Zhao Zilong pergi menuju Cao Cao!",},
        [4197] = {8105,"Mi Fang","Liu Bei","Zilong adalah teman lamaku, mana mungkin dia berkhianat?","Zilong adalah teman lamaku, mana mungkin dia berkhianat?",},
        [4198] = {8105,"Liu Bei","Zhang Fei","Melihat kita yang semakin lemah, dia menuju Cao Cao demi kekayaan!","Melihat kita yang semakin lemah, dia menuju Cao Cao demi kekayaan!",},
        [4199] = {8105,"Zhang Fei","Liu Bei","Zilong bersamaku melalui banyak kesulitan, kesetiaannya sekeras baja, dia tidak akan goyah karena kekayaan.","Zilong bersamaku melalui banyak kesulitan, kesetiaannya sekeras baja, dia tidak akan goyah karena kekayaan.",},
        [4200] = {8105,"Liu Bei","Mi Fang","Aku melihatnya berkuda ke barat laut.","Aku melihatnya berkuda ke barat laut.",},
        [4201] = {8105,"Liu Bei","Zhang Fei","Aku akan mengejarnya sendiri dan aku akan menusuknya hingga mati jika bertemu!","Aku akan mengejarnya sendiri dan aku akan menusuknya hingga mati jika bertemu!",},
        [4202] = {8105,"Zhang Fei","Liu Bei","Jangan gegabah. Apa kamu lupa Yan Liang dan Wen Chou dibunuh oleh Guan Yu saudaramu? Zilong pergi dengan alasan, aku yakin dia tidak meninggalkanku.","Jangan gegabah. Apa kamu lupa Yan Liang dan Wen Chou dibunuh oleh Guan Yu saudaramu? Zilong pergi dengan alasan, aku yakin dia tidak meninggalkanku.",},
        [4203] = {8105,"Liu Bei","Zhang Fei","Aku akan menunggu di jembatan Changban, kita lihat dia akan kembali atau tidak.","Aku akan menunggu di jembatan Changban, kita lihat dia akan kembali atau tidak.",},
        [4204] = {8106,"","Zhao Yun","Tuanku memercayakan Nyonya Gang dan Nyonya Mi dan juga tuan muda A Dou kepadaku.","Tuanku memercayakan Nyonya Gang dan Nyonya Mi dan juga tuan muda A Dou kepadaku.",},
        [4205] = {8106,"","Zhao Yun","Jika mereka hilang, apa aku masih punya muka untuk menemui tuanku? Lebih baik aku mempertaruhkan nyawa untuk menemukan nyonya dan tuan muda!","Jika mereka hilang, apa aku masih punya muka untuk menemui tuanku? Lebih baik aku mempertaruhkan nyawa untuk menemukan nyonya dan tuan muda!",},
        [4206] = {8107,"Jian Yong","Zhao Yun","Apakah kamu pernah melihat dua nyonya besar?","Apakah kamu pernah melihat dua nyonya besar?",},
        [4207] = {8107,"Zhao Yun","Jian Yong","Mereka berpisah dari barisan dan membawa A Dou pergi.","Mereka berpisah dari barisan dan membawa A Dou pergi.",},
        [4208] = {8107,"Zhao Yun","Jian Yong","Aku mencoba mengejar mereka. Setelah memutari lereng, seorang prajurit menusukku dan mengambil kudaku.","Aku mencoba mengejar mereka. Setelah memutari lereng, seorang prajurit menusukku dan mengambil kudaku.",},
        [4209] = {8107,"Zhao Yun","Jian Yong","Aku hanya melihat Nyonya Gan berlari ke arah selatan mengikuti sekumpulan gadis.","Aku hanya melihat Nyonya Gan berlari ke arah selatan mengikuti sekumpulan gadis.",},
        [4210] = {8107,"Jian Yong","Zhao Yun","Kamu kendarai kudaku kembali ke Xuande, beritahu dia bahwa aku akan membawa kembali kedua nyonya dan tuan muda apapun resikonya.","Kamu kendarai kudaku kembali ke Xuande, beritahu dia bahwa aku akan membawa kembali kedua nyonya dan tuan muda apapun resikonya.",},
        [4211] = {8107,"Jian Yong","Zhao Yun","Jika aku tidak bisa menemukannya, aku rela mati di medan perang!","Jika aku tidak bisa menemukannya, aku rela mati di medan perang!",},
        [4212] = {8108,"Liu Bei","Jian Yong","Zilong menyelamatkanku dari musuh, dia memintaku kembali kepada Tuan untuk melapor.","Zilong menyelamatkanku dari musuh, dia memintaku kembali kepada Tuan untuk melapor.",},
        [4213] = {8108,"Liu Bei","Jian Yong","Dia akan membawa kembali kedua nyonya dan tuan muda apapun resikonya, jika tidak ketemu, dia rela mati di medan perang!","Dia akan membawa kembali kedua nyonya dan tuan muda apapun resikonya, jika tidak ketemu, dia rela mati di medan perang!",},
        [4214] = {8108,"Jian Yong","Liu Bei","Zilong melakukan tugas berbahaya, bagaimana baiknya?","Zilong melakukan tugas berbahaya, bagaimana baiknya?",},
        [4215] = {8108,"Liu Bei","Protagonis","Xuande jangan khawatir, aku akan pergi membantu Zilong, mencari kedua nyonya dan A Dou.","Xuande jangan khawatir, aku akan pergi membantu Zilong, mencari kedua nyonya dan A Dou.",},
        [4216] = {8108,"Protagonis","Liu Bei","Baiklah, adik keempat hati-hatilah.","Baiklah, adik keempat hati-hatilah.",},
        [4217] = {8109,"","Zhao Yun","Apakah Nyonya Gan ada di antara kalian?","Apakah Nyonya Gan ada di antara kalian?",},
        [4218] = {8109,"Zhao Yun","Nyonya Gan","Zilong!","Zilong!",},
        [4219] = {8109,"Nyonya Gan","Zhao Yun","Ini salahku hingga nyonya sampai berpisah dari kerumunan! Di manakah Nyonya Mi dan Tuan Muda berada?","Ini salahku hingga nyonya sampai berpisah dari kerumunan! Di manakah Nyonya Mi dan Tuan Muda berada?",},
        [4220] = {8109,"Zhao Yun","Nyonya Gan","Aku dan Nyonya Mi terpisah dari kerumunan, kami berjalan bersama rakyat dan pasukan musuh memisahkan kita.","Aku dan Nyonya Mi terpisah dari kerumunan, kami berjalan bersama rakyat dan pasukan musuh memisahkan kita.",},
        [4221] = {8109,"Zhao Yun","Nyonya Gan","Aku tidak tahu Nyonya Mi dan A Dou di mana, aku kemari sendirian.","Aku tidak tahu Nyonya Mi dan A Dou di mana, aku kemari sendirian.",},
        [4222] = {8109,"Nyonya Gan","Zhao Yun","Naiklah ke atas kuda Nyonya Gan, aku akan membukakan jalan dan mengirimkanmu ke Changban.","Naiklah ke atas kuda Nyonya Gan, aku akan membukakan jalan dan mengirimkanmu ke Changban.",},
        [4223] = {8110,"Zhao Yun","Zhang Fei","Zilong! Beraninya kamu mengkhianati kakakku?","Zilong! Beraninya kamu mengkhianati kakakku?",},
        [4224] = {8110,"Zhang Fei","Zhao Yun","Aku pergi mencari nyonya dan tuan muda yang hilang, mengapa kamu bilang aku berkhianat?","Aku pergi mencari nyonya dan tuan muda yang hilang, mengapa kamu bilang aku berkhianat?",},
        [4225] = {8110,"Zhao Yun","Zhang Fei","Jika bukan karena laporan Jian Yong, aku tidak akan mengampuni nyawamu! ","Jika bukan karena laporan Jian Yong, aku tidak akan mengampuni nyawamu! ",},
        [4226] = {8110,"Zhang Fei","Zhao Yun","Di mana Tuan?","Di mana Tuan?",},
        [4227] = {8110,"Zhao Yun","Zhang Fei","Di depan tidak jauh.","Di depan tidak jauh.",},
        [4228] = {8110,"Zhang Fei","Zhao Yun","Kawan Nyonya Gan ke depan, aku akan kembali pergi mencari Nyonya Mi dan Tuan Muda.","Kawan Nyonya Gan ke depan, aku akan kembali pergi mencari Nyonya Mi dan Tuan Muda.",},
        [4229] = {8110,"Zhao Yun","Zhang Fei","Hati-hatilah Zilong, Jenderal Yangwei pergi ke arah musuh untuk mencari Nyonya Kedua dan A Dou.","Hati-hatilah Zilong, Jenderal Yangwei pergi ke arah musuh untuk mencari Nyonya Kedua dan A Dou.",},
        [4230] = {8110,"Zhang Fei","Zhao Yun","Baiklah, aku akan pergi bergabung dengan Jenderal Yangwei untuk bersama menyelamatkan Nyonya Kedua dan A Dou. ","Baiklah, aku akan pergi bergabung dengan Jenderal Yangwei untuk bersama menyelamatkan Nyonya Kedua dan A Dou. ",},
        [4231] = {8111,"Nyonya Mi","Zhao Yun","Maafkan Zilong terlambat.","Maafkan Zilong terlambat.",},
        [4232] = {8111,"Zhao Yun","Nyonya Mi","Senang melihatmu jenderal, A Dou akan bertahan hidup. Kehidupan sudah terlalu berat untuk ayahnya, A Dou segalanya yang dia punya saat ini.","Senang melihatmu jenderal, A Dou akan bertahan hidup. Kehidupan sudah terlalu berat untuk ayahnya, A Dou segalanya yang dia punya saat ini.",},
        [4233] = {8111,"Zhao Yun","Nyonya Mi","Jika jenderal mampu membawanya bertemu ayahnya, aku akan mati tanpa penyesalan!","Jika jenderal mampu membawanya bertemu ayahnya, aku akan mati tanpa penyesalan!",},
        [4234] = {8111,"Nyonya Mi","Zhao Yun","Ini semua salahku hingga nyonya menderita. Nyonya segeralah naik ke kuda, aku akan membukakan jalan keluar dari kepungan dengan berjalan kaki.","Ini semua salahku hingga nyonya menderita. Nyonya segeralah naik ke kuda, aku akan membukakan jalan keluar dari kepungan dengan berjalan kaki.",},
        [4235] = {8111,"Zhao Yun","Nyonya Mi","Tidak! Kamu harus menaiki kuda! Nyawa anak ini di tanganmu. Aku terluka parah, matipun tidak masalah!","Tidak! Kamu harus menaiki kuda! Nyawa anak ini di tanganmu. Aku terluka parah, matipun tidak masalah!",},
        [4236] = {8111,"Zhao Yun","Nyonya Mi","Jenderal cepatlah bawa anak ini pergi, aku hanya menjadi beban.","Jenderal cepatlah bawa anak ini pergi, aku hanya menjadi beban.",},
        [4237] = {8111,"Nyonya Mi","Zhao Yun","Aku bisa mendengar musuh mendekat, cepatlah nyonya naik ke atas kuda.","Aku bisa mendengar musuh mendekat, cepatlah nyonya naik ke atas kuda.",},
        [4238] = {8111,"Zhao Yun","Nyonya Mi","Aku tidak akan sanggup. Jangan ragu lagi, pergilah.","Aku tidak akan sanggup. Jangan ragu lagi, pergilah.",},
        [4239] = {8111,"Zhao Yun","Nyonya Mi","Nyawa anak ini ada di tanganmu! (Nyonya Mi menyerahkan A Dou kepada Zhao Yun.)","Nyawa anak ini ada di tanganmu! (Nyonya Mi menyerahkan A Dou kepada Zhao Yun.)",},
        [4240] = {8111,"Nyonya Mi","Zhao Yun","Karena nyonya memaksa, jika nanti pasukan musuh datang, apa yang akan Anda lakukan?","Karena nyonya memaksa, jika nanti pasukan musuh datang, apa yang akan Anda lakukan?",},
        [4241] = {8111,"Zhao Yun","Nyonya Mi","A Dou aku serahkan padamu. (Nyonya Mi menaruh A Dou di tanah, lalu dirinya bunuh diri dengan melompat ke sumur.)","A Dou aku serahkan padamu. (Nyonya Mi menaruh A Dou di tanah, lalu dirinya bunuh diri dengan melompat ke sumur.)",},
        [4242] = {8111,"Nyonya Mi","Zhao Yun","Nyonya Mi! (Melihat Nyonya Mi meninggal, Zhao Yun menutup sumur dengan reruntuhan dinding untuk mencegah pasukan Cao mengambil jasadnya. Dia melepas zirahnya untuk bisa membawa A Dou di pelukannya, membawa senjatanya, lalu pergi).","Nyonya Mi! (Melihat Nyonya Mi meninggal, Zhao Yun menutup sumur dengan reruntuhan dinding untuk mencegah pasukan Cao mengambil jasadnya. Dia melepas zirahnya untuk bisa membawa A Dou di pelukannya, membawa senjatanya, lalu pergi).",},
        [4243] = {8112,"Zhao Yun","Protagonis","Zi Long! Apakah kamu sudah menemukan nyonya dan A Dou?","Zi Long! Apakah kamu sudah menemukan nyonya dan A Dou?",},
        [4244] = {8112,"Protagonis","Zhao Yun","Nyonya Gan sudah menyeberangi Jembatan Changban dengan selamat.","Nyonya Gan sudah menyeberangi Jembatan Changban dengan selamat.",},
        [4245] = {8112,"Protagonis","Zhao Yun","A Dou ada bersamaku, Nyonya Mi…","A Dou ada bersamaku, Nyonya Mi…",},
        [4246] = {8112,"Zhao Yun","Protagonis","Nyonya Mi kenapa?","Nyonya Mi kenapa?",},
        [4247] = {8112,"Protagonis","Zhao Yun","Nyonya Mi terluka parah. Tidak ingin menjadi beban, dia bunuh diri melompat ke sumur kering…","Nyonya Mi terluka parah. Tidak ingin menjadi beban, dia bunuh diri melompat ke sumur kering…",},
        [4248] = {8112,"Zhao Yun","Protagonis","Dia mati demi keturunan Tuan kita, sungguh heroik.","Dia mati demi keturunan Tuan kita, sungguh heroik.",},
        [4249] = {8112,"Zhao Yun","Protagonis","Zilong, cepatlah! Kita harus menerobos formasi Pasukan Cao, kita tidak boleh menyia-nyiakan pengorbanan Nyonya Mi.","Zilong, cepatlah! Kita harus menerobos formasi Pasukan Cao, kita tidak boleh menyia-nyiakan pengorbanan Nyonya Mi.",},
        [4250] = {8201,"Zhang Fei","Zhao Yun","Ada musuh mengejarku, tolong aku Yide!","Ada musuh mengejarku, tolong aku Yide!",},
        [4251] = {8201,"Zhao Yun","Zhang Fei","Cepatlah Zilong, aku akan menghadang mereka.","Cepatlah Zilong, aku akan menghadang mereka.",},
        [4252] = {8202,"Liu Bei","Zhao Yun","Zhao Yun bersalah kepada Tuan, aku pantas mati! Nyonya Mi terluka parah dan tidak bersedia naik ke kuda, memilih untuk mati dengan melompat ke sumur, aku hanya bisa menutupinya dengan runtuhan dinding.","Zhao Yun bersalah kepada Tuan, aku pantas mati! Nyonya Mi terluka parah dan tidak bersedia naik ke kuda, memilih untuk mati dengan melompat ke sumur, aku hanya bisa menutupinya dengan runtuhan dinding.",},
        [4253] = {8202,"Liu Bei","Zhao Yun","Aku hanya bisa membawa tuan muda menerobos kepungan, kebetulan Jenderal Yangwei membantuku tepat waktu.","Aku hanya bisa membawa tuan muda menerobos kepungan, kebetulan Jenderal Yangwei membantuku tepat waktu.",},
        [4254] = {8202,"Liu Bei","Zhao Yun","Untungnya tuan muda tidak kenapa-kenapa! (Zhao Yun menyerahkan A Dou ke Xuande.)","Untungnya tuan muda tidak kenapa-kenapa! (Zhao Yun menyerahkan A Dou ke Xuande.)",},
        [4255] = {8202,"Zhao Yun","Liu Bei","Demi bocah ini, Jenderal Yangwei dan Zilong jadi dalam bahaya! (Xuande setelah menerima A Dou kemudian melemparkannya ke tanah.)","Demi bocah ini, Jenderal Yangwei dan Zilong jadi dalam bahaya! (Xuande setelah menerima A Dou kemudian melemparkannya ke tanah.)",},
        [4256] = {8202,"Liu Bei","Zhao Yun","Aku rela mati demi tuan muda! (Zhao Yun langsung memeluk A Dou.)","Aku rela mati demi tuan muda! (Zhao Yun langsung memeluk A Dou.)",},
        [4257] = {8203,"Cao Cao","Yue Jin","Jenderal musuh Zhang Fei terlihat di Jembatan Changban dengan wajah penuh brewok, mata marah, sambil memegang Tombak Ular!","Jenderal musuh Zhang Fei terlihat di Jembatan Changban dengan wajah penuh brewok, mata marah, sambil memegang Tombak Ular!",},
        [4258] = {8203,"Cao Cao","Yue Jin","Debu menutupi hutan di sebelah timur jembatan, takutnya ini adalah siasat dari Zhuge Kongming.","Debu menutupi hutan di sebelah timur jembatan, takutnya ini adalah siasat dari Zhuge Kongming.",},
        [4259] = {8203,"Yue Jin","Cao Cao","Aku pernah dengar Yunchang berkata bahwa Yide bisa memenggal kepala jenderal pasukan dengan mudahnya meskipun dilindungi jutaan pasukan.","Aku pernah dengar Yunchang berkata bahwa Yide bisa memenggal kepala jenderal pasukan dengan mudahnya meskipun dilindungi jutaan pasukan.",},
        [4260] = {8203,"Yue Jin","Cao Cao","Akhirnya kita bertemu dengannya hari ini, tidak peduli apakah ini siasat dari Kongming, kita tidak boleh menganggap remeh.","Akhirnya kita bertemu dengannya hari ini, tidak peduli apakah ini siasat dari Kongming, kita tidak boleh menganggap remeh.",},
        [4261] = {8204,"Cao Cao","Zhang Fei","Zhang Fei orang Yan ada di sini! Siapa berani menantang maut? ","Zhang Fei orang Yan ada di sini! Siapa berani menantang maut? ",},
        [4262] = {8204,"Cao Cao","Zhang Fei","Maju ga maju, mundur ga mundur, gimana maunya!","Maju ga maju, mundur ga mundur, gimana maunya!",},
        [4263] = {8204,"Zhang Fei","Cao Cao","Pasukan, pergi ke barat, putari jembatan Changban.","Pasukan, pergi ke barat, putari jembatan Changban.",},
        [4264] = {8205,"Cao Cao","Zhang Liao","Tenang perdana menteri. Zhang Fei seorang diri, kita tidak perlu takut! Mari kita mundur dulu untuk menangkap Liu Bei hidup-hidup.","Tenang perdana menteri. Zhang Fei seorang diri, kita tidak perlu takut! Mari kita mundur dulu untuk menangkap Liu Bei hidup-hidup.",},
        [4265] = {8205,"Zhang Liao","Cao Cao","Kamu cepatlah bersama Xu Chu ke jembatan Changban untuk mencari informasi.","Kamu cepatlah bersama Xu Chu ke jembatan Changban untuk mencari informasi.",},
        [4266] = {8206,"Cao Cao","Zhang Liao","Zhang Fei sudah pergi dan jembatannya sudah hancur.","Zhang Fei sudah pergi dan jembatannya sudah hancur.",},
        [4267] = {8206,"Zhang Liao","Cao Cao","Dia melakukan ini karena terintimidasi.","Dia melakukan ini karena terintimidasi.",},
        [4268] = {8206,"Zhang Liao","Cao Cao","Perintahkan pasukan untuk dengan cepat membangun jembatan apung, kita akan menyeberangi sungai malam ini.","Perintahkan pasukan untuk dengan cepat membangun jembatan apung, kita akan menyeberangi sungai malam ini.",},
        [4269] = {8206,"Cao Cao","Li Dian","Mungkin saja ini juga siasat dari Zhuge Liang, kita tidak boleh lengah.","Mungkin saja ini juga siasat dari Zhuge Liang, kita tidak boleh lengah.",},
        [4270] = {8206,"Li Dian","Cao Cao","Zhang Fei hanyalah petarung bodoh, dia tidak mengerti siasat!","Zhang Fei hanyalah petarung bodoh, dia tidak mengerti siasat!",},
        [4271] = {8207,"Protagonis","Liu Bei","Sungai besar di depan sementara kita dikejar, apa yang harus kita lakukan?","Sungai besar di depan sementara kita dikejar, apa yang harus kita lakukan?",},
        [4272] = {8207,"Liu Bei","Protagonis","Jangan ragu, aku dan Zilong di sini!","Jangan ragu, aku dan Zilong di sini!",},
        [4273] = {8208,"","Cao Cao","Saat ini Liu Bei seperti ikan di dalam gentong, jika kita tidak menangkapnya, dia akan seperti ikan yang masuk bebas ke laut.","Saat ini Liu Bei seperti ikan di dalam gentong, jika kita tidak menangkapnya, dia akan seperti ikan yang masuk bebas ke laut.",},
        [4274] = {8208,"","Cao Cao","Pasukan, maju!","Pasukan, maju!",},
        [4275] = {8208,"Cao Cao","Guan Yu","Aku sudah menunggu lama di sini! (Guan Yu pergi ke Jiangxia untuk meminjam sepuluh ribu pasukan. Dia secara khusus mencegat di sini setelah mendengar tentang Perang Lereng Changban.)","Aku sudah menunggu lama di sini! (Guan Yu pergi ke Jiangxia untuk meminjam sepuluh ribu pasukan. Dia secara khusus mencegat di sini setelah mendengar tentang Perang Lereng Changban.)",},
        [4276] = {8208,"Guan Yu","Cao Cao","Lagi-lagi kita terjebak siasat Zhuge Liang!","Lagi-lagi kita terjebak siasat Zhuge Liang!",},
        [4277] = {8208,"Guan Yu","Cao Cao","Pasukan, mundur!","Pasukan, mundur!",},
        [4278] = {8301,"","Cao Cao","Kini Liu Bei ke Jiangxia, takutnya dia beraliansi dengan Dongwu, ini masalah baru, apakah ada rencana?","Kini Liu Bei ke Jiangxia, takutnya dia beraliansi dengan Dongwu, ini masalah baru, apakah ada rencana?",},
        [4279] = {8301,"Cao Cao","Xun You","Kita tunjukkan kekuatan besar kita, kirim utusan ke Jiangdong, meminta Sun Quan untuk menangkap Liu Bei di Jiangxia. Lalu kita membagi wilayah Jingzhou, menjadi aliansi bagi mereka.","Kita tunjukkan kekuatan besar kita, kirim utusan ke Jiangdong, meminta Sun Quan untuk menangkap Liu Bei di Jiangxia. Lalu kita membagi wilayah Jingzhou, menjadi aliansi bagi mereka.",},
        [4280] = {8301,"Cao Cao","Xun You","Sun Quan akan menyerah, dan rencanaku akan berhasil.","Sun Quan akan menyerah, dan rencanaku akan berhasil.",},
        [4281] = {8301,"Xun You","Cao Cao","Baiklah, lakukan sesuai rencanamu, cepat kirim utusan ke Dongwu.","Baiklah, lakukan sesuai rencanamu, cepat kirim utusan ke Dongwu.",},
        [4282] = {8302,"Sun Quan","Lu Su","Jingzhou ada di sebelah kita, strategis, makmur. Jika memilikinya, maka akan menjadi langkah penting bagi kita untuk menguasai negara.","Jingzhou ada di sebelah kita, strategis, makmur. Jika memilikinya, maka akan menjadi langkah penting bagi kita untuk menguasai negara.",},
        [4283] = {8302,"Sun Quan","Lu Su","Liu Biao baru saja mati, Liu Bei baru saja kalah. Kini aku menuju Jiangxia untuk menunjukkan belasungkawa, aku bertujuan untuk meyakinkan Liu Bei memimpin pasukan milik Liu Biao, bersama kita mengalahkan Cao Cao.","Liu Biao baru saja mati, Liu Bei baru saja kalah. Kini aku menuju Jiangxia untuk menunjukkan belasungkawa, aku bertujuan untuk meyakinkan Liu Bei memimpin pasukan milik Liu Biao, bersama kita mengalahkan Cao Cao.",},
        [4284] = {8302,"Sun Quan","Lu Su","Dia akan dengan senang hati menyetujui, dan kemenangan menjadi milik kita.","Dia akan dengan senang hati menyetujui, dan kemenangan menjadi milik kita.",},
        [4285] = {8302,"Lu Su","Sun Quan","Baiklah, kamu cepatlah ke Jiangxia.","Baiklah, kamu cepatlah ke Jiangxia.",},
        [4286] = {8303,"Zhuge Liang","Liu Bei","Pasukan Cao berbaris semalaman untuk menaklukkan Jiangling, apa yang harus kita lakukan?","Pasukan Cao berbaris semalaman untuk menaklukkan Jiangling, apa yang harus kita lakukan?",},
        [4287] = {8303,"Liu Bei","Zhuge Liang","Cao Cao terlalu kuat, bagaimana jika kita ke Dongwu dan beraliansi dengan Sun Quan, sebagai bala bantuan. Perang antara utara dan selatan, lalu kita mengambil keuntungan, bagaimana?","Cao Cao terlalu kuat, bagaimana jika kita ke Dongwu dan beraliansi dengan Sun Quan, sebagai bala bantuan. Perang antara utara dan selatan, lalu kita mengambil keuntungan, bagaimana?",},
        [4288] = {8303,"Zhuge Liang","Liu Bei","Jiangdong memiliki banyak penasihat bertalenta, bagaimana mau menerima kita?","Jiangdong memiliki banyak penasihat bertalenta, bagaimana mau menerima kita?",},
        [4289] = {8303,"Liu Bei","Zhuge Liang","Saat ini pasukan Cao berkemah di Jianghan, mana mungkin Jiangdong tidak mengirim orang untuk mengintai?","Saat ini pasukan Cao berkemah di Jianghan, mana mungkin Jiangdong tidak mengirim orang untuk mengintai?",},
        [4290] = {8303,"Liu Bei","Zhuge Liang","Saat orang mereka tiba, aku akan kembali ke Jiangdong bersamanya, lalu menyulut perang antara utara dan selatan dengan lidahku ini.","Saat orang mereka tiba, aku akan kembali ke Jiangdong bersamanya, lalu menyulut perang antara utara dan selatan dengan lidahku ini.",},
        [4291] = {8303,"Liu Bei","Zhuge Liang","Jika selatan menang, kita bunuh Cao Cao dan merebut Jingzhou, jika utara menang, maka aku akan mengambil kesempatan merebut Jiangnan.","Jika selatan menang, kita bunuh Cao Cao dan merebut Jingzhou, jika utara menang, maka aku akan mengambil kesempatan merebut Jiangnan.",},
        [4292] = {8303,"Zhuge Liang","Liu Bei","Rencana yang brilian, tetapi bagaimana kita bisa mendapatkan orang Jiangdong di sini?","Rencana yang brilian, tetapi bagaimana kita bisa mendapatkan orang Jiangdong di sini?",},
        [4293] = {8303,"Liu Bei","Zhuge Liang","Orang Jiangdong akan tiba di sini dalam waktu singkat.","Orang Jiangdong akan tiba di sini dalam waktu singkat.",},
        [4294] = {8304,"Zhuge Liang","Liu Bei","Sun Quan mengutus Lu Su kemari sebagai ucapan belasungkawa, kapalnya sudah berlabuh.","Sun Quan mengutus Lu Su kemari sebagai ucapan belasungkawa, kapalnya sudah berlabuh.",},
        [4295] = {8304,"Liu Bei","Zhuge Liang","Sempurna!","Sempurna!",},
        [4296] = {8304,"Liu Bei","Zhuge Liang","Saat Sun Ce wafat, apakah Xiangyang mengirimkan orang untuk berbela sungkawa?","Saat Sun Ce wafat, apakah Xiangyang mengirimkan orang untuk berbela sungkawa?",},
        [4297] = {8304,"Zhuge Liang","Liu Qi","Wu membunuh ayahku, bagaimana mungkin aku mengirim belasungkawa untuk mereka!","Wu membunuh ayahku, bagaimana mungkin aku mengirim belasungkawa untuk mereka!",},
        [4298] = {8304,"Liu Qi","Zhuge Liang","Kalau begitu Lu Su kemari untuk mengintai, bukan untuk berbela sungkawa.","Kalau begitu Lu Su kemari untuk mengintai, bukan untuk berbela sungkawa.",},
        [4299] = {8304,"Liu Qi","Zhuge Liang","Saat Lu Su tiba, jika dia menanyakan tentang pergerakan Cao Cao, Tuan jawab saja tidak tahu, jika dia menanyakan lagi, Tuan tinggal bilang untuk bertanya ke Zhuge Liang.","Saat Lu Su tiba, jika dia menanyakan tentang pergerakan Cao Cao, Tuan jawab saja tidak tahu, jika dia menanyakan lagi, Tuan tinggal bilang untuk bertanya ke Zhuge Liang.",},
        [4300] = {8304,"Zhuge Liang","Liu Bei","Baik.","Baik.",},
        [4301] = {8305,"Liu Bei","Lu Su","Sudah lama mendengar nama besar Paman Imperial, suatu kehormatan bisa bertemu di sini. ","Sudah lama mendengar nama besar Paman Imperial, suatu kehormatan bisa bertemu di sini. ",},
        [4302] = {8305,"Liu Bei","Lu Su","Aku dengar Paman Imperial bertempur dengan Cao Cao, pasti mengetahui kekuatan pasukannya, bolehkah aku tahu seberapa besar pasukannya?","Aku dengar Paman Imperial bertempur dengan Cao Cao, pasti mengetahui kekuatan pasukannya, bolehkah aku tahu seberapa besar pasukannya?",},
        [4303] = {8305,"Lu Su","Liu Bei","Pasukanku lemah dan sedikit, saat mendengar Cao Cao datang, aku langsung saja melarikan diri.","Pasukanku lemah dan sedikit, saat mendengar Cao Cao datang, aku langsung saja melarikan diri.",},
        [4304] = {8305,"Liu Bei","Lu Su","Aku dengar kalau Paman Imperial menggunakan siasat penasihat Zhuge Kongming, dua kali membakar pasukan Cao, bagaimana bisa tidak tahu?","Aku dengar kalau Paman Imperial menggunakan siasat penasihat Zhuge Kongming, dua kali membakar pasukan Cao, bagaimana bisa tidak tahu?",},
        [4305] = {8305,"Lu Su","Liu Bei","Karena itulah lebih baik kamu bertanya langsung ke Kongming, dia lebih tahu rinci.","Karena itulah lebih baik kamu bertanya langsung ke Kongming, dia lebih tahu rinci.",},
        [4306] = {8305,"Liu Bei","Lu Su","Di manakah Kongming? Aku ingin bertemu sebentar.","Di manakah Kongming? Aku ingin bertemu sebentar.",},
        [4307] = {8305,"Lu Su","Liu Bei","Aku akan memanggil Kongming untuk menemuimu.","Aku akan memanggil Kongming untuk menemuimu.",},
        [4308] = {8306,"Zhuge Liang","Lu Su","Aku sangat mengagumi kebijaksanaan Tuan, sungguh kehormatan bisa bertemu denganmu. Bisakah Tuan berbagi informasi tentang ancaman besar di depan kita?","Aku sangat mengagumi kebijaksanaan Tuan, sungguh kehormatan bisa bertemu denganmu. Bisakah Tuan berbagi informasi tentang ancaman besar di depan kita?",},
        [4309] = {8306,"Lu Su","Zhuge Liang","Rencana Cao Cao aku sudah mengetahuinya, tetapi kami tidak cukup kuat menghadapinya karena itu kami terus melarikan diri.","Rencana Cao Cao aku sudah mengetahuinya, tetapi kami tidak cukup kuat menghadapinya karena itu kami terus melarikan diri.",},
        [4310] = {8306,"Zhuge Liang","Lu Su","Paman Imperial apakah akan tinggal di sini?","Paman Imperial apakah akan tinggal di sini?",},
        [4311] = {8306,"Lu Su","Zhuge Liang","Tuanku dan Kepala Prefektur Changwu Wu Chen adalah teman lama, kami akan mencari perlindungan darinya.","Tuanku dan Kepala Prefektur Changwu Wu Chen adalah teman lama, kami akan mencari perlindungan darinya.",},
        [4312] = {8306,"Zhuge Liang","Lu Su","Wu Chen hanya memiliki sedikit ransum dan pasukan, tidak bisa melindungi dirinya sendiri, bagaimana dia bisa melindungi orang lain?","Wu Chen hanya memiliki sedikit ransum dan pasukan, tidak bisa melindungi dirinya sendiri, bagaimana dia bisa melindungi orang lain?",},
        [4313] = {8306,"Lu Su","Zhuge Liang","Meskipun tidak bisa tinggal lama di Wu Chen, tapi untuk sementara di sini, sambil memikirkan rencana yang lebih baik.","Meskipun tidak bisa tinggal lama di Wu Chen, tapi untuk sementara di sini, sambil memikirkan rencana yang lebih baik.",},
        [4314] = {8306,"Zhuge Liang","Lu Su","Jenderal Sun memiliki enam wilayah, pasukan yang baik, juga sangat menghormati para pahlawan. Para pendekar Jiangbiao kini banyak yang bertarung untuknya.","Jenderal Sun memiliki enam wilayah, pasukan yang baik, juga sangat menghormati para pahlawan. Para pendekar Jiangbiao kini banyak yang bertarung untuknya.",},
        [4315] = {8306,"Zhuge Liang","Lu Su","Aku saat ini menawarkan untuk mengirimkan orang kepercayaanmu beraliansi dengan Wu, kita akan menggabungkan kekuatan untuk tujuan yang lebih besar.","Aku saat ini menawarkan untuk mengirimkan orang kepercayaanmu beraliansi dengan Wu, kita akan menggabungkan kekuatan untuk tujuan yang lebih besar.",},
        [4316] = {8306,"Lu Su","Zhuge Liang","Tuanku tidak memiliki sejarah dengan Jenderal Sun, mungkin akan menjadi perjalanan yang sia-sia. Dan saat ini kita tidak memiliki orang kepercayaan untuk diutus.","Tuanku tidak memiliki sejarah dengan Jenderal Sun, mungkin akan menjadi perjalanan yang sia-sia. Dan saat ini kita tidak memiliki orang kepercayaan untuk diutus.",},
        [4317] = {8306,"Zhuge Liang","Lu Su","Saudaramu kini menjadi penasihat bagi Jiangdong, setiap hari ingin bertemu denganmu. Aku, Lu Su, ingin membawamu menemui Jenderal Sun, dan berdiskusi dengannya.","Saudaramu kini menjadi penasihat bagi Jiangdong, setiap hari ingin bertemu denganmu. Aku, Lu Su, ingin membawamu menemui Jenderal Sun, dan berdiskusi dengannya.",},
        [4318] = {8306,"Lu Su","Liu Bei","Kongming adalah penasihatku, dia tidak boleh pergi, bagaimana kamu bisa membawanya?","Kongming adalah penasihatku, dia tidak boleh pergi, bagaimana kamu bisa membawanya?",},
        [4319] = {8306,"Liu Bei","Lu Su","Mengapa Paman Imperial tidak pergi saja bersama dengan Kongming?","Mengapa Paman Imperial tidak pergi saja bersama dengan Kongming?",},
        [4320] = {8306,"Lu Su","Liu Bei","Ini…","Ini…",},
        [4321] = {8306,"Liu Bei","Protagonis","Pergi ke Dongwu, tidak perlu merepotkan kakak, biar aku saja pergi bersama dengan Kongming.","Pergi ke Dongwu, tidak perlu merepotkan kakak, biar aku saja pergi bersama dengan Kongming.",},
        [4322] = {8306,"Protagonis","Liu Bei","Kalau begitu merepotkanmu, adik keempat.","Kalau begitu merepotkanmu, adik keempat.",},
        [4323] = {8307,"Lu Su","Sun Quan","Seberapa banyak informasi yang kamu dapatkan di Jiangxia?","Seberapa banyak informasi yang kamu dapatkan di Jiangxia?",},
        [4324] = {8307,"Sun Quan","Lu Su","Sudah mendapatkan beberapa, biar aku jelaskan.","Sudah mendapatkan beberapa, biar aku jelaskan.",},
        [4325] = {8307,"Lu Su","Sun Quan","Cao Cao mengutus orang untuk mengirimkan surat kemari, aku menyuruhnya pergi. Saat ini kita belum membuat keputusan apapun.","Cao Cao mengutus orang untuk mengirimkan surat kemari, aku menyuruhnya pergi. Saat ini kita belum membuat keputusan apapun.",},
        [4326] = {8307,"Sun Quan","Lu Su","Cao Cao punya maksud apa?","Cao Cao punya maksud apa?",},
        [4327] = {8307,"Lu Su","Sun Quan","Dia ingin bersama Dongwu menangkap Liu Bei di Jiangxia, berbagi wilayah, beraliansi untuk selamanya.","Dia ingin bersama Dongwu menangkap Liu Bei di Jiangxia, berbagi wilayah, beraliansi untuk selamanya.",},
        [4328] = {8307,"Sun Quan","Lu Su","Bagaimana menurut Tuan?","Bagaimana menurut Tuan?",},
        [4329] = {8307,"Lu Su","Sun Quan","Belum aku putuskan.","Belum aku putuskan.",},
        [4330] = {8307,"Sun Quan","Zhang Zhao","Dengan jutaan pasukannya, menggunakan nama kaisar, dia menaklukkan segala arah, semua yang melawan akan kalah. Dan satu-satunya pengaruh yang Tuan miliki adalah sungai Yangtze.","Dengan jutaan pasukannya, menggunakan nama kaisar, dia menaklukkan segala arah, semua yang melawan akan kalah. Dan satu-satunya pengaruh yang Tuan miliki adalah sungai Yangtze.",},
        [4331] = {8307,"Sun Quan","Zhang Zhao","Kini dengan Cao Cao mendapatkan Jingzhou, dia juga bisa memanfaatkan sungai Yangtze sama seperti kita yang membuatnya tidak bisa dihentikan. Menurut pendapatkan, kita lebih baik menyerah, itu adalah rencana paling aman.","Kini dengan Cao Cao mendapatkan Jingzhou, dia juga bisa memanfaatkan sungai Yangtze sama seperti kita yang membuatnya tidak bisa dihentikan. Menurut pendapatkan, kita lebih baik menyerah, itu adalah rencana paling aman.",},
        [4332] = {8307,"Zhang Zhao","Sun Quan","Ini…","Ini…",},
        [4333] = {8307,"Sun Quan","Zhang Zhao","Tuan tidak perlu ragu, jika kita menyerah, rakyat Dongwu, enam wilayah Jiangnan, semuanya akan aman.","Tuan tidak perlu ragu, jika kita menyerah, rakyat Dongwu, enam wilayah Jiangnan, semuanya akan aman.",},
        [4334] = {8307,"Zhang Zhao","Sun Quan","Ini…","Ini…",},
        [4335] = {8308,"Sun Quan","Lu Su","Semua orang bisa menyerah kepada Cao Cao, tapi tidak denganmu jenderal.","Semua orang bisa menyerah kepada Cao Cao, tapi tidak denganmu jenderal.",},
        [4336] = {8308,"Lu Su","Sun Quan","Kenapa begitu?","Kenapa begitu?",},
        [4337] = {8308,"Sun Quan","Lu Su","Jika aku menyerah kepada Cao Cao, aku tinggal pulang ke kampung halaman dan bekerja sebagai gubernur.","Jika aku menyerah kepada Cao Cao, aku tinggal pulang ke kampung halaman dan bekerja sebagai gubernur.",},
        [4338] = {8308,"Sun Quan","Lu Su","Tapi jika jenderal menyerah kepada Cao Cao, apa yang akan Anda lakukan? Posisi tidak akan lebih dari penguasa feudal, dengan satu kereta, memiliki beberapa pengikut. Apakah Anda dapat menjadi raja lagi?","Tapi jika jenderal menyerah kepada Cao Cao, apa yang akan Anda lakukan? Posisi tidak akan lebih dari penguasa feudal, dengan satu kereta, memiliki beberapa pengikut. Apakah Anda dapat menjadi raja lagi?",},
        [4339] = {8308,"Sun Quan","Lu Su","Tuan jangan mendengarkan saran yang mementingkan diri sendiri. Jenderal harus membuat keputusanmu sendiri.","Tuan jangan mendengarkan saran yang mementingkan diri sendiri. Jenderal harus membuat keputusanmu sendiri.",},
        [4340] = {8308,"Lu Su","Sun Quan","Semua orang membicarakannya, kehilangan harapan. Pendapat Zijing sama denganku.","Semua orang membicarakannya, kehilangan harapan. Pendapat Zijing sama denganku.",},
        [4341] = {8308,"Lu Su","Sun Quan","Aku berterimakasih kepada Zijing atas kekuasaanku! Tetapi setelah Cao Cao mendapatkan pasukan Yuan Shao, lalu juga mendapatkan pasukan Jingzhou, dia akan menjadi musuh yang sulit dihadapi.","Aku berterimakasih kepada Zijing atas kekuasaanku! Tetapi setelah Cao Cao mendapatkan pasukan Yuan Shao, lalu juga mendapatkan pasukan Jingzhou, dia akan menjadi musuh yang sulit dihadapi.",},
        [4342] = {8308,"Sun Quan","Lu Su","Lu Su pergi ke Jiangxia, membawa kemari Zhuge Liang, saudara Zhuge Jin. Tuan bisa bertanya informasi kepadanya.","Lu Su pergi ke Jiangxia, membawa kemari Zhuge Liang, saudara Zhuge Jin. Tuan bisa bertanya informasi kepadanya.",},
        [4343] = {8308,"Lu Su","Sun Quan","Apakah Tuan Wolong di sini?","Apakah Tuan Wolong di sini?",},
        [4344] = {8308,"Sun Quan","Lu Su","Dia beristirahat di kedai.","Dia beristirahat di kedai.",},
        [4345] = {8308,"Lu Su","Sun Quan","Hari sudah malam. Besok kumpulkan semua jenderal dan penasihat di tenda, kita harus berdiskusi sebelum aku menemui para pendekar Jiangdong.","Hari sudah malam. Besok kumpulkan semua jenderal dan penasihat di tenda, kita harus berdiskusi sebelum aku menemui para pendekar Jiangdong.",},
        [4346] = {8309,"Zhuge Liang","Zhang Zhao","Aku bukan siapa-siapa di Jiangdong, sudah lama aku mendengar Tuan bertapa di Longzhong, dan Tuan membandingkan diri dengan Guan Zhong dan Le Yi, benarkah demikian?","Aku bukan siapa-siapa di Jiangdong, sudah lama aku mendengar Tuan bertapa di Longzhong, dan Tuan membandingkan diri dengan Guan Zhong dan Le Yi, benarkah demikian?",},
        [4347] = {8309,"Zhang Zhao","Zhuge Liang","Bagaimana aku berani membandingkan diri dengan mereka?","Bagaimana aku berani membandingkan diri dengan mereka?",},
        [4348] = {8309,"Zhuge Liang","Zhang Zhao","Aku denggar Liu Bei berhasil meyakinkanmu setelah mengunjungi gubukmu tiga kali. Dia mengira mendapatkan orang terbaik dan coba merebut Jingxiang. Tapi kini wilayah tersebut dikuasai Cao Cao, apa pendapatmu?","Aku denggar Liu Bei berhasil meyakinkanmu setelah mengunjungi gubukmu tiga kali. Dia mengira mendapatkan orang terbaik dan coba merebut Jingxiang. Tapi kini wilayah tersebut dikuasai Cao Cao, apa pendapatmu?",},
        [4349] = {8309,"Zhang Zhao","Zhuge Liang","Merebut kembali wilayah Han semudah membalikkan telapak tangan. Tetapi Tuanku orang yang penuh kebajikan, dia tidak tega untuk merebut kekuasaan sepupunya sehingga dia menolaknya..","Merebut kembali wilayah Han semudah membalikkan telapak tangan. Tetapi Tuanku orang yang penuh kebajikan, dia tidak tega untuk merebut kekuasaan sepupunya sehingga dia menolaknya..",},
        [4350] = {8309,"Zhang Zhao","Zhuge Liang","Liu Cong masih muda, mendengarkan saran, memutuskan menyerah. Akibatnya kini Cao Cao menjadi sangat kuat. Tuanku berkemah di Jiangxia saat ini dan sedang merencanakan sesuatu yang tidak bisa diberitahukan ke orang-orang yang tidak berkepentingan.","Liu Cong masih muda, mendengarkan saran, memutuskan menyerah. Akibatnya kini Cao Cao menjadi sangat kuat. Tuanku berkemah di Jiangxia saat ini dan sedang merencanakan sesuatu yang tidak bisa diberitahukan ke orang-orang yang tidak berkepentingan.",},
        [4351] = {8309,"Zhuge Liang","Zhang Zhao","Jika demikian, berarti Tuan bukanlah orang yang setia. Tuan mengabdi kepada Liu Bei, Tuan seharusnya membantunya mengatasi pemberontakan.","Jika demikian, berarti Tuan bukanlah orang yang setia. Tuan mengabdi kepada Liu Bei, Tuan seharusnya membantunya mengatasi pemberontakan.",},
        [4352] = {8309,"Zhuge Liang","Zhang Zhao","Semenjak Tuan mengabdi kepada Liu Bei, yang Tuan lakukan hanyalah mengalah dan melarikan diri ketika menghadapi pasukan Cao. Tuan tidak bisa menenangkan Liu Biao dan rakyatmu, juga tidak bisa membantu Tuanmu memperluas wilayahnya.","Semenjak Tuan mengabdi kepada Liu Bei, yang Tuan lakukan hanyalah mengalah dan melarikan diri ketika menghadapi pasukan Cao. Tuan tidak bisa menenangkan Liu Biao dan rakyatmu, juga tidak bisa membantu Tuanmu memperluas wilayahnya.",},
        [4353] = {8309,"Zhuge Liang","Zhang Zhao","Setelah meninggalkan Xinye dan Fancheng, kalah di Dangyang, kabur ke Xiakou, kini tidak ada tempat lagi untuk pergi. Liu Bei kini berada di situasi terburuk semenjak dia mendapatkanmu sebagai penasihat. Guan Zhong, Le Yi? Benarkah demikian?","Setelah meninggalkan Xinye dan Fancheng, kalah di Dangyang, kabur ke Xiakou, kini tidak ada tempat lagi untuk pergi. Liu Bei kini berada di situasi terburuk semenjak dia mendapatkanmu sebagai penasihat. Guan Zhong, Le Yi? Benarkah demikian?",},
        [4354] = {8309,"Zhang Zhao","Zhuge Liang","Tuanku mencari perlindungan ke Liu Biao setelah dikalahkan di Runan, saat itu pasukan tidak sampai seribu, dengan Guan Yu, Zhang Fei, dan Zhao Yun sebagai pengikutnya, Yuzhou hanyalah tempat sementara, bagaimana dia bisa tinggal selamanya di sana?","Tuanku mencari perlindungan ke Liu Biao setelah dikalahkan di Runan, saat itu pasukan tidak sampai seribu, dengan Guan Yu, Zhang Fei, dan Zhao Yun sebagai pengikutnya, Yuzhou hanyalah tempat sementara, bagaimana dia bisa tinggal selamanya di sana?",},
        [4355] = {8309,"Zhang Zhao","Zhuge Liang","Dulu, pasukannya tidak bersenjata lengkap, benteng kota tidak kokoh, pasukan tidak terlatih, ransum tidak cukup. Tetapi api di Bowang dan banjir di sungai Bai bisa menakuti Xiahou Dun dan Cao Ren.","Dulu, pasukannya tidak bersenjata lengkap, benteng kota tidak kokoh, pasukan tidak terlatih, ransum tidak cukup. Tetapi api di Bowang dan banjir di sungai Bai bisa menakuti Xiahou Dun dan Cao Ren.",},
        [4356] = {8309,"Zhang Zhao","Zhuge Liang","Mengenai Liu Cong menyerah, Tuanku tidak mengetahuinya, dan dia tidak tega merebut kekuasan dari sepupunya. Begitulah betapa dirinya penuh kebajikan.","Mengenai Liu Cong menyerah, Tuanku tidak mengetahuinya, dan dia tidak tega merebut kekuasan dari sepupunya. Begitulah betapa dirinya penuh kebajikan.",},
        [4357] = {8309,"Zhang Zhao","Zhuge Liang","Mengenai kekalahan di Dangyang, Tuanku memiliki lebih dari seratus ribu pengungsi mengikutinya, dan dia tidak tega meninggalkannya. Sepuluh mil perhari, dia memilih untuk tidak memasuki Jiangling dan memilih untuk dikalahkan, begitulah dia menunjukkan kebajikannya.","Mengenai kekalahan di Dangyang, Tuanku memiliki lebih dari seratus ribu pengungsi mengikutinya, dan dia tidak tega meninggalkannya. Sepuluh mil perhari, dia memilih untuk tidak memasuki Jiangling dan memilih untuk dikalahkan, begitulah dia menunjukkan kebajikannya.",},
        [4358] = {8309,"Zhuge Liang","Zhang Zhao","Ini…","Ini…",},
        [4359] = {8310,"Zhuge Liang","Sun Quan","Tuan berada di Xinye, menjadi penasihat saat Liu Bei bertempur melawan Cao Cao, pasti mengetahui seberapa kuat, ada berapa jumlah pasukan Cao? Ada berapa jenderal bawahannya?","Tuan berada di Xinye, menjadi penasihat saat Liu Bei bertempur melawan Cao Cao, pasti mengetahui seberapa kuat, ada berapa jumlah pasukan Cao? Ada berapa jenderal bawahannya?",},
        [4360] = {8310,"Sun Quan","Zhuge Liang","Kavaleri, infantri, dan angkatan laut, total ada satu juta pasukan. Dan juga ada kira-kira dua ribu penasihat dan pendekar.","Kavaleri, infantri, dan angkatan laut, total ada satu juta pasukan. Dan juga ada kira-kira dua ribu penasihat dan pendekar.",},
        [4361] = {8310,"Zhuge Liang","Sun Quan","Setelah Cao Cao menaklukkan Jing dan Chu, apa langkah dia selanjutnya? ","Setelah Cao Cao menaklukkan Jing dan Chu, apa langkah dia selanjutnya? ",},
        [4362] = {8310,"Sun Quan","Zhuge Liang","Dia membangun barak di sepanjang sungai , mempersiapkan kapal perang. Jika targetnya bukan Jiangdong, lalu apalagi?","Dia membangun barak di sepanjang sungai , mempersiapkan kapal perang. Jika targetnya bukan Jiangdong, lalu apalagi?",},
        [4363] = {8310,"Zhuge Liang","Sun Quan","Jika dia bermaksud menaklukkan kami, tolong bantu kami memutuskan untuk menjawab tantangannya atau tidak.","Jika dia bermaksud menaklukkan kami, tolong bantu kami memutuskan untuk menjawab tantangannya atau tidak.",},
        [4364] = {8310,"Sun Quan","Zhuge Liang","Negara dalam kekacauan, sehingga jenderal membangkitkan Jiangdong, sedangkan Liu Bei mendapatkan Hannan. Tuan memperebutkan negara melawan Cao Cao","Negara dalam kekacauan, sehingga jenderal membangkitkan Jiangdong, sedangkan Liu Bei mendapatkan Hannan. Tuan memperebutkan negara melawan Cao Cao",},
        [4365] = {8310,"Sun Quan","Zhuge Liang","Cao Cao menyingkirkan pemberontak dan juga baru mendapatkan Jingzhou, menunjukkan kekuatannya ke seluruh penjuru negeri. Saat kehilangan benteng, seorang pahlawan pun tidak akan tahu apa yang harus dilakukan, itulah mengapai Tuanku melarikan diri kemari.","Cao Cao menyingkirkan pemberontak dan juga baru mendapatkan Jingzhou, menunjukkan kekuatannya ke seluruh penjuru negeri. Saat kehilangan benteng, seorang pahlawan pun tidak akan tahu apa yang harus dilakukan, itulah mengapai Tuanku melarikan diri kemari.",},
        [4366] = {8310,"Sun Quan","Zhuge Liang","Aku menyarankan jenderal untuk mengevaluasi pasukan sebelum melawan Cao Cao. Jika Wu bisa melawan seantero China, lebih baik jenderal mendeklarasikan perang secepat mungkin. Jika tidak mampu, mengapa tidak ikuti saja saran para penasihat untuk menyerah kepada utara?","Aku menyarankan jenderal untuk mengevaluasi pasukan sebelum melawan Cao Cao. Jika Wu bisa melawan seantero China, lebih baik jenderal mendeklarasikan perang secepat mungkin. Jika tidak mampu, mengapa tidak ikuti saja saran para penasihat untuk menyerah kepada utara?",},
        [4367] = {8310,"Sun Quan","Zhuge Liang","Tetapi jika jenderal mengulur waktu berpura-pura tunduk sambil menyusun rencana dalam keraguan, maka masalah akan datang!","Tetapi jika jenderal mengulur waktu berpura-pura tunduk sambil menyusun rencana dalam keraguan, maka masalah akan datang!",},
        [4368] = {8310,"Zhuge Liang","Sun Quan","Jika benar ucapanmu, lalu kenapa Liu Bei tidak menyerah?","Jika benar ucapanmu, lalu kenapa Liu Bei tidak menyerah?",},
        [4369] = {8310,"Sun Quan","Zhuge Liang","Tian Heng, pahlawan negara bagian Qi, lebih baik mati daripada menyerah. Tuanku adalah bangsawan Han, bermartabat dan penuh kehormatan. Kegagalannya adalah takdir jika itu memang harus terjadi, bagaimana dia bisa menjadi pelayan?","Tian Heng, pahlawan negara bagian Qi, lebih baik mati daripada menyerah. Tuanku adalah bangsawan Han, bermartabat dan penuh kehormatan. Kegagalannya adalah takdir jika itu memang harus terjadi, bagaimana dia bisa menjadi pelayan?",},
        [4370] = {8310,"Zhuge Liang","Lu Su","Kurang ajar, ucapan tuan sangat menghinda tuanku! Kita bicara lagi lain kali.","Kurang ajar, ucapan tuan sangat menghinda tuanku! Kita bicara lagi lain kali.",},
        [4371] = {8311,"Zhuge Liang","Sun Quan","Ada orang-orang yang Cao Cao benci atau pernah benci. Lu Bu, Liu Biao, Yuan Shao, Yuan Shu, Liu Bei, dan aku. Kebanyakan sudah tewas, hanya aku dan Liu Bei yang tersisa. Aku tidak bersedia tanah Wu diperintah leh orang lain.","Ada orang-orang yang Cao Cao benci atau pernah benci. Lu Bu, Liu Biao, Yuan Shao, Yuan Shu, Liu Bei, dan aku. Kebanyakan sudah tewas, hanya aku dan Liu Bei yang tersisa. Aku tidak bersedia tanah Wu diperintah leh orang lain.",},
        [4372] = {8311,"Zhuge Liang","Sun Quan","Aku sudah memutuskan. Tidak ada yang bisa bertarung melawan Cao Cao selain Liu Bei, tetapi dia baru saja dikalahkan, tanggung jawab apa yang bisa dia pikul saat ini?","Aku sudah memutuskan. Tidak ada yang bisa bertarung melawan Cao Cao selain Liu Bei, tetapi dia baru saja dikalahkan, tanggung jawab apa yang bisa dia pikul saat ini?",},
        [4373] = {8311,"Sun Quan","Zhuge Liang","Tuanku baru saja dikalahkan, tetapi Guan Yunchang memimpin sepuluh ribu pasukan, Liu Qi juga memiliki sepuluh ribu pasukan di Jiangxia.","Tuanku baru saja dikalahkan, tetapi Guan Yunchang memimpin sepuluh ribu pasukan, Liu Qi juga memiliki sepuluh ribu pasukan di Jiangxia.",},
        [4374] = {8311,"Sun Quan","Zhuge Liang","Pasukan Cao sudah menempuh perjalanan sangat jauh untuk mengejar kami, tiga ratus mil perhari, pasti kelelahan, bahkan tidak akan bisa menembus pertahanan terlemah sekalipun. Lagipula mereka orang utara, tidak terbiasa berperang di air.","Pasukan Cao sudah menempuh perjalanan sangat jauh untuk mengejar kami, tiga ratus mil perhari, pasti kelelahan, bahkan tidak akan bisa menembus pertahanan terlemah sekalipun. Lagipula mereka orang utara, tidak terbiasa berperang di air.",},
        [4375] = {8311,"Sun Quan","Zhuge Liang","Rakyat Jingzhou tunduk kepada Cao Cao karena terpaksa, bukan sukarela.","Rakyat Jingzhou tunduk kepada Cao Cao karena terpaksa, bukan sukarela.",},
        [4376] = {8311,"Sun Quan","Zhuge Liang","Jika jenderal bisa bekerja sama dengan Liu Bei, maka Cao Cao pasti kalah. Setelah kalah, pasti kembali ke utara, di saat itu aliansi Jingzhou dan Wu sudah kuat untuk melawan utara.","Jika jenderal bisa bekerja sama dengan Liu Bei, maka Cao Cao pasti kalah. Setelah kalah, pasti kembali ke utara, di saat itu aliansi Jingzhou dan Wu sudah kuat untuk melawan utara.",},
        [4377] = {8311,"Sun Quan","Zhuge Liang","Hari ini adalah hari yang akan menentukan sejarah, kami hanya menunggu tanggapanmu.","Hari ini adalah hari yang akan menentukan sejarah, kami hanya menunggu tanggapanmu.",},
        [4378] = {8311,"Zhuge Liang","Sun Quan","Ucapan tuan, memberiku pencerahan. Aku sudah memutuskan, tanpa ragu lagi. Mulai hari ini kita mendiskusikan aliansi, bersama, kita hancurkan Cao Cao!","Ucapan tuan, memberiku pencerahan. Aku sudah memutuskan, tanpa ragu lagi. Mulai hari ini kita mendiskusikan aliansi, bersama, kita hancurkan Cao Cao!",},
        [4379] = {8312,"Sun Quan","Zhang Zhao","Kita masuk ke dalam siasat Kongming!","Kita masuk ke dalam siasat Kongming!",},
        [4380] = {8312,"Sun Quan","Zhang Zhao","Saat Cao Cao masih memiliki pasukan sedikit, dia mampu menghancurkan Yuan Shao. Kini dia memiliki sejuta pasukan, bagaimana melawannya?","Saat Cao Cao masih memiliki pasukan sedikit, dia mampu menghancurkan Yuan Shao. Kini dia memiliki sejuta pasukan, bagaimana melawannya?",},
        [4381] = {8312,"Sun Quan","Zhang Zhao","Jika kita mengikuti ucapan Zhuge Liang dan mengirimkan pasukan kita, sama saja kita membawa kayu ke dalam api.","Jika kita mengikuti ucapan Zhuge Liang dan mengirimkan pasukan kita, sama saja kita membawa kayu ke dalam api.",},
        [4382] = {8312,"Zhang Zhao","Sun Quan","Ini…","Ini…",},
        [4383] = {8312,"Sun Quan","Gu Yong","Liu Bei dikalahkan Cao Cao, karena itu dia ingin menggunakan pasukan Jiangdong untuk melawannya, Tuan hanya dimanfaatkan, tolong dengarkan perkataan Zibu.","Liu Bei dikalahkan Cao Cao, karena itu dia ingin menggunakan pasukan Jiangdong untuk melawannya, Tuan hanya dimanfaatkan, tolong dengarkan perkataan Zibu.",},
        [4384] = {8312,"Gu Yong","Sun Quan","Ini…","Ini…",},
        [4385] = {8312,"Sun Quan","Lu Su","Zhang Zibu dan lainnya menyarankan untuk tidak melawan dan menyerah saja karena mereka ingin melindungi keluarganya, itu hanyalah demi kepentingan pribadinya. Harap Tuan jangan mendengarkannya.","Zhang Zibu dan lainnya menyarankan untuk tidak melawan dan menyerah saja karena mereka ingin melindungi keluarganya, itu hanyalah demi kepentingan pribadinya. Harap Tuan jangan mendengarkannya.",},
        [4386] = {8312,"Sun Quan","Lu Su","Jika Tuan terus ragu, maka akan menempatkan rakyat dalam bahaya.","Jika Tuan terus ragu, maka akan menempatkan rakyat dalam bahaya.",},
        [4387] = {8312,"Lu Su","Sun Quan","Semuanya mundur, biarkan aku berpikir.","Semuanya mundur, biarkan aku berpikir.",},
        [4388] = {8313,"Sun Quan","Ibu Suri Wu","Apa yang kamu pikirkan? Apa yang mengganggu makanmu dan tidurmu?","Apa yang kamu pikirkan? Apa yang mengganggu makanmu dan tidurmu?",},
        [4389] = {8313,"Ibu Suri Wu","Sun Quan","Saat ini Cao Cao berkemah di Jianghan, bermaksud menyerang Jiangnan. Aku sudah berdiskusi dengan para penasihat dan jenderalku, ada yang menyarankan berperang, ada yang menyarankan menyerah. Jika berperang, aku takut kalah jumlah. Jika menyerah, aku takut Cao Cao akan menyingkirkan kita.","Saat ini Cao Cao berkemah di Jianghan, bermaksud menyerang Jiangnan. Aku sudah berdiskusi dengan para penasihat dan jenderalku, ada yang menyarankan berperang, ada yang menyarankan menyerah. Jika berperang, aku takut kalah jumlah. Jika menyerah, aku takut Cao Cao akan menyingkirkan kita.",},
        [4390] = {8313,"Sun Quan","Ibu Suri Wu","Apa kamu lupa apa pesan Ratu Wulie sebelum dia meninggal?","Apa kamu lupa apa pesan Ratu Wulie sebelum dia meninggal?",},
        [4391] = {8313,"Sun Quan","Ibu Suri Wu","Berkonsultasilah dengan Zhang Zhao untuk masalah internal, dengan Zhou Yu untuk masalah eksternal.","Berkonsultasilah dengan Zhang Zhao untuk masalah internal, dengan Zhou Yu untuk masalah eksternal.",},
        [4392] = {8313,"Sun Quan","Ibu Suri Wu","Mengapa kamu tidak bertanya ke Gongjin?","Mengapa kamu tidak bertanya ke Gongjin?",},
        [4393] = {8401,"Zhou Yu","Zhang Zhao","Jenderal apakah memahami ancaman bagi Jiangdong saat ini? ","Jenderal apakah memahami ancaman bagi Jiangdong saat ini? ",},
        [4394] = {8401,"Zhang Zhao","Zhou Yu","Tidak","Tidak",},
        [4395] = {8401,"Zhou Yu","Zhang Zhao","Sejuta pasukan Cao Cao berkemah di Jianghan. Kemarin mereka mengirim surat, mengundang tuan kita untuk menyerang Jingxia bersama. Tujuan mereka untuk menyerang Wu tidak tersirat di dalam surat.","Sejuta pasukan Cao Cao berkemah di Jianghan. Kemarin mereka mengirim surat, mengundang tuan kita untuk menyerang Jingxia bersama. Tujuan mereka untuk menyerang Wu tidak tersirat di dalam surat.",},
        [4396] = {8401,"Zhou Yu","Zhang Zhao","Para penasihat dan diriku menyarankan untuk menyerah, menghindarkan Jiangdong dari masalah. Tapi Lu Zijing dari Jiangxia membawa kemari Zhuge Liang, penasihat Liu Bei. Dia mempengaruhi Tuan kita demi membalaskan kekalahan Tuannya.","Para penasihat dan diriku menyarankan untuk menyerah, menghindarkan Jiangdong dari masalah. Tapi Lu Zijing dari Jiangxia membawa kemari Zhuge Liang, penasihat Liu Bei. Dia mempengaruhi Tuan kita demi membalaskan kekalahan Tuannya.",},
        [4397] = {8401,"Zhou Yu","Zhang Zhao","Zijing keras kepala. Karena itu kami ingin mendengarkan pendapat dari jenderal.","Zijing keras kepala. Karena itu kami ingin mendengarkan pendapat dari jenderal.",},
        [4398] = {8401,"Zhang Zhao","Zhou Yu","Apakah semua opini kalian sama?","Apakah semua opini kalian sama?",},
        [4399] = {8401,"Zhou Yu","Gu Yong","Iya benar.","Iya benar.",},
        [4400] = {8401,"Gu Yong","Zhou Yu","Aku pribadi juga ingin menyerah. Silahkan kembali sekarang, besok aku akan menemui Tuan, dan memberikan saran.","Aku pribadi juga ingin menyerah. Silahkan kembali sekarang, besok aku akan menemui Tuan, dan memberikan saran.",},
        [4401] = {8402,"Zhou Yu","Cheng Pu","Apakah jenderal tahu bahwa Jiangdong akan menjadi milik orang lain cepat atau lambat?","Apakah jenderal tahu bahwa Jiangdong akan menjadi milik orang lain cepat atau lambat?",},
        [4402] = {8402,"Cheng Pu","Zhou Yu","Tidak","Tidak",},
        [4403] = {8402,"Zhou Yu","Cheng Pu","Sejak kita mengikuti Jenderal Sun, kita sudah melalui ratusan pertempuran, mendapatkan enam wilayah. Kini Tuan kita mendengarkan saran dari para penasihat untuk menyerah, sungguh memalukan!","Sejak kita mengikuti Jenderal Sun, kita sudah melalui ratusan pertempuran, mendapatkan enam wilayah. Kini Tuan kita mendengarkan saran dari para penasihat untuk menyerah, sungguh memalukan!",},
        [4404] = {8402,"Zhou Yu","Cheng Pu","Kita lebih baik mati daripada menyerah. Aku harap jenderal berbicara kepada Tuan untuk berperang, aku siap mati demi Wu.","Kita lebih baik mati daripada menyerah. Aku harap jenderal berbicara kepada Tuan untuk berperang, aku siap mati demi Wu.",},
        [4405] = {8402,"Cheng Pu","Zhou Yu","Apakah para jenderal semuanya berpendapat sama?","Apakah para jenderal semuanya berpendapat sama?",},
        [4406] = {8402,"Zhou Yu","Huang Gai","Aku lebih baik mati daripada menyerah kepada Cao Cao.","Aku lebih baik mati daripada menyerah kepada Cao Cao.",},
        [4407] = {8402,"Huang Gai","Zhou Yu","Aku juga, rela mati bertarung melawan Cao Cao, pantang menyerah! Silahkan para jenderal kembali. Zhou Yu akan berbicara dengan Tuanku.","Aku juga, rela mati bertarung melawan Cao Cao, pantang menyerah! Silahkan para jenderal kembali. Zhou Yu akan berbicara dengan Tuanku.",},
        [4408] = {8403,"Zhou Yu","Zhuge Jin","Zhuge Liang datang dari Han menyampaikan bahwa Liu Bei bersedia beraliansi dengan Dongwu, bersama melawan Cao Cao. Tuan belum mengambil keputusan, aku tidak berani berkata terlalu banyak, memilih untuk membicarakan ini dengan jenderal.","Zhuge Liang datang dari Han menyampaikan bahwa Liu Bei bersedia beraliansi dengan Dongwu, bersama melawan Cao Cao. Tuan belum mengambil keputusan, aku tidak berani berkata terlalu banyak, memilih untuk membicarakan ini dengan jenderal.",},
        [4409] = {8403,"Zhuge Jin","Zhou Yu","Bagaimana menurutmu?","Bagaimana menurutmu?",},
        [4410] = {8403,"Zhou Yu","Zhuge Jin","Menyerah lebih aman daripada perang.","Menyerah lebih aman daripada perang.",},
        [4411] = {8403,"Zhuge Jin","Zhou Yu","Aku memiliki pemikiran sendiri. Besok aku akan memberikan keputusan. ","Aku memiliki pemikiran sendiri. Besok aku akan memberikan keputusan. ",},
        [4412] = {8404,"Zhou Yu","Lu Su","Saat ini Cao Cao akan menyerang selatan, Tuan tidak bisa mengambil keputusan, pasti akan mendengarkan pendapatmu. Bagaimana menurutmu?","Saat ini Cao Cao akan menyerang selatan, Tuan tidak bisa mengambil keputusan, pasti akan mendengarkan pendapatmu. Bagaimana menurutmu?",},
        [4413] = {8404,"Lu Su","Zhou Yu","Cao Cao datang atas nama kaisar, dia hanya mencari alasan. Dia terlalu kuat, tidak bisa diremehkan. Jika berperang pasti kalah, akan lebih aman jika menyerah. Besok aku akan bertemu Tuan, dan menyarankan untuk menyerah.","Cao Cao datang atas nama kaisar, dia hanya mencari alasan. Dia terlalu kuat, tidak bisa diremehkan. Jika berperang pasti kalah, akan lebih aman jika menyerah. Besok aku akan bertemu Tuan, dan menyarankan untuk menyerah.",},
        [4414] = {8404,"Zhou Yu","Lu Su","Tuan salah! Jiangdong makmur, diperintah oleh tiga generasi, bagaimana bisa diserahkan kepada orang lain? Terakhir kali Sun Bofu berpesan, masalah eksternal diserahkan kepadamu.","Tuan salah! Jiangdong makmur, diperintah oleh tiga generasi, bagaimana bisa diserahkan kepada orang lain? Terakhir kali Sun Bofu berpesan, masalah eksternal diserahkan kepadamu.",},
        [4415] = {8404,"Zhou Yu","Lu Su","Kami mengandalkanmu jenderal untuk melindungi negara, mengapa jenderal memilih untuk menjadi pengecut?","Kami mengandalkanmu jenderal untuk melindungi negara, mengapa jenderal memilih untuk menjadi pengecut?",},
        [4416] = {8404,"Lu Su","Zhou Yu","Jika enam wilayah Jiangdong harus menderita, maka aku yang akan disalahkan. Karena itu aku menyarankan menyerah.","Jika enam wilayah Jiangdong harus menderita, maka aku yang akan disalahkan. Karena itu aku menyarankan menyerah.",},
        [4417] = {8404,"Zhou Yu","Lu Su","Tidak begitu. Kami memilikimu jenderal, juga daratan Jiangdong, Cao Cao belum tentu menang.","Tidak begitu. Kami memilikimu jenderal, juga daratan Jiangdong, Cao Cao belum tentu menang.",},
        [4418] = {8404,"Zhou Yu","Zhuge Liang","Hahahahaha.","Hahahahaha.",},
        [4419] = {8404,"Zhuge Liang","Zhou Yu","Mengapa Tuan tertawa?","Mengapa Tuan tertawa?",},
        [4420] = {8404,"Zhou Yu","Zhuge Liang","Aku tertawa karena Zijing sangat idealis.","Aku tertawa karena Zijing sangat idealis.",},
        [4421] = {8405,"Zhuge Liang","Lu Su","Bagaimana bisa aku idealis?","Bagaimana bisa aku idealis?",},
        [4422] = {8405,"Lu Su","Zhuge Liang","Ide Gongjin untuk menyerah kepada Cao Cao sangatlah masuk akal.","Ide Gongjin untuk menyerah kepada Cao Cao sangatlah masuk akal.",},
        [4423] = {8405,"Zhuge Liang","Zhou Yu","Kongming adalah orang yang realistis, kita pasti memiliki pemikiran yang sama.","Kongming adalah orang yang realistis, kita pasti memiliki pemikiran yang sama.",},
        [4424] = {8405,"Zhuge Liang","Lu Su","Kongming, apakah kamu juga demikian?","Kongming, apakah kamu juga demikian?",},
        [4425] = {8405,"Lu Su","Zhuge Liang","Cao Cao adalah orang yang hebat dalam menggunakan pasukan. Hanya ada sedikit orang yang berani bermusuhan dengannya seperti Lu Bu, Yuan Shao, Yuan Shu, dan Liu Biao. Dan tidak ada yang mampu bertahan melawannya.","Cao Cao adalah orang yang hebat dalam menggunakan pasukan. Hanya ada sedikit orang yang berani bermusuhan dengannya seperti Lu Bu, Yuan Shao, Yuan Shu, dan Liu Biao. Dan tidak ada yang mampu bertahan melawannya.",},
        [4426] = {8405,"Lu Su","Zhuge Liang","Liu Bei juga orang yang idealis, memilih untuk melawan, dan mengalami kekalahan. Jika jenderal menyerah kepada Cao Cao, bisa melindungi anak istri dan kekayaan. Mengabdi kepada raja yang baru dan mengalah kepada takdir tidak ada artinya! ","Liu Bei juga orang yang idealis, memilih untuk melawan, dan mengalami kekalahan. Jika jenderal menyerah kepada Cao Cao, bisa melindungi anak istri dan kekayaan. Mengabdi kepada raja yang baru dan mengalah kepada takdir tidak ada artinya! ",},
        [4427] = {8405,"Zhuge Liang","Lu Su","Kamu menyuruh Tuanku untuk tunduk kepada Cao Cao?","Kamu menyuruh Tuanku untuk tunduk kepada Cao Cao?",},
        [4428] = {8405,"Lu Su","Zhuge Liang","Aku memiliki siasat, aku mengirim dua orang kepada Cao Cao. Saat Cao Cao mendapatkan kedua orang ini, sejuta pasukan pasti akan mundur.","Aku memiliki siasat, aku mengirim dua orang kepada Cao Cao. Saat Cao Cao mendapatkan kedua orang ini, sejuta pasukan pasti akan mundur.",},
        [4429] = {8405,"Zhuge Liang","Zhou Yu","Siapa dua orang itu yang mampu membuat pasukan Cao mundur?","Siapa dua orang itu yang mampu membuat pasukan Cao mundur?",},
        [4430] = {8405,"Zhou Yu","Zhuge Liang","Kedua Qiao bersaudara!","Kedua Qiao bersaudara!",},
        [4431] = {8406,"Zhuge Liang","Zhou Yu","Mengapa harus Qiao bersaudara?","Mengapa harus Qiao bersaudara?",},
        [4432] = {8406,"Zhou Yu","Zhuge Liang","Saat aku di Longzhong, aku dengar Cao Cao membangun sebuah paviliun bernama Paviliun Pipit Tembaga di sungai Zhang, di mana Cao Cao mengumpulkan semua wanita cantik dari semua wilayah yang dia serang.","Saat aku di Longzhong, aku dengar Cao Cao membangun sebuah paviliun bernama Paviliun Pipit Tembaga di sungai Zhang, di mana Cao Cao mengumpulkan semua wanita cantik dari semua wilayah yang dia serang.",},
        [4433] = {8406,"Zhou Yu","Zhuge Liang","Cao Cao adalah orang yang mata keranjang, dia sangat menginginkan kedua putri tuan Qiao sejak lama, Da Qiao dan juga Xiao Qiao, mereka secantik peri kahyangan.","Cao Cao adalah orang yang mata keranjang, dia sangat menginginkan kedua putri tuan Qiao sejak lama, Da Qiao dan juga Xiao Qiao, mereka secantik peri kahyangan.",},
        [4434] = {8406,"Zhou Yu","Zhuge Liang","Cao Cao memiliki dua ambisi, yang pertama adalah memperluas kekuasaan dan menjadi kaisar, yang kedua adalah mendapatkan Qiao bersaudara dan menempatkannya di Paviliun Pipit Tembaga sebagai kesenangannya di masa tua.","Cao Cao memiliki dua ambisi, yang pertama adalah memperluas kekuasaan dan menjadi kaisar, yang kedua adalah mendapatkan Qiao bersaudara dan menempatkannya di Paviliun Pipit Tembaga sebagai kesenangannya di masa tua.",},
        [4435] = {8406,"Zhou Yu","Zhuge Liang","Faktanya, Qiao bersaudara adalah alasan dia membawa sejuta pasukan ke Jiangnan. Mengapa jenderal tidak pergi mencari Tuan Qiao, membeli kedua gadis ini seharga seribu emas, dan mengirimkannya kepada Cao Cao.","Faktanya, Qiao bersaudara adalah alasan dia membawa sejuta pasukan ke Jiangnan. Mengapa jenderal tidak pergi mencari Tuan Qiao, membeli kedua gadis ini seharga seribu emas, dan mengirimkannya kepada Cao Cao.",},
        [4436] = {8406,"Zhou Yu","Zhuge Liang","Ini adalah siasat penawaran yang sangat bagus. Setelah Cao Cao mendapatkan kedua gadis, dia akan puas, lalu kembali ke utara.","Ini adalah siasat penawaran yang sangat bagus. Setelah Cao Cao mendapatkan kedua gadis, dia akan puas, lalu kembali ke utara.",},
        [4437] = {8406,"Zhuge Liang","Zhou Yu","Apa buktinya kalau Cao Cao menginginkan Qiao bersaudara?","Apa buktinya kalau Cao Cao menginginkan Qiao bersaudara?",},
        [4438] = {8406,"Zhou Yu","Protagonis","Putra Cao Cao bernama Cao Zhi, nama lain Zijian, adalah seorang cendekiawan. Cao Cao pernah memintanya membuat suatu karya berjudul Paviliun Pipit Tembaga. Sajaknya menyatakan ambisi Cao Cao menjadi kaisar dan mendapatkan kedua Qiao bersaudara.","Putra Cao Cao bernama Cao Zhi, nama lain Zijian, adalah seorang cendekiawan. Cao Cao pernah memintanya membuat suatu karya berjudul Paviliun Pipit Tembaga. Sajaknya menyatakan ambisi Cao Cao menjadi kaisar dan mendapatkan kedua Qiao bersaudara.",},
        [4439] = {8406,"Zhou Yu","Protagonis","Aku memiliki sajaknya di sini, silahkan dilihat.","Aku memiliki sajaknya di sini, silahkan dilihat.",},
        [4440] = {8406,"Protagonis","Zhou Yu","Tua bangka ini sudah kelewatan!","Tua bangka ini sudah kelewatan!",},
        [4441] = {8406,"Zhou Yu","Zhuge Liang","Di waktu lampau, Chanyu melewati perbatasan berkali-kali sehingga membuat Kaisar Han berdamai dengannya dengan memberikan tuan putri. Mengapa hari ini jenderal begitu peduli dengan dua gadis biasa?","Di waktu lampau, Chanyu melewati perbatasan berkali-kali sehingga membuat Kaisar Han berdamai dengannya dengan memberikan tuan putri. Mengapa hari ini jenderal begitu peduli dengan dua gadis biasa?",},
        [4442] = {8406,"Zhuge Liang","Zhou Yu","Ada yang Tuan tidak tahu, Da Qiao adalah istri Jenderal Sun Bofu, Xiao Qiao adalah istriku.","Ada yang Tuan tidak tahu, Da Qiao adalah istri Jenderal Sun Bofu, Xiao Qiao adalah istriku.",},
        [4443] = {8406,"Zhou Yu","Zhuge Liang","Zhuge Liang tidak tahu. Maafkan kelancanganku, aku pantas mati!","Zhuge Liang tidak tahu. Maafkan kelancanganku, aku pantas mati!",},
        [4444] = {8406,"Zhuge Liang","Zhou Yu","Cao Cao adalah musuh bebuyutanku! Aku akan memberikan saran kepada tuanku untuk mengumpulkan pasukan besok.","Cao Cao adalah musuh bebuyutanku! Aku akan memberikan saran kepada tuanku untuk mengumpulkan pasukan besok.",},
        [4445] = {8407,"Zhou Yu","Sun Quan","Berhari-hari mendiskusikan masalah ini, ada yang menyarankan menyerah, ada yang berperang. Aku belum memutuskan, karena itu aku meminta saran Gongjin saat ini.","Berhari-hari mendiskusikan masalah ini, ada yang menyarankan menyerah, ada yang berperang. Aku belum memutuskan, karena itu aku meminta saran Gongjin saat ini.",},
        [4446] = {8407,"Sun Quan","Zhou Yu","Siapa yang menyarankanmu untuk menyerah?","Siapa yang menyarankanmu untuk menyerah?",},
        [4447] = {8407,"Zhou Yu","Sun Quan","Zhang Zibu dan lainnya.","Zhang Zibu dan lainnya.",},
        [4448] = {8407,"Sun Quan","Zhou Yu","Aku ingin mendengar pendapatmu.","Aku ingin mendengar pendapatmu.",},
        [4449] = {8407,"Zhou Yu","Zhang Zhao","Cao Cao menaklukkan wilayah atas nama kaisar, dan baru saja mendapatkan Jingzhou, kekuatannya sangat besar. Sungai Yangtze satu-satunya keunggulan kita untuk melawan Cao Cao.","Cao Cao menaklukkan wilayah atas nama kaisar, dan baru saja mendapatkan Jingzhou, kekuatannya sangat besar. Sungai Yangtze satu-satunya keunggulan kita untuk melawan Cao Cao.",},
        [4450] = {8407,"Zhou Yu","Zhang Zhao","Kini dia memimpin seribu kapal, bagaimana kita bisa melawannya? Lebih baik menyerah dulu, lalu membuat rencana kemudian.","Kini dia memimpin seribu kapal, bagaimana kita bisa melawannya? Lebih baik menyerah dulu, lalu membuat rencana kemudian.",},
        [4451] = {8407,"Zhang Zhao","Zhou Yu","Ini teori pengecut! Jiangdong sudah dipimpin tiga generasi, bagaimana kita bisa menyerahkannya?","Ini teori pengecut! Jiangdong sudah dipimpin tiga generasi, bagaimana kita bisa menyerahkannya?",},
        [4452] = {8407,"Zhou Yu","Sun Quan","Kalau begitu, apa rencanamu?","Kalau begitu, apa rencanamu?",},
        [4453] = {8407,"Sun Quan","Zhou Yu","Cao Cao memang benar adalah perdana menteri Han, tapi sesungguhnya dia adalah pengkhianat Han. Jenderal memimpin Jiangdong dengan kemampuan dan warisan keluarga. Dengan pasukan yang baik dan sumber daya yang cukup, mengapa Tuanku memilih menyerah dibandingkan membunuh bajingan ini?","Cao Cao memang benar adalah perdana menteri Han, tapi sesungguhnya dia adalah pengkhianat Han. Jenderal memimpin Jiangdong dengan kemampuan dan warisan keluarga. Dengan pasukan yang baik dan sumber daya yang cukup, mengapa Tuanku memilih menyerah dibandingkan membunuh bajingan ini?",},
        [4454] = {8407,"Sun Quan","Zhou Yu","Utara belum sepenuhnya dikuasai, tetapi Cao Cao sudah ingin menaklukkan selatan, ini kerugian pertama bagi mereka. Orang utara lemah saat mereka meninggalkan kudanya untuk berperang melawan Dongwu di air. Ini kerugian kedua mereka.","Utara belum sepenuhnya dikuasai, tetapi Cao Cao sudah ingin menaklukkan selatan, ini kerugian pertama bagi mereka. Orang utara lemah saat mereka meninggalkan kudanya untuk berperang melawan Dongwu di air. Ini kerugian kedua mereka.",},
        [4455] = {8407,"Sun Quan","Zhou Yu","Saat ini juga musim dingin yang sangat dingin bagi mereka, kuda mereka belum cukup makan, kerugian nomor tiga. Pasukan Cao sudah menempuh perjalanan jauh, tidak terbiasa dengan kondisi alam di sini, banyak yang sakit, ini kerugian nomor empat.","Saat ini juga musim dingin yang sangat dingin bagi mereka, kuda mereka belum cukup makan, kerugian nomor tiga. Pasukan Cao sudah menempuh perjalanan jauh, tidak terbiasa dengan kondisi alam di sini, banyak yang sakit, ini kerugian nomor empat.",},
        [4456] = {8407,"Sun Quan","Zhou Yu","Dengan segala kerugian ini, meskipun jumlah mereka lebih banyak, dia pasti kalah. Ini saat yang tepat bagi Tuan Jenderal untuk menangkap Cao. Zhou Yu memerlukan lima puluh ribu pasukan elit di Xiakou, aku akan maju ke garis depan untukmu!","Dengan segala kerugian ini, meskipun jumlah mereka lebih banyak, dia pasti kalah. Ini saat yang tepat bagi Tuan Jenderal untuk menangkap Cao. Zhou Yu memerlukan lima puluh ribu pasukan elit di Xiakou, aku akan maju ke garis depan untukmu!",},
        [4457] = {8407,"Zhou Yu","Sun Quan","Aku menunjukmu sebagai Marsekal, Cheng Pu sebagai wakil, Lu Su sebagai mayor penasihat. Kumpulkan pasukan melawan Cao. Aku akan memenggal siapapun yang menyarankan lagi untuk menyerah!","Aku menunjukmu sebagai Marsekal, Cheng Pu sebagai wakil, Lu Su sebagai mayor penasihat. Kumpulkan pasukan melawan Cao. Aku akan memenggal siapapun yang menyarankan lagi untuk menyerah!",},
        [4458] = {8501,"Zhuge Liang","Zhou Yu","Keputusan sudah dibuat hari ini, moon bantuan Tuan untuk menyusun siasat.","Keputusan sudah dibuat hari ini, moon bantuan Tuan untuk menyusun siasat.",},
        [4459] = {8501,"Zhou Yu","Zhuge Liang","Hati Jenderal Sun belum tenang, masih belum bisa membuat keputusan.","Hati Jenderal Sun belum tenang, masih belum bisa membuat keputusan.",},
        [4460] = {8501,"Zhuge Liang","Zhou Yu","Apa yang kamu maksud belum tenang?","Apa yang kamu maksud belum tenang?",},
        [4461] = {8501,"Zhou Yu","Zhuge Liang","Ketakutan kalah jumlah masih menghantui pikirannya. Jika kamu mampu menenangkannya, tanpa keraguan lagi, kita pasti menang. ","Ketakutan kalah jumlah masih menghantui pikirannya. Jika kamu mampu menenangkannya, tanpa keraguan lagi, kita pasti menang. ",},
        [4462] = {8501,"Zhuge Liang","Zhou Yu","Sungguh saran yang baik.","Sungguh saran yang baik.",},
        [4463] = {8502,"Zhou Yu","Sun Quan","Gongjin malam-malam begini, apa yang sedang dilakukan.","Gongjin malam-malam begini, apa yang sedang dilakukan.",},
        [4464] = {8502,"Sun Quan","Zhou Yu","Kita akan mulai mengirim pasukan besok, apakah Tuan masih ada keraguan?","Kita akan mulai mengirim pasukan besok, apakah Tuan masih ada keraguan?",},
        [4465] = {8502,"Zhou Yu","Sun Quan","Aku hanya khawatir kalah jumlah, tidak ada keraguan lainnya.","Aku hanya khawatir kalah jumlah, tidak ada keraguan lainnya.",},
        [4466] = {8502,"Sun Quan","Zhou Yu","Aku kemari untuk menjelaskan kepada Tuan. Di surat Cao Cao, dia bilang sejuta pasukan, karena itulah Tuan khawatir. Tetapi Tuan tidak pernah mengeceknya sendiri apakah benar demikian.","Aku kemari untuk menjelaskan kepada Tuan. Di surat Cao Cao, dia bilang sejuta pasukan, karena itulah Tuan khawatir. Tetapi Tuan tidak pernah mengeceknya sendiri apakah benar demikian.",},
        [4467] = {8502,"Sun Quan","Zhou Yu","Lalu, pasukannya kelelahan, banyak yang juga tidak setia padanya. Dengan lima puluh ribu pasukan, cukup untuk mengalahkannya. Tuan tidak perlu ragu.","Lalu, pasukannya kelelahan, banyak yang juga tidak setia padanya. Dengan lima puluh ribu pasukan, cukup untuk mengalahkannya. Tuan tidak perlu ragu.",},
        [4468] = {8502,"Zhou Yu","Sun Quan","Yang kamu katakan mampu menghapus keraguanku. Zibu membuatku kehilangan harapan, hanya Zijing dan dirimu yang bersamaku.","Yang kamu katakan mampu menghapus keraguanku. Zibu membuatku kehilangan harapan, hanya Zijing dan dirimu yang bersamaku.",},
        [4469] = {8503,"Lu Su","Zhou Yu","Kongming sejak awal sudah memberikan pencerahan kepada tuan kita. Siasatnya pun jauh di atasku. Dia akan menjadi ancaman bagi kita suatu hari nanti, kita harus membunuhnya.","Kongming sejak awal sudah memberikan pencerahan kepada tuan kita. Siasatnya pun jauh di atasku. Dia akan menjadi ancaman bagi kita suatu hari nanti, kita harus membunuhnya.",},
        [4470] = {8503,"Zhou Yu","Lu Su","Tidak bisa, Cao Cao masih belum dikalahkan. Membunuh penasihat, hanya akan merugikan kita.","Tidak bisa, Cao Cao masih belum dikalahkan. Membunuh penasihat, hanya akan merugikan kita.",},
        [4471] = {8503,"Lu Su","Zhou Yu","Dia penasihat Liu Bei, ancaman bagi Jiangdong.","Dia penasihat Liu Bei, ancaman bagi Jiangdong.",},
        [4472] = {8503,"Zhou Yu","Lu Su","Zhuge Jin adalah saudaranya, bisa membuatnya berpaling kepada Dongwu, bukankah ini bagus?","Zhuge Jin adalah saudaranya, bisa membuatnya berpaling kepada Dongwu, bukankah ini bagus?",},
        [4473] = {8503,"Lu Su","Zhou Yu","Masuk akal.","Masuk akal.",},
        [4474] = {8504,"Zhuge Jin","Zhou Yu","Kongming adalah penasihat yang sangat hebat, mengapa dia mengabdi kepada Liu Bei?","Kongming adalah penasihat yang sangat hebat, mengapa dia mengabdi kepada Liu Bei?",},
        [4475] = {8504,"Zhuge Jin","Zhou Yu","Berhubung dia kini di Jiangdong, aku ingin kamu mempengaruhinya untuk mengabdi kepada Wu tidak peduli apa yang akan dikatakan orang tentangmu. Dengan begini, tuan kita akan memiliki penasihat hebat dan kalian bersaudara bisa bersama, bukankah itu sesuatu yang bagus?","Berhubung dia kini di Jiangdong, aku ingin kamu mempengaruhinya untuk mengabdi kepada Wu tidak peduli apa yang akan dikatakan orang tentangmu. Dengan begini, tuan kita akan memiliki penasihat hebat dan kalian bersaudara bisa bersama, bukankah itu sesuatu yang bagus?",},
        [4476] = {8504,"Zhou Yu","Zhuge Jin","Sejak aku datang di Jiangdong, aku belum memberikan kontribusi apapun, aku tidak berani menolak perintah ini.","Sejak aku datang di Jiangdong, aku belum memberikan kontribusi apapun, aku tidak berani menolak perintah ini.",},
        [4477] = {8505,"Zhuge Liang","Zhuge Jin","Apakah kamu bersedia untuk meninggalkan Liu Bei dan mengabdi kepada Wu?","Apakah kamu bersedia untuk meninggalkan Liu Bei dan mengabdi kepada Wu?",},
        [4478] = {8505,"Zhuge Jin","Zhuge Liang","Zhou Yu pasti yang mengirimkanmu padaku.","Zhou Yu pasti yang mengirimkanmu padaku.",},
        [4479] = {8505,"Zhuge Liang","Zhuge Jin","Apakah kamu tahu Boyi atau Shuqi?","Apakah kamu tahu Boyi atau Shuqi?",},
        [4480] = {8505,"Zhuge Liang","Zhuge Jin","Keduanya mati kelaparan di Shouyang, kedua saudara ini bersama-sama. Kamu dan aku bersaudara tetapi mengabdi kepada tuan yang berbeda, kita tidak bisa bersama, apakah kamu tidak merasa buruk?","Keduanya mati kelaparan di Shouyang, kedua saudara ini bersama-sama. Kamu dan aku bersaudara tetapi mengabdi kepada tuan yang berbeda, kita tidak bisa bersama, apakah kamu tidak merasa buruk?",},
        [4481] = {8505,"Zhuge Jin","Zhuge Liang","Kakak menghargai persaudaraan, adik menghargai kesetiaan. Kita berdua adalah orang Han.","Kakak menghargai persaudaraan, adik menghargai kesetiaan. Kita berdua adalah orang Han.",},
        [4482] = {8505,"Zhuge Jin","Zhuge Liang","Tuanku adalah keturunan Han, jika kakak bisa mengabdi kepada Paman Imperial Liu bersamaku, kita tidak hanya berjuang demi Han, tetapi kita juga bisa bersama. Bukankah ini jalan terbaik.","Tuanku adalah keturunan Han, jika kakak bisa mengabdi kepada Paman Imperial Liu bersamaku, kita tidak hanya berjuang demi Han, tetapi kita juga bisa bersama. Bukankah ini jalan terbaik.",},
        [4483] = {8505,"Zhuge Jin","Zhuge Liang","Bagaimana menurutmu?","Bagaimana menurutmu?",},
        [4484] = {8505,"Zhuge Liang","Zhuge Jin","Aku sudah memahami maksudmu. Sampai jumpa.","Aku sudah memahami maksudmu. Sampai jumpa.",},
        [4485] = {8506,"Zhuge Liang","Zhou Yu","Di masa lampau, pasukan Yuan Shao banyak, tetapi Cao Cao menang karena menggunakan siasat Xu You, dengan menyerang ransum Wuchao lebih dulu.","Di masa lampau, pasukan Yuan Shao banyak, tetapi Cao Cao menang karena menggunakan siasat Xu You, dengan menyerang ransum Wuchao lebih dulu.",},
        [4486] = {8506,"Zhuge Liang","Zhou Yu","Kini pasukan Cao ada delapan ratus tiga puluh ribu, pasukanku lima puluh ribu lebih, apa yang bisa aku lakukan? Aku juga harus menghancurkan persediaan ransum pasukan Cao untuk bisa menyerang. Aku sudah tahu ransum pasukan Cao ada di gunung Jutie.","Kini pasukan Cao ada delapan ratus tiga puluh ribu, pasukanku lima puluh ribu lebih, apa yang bisa aku lakukan? Aku juga harus menghancurkan persediaan ransum pasukan Cao untuk bisa menyerang. Aku sudah tahu ransum pasukan Cao ada di gunung Jutie.",},
        [4487] = {8506,"Zhuge Liang","Zhou Yu","Tuan lama tinggal di Han, sangat memahami geografis di sana. Tolong sabotase suplai ransum di gunung Jutie. Kita memiliki tujuan yang sama, tolong jangan menolak.","Tuan lama tinggal di Han, sangat memahami geografis di sana. Tolong sabotase suplai ransum di gunung Jutie. Kita memiliki tujuan yang sama, tolong jangan menolak.",},
        [4488] = {8506,"Zhou Yu","Zhuge Liang","Baik.","Baik.",},
        [4489] = {8507,"Zhuge Liang","Protagonis","Zhou Yu karena tidak bisa mempengaruhi Tuan, ingin menyingkirkan Tuan dengan cara supaya Tuan mati terbunuh oleh Cao Cao.","Zhou Yu karena tidak bisa mempengaruhi Tuan, ingin menyingkirkan Tuan dengan cara supaya Tuan mati terbunuh oleh Cao Cao.",},
        [4490] = {8507,"Protagonis","Zhuge Liang","Aku tahu, tapi jika aku menolak, aku akan jadi bahan tertawaan. Aku hanya bisa menyetujui sambil membuat rencana.","Aku tahu, tapi jika aku menolak, aku akan jadi bahan tertawaan. Aku hanya bisa menyetujui sambil membuat rencana.",},
        [4491] = {8507,"Zhuge Liang","Protagonis","Tuan hebat sekali.","Tuan hebat sekali.",},
        [4492] = {8508,"Zhuge Liang","Lu Su","Apakah Tuan akan berhasil menghancurkan suplai ransum Cao Cao?","Apakah Tuan akan berhasil menghancurkan suplai ransum Cao Cao?",},
        [4493] = {8508,"Lu Su","Zhuge Liang","Aku menguasai pertempuran air, infantri, kavaleri, kereta, dan berbagai hal lainnya, mengapa aku harus gagal? Berbeda denganmu dan Zhou Yu yang hanya menguasai satu hal.","Aku menguasai pertempuran air, infantri, kavaleri, kereta, dan berbagai hal lainnya, mengapa aku harus gagal? Berbeda denganmu dan Zhou Yu yang hanya menguasai satu hal.",},
        [4494] = {8508,"Zhuge Liang","Lu Su","Aku dan Gongjin, satu hal apakah itu?","Aku dan Gongjin, satu hal apakah itu?",},
        [4495] = {8508,"Lu Su","Zhuge Liang","Rumor yang berhembus, Zijing ahli darat, Zhoulang ahli air.","Rumor yang berhembus, Zijing ahli darat, Zhoulang ahli air.",},
        [4496] = {8508,"Lu Su","Zhuge Liang","Artinya kamu hanya ahli bertempur di darat, Zhou Gongjin ahli bertempur di air, tidak di keduanya.","Artinya kamu hanya ahli bertempur di darat, Zhou Gongjin ahli bertempur di air, tidak di keduanya.",},
        [4497] = {8509,"Zhou Yu","Lu Su","Saat aku pergi mencari informasi, aku bertemu Kongming, dia bilang kalau Tuan hanya bisa bertarung di air, tidak di darat.","Saat aku pergi mencari informasi, aku bertemu Kongming, dia bilang kalau Tuan hanya bisa bertarung di air, tidak di darat.",},
        [4498] = {8509,"Lu Su","Zhou Yu","Merendahkanku! Dia tidak perlu pergi! Aku sendiri yang akan memimpin sepuluh ribu pasukan untuk menghancurkan ransum Cao Cao.","Merendahkanku! Dia tidak perlu pergi! Aku sendiri yang akan memimpin sepuluh ribu pasukan untuk menghancurkan ransum Cao Cao.",},
        [4499] = {8510,"","Liu Bei","Kongming sejak pergi ke Dongwu, tidak ada kabar sama sekali, tidak tahu bagaimana dia sekarang?","Kongming sejak pergi ke Dongwu, tidak ada kabar sama sekali, tidak tahu bagaimana dia sekarang?",},
        [4500] = {8510,"Liu Bei","Mi Zhu","Saat aku pergi mencari informasi, kabarnya Dongwu meminta Kongming menjadi penasihat untuk melawan Cao Cao, tidak boleh pergi dulu.","Saat aku pergi mencari informasi, kabarnya Dongwu meminta Kongming menjadi penasihat untuk melawan Cao Cao, tidak boleh pergi dulu.",},
        [4501] = {8510,"Liu Bei","Mi Zhu","Ohya, Zhou Lang juga ingin menemui Tuan, ingin membicarakan siasat.","Ohya, Zhou Lang juga ingin menemui Tuan, ingin membicarakan siasat.",},
        [4502] = {8510,"Liu Bei","Guan Yu","Zhou Yu penuh dengan siasat, juga tidak ada surat dari Kongming. Kita tidak bisa meremehkan, bisa saja kita dijebak.","Zhou Yu penuh dengan siasat, juga tidak ada surat dari Kongming. Kita tidak bisa meremehkan, bisa saja kita dijebak.",},
        [4503] = {8510,"Guan Yu","Liu Bei","Aku kini beraliansi dengan Dongwu untuk melawan Cao Cao. Zhou Lang ingin menemuiku, jika aku tidak menemuinya, akan melanggar aliansi. Kedua pihak tidak seharusnya saling mencurigai.","Aku kini beraliansi dengan Dongwu untuk melawan Cao Cao. Zhou Lang ingin menemuiku, jika aku tidak menemuinya, akan melanggar aliansi. Kedua pihak tidak seharusnya saling mencurigai.",},
        [4504] = {8510,"Liu Bei","Guan Yu","Jika kakak memaksa pergi, adik juga akan pergi.","Jika kakak memaksa pergi, adik juga akan pergi.",},
        [4505] = {8510,"Liu Bei","Zhang Fei","Aku juga ikut.","Aku juga ikut.",},
        [4506] = {8510,"Zhang Fei","Liu Bei","Cukup Yunchang saja ikut denganku, juga ada adik keempat bersama dengan Kongming saat ini.","Cukup Yunchang saja ikut denganku, juga ada adik keempat bersama dengan Kongming saat ini.",},
