        [4518] = {8512,"Liu Bei","Zhou Yu","Aku mendengar nama besarmu. Mari mari, aku ingin bersulang juga bagi Yunchang.","Aku mendengar nama besarmu. Mari mari, aku ingin bersulang juga bagi Yunchang.",},
        [4519] = {8513,"Zhou Yu","Lu Su","Tuan sudah menarik Xuande kemari, kenapa tidak memberikan perintah apapun?","Tuan sudah menarik Xuande kemari, kenapa tidak memberikan perintah apapun?",},
        [4520] = {8513,"Lu Su","Zhou Yu","Guan Yunchang, dia adalah Jenderal Macan, bersebelahan dengan Xuande. Jika aku beraksi, dia pasti akan menghajarku.","Guan Yunchang, dia adalah Jenderal Macan, bersebelahan dengan Xuande. Jika aku beraksi, dia pasti akan menghajarku.",},
