        [4525] = {8514,"Protagonis","Liu Bei","Kita sungguh dalam bahaya. Kamu harus segera kembali bersamaku.","Kita sungguh dalam bahaya. Kamu harus segera kembali bersamaku.",},
        [4526] = {8514,"Liu Bei","Zhuge Liang","Aku memang dalam bahaya, tetapi aku tidak khawatir. Tuan silahkan kembali hari ini.","Aku memang dalam bahaya, tetapi aku tidak khawatir. Tuan silahkan kembali hari ini.",},
        [4527] = {8514,"Liu Bei","Zhuge Liang","Pada 20 November perintahkan Zilong untuk menunggu di dermaga dengan kapal kecil. Jangan ada kesalahan.","Pada 20 November perintahkan Zilong untuk menunggu di dermaga dengan kapal kecil. Jangan ada kesalahan.",},
