        [4535] = {8601,"Lu Su","Zhou Yu","Di sampul suratnya, tertulis untuk Jenderal Zhou Yu dari perdana menteri Han.","Di sampul suratnya, tertulis untuk Jenderal Zhou Yu dari perdana menteri Han.",},
        [4536] = {8601,"Zhou Yu","Lu Su","Kedua negara berperang, tidak akan membunuh utusan.","Kedua negara berperang, tidak akan membunuh utusan.",},
        [4537] = {8601,"Lu Su","Zhou Yu","Bunuh dia untuk menunjukkan kekuatan kita! Kirim kepalanya kembali ke mereka.","Bunuh dia untuk menunjukkan kekuatan kita! Kirim kepalanya kembali ke mereka.",},
        [4538] = {8601,"Lu Su","Zhou Yu","Tunjuk Gan Ning sebagai pionir, Han Dang sebagai sayap kiri, Jiang Qin sebagai sayap kanan. Aku sendiri yang akan memimpin pasukan cadangan. Besok jam 1 dini hari kita memasak, jam 3 pagi ita berangkat, tabuh genderang dan menyerang.","Tunjuk Gan Ning sebagai pionir, Han Dang sebagai sayap kiri, Jiang Qin sebagai sayap kanan. Aku sendiri yang akan memimpin pasukan cadangan. Besok jam 1 dini hari kita memasak, jam 3 pagi ita berangkat, tabuh genderang dan menyerang.",},
        [4539] = {8602,"","Cao Cao","Zhou Yu membunuh utusan kita!","Zhou Yu membunuh utusan kita!",},
        [4540] = {8602,"","Cao Cao","Cai Mao dan Zhang Yun akan memimpin di depan, aku di pasukan belakang. Percepat kapal perang untuk menyusuri tiga sungai.","Cai Mao dan Zhang Yun akan memimpin di depan, aku di pasukan belakang. Percepat kapal perang untuk menyusuri tiga sungai.",},
        [4541] = {8603,"Cai Mao","Cao Cao","Cai Xun sudah matii, banyak pasukan Cao terkena panah dan meriam.","Cai Xun sudah matii, banyak pasukan Cao terkena panah dan meriam.",},
        [4542] = {8603,"Cai Mao","Cao Cao","Wu mengalahkanmu dengan lebih sedikit pasukan, kamu tidak bertarung sepenuh hati!","Wu mengalahkanmu dengan lebih sedikit pasukan, kamu tidak bertarung sepenuh hati!",},
        [4543] = {8603,"Cao Cao","Cai Mao","Angkatan laut Jingzhou tidak terlatih. Pasukan Qing dan Xu tidak ahli berperang di air. Itulah kenapa kita kalah.","Angkatan laut Jingzhou tidak terlatih. Pasukan Qing dan Xu tidak ahli berperang di air. Itulah kenapa kita kalah.",},
        [4544] = {8603,"Cao Cao","Cai Mao","Kita harus membangun barak di air, dengan pasukan Qing dan Xu di sana, pasukan Jingzhou di luar, berlatih setiap hari, mereka akan bisa digunakan nantinya.","Kita harus membangun barak di air, dengan pasukan Qing dan Xu di sana, pasukan Jingzhou di luar, berlatih setiap hari, mereka akan bisa digunakan nantinya.",},
        [4545] = {8603,"Cai Mao","Cao Cao","Kamu adalah Gubernur Marinir, lakukan sesuai keputusanmu, tidak perlu melapor padaku!","Kamu adalah Gubernur Marinir, lakukan sesuai keputusanmu, tidak perlu melapor padaku!",},
        [4546] = {8604,"Zhou Yu","Protagonis","Saat aku melihat dari ketinggian, aku melihat di barat penuh dengan cahaya pasukan utara.","Saat aku melihat dari ketinggian, aku melihat di barat penuh dengan cahaya pasukan utara.",},
        [4547] = {8604,"Zhou Yu","Protagonis","Aku mengutus pengintai, dan ternyata Cao Cao membangun barak di air, sungguh siasat yang bagus!","Aku mengutus pengintai, dan ternyata Cao Cao membangun barak di air, sungguh siasat yang bagus!",},
