        [4549] = {8604,"Zhou Yu","Protagonis","Cai Mao dan Zhang Yun.","Cai Mao dan Zhang Yun.",},
        [4550] = {8604,"Protagonis","Zhuge Liang","Mereka lama tinggal di Jiangdong, terlatih untuk pertempuran di air, aku harus memikirkan cara untuk menyingkirkan mereka berdua, lalu kita bisa menghancurkan pasukan Cao.","Mereka lama tinggal di Jiangdong, terlatih untuk pertempuran di air, aku harus memikirkan cara untuk menyingkirkan mereka berdua, lalu kita bisa menghancurkan pasukan Cao.",},
        [4551] = {8605,"","Cao Cao","Kemarin baru saja kalah satu pasukan, sekarang dia sudah mengetahui tentang barak air kita. Apa yang harus aku lakukan? ","Kemarin baru saja kalah satu pasukan, sekarang dia sudah mengetahui tentang barak air kita. Apa yang harus aku lakukan? ",},
