        [4585] = {8610,"Cao Cao","Jiang Gan","Di suratnya tertulis, kami tidak menyerah kepada Cao Cao demi kekayaan dan jabatan, kami terpaksa melakukannya, sehingga kami harus mengelola pasukannya di barak. Saat kami memilki kesempatan, kami akan memenggalnya dan mempersembahkannya padamu.","Di suratnya tertulis, kami tidak menyerah kepada Cao Cao demi kekayaan dan jabatan, kami terpaksa melakukannya, sehingga kami harus mengelola pasukannya di barak. Saat kami memilki kesempatan, kami akan memenggalnya dan mempersembahkannya padamu.",},
