        [4612] = {8702,"Zhou Yu","Zhuge Liang","Aku tidak berani mempermainkan jenderal! Aku bersedia membuat jaminan militer, jika dalam tiga hari tidak bisa, aku siap menerima hukuman berat.","Aku tidak berani mempermainkan jenderal! Aku bersedia membuat jaminan militer, jika dalam tiga hari tidak bisa, aku siap menerima hukuman berat.",},
