        [4614] = {8702,"Zhou Yu","Zhuge Liang","Hari ini sudah terlalu malam, besok dimulai. Di hari ketiga, tolong suruh lima ratus orang ke dermaga untuk mengumpulkan panahnya.","Hari ini sudah terlalu malam, besok dimulai. Di hari ketiga, tolong suruh lima ratus orang ke dermaga untuk mengumpulkan panahnya.",},
        [4615] = {8703,"Zhou Yu","Lu Su","Apakah dia membual?","Apakah dia membual?",},
        [4616] = {8703,"Lu Su","Zhou Yu","Dia sendiri yang mencari mati, aku tidak memaksanya. Dia sendiri yang menandatangani jaminan militer di depan publik. Bahkan jika dia punya sayap, dia juga tidak bisa terbang.","Dia sendiri yang mencari mati, aku tidak memaksanya. Dia sendiri yang menandatangani jaminan militer di depan publik. Bahkan jika dia punya sayap, dia juga tidak bisa terbang.",},
        [4617] = {8703,"Lu Su","Zhou Yu","Aku sudah memberitahu pandai besi untuk memperlambat pekerjaan, dan Zhuge Liang tidak akan mendapatkan sumber daya yang diperlukan.","Aku sudah memberitahu pandai besi untuk memperlambat pekerjaan, dan Zhuge Liang tidak akan mendapatkan sumber daya yang diperlukan.",},
        [4618] = {8703,"Lu Su","Zhou Yu","Dengan begini, penempaan pasti akan terlambat. Hingga waktunya tiba, dia tidak punya alasan lagi kan? Aku bisa menghukumnya dengan segala cara. Kamu tolong memeriksanya dan melaporkan kepadaku.","Dengan begini, penempaan pasti akan terlambat. Hingga waktunya tiba, dia tidak punya alasan lagi kan? Aku bisa menghukumnya dengan segala cara. Kamu tolong memeriksanya dan melaporkan kepadaku.",},
        [4619] = {8704,"Lu Su","Zhuge Liang","Aku pernah bilang kepadamu, jangan bilang kepada Gongjin, dia pasti menginginkanku mati, tapi kamu tetap melakukannya. Kini dia mencari masalah lagi denganku.","Aku pernah bilang kepadamu, jangan bilang kepada Gongjin, dia pasti menginginkanku mati, tapi kamu tetap melakukannya. Kini dia mencari masalah lagi denganku.",},
        [4620] = {8704,"Lu Su","Zhuge Liang","Bagaimana aku harus menyiapkan seratus ribu panah dalam tiga hari? Zijing harus menolongku!","Bagaimana aku harus menyiapkan seratus ribu panah dalam tiga hari? Zijing harus menolongku!",},
        [4621] = {8704,"Zhuge Liang","Lu Su","Kamu sendiri yang mencari masalah, kenapa aku harus menolongmu?","Kamu sendiri yang mencari masalah, kenapa aku harus menolongmu?",},
        [4622] = {8704,"Lu Su","Zhuge Liang","Tolong pinjami aku dua puluh kapal, setiap kapal berisi tiga puluh pasukan, tutupi kapal dengan kain hijau, taruh berkas gandum di kedua sisinya.","Tolong pinjami aku dua puluh kapal, setiap kapal berisi tiga puluh pasukan, tutupi kapal dengan kain hijau, taruh berkas gandum di kedua sisinya.",},
        [4623] = {8704,"Lu Su","Zhuge Liang","Aku memiliki ide brilian. Aku menjanjikan seratus ribu panah di hari ketiga. Tapi jangan biarkan Gongjin mengetahui permintaanku ini. Jika dia tahu, rencanaku akan gagal.","Aku memiliki ide brilian. Aku menjanjikan seratus ribu panah di hari ketiga. Tapi jangan biarkan Gongjin mengetahui permintaanku ini. Jika dia tahu, rencanaku akan gagal.",},
        [4624] = {8704,"Zhuge Liang","Lu Su","Aku tidak tahu apa rencanamu, tetapi aku akan memberikan apa yang kamu perlukan.","Aku tidak tahu apa rencanamu, tetapi aku akan memberikan apa yang kamu perlukan.",},
        [4625] = {8705,"Zhuge Liang","Lu Su","Mengapa kamu memanggilku kemari?","Mengapa kamu memanggilku kemari?",},
        [4626] = {8705,"Lu Su","Zhuge Liang","Aku mengajakmu mengumpulkan panah bersamaku.","Aku mengajakmu mengumpulkan panah bersamaku.",},
        [4627] = {8705,"Zhuge Liang","Lu Su","Di mana?","Di mana?",},
        [4628] = {8705,"Lu Su","Zhuge Liang","Jangan banyak tanya, ikuti saja aku.","Jangan banyak tanya, ikuti saja aku.",},
        [4629] = {8706,"Zhuge Liang","Lu Su","Ini lewat jam 3 pagi, kenapa kapal menuju arah dermaga pasukan Cao","Ini lewat jam 3 pagi, kenapa kapal menuju arah dermaga pasukan Cao",},
        [4630] = {8706,"Lu Su","Zhuge Liang","Sabarlah, semua kapal menghadap ke arah barat dan berbaris, pasukan tabuh genderang dan berteriak.","Sabarlah, semua kapal menghadap ke arah barat dan berbaris, pasukan tabuh genderang dan berteriak.",},
        [4631] = {8706,"Zhuge Liang","Lu Su","Bagaimana jika pasukan Cao menyerang kita?","Bagaimana jika pasukan Cao menyerang kita?",},
        [4632] = {8706,"Lu Su","Zhuge Liang","Cao Cao tidak akan berani membuat tindakan saat kabut tebal. Kita hanya perlu menunggu sambil minum hingga kabutnya menghilang.","Cao Cao tidak akan berani membuat tindakan saat kabut tebal. Kita hanya perlu menunggu sambil minum hingga kabutnya menghilang.",},
        [4633] = {8707,"Cao Cao","Yu Jin","Perdana menteri, kapal Wu menabuh genderang dan berteriak di sungai.","Perdana menteri, kapal Wu menabuh genderang dan berteriak di sungai.",},
        [4634] = {8707,"Yu Jin","Cao Cao","Musuh kita bersembunyi di balik kabut, pasti ada sergapan, kita harus berhati-hati. Perintahkan pemanah untuk menembakkan panah.","Musuh kita bersembunyi di balik kabut, pasti ada sergapan, kita harus berhati-hati. Perintahkan pemanah untuk menembakkan panah.",},
        [4635] = {8707,"Yu Jin","Cao Cao","Zhang Liao, Xu Huang, pimpin tiga ribu pasukan panah, cepat tembakkan ke sungai.","Zhang Liao, Xu Huang, pimpin tiga ribu pasukan panah, cepat tembakkan ke sungai.",},
        [4636] = {8707,"Cao Cao","Zhang Liao","Ya.","Ya.",},
        [4637] = {8708,"","Zhuge Liang","Terimakasih perdana menteri atas panahnya!","Terimakasih perdana menteri atas panahnya!",},
        [4638] = {8708,"Zhuge Liang","Cao Cao","Apa! Cepat kejar mereka.","Apa! Cepat kejar mereka.",},
        [4639] = {8708,"Cao Cao","Yu Jin","Kapal berlayar cepat searah aliran sungai, mereka sudah berjarak 20 mil, tidak terkejar lagi. ","Kapal berlayar cepat searah aliran sungai, mereka sudah berjarak 20 mil, tidak terkejar lagi. ",},
        [4640] = {8708,"Yu Jin","Cao Cao","Sialan, Zhuge Kongming!","Sialan, Zhuge Kongming!",},
        [4641] = {8709,"Lu Su","Zhuge Liang","Lebih dari 5000 panah di setiap kapal, seratus ribu panah didapatkan tanpa kesulitan. Besok digunakan untuk memanah pasukan Cao, sungguh efisien!","Lebih dari 5000 panah di setiap kapal, seratus ribu panah didapatkan tanpa kesulitan. Besok digunakan untuk memanah pasukan Cao, sungguh efisien!",},
        [4642] = {8709,"Zhuge Liang","Lu Su","Tuan sungguh jenius! Bagaimana bisa tahu kalau akan ada kabut tebal?","Tuan sungguh jenius! Bagaimana bisa tahu kalau akan ada kabut tebal?",},
        [4643] = {8709,"Lu Su","Zhuge Liang","Sebagai jenderal, dia tidak mempelajari astronomi ataupun geografi, tidak belajar klasik ataupun Yin Yang. Tidak membaca peta formasi, tidak memahami keunggulan pasukan, sangatlah pemula.","Sebagai jenderal, dia tidak mempelajari astronomi ataupun geografi, tidak belajar klasik ataupun Yin Yang. Tidak membaca peta formasi, tidak memahami keunggulan pasukan, sangatlah pemula.",},
        [4644] = {8709,"Lu Su","Zhuge Liang","Aku tiga hari lalu memperkirakan bahwa akan ada kabut tebal, karena itulah aku berani menjanjikan tiga hari.","Aku tiga hari lalu memperkirakan bahwa akan ada kabut tebal, karena itulah aku berani menjanjikan tiga hari.",},
        [4645] = {8709,"Lu Su","Zhuge Liang","Gongjin memintaku menyelesaikan dalam sepuluh hari, tanpa pandai besi dan sumber daya apapun. Sangat terlihat jelas dia bermaksud membunuhku, tetapi takdirku tidak berada di tangannya! ","Gongjin memintaku menyelesaikan dalam sepuluh hari, tanpa pandai besi dan sumber daya apapun. Sangat terlihat jelas dia bermaksud membunuhku, tetapi takdirku tidak berada di tangannya! ",},
        [4646] = {8709,"Zhuge Liang","Lu Su","Zijing mengagumimu Tuan.","Zijing mengagumimu Tuan.",},
        [4647] = {8710,"Zhuge Liang","Zhou Yu","Perhitungan Tuan, sungguh layak dikagumi.","Perhitungan Tuan, sungguh layak dikagumi.",},
        [4648] = {8710,"Zhou Yu","Zhuge Liang","Ini hanyalah siasat kecil.","Ini hanyalah siasat kecil.",},
        [4649] = {8710,"Zhuge Liang","Zhou Yu","Kemarin, Tuanku menyuruhku mempercepat serangan, aku belum memiliki rencana, aku harap Tuan bisa mengajariku.","Kemarin, Tuanku menyuruhku mempercepat serangan, aku belum memiliki rencana, aku harap Tuan bisa mengajariku.",},
        [4650] = {8710,"Zhou Yu","Zhuge Liang","Aku hanya orang biasa saja, bagaimana aku bisa memiliki rencana?","Aku hanya orang biasa saja, bagaimana aku bisa memiliki rencana?",},
        [4651] = {8710,"Zhuge Liang","Zhou Yu","Dari pengamatanku kemarin, benteng air Cao Cao sungguh solid, tidak mudah diserang. Aku memiliki rencana, tidak tahu bisa dijalankan atau tidak. Tuan bisakah mengevaluasi rencanaku ini.","Dari pengamatanku kemarin, benteng air Cao Cao sungguh solid, tidak mudah diserang. Aku memiliki rencana, tidak tahu bisa dijalankan atau tidak. Tuan bisakah mengevaluasi rencanaku ini.",},
        [4652] = {8710,"Zhou Yu","Zhuge Liang","Jangan katakan dulu. Kita masing-masing menulis dulu di tangan, kita lihat apakah rencana kita saa.","Jangan katakan dulu. Kita masing-masing menulis dulu di tangan, kita lihat apakah rencana kita saa.",},
        [4653] = {8710,"Zhuge Liang","Zhou Yu","Aku menulis huruf Api.","Aku menulis huruf Api.",},
        [4654] = {8710,"Zhou Yu","Zhuge Liang","Aku juga menulis huruf Api.","Aku juga menulis huruf Api.",},
        [4655] = {8710,"Zhuge Liang","Zhou Yu","Berhubung kita berdua sama, aku menjadi lebih yakin. Jangan bocorkan.","Berhubung kita berdua sama, aku menjadi lebih yakin. Jangan bocorkan.",},
        [4656] = {8710,"Zhou Yu","Zhuge Liang","Demi kebaikan kedua Tuan, jangan ada yang membocorkan. Menurutku meskipun aku sudah dua kali menggunakan siasat api untuk membakar Cao Cao, dia tetap tidak akan bersiap untuk itu. Mari kita tetap jalankan rencana.","Demi kebaikan kedua Tuan, jangan ada yang membocorkan. Menurutku meskipun aku sudah dua kali menggunakan siasat api untuk membakar Cao Cao, dia tetap tidak akan bersiap untuk itu. Mari kita tetap jalankan rencana.",},
        [4657] = {8801,"Cao Cao","Xun You","Jiangdong memiliki dua orang bijak, yaitu Zhou Yu dan Zhuge liang, sulit mengalahkan mereka. Kita bisa mengirim mata-mata ke Dongwu, seseorang yang berpura-pura sebagai pembelot, tetapi aslinya menggali informasi bagi kita. ","Jiangdong memiliki dua orang bijak, yaitu Zhou Yu dan Zhuge liang, sulit mengalahkan mereka. Kita bisa mengirim mata-mata ke Dongwu, seseorang yang berpura-pura sebagai pembelot, tetapi aslinya menggali informasi bagi kita. ",},
        [4658] = {8801,"Xun You","Cao Cao","Sesuai dengan tujuanku. Menurutmu siapa yang harus diutus?","Sesuai dengan tujuanku. Menurutmu siapa yang harus diutus?",},
        [4659] = {8801,"Cao Cao","Xun You","Cai Mao sudah mati, seluruh klan Cao ada di dalam pasukan. Sepupu Cai Mao, yaitu Cai Zhong dan Cai He, keduanya adalah kapten. Mereka bisa diutus untuk menjadi mata-mata. Dengan mereka berpura-pura membelot, Wu tidak akan curiga.","Cai Mao sudah mati, seluruh klan Cao ada di dalam pasukan. Sepupu Cai Mao, yaitu Cai Zhong dan Cai He, keduanya adalah kapten. Mereka bisa diutus untuk menjadi mata-mata. Dengan mereka berpura-pura membelot, Wu tidak akan curiga.",},
        [4660] = {8801,"Xun You","Cao Cao","Rencana bagus.","Rencana bagus.",},
        [4661] = {8802,"Cai He","Cao Cao","Cai Zhong, Cai He, kalian berdua bawa beberapa pasukan untuk menyerah kepada Dongwu. Jika ada pergerakan, kirim laporan. Setelah kita menang perang, kalian berdua akan mendapatkan banyak imbalan!","Cai Zhong, Cai He, kalian berdua bawa beberapa pasukan untuk menyerah kepada Dongwu. Jika ada pergerakan, kirim laporan. Setelah kita menang perang, kalian berdua akan mendapatkan banyak imbalan!",},
        [4662] = {8802,"Cao Cao","Cai He","Anak dan istri kami ada di Jingzhou, perdana menteri tidak perlu mencurigai kami. Kami akan mempersembahkan kepala Zhuge Liang dan Zhou Yu kepadamu.","Anak dan istri kami ada di Jingzhou, perdana menteri tidak perlu mencurigai kami. Kami akan mempersembahkan kepala Zhuge Liang dan Zhou Yu kepadamu.",},
        [4663] = {8802,"Cai He","Cao Cao","Baiklah, aku akan memberikan imbalan uang muka untuk kalian.","Baiklah, aku akan memberikan imbalan uang muka untuk kalian.",},
        [4664] = {8802,"Cai He","Cao Cao","Besok, masing-masing dari kalian membawa lima ratus pasukan dan beberapa kapal ke pesisir selatan.","Besok, masing-masing dari kalian membawa lima ratus pasukan dan beberapa kapal ke pesisir selatan.",},
        [4665] = {8802,"Cao Cao","Cai He","Ya.","Ya.",},
        [4666] = {8803,"Zhou Yu","Cai He","Sepupu kami tidak bersalah, tapi bajingan Cao membunuhnya. Kami berdua ingin membalas dendam, secara khusus datang menyerahkan diri. Semoga kami diterima di sini, kami bersedia di baris depan.","Sepupu kami tidak bersalah, tapi bajingan Cao membunuhnya. Kami berdua ingin membalas dendam, secara khusus datang menyerahkan diri. Semoga kami diterima di sini, kami bersedia di baris depan.",},
        [4667] = {8803,"Cai He","Zhou Yu","Selamat datang di Dongwu, beri mereka imbalan! Bergabunglah dengan Gan Ning di baris depan.","Selamat datang di Dongwu, beri mereka imbalan! Bergabunglah dengan Gan Ning di baris depan.",},
        [4668] = {8803,"Zhou Yu","Cai He","Terimakasih Zhou Lang!","Terimakasih Zhou Lang!",},
        [4669] = {8804,"Gan Ning","Zhou Yu","Cai Zhong dan Cai He kemari tanpa membawa keluarga, mereka berpura-pura menyerah. Mereka adalah mata-mata yang dikirim Cao Cao. Aku akan memanfaatkan mereka dan memberikan mereka sesuatu untuk dikabarkan.","Cai Zhong dan Cai He kemari tanpa membawa keluarga, mereka berpura-pura menyerah. Mereka adalah mata-mata yang dikirim Cao Cao. Aku akan memanfaatkan mereka dan memberikan mereka sesuatu untuk dikabarkan.",},
        [4670] = {8804,"Gan Ning","Zhou Yu","Kamu sambutlah mereka, tetapi tetap penuh kewaspadaan. Saat pasukan dikirim, bunuh mereka berdua lebih dulu. Kamu harus hati-hati, tanpa kesalahan.","Kamu sambutlah mereka, tetapi tetap penuh kewaspadaan. Saat pasukan dikirim, bunuh mereka berdua lebih dulu. Kamu harus hati-hati, tanpa kesalahan.",},
        [4671] = {8804,"Zhou Yu","Gan Ning","Ya!","Ya!",},
        [4672] = {8805,"Zhou Yu","Huang Gai","Salam, Zhou Lang.","Salam, Zhou Lang.",},
        [4673] = {8805,"Huang Gai","Zhou Yu","Datang semalam ini, pasti ada rencana bagus yang ingin dibicarakan?","Datang semalam ini, pasti ada rencana bagus yang ingin dibicarakan?",},
        [4674] = {8805,"Zhou Yu","Huang Gai","Kita kalah jumlah, tidak bisa perang berlarut-larut, mengapa kita tidak menggunakan api?","Kita kalah jumlah, tidak bisa perang berlarut-larut, mengapa kita tidak menggunakan api?",},
        [4675] = {8805,"Huang Gai","Zhou Yu","Siapa yang mengajarkanmu hal ini?","Siapa yang mengajarkanmu hal ini?",},
        [4676] = {8805,"Zhou Yu","Huang Gai","Aku sendiri yang memikirkan, tidak ada yang mengajariku.","Aku sendiri yang memikirkan, tidak ada yang mengajariku.",},
        [4677] = {8805,"Huang Gai","Zhou Yu","Aku memiliki ide yang sama, karena itu aku dengan sengaja menerima Cai Zhong dan Cai He meskipun mereka adalah mata-mata, demi menyampaikan informasi palsu. Tetapi tidak ada seorangpun yang bisa bersandiwara denganku.","Aku memiliki ide yang sama, karena itu aku dengan sengaja menerima Cai Zhong dan Cai He meskipun mereka adalah mata-mata, demi menyampaikan informasi palsu. Tetapi tidak ada seorangpun yang bisa bersandiwara denganku.",},
        [4678] = {8805,"Zhou Yu","Huang Gai","Aku bersedia.","Aku bersedia.",},
        [4679] = {8805,"Huang Gai","Zhou Yu","Kamu harus menderita, jika tidak mereka tidak akan percaya.","Kamu harus menderita, jika tidak mereka tidak akan percaya.",},
        [4680] = {8805,"Zhou Yu","Huang Gai","Aku banyak berhutang budi kepada keluarga Sun, bahkan harus matipun aku rela.","Aku banyak berhutang budi kepada keluarga Sun, bahkan harus matipun aku rela.",},
        [4681] = {8805,"Huang Gai","Zhou Yu","Jika kamu bersedia melakukan siasat melukai diri sendiri, maka Jiangdong akan sangat berterimakasih.","Jika kamu bersedia melakukan siasat melukai diri sendiri, maka Jiangdong akan sangat berterimakasih.",},
        [4682] = {8805,"Zhou Yu","Huang Gai","Matipun aku tidak akan menyesal.","Matipun aku tidak akan menyesal.",},
        [4683] = {8806,"","Zhou Yu","Sejuta pasukan Cao Cao, berbaris tiga ratus mil, tidak akan bisa dihancurkan dalam sehari. Ransum untuk tiga bulan dipercayakan kepada setiap kapten hari ini, bersiap untuk menahan musuh.","Sejuta pasukan Cao Cao, berbaris tiga ratus mil, tidak akan bisa dihancurkan dalam sehari. Ransum untuk tiga bulan dipercayakan kepada setiap kapten hari ini, bersiap untuk menahan musuh.",},
        [4684] = {8806,"Zhou Yu","Huang Gai","Jangankan tiga bulan, ransum untuk tiga puluh bulan pun juga tidak akan cukup! Jika kita menyerang, kita serang bulan ini juga!","Jangankan tiga bulan, ransum untuk tiga puluh bulan pun juga tidak akan cukup! Jika kita menyerang, kita serang bulan ini juga!",},
        [4685] = {8806,"Zhou Yu","Huang Gai","Jika kita gagal mengalahkan, kita ikuti rencana Zibu, kita menyerah ke utara!","Jika kita gagal mengalahkan, kita ikuti rencana Zibu, kita menyerah ke utara!",},
        [4686] = {8806,"Huang Gai","Zhou Yu","Tuanku menyuruhku untuk mengalahkan Cao Cao, aku akan membunuh siapapun yang berkata menyerah lagi. Beraninya kamu melemahkan pasukan di saat seperti ini, aku harus memenggalmu, kepalamu harus dipertontonkan di hadapan para pasukan!","Tuanku menyuruhku untuk mengalahkan Cao Cao, aku akan membunuh siapapun yang berkata menyerah lagi. Beraninya kamu melemahkan pasukan di saat seperti ini, aku harus memenggalmu, kepalamu harus dipertontonkan di hadapan para pasukan!",},
        [4687] = {8806,"Zhou Yu","Huang Gai","Sudah tiga generasi sejak aku mengikuti Jenderal Polu, kamu kira siapa dirimu?","Sudah tiga generasi sejak aku mengikuti Jenderal Polu, kamu kira siapa dirimu?",},
        [4688] = {8806,"Huang Gai","Zhou Yu","Bawa dia dan penggal!","Bawa dia dan penggal!",},
        [4689] = {8806,"Zhou Yu","Gan Ning","Gongfu adalah menteri lama Dongwu, tolong berikan pengampunan.","Gongfu adalah menteri lama Dongwu, tolong berikan pengampunan.",},
        [4690] = {8806,"Gan Ning","Zhou Yu","Beraninya kamu meminta pengampunanku untuknya! Ucapanku adalah hukum yang berlaku! Bawa Gan Ning keluar untuk dihukum.","Beraninya kamu meminta pengampunanku untuknya! Ucapanku adalah hukum yang berlaku! Bawa Gan Ning keluar untuk dihukum.",},
        [4691] = {8806,"Zhou Yu","Lu Su","Huang Gai pantas dipenggal, tetapi ini tidak baik untuk moral pasukan. Ampuni dia sekarang, Tuan bisa memenggalnya nanti setelah mengalahkan Cao Cao.","Huang Gai pantas dipenggal, tetapi ini tidak baik untuk moral pasukan. Ampuni dia sekarang, Tuan bisa memenggalnya nanti setelah mengalahkan Cao Cao.",},
        [4692] = {8806,"Lu Su","Zhou Yu","Jika bukan karenamu, dia sekarang sudah dipenggal! Dia tidak perlu mati sekarang! Pukul dia dengan seratus kali cambukan!","Jika bukan karenamu, dia sekarang sudah dipenggal! Dia tidak perlu mati sekarang! Pukul dia dengan seratus kali cambukan!",},
        [4693] = {8807,"Zhuge Liang","Lu Su","Hari ini Gongjin menghukum Gongfu dengan berat, kita tidak berani menghentikannya karena kita hanyalah bawahan. Tuan sebagai tamu, mengapa Tuan tidak berbuat apa-apa dan hanya menonton?","Hari ini Gongjin menghukum Gongfu dengan berat, kita tidak berani menghentikannya karena kita hanyalah bawahan. Tuan sebagai tamu, mengapa Tuan tidak berbuat apa-apa dan hanya menonton?",},
        [4694] = {8807,"Lu Su","Zhuge Liang","Kamu berbohong padaku.","Kamu berbohong padaku.",},
        [4695] = {8807,"Zhuge Liang","Lu Su","Sejak aku menyeberangi sungai bersama Tuan, aku selalu berkata jujur. Mengapa Tuan bilang aku berbohong?","Sejak aku menyeberangi sungai bersama Tuan, aku selalu berkata jujur. Mengapa Tuan bilang aku berbohong?",},
        [4696] = {8807,"Lu Su","Zhuge Liang","Tidakkah kamu tahu bahwa Gongjin mencambuk Huang Gongfu sebagai bagian dari rencana? Mengapa kamu ingin aku menghentikannya?","Tidakkah kamu tahu bahwa Gongjin mencambuk Huang Gongfu sebagai bagian dari rencana? Mengapa kamu ingin aku menghentikannya?",},
        [4697] = {8807,"Zhuge Liang","Lu Su","Aku sungguh tidak tahu jika Tuan tidak bilang!","Aku sungguh tidak tahu jika Tuan tidak bilang!",},
        [4698] = {8807,"Lu Su","Zhuge Liang","Jika tidak menggunakan siasat melukai diri sendiri, bagaimana bisa meyakinkan Cao Cao? Huang Gongfu menipu para mata-mata, sehingga Cai Zhong dan Cai He memberikan laporan yang salah.","Jika tidak menggunakan siasat melukai diri sendiri, bagaimana bisa meyakinkan Cao Cao? Huang Gongfu menipu para mata-mata, sehingga Cai Zhong dan Cai He memberikan laporan yang salah.",},
        [4699] = {8808,"Huang Gai","Kan Ze","Apakah jenderal dendam terhadap jenderal besar?","Apakah jenderal dendam terhadap jenderal besar?",},
        [4700] = {8808,"Kan Ze","Huang Gai","Tidak ada.","Tidak ada.",},
        [4701] = {8808,"Huang Gai","Kan Ze","Jadi apakah ini siasat melukai diri sendiri atas kemauanmu?","Jadi apakah ini siasat melukai diri sendiri atas kemauanmu?",},
        [4702] = {8808,"Kan Ze","Huang Gai","Bagaimana kamu tahu?","Bagaimana kamu tahu?",},
        [4703] = {8808,"Huang Gai","Kan Ze","Aku menilainya dari tindakan Gongjin.","Aku menilainya dari tindakan Gongjin.",},
        [4704] = {8808,"Kan Ze","Huang Gai","Aku sudah menerima banyak kebaikan dari tiga generasi Wu, ini untuk membalas budi, sehingga melakukan ini untuk mengalahkan Cao Cao. Meskipun aku kesakitan, aku tidak dendam.","Aku sudah menerima banyak kebaikan dari tiga generasi Wu, ini untuk membalas budi, sehingga melakukan ini untuk mengalahkan Cao Cao. Meskipun aku kesakitan, aku tidak dendam.",},
        [4705] = {8808,"Kan Ze","Huang Gai","Aku tidak mempercayai siapapun di pasukan selain dirimu. Aku merasa dirimu adalah orang yang loyal, jadi jujurlah kepadaku.","Aku tidak mempercayai siapapun di pasukan selain dirimu. Aku merasa dirimu adalah orang yang loyal, jadi jujurlah kepadaku.",},
        [4706] = {8808,"Huang Gai","Kan Ze","Kamu memberitahuku hal ini karena kamu ingin aku memberikan surat menyerah.","Kamu memberitahuku hal ini karena kamu ingin aku memberikan surat menyerah.",},
        [4707] = {8808,"Kan Ze","Huang Gai","Iya, bisakah kamu melakukannya untukku.","Iya, bisakah kamu melakukannya untukku.",},
        [4708] = {8808,"Huang Gai","Kan Ze","Berhubung kamu mendedikasikan tubuhmu demi Tuan kita, bagaimana bisa aku takut mati?","Berhubung kamu mendedikasikan tubuhmu demi Tuan kita, bagaimana bisa aku takut mati?",},
        [4709] = {8808,"Kan Ze","Huang Gai","Sungguh berterima kasih atas bantuanmu.","Sungguh berterima kasih atas bantuanmu.",},
        [4710] = {8808,"Huang Gai","Kan Ze","Tidak perlu ditunda lagi, kita lakukan hari ini juga.","Tidak perlu ditunda lagi, kita lakukan hari ini juga.",},
        [4711] = {8808,"Kan Ze","Huang Gai","Suratnya sudah selesai.","Suratnya sudah selesai.",},
        [4712] = {8808,"Huang Gai","Kan Ze","Aku menyamar sebagai nelayan lalu pergi ke utara dengan kapal kecil sekarang juga.","Aku menyamar sebagai nelayan lalu pergi ke utara dengan kapal kecil sekarang juga.",},
        [4713] = {8809,"Kan Ze","Cao Cao","Kamu adalah penasihat Wu, mengapa kamu kemari?","Kamu adalah penasihat Wu, mengapa kamu kemari?",},
        [4714] = {8809,"Cao Cao","Kan Ze","Huang Gongfu mengabdi kepada Wu sudah tiga generasi, hari ini dia di depan para jenderal, dihukum cambuk oleh Zhou Yu, dipermalukan tanpa alasan yang jelas. Dia ingin membelot dan mengabdi padamu, karena itu dia menyuruhku mengantarkan surat ini kepada perdana menteri. Apakah perdana menteri bersedia menerimanya?","Huang Gongfu mengabdi kepada Wu sudah tiga generasi, hari ini dia di depan para jenderal, dihukum cambuk oleh Zhou Yu, dipermalukan tanpa alasan yang jelas. Dia ingin membelot dan mengabdi padamu, karena itu dia menyuruhku mengantarkan surat ini kepada perdana menteri. Apakah perdana menteri bersedia menerimanya?",},
        [4715] = {8809,"Kan Ze","Cao Cao","Huang Gai memainkan siasat melukai diri sendiri, dan menyuruhmu kemari untuk menyerahkan surat berpura-pura menyerah, beraninya kamu menipuku dengan trik lama seperti ini! Penggal dia di luar.","Huang Gai memainkan siasat melukai diri sendiri, dan menyuruhmu kemari untuk menyerahkan surat berpura-pura menyerah, beraninya kamu menipuku dengan trik lama seperti ini! Penggal dia di luar.",},
        [4716] = {8809,"Cao Cao","Kan Ze","Hahahahaha.","Hahahahaha.",},
        [4717] = {8809,"Kan Ze","Cao Cao","Aku sudah mengetahui rencanamu, mengapa kamu tertawa?","Aku sudah mengetahui rencanamu, mengapa kamu tertawa?",},
        [4718] = {8809,"Cao Cao","Kan Ze","Aku tidak menertawakanmu, aku menertawakan Huang Gongfu yang tidak bisa menilai orang.","Aku tidak menertawakanmu, aku menertawakan Huang Gongfu yang tidak bisa menilai orang.",},
        [4719] = {8809,"Kan Ze","Cao Cao","Sejak kecil aku belajar taktik militer, aku mengetahui segala trik kotor semacam ini. Siasat semacam ini, hanya bisa menipu orang lain, tapi tidak denganku!","Sejak kecil aku belajar taktik militer, aku mengetahui segala trik kotor semacam ini. Siasat semacam ini, hanya bisa menipu orang lain, tapi tidak denganku!",},
        [4720] = {8809,"Cao Cao","Kan Ze","Beraninya kamu menyamakan ketidaktahuanmu dengan sok tahumu tentang buku taktik militer! Lebih baik kamu menarik pasukanmu mundur sebelum Zhou Yu menangkapmu dalam perang! Sungguh memalukan aku harus mati di tangan orang tak berpendidikan sepertimu!","Beraninya kamu menyamakan ketidaktahuanmu dengan sok tahumu tentang buku taktik militer! Lebih baik kamu menarik pasukanmu mundur sebelum Zhou Yu menangkapmu dalam perang! Sungguh memalukan aku harus mati di tangan orang tak berpendidikan sepertimu!",},
        [4721] = {8809,"Kan Ze","Cao Cao","Mengapa kamu bilang kalau aku tidak berpendidikan?","Mengapa kamu bilang kalau aku tidak berpendidikan?",},
        [4722] = {8809,"Cao Cao","Kan Ze","Tidak pernahkah kamu mendengar, jika kamu hendak mencuri dari tuanmu, maka kamu tidak akan bisa menentukan waktunya? Jika waktunya sudah ditentukan, kegelisahan malah tidak akan bisa mendapatkannya, kemari berkoordinasi dengan orang lain, semuanya malah akan langsung ketahuan.","Tidak pernahkah kamu mendengar, jika kamu hendak mencuri dari tuanmu, maka kamu tidak akan bisa menentukan waktunya? Jika waktunya sudah ditentukan, kegelisahan malah tidak akan bisa mendapatkannya, kemari berkoordinasi dengan orang lain, semuanya malah akan langsung ketahuan.",},
        [4723] = {8809,"Cao Cao","Kan Ze","Cara yang tepat adalah mengambil kesempatan dibandingkan menentukan waktunya lebih dulu. Kamu tidak memahami hal ini, sehingga kamu ingin membunuh orang baik. Itulah kenapa kamu tidak berpendidikan!","Cara yang tepat adalah mengambil kesempatan dibandingkan menentukan waktunya lebih dulu. Kamu tidak memahami hal ini, sehingga kamu ingin membunuh orang baik. Itulah kenapa kamu tidak berpendidikan!",},
        [4724] = {8809,"Kan Ze","Cao Cao","Sungguh aku tidak paham, maaf aku telah membuatmu tersinggung.","Sungguh aku tidak paham, maaf aku telah membuatmu tersinggung.",},
        [4725] = {8809,"Cao Cao","Kan Ze","Huang Gongfu dan diriku sepenuh hati ingin menyerah, seperti anak menghadap ke orang tuanya, bagaimana bisa dianggap sebagai trik!","Huang Gongfu dan diriku sepenuh hati ingin menyerah, seperti anak menghadap ke orang tuanya, bagaimana bisa dianggap sebagai trik!",},
        [4726] = {8809,"Kan Ze","Cao Cao","Jika kalian berdua bisa membuat kontribusi besar, aku akan memberikan imbalan.","Jika kalian berdua bisa membuat kontribusi besar, aku akan memberikan imbalan.",},
        [4727] = {8809,"Cao Cao","Kan Ze","Kami tidak mengabdi demi kekayaan ataupun jabatan, kami hanya mengikuti waktu yang tepat.","Kami tidak mengabdi demi kekayaan ataupun jabatan, kami hanya mengikuti waktu yang tepat.",},
        [4728] = {8810,"Gan Ning","Kan Ze","Aku rasa sangat tidak adil jenderal dipermalukan oleh Gongjin karena ingin menyelamatkan Huang Gongfu. ","Aku rasa sangat tidak adil jenderal dipermalukan oleh Gongjin karena ingin menyelamatkan Huang Gongfu. ",},
        [4729] = {8810,"Kan Ze","Gan Ning","Zhou Gongjin adalah pria yang arogan, dia sama sekali tidak peduli dengan kita. Aku hari ini dipermalukan, bahkan aku malu untuk menemui bawahanku!","Zhou Gongjin adalah pria yang arogan, dia sama sekali tidak peduli dengan kita. Aku hari ini dipermalukan, bahkan aku malu untuk menemui bawahanku!",},
        [4730] = {8810,"Gan Ning","Cai He","Mengapa jenderal terlihat gelisah? Apa ada yang mengganggu pikiran Tuan?","Mengapa jenderal terlihat gelisah? Apa ada yang mengganggu pikiran Tuan?",},
        [4731] = {8810,"Cai He","Gan Ning","Bagaimana bisa kamu berempati denganku!","Bagaimana bisa kamu berempati denganku!",},
        [4732] = {8810,"Gan Ning","Cai He","Apakah kamu ingin mengkhianati Wu dan berpaling kepada Cao?","Apakah kamu ingin mengkhianati Wu dan berpaling kepada Cao?",},
        [4733] = {8810,"Cai He","Gan Ning","Berhubung kamu sudah melihatnya, aku harus membunuhmu untuk menutup mulut!","Berhubung kamu sudah melihatnya, aku harus membunuhmu untuk menutup mulut!",},
        [4734] = {8810,"Gan Ning","Cai He","Tenanglah Tuan, aku bisa memahamimu.","Tenanglah Tuan, aku bisa memahamimu.",},
        [4735] = {8810,"Cai He","Gan Ning","Cepat bilang apa yang ingin kamu bilang!","Cepat bilang apa yang ingin kamu bilang!",},
        [4736] = {8810,"Gan Ning","Cai He","Kami berdua berpura-pura menyerah. Kami adalah mata-mata Cao Cao. Jika Tuan ingin mengabdi kepada Cao Cao, kami bisa memperkenalkan.","Kami berdua berpura-pura menyerah. Kami adalah mata-mata Cao Cao. Jika Tuan ingin mengabdi kepada Cao Cao, kami bisa memperkenalkan.",},
        [4737] = {8810,"Cai He","Gan Ning","Sungguh?","Sungguh?",},
        [4738] = {8810,"Gan Ning","Cai He","Sungguh","Sungguh",},
        [4739] = {8810,"Cai He","Gan Ning","Jika benar, ini peluang emas!","Jika benar, ini peluang emas!",},
        [4740] = {8810,"Gan Ning","Cai He","Aku sudah mengirim surat kepada perdana menteri tentang apa yang dialami Huang Gongu dan juga jenderal Gan Ning.","Aku sudah mengirim surat kepada perdana menteri tentang apa yang dialami Huang Gongu dan juga jenderal Gan Ning.",},
        [4741] = {8810,"Cai He","Kan Ze","Aku sudah menyerahkan surat kepada perdana menteri, aku hari ini kemari untuk menemui Xingba, mengajaknya menyerah bersama.","Aku sudah menyerahkan surat kepada perdana menteri, aku hari ini kemari untuk menemui Xingba, mengajaknya menyerah bersama.",},
        [4742] = {8810,"Cai He","Gan Ning","Seorang pria harus mengabdi kepada Tuan yang benar.","Seorang pria harus mengabdi kepada Tuan yang benar.",},
        [4743] = {8811,"","Cao Cao","Gan Ning bersedia mengikuti kita setelah dipermalukan oleh Zhou Yu. Huang Gai mengirim Kan Ze kemari untuk menyampaikan surat menyerah setelah menerima hukuman, tetapi aku tetap tidak yakin.","Gan Ning bersedia mengikuti kita setelah dipermalukan oleh Zhou Yu. Huang Gai mengirim Kan Ze kemari untuk menyampaikan surat menyerah setelah menerima hukuman, tetapi aku tetap tidak yakin.",},
        [4744] = {8811,"","Cao Cao","Siapa berani memasuki barak Zhou Yu untuk mencari informasi?","Siapa berani memasuki barak Zhou Yu untuk mencari informasi?",},
        [4745] = {8811,"Cao Cao","Jiang Gan","Aku masih merasa tidak enak hati atas kegagalanku terakhir kali ke Wu. Aku bersedia pergi ke sana untuk mencari informasi dan melaporkannya kepada perdana menteri.","Aku masih merasa tidak enak hati atas kegagalanku terakhir kali ke Wu. Aku bersedia pergi ke sana untuk mencari informasi dan melaporkannya kepada perdana menteri.",},
        [4746] = {8812,"Jiang Gan","Zhou Yu","Mengapa kamu berbohong kepadaku Ziyi?","Mengapa kamu berbohong kepadaku Ziyi?",},
        [4747] = {8812,"Zhou Yu","Jiang Gan","Aku kemari sebagai teman lama, mengapa kamu bilang aku membohongimu?","Aku kemari sebagai teman lama, mengapa kamu bilang aku membohongimu?",},
        [4748] = {8812,"Jiang Gan","Zhou Yu","Aku sudah bilang aku tidak akan menyerah! Tetapi demi mengenang masa lalu, aku mengajakmu minum dan bermalam di sini.","Aku sudah bilang aku tidak akan menyerah! Tetapi demi mengenang masa lalu, aku mengajakmu minum dan bermalam di sini.",},
        [4749] = {8812,"Jiang Gan","Zhou Yu","Kamu malah membaca surat pribadiku, pergi tanpa pamit, dan melaporkannya ke Cao Cao, membuat Cai Mao dan Zhang Yun terbunuh, rencanaku pun gagal. Kini kamu datang lagi dengan maksud jahat!","Kamu malah membaca surat pribadiku, pergi tanpa pamit, dan melaporkannya ke Cao Cao, membuat Cai Mao dan Zhang Yun terbunuh, rencanaku pun gagal. Kini kamu datang lagi dengan maksud jahat!",},
        [4750] = {8812,"Jiang Gan","Zhou Yu","Aku memutuskan untuk memutus hubungan denganmu! Aku ingin mengirimmu kembali, tetapi aku akan menyerang Cao Cao dalam dua atau tiga hari. Tetapi aku membiarkanmu tetap di pasukanku juga sangat berbahaya, pasti kamu akan membocorkan rahasia.","Aku memutuskan untuk memutus hubungan denganmu! Aku ingin mengirimmu kembali, tetapi aku akan menyerang Cao Cao dalam dua atau tiga hari. Tetapi aku membiarkanmu tetap di pasukanku juga sangat berbahaya, pasti kamu akan membocorkan rahasia.",},
        [4751] = {8812,"Jiang Gan","Zhou Yu","Kirim Ziyi ke kuil di barat untuk beristirahat. Tunggu aku menghancurkan Cao Cao, saat itu kamu bisa menyeberangi sungai.","Kirim Ziyi ke kuil di barat untuk beristirahat. Tunggu aku menghancurkan Cao Cao, saat itu kamu bisa menyeberangi sungai.",},
        [4752] = {8812,"Zhou Yu","Jiang Gan","Ini…","Ini…",},
        [4753] = {8813,"Lu Su","Zhou Yu","Apakah Pang Shiyuan sudah menunggu di barat gunung saat ini?","Apakah Pang Shiyuan sudah menunggu di barat gunung saat ini?",},
        [4754] = {8813,"Zhou Yu","Lu Su","Iya.","Iya.",},
        [4755] = {8813,"Lu Su","Zhou Yu","Bagus. Tinggal menunggu Jiang Gan terjebak dalam rencana kita.","Bagus. Tinggal menunggu Jiang Gan terjebak dalam rencana kita.",},
        [4756] = {8813,"Zhou Yu","Protagonis","Pang Shiyuan akan memasuki kamp Cao, demi keamanannya, aku bersedia berpura-pura menjadi pengikutnya.","Pang Shiyuan akan memasuki kamp Cao, demi keamanannya, aku bersedia berpura-pura menjadi pengikutnya.",},
        [4757] = {8813,"Protagonis","Zhou Yu","Terimakasih, Jenderal Yangwei","Terimakasih, Jenderal Yangwei",},
        [4758] = {8901,"Pang Tong","Jiang Gan","Siapa kamu, mengapa kamu di sini mengamati bintang?","Siapa kamu, mengapa kamu di sini mengamati bintang?",},
        [4759] = {8901,"Jiang Gan","Pang Tong","Namaku Pang Tong, nama lain Shiyuan.","Namaku Pang Tong, nama lain Shiyuan.",},
        [4760] = {8901,"Pang Tong","Jiang Gan","Apakah kamu Tuan Phoenix?","Apakah kamu Tuan Phoenix?",},
        [4761] = {8901,"Jiang Gan","Pang Tong","Betul.","Betul.",},
        [4762] = {8901,"Pang Tong","Jiang Gan","Aku mendengar nama besarmu. Mengapa kamu ada di tempat seperti ini?","Aku mendengar nama besarmu. Mengapa kamu ada di tempat seperti ini?",},
        [4763] = {8901,"Jiang Gan","Pang Tong","Pria arogan Zhou Yu merasa dirinya pintar, tidak menganggapku, sehingga aku mengasingkan diri di sini. Siapa Tuan?","Pria arogan Zhou Yu merasa dirinya pintar, tidak menganggapku, sehingga aku mengasingkan diri di sini. Siapa Tuan?",},
        [4764] = {8901,"Pang Tong","Jiang Gan","Aku Jiang Gan. Tuan adalah orang yang sangat bertalenta, mengapa tidak dipergunakan dengan baik? Jika bersedia mengikuti Cao Cao, pasti aku akan merekomendasikanmu.","Aku Jiang Gan. Tuan adalah orang yang sangat bertalenta, mengapa tidak dipergunakan dengan baik? Jika bersedia mengikuti Cao Cao, pasti aku akan merekomendasikanmu.",},
        [4765] = {8901,"Jiang Gan","Pang Tong","Sudah lama aku ingin meninggalkan Jiangdong. Berhubung kamu bersedia merekomendasikanku, aku akan ikut denganmu. Jika terlambat, Zhou Yu akan mengetahui lalu membunuhku.","Sudah lama aku ingin meninggalkan Jiangdong. Berhubung kamu bersedia merekomendasikanku, aku akan ikut denganmu. Jika terlambat, Zhou Yu akan mengetahui lalu membunuhku.",},
        [4766] = {8901,"Pang Tong","Jiang Gan","Kamu ikut aku turun gunung sekarang, mencari perahu, lalu pergi ke utara.","Kamu ikut aku turun gunung sekarang, mencari perahu, lalu pergi ke utara.",},
        [4767] = {8902,"Pang Tong","Cao Cao","Zhou Yu masih muda, dia memandang rendah sekitarnya, tidak memandang penasihat. Suatu kehormatan bisa bertemu denganmu saat ini, Cao Cao sudah lama mendengar nama besarmu. Tolong berikan pencerahan buatku.","Zhou Yu masih muda, dia memandang rendah sekitarnya, tidak memandang penasihat. Suatu kehormatan bisa bertemu denganmu saat ini, Cao Cao sudah lama mendengar nama besarmu. Tolong berikan pencerahan buatku.",},
        [4768] = {8902,"Cao Cao","Pang Tong","Perdana menteri, aku selalu mengagumi taktik militermu, hari ini aku bisa menyaksikan langsung kehebatan pasukanmu. Di samping gunung di sebelah hutan, di depan dan belakang juga kokoh, bahkan Sun Tzu, Wu Qi, ataupun Rangju hidup kembali sekalipun, tidak akan bisa melebihimu.","Perdana menteri, aku selalu mengagumi taktik militermu, hari ini aku bisa menyaksikan langsung kehebatan pasukanmu. Di samping gunung di sebelah hutan, di depan dan belakang juga kokoh, bahkan Sun Tzu, Wu Qi, ataupun Rangju hidup kembali sekalipun, tidak akan bisa melebihimu.",},
        [4769] = {8902,"Pang Tong","Cao Cao","Tuan terlalu berlebihan menilaiku.","Tuan terlalu berlebihan menilaiku.",},
        [4770] = {8902,"Cao Cao","Pang Tong","Apakah Tuan memiliki tabib di pasukanmu?","Apakah Tuan memiliki tabib di pasukanmu?",},
        [4771] = {8902,"Pang Tong","Cao Cao","Untuk apa menanyakan ini?","Untuk apa menanyakan ini?",},
        [4772] = {8902,"Cao Cao","Pang Tong","Banyak wabah di angkatan laut, karena itulah memerlukan tabib hebat.","Banyak wabah di angkatan laut, karena itulah memerlukan tabib hebat.",},
        [4773] = {8902,"Pang Tong","Cao Cao","Pasukanku tidak terbiasa dengan medan di sini, banyak yang muntah, banyak yang sekarat. Aku mengkhawatirkan hal ini.","Pasukanku tidak terbiasa dengan medan di sini, banyak yang muntah, banyak yang sekarat. Aku mengkhawatirkan hal ini.",},
        [4774] = {8902,"Cao Cao","Pang Tong","Angkatan laut perdana menteri bagus tetapi tidak cukup sempurna. Aku memiliki rencana, yang bisa membuat pasukan terbebas dari penyakit, pasti berhasil.","Angkatan laut perdana menteri bagus tetapi tidak cukup sempurna. Aku memiliki rencana, yang bisa membuat pasukan terbebas dari penyakit, pasti berhasil.",},
        [4775] = {8902,"Pang Tong","Cao Cao","Rencana apa itu?","Rencana apa itu?",},
        [4776] = {8902,"Cao Cao","Pang Tong","Ombak dan angin sangat kencang, orang utara tidak terbiasa dengan kapal, goncangannya membuat mereka sakit.","Ombak dan angin sangat kencang, orang utara tidak terbiasa dengan kapal, goncangannya membuat mereka sakit.",},
        [4777] = {8902,"Cao Cao","Pang Tong","Tautkan kapal besar dan kecil, satu baris tiga puluh atau lima puluh kapal, sambungkan ekornya menggunakan rantai, dan tautkan dengan dermaga.","Tautkan kapal besar dan kecil, satu baris tiga puluh atau lima puluh kapal, sambungkan ekornya menggunakan rantai, dan tautkan dengan dermaga.",},
        [4778] = {8902,"Cao Cao","Pang Tong","Tidak hanya manusia, kuda pun bisa melaluinya. Dengan begini, ombak besarpun tidak akan mempengaruhimu berlayar. ","Tidak hanya manusia, kuda pun bisa melaluinya. Dengan begini, ombak besarpun tidak akan mempengaruhimu berlayar. ",},
        [4779] = {8902,"Pang Tong","Cao Cao","Aku tidak akan bisa mengalahkan Wu jika kamu tidak memberikan nasihat ini!","Aku tidak akan bisa mengalahkan Wu jika kamu tidak memberikan nasihat ini!",},
        [4780] = {8902,"Cao Cao","Pang Tong","Ini hanyalah sebuah pemikiran dangkal dariku, perdana menteri yang memutuskan.","Ini hanyalah sebuah pemikiran dangkal dariku, perdana menteri yang memutuskan.",},
        [4781] = {8902,"Pang Tong","Cao Cao","Suruh para pandai besi untuk segera menautkan kapal menggunakan rantai.","Suruh para pandai besi untuk segera menautkan kapal menggunakan rantai.",},
        [4782] = {8903,"Pang Tong","Xu Shu","Kamu sungguh berani! Huang Gai dengan siasat melukai diri sendiri, Kan Ze dengan surat menyerah palsu, kini kamu mengajukan siasat berantai, hanya tinggal menunggu waktu api membakar mereka! ","Kamu sungguh berani! Huang Gai dengan siasat melukai diri sendiri, Kan Ze dengan surat menyerah palsu, kini kamu mengajukan siasat berantai, hanya tinggal menunggu waktu api membakar mereka! ",},
        [4783] = {8903,"Pang Tong","Xu Shu","Semua trik ini bisa menipu semua orang bahkan Cao Cao sekalipun, tapi tidak denganku!","Semua trik ini bisa menipu semua orang bahkan Cao Cao sekalipun, tapi tidak denganku!",},
        [4784] = {8903,"Xu Shu","Pang Tong","Jika kamu menggagalkan rencanaku, bisa mengakibatkan kematian penduduk 81 wilayah di Jiangnan!","Jika kamu menggagalkan rencanaku, bisa mengakibatkan kematian penduduk 81 wilayah di Jiangnan!",},
        [4785] = {8903,"Pang Tong","Xu Shu","Bagaimana dengan nyawa delapan ratus tiga puluh ribu pasukan?","Bagaimana dengan nyawa delapan ratus tiga puluh ribu pasukan?",},
        [4786] = {8903,"Xu Shu","Protagonis","Zhiyuan apakah hendak menggagalkan rencana ini?","Zhiyuan apakah hendak menggagalkan rencana ini?",},
        [4787] = {8903,"Protagonis","Xu Shu","Aku tidak pernah punya kesempatan untuk membalas kebaikan Paman Imperial Liu. Cao Cao membunuh ibuku, aku bersumpah tidak akan pernah menyediakan rencana bagi Cao Cao, bagaimana mungkin aku menggagalkan rencana kalian.","Aku tidak pernah punya kesempatan untuk membalas kebaikan Paman Imperial Liu. Cao Cao membunuh ibuku, aku bersumpah tidak akan pernah menyediakan rencana bagi Cao Cao, bagaimana mungkin aku menggagalkan rencana kalian.",},
        [4788] = {8903,"Protagonis","Xu Shu","Aku hanya mengikuti pasukan ini, setelah pasukan kalah, aku akan dalam masalah. Jika kamu menawarkanku jalan keluar, aku akan menutup mulutku dan tidak ikut campur.","Aku hanya mengikuti pasukan ini, setelah pasukan kalah, aku akan dalam masalah. Jika kamu menawarkanku jalan keluar, aku akan menutup mulutku dan tidak ikut campur.",},
        [4789] = {8903,"Xu Shu","Protagonis","Yuanzhi selalu bijaksana seperti ini. Ini bukanlah hal sulit.","Yuanzhi selalu bijaksana seperti ini. Ini bukanlah hal sulit.",},
        [4790] = {8903,"Protagonis","Xu Shu","Silahkan jenderal memerintahkanku.","Silahkan jenderal memerintahkanku.",},
        [4791] = {8903,"Xu Shu","Protagonis","Mendekatlah dan dengarkan.","Mendekatlah dan dengarkan.",},
        [4792] = {8903,"Protagonis","Xu Shu","Hahaha. Rencana bagus! Terimakasih Jenderal Yangwei!","Hahaha. Rencana bagus! Terimakasih Jenderal Yangwei!",},
        [4793] = {8904,"","Cao Cao","Rumornya Han Sui dan Ma Teng di Xiliang melakukan pemberontakan, dan kini menuju Xuchang. Meskipun belum yakin kebenarannya, kita harus bersiap.","Rumornya Han Sui dan Ma Teng di Xiliang melakukan pemberontakan, dan kini menuju Xuchang. Meskipun belum yakin kebenarannya, kita harus bersiap.",},
        [4794] = {8904,"Cao Cao","Xu Shu","Terimakasih perdana menteri sudah menerimaku, aku harus membalasmu dengan berkontribusi. Tolong berikan aku tiga ribu pasukan, malam ini juga aku menjaga benteng, jika ada hal darurat, aku akan langsung melaporkan.","Terimakasih perdana menteri sudah menerimaku, aku harus membalasmu dengan berkontribusi. Tolong berikan aku tiga ribu pasukan, malam ini juga aku menjaga benteng, jika ada hal darurat, aku akan langsung melaporkan.",},
        [4795] = {8904,"Xu Shu","Cao Cao","Jika Yuanzhi yang pergi, aku tidak khawatir! Kamu memiliki wewenang untuk memerintah semua pasukan di semua benteng sepanjang perjalananmu. Bawa tiga ribu pasukan, dan tunjuk Zang Ba sebagai pionir, pergi sebelum malam, tiba sesegera mungkin.","Jika Yuanzhi yang pergi, aku tidak khawatir! Kamu memiliki wewenang untuk memerintah semua pasukan di semua benteng sepanjang perjalananmu. Bawa tiga ribu pasukan, dan tunjuk Zang Ba sebagai pionir, pergi sebelum malam, tiba sesegera mungkin.",},
        [4796] = {8904,"Cao Cao","Xu Shu","Xu Shu dan Zang Ba berangkat sekarang.","Xu Shu dan Zang Ba berangkat sekarang.",},
        [4797] = {9001,"","Cao Cao","Zhou Yu, Lu Su, tidak memahami takdir! Aku beruntung memiliki mereka yang menyerah, takdir sedang membantuku.","Zhou Yu, Lu Su, tidak memahami takdir! Aku beruntung memiliki mereka yang menyerah, takdir sedang membantuku.",},
        [4798] = {9001,"Cao Cao","Xun You","Harap hati-hati dengan perkataan perdana menteri, takutnya akan bocor keluar.","Harap hati-hati dengan perkataan perdana menteri, takutnya akan bocor keluar.",},
        [4799] = {9001,"Xun You","Cao Cao","Semua yang di sekelilingku adalah orang yang loyal, kenapa aku harus hati-hati!","Semua yang di sekelilingku adalah orang yang loyal, kenapa aku harus hati-hati!",},
        [4800] = {9001,"Xun You","Cao Cao","Liu Bei dan Zhuge Liang berusaha melawanku dengan kekuatan mereka yang seperti semut! Sungguh bodoh!","Liu Bei dan Zhuge Liang berusaha melawanku dengan kekuatan mereka yang seperti semut! Sungguh bodoh!",},
        [4801] = {9002,"","Cao Cao","Aku mendengar suara gagak terbang ke selatan, pertanda apa ini?","Aku mendengar suara gagak terbang ke selatan, pertanda apa ini?",},
        [4802] = {9002,"Cao Cao","Cheng Yu","Mereka melihat cahaya bulan dan mengira sebagai matahari, sehingga mereka terbang ke sana.","Mereka melihat cahaya bulan dan mengira sebagai matahari, sehingga mereka terbang ke sana.",},
        [4803] = {9002,"Cheng Yu","Cao Cao","Dengan senjata ini, aku menghancurkan Turban Kuning, menangkap Lu Bu, membasmi Yuan Shu, mengalahkan Yuan Shao, memasuki benteng utara, menghajar Liaodong, menaklukkan segala arah.","Dengan senjata ini, aku menghancurkan Turban Kuning, menangkap Lu Bu, membasmi Yuan Shu, mengalahkan Yuan Shao, memasuki benteng utara, menghajar Liaodong, menaklukkan segala arah.",},
        [4804] = {9002,"Cheng Yu","Cao Cao","Pemandangan ini sangat membuatku tersentuh, aku ingin membuat lagu, tolong iringi.","Pemandangan ini sangat membuatku tersentuh, aku ingin membuat lagu, tolong iringi.",},
        [4805] = {9002,"Cheng Yu","Cao Cao","Arak dan lagu, hidup terus berjalan, untuk berapa lama lagi, menguap seperti embun pagi, hari demi hari.","Arak dan lagu, hidup terus berjalan, untuk berapa lama lagi, menguap seperti embun pagi, hari demi hari.",},
        [4806] = {9002,"Cheng Yu","Cao Cao","Ambisi dan aspirasi menopangku, tetapi kesedihan membuatku khawatir. Bagaimana aku menyingkirkannya, tentu saja dengan arak.","Ambisi dan aspirasi menopangku, tetapi kesedihan membuatku khawatir. Bagaimana aku menyingkirkannya, tentu saja dengan arak.",},
        [4807] = {9002,"Cheng Yu","Cao Cao","Cendekiawan di manakah kalian? Aku memanggil sekian lama, tapi kalian tidak pernah datang padaku.","Cendekiawan di manakah kalian? Aku memanggil sekian lama, tapi kalian tidak pernah datang padaku.",},
        [4808] = {9003,"","Cao Cao","Jika bukan takdir membantuku, bagaimana aku bisa mendapatkan Phoenix menjadi penasihatku? Menautkan kapal bagaikan kavaleri di atas air, kita akan meratakan musuh.","Jika bukan takdir membantuku, bagaimana aku bisa mendapatkan Phoenix menjadi penasihatku? Menautkan kapal bagaikan kavaleri di atas air, kita akan meratakan musuh.",},
        [4809] = {9003,"Cao Cao","Cheng Yu","Kapal ditautkan dengan rantai dan kini menjadi stabil, tetapi jika kita diserang dengan api, kita tidak bisa menghindar. Kita harus waspada.","Kapal ditautkan dengan rantai dan kini menjadi stabil, tetapi jika kita diserang dengan api, kita tidak bisa menghindar. Kita harus waspada.",},
        [4810] = {9003,"Cheng Yu","Cao Cao","Kamu memiliki pandangan jauh, tetapi masih ada hal-hal yang tidak bisa kamu lihat.","Kamu memiliki pandangan jauh, tetapi masih ada hal-hal yang tidak bisa kamu lihat.",},
        [4811] = {9003,"Cao Cao","Xun You","Zhongde benar. Mengapa Anda tertawa perdana menteri?","Zhongde benar. Mengapa Anda tertawa perdana menteri?",},
        [4812] = {9003,"Xun You","Cao Cao","Jika menggunakan api, harus ada bantuan angin. Sedangkan saat ni musim dingin, hanya ada angin dari barat dan utara, coba beritahu aku, darimana mereka bisa mendapatkan angin timur dan selatan?","Jika menggunakan api, harus ada bantuan angin. Sedangkan saat ni musim dingin, hanya ada angin dari barat dan utara, coba beritahu aku, darimana mereka bisa mendapatkan angin timur dan selatan?",},
        [4813] = {9003,"Xun You","Cao Cao","Kita dari barat laut, mereka ada di selatan. Jika mereka menggunakan api, mereka hanya akan membakar dirinya sendiri. Kenapa aku harus takut? Jika ini bulan Oktobe, aku akan bersiap lebih dulu.","Kita dari barat laut, mereka ada di selatan. Jika mereka menggunakan api, mereka hanya akan membakar dirinya sendiri. Kenapa aku harus takut? Jika ini bulan Oktobe, aku akan bersiap lebih dulu.",},
        [4814] = {9003,"Cao Cao","Cheng Yu","Perdana menteri sungguh jenius, melebihi kami semua.","Perdana menteri sungguh jenius, melebihi kami semua.",},
        [4815] = {9004,"Pang Tong","Protagonis","Shiyuan, siasat sudah disiapkan. Cao Cao akan menyerang besok, kita cepat pergi dari sini..","Shiyuan, siasat sudah disiapkan. Cao Cao akan menyerang besok, kita cepat pergi dari sini..",},
        [4816] = {9004,"Protagonis","Pang Tong","Baiklah, kita cari kapal malam ini untuk pergi.","Baiklah, kita cari kapal malam ini untuk pergi.",},
        [4817] = {9101,"Lu Su","Zhou Yu","Angin bertiup kencang, tiang bendera patah, hanyut dalam sungai. Ini pertanda buruk!","Angin bertiup kencang, tiang bendera patah, hanyut dalam sungai. Ini pertanda buruk!",},
        [4818] = {9101,"Lu Su","Zhou Yu","Bagaimana cara kita melaksanakan siasat api! Rencana kita berantakan.","Bagaimana cara kita melaksanakan siasat api! Rencana kita berantakan.",},
        [4819] = {9101,"Zhou Yu","Lu Su","Ini…","Ini…",},
        [4820] = {9101,"Lu Su","Zhou Yu","Aaaargh!","Aaaargh!",},
        [4821] = {9101,"Zhou Yu","Lu Su","Cepat panggil orang, jenderal muntah darah, cepat panggil tabib.","Cepat panggil orang, jenderal muntah darah, cepat panggil tabib.",},
        [4822] = {9102,"Zhuge Liang","Lu Su","Angin bertiup kencang, tidak bisa melaksanakan siasat api, Zhou Lang juga sedang sakit.","Angin bertiup kencang, tidak bisa melaksanakan siasat api, Zhou Lang juga sedang sakit.",},
        [4823] = {9102,"Lu Su","Zhuge Liang","Menurutmu pertanda apakah itu?","Menurutmu pertanda apakah itu?",},
        [4824] = {9102,"Zhuge Liang","Lu Su","Ini keberuntungan bagi Cao, dan bencana bagi Jiangdong.","Ini keberuntungan bagi Cao, dan bencana bagi Jiangdong.",},
        [4825] = {9102,"Lu Su","Zhuge Liang","Gongjin sakit, keajaiban Liang akan menyembuhkannya.","Gongjin sakit, keajaiban Liang akan menyembuhkannya.",},
        [4826] = {9102,"Zhuge Liang","Lu Su","Jika benar begitu, maka akan bagus sekali! Cepat pergi bersamaku!","Jika benar begitu, maka akan bagus sekali! Cepat pergi bersamaku!",},
        [4827] = {9103,"Zhou Yu","Lu Su","Bagaimana kondisi jenderal?","Bagaimana kondisi jenderal?",},
        [4828] = {9103,"Lu Su","Zhou Yu","Dada dan perutku sakit, sedikit pusing.","Dada dan perutku sakit, sedikit pusing.",},
        [4829] = {9103,"Zhou Yu","Lu Su","Apakah sudah minum obat apapun?","Apakah sudah minum obat apapun?",},
        [4830] = {9103,"Lu Su","Zhou Yu","Tidak bisa minum obat.","Tidak bisa minum obat.",},
        [4831] = {9103,"Zhou Yu","Lu Su","Aku pergi ke Kongming, dia bilang bisa menyembuhkanmu. Dia sekarang di luar tenda, haruskah aku memanggilnya?","Aku pergi ke Kongming, dia bilang bisa menyembuhkanmu. Dia sekarang di luar tenda, haruskah aku memanggilnya?",},
        [4832] = {9103,"Lu Su","Zhou Yu","Iya.","Iya.",},
        [4833] = {9104,"Zhou Yu","Zhuge Liang","Kita tidak bertemu beberapa hari, sakitmu sudah parah seperti ini!","Kita tidak bertemu beberapa hari, sakitmu sudah parah seperti ini!",},
        [4834] = {9104,"Zhuge Liang","Zhou Yu","Takdir menginginkanku mati, aku bisa apa?","Takdir menginginkanku mati, aku bisa apa?",},
        [4835] = {9104,"Zhou Yu","Zhuge Liang","Takdir memiliki jalannya sendiri, siapa yang bisa memperkirakan? Apakah jenderal merasa sakit di dada?","Takdir memiliki jalannya sendiri, siapa yang bisa memperkirakan? Apakah jenderal merasa sakit di dada?",},
        [4836] = {9104,"Zhuge Liang","Zhou Yu","Iya.","Iya.",},
        [4837] = {9104,"Zhou Yu","Zhuge Liang","Aku punya cara untuk menenangkanmu.","Aku punya cara untuk menenangkanmu.",},
        [4838] = {9104,"Zhuge Liang","Zhou Yu","Tolong Tuan beritahu aku.","Tolong Tuan beritahu aku.",},
        [4839] = {9104,"Zhou Yu","Zhuge Liang","Siasatmu adalah membakar Cao Cao, tetapi kekuragan angin timur. Ini yang menyebabkanmu sakit.","Siasatmu adalah membakar Cao Cao, tetapi kekuragan angin timur. Ini yang menyebabkanmu sakit.",},
        [4840] = {9104,"Zhuge Liang","Zhou Yu","Tuan sudah mengetahui sumbernya, apakah ada obatnya? Ini darurat, tolong beritahu aku.","Tuan sudah mengetahui sumbernya, apakah ada obatnya? Ini darurat, tolong beritahu aku.",},
        [4841] = {9104,"Zhou Yu","Zhuge Liang","Meskipun aku biasa-biasa saja, tapi aku pernah bertemu pengikut suatu aliran yang mengajariku buku magis klasik, bisa memanggil awan dan hujan.","Meskipun aku biasa-biasa saja, tapi aku pernah bertemu pengikut suatu aliran yang mengajariku buku magis klasik, bisa memanggil awan dan hujan.",},
        [4842] = {9104,"Zhou Yu","Zhuge Liang","Jika menginginkan angin tenggara, bisa membangun satu paviliun di Gunung Nanping, lalu menamainya Altar Tujuh Bintang: tiga tingkat, tinggi tiga meter, dengan seratus dua puluh orang pemegang bendera.","Jika menginginkan angin tenggara, bisa membangun satu paviliun di Gunung Nanping, lalu menamainya Altar Tujuh Bintang: tiga tingkat, tinggi tiga meter, dengan seratus dua puluh orang pemegang bendera.",},
        [4843] = {9104,"Zhou Yu","Zhuge Liang","Aku akan melakukan sihir, meminjam angin tenggara tiga hari tiga malam untuk jenderal, bagaimana menurutmu?","Aku akan melakukan sihir, meminjam angin tenggara tiga hari tiga malam untuk jenderal, bagaimana menurutmu?",},
        [4844] = {9104,"Zhuge Liang","Zhou Yu","Tidak perlu tiga hari tiga malam, hanya perlu angin satu malam saja, rencana pasti berhasil. Tapi ini darurat, tidak boleh ditunda lagi.","Tidak perlu tiga hari tiga malam, hanya perlu angin satu malam saja, rencana pasti berhasil. Tapi ini darurat, tidak boleh ditunda lagi.",},
        [4845] = {9104,"Zhou Yu","Zhuge Liang","Aku akan memanggil angin di 20 November, hingga 22 November terjadi angin kencangnya, bagaimana?","Aku akan memanggil angin di 20 November, hingga 22 November terjadi angin kencangnya, bagaimana?",},
        [4846] = {9104,"Zhuge Liang","Zhou Yu","Perintahkan lima ratus pasukan terkuat menuju ke Gunung Nanping untuk membangun altar, dan siapkan seratus dua puluh pemegang bendera.","Perintahkan lima ratus pasukan terkuat menuju ke Gunung Nanping untuk membangun altar, dan siapkan seratus dua puluh pemegang bendera.",},
        [4847] = {9105,"Lu Su","Zhou Yu","Malam ini, langit masih cerah, angin tidak bertiup. Yang Kongming katakan tidak masuk akal. Ini musim dingin, bagaimana mungkin memanggil angin tenggara?","Malam ini, langit masih cerah, angin tidak bertiup. Yang Kongming katakan tidak masuk akal. Ini musim dingin, bagaimana mungkin memanggil angin tenggara?",},
        [4848] = {9105,"Zhou Yu","Lu Su","Rasanya tidak begitu.","Rasanya tidak begitu.",},
        [4849] = {9105,"Zhou Yu","Lu Su","Jenderal, lihat, bendera berputar mengarah ke barat laut, angin tenggara mulai bertiup.","Jenderal, lihat, bendera berputar mengarah ke barat laut, angin tenggara mulai bertiup.",},
        [4850] = {9105,"Lu Su","Zhou Yu","Orang ini penyihir, dia berbahaya bagi Wu jika dibiarkan. Kita harus membunuhnya, jika tidak ingin masalah di kemudian hari.","Orang ini penyihir, dia berbahaya bagi Wu jika dibiarkan. Kita harus membunuhnya, jika tidak ingin masalah di kemudian hari.",},
        [4851] = {9105,"Lu Su","Zhou Yu","Ding Feng, Xu Sheng, masing-masing membawa seratus orang. Xu Sheng lewat air, Ding Feng lewat darat.","Ding Feng, Xu Sheng, masing-masing membawa seratus orang. Xu Sheng lewat air, Ding Feng lewat darat.",},
        [4852] = {9105,"Lu Su","Zhou Yu","Menuju Altar Tujuh Bintang di Gunung Nanping, tiba di sana jangan katakan apapun, tangkap saja Zhuge Liang dan bawa kepalanya kepadaku.","Menuju Altar Tujuh Bintang di Gunung Nanping, tiba di sana jangan katakan apapun, tangkap saja Zhuge Liang dan bawa kepalanya kepadaku.",},
        [4853] = {9105,"Zhou Yu","Xu Sheng","Baik, jenderal.","Baik, jenderal.",},
        [4854] = {9106,"Zhuge Liang","Protagonis","Zhou Yu orang yang berpikiran sempit, saat angin tenggara bertiup, dia pasti mengirim orang menangkapmu.","Zhou Yu orang yang berpikiran sempit, saat angin tenggara bertiup, dia pasti mengirim orang menangkapmu.",},
        [4855] = {9106,"Protagonis","Zhuge Liang","Aku sudah memperkirakannya, aku sudah meminta Zilong untuk menjemputku di sungai.","Aku sudah memperkirakannya, aku sudah meminta Zilong untuk menjemputku di sungai.",},
        [4856] = {9106,"Zhuge Liang","Protagonis","Kemarin malam aku sudah menyiapkan perahu di dermaga, kita segera berkumpul dengan Zilong.","Kemarin malam aku sudah menyiapkan perahu di dermaga, kita segera berkumpul dengan Zilong.",},
        [4857] = {9107,"Zhuge Liang","Xu Sheng","Penasihat jangan pergi dulu! Jenderal ingin bertemu!","Penasihat jangan pergi dulu! Jenderal ingin bertemu!",},
        [4858] = {9107,"Xu Sheng","Zhuge Liang","Beritahu jenderalmu, pergunakan pasukan dengan baik. Zhuge Liang kini kembali dulu ke Xiakou, sampai jumpa lagi.","Beritahu jenderalmu, pergunakan pasukan dengan baik. Zhuge Liang kini kembali dulu ke Xiakou, sampai jumpa lagi.",},
        [4859] = {9107,"Zhuge Liang","Xu Sheng","Tolong tinggal dulu beberapa hari, ada masalah penting ingin dibicarakan.","Tolong tinggal dulu beberapa hari, ada masalah penting ingin dibicarakan.",},
        [4860] = {9107,"Xu Sheng","Zhuge Liang","Aku sudah memperkirakan jika jenderal Zhou menginginkanku mati, karena itu aku sudah lebih dulu memanggil Zilong untuk menjemputku. Jangan mengejarku lagi. ","Aku sudah memperkirakan jika jenderal Zhou menginginkanku mati, karena itu aku sudah lebih dulu memanggil Zilong untuk menjemputku. Jangan mengejarku lagi. ",},
        [4861] = {9107,"Xu Sheng","Zhao Yun","Zhao Zilong orang Changsan tiba untuk menjemput penasihat. Aku tidak ingin merusak aliansi, tetapi jika terpaksa aku akan memanahmu.","Zhao Zilong orang Changsan tiba untuk menjemput penasihat. Aku tidak ingin merusak aliansi, tetapi jika terpaksa aku akan memanahmu.",},
        [4862] = {9107,"Xu Sheng","Ding Feng","Zhuge Liang memiliki kalkulasi yang baik. Zhao Yun adalah pendekar yang sulit ditandingi, tahukah kamu tentang kehebatan mereka di Perang Changban?","Zhuge Liang memiliki kalkulasi yang baik. Zhao Yun adalah pendekar yang sulit ditandingi, tahukah kamu tentang kehebatan mereka di Perang Changban?",},
        [4863] = {9107,"Xu Sheng","Ding Feng","Kita harus kembali untuk melapor ke jenderal.","Kita harus kembali untuk melapor ke jenderal.",},
        [4864] = {9107,"Ding Feng","Xu Sheng","Iya.","Iya.",},
        [4865] = {9108,"Zhou Yu","Xu Sheng","Kongming lebih dulu memanggil Zhao Yun untuk menjemputnya, kita gagal menangkapnya.","Kongming lebih dulu memanggil Zhao Yun untuk menjemputnya, kita gagal menangkapnya.",},
        [4866] = {9108,"Xu Sheng","Zhou Yu","Orang ini sungguh penuh dengan siasat, aku tidak tenang semalaman!","Orang ini sungguh penuh dengan siasat, aku tidak tenang semalaman!",},
        [4867] = {9108,"Zhou Yu","Lu Su","Kita urusi dia nanti, setelah mengalahkan Cao Cao.","Kita urusi dia nanti, setelah mengalahkan Cao Cao.",},
        [4868] = {9108,"Lu Su","Zhou Yu","Baik.","Baik.",},
        [4869] = {9201,"Cao Cao","Lu Su","Kapal dengan bendera gigi naga tiba dari Jiangnan. Bendera yang terbesar bertuliskan Huang Gai!","Kapal dengan bendera gigi naga tiba dari Jiangnan. Bendera yang terbesar bertuliskan Huang Gai!",},
        [4870] = {9201,"Lu Su","Cao Cao","Gongfu datang menyerah, takdir membantuku!","Gongfu datang menyerah, takdir membantuku!",},
        [4871] = {9201,"Cao Cao","Cheng Yu","Ini jebakan, jangan biarkan mereka mendekat.","Ini jebakan, jangan biarkan mereka mendekat.",},
        [4872] = {9201,"Cheng Yu","Cao Cao","Bagaimana kamu tahu!?","Bagaimana kamu tahu!?",},
        [4873] = {9201,"Cao Cao","Cheng Yu","Ransum di dalam kapal, pasti berat. Tapi kali ini datang, ringan sekali. Dan juga angin tenggara bertiup malam ini, pasti jebakan, kita harus bagaimana?","Ransum di dalam kapal, pasti berat. Tapi kali ini datang, ringan sekali. Dan juga angin tenggara bertiup malam ini, pasti jebakan, kita harus bagaimana?",},
        [4874] = {9201,"Cheng Yu","Cao Cao","Siapa yang akan menghentikannya?","Siapa yang akan menghentikannya?",},
        [4875] = {9201,"Cao Cao","Wen Pin","Aku terbiasa dengan air, biarkan aku pergi.","Aku terbiasa dengan air, biarkan aku pergi.",},
        [4876] = {9201,"Wen Pin","Cao Cao","Baik.","Baik.",},
        [4877] = {9202,"Huang Gai","Wen Pin","Atas perintah perdana menteri, kapal dari selatan dilarang mendekat, labuhkan jangkarmu.","Atas perintah perdana menteri, kapal dari selatan dilarang mendekat, labuhkan jangkarmu.",},
        [4878] = {9202,"Huang Gai","Wen Pin","Cepat turunkan layarmu.","Cepat turunkan layarmu.",},
        [4879] = {9202,"Wen Pin","Huang Gai","Tembakkan panah api!","Tembakkan panah api!",},
        [4880] = {9202,"Wen Pin","Huang Gai","Bakar kapalnya, tabrakkan ke barak air!","Bakar kapalnya, tabrakkan ke barak air!",},
        [4881] = {9202,"Huang Gai","Wen Pin","Hentikan kapal mereka.","Hentikan kapal mereka.",},
        [4882] = {9203,"Cao Cao","Huang Gai","Huang Gai di sini! Bandit Cao jangan lari!","Huang Gai di sini! Bandit Cao jangan lari!",},
        [4883] = {9203,"Huang Gai","Cao Cao","Lindungi aku.","Lindungi aku.",},
        [4884] = {9203,"Cao Cao","Zhang Liao","Kapal kita tertaut satu sama lain, jika terbakar maka akan terbakar semua. Bahkan permukaan air pun akan terbakar.","Kapal kita tertaut satu sama lain, jika terbakar maka akan terbakar semua. Bahkan permukaan air pun akan terbakar.",},
        [4885] = {9203,"Cao Cao","Zhang Liao","Perdana menteri cepat naik kapal menuju dermaga.","Perdana menteri cepat naik kapal menuju dermaga.",},
        [4886] = {9203,"Zhang Liao","Huang Gai","Mau lari ke mana kamu!","Mau lari ke mana kamu!",},
        [4887] = {9203,"Huang Gai","Zhang Liao","Mati kau Huang Gai!","Mati kau Huang Gai!",},
        [4888] = {9301,"Zhao Yun","Zhuge Liang","Zilong, bawa tiga ribu kavaleri, dan bersiap menyergap Cao Cao di semak kedua sisi hutan. Setelah malam, Cao Cao akan lewat sana.","Zilong, bawa tiga ribu kavaleri, dan bersiap menyergap Cao Cao di semak kedua sisi hutan. Setelah malam, Cao Cao akan lewat sana.",},
        [4889] = {9301,"Zhao Yun","Zhuge Liang","Saat pasukannya lewat, bakar mereka. Paling tidak separuh dari mereka akan terbakar.","Saat pasukannya lewat, bakar mereka. Paling tidak separuh dari mereka akan terbakar.",},
        [4890] = {9301,"Zhuge Liang","Zhao Yun","Ada dua jalan di Hutan Wu, satu menuju Nanjun, satunya menuju Jingzhou, jalan manakah yang akan dia ambil?","Ada dua jalan di Hutan Wu, satu menuju Nanjun, satunya menuju Jingzhou, jalan manakah yang akan dia ambil?",},
        [4891] = {9301,"Zhao Yun","Zhuge Liang","Nanjun bukan tempat yang bagus untuk Cao Cao pergi, dia pasti ke Jingzhou, lalu pergi ke Xuchang.","Nanjun bukan tempat yang bagus untuk Cao Cao pergi, dia pasti ke Jingzhou, lalu pergi ke Xuchang.",},
        [4892] = {9301,"Zhuge Liang","Zhao Yun","Zilong pergi sekarang juga.","Zilong pergi sekarang juga.",},
        [4893] = {9301,"Zhao Yun","Zhuge Liang","Yide, bawa tiga ribu pasukan ke seberang sungai, cegat jalan Yiling, pergi ke lembah Hulu dan siap menyergap. Cao Cao tidak akan berani ke Yiling selatan, pasti ke utara.","Yide, bawa tiga ribu pasukan ke seberang sungai, cegat jalan Yiling, pergi ke lembah Hulu dan siap menyergap. Cao Cao tidak akan berani ke Yiling selatan, pasti ke utara.",},
        [4894] = {9301,"Zhao Yun","Zhuge Liang","Besok akan hujan, setelah itu pasukan akan bermalam di sini. Begitu melihat api, cepat datangi. Meskipun tidak bisa menangkap Cao Cao, paling tidak Yide akan melukainya. ","Besok akan hujan, setelah itu pasukan akan bermalam di sini. Begitu melihat api, cepat datangi. Meskipun tidak bisa menangkap Cao Cao, paling tidak Yide akan melukainya. ",},
        [4895] = {9301,"Zhuge Liang","Zhang Fei","Aku pergi sekarang juga.","Aku pergi sekarang juga.",},
        [4896] = {9301,"Zhang Fei","Zhuge Liang","Mi Zhu, Mi Fang, Liu Feng, kalian bertiga masing-masing menaiki perahu, tangkap desertir pasukan Cao, ambil senjata mereka.","Mi Zhu, Mi Fang, Liu Feng, kalian bertiga masing-masing menaiki perahu, tangkap desertir pasukan Cao, ambil senjata mereka.",},
        [4897] = {9301,"Zhuge Liang","Mi Zhu","Baik.","Baik.",},
        [4898] = {9301,"Mi Zhu","Zhuge Liang","Wuchang lokasi yang penting. Kembalilah ke sini, bawa pasukan Wuchang untuk mempertahankan dermaga. Tangkap desertir Cao tapi jangan tinggalkan kota untuk mengejar mereka.","Wuchang lokasi yang penting. Kembalilah ke sini, bawa pasukan Wuchang untuk mempertahankan dermaga. Tangkap desertir Cao tapi jangan tinggalkan kota untuk mengejar mereka.",},
        [4899] = {9301,"Zhuge Liang","Liu Qi","Aku pergi sekarang.","Aku pergi sekarang.",},
        [4900] = {9301,"Liu Qi","Zhuge Liang","Tuan tolong garnisun Fankou, dan perhatikan saja kemenangan Zhou Lang malam ini dari ketinggian.","Tuan tolong garnisun Fankou, dan perhatikan saja kemenangan Zhou Lang malam ini dari ketinggian.",},
        [4901] = {9301,"Zhuge Liang","Liu Bei","Tuan sangat bijaksana.","Tuan sangat bijaksana.",},
        [4902] = {9302,"Zhuge Liang","Guan Yu","Guan Yu sudah mengikuti kakak berperang bertahun-tahun, dan belum pernah kalah. Malam ini perang besar, penasihat tidak menggunakanku sama sekali, apa maksudnya ini?","Guan Yu sudah mengikuti kakak berperang bertahun-tahun, dan belum pernah kalah. Malam ini perang besar, penasihat tidak menggunakanku sama sekali, apa maksudnya ini?",},
        [4903] = {9302,"Guan Yu","Zhuge Liang","Yunchang jangan salahkan aku! Aku awalnya menginginkanmu mempertahankan Xiakou, tetapi aku ada sedikit kekhawatiran, tidak berani memerintahkanmu pergi.","Yunchang jangan salahkan aku! Aku awalnya menginginkanmu mempertahankan Xiakou, tetapi aku ada sedikit kekhawatiran, tidak berani memerintahkanmu pergi.",},
        [4904] = {9302,"Zhuge Liang","Guan Yu","Apa itu? Beritahu aku.","Apa itu? Beritahu aku.",},
        [4905] = {9302,"Guan Yu","Zhuge Liang","Cao Cao memperlakukanmu dengan baik di masa lampau, sebagai orang yang membalas budi, kamu pasti membalasnya. Hari ini pasukan Cao kalah, pasti melewati jalan Huarong, dan saat itu kamu pasti akan membiarkannya lewat jika aku menyuruhmu pergi.","Cao Cao memperlakukanmu dengan baik di masa lampau, sebagai orang yang membalas budi, kamu pasti membalasnya. Hari ini pasukan Cao kalah, pasti melewati jalan Huarong, dan saat itu kamu pasti akan membiarkannya lewat jika aku menyuruhmu pergi.",},
        [4906] = {9302,"Zhuge Liang","Guan Yu","Penasihat berpikir terlalu jauh! Memang dulu Cao Cao memperlakukanku dengan baik, aku sudah membunuh Yan Liang dan Wen Chou, menang di Baima. Hari ini jika bertemu, pasti tidak akan aku lepaskan!","Penasihat berpikir terlalu jauh! Memang dulu Cao Cao memperlakukanku dengan baik, aku sudah membunuh Yan Liang dan Wen Chou, menang di Baima. Hari ini jika bertemu, pasti tidak akan aku lepaskan!",},
        [4907] = {9302,"Guan Yu","Zhuge Liang","Lalu bagaimana jika kamu melepaskannya?","Lalu bagaimana jika kamu melepaskannya?",},
        [4908] = {9302,"Zhuge Liang","Guan Yu","Hukum aku sesuai aturan militer!","Hukum aku sesuai aturan militer!",},
        [4909] = {9302,"Guan Yu","Zhuge Liang","Baiklah, tanda tangani jaminan kalau begitu.","Baiklah, tanda tangani jaminan kalau begitu.",},
        [4910] = {9302,"Zhuge Liang","Guan Yu","Bagaimana jika Cao Cao tidak lewat jalan itu?","Bagaimana jika Cao Cao tidak lewat jalan itu?",},
        [4911] = {9302,"Guan Yu","Zhuge Liang","Aku juga akan menanda tangani jaminan militer.","Aku juga akan menanda tangani jaminan militer.",},
        [4912] = {9302,"Guan Yu","Zhuge Liang","Yunchang bisa dari bukit jalan Huarong, membakar semak, menarik Cao Cao datang.","Yunchang bisa dari bukit jalan Huarong, membakar semak, menarik Cao Cao datang.",},
        [4913] = {9302,"Zhuge Liang","Guan Yu","Saat Cao Cao melihat semak, dia akan tahu ada sergapan, bagaimana mungkin dia datang?","Saat Cao Cao melihat semak, dia akan tahu ada sergapan, bagaimana mungkin dia datang?",},
        [4914] = {9302,"Guan Yu","Zhuge Liang","Pernah membaca seni perang? Cao Cao pandai menggunakan pasukan, kali ini akan menipunya. Saat dia melihat api, dia pasti akan menganggap ini tipuan, dan akan sengaja melaluinya. Jangan tunjukkkan pengampunan padanya.","Pernah membaca seni perang? Cao Cao pandai menggunakan pasukan, kali ini akan menipunya. Saat dia melihat api, dia pasti akan menganggap ini tipuan, dan akan sengaja melaluinya. Jangan tunjukkkan pengampunan padanya.",},
        [4915] = {9303,"Zhuge Liang","Liu Bei","Adikku orang yang penuh balas budi, jika Cao Cao melewati jalan Huarong, aku takut dia akan melepaskannya.","Adikku orang yang penuh balas budi, jika Cao Cao melewati jalan Huarong, aku takut dia akan melepaskannya.",},
        [4916] = {9303,"Liu Bei","Zhuge Liang","Aku mengamati bintang, ini tahu ini belum saatnya kematian Cao Cao. Karena berhutang budi, Yunchang pasti melepaskannya.","Aku mengamati bintang, ini tahu ini belum saatnya kematian Cao Cao. Karena berhutang budi, Yunchang pasti melepaskannya.",},
        [4917] = {9303,"Zhuge Liang","Liu Bei","Perhitungan Tuan, tidak ada yang bisa menandingi!","Perhitungan Tuan, tidak ada yang bisa menandingi!",},
        [4918] = {9401,"Xu Chu","Cao Cao","Di depan itu ke mana?","Di depan itu ke mana?",},
        [4919] = {9401,"Cao Cao","Xu Chu","Yang satu adalah jalan menuju Yiling selatan, satunya ke Yiling utara.","Yang satu adalah jalan menuju Yiling selatan, satunya ke Yiling utara.",},
        [4920] = {9401,"Xu Chu","Cao Cao","Yang mana terdekat ke Nanjun?","Yang mana terdekat ke Nanjun?",},
        [4921] = {9401,"Cao Cao","Xu Chu","Melalui Hulu lebih dekat ke Nanjun.","Melalui Hulu lebih dekat ke Nanjun.",},
        [4922] = {9401,"Xu Chu","Cao Cao","Pergi ke Yiling selatan.","Pergi ke Yiling selatan.",},
        [4923] = {9402,"","Cao Cao","Hahahahaha.","Hahahahaha.",},
        [4924] = {9402,"Cao Cao","Zhang Liao","Mengapa perdana menteri tertawa?","Mengapa perdana menteri tertawa?",},
        [4925] = {9402,"Zhang Liao","Cao Cao","Aku menertawakan Zhuge Liang dan Zhou Yu. Jika aku yang menggunakan pasukan, aku akan menyergap di perjalanan ke Yiling selatan.","Aku menertawakan Zhuge Liang dan Zhou Yu. Jika aku yang menggunakan pasukan, aku akan menyergap di perjalanan ke Yiling selatan.",},
        [4926] = {9402,"Zhang Liao","Cao Cao","Bahkan jika kita selamat, kita pasti terluka parah. Jika kamu tidak memahami ini, aku akan tertawa.","Bahkan jika kita selamat, kita pasti terluka parah. Jika kamu tidak memahami ini, aku akan tertawa.",},
        [4927] = {9402,"Cao Cao","Zhang Fei","Siapa bilang Kongming bodoh, Yide sudah menunggu lama di sini!","Siapa bilang Kongming bodoh, Yide sudah menunggu lama di sini!",},
        [4928] = {9402,"Zhang Fei","Zhang Liao","Perdana menteri pergilah duluan, biar aku yang melawannya.","Perdana menteri pergilah duluan, biar aku yang melawannya.",},
        [4929] = {9403,"Cao Cao","Zhang Liao","Di depan ada dua jalan, ke mana perdana menteri akan memilih?","Di depan ada dua jalan, ke mana perdana menteri akan memilih?",},
        [4930] = {9403,"Zhang Liao","Cao Cao","Yang mana lebih dekat?","Yang mana lebih dekat?",},
        [4931] = {9403,"Cao Cao","Zhang Liao","Jalan utama lebih datar tapi lebih jauh lima puluh mil. Jalan kecil ke Huarong, lebih dekat lima puluh mil, tetapi sempit dan terjal untuk dilalui.","Jalan utama lebih datar tapi lebih jauh lima puluh mil. Jalan kecil ke Huarong, lebih dekat lima puluh mil, tetapi sempit dan terjal untuk dilalui.",},
        [4932] = {9403,"Cao Cao","Zhang Liao","Dan juga ada asap di gunung sebelah jalan kecil, sedangkan tidak ada pergerakan di jalan utama.","Dan juga ada asap di gunung sebelah jalan kecil, sedangkan tidak ada pergerakan di jalan utama.",},
        [4933] = {9403,"Zhang Liao","Cao Cao","Kita lewat Jalan Huarong.","Kita lewat Jalan Huarong.",},
        [4934] = {9403,"Cao Cao","Zhang Liao","Jika ada asap, pasti ada pasukan. Kenapa kita lewat sana?","Jika ada asap, pasti ada pasukan. Kenapa kita lewat sana?",},
        [4935] = {9403,"Zhang Liao","Cao Cao","Pernahkah kamu membaca buku perang yang berkata, berisi berarti kosong, kosong berarti berisi?","Pernahkah kamu membaca buku perang yang berkata, berisi berarti kosong, kosong berarti berisi?",},
        [4936] = {9403,"Zhang Liao","Cao Cao","Zhuge Liang penuh siasat cerdik, dia sengaja menyuruh membuat asap supaya kita tidak melalui jalan pintas, sementara mereka menyergap di jalan utama. Aku membaca pikirannya, tidak akan terjebak ke rencananya!","Zhuge Liang penuh siasat cerdik, dia sengaja menyuruh membuat asap supaya kita tidak melalui jalan pintas, sementara mereka menyergap di jalan utama. Aku membaca pikirannya, tidak akan terjebak ke rencananya!",},
        [4937] = {9403,"Cao Cao","Zhang Liao","Perdana menteri sungguh bijaksana.","Perdana menteri sungguh bijaksana.",},
        [4938] = {9404,"Cao Cao","Zhang Liao","Gawat, lima ratuus pasukan pedang di kedua sisi, Guan Yunchang di tengah menunggu, sambil membawa pedang naga, menunggang kuda Kelinci Merah, bersiap menerkam kita.","Gawat, lima ratuus pasukan pedang di kedua sisi, Guan Yunchang di tengah menunggu, sambil membawa pedang naga, menunggang kuda Kelinci Merah, bersiap menerkam kita.",},
        [4939] = {9404,"Zhang Liao","Cao Cao","Pilihannya aku mati atau dia mati!","Pilihannya aku mati atau dia mati!",},
        [4940] = {9404,"Cao Cao","Cheng Yu","Aku tahu Yunchang orang yang penuh balas budi dan pengampunan.","Aku tahu Yunchang orang yang penuh balas budi dan pengampunan.",},
        [4941] = {9404,"Cao Cao","Cheng Yu","Tuan baik kepadanya di waktu lampau, Tuan bisa mencoba berbicara dengannya, mungkin kita bisa selamat.","Tuan baik kepadanya di waktu lampau, Tuan bisa mencoba berbicara dengannya, mungkin kita bisa selamat.",},
        [4942] = {9405,"Guan Yu","Cao Cao","Bagaimana kabarmu, jenderal Guan?","Bagaimana kabarmu, jenderal Guan?",},
        [4943] = {9405,"Cao Cao","Guan Yu","Berdasarkan perintah penasihat, aku sudah menunggu lama di sini.","Berdasarkan perintah penasihat, aku sudah menunggu lama di sini.",},
        [4944] = {9405,"Guan Yu","Cao Cao","Pasukanku dikalahkan dan aku menemui jalan buntu, tolong berbelas kasihan padaku atas dasar pertemanan masa lalu.","Pasukanku dikalahkan dan aku menemui jalan buntu, tolong berbelas kasihan padaku atas dasar pertemanan masa lalu.",},
        [4945] = {9405,"Cao Cao","Guan Yu","Benar, kamu baik kepadaku. Tetapi aku sudah Yan Liang, Wen Chou, dan memenangkan Baima untukmu. Membunuhmu adalah demi kebaikan, bagaimana aku bisa memiliki sentimen pribadi?","Benar, kamu baik kepadaku. Tetapi aku sudah Yan Liang, Wen Chou, dan memenangkan Baima untukmu. Membunuhmu adalah demi kebaikan, bagaimana aku bisa memiliki sentimen pribadi?",},
        [4946] = {9405,"Guan Yu","Cao Cao","Melewati 5 benteng dan membunuh 6 jenderal, apakah kamu tidak ingat? Seorang pria haruslah penuh balas budi. Jenderal sudah membaca Negara Damai, tidakkah tahu tentang kisah Yugong Zhishi dan Zizhuo Ruzi?","Melewati 5 benteng dan membunuh 6 jenderal, apakah kamu tidak ingat? Seorang pria haruslah penuh balas budi. Jenderal sudah membaca Negara Damai, tidakkah tahu tentang kisah Yugong Zhishi dan Zizhuo Ruzi?",},
        [4947] = {9405,"Cao Cao","Guan Yu","Para prajurit, minggir semuanya.","Para prajurit, minggir semuanya.",},
        [4948] = {9405,"Guan Yu","Cao Cao","Terimakasih Jenderal.","Terimakasih Jenderal.",},
        [4949] = {9501,"","Cao Cao","Selatan mengirimkan seekor burung, burung itu mencintai bulunya, melihat bayangannya dia akan menari.","Selatan mengirimkan seekor burung, burung itu mencintai bulunya, melihat bayangannya dia akan menari.",},
        [4950] = {9501,"","Cao Cao","Aku ingin membuatnya menari, tetapi aku tidak bisa.","Aku ingin membuatnya menari, tetapi aku tidak bisa.",},
        [4951] = {9501,"Cao Cao","Cao Chong","Mengapa tidak menaruhnya di depan cermin tembaga?","Mengapa tidak menaruhnya di depan cermin tembaga?",},
        [4952] = {9501,"Cao Chong","Cao Cao","Benar, ide bagus.","Benar, ide bagus.",},
        [4953] = {9502,"Cao Chong","Cao Cao","Aku menaruh cermin tembaga di depan burung, dia mulai menari setelah melihat pantulannya.","Aku menaruh cermin tembaga di depan burung, dia mulai menari setelah melihat pantulannya.",},
        [4954] = {9502,"Cao Chong","Cao Cao","Tetapi burung itu tidak berhenti menari, dan akhirnya mati kelelahan.","Tetapi burung itu tidak berhenti menari, dan akhirnya mati kelelahan.",},
        [4955] = {9502,"Cao Cao","Cao Chong","Mungkin itu yang dinamakan dengan narsistik.","Mungkin itu yang dinamakan dengan narsistik.",},
        [4956] = {9503,"Cao Cao","Nyonya Huan","Mengde, Cao Chong sakit, cepat kamu tengok.","Mengde, Cao Chong sakit, cepat kamu tengok.",},
        [4957] = {9503,"Nyonya Huan","Cao Cao","Apa? Aku sekarang juga kembali ke Xuchang.","Apa? Aku sekarang juga kembali ke Xuchang.",},
        [4958] = {9504,"Nyonya Huan","Cao Cao","Cao Chong sakit apa? Apa sudah diperiksa tabib? ","Cao Chong sakit apa? Apa sudah diperiksa tabib? ",},
        [4959] = {9504,"Cao Cao","Nyonya Huan","Sudah, tetapi doktor tidak tahu penyakit apa.","Sudah, tetapi doktor tidak tahu penyakit apa.",},
        [4960] = {9504,"Nyonya Huan","Cao Cao","Tenanglah, aku akan mencari tabib terhebat dunia untuk menyembuhkannya.","Tenanglah, aku akan mencari tabib terhebat dunia untuk menyembuhkannya.",},
        [4961] = {9504,"Nyonya Huan","Cao Cao","Cepat, cari tabib! Cepat!","Cepat, cari tabib! Cepat!",},
        [4962] = {9504,"Cao Cao","Cao Ren","Ya.","Ya.",},
        [4963] = {9505,"Cao Cao","Cao Pi","Sungguh tragis, Cao Chong mati karena sakit.","Sungguh tragis, Cao Chong mati karena sakit.",},
        [4964] = {9505,"Cao Pi","Cao Cao","Tahun 2 Jian'an, Cao Ang dan aku pergi menyerang Zhang Xiu, tetapi dia tewas melindungiku saat aku mundur.","Tahun 2 Jian'an, Cao Ang dan aku pergi menyerang Zhang Xiu, tetapi dia tewas melindungiku saat aku mundur.",},
        [4965] = {9505,"Cao Pi","Cao Cao","Cao Chong sangat cerdas, mati di umur tiga belas, aku sungguh sedih!","Cao Chong sangat cerdas, mati di umur tiga belas, aku sungguh sedih!",},
        [4966] = {9505,"Cao Pi","Cao Cao","Itu ketidak beruntunganmu, tapi keberuntungan bagiku.","Itu ketidak beruntunganmu, tapi keberuntungan bagiku.",},
        [4967] = {9601,"Liu Bei","Zhou Yu","Tuan Liu memindahkan pasukan kemari, apakah hendak menyerang Nanjun?","Tuan Liu memindahkan pasukan kemari, apakah hendak menyerang Nanjun?",},
        [4968] = {9601,"Zhou Yu","Liu Bei","Aku mendengar jenderal akan merebut Nanjun, aku datang untuk membantu. Jika jenderal tidak mau, aku saja yang merebutnya.","Aku mendengar jenderal akan merebut Nanjun, aku datang untuk membantu. Jika jenderal tidak mau, aku saja yang merebutnya.",},
        [4969] = {9601,"Liu Bei","Zhou Yu","Wu berkeinginan untuk menyatukan Hanjiang sejak dulu, Nanjun sudah dalam genggaman, mengapa tidak kami ambil?","Wu berkeinginan untuk menyatukan Hanjiang sejak dulu, Nanjun sudah dalam genggaman, mengapa tidak kami ambil?",},
        [4970] = {9601,"Zhou Yu","Liu Bei","Perang tidak bisa diprediksi. Sebelum Cao Cao mundur, dia menyuruh Cao Ren untuk berjaga di Nanjun, dia pasti sudah dipersiapkan dengan siasat, apalagi Cao Ren sangat pemberani, aku khawatir jenderal gagal merebut Nanjun.","Perang tidak bisa diprediksi. Sebelum Cao Cao mundur, dia menyuruh Cao Ren untuk berjaga di Nanjun, dia pasti sudah dipersiapkan dengan siasat, apalagi Cao Ren sangat pemberani, aku khawatir jenderal gagal merebut Nanjun.",},
        [4971] = {9601,"Liu Bei","Zhou Yu","Jika aku gagal, aku akan membiarkanmu merebutnya.","Jika aku gagal, aku akan membiarkanmu merebutnya.",},
        [4972] = {9601,"Zhou Yu","Liu Bei","Zijing dan Kongming menjadi saksi, jenderal jangan menyesalinya nanti.","Zijing dan Kongming menjadi saksi, jenderal jangan menyesalinya nanti.",},
        [4973] = {9601,"Liu Bei","Zhou Yu","Aku orang yang menepati ucapanku, mengapa harus menyesal!","Aku orang yang menepati ucapanku, mengapa harus menyesal!",},
        [4974] = {9601,"Zhou Yu","Liu Bei","Baiklah, biarkan Dongwu berusaha lebih dulu, jika gagal, maka giliranku!","Baiklah, biarkan Dongwu berusaha lebih dulu, jika gagal, maka giliranku!",},
        [4975] = {9602,"Zhuge Liang","Liu Bei","Tuan yang memintaku menjawab seperti itu, meskipun aku sudah mengatakannya, aku masih tidak paham. Aku kini lemah dan miskin, tanpa wilayah, Nanjun akan menjadi wilayah strategis bagiku.","Tuan yang memintaku menjawab seperti itu, meskipun aku sudah mengatakannya, aku masih tidak paham. Aku kini lemah dan miskin, tanpa wilayah, Nanjun akan menjadi wilayah strategis bagiku.",},
        [4976] = {9602,"Zhuge Liang","Liu Bei","Jika Zhou Yu berhasil merebutnya, maka kota tersebut menjadi milik Dongwu, bagaimana cara aku mendapatkannya?","Jika Zhou Yu berhasil merebutnya, maka kota tersebut menjadi milik Dongwu, bagaimana cara aku mendapatkannya?",},
        [4977] = {9602,"Liu Bei","Zhuge Liang","Aku dulu menyarankan untuk merebut Jingzhou, tapi Tuan tidak mau mendengar, tapi kini malah menginginkannya?","Aku dulu menyarankan untuk merebut Jingzhou, tapi Tuan tidak mau mendengar, tapi kini malah menginginkannya?",},
        [4978] = {9602,"Zhuge Liang","Liu Bei","Jingzhou adalah milik Jingsheng, aku tidak tega merebutnya. Nanjun milik Cao Cao, aku bisa merebutnya.","Jingzhou adalah milik Jingsheng, aku tidak tega merebutnya. Nanjun milik Cao Cao, aku bisa merebutnya.",},
        [4979] = {9602,"Liu Bei","Zhuge Liang","Tuan tidak perlu khawatir, biar Zhou Yu yang pergi membantai, cepat atau lambat Tuan akan menduduki Nanjun.","Tuan tidak perlu khawatir, biar Zhou Yu yang pergi membantai, cepat atau lambat Tuan akan menduduki Nanjun.",},
        [4980] = {9602,"Zhuge Liang","Liu Bei","Strategi apa yang kamu punya?","Strategi apa yang kamu punya?",},
        [4981] = {9602,"Liu Bei","Zhuge Liang","Dekatkan telinga Tuan.","Dekatkan telinga Tuan.",},
        [4982] = {9603,"Zhou Yu","Lu Su","Mengapa kamu mengijinkan Xuande untuk menyerang Nanjun?","Mengapa kamu mengijinkan Xuande untuk menyerang Nanjun?",},
        [4983] = {9603,"Lu Su","Zhou Yu","Aku bisa merebut Nanjun dengan mudah, aku hanya berusaha sopan.","Aku bisa merebut Nanjun dengan mudah, aku hanya berusaha sopan.",},
        [4984] = {9603,"Lu Su","Zhou Yu","Siapa yang berani lebih dulu merebut Nanjun?","Siapa yang berani lebih dulu merebut Nanjun?",},
        [4985] = {9603,"Zhou Yu","Jiang Qin","Aku!","Aku!",},
        [4986] = {9603,"Jiang Qin","Zhou Yu","Kamu menjadi pionir, Xu Sheng dan Ding Feng sebagai wakil kapten. Bawa lima ribu kavaleri menyeberangi sungai, aku akan menyusul kemudian.","Kamu menjadi pionir, Xu Sheng dan Ding Feng sebagai wakil kapten. Bawa lima ribu kavaleri menyeberangi sungai, aku akan menyusul kemudian.",},
        [4987] = {9604,"Cao Ren","Niu Jin","Pasukan Wu sudah menyeberangi sungaii,","Pasukan Wu sudah menyeberangi sungaii,",},
        [4988] = {9604,"Niu Jin","Cao Ren","Pertahanan, jangan menyerang.","Pertahanan, jangan menyerang.",},
        [4989] = {9604,"Cao Ren","Niu Jin","Hanya pengecut yang bersembunyi di kota. Pasukanku juga baru kalah, mereka menginginkan kemenangan untuk meningkatkan moral, aku perlu lima ratus pasukan elit untuk mengalahkan mereka. ","Hanya pengecut yang bersembunyi di kota. Pasukanku juga baru kalah, mereka menginginkan kemenangan untuk meningkatkan moral, aku perlu lima ratus pasukan elit untuk mengalahkan mereka. ",},
        [4990] = {9604,"Niu Jin","Cao Ren","Baiklah, Niu Jin bawa lima ratus pasukan.","Baiklah, Niu Jin bawa lima ratus pasukan.",},
        [4991] = {9605,"Gan Ning","Zhou Yu","Aku akan mengecek pasukan dan bertempur langsung melawan Cao Ren.","Aku akan mengecek pasukan dan bertempur langsung melawan Cao Ren.",},
        [4992] = {9605,"Zhou Yu","Gan Ning","Jangan dulu untuk kali ini. Cao Hong berjaga di Yiling atas perintah Cao Ren. Kita di antara dua benteng. Aku meminta tiga ribu pasukan untuk merebut Yiling lebih dulu, baru kemudian jenderal bisa menyerang Nanjun.","Jangan dulu untuk kali ini. Cao Hong berjaga di Yiling atas perintah Cao Ren. Kita di antara dua benteng. Aku meminta tiga ribu pasukan untuk merebut Yiling lebih dulu, baru kemudian jenderal bisa menyerang Nanjun.",},
        [4993] = {9605,"Gan Ning","Zhou Yu","Baik, tiga ribu pasukan untukmu menyerang Yiling,","Baik, tiga ribu pasukan untukmu menyerang Yiling,",},
        [4994] = {9606,"Niu Jin","Cao Ren","Mata-mata melaporkan bahwa Gan Ning akan menyerang dengan tiga ribu pasukan elit.","Mata-mata melaporkan bahwa Gan Ning akan menyerang dengan tiga ribu pasukan elit.",},
        [4995] = {9606,"Niu Jin","Cao Ren","Jika Yiling kalah, Nanjun tidak akan bertahan. Kita harus membantu Yiling.","Jika Yiling kalah, Nanjun tidak akan bertahan. Kita harus membantu Yiling.",},
        [4996] = {9606,"Niu Jin","Cao Ren","Utus orang untuk memberitahukan Cao Hong, untuk berperan sebagai umpan di luar kota.","Utus orang untuk memberitahukan Cao Hong, untuk berperan sebagai umpan di luar kota.",},
        [4997] = {9606,"Niu Jin","Cao Ren","Sementara itu Cao Chun dan aku akan memimpin pasukan bala bantuan untuk Cao Hong.","Sementara itu Cao Chun dan aku akan memimpin pasukan bala bantuan untuk Cao Hong.",},
        [4998] = {9606,"Cao Ren","Niu Jin","Baik.","Baik.",},
        [4999] = {9607,"Cao Hong","Gan Ning","Xingba di sini, cepat serahkan Yiling.","Xingba di sini, cepat serahkan Yiling.",},
        [5000] = {9607,"Gan Ning","Cao Hong","Aku kenapa harus takut dengan perompak sepertimu.","Aku kenapa harus takut dengan perompak sepertimu.",},
        [5001] = {9608,"","Gan Ning","Aku tidak menyangka Cao Hong selemah ini, kalah hanya dalam 20 ronde.","Aku tidak menyangka Cao Hong selemah ini, kalah hanya dalam 20 ronde.",},
        [5002] = {9608,"","Gan Ning","Yiling kini aku rebut.","Yiling kini aku rebut.",},
        [5003] = {9609,"Gan Ning","Cao Hong","Bandit Jinfan, kamu mengira Yiling bisa direbut semudah itu?","Bandit Jinfan, kamu mengira Yiling bisa direbut semudah itu?",},
        [5004] = {9609,"Gan Ning","Niu Jin","Kamu sudah dikepung.","Kamu sudah dikepung.",},
        [5005] = {9609,"Gan Ning","Cao Ren","Mati kau sekarang!","Mati kau sekarang!",},
        [5006] = {9609,"Cao Ren","Gan Ning","Sial, aku terjebak!","Sial, aku terjebak!",},
        [5007] = {9701,"","Zhou Yu","Gan Ning terjebak di kota Yiling!","Gan Ning terjebak di kota Yiling!",},
        [5008] = {9701,"Zhou Yu","Cheng Pu","Aku sarankan untuk mengirimkan bala bantuan segera","Aku sarankan untuk mengirimkan bala bantuan segera",},
        [5009] = {9701,"Cheng Pu","Zhou Yu","Kita berada di lokasi strategis, jika mengirim pasukan bala bantuan, bagaimana jika nanti Cao Ren datang menyerang?","Kita berada di lokasi strategis, jika mengirim pasukan bala bantuan, bagaimana jika nanti Cao Ren datang menyerang?",},
        [5010] = {9701,"Zhou Yu","Lu Meng","Gan Xingba adalah jenderal penting bagi Jiangdong, bagaimana bisa kita tidak menyelamatkannya?","Gan Xingba adalah jenderal penting bagi Jiangdong, bagaimana bisa kita tidak menyelamatkannya?",},
        [5011] = {9701,"Lu Meng","Zhou Yu","Aku akan menyelamatkannya sendiri, tetapi siapa yang ditinggal di sini untuk menjaga?","Aku akan menyelamatkannya sendiri, tetapi siapa yang ditinggal di sini untuk menjaga?",},
        [5012] = {9701,"Zhou Yu","Lu Meng","Liu Gongji cocok untuk berjaga di sini, aku akan di depan, jenderal mengikuti di belakang. Dalam sepuluh hari, kita pasti menang.","Liu Gongji cocok untuk berjaga di sini, aku akan di depan, jenderal mengikuti di belakang. Dalam sepuluh hari, kita pasti menang.",},
        [5013] = {9701,"Lu Meng","Zhou Yu","Apakah kamu ingin menjadi komandan?","Apakah kamu ingin menjadi komandan?",},
        [5014] = {9701,"Zhou Yu","Ling Tong","Kalau waktu sepuluh hari, aku saja cukup untuk menang.","Kalau waktu sepuluh hari, aku saja cukup untuk menang.",},
        [5015] = {9701,"Ling Tong","Zhou Yu","Tinggalkan sepuluh ribu pasukan bersama Ling Tong, pasukan utama akan menyerang Yiling besok.","Tinggalkan sepuluh ribu pasukan bersama Ling Tong, pasukan utama akan menyerang Yiling besok.",},
        [5016] = {9701,"Zhou Yu","Lu Meng","Jalan kecil di selatan Yiling adalah jalan pintas. Kita kirim lima ratus pasukan untuk menebang pohon, dan memblokade jalan.","Jalan kecil di selatan Yiling adalah jalan pintas. Kita kirim lima ratus pasukan untuk menebang pohon, dan memblokade jalan.",},
        [5017] = {9701,"Zhou Yu","Lu Meng","Saat pasukan dikalahkan, pasti akan lewat jalan ini. Kuda tidak bisa melintas, kuda akan ditinggalkan di sana, kita rebut kudanya. ","Saat pasukan dikalahkan, pasti akan lewat jalan ini. Kuda tidak bisa melintas, kuda akan ditinggalkan di sana, kita rebut kudanya. ",},
        [5018] = {9701,"Lu Meng","Zhou Yu","Baik!","Baik!",},
        [5019] = {9702,"","Zhou Yu","Pasukan sudah tiba di Yiling, siapa berani menerobos dan menyelamatkan Gan Ning?","Pasukan sudah tiba di Yiling, siapa berani menerobos dan menyelamatkan Gan Ning?",},
        [5020] = {9702,"Zhou Yu","Zhou Tai","Biar aku saja!","Biar aku saja!",},
        [5021] = {9702,"Zhou Tai","Zhou Yu","Baik!","Baik!",},
        [5022] = {9703,"Gan Ning","Zhou Tai","Jenderal Zhou Tai di sini.","Jenderal Zhou Tai di sini.",},
        [5023] = {9703,"Zhou Tai","Gan Ning","Aku akan memerintahkan pasukan untuk bersiap menyambut dengan moral tinggi.","Aku akan memerintahkan pasukan untuk bersiap menyambut dengan moral tinggi.",},
        [5024] = {9704,"Cao Ren","Cao Hong","Kini kita kehilangan Yiling, moral dalam bahaya, mengapa tidak menggunakan siasat perdana menteri untuk membereskan masalah?","Kini kita kehilangan Yiling, moral dalam bahaya, mengapa tidak menggunakan siasat perdana menteri untuk membereskan masalah?",},
        [5025] = {9704,"Cao Hong","Cao Ren","Perkataanmu sesuai keinginanku.","Perkataanmu sesuai keinginanku.",},
        [5026] = {9704,"Cao Hong","Cao Ren","Hahahahaha.","Hahahahaha.",},
        [5027] = {9704,"Cao Hong","Cao Ren","Perdana menteri menyuruh kita masak di pukul 3 pagi, dan meninggalkan kota setelah menaruh bendera sebagai tipuan.","Perdana menteri menyuruh kita masak di pukul 3 pagi, dan meninggalkan kota setelah menaruh bendera sebagai tipuan.",},
        [5028] = {9704,"Cao Ren","Cao Hong","Rencana brilian.","Rencana brilian.",},
        [5029] = {9705,"","Cao Ren","Rencana perdana menteri sungguh jenius! Zhou Yu dan Gan Ning terjebak.","Rencana perdana menteri sungguh jenius! Zhou Yu dan Gan Ning terjebak.",},
        [5030] = {9705,"","Cao Ren","Pasukan Wu masuk ke dalam perangkap setelah menerobos masuk, lalu mati dihujani panah.","Pasukan Wu masuk ke dalam perangkap setelah menerobos masuk, lalu mati dihujani panah.",},
        [5031] = {9705,"","Cao Ren","Zhou Yu terpanah dan jatuh dari kuda saat hendak berbalik.","Zhou Yu terpanah dan jatuh dari kuda saat hendak berbalik.",},
        [5032] = {9706,"","Zhou Yu","Dari mana datangnya suara genderang dan teriakan?","Dari mana datangnya suara genderang dan teriakan?",},
        [5033] = {9706,"Zhou Yu","Gan Ning","Dari pasukan kita.","Dari pasukan kita.",},
        [5034] = {9706,"Gan Ning","Zhou Yu","Jangan membohongiku! Aku tahu pasukan Cao sering datang melakukan provokasi kepada kita. Berhubung kamu yang bertanggung jawab di sini, Cheng Demou, mengapa kamu duduk dan tidak melakukan apapun?","Jangan membohongiku! Aku tahu pasukan Cao sering datang melakukan provokasi kepada kita. Berhubung kamu yang bertanggung jawab di sini, Cheng Demou, mengapa kamu duduk dan tidak melakukan apapun?",},
        [5035] = {9706,"Zhou Yu","Cheng Pu","Gongjin terluka, medis memberitahuku untuk tidak membuatmu marah. Karena itu aku tidak melaporkanmu tentang aksi pasukan Cao.","Gongjin terluka, medis memberitahuku untuk tidak membuatmu marah. Karena itu aku tidak melaporkanmu tentang aksi pasukan Cao.",},
        [5036] = {9706,"Cheng Pu","Zhou Yu","Jika kamu tidak ingin berperang, lalu apa rencananya?","Jika kamu tidak ingin berperang, lalu apa rencananya?",},
        [5037] = {9706,"Zhou Yu","Cheng Pu","Kita harus kembali ke Jiangdong, setelah pulih, kita coba rebut lagi.","Kita harus kembali ke Jiangdong, setelah pulih, kita coba rebut lagi.",},
        [5038] = {9706,"Cheng Pu","Zhou Yu","Seorang pria harus merasa terhormat saat gugur berperang demi tuannya! Mengapa demi diriku seorang, mengabaikan urusan negara?","Seorang pria harus merasa terhormat saat gugur berperang demi tuannya! Mengapa demi diriku seorang, mengabaikan urusan negara?",},
        [5039] = {9707,"Zhou Yu","Cao Ren","Zhou Yu sang titik lemah, kamu akan segera menemui ajal, tidak akan berani melawan pasukanku!","Zhou Yu sang titik lemah, kamu akan segera menemui ajal, tidak akan berani melawan pasukanku!",},
        [5040] = {9707,"Cao Ren","Zhou Yu","Cao Ren sialan! Sini lawan aku kalau berani!","Cao Ren sialan! Sini lawan aku kalau berani!",},
        [5041] = {9707,"Zhou Yu","Cao Ren","Ayo sini melawanku!","Ayo sini melawanku!",},
        [5042] = {9707,"Cao Ren","Zhou Yu","Pan Zhang, maju.","Pan Zhang, maju.",},
        [5043] = {9708,"","Zhou Yu","Arrrgh! (Zhou Yu berteriak, mulutnya memuntahkan darah, terjatuh dari kuda.)","Arrrgh! (Zhou Yu berteriak, mulutnya memuntahkan darah, terjatuh dari kuda.)",},
        [5044] = {9708,"Zhou Yu","Cheng Pu","Bagaimana keadaanmu jenderal?","Bagaimana keadaanmu jenderal?",},
        [5045] = {9708,"Cheng Pu","Zhou Yu","Ini rencanaku.","Ini rencanaku.",},
        [5046] = {9708,"Zhou Yu","Cheng Pu","Strategi apa yang kamu punya?","Strategi apa yang kamu punya?",},
        [5047] = {9708,"Cheng Pu","Zhou Yu","Aku baik-baik saja, aku sengaja menunjukkan kepada pasukan Cao bahwa kondisiku buruk, mereka akan terkecoh.","Aku baik-baik saja, aku sengaja menunjukkan kepada pasukan Cao bahwa kondisiku buruk, mereka akan terkecoh.",},
        [5048] = {9708,"Cheng Pu","Zhou Yu","Kirim orang kepercayaan untuk berpura-pura menyerah, bilang bahwa aku telah mati. Malam ini Cao Ren akan menyerbu benteng dan kita akan menyergapnya, dia akan tertangkap kali ini.","Kirim orang kepercayaan untuk berpura-pura menyerah, bilang bahwa aku telah mati. Malam ini Cao Ren akan menyerbu benteng dan kita akan menyergapnya, dia akan tertangkap kali ini.",},
        [5049] = {9708,"Zhou Yu","Cheng Pu","Rencana hebat!","Rencana hebat!",},
        [5050] = {9709,"","Cao Ren","aku dengar Zhou Yu terluka parah dan mati saat kembali ke benteng. Pemakamannya sudah dilakukan oleh pasukan.","aku dengar Zhou Yu terluka parah dan mati saat kembali ke benteng. Pemakamannya sudah dilakukan oleh pasukan.",},
        [5051] = {9709,"","Cao Ren","Kita akan menyerbu malam ini, merebut mayatnya, memotong kepalanya, dan mengirimkan ke Xuchang.","Kita akan menyerbu malam ini, merebut mayatnya, memotong kepalanya, dan mengirimkan ke Xuchang.",},
        [5052] = {9709,"","Cao Ren","Niu Jin sebagai pionir, aku di tengah. Cao Hong dan Cao Chun sebagai bala bantuan, tinggalkan Chen Jiao dengan beberapa prajurit untuk menjaga kota, yang lainnya, ikut menyerbu.","Niu Jin sebagai pionir, aku di tengah. Cao Hong dan Cao Chun sebagai bala bantuan, tinggalkan Chen Jiao dengan beberapa prajurit untuk menjaga kota, yang lainnya, ikut menyerbu.",},
        [5053] = {9710,"Cao Ren","Cao Hong","Hanya ada bendera tanpa seorangpun di benteng.","Hanya ada bendera tanpa seorangpun di benteng.",},
        [5054] = {9710,"Cao Hong","Cao Ren","Gawat, kita terjebak, pasukan cepat kembali ke Xiangyang.","Gawat, kita terjebak, pasukan cepat kembali ke Xiangyang.",},
        [5055] = {9801,"Zhou Yu","Cheng Pu","Bendera sudah berserakan di bawah Nanjun, Zhao Zilong sudah merebut kota.","Bendera sudah berserakan di bawah Nanjun, Zhao Zilong sudah merebut kota.",},
        [5056] = {9801,"Cheng Pu","Zhou Yu","Apa! Bawa pasukan menyerang kota.","Apa! Bawa pasukan menyerang kota.",},
        [5057] = {9801,"Zhou Yu","Cheng Pu","Mereka menghujani panah, kita tidak bisa menyerang kota.","Mereka menghujani panah, kita tidak bisa menyerang kota.",},
        [5058] = {9801,"Cheng Pu","Zhou Yu","Gan Ning, pimpin ribuan kavaleri untuk merebut Jingzhou.","Gan Ning, pimpin ribuan kavaleri untuk merebut Jingzhou.",},
        [5059] = {9801,"Cheng Pu","Zhou Yu","Ling Tong, pimpin ribuan kavaleri untuk merebut Xiangyang, kita bisa merebut Nanjun lain kali.","Ling Tong, pimpin ribuan kavaleri untuk merebut Xiangyang, kita bisa merebut Nanjun lain kali.",},
        [5060] = {9802,"Zhou Yu","Cheng Pu","Lapor! Setelah Zhuge Liang mendapatkan Nanjun, menggunakan token pasukan, menipu pasukan Jingzhou untuk mengirimkan bala bantuan kemari.","Lapor! Setelah Zhuge Liang mendapatkan Nanjun, menggunakan token pasukan, menipu pasukan Jingzhou untuk mengirimkan bala bantuan kemari.",},
        [5061] = {9802,"Zhou Yu","Cheng Pu","Zhang Fei sudah merebut Jingzhou.","Zhang Fei sudah merebut Jingzhou.",},
        [5062] = {9802,"Cheng Pu","Zhou Yu","Apa!","Apa!",},
        [5063] = {9803,"Zhou Yu","Cheng Pu","Lapor! Xiahou Dun di Xiangyang tertipu oleh Zhuge Liang, bilang bahwa Cao Ren meminta bantuan, menarik pasukan keluar, lalu kemudian Yunchang merebut Xiangyang.","Lapor! Xiahou Dun di Xiangyang tertipu oleh Zhuge Liang, bilang bahwa Cao Ren meminta bantuan, menarik pasukan keluar, lalu kemudian Yunchang merebut Xiangyang.",},
        [5064] = {9803,"Zhou Yu","Cheng Pu","Liu Xuande merebut kota tanpa membuang tenaga.","Liu Xuande merebut kota tanpa membuang tenaga.",},
        [5065] = {9803,"Cheng Pu","Zhou Yu","Bagaimana cara Zhuge Liang mendapatkan Token Militer?","Bagaimana cara Zhuge Liang mendapatkan Token Militer?",},
        [5066] = {9803,"Zhou Yu","Cheng Pu","Dia mengendalikan Chen Jiao dan mendapatkannya darinya.","Dia mengendalikan Chen Jiao dan mendapatkannya darinya.",},
        [5067] = {9803,"Cheng Pu","Zhou Yu","Arrrgh! (Zhou Yu berteriak, lukanya terbuka.)","Arrrgh! (Zhou Yu berteriak, lukanya terbuka.)",},
        [5068] = {9803,"Zhou Yu","Cheng Pu","Cepat bawa jenderal kembali ke barak.","Cepat bawa jenderal kembali ke barak.",},
        [5069] = {9804,"Lu Su","Zhou Yu","Jika aku tidak membunuh Zhuge Liang si petani itu, aku tidak akan tenang!","Jika aku tidak membunuh Zhuge Liang si petani itu, aku tidak akan tenang!",},
        [5070] = {9804,"Lu Su","Zhou Yu","Untuk merebut kembali kota-kota tersebut, aku akan menangkap Liu Bei dan Zhuge Liang. Zijing, apakah mau membantuku?","Untuk merebut kembali kota-kota tersebut, aku akan menangkap Liu Bei dan Zhuge Liang. Zijing, apakah mau membantuku?",},
        [5071] = {9804,"Zhou Yu","Lu Su","Tidak bisa, kita sedang berperang dengan Cao Cao, belum jelas menang kalah. Tuan menyerang Hefei namun belum menaklukannya. Bagaimana jika Cao Cao mengambil keuntungan dengan menyerang kita saat kita memutus aliansi dengan Liu Bei? Kita akan dalam masalah.","Tidak bisa, kita sedang berperang dengan Cao Cao, belum jelas menang kalah. Tuan menyerang Hefei namun belum menaklukannya. Bagaimana jika Cao Cao mengambil keuntungan dengan menyerang kita saat kita memutus aliansi dengan Liu Bei? Kita akan dalam masalah.",},
        [5072] = {9804,"Zhou Yu","Lu Su","Juga Liu Xuande dulunya dekat dengan Cao Cao. Bagaimana jika pada akhirnya mereka berdua bersama menyerang Dongwu?","Juga Liu Xuande dulunya dekat dengan Cao Cao. Bagaimana jika pada akhirnya mereka berdua bersama menyerang Dongwu?",},
        [5073] = {9804,"Lu Su","Zhou Yu","Setelah semua rencana yang kita lakukan, kehilangan pasukan dan juga ransum, dia mengambil hadiahnya tanpa usaha, kan menyebalkan!","Setelah semua rencana yang kita lakukan, kehilangan pasukan dan juga ransum, dia mengambil hadiahnya tanpa usaha, kan menyebalkan!",},
        [5074] = {9804,"Zhou Yu","Lu Su","Gongjin harus sabar. Aku akan bertemu dan berdiskusi dengan Xuande. Jika tidak ada jalan keluar, saat itu pasukan akan menyerang.","Gongjin harus sabar. Aku akan bertemu dan berdiskusi dengan Xuande. Jika tidak ada jalan keluar, saat itu pasukan akan menyerang.",},
        [5075] = {9901,"Zhuge Liang","Lu Su","Tuanku penguasa Wu, dan juga jenderal Gongjin, memintaku untuk berdiskusi dengan Paman Imperial Liu. Sebelumnya, Cao Cao memimpin sejuta pasukan seakan untuk menyerang Jiangnan, sesungguhnya dia mengejarmu.","Tuanku penguasa Wu, dan juga jenderal Gongjin, memintaku untuk berdiskusi dengan Paman Imperial Liu. Sebelumnya, Cao Cao memimpin sejuta pasukan seakan untuk menyerang Jiangnan, sesungguhnya dia mengejarmu.",},
        [5076] = {9901,"Zhuge Liang","Lu Su","Berterimakasihlah pada Wu, Cao Cao berhasil dipukul mundur, dan Liu Bei pun selamat. Sembilan wilayah Jingzhou, semuanya harus menjadi milik Dongwu. ","Berterimakasihlah pada Wu, Cao Cao berhasil dipukul mundur, dan Liu Bei pun selamat. Sembilan wilayah Jingzhou, semuanya harus menjadi milik Dongwu. ",},
        [5077] = {9901,"Zhuge Liang","Lu Su","Tetapi dengan trik kotormu, merebut Jingzhou dan Xiangyang, mengakibatkan kerugian pasukan dan ransum bagi Jiangdong.","Tetapi dengan trik kotormu, merebut Jingzhou dan Xiangyang, mengakibatkan kerugian pasukan dan ransum bagi Jiangdong.",},
        [5078] = {9901,"Lu Su","Zhuge Liang","Zijing adalah cendekiawan cerdas, mengapa berkata demikian? Seperti yang kita tahu, kepemilikan harus dihargai. Sembilan wilayah Jingxiang, bukan milik Dongwu, mereka milik Liu.","Zijing adalah cendekiawan cerdas, mengapa berkata demikian? Seperti yang kita tahu, kepemilikan harus dihargai. Sembilan wilayah Jingxiang, bukan milik Dongwu, mereka milik Liu.",},
        [5079] = {9901,"Lu Su","Zhuge Liang","Tuanku adalah sepupu Jingsheng. Jingsheng meninggal tetapi anaknya masih hidup. Pamannya memiliki segala hak untuk merebutnya kembali untuknya, bukankah demikian?","Tuanku adalah sepupu Jingsheng. Jingsheng meninggal tetapi anaknya masih hidup. Pamannya memiliki segala hak untuk merebutnya kembali untuknya, bukankah demikian?",},
        [5080] = {9901,"Zhuge Liang","Lu Su","Jika kota diambil oleh Liu Qi, maka bisa dipahami. Tapi dia di Jiangxia, tidak di sini!","Jika kota diambil oleh Liu Qi, maka bisa dipahami. Tapi dia di Jiangxia, tidak di sini!",},
        [5081] = {9901,"Lu Su","Zhuge Liang","Apakah Zijing ingin menemuinya?","Apakah Zijing ingin menemuinya?",},
        [5082] = {9901,"Zhuge Liang","Lu Su","Baik!","Baik!",},
        [5083] = {9901,"Lu Su","Zhuge Liang","Kongming sekarang juga akan membawamu menemuinya.","Kongming sekarang juga akan membawamu menemuinya.",},
        [5084] = {9902,"Lu Su","Liu Qi","aku sakit, maaf aku tidak bisa menyambutmu Zijing. (Liu Qi berbaring di ranjang.)","aku sakit, maaf aku tidak bisa menyambutmu Zijing. (Liu Qi berbaring di ranjang.)",},
        [5085] = {9902,"Liu Qi","Lu Su","Bagaimana jika Tuan nanti meninggal?","Bagaimana jika Tuan nanti meninggal?",},
        [5086] = {9902,"Lu Su","Zhuge Liang","Kita akan mempertahankan kota selama Liu Qi masih hidup. Jika dia meninggal, bisa bernegosiasi ulang.","Kita akan mempertahankan kota selama Liu Qi masih hidup. Jika dia meninggal, bisa bernegosiasi ulang.",},
        [5087] = {9902,"Zhuge Liang","Lu Su","Jika dia meninggal, kamu harus mengembalikan kota ke Dongwu.","Jika dia meninggal, kamu harus mengembalikan kota ke Dongwu.",},
        [5088] = {9902,"Lu Su","Zhuge Liang","Cukup adil.","Cukup adil.",},
        [5089] = {9903,"Zhou Yu","Lu Su","Setelah Liu Qi meninggal, mereka akan mengembalikan kotanya ke Dongwu.","Setelah Liu Qi meninggal, mereka akan mengembalikan kotanya ke Dongwu.",},
        [5090] = {9903,"Lu Su","Zhou Yu","Liu Qi masih muda dan sehat, bagaimana dia bisa mati? Berapa lama kita harus menunggu sampai Jingzhou dikembalikan?","Liu Qi masih muda dan sehat, bagaimana dia bisa mati? Berapa lama kita harus menunggu sampai Jingzhou dikembalikan?",},
        [5091] = {9903,"Zhou Yu","Lu Su","Jenderal tenang saja. Serahkan semuanya padaku, aku pasti mengembalikan Jingxiang ke Dongwu.","Jenderal tenang saja. Serahkan semuanya padaku, aku pasti mengembalikan Jingxiang ke Dongwu.",},
        [5092] = {9903,"Lu Su","Zhou Yu","Zijing ada pemikiran apa?","Zijing ada pemikiran apa?",},
        [5093] = {9903,"Zhou Yu","Lu Su","Dari pengamatanku, Liu Qi tenggelam dalam arak dan wanita. Dia kini sakit, sesak nafas, batuk darah. Tidak lewat dari setengah tahun, dia akan mati.","Dari pengamatanku, Liu Qi tenggelam dalam arak dan wanita. Dia kini sakit, sesak nafas, batuk darah. Tidak lewat dari setengah tahun, dia akan mati.",},
        [5094] = {9903,"Zhou Yu","Lu Su","Saat itu kita akan mengklaim Jingzhou, Liu Bei tidak punya alasan untuk menolak.","Saat itu kita akan mengklaim Jingzhou, Liu Bei tidak punya alasan untuk menolak.",},
        [5095] = {9903,"Lu Su","Zhou Yu","Baik.","Baik.",},
        [5096] = {9904,"Liu Bei","Yi Ji","Mengapa tidak meminta saran cendekiawan jika ingin menguasai Jingzhou dalam waktu lama?","Mengapa tidak meminta saran cendekiawan jika ingin menguasai Jingzhou dalam waktu lama?",},
        [5097] = {9904,"Yi Ji","Liu Bei","Di mana aku bisa menemukan cendekiawan?","Di mana aku bisa menemukan cendekiawan?",},
        [5098] = {9904,"Liu Bei","Yi Ji","Kelima marga Ma bersaudara semuanya adalah cendekiawan. Termuda adalah Ma Su, nama lain Youchang. Yang terpandai adalah Ma Liang, nama lain Jichang.","Kelima marga Ma bersaudara semuanya adalah cendekiawan. Termuda adalah Ma Su, nama lain Youchang. Yang terpandai adalah Ma Liang, nama lain Jichang.",},
        [5099] = {9904,"Liu Bei","Yi Ji","Pepatah di antara para penduduk, kesemua lima Ma bersaudara, yang terhebat adalah alis putih. Mengapa Tuan tidak menemuinya untuk meminta nasihat?","Pepatah di antara para penduduk, kesemua lima Ma bersaudara, yang terhebat adalah alis putih. Mengapa Tuan tidak menemuinya untuk meminta nasihat?",},
        [5100] = {9904,"Yi Ji","Liu Bei","Undang dia kemari.","Undang dia kemari.",},
        [5101] = {9905,"Ma Liang","Liu Bei","Apakah Tuan memiliki siasat bagi kami untuk mempertahankan Jingxiang?","Apakah Tuan memiliki siasat bagi kami untuk mempertahankan Jingxiang?",},
        [5102] = {9905,"Liu Bei","Ma Liang","Jingzhou dikelilingi musuh, bukanlah wilayah yang tepat untuk tinggal berlama-lama. Aku sarankan untuk membuat Liu Qi sehat kembali, memanggil bawahan lamanya untuk kembali garnisun Jingzhou. Tunjuk Liu Qi sebagai sekretariat feudal Jingzhou untuk menenangkan penduduk.","Jingzhou dikelilingi musuh, bukanlah wilayah yang tepat untuk tinggal berlama-lama. Aku sarankan untuk membuat Liu Qi sehat kembali, memanggil bawahan lamanya untuk kembali garnisun Jingzhou. Tunjuk Liu Qi sebagai sekretariat feudal Jingzhou untuk menenangkan penduduk.",},
        [5103] = {9905,"Liu Bei","Ma Liang","Lalu taklukan Wuling, Changsha, Guiyang, dan Lingling, empat wilayah ini, kumpulkan uang dan ransum dari mereka. Ini bisa menjadi rencana jangka panjang.","Lalu taklukan Wuling, Changsha, Guiyang, dan Lingling, empat wilayah ini, kumpulkan uang dan ransum dari mereka. Ini bisa menjadi rencana jangka panjang.",},
        [5104] = {9905,"Ma Liang","Liu Bei","Wilayah mana yang harus kita kuasai dulu?","Wilayah mana yang harus kita kuasai dulu?",},
        [5105] = {9905,"Liu Bei","Ma Liang","Lingling yang terdekat, di barat sungai Xiang. Kemudian Wuling, Guilin, lalu Changsha yang terakhir. ","Lingling yang terdekat, di barat sungai Xiang. Kemudian Wuling, Guilin, lalu Changsha yang terakhir. ",},
        [5106] = {9905,"Ma Liang","Liu Bei","Baiklah! Kamu sebagai pejabat, Yi Ji menjadi wakilmu. Kirim Liu Qi kembali ke Xiangyang untuk menggantikan Yunchang.","Baiklah! Kamu sebagai pejabat, Yi Ji menjadi wakilmu. Kirim Liu Qi kembali ke Xiangyang untuk menggantikan Yunchang.",},
        [5107] = {9905,"Ma Liang","Liu Bei","Pimpin lima belas ribu pasukan untuk menyerang Lingling, Zhang Fei sebagai pionir, Zhao Yun sebagai bala bantuan, Kongming dan aku di tengah pasukan. Taruh Yunchang tetap di Jingzhou. Mi Zhu dan Liu Feng garnisun di Jiangling.","Pimpin lima belas ribu pasukan untuk menyerang Lingling, Zhang Fei sebagai pionir, Zhao Yun sebagai bala bantuan, Kongming dan aku di tengah pasukan. Taruh Yunchang tetap di Jingzhou. Mi Zhu dan Liu Feng garnisun di Jiangling.",},
        [5108] = {10001,"Xing Daorong","Zhuge Liang","Aku Zhuge Kongming, yang menghancurkan sejuta pasukan Cao Cao dengan trik kecilku. ","Aku Zhuge Kongming, yang menghancurkan sejuta pasukan Cao Cao dengan trik kecilku. ",},
        [5109] = {10001,"Xing Daorong","Zhuge Liang","Apakah kamu berpikir kamu mampu melawanku? Aku datang untuk memberikan penawaran, apakah tidak mau menyerah lebih awal?","Apakah kamu berpikir kamu mampu melawanku? Aku datang untuk memberikan penawaran, apakah tidak mau menyerah lebih awal?",},
        [5110] = {10001,"Zhuge Liang","Xing Daorong","Wu menang di Chibi karena rencana Zhou Lang, tidak ada hubungannya denganmu, beraninya kamu mengaku-ngaku!","Wu menang di Chibi karena rencana Zhou Lang, tidak ada hubungannya denganmu, beraninya kamu mengaku-ngaku!",},
        [5111] = {10001,"Zhuge Liang","Xing Daorong","Rasakan dulu senjataku!","Rasakan dulu senjataku!",},
        [5112] = {10002,"Xing Daorong","Zhao Yun","Apakah kamu mengenal Zhao Zilong?","Apakah kamu mengenal Zhao Zilong?",},
        [5113] = {10002,"Xing Daorong","Zhao Yun","Mau lari ke mana!","Mau lari ke mana!",},
        [5114] = {10002,"Zhao Yun","Xing Daorong","Ampuni aku Zilong!","Ampuni aku Zilong!",},
        [5115] = {10003,"Xing Daorong","Zhuge Liang","Jika kamu membantuku menangkap Liu Xian, aku akan mengampunimu.","Jika kamu membantuku menangkap Liu Xian, aku akan mengampunimu.",},
        [5116] = {10003,"Zhuge Liang","Xing Daorong","Aku akan melayanimu.","Aku akan melayanimu.",},
        [5117] = {10003,"Xing Daorong","Zhuge Liang","Kamu akan menggunakan cara apa untuk menangkapnya?","Kamu akan menggunakan cara apa untuk menangkapnya?",},
        [5118] = {10003,"Zhuge Liang","Xing Daorong","Penasihat jika melepaskaku, aku akan kembali dan menipunya. Malam ini penasihat membawa pasukan menyerang benteng, aku akan membantu dari dalam dengan menangkap Liu Xian hidup-hidup, setelah itu Liu Du akan otomatis ikut menyerah.","Penasihat jika melepaskaku, aku akan kembali dan menipunya. Malam ini penasihat membawa pasukan menyerang benteng, aku akan membantu dari dalam dengan menangkap Liu Xian hidup-hidup, setelah itu Liu Du akan otomatis ikut menyerah.",},
        [5119] = {10003,"Xing Daorong","Liu Bei","Mengapa aku harus percaya padamu?","Mengapa aku harus percaya padamu?",},
        [5120] = {10003,"Liu Bei","Xing Daorong","Ucapanku bisa dipegang!","Ucapanku bisa dipegang!",},
        [5121] = {10003,"Xing Daorong","Zhuge Liang","Aku percaya padamu Jenderal Xing, kembalilah.","Aku percaya padamu Jenderal Xing, kembalilah.",},
        [5122] = {10003,"Zhuge Liang","Xing Daorong","Terimakasih Kongming.","Terimakasih Kongming.",},
        [5123] = {10004,"Liu Xian","Xing Daorong","Liu Bei melepaskanku, menjadi mata-mata, hendak menangkapmu hidup-hidup, membuat Liu Du secara otomatis menyerah.","Liu Bei melepaskanku, menjadi mata-mata, hendak menangkapmu hidup-hidup, membuat Liu Du secara otomatis menyerah.",},
        [5124] = {10004,"Xing Daorong","Liu Xian","Apa yang harus kita lakukan?","Apa yang harus kita lakukan?",},
        [5125] = {10004,"Liu Xian","Xing Daorong","Kita mengikuti rencana mereka. Taruh pasukan di luar tetapi pasang bendera di dalam benteng, tunggu Kongming menyerah, kita tangkap dia.","Kita mengikuti rencana mereka. Taruh pasukan di luar tetapi pasang bendera di dalam benteng, tunggu Kongming menyerah, kita tangkap dia.",},
        [5126] = {10004,"Xing Daorong","Liu Xian","Baik.","Baik.",},
        [5127] = {10005,"Xing Daorong","Liu Xian","Pasukan di gerbang dengan obor, sambil membawa rerumputan, mereka hendak membakar benteng.","Pasukan di gerbang dengan obor, sambil membawa rerumputan, mereka hendak membakar benteng.",},
        [5128] = {10005,"Liu Xian","Xing Daorong","Kepung mereka dan tangkap Kongming.","Kepung mereka dan tangkap Kongming.",},
        [5129] = {10005,"Xing Daorong","Liu Xian","Baik!","Baik!",},
        [5130] = {10006,"Liu Xian","Xing Daorong","Kita mengejar sejauh sepuluh mil, tapi tidak menemukan siapapun.","Kita mengejar sejauh sepuluh mil, tapi tidak menemukan siapapun.",},
        [5131] = {10006,"Liu Xian","Xing Daorong","Gawat, kita terjebak, segera kembali ke benteng.","Gawat, kita terjebak, segera kembali ke benteng.",},
        [5132] = {10006,"Xing Daorong","Liu Xian","Kita tidak boleh memasuki benteng, takutnya sudah mereka kuasai.","Kita tidak boleh memasuki benteng, takutnya sudah mereka kuasai.",},
        [5133] = {10006,"Xing Daorong","Liu Xian","Mari serbu barak Kongming.","Mari serbu barak Kongming.",},
        [5134] = {10007,"Liu Xian","Zhao Yun","Kamu mau lari ke mana Liu Xian, cepat menyerah!","Kamu mau lari ke mana Liu Xian, cepat menyerah!",},
        [5135] = {10007,"Zhao Yun","Liu Xian","Aku menyerah!","Aku menyerah!",},
        [5136] = {10007,"Zhao Yun","Liu Xian","Xing Daorong yang menyuruhku berbuat demikian, ini bukan ideku.","Xing Daorong yang menyuruhku berbuat demikian, ini bukan ideku.",},
        [5137] = {10008,"Liu Du","Zhao Yun","Liu Xian sudah tertangkap, menyerahlah Liu Du. Jika tidak, kami akan membantai kota.","Liu Xian sudah tertangkap, menyerahlah Liu Du. Jika tidak, kami akan membantai kota.",},
        [5138] = {10008,"Liu Du","Liu Xian","Kong Ming tidak melukaiku, dia bahkan menawarkan arak padaku.","Kong Ming tidak melukaiku, dia bahkan menawarkan arak padaku.",},
        [5139] = {10008,"Liu Du","Liu Xian","Silahkan menyerah, Liu Du, bawa stempelmu.","Silahkan menyerah, Liu Du, bawa stempelmu.",},
        [5140] = {10008,"Liu Xian","Liu Du","Baiklah, aku bersedia menyerah ke Liu Xuande.","Baiklah, aku bersedia menyerah ke Liu Xuande.",},
        [5141] = {10008,"Liu Du","Zhuge Liang","Perintah Xuande, Liu Du ditunjuk sebagai hakim prefektur, Liu xian mengikuti pasukan ke Jingzhou.","Perintah Xuande, Liu Du ditunjuk sebagai hakim prefektur, Liu xian mengikuti pasukan ke Jingzhou.",},
        [5142] = {10008,"Zhuge Liang","Liu Du","Terimakasih atas kebaikan Kongming dan Liu Xuande!","Terimakasih atas kebaikan Kongming dan Liu Xuande!",},
    }
}

